import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as v,q as f}from"./chunks/framework.B1z0IdBH.js";const D={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},S=["href"],E={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,S)]),i("p",E,u(s.poem.context_page_description),1)])])])}const P=g(D,[["render",x],["__scopeId","data-v-85b02173"]]),M=JSON.parse(`[{"page_url":"https://es.wikipedia.org/wiki/Edificio_YPF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Edificio_YPF_acceso.jpg","page_title":"Edificio YPF","context_page_description":"El Edificio de Yacimientos Petrolíferos Fiscales es un edificio que sirvió como la sede central de YPF. Se encuentra sobre la Diagonal Norte, en el barrio de San Nicolás, ciudad de Buenos Aires. Fue declarado Monumento Histórico Nacional en 2010.\\nDesde 2011, es la casa central de la consultora Accenture en Buenos Aires."},{"page_url":"https://es.wikipedia.org/wiki/Crapatalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Crapatalus_novaezelandiae_%28New_Zealand_sand_stargazer%29.gif","page_title":"Crapatalus","context_page_description":"Crapatalus es un género de peces de la familia Leptoscopidae, del orden Perciformes. Este género marino fue descrito por primera vez en 1861 por Albert Günther."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%8F%D1%82%D1%8C%D1%81%D0%BE%D1%82_%D0%BC%D0%B0%D0%BD%D0%B0%D1%82%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/TM-2001-500manat-G%C3%B6rogly-b.png","page_title":"Пятьсот манатов","context_page_description":"Пятьсот манатов — номинал банкнот и монет азербайджанского маната и туркменского маната. В настоящее время выпускаются только памятные монеты."},{"page_url":"https://az.wikipedia.org/wiki/Grangea","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Grangea_maderaspatana_%28Madras_Carpet%29_W_IMG_9902.jpg","page_title":"Grangea","context_page_description":"Grangea — astraçiçəklilər sırasının mürəkkəbçiçəklilər fəsiləsinə aid biki cinsi."},{"page_url":"https://en.wikipedia.org/wiki/Toronto_Harbour","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Tugboat_G.W._Rogers_in_Toronto_in_1976.jpg","page_title":"Toronto Harbour","context_page_description":"Toronto Harbour or Toronto Bay is a bay on the north shore of Lake Ontario, in Toronto, Ontario, Canada. It is a natural harbour, protected from Lake Ontario waves by the Toronto Islands. Today, the harbour is used primarily for recreational boating, including personal vessels and pleasure boats providing scenic or party cruises. Ferries travel from docks on the mainland to the Islands, and cargo ships deliver aggregates and raw sugar to industries located in the harbour. Historically, the harbour has been used for military vessels, passenger traffic and cargo traffic. Waterfront uses include residential, recreational, cultural, commercial and industrial sites."},{"page_url":"https://it.wikipedia.org/wiki/Fine_dei_Romanov","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Russia_2078_%284091295048%29.jpg","page_title":"Fine dei Romanov","context_page_description":"Fine dei Romanov è un'espressione impiegata da svariati storici per designare l'insieme di omicidi politici compiuti dal nuovo potere sovietico su membri della ex famiglia imperiale. Dalla rivoluzione d'ottobre del 1917 ai primi del 1919 furono assassinate una ventina di persone di ambo i sessi, circa un terzo dei membri adulti della famiglia imperiale, a partire dal deposto imperatore Nicola II con tutta la sua famiglia e tutti coloro che li accompagnavano al seguito, tra cui Yevgeny Botkin, Anna Demidova, Alexei Trupp ed Ivan Kharitonov Secondo la versione ufficiale rilasciata dal governo rivoluzionario russo, i membri della famiglia imperiale russa vennero regolarmente giustiziati da un plotone di esecuzione per il terrore che la città potesse essere occupata dal movimento dei \\"bianchi\\". che avrebbe certamente salvato l'intera famiglia che ormai risultava un imbarazzante problema politico. Secondo diversi storici e ricercatori nel campo, l'ordine venne impartito da tre personaggi chiave Lenin, Yakov Sverdlov e Felix Dzerzhinsky. I corpi dei membri della famiglia imperiale e dei loro servitori vennero portati quindi nella foresta di Koptyaki dove vennero spogliati e mutilati."},{"page_url":"https://de.wikipedia.org/wiki/Landeshaus_K%C3%B6ln","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Landeshaus_des_LVR%2C_Rheinboulevard_K%C3%B6ln-Deutz-5894.jpg","page_title":"Landeshaus Köln","context_page_description":"Das Landeshaus Köln ist das Hauptgebäude des Landschaftsverbands Rheinland. Das Verwaltungsgebäude der Zentralverwaltung dieses höheren Kommunalverbandes liegt am Kennedy-Ufer 2 in Köln-Deutz, direkt am Rhein. Es entstand in den Jahren 1956 bis 1959 nach Plänen der Architekten Eckhard Schulze-Fielitz und Ernst von Rudloff unter Mitarbeit von Ulrich Schmidt von Altenstadt im Stil der Moderne."},{"page_url":"https://vi.wikipedia.org/wiki/Lachnolaimus_maximus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Hogfish.JPG","page_title":"Lachnolaimus maximus","context_page_description":"Lachnolaimus maximus là loài cá biển duy nhất thuộc chi Lachnolaimus trong họ Cá bàng chài. Loài này được mô tả lần đầu tiên vào năm 1792."},{"page_url":"https://cs.wikipedia.org/wiki/Thurn-Taxisov%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Wappen_Thurn_und_Taxis.svg","page_title":"Thurn-Taxisové","context_page_description":"Thurn-Taxisové jsou německý knížecí rod, který pochází ze severní Itálie. Do Čech přišli v první polovině 16. století.\\nV 17. století spojili tehdejší genealogové rod Taxis s ve středověku vymřelým italským rodem Torriani, protože používali příjmení della Torre. Proto jim bylo přiznáno právo spojit svůj erb s erbem a titulem Thurn-Valsassina."},{"page_url":"https://uk.wikipedia.org/wiki/Honda_CR-X","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Honda-CRX.jpg","page_title":"Honda CR-X","context_page_description":"Honda CR-X — спортивний автомобіль японської компанії Honda."},{"page_url":"https://ca.wikipedia.org/wiki/Faune_bru","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Hipparchia_statilinus_MHNT_CUT_2013_3_31_Fontanes_female_ventral.jpg","page_title":"Faune bru","context_page_description":"El faune bru és un lepidòpter ropalòcer de la família Nymphalidae."},{"page_url":"https://ro.wikipedia.org/wiki/Theofil_Sauciuc-S%C4%83veanu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Theofil_Sauciuc-S%C4%83veanu.jpg","page_title":"Theofil Sauciuc-Săveanu","context_page_description":"Theofil Sauciuc-Săveanu a fost un istoric român, membru corespondent al Academiei Române. A studiat Literele și Filosofia la Cernăuți și Viena. Profesor de filologie clasică și rector la Universitatea austriacă din Cernăuți, apoi profesor de epigrafie și decan al Facultății de Litere și Filozofie la Universitatea din București. Deputat și senator țărănist. A fost șef de săpături pe șantierul de la Callatis."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_356","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/NGC_0356_SDSS.jpg","page_title":"NGC 356","context_page_description":"NGC 356 galaxia espiral bat da, Cetus konstelazioan. Albert Marthek aurkitu zuen 1864ko irailaren 27an."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%A4%A9%E6%98%9F%E7%A2%BC%E9%A0%AD%E5%A4%9A%E5%B1%A4%E5%81%9C%E8%BB%8A%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Edinburgh_Place_2007.jpg","page_title":"天星碼頭多層停車場","context_page_description":"天星码头多层停车场，是香港岛中区中环爱丁堡广场9号的一个多层停车场，位于前中环天星码头以南毗邻。建于1957年，由当时工务局英国建筑师Ron Phillips 参与设计，为香港首个多层停车场。虽然天星码头已于2006年搬迁，但停车场名称未有改动。"},{"page_url":"https://fr.wikipedia.org/wiki/Gagan_Thapa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Gagan_Thapa_ICIMOD.jpg","page_title":"Gagan Thapa","context_page_description":"Gagan Thapa, né le 16 juillet 1976 à Katmandou, est un homme politique népalais, membre du Congrès népalais."},{"page_url":"https://no.wikipedia.org/wiki/Birkensykkel","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Tomac-00Buckshot.jpg","page_title":"Birkensykkel","context_page_description":"Birkensykkel er en moderne norsk betegnelse på en sykkel som egner seg særlig godt til sykkelritt med noe innslag av terreng i form av grus og lette krøtter-stier. Det bærer navn av Birkebeinerrittet, et grusritt som opplevde sterk økning i popularitet på begynnelsen av 2000-tallet.\\nEn mengde norske leverandører av sykler har versjoner i sitt sortiment som de karakteriserer som birkensykler. Syklene ser gjerne ut som vanlige terrengsykler, men kan ha smale dekk med lite mønster, og ellers utstyr som ikke egner seg godt for hard teknisk sykling i terreng. Syklene kan være av forskjellige prisklasser, fra lav til høy. Typiske andre karakteristika kan være klistremerker eller modellnavn som indikerer at produsenten mener sykkelen egner seg godt for grusritt med lav grad av sykkelteknisk utfordring."},{"page_url":"https://pl.wikipedia.org/wiki/Inflator","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Inflator.JPG","page_title":"Inflator","context_page_description":"Inflator – element sprzętu nurkowego, zwykle pojedyncze urządzenie umiejscowione na wysokości lewego ramienia, w postaci grubego karbowanego węża zakończonego głowicą. Głowica posiada przyłącze inflatorowe do węża średniego ciśnienia z szybkozłączką i przycisk: dodawczy i spustowy, służące do napełniania i opróżniania worka wypornościowego. Głowica posiada także ustnik służący do napełnienia worka wypornościowego za pomocą ust i upuszczania powietrza po naciśnięciu przycisku spustowego. Wewnątrz karbowanego węża może być prowadzone cięgno do dodatkowego zaworu spustowego, zlokalizowanego w miejscu połączenia inflatora z workiem wypornościowym na wysokości lewego ramienia.\\nNiekiedy inflator może być zintegrowany z dodatkowym drugim stopniem automatu oddechowego, a w niektórych konstrukcjach inflator może być pozbawiony karbowanego węża, a jego głowica jest wówczas zintegrowana z workiem wypornościowym w rejonie lewej kieszeni KRW."},{"page_url":"https://et.wikipedia.org/wiki/Luzerni_kanton","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Karte_Lage_Kanton_Luzern_2015.png","page_title":"Luzerni kanton","context_page_description":"Luzerni kanton on kanton Šveitsi keskosas.\\nLuzerni kantonis on 88 valda."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%AF%BA%E8%B4%9D%E5%B0%94%E7%94%9F%E7%90%86%E5%AD%A6%E6%88%96%E5%8C%BB%E5%AD%A6%E5%A5%96%E5%BE%97%E4%B8%BB%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Fredrick_banting.jpg","page_title":"诺贝尔生理学或医学奖得主列表","context_page_description":"諾貝爾生理學或醫學獎得主列表，是諾貝爾生理學或醫學獎的得主列表。\\n諾貝爾生理學或醫學獎於1901年首次頒發，得主是德國科學家埃米爾·阿道夫·馮·貝林。每一位獲獎者都會得到一塊獎牌，一份獲獎證書，以及一筆不菲的獎金，獎金的數額每年會有變化。例如，1901年，馮·貝林得到的獎金為150,782瑞典克朗，相當於2008年12月的7,731,004瑞典克朗；而2008年，哈拉爾德·楚爾·豪森、弗朗索瓦絲·巴爾-西諾西和呂克·蒙塔尼分享了總數為一千萬瑞典克朗的獎金。該獎於每年12月10日，即阿爾弗雷德·諾貝爾逝世周年紀念日，以隆重的儀式在斯德哥爾摩頒發。\\n諾貝爾生理學或醫學獎得主的研究領域分布相當廣。截至2000年，有13名獲獎者來自神經生物學領域，而有13名則在中間代謝研究中做出貢獻。1939年的獲獎者，德國人格哈德·多馬克，被其政府禁止領獎。雖然後來他得到了獎牌和獲獎證書，卻沒有得到獎金。截至2020年，共有12位女性獲得該獎項，人數僅次於17名的和平獎和14名的文學獎，是女性得主第三多的諾貝爾獎項，她們是格蒂·科里、羅莎琳·薩斯曼·耶洛、巴巴拉·麥克林托克、麗塔·列維-蒙塔爾奇尼、格特魯德·B·埃利恩、克里斯汀·紐斯林-沃爾哈德、琳達·巴克、弗朗索瓦絲·巴爾-西諾西、伊麗莎白·布萊克本、卡羅爾·格雷德、邁-布里特·莫澤和屠呦呦。截至2019年，共有219人獲得過諾貝爾生理學或醫學獎。該獎有9年因故停發，有5年延遲一年頒發。"},{"page_url":"https://it.wikipedia.org/wiki/Sostanza_naturale","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/J%C3%B6ns_Jacob_Berzelius_from_Familj-Journalen1873.png","page_title":"Sostanza naturale","context_page_description":"Una sostanza naturale è un composto chimico prodotto da un organismo vivente che di solito, ma non necessariamente, ha un'attività biologica o farmacologica. Una sostanza naturale può essere considerata tale anche se può essere preparata mediante sintesi totale. La definizione di sostanza naturale comprende sostanze pure costituite da atomi di natura differente o prodotti con composizione definita e uniforme. Prodotti naturali come piume, legno o cotone, sebbene siano costituiti da materiali di fatto naturali, non costituiscono miscele uniformi e pertanto non rientrano nella definizione. Tutte le sostanze inorganiche presenti in natura come i minerali o rocce non rientrano in questa definizione in quanto non prodotti da organismi viventi.\\nNel campo della chimica organica, come suggerito originariamente da Albrecht Kossel nel 1891 sulla base di un lavoro di Stahls sulla biochimica vegetale, la definizione di sostanze naturali è solitamente limitata a composti organici purificati isolati da fonti naturali che sono prodotti dalle vie metaboliche del metabolismo primario o secondario, e che come tale sono distinti come metaboliti primari e secondari."},{"page_url":"https://sk.wikipedia.org/wiki/Laeken","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Luc_Viatour_Bruxelles_tour_japonaise.JPG","page_title":"Laeken","context_page_description":"Laeken je obytná štvrť v Bruseli v Belgicku. Nachádza sa tu Belgický kráľovský palác, v ktorom sídli kráľovská rodina.\\n14. – 15. decembra 2001 sa tu konal Samit v Laekene"},{"page_url":"https://sl.wikipedia.org/wiki/Antwerpen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Osias_Beert_the_Elder_-_Dishes_with_Oysters%2C_Fruit%2C_and_Wine_-_Google_Art_Project.jpg","page_title":"Antwerpen","context_page_description":"Antwerpen je flamsko mesto v Belgiji in je glavno mesto province Antwerpen v regiji Flandrija. S 520.504 prebivalci, je najgosteje naseljeno mesto v Belgiji. Njegovo metropolitansko območje ima okrog 1.200.000 ljudi, kar pomeni, da je po velikosti takoj za Brusljem.\\nAntwerpen leži ob reki Šeldi, ki ga s Severnim morjem povezuje estuarij Zahodne Šelde. Je približno 40 km severno od Bruslja in približno 15 km od nizozemske meje. Pristanišče je po velikosti med prvimi 20 na svetu in drugo v Evropi. Ima tudi najstarejšo borzno stavbo na svetu, prvič zgrajeno leta 1531, ponovno leta 1872, od leta 1997 pa je opuščena.\\nDolgo je bilo pomembno gospodarsko in kulturno mesto v državah na območju današnjega Beneluksa, še posebej pred špansko furijo ob nizozemskem uporu. Prebivalci Antwerpna imajo vzdevek sinjoren, po španskem señor ali francoskem seigneur in se nanaša na španske plemiče, ki so vladali v 17. stoletju. Danes je Antwerpen veliko trgovsko in kulturno središče in je drugo najbolj večkulturno mesto na svetu s 170 narodnostmi. Znan je tudi kot svetovna prestolnica diamantov s svojim velikim okrožjem diamantov. Mesto je gostilo poletne olimpijske igre leta 1920."},{"page_url":"https://vi.wikipedia.org/wiki/Ho%C3%A0ng_h%E1%BA%ADu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Empress_Michiko_cropped_20140424.jpg","page_title":"Hoàng hậu","context_page_description":"Hoàng hậu là danh hiệu dành cho chính thê của Hoàng đế, do Hoàng đế sắc phong. Danh hiệu này tồn tại trong thế giới đồng văn Đông Á, bao gồm Trung Quốc, Nhật Bản, Hàn Quốc và Việt Nam.\\nHoàng hậu nắm giữ địa vị cao quý nhất và là nguyên phối chính thức được cử hành nghi thức đại hôn với Hoàng đế. Danh hiệu Hoàng hậu cũng có thể được truy phong cho phi tần là sinh mẫu của Tân đế mặc dù họ chưa từng là Hoàng hậu. Trong ngôn ngữ Việt Nam hiện đại, [Hoàng hậu] thường bị dùng để chỉ chung [vợ của Vua], từ Quốc vương đến Hoàng đế không phân biệt tước vị, điều này dẫn đến nhiều mâu thuẫn trong dịch thuật."},{"page_url":"https://es.wikipedia.org/wiki/Estadio_de_Nervi%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Estadio_de_Nervi%C3%B3n.jpg","page_title":"Estadio de Nervión","context_page_description":"El Estadio de Nervión fue un estadio multipropósito situado en el barrio del mismo nombre de la ciudad de Sevilla. Inaugurado en 1928, tenía capacidad para 23 000 espectadores, y fue clausurado en 1958, siendo sustituido por el Estadio Ramón Sánchez-Pizjuán como sede del Sevilla F.C.. El Sánchez Pizjuán se encuentra junto al viejo Nervión, que había sustituido a su vez al Estadio Reina Victoria como sede del Sevilla.​"},{"page_url":"https://fr.wikipedia.org/wiki/Pale_di_San_Martino","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Rifugio_Pedrotti.JPG","page_title":"Pale di San Martino","context_page_description":"Les Pale di San Martino forment le plus vaste groupe montagneux des Dolomites, avec une superficie d'environ 240 km². Situé à cheval entre le Trentin et la Vénétie, elles s'élèvent entre les vallées de Primiero, du Biois et du Cordevole, dans le secteur central des Dolomites.\\nLe plateau des Pale s'étend sur environ 50 km, formant un grand plateau rocheux et presque lunaire, qui oscille entre 2 500 et 2 800 m d'altitude.\\nLa partie du groupe située dans le Trentin est entièrement incluse dans le parc naturel de Paneveggio - Pale di San Martino. Selon certaines sources, le groupe a inspiré l'écrivain Dino Buzzati dans le cadre de son roman Le désert des Tartares.\\nLe système géologique des Pale est inclus dans le site Les Dolomites, déclaré en 2009 site du patrimoine mondial par l'UNESCO."},{"page_url":"https://en.wikipedia.org/wiki/List_of_highways_in_Webb_County,_Texas","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Laredo_IH35-Loop_20_Intersection.jpg","page_title":"List of highways in Webb County, Texas","context_page_description":"The following is a list of all state highways in Webb County, Texas, maintained by the Texas Department of Transportation. All state highways in Texas are paved. In the future Webb County will be the United States terminus of the North American Supercorridor, Interstate 69, and The Ports to Plains Trade Corridor. The Texas Department of Transportation Laredo District is preparing for future growth by turning Loop 20 into a freeway by building overpasses at major intersections and on / off ramps. The Webb County - City of Laredo Regional Mobility Authority has responsibility for a comprehensive transport system in the region."},{"page_url":"https://de.wikipedia.org/wiki/Musikjahr_1865","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Stanis%C5%82a%C5%AD_Maniu%C5%A1ka._%D0%A1%D1%82%D0%B0%D0%BD%D1%96%D1%81%D0%BB%D0%B0%D1%9E_%D0%9C%D0%B0%D0%BD%D1%8E%D1%88%D0%BA%D0%B0_%281865%29.jpg","page_title":"Musikjahr 1865","context_page_description":"17. Februar: Die Uraufführung der Oper Der Deserteur von Ferdinand Hiller auf das Libretto von Ernst Pasqué findet in Köln statt.\\n14. März: Eine revidierte Fassung der 1847 entstandenen Oper Macbeth von Giuseppe Verdi hat ihre Uraufführung am Théâtre-Lyrique in Paris. In dieser französischen Fassung hat Verdi einige Stücke überarbeitet und das für das Pariser Publikum notwendige Ballett eingefügt.\\n15. April: Die Oper Le Bœuf Apis von Léo Delibes hat ihre Uraufführung am Théâtre des Bouffes-Parisiens in Paris.\\n28. April: Die Uraufführung der Großen Oper L'Africaine von Giacomo Meyerbeer findet an der Pariser Oper statt. Sowohl der Komponist als auch der Librettist Eugène Scribe sind beim triumphalen Erfolg der Oper bereits verstorben. Auch die deutsche Erstaufführung am 18. November in Berlin wird ein Erfolg.\\n21. Mai: Die Uraufführung des lyrischen Dramas Der Cid von Peter Cornelius erfolgt am Hoftheater Weimar.\\n10. Juni: Im Königlichen Hof- und Nationaltheater in München wird Wagners Tristan und Isolde unter der Leitung von Hans von Bülow mit triumphalem Erfolg uraufgeführt. Malvina Schnorr von Carolsfeld singt die Isolde."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%96%E5%8B%99%E5%A4%A7%E8%87%A3_(%E6%97%A5%E6%9C%AC)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Michitomi_Higashikuze.jpg","page_title":"外務大臣 (日本)","context_page_description":"外務大臣是主管日本外務省的國務大臣，簡稱外相。為內閣中最重要的職位之一，通常由執政黨內的實力派國會議員擔任，有時還會兼任副首相。在日本歷史上，許多曾擔任過外務大臣的議員到後來成為首相。由於外務大臣的重要性，還有許多首相任內兼任外務大臣。\\n外務大臣的職權有：\\n主持外務省業務，協助首相擬定對外政策和計劃，並予以貫徹執行；\\n協助對外關係的各種日常事務；\\n指導、檢查、監督外務省和駐外使館館員的工作；\\n向國會報告外交工作等。\\n外務大臣和內閣總理大臣是自1885年實行內閣制以後僅有的名稱沒有變更過的國務大臣職位。\\n如果首相有事、出訪或生病，在沒有副首相的情況下，有可能會指定外務大臣代理首相職務。"},{"page_url":"https://fi.wikipedia.org/wiki/Kelly_LeBrock","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Kelly_LeBrock_%28cropped%29.jpg","page_title":"Kelly LeBrock","context_page_description":"Kelly LeBrock on yhdysvaltalainen näyttelijä."},{"page_url":"https://tr.wikipedia.org/wiki/Polykarp_Kusch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Polykarp_Kusch.jpg","page_title":"Polykarp Kusch","context_page_description":"Polykarp Kusch Alman-Amerikalı Nobel Fizik Ödülü sahibi fizikçi.\\n1955 yılında elektronların manyetik hareketlenmesinin teorik değerlerden daha hızlı olduğunu gösteren çalışması ile Willis Eugene Lamb ile beraber Nobel Fizik Ödülü'ne layık görülmüştür.\\nKariyerinin çoğunu New York'ta Columbia Üniversitesi'nde geçirmiştir. Burada lazerin mucidi olan Gordon Gould'un doktora programının gözlemcisi olarak da çalışmıştır.\\nCleveland, Ohio'daki Case Western Reserve Ünivesitesi'nin güney kampüsü onun adıyla anılmaktadır. Buradaki bina Kusch House olarak adlandırılmıştır."},{"page_url":"https://nl.wikipedia.org/wiki/Station_Exeter_Central","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/2008_at_Exeter_Central_station_-_Queen_Street_entrance.jpg","page_title":"Station Exeter Central","context_page_description":"Exeter Central is een spoorwegstation van National Rail in Exeter, Exeter in Engeland. Het station is eigendom van Network Rail en wordt beheerd door First Great Western. Het station is geopend in 1860."},{"page_url":"https://de.wikipedia.org/wiki/Wechselbl%C3%A4ttriges_Milzkraut","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Chrysosplenium_alternifolium_fruit_seeds_kz.jpg","page_title":"Wechselblättriges Milzkraut","context_page_description":"Das Wechselblättrige Milzkraut, auch Gold-Milzkraut, Wechselblatt-Milzkraut oder Krätzenblume genannt, ist eine Pflanzenart aus der Familie der Steinbrechgewächse."},{"page_url":"https://simple.wikipedia.org/wiki/Chicago_Bulls","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/BennyBull.JPG","page_title":"Chicago Bulls","context_page_description":"Chicago Bulls are an American professional basketball team. They play in Chicago, Illinois at the United Center. The Bulls are a part of the National Basketball Association. They were named the Bulls in reference to the Chicago Union Stockyards, which was once a major business in Chicago. The current head coach is Fred Hoiberg.\\nMichael Jordan played for the Chicago Bulls from 1984 until 1993 and from 1995 until 1998, leading the team to six NBA championships. In the 21st Century, Derrick Rose was the star of the Bulls until his injuries prevented him to play."},{"page_url":"https://nl.wikipedia.org/wiki/Materieel_van_Arriva_Personenvervoer_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Arriva_5746.JPG","page_title":"Materieel van Arriva Personenvervoer Nederland","context_page_description":"Dit artikel geeft in twee tabellen een overzicht van al het materieel dat bij het Nederlandse vervoerbedrijf Arriva in het stads- en streekvervoer en in het treinvervoer in dienst is of is geweest. De bussen en treinen staan standaard vermeld in numerieke volgorde, maar kunnen desgewenst gesorteerd worden op bouwjaar, type of status."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B2%99%E7%89%B9%E9%98%BF%E6%8B%89%E4%BC%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Jeddah-seaport-saudiarabia.PNG","page_title":"沙特阿拉伯","context_page_description":"沙烏地阿拉伯，或譯沙特阿拉伯、沙地阿拉伯，全稱沙烏地阿拉伯王國，簡稱沙烏地，是一個位於西亞阿拉伯半島的阿拉伯人國家。面積2,149,690平方公里，它是在阿拉伯世界中地理面積第二大的國家，僅次於阿爾及利亞。沙烏地阿拉伯北方與約旦和伊拉克接壤；東北與科威特接壤；東邊和卡達、巴林及阿拉伯聯合大公國交界；東南方和阿曼接壤；南方則與葉門交界。它是唯一一個同時擁有紅海和波斯灣海岸線的國家，而它大部分的土地由不宜居的沙漠及貧瘠的荒野組成。現時沙烏地阿拉伯由四個本來分明的區域——漢志、內志、部分東阿拉伯半島和部分南阿拉伯半島組成。\\n沙烏地阿拉伯王國是於1932年由伊本·沙烏地成立，他由1902年奪回沙烏地王朝歷史領地利雅德開始，相繼以征服統一了以上的四個區域。該國從此便一直是以根據伊斯蘭主義原則、以君主專制的形式管治。瓦哈比派這一被定為國教的極端保守伊斯蘭教派別亦被稱為「沙烏地文化的首要特徵」，並隨著其政策在全世界範圍內傳播。沙烏地阿拉伯有時被稱為「兩聖寺之地」，因它的範圍包括了伊斯蘭教中兩個最神聖的聖地：麥加的禁寺及麥地那的先知寺。作為一個政治上極端保守，並採用政教合一的獨裁政權，沙烏地阿拉伯對女性權利的限制極多，隨著下一代國王即位後近年來不平等現象已經較為緩和，並仍採用酷刑和殘忍的死刑行刑方法。\\n沙烏地阿拉伯是世界上石油生產量及輸出量最高的國家，它同時亦控制了全球第二大的烴儲藏。由於有石化燃料支持經濟，沙烏地阿拉伯被列為高收入經濟體之一，人類發展指數亦極高，且是唯一在二十國集團中的阿拉伯國家。但是，它在海灣阿拉伯國家合作委員會成員中擁有最單一的經濟。沙烏地阿拉伯的國防開支在世界排行第四，在2010至2014年斯德哥爾摩國際和平研究所曾為世界第二大軍備進口者。它常被視為地域大國和中等強國。除了海灣阿拉伯國家合作委員會，它亦是伊斯蘭合作組織和石油輸出國家組織的成員。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D0%B0%D0%B2%D0%B8%D1%88%D1%82%D0%B0_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Boavista_pantera.jpg","page_title":"Боавишта (футбольный клуб)","context_page_description":"«Боави́шта» — португальский профессиональный футбольный клуб из Порту, основанный в 1903 году. Клуб провёл 50 сезонов в высшей лиге страны, причём с сезона 1969/70 и до 2007/08 играл в ней 39 лет подряд, когда был принудительно переведён во вторую лигу по результатам расследования футбольного коррупционного скандала 2003—2004 годов Apito Dourado. В апреле 2014 г. по решению Федерации футбола Португалии «Боави́шта» восстановлена в статусе профессионального клуба и в новом сезоне будет выступать в Лиге Сагриш."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AA%E0%A7%8D%E0%A6%B0%E0%A6%A4%E0%A7%8D%E0%A6%AF%E0%A7%87%E0%A6%95%E0%A7%87%E0%A6%B0_%E0%A6%A5%E0%A7%87%E0%A6%95%E0%A7%87_%E0%A6%A4%E0%A6%BE%E0%A6%81%E0%A6%B0_%E0%A6%B8%E0%A6%BE%E0%A6%AE%E0%A6%B0%E0%A7%8D%E0%A6%A5%E0%A7%8D%E0%A6%AF_%E0%A6%85%E0%A6%A8%E0%A7%81%E0%A6%B8%E0%A6%BE%E0%A6%B0%E0%A7%87,_%E0%A6%AA%E0%A7%8D%E0%A6%B0%E0%A6%A4%E0%A7%8D%E0%A6%AF%E0%A7%87%E0%A6%95%E0%A6%95%E0%A7%87_%E0%A6%A4%E0%A6%BE%E0%A6%81%E0%A6%B0_%E0%A6%AA%E0%A7%8D%E0%A6%B0%E0%A6%AF%E0%A6%BC%E0%A7%8B%E0%A6%9C%E0%A6%A8_%E0%A6%85%E0%A6%A8%E0%A7%81%E0%A6%B8%E0%A6%BE%E0%A6%B0%E0%A7%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Socrates.png","page_title":"প্রত্যেকের থেকে তাঁর সামর্থ্য অনুসারে, প্রত্যেককে তাঁর প্রয়োজন অনুসারে","context_page_description":"\\"প্রত্যেকের থেকে তাঁর সামর্থ্য অনুসারে, প্রত্যেককে তাঁর প্রয়োজন অনুসারে\\" একটি শ্লোগান যা লুই ব্ল্যাংক প্রথম ১৮৫১ সালে ব্যবহার করেছিলেন। পরে এই শ্লোগানের আগের একটি রূপ এটিয়েন গেব্রিয়েল মরেলির দ্য কোড অব নেচারে দৃশ্যমান হয়েছিল। এই শ্লোগানকে কার্ল মার্ক্স ১৮৭৫এ নিজের গোথা কর্মসূচির সমালোচনায় জনপ্রিয় করে তুলেছিলেন। নীতিটি পণ্য, পুঁজি এবং সেবার মুক্ত উপলব্ধি এবং বিতরণ বোঝায়। মার্ক্সবাদী দর্শন তেমনিভাবে হয় এক উন্নত সাম্যবাদী ব্যবস্থায় উৎপাদিত পণ্য এবং সেবার উভয় দিক দিয়ে। সমাজবাদের পূর্ণ বিকাশ এবং অত্যুন্নত উৎপাদন শক্তি একে বাস্তবায়িত করার কথা বলে।"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84_%D8%A8%D9%88%D8%B1%D8%BA%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Burgess_2163735434_2f49595db7_o.jpg","page_title":"بيل بورغس","context_page_description":"بيل بورغس ‏ هو مدرب رياضي وسباح بريطاني، ولد في 15 يونيو 1872 في Rotherham في المملكة المتحدة، وتوفي في 5 يوليو 1950 في باريس في فرنسا."},{"page_url":"https://de.wikipedia.org/wiki/Stammstrecke_3_(Stadtbahn_Dortmund)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Dsw151heinrichstrasse151005.jpg","page_title":"Stammstrecke 3 (Stadtbahn Dortmund)","context_page_description":"Die Stammstrecke III ist eine von drei Stammstrecken der Stadtbahn in Dortmund. Sie führt von Westen nach Osten. Der Stadtbahnbetrieb wurde am 27. April 2008 aufgenommen, auch wenn die Strecke zu Beginn mit den vorherigen Straßenbahnwagen des Typs N8C und nun mit niederflurigen Stadtbahnwagen, die in anderen Städten als Straßenbahnwagen gelten, bedient wird."},{"page_url":"https://fr.wikipedia.org/wiki/Sahr-i-Bahlol","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Head_of_a_bodhisattva%2C_Gandhara%2C_Pakistan%2C_Sahri_Bahlol%2C_c._100_AD%2C_schist_-_San_Diego_Museum_of_Art_-_DSC06345.JPG","page_title":"Sahr-i-Bahlol","context_page_description":"Sahr-i-Bahlol est un site historique, constitué d'un village fortifié sur une botte surélevée de 9m par rapport à la plaine agricole qui l'entoure. Il est situé près des ruines du monastère bouddhique de Takht-i-Bahi qui date de la même époque, à environ 70 km au nord-ouest de Peshawar, capitale de la province de Khyber Pakhtunkhwa du Pakistan. Il est sur la liste du patrimoine mondial de l'UNESCO depuis 1980.\\nSituées sur une petite sur-élévation au milieu d'une région dévolue à l'agriculture, les ruines sont souvent excavées illégalement par les habitants des environs pour vendre les objets anciens."},{"page_url":"https://es.wikipedia.org/wiki/Oteros_de_Boedo","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Vista_desde_el_monte.jpg","page_title":"Oteros de Boedo","context_page_description":"Oteros de Boedo es una localidad y también una pedanía españolas de la comarca natural de Boedo-Ojeda en la Provincia de Palencia, comunidad autónoma de Castilla y León, España, pertenece al municipio de Collazos de Boedo"},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Dukovanech","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Dukovany_barokn%C3%AD_z%C3%A1mek.jpg","page_title":"Seznam kulturních památek v Dukovanech","context_page_description":"Tento seznam nemovitých kulturních památek v obci Dukovany v okrese Třebíč vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://hu.wikipedia.org/wiki/Nemzetk%C3%B6zi_rep%C3%BCl%C5%91terek_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Addis_Abeba_Airport_b.7.jpg","page_title":"Nemzetközi repülőterek listája","context_page_description":"Ez a lista alapvetően olyan repülőtereket tartalmaz, amelyek szerepelnek a Wikidatában és ott nemzetközi repülőtérként vannak megjelölve, ami nem feltétlenül jelenti azt, hogy valóban nemzetközi repülőterek, vagy hogy minden ilyen repülőtér szerepelne a listában."},{"page_url":"https://hu.wikipedia.org/wiki/Virandeville","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/%C3%89glise_Saint-Amand_de_Virandeville_%284%29.JPG","page_title":"Virandeville","context_page_description":"Virandeville település Franciaországban, Manche megyében. Lakosainak száma 794 fő. +/- Virandeville Teurthéville-Hague, Couville, Saint-Christophe-du-Foc és Sideville községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/BMW_E3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/BMW_2500-E3_Rear-view.JPG","page_title":"BMW E3","context_page_description":"Der intern als E3 bezeichnete PKW war ein Modell der Oberklasse von BMW, das im Herbst 1968 auf dem Markt erschien. Die Wagen mit Sechszylinder-Reihenmotoren waren die Nachfolger des 1964 eingestellten „Barockengels“ BMW 3200 S mit V8-Motor.\\nDer E3 war zugleich das erste Fahrzeug von BMW mit der Werkscodebezeichnung „E“ und sollte gegen die S-Klasse von Daimler-Benz und die KAD-Baureihe von Opel antreten.\\nDer Nachfolger des E3 war die im Mai 1977 vorgestellte erste 7er-Reihe vom Typ E23."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BA%A2%E8%8C%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Solanum_integrifolium_Poir.JPG","page_title":"红茄","context_page_description":"红茄，别名：观赏茄、南瓜茄、非洲红茄、冬海红、扁茄、金茄、车轮苦瓜，为茄科茄属下的一个种。"},{"page_url":"https://sr.wikipedia.org/wiki/Frontotemporalna_lobarna_degeneracija","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Histology_of_frontotemporal_lobar_degeneration.jpg","page_title":"Frontotemporalna lobarna degeneracija","context_page_description":"Frontotemporalna lobarna degeneracija je naziv za kliničku sliku koji obuhvata skup različitih neurodegenerativnih bolesti koje zahvataju čeone i slepoočne režnjeve mozga, sa primarnim obeležjima poput poremećenog ponašanja i poteškoća u jezičkim sposobnostima. Ona je neuropatološki supstrat većine frontotemporalnih demencija, koja se javlja kod bolesnika do 65. godine života, čineći time tok bolesti posebno teškim koji ostavlja osobu bez osnovnih ljudskih karakteristika, često u vrhuncu njihovog života.\\nKod oko polovine obolelih u njenoj osnovi se nalazi nasledna bolest, koja se povezuje najčešće sa mutacijom MAPT gena.\\nPo učestalosti druga je vrsta demencije uz Alchajmerovu bolest, od koje se razlikuje po tome što amnestički sindrom nije dominantan u ranijim stadijumima bolesti.\\nBolest obuhvata spektar klinički, patološki i genetski raznličitih neurodegenerativnih poremećaja mozga, kod kojih se u zavisnosti od anatomske raspodele patoloških promena može razlikovati više kliničkih sindroma: bihevioralna varijanta FTLD-a, progresivna nefluentna afazija, semantička demencija i dr."},{"page_url":"https://fi.wikipedia.org/wiki/Neulam%C3%A4ki","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Neulam%C3%A4ki.jpg","page_title":"Neulamäki","context_page_description":"Neulamäki on kaupunginosa Kuopiossa noin 4–5 kilometriä keskustasta lounaaseen. Asukkaita Neulamäessä on noin 5 500. Asukkaiden keski-ikä on vain noin 35 vuotta. Neulamäki on nimensä mukaan korkea mäki. Se on myös Kuopion korkeimmalla merenpinnasta oleva asutusalue. Alue on rakennettu pääosin 1980-luvulla.\\nAlue jakautuu Neulamäen asuntoalueeseen ja teollisuusalueeseen. Myös Kuopion tiedepuisto sijaitsee lähistöllä. Neulamäkeen on sijoittunut noin 1 800 työpaikkaa.\\nAsuntokanta on monipuolinen, sillä se koostuu sekä rivi-, kerros- että omakotitaloista. Alueella asuu paljon opiskelijoita, joista osa ei ole kirjoilla Kuopiossa, joten alueen todellinen asukasluku on huomattavasti suurempi. Kuopaksen suurin asuntokanta sijoittuu Neulamäkeen.\\nNeulamäessä on päiväkoteja, ala- ja yläasteen koulut sekä nuorisotalo, joka tunnetaan myös nimellä Rytö. Alueella on myös monipuolinen lähipalvelukeskus, josta löytyy kauppoja, kirjasto, apteekki, ravintola, neuvola ja hammashoitola. Neulamäessä on myös Neulamäen kirkko, joka kuuluu Alavan seurakuntaan Särkiniemen ja Alavan kaupunginosien kanssa."},{"page_url":"https://ca.wikipedia.org/wiki/Tewodros_II_d%27Eti%C3%B2pia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/A_lancer_of_Tigre_colour.jpg","page_title":"Tewodros II d'Etiòpia","context_page_description":"Tewodros II d'Etiòpia -en alfabet amhàric, ቴዎድሮስ, batejat com Theodore II- fou un emperador d'Abissínia avui en dia Etiòpia que va regnar entre l'11 de febrer del 1855 i el 13 d'abril del 1868.\\nVa néixer amb el nom de Kassa haile Giorgis' però normalment es refereix a ell com Kassa Hailu (ካሳ ኃይሉ). També fou conegut sota el nom de cavaller Abba Tateq i per raó de les seva expansió militar, va tenir el sobrenom de Meysaw (el coratjós). El seu regnat sovint és considerat com el començament de l'Etiòpia moderna, finalitzant el període de descentralització Zemene Mesafint (Era dels Prínceps).\\nTewodros va néixer el 1818 a Charge, a la província de Qwara, a l'oest de Gonder, que en aquell moment era capital d'un imperi etiopienc dividit per les guerres dels senyors de Zemene Mesafent. El seu pare, Hailou Welde Giyorgis, fou governador de la seva província natal i un militar, com el seu oncle Kenfou Hilou. Després d'una breu educació dins el monestir, Téwodros es va integrar a l'exèrcit de Kenfou. Cap al 1945, davant a la fulgurant ascensió de Téwodros, Menen li va oferir el lloc de governador de Qwara i la mà de la seva néta, Tewabetch Ali."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Longvic","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Rivero_Ouche_kaj_urbodomo.JPG","page_title":"Longvic","context_page_description":"Longvic sī ūi-tī Hoat-kok Bourgogne tōa-khu Côte-d'Or séng ê chi̍t-ê commune."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D0%BC%D1%8F%D1%89%D0%B8%D0%B9_(%D0%BA%D0%B0%D0%BD%D0%BE%D0%BD%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BB%D0%BE%D0%B4%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/ru/6/6f/BattleofDaguescadra.jpg","page_title":"Гремящий (канонерская лодка)","context_page_description":"«Гремящий» — мореходная канонерская лодка Российского императорского флота типа «Грозящий».\\nДо 1 февраля 1892 года классифицировалась как броненосная канонерская лодка, после — переквалифицирована в мореходную канонерскую лодку.\\n«Гремящий» принимал участие в атаке на форты Дагу, деблокаде Тяньцзиня, обороне Инкоу во время Восстания ихэтуаней; обороне Порт-Артура и обстреле береговых позиций японцев во время Русско-японской войны."},{"page_url":"https://en.wikipedia.org/wiki/AA-52_machine_gun","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Mitrailleuse-IMG_1728.jpg","page_title":"AA-52 machine gun","context_page_description":"The AA-52 is one of the first French-produced guns of the post–World War II era. It was manufactured by the French government-owned Manufacture d'armes de Saint-Étienne company. The AA-52 is still used today as a vehicle-mounted weapon due to large quantities in service, but has been replaced in the helicopter role by the Belgian FN MAG, starting with the EC 725 Caracal of the special operations units and the Air Force search and rescue teams. The AA-52 had been largely phased out for infantry use in favour of the lighter FN Minimi but remains in use."},{"page_url":"https://en.wikipedia.org/wiki/Beaver_Dam,_Indiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Beaver_Dam%2C_Indiana.jpg","page_title":"Beaver Dam, Indiana","context_page_description":"Beaver Dam is an unincorporated community in Franklin Township, Kosciusko County, in the U.S. state of Indiana."},{"page_url":"https://ca.wikipedia.org/wiki/Lle%C3%B3_mar%C3%AD_de_Nova_Zelanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/New_Zealand_Sea_Lion.jpg","page_title":"Lleó marí de Nova Zelanda","context_page_description":"El lleó marí de Nova Zelanda és una espècie d'otàrid. És l'única del gènere Phocarctos.\\nNo se l'ha de confondre amb l'ós marí de Nova Zelanda. És bastant proper al lleó marí australià i a vegades se'ls ha considerat com a única espècie."},{"page_url":"https://gl.wikipedia.org/wiki/Advanced_Composition_Explorer","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/ACE-swics_sm.jpg","page_title":"Advanced Composition Explorer","context_page_description":"Advanced Composition Explorer, tamén coñecido polo acrónimo ACE, é un satélite artificial pertencente ó programa Explorer da NASA que foi lanzado o 25 de agosto de 1997 a bordo dun foguete Delta II 7920 desde o Centro Espacial Kennedy, en Florida, Estados Unidos."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B1%9F%E6%88%B6%E5%B9%95%E5%BA%9C%E5%B0%87%E8%BB%8D%E5%88%97%E8%A1%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Hidetada2.jpg","page_title":"江戶幕府將軍列表","context_page_description":"江户幕府将军列表中列出日本江户幕府时期，德川氏十五任征夷大将军的列表。德川家的将军除了秀忠以外，在就任同时都会一并得到源氏长者的称号，死后也会追赠正一位的地位。15位将军中只有，家康，家光，庆喜三人是正室所生。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A4%E0%AE%9E%E0%AF%8D%E0%AE%9A%E0%AE%BE%E0%AE%B5%E0%AF%82%E0%AE%B0%E0%AF%8D_%E0%AE%A8%E0%AE%BE%E0%AE%95%E0%AE%A8%E0%AE%BE%E0%AE%95%E0%AF%87%E0%AE%9A%E0%AF%81%E0%AE%B5%E0%AE%B0%E0%AE%B0%E0%AF%8D_%E0%AE%95%E0%AF%8B%E0%AE%AF%E0%AE%BF%E0%AE%B2%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Thanjavur_naganagesvarartemple2.jpg","page_title":"தஞ்சாவூர் நாகநாகேசுவரர் கோயில்","context_page_description":"தஞ்சாவூர் நாகநாகேசுவரர் கோயில் தமிழ்நாட்டின் தஞ்சாவூரில் அமைந்துள்ள சிவன் கோயிலாகும்."},{"page_url":"https://es.wikipedia.org/wiki/Egnacia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Bas%C3%ADlica_meridional.JPG","page_title":"Egnacia","context_page_description":"Egnacia es un yacimiento arqueológico que se encuentra en la región de Apulia en el sur de Italia en la localidad de mar de Savelletri di Fasano, provincia de Brindis. El enclave está situado en la que fuera la via Trajana, brazo separado de la via Appia que comunicaba las ciudades de Brindis con Benevento y que fue realizada entre los años 108 y 111 a. C. después de la victoria del empredor Trajano en la Dacia.\\n​\\n​"},{"page_url":"https://fr.wikipedia.org/wiki/Jardin_de_l%27%C3%89v%C3%AAch%C3%A9_de_Limoges","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/D%C3%A9tail_-_Jardin_de_l%27Ev%C3%AAch%C3%A9_de_Limoges.JPG","page_title":"Jardin de l'Évêché de Limoges","context_page_description":"Le jardin municipal de l'Évêché, plus proprement dénommé au pluriel jardins de l'Évêché, est un jardin public municipal de la ville de Limoges, situé dans le quartier historique de La Cité, en surplomb de la Vienne et de la coulée verte des bords de Vienne.\\nD'une superficie totale d'environ 5 hectares, les jardins de l'Évêché sont le plus grand espace vert du centre-ville de Limoges, accolés à la cathédrale Saint-Étienne et surtout à l'ancien évêché de la ville, désormais musée municipal des Beaux-Arts. Ils sont divisés en un jardin à la française, jardin public typique composé de bassins et de haies d'arbres, et un vaste jardin botanique, lui-même divisés en trois espaces : jardin systématique, jardin à thèmes et jardin des milieux naturels régionaux.\\nPropriété de la Ville de Limoges depuis 1910, il est géré et entretenu par le service municipal des espaces verts."},{"page_url":"https://sw.wikipedia.org/wiki/B%C3%A9k%C3%A9s_(wilaya)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/B%C3%A9k%C3%A9s-_Hungary.jpg","page_title":"Békés (wilaya)","context_page_description":"Békés ni moja ya wilaya 19 ya kujitawala ya Hungaria. Idadi ya wakazi wake ni takriban 376,657. Mji wake mkuu ni Békéscsaba."},{"page_url":"https://pl.wikipedia.org/wiki/Borek_Wielkopolski_(gmina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Piramida_wieku_Gmina_Borek_Wielkopolski.png","page_title":"Borek Wielkopolski (gmina)","context_page_description":"Borek Wielkopolski – gmina miejsko-wiejska w województwie wielkopolskim, w powiecie gostyńskim. W latach 1975–1998 gmina położona była w województwie leszczyńskim.\\nSiedziba gminy to Borek Wielkopolski.\\nWedług danych z 30 czerwca 2004 gminę zamieszkiwało 7730 osób."},{"page_url":"https://hu.wikipedia.org/wiki/Vastagh_Gy%C3%B6rgy_(fest%C5%91)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Vastagh_Gy%C3%B6rgy_%C3%A9s_a_csal%C3%A1d_eml%C3%A9kt%C3%A1bl%C3%A1ja_Tigris_utca_55.jpg","page_title":"Vastagh György (festő)","context_page_description":"Idősebb alsótorjai Vastagh György magyar festőművész."},{"page_url":"https://pt.wikipedia.org/wiki/San_Tommaso_in_Formis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Villa_Celimontana_San_Tommaso_in_Formis_612.jpg","page_title":"San Tommaso in Formis","context_page_description":"San Tommaso in Formis ou Igreja de São Tomé em Formis, chamada também de San Tommaso in Formis all'Arco di Dolabella, é uma igreja de Roma, Itália, localizada no rione Celio, na via San Paolo della Croce. É dedicada a São Tomé Apóstolo e uma igreja subsidiária da paróquia de Santa Maria in Domnica alla Navicella. Situada perto da Villa Celimontana, vizinha do Arco de Dolabela, deve seu cognome \\"in Formis\\" à proximidade da Água Cláudia."},{"page_url":"https://vi.wikipedia.org/wiki/Raphicerus_melanotis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Southafrica-capegrysbok.jpg","page_title":"Raphicerus melanotis","context_page_description":"Raphicerus melanotis là một loài động vật có vú trong họ Bovidae, bộ Artiodactyla. Loài này được Thunberg mô tả năm 1811."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CF%86%CE%B9%CE%AC%CE%BB%CF%84%CE%B7%CF%82_(%CF%8C%CE%BD%CE%B5%CE%B9%CF%81%CE%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/John_Henry_Fuseli_-_The_Nightmare.JPG","page_title":"Εφιάλτης (όνειρο)","context_page_description":"Ο όρος εφιάλτης χρησιμοποιείται για να περιγράψει ένα όνειρο που προκαλεί μια δυνατή δυσάρεστη αισθηματική αντίδραση σε αυτόν που το βιώνει. Η αντίδραση συνήθως είναι φόβος ή τρόμος, προκαλεί ακόμα και αισθήματα πόνου, πνιγμού και θανάτου, ενώ πολλές φορές δημιουργεί την αίσθηση ότι κάποιος πέφτει από μεγάλο υψόμετρο. Τέτοια όνειρα οφείλονται σε σωματικές διαταραχές όπως υψηλό πυρετό, ή και σε ψυχολογικές διαταραχές όπως ψυχολογικό τραύμα και άγχος, ωστόσο τις περισσότερες φορές η εμφάνιση τους δεν έχει κάποια φανερή αιτία. Αν κάποιο άτομο έχει βιώσει μια ψυχολογικά τραυματική εμπειρία στη ζωή του, για παράδειγμα, εάν έχει βασανιστεί σωματικά τότε αυτή η εμπειρία θα επανέλθει στα όνειρά του προκαλώντας εφιάλτη. Αυτοί που βιώνουν ένα εφιάλτη συνήθως ξυπνούν με αίσθημα έντονου άγχους και είναι δύσκολο να πάνε για ύπνο για πολλή ώρα.\\nΟι εφιάλτες είναι κοινοί στη ζωή κάποιου, ωστόσο πολλές φορές είναι τόσο έντονοι και εμφανίζονται τόσο συχνά που μπορούν να επέμβουν στον ύπνο κάποιου και μπορεί να προκαλέσουν σε μερικά άτομα να αναζητήσουν ιατρική βοήθεια."},{"page_url":"https://hu.wikipedia.org/wiki/Stazione_di_Sala_al_Barro-Galbiate","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Galbiate_-_frazione_Sala_al_Barro_-_stazione_ferroviaria.jpg","page_title":"Stazione di Sala al Barro-Galbiate","context_page_description":"Stazione di Sala al Barro-Galbiate vasútállomás Olaszországban, Lombardia régióban, Galbiate település Sala al Barro frazionéjában."},{"page_url":"https://es.wikipedia.org/wiki/Islas_Frisias","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Ostfriesische_Inseln_%28Karte%29.png","page_title":"Islas Frisias","context_page_description":"Las islas Frisias son una cadena de islas e islotes que transcurren paralelos a la costa occidental de Europa, desde el norte de los Países Bajos hasta el suroeste de Dinamarca pasando por Alemania, contenidas en el territorio de la antigua Frisia, de las que reciben el nombre. Separan el mar del Norte del mar de Frisia. Este último, al vaciarse con la marea baja, permite el acceso a pie a algunas de las islas.\\nConstituidas por terrenos arenosos y arcillosos, tienen muy poca altura y son de morfología muy cambiante. La acción del oleaje y los temporales excepcionales pueden ampliarlas o hacerlas desaparecer, o incluso juntar unas con otras.\\nAunque antiguamente basaban su economía en la agricultura, la ganadería y la pesca, actualmente el turismo es una fuente de ingresos fundamental.\\nSe clasifican en tres grupos: occidentales, orientales y septentrionales."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Backsteinbauwerke_der_Gotik_in_Italien","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/08/Map_of_region_of_Marche%2C_Italy%2C_with_provinces-de.svg","page_title":"Liste der Backsteinbauwerke der Gotik in Italien","context_page_description":"Die Liste der gotischen Backsteinbauwerke in Italien ist Teil des Listenwerkes Backsteinbauwerke der Gotik, in dem die gotischen Backsteinbauwerke aller entsprechenden Länder Europas möglichst vollständig erfasst sind. Aufgenommen sind nur Bauten, an denen der Backstein irgendwo zutage tritt oder, bei geschlämmten Oberflächen, wenigstens die Backsteinstruktur von Mauerwerk erkennbar ist.\\nUmfang:\\nDiese Liste umfasst 396 Einträge von Bauwerken und Gruppen von Bauwerken.\\nHintergrundinformationen:\\nBei einigen Gebäuden ist unter „“ die zugehörige Bildersammlung in Wikimedia Commons verlinkt.\\nDatenbank-Links sind, sofern verfügbar, bei den einzelnen Provinzen erklärt."},{"page_url":"https://simple.wikipedia.org/wiki/Raimonds_V%C4%93jonis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Flickr_-_Saeima_-_10.Saeimas_deput%C4%81ts_Raimonds_V%C4%93jonis.jpg","page_title":"Raimonds Vējonis","context_page_description":"Raimonds Vējonis is a Latvian politician. He was the 9th President of Latvia from 2015 to 2019. He is a member of the Green Party, part of the Union of Greens and Farmers."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D0%B4%D0%B4%D0%B5%D1%80,_%D0%90%D0%BB%D1%8C%D1%84%D1%80%D0%B5%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/AV_Kidder.jpg","page_title":"Киддер, Альфред","context_page_description":"Альфред Винсент Киддер — крупнейший археолог XX века из числа из тех, которые занимались изучением истории юго-запада США и Месоамерики. Разработал систематичный подход к изучению доколумбовых культур, автор хронологии Пекос и термина «анасази» для обозначения цивилизации древних пуэбло.\\nЧлен Национальной академии наук США."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1894","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Bundesarchiv_Bild_183-83285-0029%2C_Friedrich_Ebert.jpg","page_title":"Lijst van personen geboren in 1894","context_page_description":"Dit is een lijst van personen die geboren zijn in 1894.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A8%D7%99_%D7%94%D7%90%D7%A0%D7%93%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/South_America_satellite_plane.jpg","page_title":"הרי האנדים","context_page_description":"הרי האנדים הם רכס ההרים היבשתיים הארוך בעולם. הרכס משתרע לאורך 8,000 קילומטרים של חופה המערבי של אמריקה הדרומית. מקור השם הוא בשפת הקצ'ואה ופירושו \\"פסגה גבוהה\\". במהלך ההיסטוריה התפתחו במרומי האנדים אימפריות אינדיאניות מפותחות, אשר שגשגו והצליחו בזכות השפע הגאולוגי והביולוגי באזור, שפע שעדיין מהווה לב הכלכלה במדינות האנדים.\\nהפסגה הגבוהה ביותר ברכס היא זו של הר אקונקגווה, המתנשא לגובה של 6,964 מטרים."},{"page_url":"https://sq.wikipedia.org/wiki/Lista_e_qyteteve_sipas_banor%C3%ABve","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/0322_Pyongyang_Turm_der_Juche_Idee_Aussicht.jpg","page_title":"Lista e qyteteve sipas banorëve","context_page_description":"Kjo është lista e qyteteve sipas banorëve."},{"page_url":"https://fi.wikipedia.org/wiki/Juniorij%C3%A4%C3%A4kiekko","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e0/TournoiPee-WeeQu%C3%A9bec2009.JPG","page_title":"Juniorijääkiekko","context_page_description":"Juniorijääkiekko tarkoittaa amatöörijääkiekkoa, jota pelataan juniori-ikäisten kesken. Pelin sääntöjä on muokattu nuorille pelaajille sopiviksi esimerkiksi taklaamista rajoittamalla tai peliaikaa muuttamalla. Juniorikiekko jaetaan usein tavallisilla säännöillä pelaaviin nuorten ja nuorien sääntömuutoksilla pelaavien juniorien sarjoihin."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%96%B0%E7%95%8C%E5%8D%80%E5%B0%88%E7%B7%9A%E5%B0%8F%E5%B7%B488B%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Greenfield_Garden_green_minibus_terminus_%28Hong_Kong%29.jpg","page_title":"新界區專線小巴88B線","context_page_description":"新界区专线小巴88B线是由顺威运输发展营办的一条专线小巴线，来往翠怡花园及葵芳站。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%98%D0%B0_%D0%95%D1%81%D1%82%D0%BE%D0%BD%D0%B8%D1%98%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Alutaguse_forests.jpg","page_title":"Географија Естоније","context_page_description":"Република Естонија је смештена у источном делу балтичког басена, на прелазу из источне у северну Европу. Обухвата територију површине 45.228 km² и по том параметру налази се на 32. месту међу европским државама, односно на 132. месту у светским оквирима. Естонији припадају и територијалне воде Балтичког мора на удаљености од 12 наутичких миља од обале.\\nНајсевернија тачка Естонија лежи на северној обали острва Вајндло на координатама 59°49′17″N 26°21′31″E, док је најсевернија тачка континенталног дела полуострво Пурекари на 59°40′31″N 25°41′49″E. Најјужнија тачка је код села Наха на летонској граници, на координатама 57°30′33″N 26°37′00″E. Западни екстрем налази се на острву Нотама на 58°19′20″N 21°45′51″E, док је најисточнија тачка источно од града Нарве на 59°22′13″N 28°12′36″E. Највећа удаљеност између два локалитета крећучи се друмом износи око 400 km. Већина острва се налази у близини континенталног дела земље, а најудаљеније је острво Рухну у Ришком заливу које је од копна удаљено 65 km.\\nНа северу и истоку Естонија излази на обале Балтичког мора, односно на његове заливе, Фински на северу и Ришки на југозападу."},{"page_url":"https://ca.wikipedia.org/wiki/Thomas_Hunt_Morgan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Thomas_Hunt_Morgan.jpg","page_title":"Thomas Hunt Morgan","context_page_description":"Thomas Hunt Morgan fou un biòleg i genetista nord-americà guardonat amb el Premi Nobel de Medicina o Fisiologia l'any 1933."},{"page_url":"https://ca.wikipedia.org/wiki/Hora_tempor%C3%A0nia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Discus_in_plano.gif","page_title":"Hora temporània","context_page_description":"Les Hores temporànies corresponen a un sistema de mesura del temps que correspon a una divisió del arc diürn en dotze parts iguals. Cada hora temporal és la dotzena part d'aquest arc, el que es traduïa en dotze parts iguals del dia natural. Aquesta divisió del temps és molt antiga i en la història de la gnomònica es pot veure emprada en certs rellotges de sol. El traçat de rellotges de sol que tenen aquest sistema horari s'ha realitzat des de molt antic mitjançant un traçat geomètric anomenat analema de Vitruvi. Aquest sistema horari va esdevenir en la vida conventual de l'edat mitjana en el sistema de hores canòniques emprades en la litúrgia cristiana. Aquest tipus de sistema va estar vigent a la cultura nipona rural fins al segle XX. El seu declivi va començar a occident al segle XVIII quan els rellotges mecànics van començar a ser efectius com màquines mesuradores del temps, en l'actualitat al començament del segle xxi és un sistema horari que es troba completament en desús."},{"page_url":"https://nl.wikipedia.org/wiki/Port-sur-Sa%C3%B4ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Port-sur-Sa%C3%B4ne_vue_sur_le_centre_2.jpg","page_title":"Port-sur-Saône","context_page_description":"Port-sur-Saône is een gemeente in het Franse departement Haute-Saône en telt 3002 inwoners. De plaats maakt deel uit van het arrondissement Vesoul."},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BB%95ng_th%E1%BB%91ng_Pakistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Mamnoon_Hussain_2014.jpg","page_title":"Tổng thống Pakistan","context_page_description":"Tổng thống Pakistan là nguyên thủ quốc gia của Pakistan. Pakistan có một chính phủ cộng hòa nghị viện. Theo hiến pháp Pakistan, tổng thống được bầu chọn thông qua một Đoàn bầu cử và có nhiệm kỳ 5 năm. Đoàn bầu cử này bao gồm Thượng viện, Quốc hội và các nghị viện cấp tỉnh. Tổng thống không được đảm nhiệm hai nhiệm kỳ liên tục. Tổng thống cũng có thể bị luận tội và bị phế truất khỏi chức vụ nếu có 2/3 phiếu bầu của Nghị viện thông qua.\\nChức vụ tổng thống Pakistan theo truyền thống là một chức vụ hình thức, còn quyền lực thực tế thuộc về Thủ tướng. Tuy nhiên, vào một số thời điểm trong lịch sử quốc gia này, thường có liên hệ tới các cuộc đảo chính quân sự và sau đó trả lại cho chính quyền dân sự, thay đổi Hiến pháp Pakistan và thay đổi các đặc quyền và quyền hạn liên quan đến chức vụ Tổng thống. Tổng thống là chủ tịch của Hội đồng An ninh Quốc gia và bộ nhiệm Tư lệnh của Lục quân, Hải quân và Không quân."},{"page_url":"https://es.wikipedia.org/wiki/Guerrera_M-1965","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/M65_schimanski_jacke.jpg","page_title":"Guerrera M-1965","context_page_description":"La guerrera M-1965 del inglés M-1965 field jacket, mejor conocida como chaqueta M65, es una prenda de vestir diseñada por el Ejército de los Estados Unidos en la década de 1960.​ Fue introducida al servicio por el ejército estadounidense para reemplazar a la guerrera de campaña M-1951, la que a su vez había sustituido a la cazadora M-1943, empleada durante la Segunda Guerra Mundial.\\nLa guerrera de campaña M-65 fue ampliamente usada por las tropas estadounidenses durante la Guerra de Vietnam, en la que la chamarra fue empleada en la zona montañosa central de Vietnam del Sur, en donde protegía contra el frío que sucede a las lluvias monzonales.​\\nOriginalmente fue introducida en color verde oliva militar y actualmente es producida en una variedad de colores y tipos de camuflaje, incluyendo el tipo boscoso, camuflaje chocolate chip, tiger stripes, negro, azul marino, camuflaje universal, entre otros. En la parte frontal se encuentran dos bolsillos laterales a la altura de la cintura y dos bolsillos a la altura del pecho. La chaqueta cuenta en la parte posterior del cuello con un cierre que alberga una capucha protectora contra la lluvia o el viento."},{"page_url":"https://pt.wikipedia.org/wiki/Murex_(g%C3%AAnero)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Purpurk%C3%BCpe.jpg","page_title":"Murex (gênero)","context_page_description":"Murex é um gênero de moluscos gastrópodes marinhos, carnívoros, pertencentes à família Muricidae. Foi descrito por Carolus Linnaeus em 1758, ao nomear a espécie Murex tribulus como seu tipo nomenclatural. Antes este gênero incluía um número maior de espécies espinescentes ou com abas em suas varizes, agora classificadas em gêneros como Chicoreus, Siratus, Pterynotus, Haustellum, Homalocantha, Hexaplex ou Phyllonotus; que ainda conservam o termo Murex como sua nomenclatura vernácula. A conhecida espécie Bolinus brandaris, que forneceu a púrpura tíria durante a Idade Antiga, foi classificada pelo mesmo naturalista e no mesmo ano, também pertencendo, outrora, a este gênero; e o nome Murex, que significa \\"peixe púrpura\\", provém do corante que foi extraído desta espécie, mas também extraído de Hexaplex trunculus e Stramonita haemastoma. A menção desta última espécie demonstra como, em tempos de antanho, qualquer espécie espinescente, até mesmo de outras famílias, como Cerithium, poderia ser classificada dentro do conceito guarda-chuva Murex, o que não é válido na atual etapa da ciência zoológica."},{"page_url":"https://cs.wikipedia.org/wiki/Cer","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Cerium_spectrum_visible.png","page_title":"Cer","context_page_description":"Cer, je šedavě bílý, vnitřně přechodný kovový prvek, druhý člen skupiny lanthanoidů. Hlavní uplatnění nalézá v metalurgickém průmyslu při výrobě speciálních slitin a nebo jejich deoxidaci, je složkou některých skel a průmyslových katalyzátorů."},{"page_url":"https://en.wikipedia.org/wiki/Eastern_Canadian_forests","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/NLW_GrosMorne1_tango7174.jpg","page_title":"Eastern Canadian forests","context_page_description":"The Eastern Canadian forests is an ecoregion of Canada as defined by the World Wildlife Fund categorization system."},{"page_url":"https://tr.wikipedia.org/wiki/Karata%C5%9F_G%C3%B6l%C3%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Burdur_harita.svg","page_title":"Karataş Gölü","context_page_description":"Karataş Gölü Burdur, Tefenni ovasında yer alan küçük ve sığ bir tatlı su gölüdür.\\nKaramanlı ilçe sınırlarında ve 1190 hektar büyüklüğündedir. Uluslararası sulak alanlar listesinde bulunan göl, 1985 yılında yaban hayatı koruma alanı kabul edilmiştir. Gölün rakımı 1050 m, en derin yeri 2 m'dir\\nBademli dere ve Akçay gölü beslerken, çevre tarlaların sulanması amacıyla suları kullanılmaktadır. Gölde bol miktarda sazlık alan bulunmaktadır. Buralar tespit edilen 122 kadar kuş türü için yuvalama alanıdır. Av ve yaban hayatı koruma alanı olan göl, Karataş Tepesi ile Kağılcık Dağları yakınındadır.\\nBalık popülasyonu açısından bol miktarda yayın balığı ve sazan bulunmaktadır.\\nGöle gelen Bozçayın suları Karamanlı barajında tutulmasıyla gölde kuraklık tehlikesi belirmiştir. Gölün önüne seddeler yapılarak rezervuar alana dönüştürmek hedeflenmektedir.\\nGöl çevresinde ağaçlandırma çalışmalıyla mesire alanı ve kuş cenneti oluşturulmaya çalışılmaktadır.\\nGöl çevresinde; 61 su kuşu, 48 ötücü, 12 gündüz ve bir gece yırtıcı kuş türü tespit edilmiştir."},{"page_url":"https://no.wikipedia.org/wiki/Forsvaret","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Nordic_Battallion.jpg","page_title":"Forsvaret","context_page_description":"Forsvaret er den militære delen av den norske statsmakten. Forsvaret er organisert som en etat under ledelse av Forsvarsdepartementet. Etaten ledes av en forsvarssjef med ansvar for det militære kommandoapparatet, de militære styrkene og støtten av disse. Admiral Haakon Bruun-Hanssen innehar stillingen som forsvarssjef.\\nHans Majestet Kongen er, ifølge Grunnloven, den øverste befalingsmannen i landet, og har grad av general i Hæren og Luftforsvaret og er admiral i Sjøforsvaret. Styresmakten ligger til Kongen i statsråd, det vil si Regjeringen, som har det øverste militære ansvaret i krig og fred.\\nForsvarsbudsjett\\nNorge brukte i 2016 1,62 % av bruttonasjonalprodukt på forsvarsbudsjettet.\\nDette er mindre enn NATOs ønskede 2 %, men mer enn de fleste andre NATO-landene.\\nStyrke\\nForsvarets styrke i fred var i 2018 15 849 personer inkludert befal og sivilt ansatte.\\nVed full mobilisering, er det rundt 63 318 totalt personell med nåværende militære, vernepliktige og Heimevernet."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%B8_%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%B0%D1%8F_%D0%B0%D1%80%D0%BC%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Maurice_d%27Elb%C3%A9e.jpg","page_title":"Католическая и Королевская армия","context_page_description":"Католическая и Королевская армия — самоназвание вооружённых формирований роялистов — сторонников монархии и противников Великой французской революции, участвовавших в Вандейском мятеже. Первоначально Вандейский мятеж возник стихийно, в результате чего у каждого отряда появились свои лидеры, чаще всего, дворяне. По мере разрастания мятежа, возникла необходимость выступать совместно, для чего была создана Католическая Королевская армия. Это однако была армия партизанского типа, которая то объединялась для совместных действий против крупных соединений республиканцев, то продолжала действовать разрозненно."},{"page_url":"https://it.wikipedia.org/wiki/Nata%C5%A1a_Osmokrovi%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Natasa_Osmokrovic_1.jpg","page_title":"Nataša Osmokrović","context_page_description":"Nataša Osmokrović è un'ex pallavolista croata.\\nGiocava nel ruolo di schiacciatrice."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%BD%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Sernhac_Eglise_St_Sauveur.jpg","page_title":"Сернак","context_page_description":"Сернак — Францин гӀала-коммуна, лаьтта Бретань регионехь. Коммунан департамент — Гар. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://fr.wikipedia.org/wiki/Besnagar","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Rail_pillars_from_Besnagar_Sunga_period.jpg","page_title":"Besnagar","context_page_description":"Besnagar, aussi Vessanagara, est le site archéologique de l'ancienne ville de Vidisha. Besnagar se trouve à proximité de la Vidisha moderne, entre les rives des rivères Bes et Betwâ. Besnagar était une cité très importante, probablement la capitale de l'est du Malwa, comme Ujjain était la capitale de l'ouest du Malwa.\\nDe nombreuses statues et vestiges architecturaux ont été retrouvés dans les ruines de l'ancienne ville. Les premières excavations furent entreprises par H.H.Lake en 1910, et les résultats publiées dans Journal of the Bombay Asiatic Society, Vol.23, pp.135-146."},{"page_url":"https://fi.wikipedia.org/wiki/Celle","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Celle4.jpg","page_title":"Celle","context_page_description":"Celle [ˈtsɛlə] on kaupunki Ala-Saksin osavaltiossa Saksassa. Se sijaitsee Weserin sivujoen Allerin varrella, koilliseen Hannoverista. Kaupungin pinta-ala 176,01 km² ja se on jaettu 17 kaupunginosaan. Vuoden 2011 väestönlaskennassa siellä oli 69 001 asukasta.\\nVarhaisin maininta Cellestä kirjallisessa tuotoksessa voidaan sijoittaa vuodelle 986. Tuolloin se tunnettiin nimellä Kellu. Cellen vanhakaupunki Altencelle perustettiin vuoden 1248 tienoilla. Itse Celle sai kaupunginoikeudet vuonna 1292 herttua Otto II:lta. Vuosina 1371–1705 Celle toimi Braunschweig-Lüneburgin herttuoiden residenssikaupunkina.\\nNykyisin Celle tunnetaan kauniista ristikkorakenteisista taloista, joita vanhassa kaupungissa on 480."},{"page_url":"https://cs.wikipedia.org/wiki/1._b%C5%99ezen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Jan_Kode%C5%A1.JPG","page_title":"1. březen","context_page_description":"1. březen je 60. den roku podle gregoriánského kalendáře. Do konce roku zbývá 305 dní. Svátek slaví Bedřich a Bedřiška.\\n1. březen je jedním z dnů používaných v historii jako začátek kalendářního roku. Za začátek roku platil tento den ve starém Římě před opravou kalendáře Juliem Caesarem – proto má září latinský název september, ačkoliv je měsícem devátým. Tento počátek roku užívali i první křesťané. 1. březen platil za počátek roku také v republice benátské, a to až do jejího pádu v roce 1797."},{"page_url":"https://fi.wikipedia.org/wiki/Eskilstunan_kunta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Mariakyrkan_Eskilstuna.jpg","page_title":"Eskilstunan kunta","context_page_description":"Eskilstunan kunta on Södermanlandin läänissä sijaitseva Ruotsin kunta. Maakuntajaossa se kuuluu Södermanlandiin. Kunnan keskustaajama on Eskilstuna.\\nKunnan maapinta-ala on 1 099,89 neliökilometriä ja asukasluku 102 065 henkeä.\\nKunnan pohjoispuolella sijaitsee Ruotsin neljästä suuresta järvestä Mälaren ja länsipuolella Hjälmaren.\\nVuonna 2007 kunnassa oli 274,30 km² peltoa, joten saman ajankohdan maapinta-alaan vertaamalla saadaan peltojen osuudeksi 24,9 prosenttia kunnan maapinta-alasta.\\nEskilstunan asukkaista n. 17% on ruotsinsuomalaisia. Kunnalla on velvoite tarjota palveluita suomen kielellä."},{"page_url":"https://sv.wikipedia.org/wiki/H%C3%A4ver%C3%B6dr%C3%A4kten","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Spelande_b%C3%B6nder.png","page_title":"Häverödräkten","context_page_description":"Häverödräkten är en folkdräkt för Häverö socken, egentligen ursprungligen utmärkande för hela Väddö och Häverö skeppslag.\\nHäverödräkten är vid sidan av Tjocködräkten den enda verkligt särpräglade Uppländska dräkten med tydlig koppling i ett lokalt dräktskick. Dahlström skriver år 1863 att tre dräkter, \\"hvilka hvar på sin ort\\" ännu är i bruk i Uppland: den första en dräkt buren av en kolbonde från Roslagen, den andra från Tierp och den tredje är Häverödräkten.\\nUppsalastudenten Frans Theodor Noréus beskrev under en resa i Roslagen 1832 Häveröbornas egna klädsel, som serdeles bland qvinnorna bibehållet sig osmittade af nyare tidens mode-lust och fåfänga, denna kräfta, som i så många orter undergräfver både charakter och oeconomisk bestånd. Att se ett helt folk i samma drägt, - kanske ett tecken till samma anda och lynne, eller till det minsta att någon gnista deraf finnes - är lika skönt, som det börjar blifva ovanligt och rart.\\nJust i Häverö bibehöll sig längst en egen landskapsdräkt. I Roslagen, speciellt Häverö socken, bibehöll sig folkdräkten måhända längre än i landskapet i övrigt. Häverödräkten lades fullständigt bort ur vardagligt bruk under 1800-talets senare hälft."},{"page_url":"https://nl.wikipedia.org/wiki/Pleurobranchus_grandis","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/18/Grand_pleurobranch_pleurobranchus_grandis.JPG","page_title":"Pleurobranchus grandis","context_page_description":"Pleurobranchus grandis is een slakkensoort uit de familie van de Pleurobranchidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1868 door Pease."},{"page_url":"https://no.wikipedia.org/wiki/Marilyn_Monroe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Yves_Montand_Marilyn_Monroe.jpg","page_title":"Marilyn Monroe","context_page_description":"Marilyn Monroe var en amerikansk skuespillerinne, sangerinne, filmprodusent og modell.\\nEtter å ha tilbragt mesteparten av barndommen i fosterhjem, giftet hun seg som 16-åring med James Dougherty. Hun begynte å jobbe som modell, noe som førte til hennes første filmkontrakt i 1946. De første rollene hennes var små, men hun spilte blant annet i de kritikerroste filmene Asfaltjungelen og Alt om Eva. Gjennombruddet kom i filmen Niagara i 1953. Hun fikk ros for sitt komiske talent i filmer som Herrer liker blonde piker, Gift med en millionær og Gresskar i nød, og ble en av de mest populære filmstjernene i Hollywood. Et ekteskap og påfølgende skilsmisse fra den tidligere baseballspilleren Joe DiMaggio økte også hennes kjendisstatus.\\nMonroe var misfornøyd med å stadig måtte spille rollen som «dum blondine» og startet sitt eget produksjonsselskap, Marilyn Monroe Productions, for å få større kontroll over sin egen karriere. Hun giftet seg også med forfatteren og dramatikeren Arthur Miller. Hennes kritikerroste rolletolkning i filmen Bus Stop fikk henne nominert til Golden Globe. Hun vant denne prisen for sin rolletolkning i filmen Noen har det hett."},{"page_url":"https://uk.wikipedia.org/wiki/1_%D0%BA%D0%B0%D1%80%D0%B1%D0%BE%D0%B2%D0%B0%D0%BD%D0%B5%D1%86%D1%8C_%C2%AB400-%D1%80%D1%96%D1%87%D1%87%D1%8F_%D0%B7_%D0%B4%D0%BD%D1%8F_%D1%81%D0%BC%D0%B5%D1%80%D1%82%D1%96_%D0%BF%D0%B5%D1%80%D1%88%D0%BE%D0%B4%D1%80%D1%83%D0%BA%D0%B0%D1%80%D1%8F_%D0%86%D0%B2%D0%B0%D0%BD%D0%B0_%D0%A4%D0%B5%D0%B4%D0%BE%D1%80%D0%BE%D0%B2%D0%B0%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/USSR-1983-1ruble-CuNi-FyodorovDeath400-b.jpg","page_title":"1 карбованець «400-річчя з дня смерті першодрукаря Івана Федорова»","context_page_description":"400-річчя з дня смерті російського першодрукаря Івана Федорова — ювілейна монета СРСР вартістю 1 карбованець, випущена 1983 року. Монета була присвячена 400-річчяю з дня смерті Івана Федорова, який увійшов в історію як першодрукар. У 1563 році за указом царя Івана Грозного в Москві був побудований Друкарський двір. Керівником друкарні призначений був церковний диякон Іван Федоров, що згодом став першодрукарем. Він був не тільки друкарем, а й знав різні ремесла, був одним з освічених і підприємливих людей свого часу."},{"page_url":"https://fr.wikipedia.org/wiki/Thomas_Janeschitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Austria_vs._Russia_20141115_%28014%29.jpg","page_title":"Thomas Janeschitz","context_page_description":"Thomas Janeschitz est un footballeur autrichien né le 22 juin 1966, qui évoluait au poste d'attaquant au Kremser SC et en équipe d'Autriche.\\nJaneschitz n'a marqué aucun but lors de son unique sélection avec l'équipe d'Autriche en 1993."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8D%B7%E9%87%8C%E6%B4%BB%E5%BB%A3%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Plaza_Hollywood_Level_2_Lift_lobby_2015.jpg","page_title":"荷里活廣場","context_page_description":"荷里活廣場是香港九龍鑽石山一所購物商場，位於大磡龍蟠街1至3號，上蓋為星河明居，為九龍倉置業旗下物業，由美國Brennan Beer Gorman策劃及設計。商場於1997年落成啟用，商場包括地下共有五層，提供超過220個舖位，當中包括大型超級市場、酒樓及電影院等，為東九龍其中一所大型商場。\\n2019年，荷里活廣場收入及營業盈利亦跌3%，收入5.52億，營業盈利4.15億港元。"},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%E1%BA%A5t_s%C3%A9t_polyme","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Polymer_clay_conditioning.jpg","page_title":"Đất sét polyme","context_page_description":"Đất sét polyme là một loại đất sét nghệ thuật có cấu tạo từ polyme polyvinyl clorua. Nó không có các chất khoáng cấu tạo nên chất sét thông thường, nhưng cũng giống như đất sét khoáng, nó có thể kết hợp với một chất lỏng để chuyển sang dạng gel hay được nung nóng để cứng lại. Đất sét polyme thường được sử dụng để làm đồ thủ công mỹ nghệ, hay dùng để trang trí. Các tác phẩm nghệ thuật làm từ đất sét polyme giờ cũng có thể được thấy trong các viện bảo tàng nghệ thuật."},{"page_url":"https://es.wikipedia.org/wiki/Delichon","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Delichonurbicaegg.png","page_title":"Delichon","context_page_description":"Delichon es un género de aves paseriformes perteneciente al la familia Hirundinidae que contiene tres especies, denominadas comúnmente aviones. Estas esbeltas aves de cabeza grande, largas alas y patas cortas tienen la mayoría de las partes superiores de color negro con matices azulados que contrastan con su obispillo blanco, y sus zonas inferiores blancas o grises claras. Destacan por la forma de sus dedos y tarsos que son una característica del género. Los aviones están cercanamente emparentados con otros hirundinidos que construyen nidos de barro, en especial con las golondrinas del género Hirundo. Solo crían en Eurasia y el norte de África. Dos de sus especies, el avión común y el avión asiático, migran al sur en invierno, mientras que el D. nipalense es sedentaria y reside en los alrededores del Himalaya todo el año.\\nLos aviones anidan en colonias en acantilados y edificios, construyendo sus nidos de barro y forrando su interior con hierba y plumas. Ambos miembros de la pareja construyen el nido, incuban los huevos y alimentan a los pollos. La puesta típica consta de dos o tres huevos. Estas aves son cazadores aéreos de pequeños insectos como las moscas y los áfidos."},{"page_url":"https://id.wikipedia.org/wiki/JDS_Y%C5%ABgiri_(DD-153)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/JS_Y%C5%ABgiri_%28DD-153%29%2C_Solent.jpg","page_title":"JDS Yūgiri (DD-153)","context_page_description":"JDS Yuugiri (DD-153) adalah sebuah kapal perusak kelas Asagiri milik Angkatan Laut Bela Diri Jepang. Ia mulai dibangun pada tahun 1984 dan mulai bertugas pada tahun 1989.\\nYuugiri berbobot 3.500 ton dengan panjang 137 meter dan lebar 14,6 meter. Kapal ini memiliki kecepatan maksimal 30 knot dengan dilengkapi berbagai persenjataan, sensor, serta membawa satu helikopter Seahawk.\\nYuugiri memiliki rudal anti kapal Harpoon dan rudal permukaan ke udara Sea Sparrow."},{"page_url":"https://de.wikipedia.org/wiki/Sumatra_Barat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Lambang_Kabupaten_Sijunjung.jpeg","page_title":"Sumatra Barat","context_page_description":"Sumatra Barat ist eine indonesische Provinz auf der Insel Sumatra."},{"page_url":"https://hu.wikipedia.org/wiki/Tinian","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/B-29s_of_the_462d_Bomb_Group_West_Field_Tinian_Mariana_Islands_1945.jpg","page_title":"Tinian","context_page_description":"Tinian egy sziget a Csendes-óceán nyugati részén. Saipan és Rota mellett az Északi-Mariana-szigetek három nagyobb tagja közül az egyik. A sziget spanyol, német, japán, majd amerikai fennhatóság alá került. Jelenleg az Egyesült Államok egyik külbirtokának részét képezi."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Martin-de-Monph%C3%A9lix_de_Pondaurat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Pondaurat_%C3%A9glise_St_Martin_de_Monph%C3%A9lix_Arc_triomphal_nord_b_a.JPG","page_title":"Église Saint-Martin-de-Monphélix de Pondaurat","context_page_description":"L'église Saint-Martin-de-Monphélix est une église catholique située dans la commune de Pondaurat, dans le département de la Gironde, en France."},{"page_url":"https://en.wikipedia.org/wiki/Ali_Said_(Indonesia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Ali_Said_-_Fourth_Development_Cabinet.jpg","page_title":"Ali Said (Indonesia)","context_page_description":"Ali Said was an Indonesian judge, military officer and politician. Like his predecessor Mujono, he was one of a string of former military officials to be appointed to the judiciary of Indonesia.\\nSaid often worked closely with Ismail Saleh and Mujono. Said replaced Mujono as Minister of Law and then as Chief Justice of the Supreme Court of Indonesia; Saleh replaced Said as Attorney General and then Minister of Law. Together, the three were known as the \\"Three Punokawan\\" or clown servants of the epic hero due to their perceived enthusiasm for upholding the law."},{"page_url":"https://nl.wikipedia.org/wiki/Rooms-Katholieke_Kerk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Second_Vatican_Council_by_Lothar_Wolleh_001.jpg","page_title":"Rooms-Katholieke Kerk","context_page_description":"De Rooms-Katholieke Kerk is met meer dan 1,2 miljard volgelingen het grootste kerkgenootschap ter wereld en wordt ook wel kortweg de Kerk genoemd. Het hoofd van de Rooms-Katholieke Kerk is de paus. Sinds 13 maart 2013 is dat paus Franciscus. Als de rooms-katholieke stroming bedoeld wordt die de Kerk vertegenwoordigt, wordt ook wel rooms-katholieke kerk geschreven.\\nZe beroept zich op het Oude en het Nieuwe Testament van de Bijbel, op de katholieke traditie en op het leergezag van Rome.\\nDe Kerk heeft het verloop van de geschiedenis van de mensheid, met name in de westerse wereld, in belangrijke mate mede bepaald. Vanaf de invoering van het leenstelsel in de vroege middeleeuwen tot aan de napoleontische tijd belichaamde ze in West-Europa behalve religieuze soms ook politieke macht. De paus, de bisschop van Rome, is ook soeverein staatshoofd van Vaticaanstad, maar zijn wereldlijke macht is beperkt."},{"page_url":"https://ast.wikipedia.org/wiki/C%C3%B3modu","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Jean-Leon_Gerome_Pollice_Verso.jpg","page_title":"Cómodu","context_page_description":"Lucio Aurelio Cómodu Antonino, comúnmente conocíu como Cómodu, foi emperador del Imperiu romanu ente los años 177 y 192. Fíu de Marco Aurelio y Faustina la Menor, nació en Lanuvium y foi l'últimu miembru de la dinastía Antonina. El nome dau equí ye l'oficial que recibió al so ascensu al tronu; pa ver les formes anterior y posterior vease l'apartáu Cambio de nome.\\nCómodu foi'l primer emperador qu'asocedía nel tronu al so padre dende'l reináu de Tito. El nuevu fíu de Marco Aurelio foi tamién el primer emperador «nacíu pa la púrpura», yá que yera'l primeru que, nel momentu de nacer, yá yera consideráu un herederu oficial al tronu.\\nEl so gobiernu puede estremase en dos fases:\\n177-180. Reináu conxuntu col so padre, Marco Aurelio. Nesta etapa les aiciones de Cómodu pueden definise como moderaes. Ente otres coses, Cómodu lluchó colos exércitos del Danubiu.\\n180-192. Gobiernu en solitariu. La manera de reinar del mozu foi dexenerando nuna paranoya incontrolable que llevó al Imperiu romanu a una de les sos mayores crisis dende los gobiernos de Calígula, Nerón o Domiciano.\\nA la so muerte, l'Imperiu sumir nuna dómina de guerres civiles conocida como'l Añu de los cinco emperadores."},{"page_url":"https://no.wikipedia.org/wiki/Shelby_(Montana)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Shelby_Montana_Downtown.jpg","page_title":"Shelby (Montana)","context_page_description":"Shelby er en by i Toole County Montana i USA. Den transkontinentale jernbanelinjen til BNSF Railway går gjennom denne byen. Innbyggertallet i år 2000 var på 3 216."},{"page_url":"https://it.wikipedia.org/wiki/Beatrice_Wood","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Beatrice_Wood_and_Marcel_Duchamp.jpg","page_title":"Beatrice Wood","context_page_description":"Beatrice Wood è stata un'artista e ceramista statunitense."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A6%DB%8C%D8%B3_%D9%85%D8%AC%D9%84%D8%B3_%D9%86%D9%85%D8%A7%DB%8C%D9%86%D8%AF%DA%AF%D8%A7%D9%86_%D8%A7%DB%8C%D8%A7%D9%84%D8%A7%D8%AA_%D9%85%D8%AA%D8%AD%D8%AF%D9%87_%D8%A2%D9%85%D8%B1%DB%8C%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/JosephBradleyVarnum.jpg","page_title":"رئیس مجلس نمایندگان ایالات متحده آمریکا","context_page_description":"سمت رئیس مجلس نمایندگان ایالات متحدهٔ آمریکا در ۱۷۸۹ به موجب مادهٔ اول، بند دوم قانون اساسی ایالات متحده تشکیل شد. قسمتی از آن بند چنین است: «مجلس نمایندگان باید سخنگویش را انتخاب کند…». رئیس کنونی، پال رایان جمهوری‌خواه است که نمایندگی بخش هشتم کنگره‌ای ویسکانسین را بر عهده دارد. قانون اساسی هیچ الزامی ایجاد نمی‌کند که رئیس یکی از اعضای منتخب کنگره باشد، اما تاکنون همه روسا عضو کنگره بوده‌اند.\\nدر انتخابات کنگره ایالات متحده آمریکا در سال ۲۰۱۸ حزب دموکرات موفق به کسب اکثر کرسی‌های مجلس نمایندگان شد و از تاریخ ۳ ژانویه سال ۲۰۱۹ سمت ریاست مجلس نمایندگان آمریکا در اختیار دبیرکل حزب دموکرات نانسی پلوسی قرار گرفت."},{"page_url":"https://fr.wikipedia.org/wiki/Quai_du_Havre","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/H%C3%B4tel_des_Sauvages_10.jpg","page_title":"Quai du Havre","context_page_description":"Le quai du Havre est un quai de Rouen."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D9%88%D8%B2%D8%AA%D9%88_%D9%88%D8%A7%D9%84%D9%81%D9%88%D8%B1%D8%AA%D9%88%D8%B1%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Roseto_Valfortore_064_%28RaBoe%29.jpg","page_title":"روزتو والفورتوره","context_page_description":"شابلون:Infobox Settlement\\nروزتو والفورتوره ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۱۲۰۵ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۶۵۰ متر یۇکسک‏لیکده یئر آلیب. و پولیا اوستانیندا یئرلشیب."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%80%81%E6%8C%9D%E7%BB%8F%E6%B5%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Meter_Taxi_in_Vientiane_01.jpg","page_title":"老挝经济","context_page_description":"寮國，在寮人民民主共和國統治下正在迅速增長，因為政府於1986年開始下放經濟控制權並鼓勵民營企業。目前，寮國是世界增長最快的經濟體之一，平均每年增長8％。另據預測，到2019年，寮國將至少保持7％的增長。\\n政府的主要目標包括為所有兒童實行減貧和教育，並主動成為「與鄰國土地相接」的國家。這是通過從中國雲南昆明到寮國萬象的近60億美元高速鐵路的不斷建設展示的。寮國於2011年開設了證券交易所，成為中國大陸，越南，泰國等鄰國水電供應商，地位不斷提升。在這個時期，寮國的經濟主要依靠外商直接投資來吸引海外資本，支持其持續的經濟增長。\\n儘管快速增長，寮國仍然是東南亞最貧窮的國家之一。作為一個內陸國家，它的基礎設施不足，大部分人口是非技術勞動力。然而，寮國繼續吸引外國投資，因為它與東協經濟共同體，其豐富的年輕勞動力和優惠的稅收待遇相結合。按照購買力計算，2016年該國的人均收入估計為5,700美元。"},{"page_url":"https://es.wikipedia.org/wiki/Sarukhan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Sarukhan_village%2C_Armenia.jpg","page_title":"Sarukhan","context_page_description":"Sarukhan es una localidad del raión de Gavarr, en la provincia de Gegharkunik, Armenia, con una población censada en octubre de 2011 de 8309 habitantes.\\nSe encuentra ubicada al oeste de la provincia, cerca de la costa occidental del lago Seván y de la frontera con la provincia de Kotayk'.​"},{"page_url":"https://sv.wikipedia.org/wiki/Stocksund","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Sturev%C3%A4gen_19A_2014a.jpg","page_title":"Stocksund","context_page_description":"Stocksund är en kommundel i Danderyds kommun vars bebyggelse huvudsakligen ingår som en del av tätorten Stockholm, belägen norr om Stockholm vid Lilla Värtan och Stocksundets norra strand. I kommundelen ingår även ön Tranholmen vars bebyggelse bildar en egen tätort.\\nStocksund, med sina cirka 6 800 invånare, har ett eget köpcentrum med bibliotek, restaurang och vårdcentral. Petruskyrkan från 1962 ligger på en höjd i Mörbyområdet. Stockhagens idrottsplats ligger på gränsen till Djursholm. Utmed Stocksundets stränder finns flera småbåtshamnar. Intill Stocksundsbron, på den västra sidan av E18, finns ett kontorsområde."},{"page_url":"https://pl.wikipedia.org/wiki/Triturus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Triturus_ivanbureschi_holotype_%28RMNH.RENA.47200%29_lateral.jpg","page_title":"Triturus","context_page_description":"Triturus – rodzaj płazów ogoniastych z rodziny salamandrowatych. Obejmuje kilka gatunków traszek. Występuje od Wielkiej Brytanii poprzez większą część kontynentalnej Europy do zachodnich krańców Syberii, Anatolii i regionu Morza Kaspijskiego.\\nTraszki te zamieszkują i rozmnażają się w stawach o bogatej roślinności lub podobnych im siedliskach wodnych przez okres od dwóch do sześciu miesięcy w roku, resztę czasu spędzając w cienistych, bogatych w schronienia siedliskach lądowych w pobliżu miejsc ich rozrodu. Samce uwodzą samice w zrytualizowanych pokazach, pozostawiając pod koniec spermatofor podnoszony przez samice. Po zapłodnieniu samica składa od 200 do 400 jaj, zawijając je w liście roślin wodnych. Z jaj wylęgają się larwy rozwijające się w wodzie przez od dwóch do czterech miesięcy, nim ulegną przeobrażeniu w żyjące na lądzie osobniki młodociane.\\nHistorycznie do omawianego rodzaju zaliczano większość europejskich traszek. Jednak taksonomowie podzielili go, wyróżniając rodzaje Ichthyosaura, Lissotriton i Ommatotriton. Natomiast najbliższymi krewnymi Triturus są przedstawiciele rodzaju Calotriton. Do Triturus zalicza się 8 gatunków zwierząt, podejrzewa się istnienie dziewiątego."},{"page_url":"https://es.wikipedia.org/wiki/Tauer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Tauer_Ortszentrum_1.jpg","page_title":"Tauer","context_page_description":"Tauer es un municipio situado en el distrito de Spree-Neiße, en el estado federado de Brandeburgo, a una altura de 60 metros. Su población a finales de 2016 era de 700 habs. y su densidad poblacional, 20 hab/km².​​"},{"page_url":"https://af.wikipedia.org/wiki/Ray_Charles","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Ray_Charles_%28cropped%29.jpg","page_title":"Ray Charles","context_page_description":"Ray Charles was ’n blinde Amerikaanse sanger, liedjieskrywer en pianis wat in die 1950’s en 1960’s gewild was. Sy bekendste liedjies sluit in \\"Georgia\\" en \\"I Can’t Stop Loving You\\". Hy het ’n groot invloed op soul-musiek gehad."},{"page_url":"https://sq.wikipedia.org/wiki/Fisibach","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Karte_Gemeinde_Fisibach_2010.png","page_title":"Fisibach","context_page_description":"Fisibach është një komunë në kantonin Aargau të Zvicrës."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_Boissonade","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Lucien_Cariat_plaque_-_46_rue_Boissanade%2C_Paris_14.jpg","page_title":"Rue Boissonade","context_page_description":"La rue Boissonade est une voie du 14ᵉ arrondissement de Paris, en France."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_n%C3%A4rmaste_terrestriska_exoplanetkandidater","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Gliese_667.jpg","page_title":"Lista över närmaste terrestriska exoplanetkandidater","context_page_description":"Den här listan är av exoplaneter inom 50 ljusår av solsystemet som kan vara terrestriska, eller jordlik. Planeter på denna lista tros at ha en stenig natur, och är inte gjord av gas som Jupiter eller Neptunus."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%D8%A7%D9%81%D9%86%D8%B3%D8%A8%D9%88%D8%B1%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Ravensburg_Frauentor_vom_Marienplatz.jpg","page_title":"رافنسبورق","context_page_description":"رافنسبورق دا بیر اسکی دؤولت."},{"page_url":"https://en.wikipedia.org/wiki/Grant_County_International_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/GrantCountyIntlAptWA-13july1996.jpg","page_title":"Grant County International Airport","context_page_description":"Grant County International Airport is a public use airport in the northwest United States, located six miles northwest of the central business district of Moses Lake in Grant County, Washington. Formerly a military facility, the airport is owned by the Port of Moses Lake, and its 13,500-foot runway is one of the longest in the world.\\nAccording to Federal Aviation Administration records, the airport had 1,369 passenger boardings in calendar year 2008, 2,920 enplanements in 2009, and 1,442 in 2010. It is included in the National Plan of Integrated Airport Systems for 2011–2015, which categorized it as a general aviation airport."},{"page_url":"https://en.wikipedia.org/wiki/Falcon_Heavy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Falcon_Heavy_Demo_Mission_%2840126461851%29.jpg","page_title":"Falcon Heavy","context_page_description":"The Falcon Heavy is a partially reusable heavy-lift launch vehicle designed and manufactured by SpaceX. It is derived from the Falcon 9 vehicle and consists of a strengthened Falcon 9 first stage as the center core with two additional Falcon 9-like first stages as strap-on boosters. The Falcon Heavy has the highest payload capacity of any currently operational launch vehicle, the third-highest capacity of any rocket ever to reach orbit, trailing the Saturn V and Energia, and the third-highest capacity of any orbital-class rocket ever launched successfully.\\nSpaceX conducted the Falcon Heavy's maiden launch on February 6, 2018, at 3:45 p.m. EST. The rocket carried a Tesla Roadster belonging to SpaceX founder Elon Musk, carrying a dummy dubbed \\"Starman\\", as a dummy payload. The second Falcon Heavy launch occurred on April 11, 2019 and all three booster rockets successfully returned to earth. The third Falcon Heavy launch successfully occurred on June 25, 2019. Since then, the Falcon Heavy has been certified for the National Security Space Launch program."},{"page_url":"https://en.wikipedia.org/wiki/Belanagar_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Belanagar_railway_station_in_Howrah_district_IMG_20200306_202018.jpg","page_title":"Belanagar railway station","context_page_description":"Belanagar railway station is a Kolkata Suburban Railway station on the Howrah-Bardhaman chord line operated by Eastern Railway zone of Indian Railways. It is situated at Bally Jagachha Block, Belanagar in Howrah district in the Indian state of West Bengal. Number of EMU trains stop at Belanagar railway station. This railway station is named after Bela Mitra, a freedom fighter and social activist. This was the first Railway station in India named after any Indian woman."},{"page_url":"https://en.wikipedia.org/wiki/Belanagar_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Belanagar_railway_station_in_Howrah_district_IMG_20200306_202018.jpg","page_title":"Belanagar railway station","context_page_description":"Belanagar railway station is a Kolkata Suburban Railway station on the Howrah-Bardhaman chord line operated by Eastern Railway zone of Indian Railways. It is situated at Bally Jagachha Block, Belanagar in Howrah district in the Indian state of West Bengal. Number of EMU trains stop at Belanagar railway station. This railway station is named after Bela Mitra, a freedom fighter and social activist. This was the first Railway station in India named after any Indian woman."},{"page_url":"https://fr.wikipedia.org/wiki/Odonata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/IC_Gomphidae_wing.jpg","page_title":"Odonata","context_page_description":"Les odonates sont un ordre d'insectes à corps allongé, dotés de deux paires d'ailes membraneuses généralement transparentes, et dont les yeux composés et généralement volumineux leur permettent de chasser efficacement leurs proies. Ils sont aquatiques à l'état larvaire et terrestres à l'état adulte. Ce sont des prédateurs, que l'on peut rencontrer occasionnellement dans tout type de milieu naturel, mais qui se retrouvent plus fréquemment aux abords des zones d'eau douce à saumâtre, stagnante à courante, dont ils ont besoin pour se reproduire.\\nEn langue française, le terme de libellules est en général employé sensu lato pour désigner les odonates, qui regroupent deux sous-ordres : les demoiselles et les libelles ou libellules stricto sensu. En 1996, Günter Bechly a regroupé les deux anciens sous-ordres Anisoptera et Anisozygoptera en Epiproctophora notamment par leur analogie au stade larvaire. L'ancien sous-ordre des Anisozygoptères ne compte que deux à quatre espèces selon les auteurs et les études génétiques.\\nLa science qui étudie les odonates est l'odonatologie, dont les spécialistes sont les odonatologues."},{"page_url":"https://en.wikipedia.org/wiki/Rumex_fueginus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Rumex_maritimus_sl84.jpg","page_title":"Rumex fueginus","context_page_description":"Rumex fueginus, known as American dock, golden dock, and Tierra del Fuego dock, is a flowering plant in the family Polygonaceae. Rumex fueginus was first formally named by Rodolfo Armando Phillipi. Rumex fueginus is native from Canada in northern North America to Tierra del Fuego at the southern tip of South America. It has previously been considered a subspecies or variety of Rumex maritimus, a Eurasian species."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%93%D7%A1%D7%94_%D7%A1%D7%9E%D7%95%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Samuel_family.jpg","page_title":"הדסה סמואל","context_page_description":"הדסה סמואל הייתה פעילת ציבור ישראלית, שכיהנה כיושבת ראש ויצו בארץ ישראל החל מ-1941, ויו\\"ר ויצ\\"ו העולמית בין השנים 1950-1949. בנוסף כיהנה כיו\\"ר מועצת ארגוני הנשים בארץ ישראל בין השנים 1936–1946.\\nהיא גדלה בבית בעל מעורבות חברתית גדולה, דיברה שפות רבות והייתה דמות שאפתנית ודעתנית. לסמואל היו קשרים ענפים עם ראשי הישוב העברי וכן עם גורמים בכירים בממשל הבריטי בארץ ישראל ומעמדה פתח בפניה דלתות רבות. כל אלו הפכו אותה לאישה המתאימה ביותר להובלת מהלך גיוס הנשים העבריות לחיל העזר לנשים של הצבא הבריטי בתקופת מלחמת העולם השנייה, מהלך פורץ דרך, אותו יזמה וקידמה ביתר שאת. בנוסף, פעלה נמרצות למען שיתופן המלא של הנשים היהודיות בארץ בפעילות הפוליטית והציבורית."},{"page_url":"https://de.wikipedia.org/wiki/Ferrari_250_Testa_Rossa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Ferrari_250_Testa_Rossa_IAA_2019_JM_0875.jpg","page_title":"Ferrari 250 Testa Rossa","context_page_description":"Der Ferrari 250 Testa Rossa oder kurz TR ist ein von 1957 bis 1961 in verschiedenen Versionen von dem italienischen Automobilhersteller Ferrari gebauter Rennsportwagen. Der Name Testa Rossa geht auf die roten Ventildeckel der Motoren zurück. Ein Ferrari 250 Testa Rossa aus dem Baujahr 1957 wurde am 17. Mai 2009 für umgerechnet 9,02 Millionen Euro in Maranello versteigert."},{"page_url":"https://en.wikipedia.org/wiki/RER_B","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Inside_the_RER_B_going_to_Paris_-_2019-02-14.jpg","page_title":"RER B","context_page_description":"RER B is one of the five lines in the Réseau Express Régional, a hybrid suburban commuter/rapid transit system serving Paris, France and its suburbs. The 80 km RER B line crosses the Paris region from north to south, with all trains serving a group of stations in central Paris, before branching out towards the ends of the line.\\nThe line runs from the northern termini Aéroport Charles de Gaulle and Mitry-Claye to the southern termini Robinson and Saint-Rémy-lès-Chevreuse.\\nFirst opened: 9 December 1977\\nLength: 80.0 km\\nNumber of stops: 47\\nTraffic: 165 million journeys per annum\\nThe southern part of the line is operated by the RATP, and the northern part by the SNCF. Trains are owned by either company.\\nUntil December 2009, drivers changed at Gare du Nord; RATP and SNCF drivers now operate their trains along the full length of the line. Trains moving from one network to the other at this station is known as the Interconnexion."},{"page_url":"https://pt.wikipedia.org/wiki/Mic_Michaeli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Mic_Michaeli_in_Lakselv_2008.jpg","page_title":"Mic Michaeli","context_page_description":"Gunnar Mathias Michaeli é um músico sueco. Ele é conhecido como tecladista na banda de rock Europe. Michaeli assim como os outros membros da banda viveu e cresceu no subúrbio de Upplands Väsby em Estocolmo. Filho de pai polonês de origem alemã e mãe sueca, entrou na banda em 1984 na turnê do álbum Wings of Tomorrow, a princípio como membro de apoio, e depois passou a ser membro oficial."},{"page_url":"https://pl.wikipedia.org/wiki/Hrabstwo_Polk_(Iowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Polk_County_Court_House.jpg","page_title":"Hrabstwo Polk (Iowa)","context_page_description":"Hrabstwo Polk – hrabstwo położone w USA w stanie Iowa z siedzibą w mieście Des Moines."},{"page_url":"https://pt.wikipedia.org/wiki/Abadia_de_L%C3%A9rins","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Plan_de_l%27abbaye_de_L%C3%A9rins.jpg","page_title":"Abadia de Lérins","context_page_description":"Abadia de Lérins é um mosteiro cisterciense na ilha de Saint-Honorat, uma das ilhas Lérins, na Riviera Francesa, com uma comunidade monástica ativa.\\nExiste uma comunidade monástica lá desde o século V. A construção dos atuais edifícios do mosteiro começou por volta de 1073. Hoje, os monges cultivam vinhedos e produzem vinho e licor."},{"page_url":"https://de.wikipedia.org/wiki/HS_Timber_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Schweighofer_Sawmill_Sebes.jpeg","page_title":"HS Timber Group","context_page_description":"Die HS Timber Group GmbH firmierte bis 2019 als Holzindustrie Schweighofer Gruppe und ist ein Unternehmen der Evergreen Privatstiftung.\\nHolzindustrie Schweighofer war Teil der Schweighofer Gruppe und hat seine Wurzeln in einem österreichischen Familienunternehmen mit mehr als 400 Jahren Tradition im Holzgeschäft. Kernbereiche der Gruppe sind heute die Holzindustrie, Forstwirtschaft, Bioenergieerzeugung und Immobilienentwicklung.\\nSeit 2002 ist die Schweighofer in Rumänien aktiv. 2003 wurde dort das erste Sägewerk eröffnet. Heute beschäftigt das Unternehmen, das mittlerweile unter anderem auch in Tschechien, Bulgarien, Deutschland und der Ukraine tätig ist, über 3.100 Mitarbeiter an fünf verschiedenen Produktionsstandorten in Rumänien und ist in Europa ein führendes Unternehmen im Bereich der Holzverarbeitung."},{"page_url":"https://ro.wikipedia.org/wiki/I%C5%82%C5%BCa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Ilza3_%28js%29.jpg","page_title":"Iłża","context_page_description":"Iłża este un oraș în Polonia."},{"page_url":"https://it.wikipedia.org/wiki/New_York_Knicks","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Danilo_Gallinari_Knicks_2010.jpg","page_title":"New York Knicks","context_page_description":"I New York Knicks, o New York Knickerbockers, dall'antico appellativo degli abitanti di New York, sono una delle trenta squadre di pallacanestro che militano nel massimo campionato professionistico statunitense, la NBA."},{"page_url":"https://fr.wikipedia.org/wiki/Suparna_Airlines","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/B-1340%40PEK_%2820200715104241%29.jpg","page_title":"Suparna Airlines","context_page_description":"Suparna Airlines est une compagnie aérienne cargo chinoise, basée à Shanghai en République populaire de Chine. Elle est également connue sous le nom de Yangtze River Express"},{"page_url":"https://es.wikipedia.org/wiki/Juan_O%27Gorman","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/242292072_ab49824e72_b.jpg","page_title":"Juan O'Gorman","context_page_description":"Juan O'Gorman ​ fue un destacado pintor y arquitecto mexicano, hermano del historiador Edmundo O'Gorman."},{"page_url":"https://io.wikipedia.org/wiki/Paul-Henri_Spaak","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Bundesarchiv_Bild_183-39998-0427%2C_Paul-Henri_Spaak.jpg","page_title":"Paul-Henri Spaak","context_page_description":"Paul-Henri Charles Spaak esis chefministro di Belgia tri foyi: de 1938 til 1939, de 13 til 31 di marto 1946 e de 1947 til 1949."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%87%D9%8A%D9%83%D8%AA%D9%88%D8%B1_%D8%A7%D9%88%D9%84%D9%8A%DA%A4%D8%A7%D8%B1%D9%8A%D8%B3_%D8%B3%D9%88%D9%84%D9%8A%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/H%C3%A9ctor_Luis_Olivares_Sol%C3%ADs.jpg","page_title":"هيكتور اوليڤاريس سوليس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nهيكتور اوليڤاريس سوليس كان سياسى من تشيلى."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D8%A7%D8%B3%D9%8A%D9%84_%D8%A8%D9%88%D8%AF%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Russell_Bodine_2013.jpg","page_title":"راسيل بودين","context_page_description":"راسيل بودين ‏ هو لاعب كرة قدم أمريكية أمريكي، ولد في 30 يونيو 1992 في Woodbridge في الولايات المتحدة."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E7%BB%B4%E7%AC%83%E4%BA%8C%E4%B8%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/153-Victor_II.jpg","page_title":"维笃二世","context_page_description":"教宗維篤二世本名多爾恩斯泰恩-希爾施貝爾格的格布哈爾德，於施瓦本出生，於1055年4月13日至1057年7月28日岀任教宗。"},{"page_url":"https://nn.wikipedia.org/wiki/Wallsend","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/St_Peter%27s_Church%2C_Wallsend_-_geograph.org.uk_-_92992.jpg","page_title":"Wallsend","context_page_description":"Wallsend er ein by i North Tyneside i Tyne and Wear i England. Namnet til byen kjem av at han ligg der Hadrianmuren i si tid slutta. Byen har ligg over 40 000 innbyggjarar."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Zwernitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Grundriss_Burg_Zwernitz.png","page_title":"Burg Zwernitz","context_page_description":"Die Burg Zwernitz ist eine in ihren Ursprüngen mittelalterliche Burganlage in der zum Markt Wonsees gehörenden Ortschaft Sanspareil im Landkreis Kulmbach, Regierungsbezirk Oberfranken in Bayern. Seit 1745 ist die Burg Bestandteil des von Wilhelmine von Brandenburg-Bayreuth geschaffenen Felsengartens Sanspareil."},{"page_url":"https://sv.wikipedia.org/wiki/Richard_Riemerschmid","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f4/Riemerschmid_lores.jpg","page_title":"Richard Riemerschmid","context_page_description":"Richard Riemerschmid, född 20 juni 1868 i München, död 13 april 1957 i München, var en tysk arkitekt, konstnär och möbelformgivare.\\nRiemerschmid anses vara en av Tysklands främsta arkitekter från jugendperioden.\\nHan har bland annat ritat en fabriksanläggning för Deutsche Werkstätten für Handwerkskunst i Dresdner-Hellerau. Han deltog i bildandet av Deutscher Werkbund 1907 och undervisade vid Kunstgewerbeschule i München 1913-1924."},{"page_url":"https://fi.wikipedia.org/wiki/Lapin_Agile","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Fr%C3%A9d%C3%A9_et_Boronali.jpg","page_title":"Lapin Agile","context_page_description":"Lapin Agile on yksi Pariisin monista kabareista, ja se sijaitsee Montmartren kukkulalla, Pariisin 18. arrondissementissa. Lapin Agile perustettiin 1800-luvun lopulla, ja sen toiminta jatkuu edelleen. Vuonna 1913 Aristide Bruant osti paikan, minkä jälkeen siitä tuli suosittu erityisesti boheemien taiteilijapiirien tapaamispaikkana.\\nLähin metroasema on Lamarc – Caulaincourt."},{"page_url":"https://pl.wikipedia.org/wiki/Dury_(Somma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Dury_%28Somme%29_France_%282%29.JPG","page_title":"Dury (Somma)","context_page_description":"Dury – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Somma.\\nWedług danych na rok 1990 gminę zamieszkiwało 1341 osób, a gęstość zaludnienia wynosiła 122 osoby/km²."},{"page_url":"https://ro.wikipedia.org/wiki/Cernogorsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Coat_of_Arms_of_Chernogorsk_%28Khakassia%29.png","page_title":"Cernogorsk","context_page_description":"Cernogorsk este un oraș din Republica Hacasia, Federația Rusă și are o populație de 73.077 locuitori."},{"page_url":"https://az.wikipedia.org/wiki/Banksia_aculeata","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Banksia_aculeata.JPG","page_title":"Banksia aculeata","context_page_description":"Banksia aculeata – proteyakimilər fəsiləsinin banksiya cinsinə aid bitki növü."},{"page_url":"https://vi.wikipedia.org/wiki/Ain","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/BV_Gare_de_Bourg_en_Bresse.JPG","page_title":"Ain","context_page_description":"Ain là một tỉnh của Pháp. Tỉnh này được đặt tên theo sông Ain ở rìa phía đông của nước Pháp. Tỉnh này thuộc vùng Auvergne-Rhône-Alpes và giáp với sông Saône và sông Rhône. Tỉnh Ain có vị trí địa lý thuận lợi, có hệ thống giao thông phát triển với các đường bộ cao tốc, đường sắt cao tốc TGV và gần các sân bay như sân bay quốc tế Lyon và sân bay quốc tế Geneva.\\nAin gồm có bốn khu vực địa lý khác nhau và mỗi nơi có một đặc điểm riêng của mình - góp phần vào sự đa dạng và sự phát triển năng động kinh tế của tỉnh này. Trong khu vực Bresse nông nghiệp và công nghiệp-nông nghiệp chủ yếu trồng các loại ngũ cốc, chăn nuôi gia súc, sản xuất sữa và pho mát cũng như chăn nuôi gia cầm. Tại Dombes, ngư nghiệp có vai trò quan trọng còn Bugey có nghề trồng nho phát triển. Việc đa dạng hóa cao của ngành công nghiệp của bộ phận được đi kèm với sự hiện diện mạnh mẽ của ngành sản xuất chất dẻo trong và xung quanh Oyonnax.\\nAin thuộc các tỉnh có nền kinh tế tăng trưởng nhanh nhất trong các tỉnh của Pháp, tỷ lệ thất nghiệp của tỉnh này thấp hơn nhiều mức trung bình của quốc gia và khu vực."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BB%D0%BB%D0%B0%D0%B4%D1%96%D0%B3%D0%B0_(%D0%90%D0%BB%D0%B0%D0%B1%D0%B0%D0%BC%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Orange_Vale_%28Lawler_House%29.jpg","page_title":"Талладіга (Алабама)","context_page_description":"Талладіга — місто в США, в окрузі Талладіга штату Алабама. Населення — 15 676 осіб."},{"page_url":"https://pt.wikipedia.org/wiki/B%C4%83tr%C3%A2na","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Batrana_jud_Hunedoara.png","page_title":"Bătrâna","context_page_description":"Bătrâna é uma comuna romena localizada no distrito de Hunedoara, na região histórica da Transilvânia. A comuna possui uma área de 85.00 km² e sua população era de 161 habitantes segundo o censo de 2007."},{"page_url":"https://fr.wikipedia.org/wiki/Dracaena_fragrans","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Fiore_di_Dracaena_fragrans.jpg","page_title":"Dracaena fragrans","context_page_description":"Dracaena fragrans, le dragonnier parfumé ou dragonnier d'Afrique tropicale, communément appelé simplement dragonnier, est une espèce de plantes de la famille des Liliacées selon la classification classique ou des Asparagaceae selon la classification phylogénétique, originaire d'Afrique tropicale. Elle est très répandue comme plante d'appartement pour son beau feuillage très souvent panaché et pour sa facilité de culture.\\nAux Antilles françaises, où il est connu sous le nom de sandragon, on le cultive pour constituer des haies brise-vent en zone bananière et comme arbuste ornemental dans les jardins. Il est aussi très communément cultivé dans les jardins tropicaux du monde entier."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%90%D1%80%D0%B3%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Argon_ice_1.jpg","page_title":"Аргон","context_page_description":"Aргон — элементи гурӯҳи 18 системаи даврии элементҳои химиявӣ даври сеюми ҷадвали даврии элементҳои химиявии Менделеев мебошад. Рақами атомиаш 18 буда, бо рамзи Ar тасвир карда мешавад. Сеюм элементи паҳншудатарин дар атмосфераи замин - 0,93% аз ҳаҷми ҳавои заминро ишғол мекунад. Aргон моддаи содда - гази инертии ғайрифаъол ранг, бӯй ва таъм надорад."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%82%B9%E7%A7%89%E6%96%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Zou_Bingwen.jpg","page_title":"邹秉文","context_page_description":"邹秉文，原籍江苏苏州，生于广东广州，中国农学家、农业教育家、植物病理学家、社会活动家。中国近代农业科研、教育和建设事业的创始人之一。"},{"page_url":"https://fr.wikipedia.org/wiki/James_Condamin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Ozanam_-_Semaine_religieuse_du_dioc%C3%A8se_de_Lyon_23_mai_1913.jpg","page_title":"James Condamin","context_page_description":"James Condamin, né le 22 mars 1844 à Saint-Chamond et mort le 4 mai 1929 à Lyon, est un prêtre, chanoine, qui fut professeur de littérature à la Faculté catholique de Lyon.\\nIl est l'auteur de nombreux ouvrages d'histoire littéraire et d'érudition religieuse ainsi que de récits de voyages. Il est enterré dans le cimetière de Saint-Chamond."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_du_Pays_valencien","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Pantano_de_Elche.jpg","page_title":"Histoire du Pays valencien","context_page_description":"L'histoire du Pays valencien est fortement conditionnée par la localisation du territoire, au bord de la mer Méditerranée, sur le levant de la péninsule Ibérique. Elle est foncièrement marquée par trois invasions : la romanisation entamée au IIᵉ siècle av. J.-C., l'occupation musulmane au VIIIᵉ siècle et la conquête et fondation du royaume de Valence par Jacques Ier d'Aragon au XIVᵉ siècle."},{"page_url":"https://ca.wikipedia.org/wiki/Colt%27s_Manufacturing_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Colt_Armory_%281857%29.jpg","page_title":"Colt's Manufacturing Company","context_page_description":"La Colt's Manufacturing Company és una empresa fabricant d'armes de foc dels Estats Units. La seva primera fàbrica va ser fundada en 1836 per Samuel Colt. Colt és el més fabricant d'armes més conegut en l'enginyeria, producció i comercialització de les armes de foc durant la segona meitat del segle XIX i la major part del segle XX. Els primers dissenys de Colt van jugar un paper important en la popularització del revòlver i en el canvi de les pistoles anteriors d'un sol tir. Mentre que Sam Colt no va inventar el concepte de revòlver, els seus primers dissenys van resultar ser un gran èxit.\\nEls productes de Colt més famosos van ser el Colt Walker, el Colt Single Action Army o el Peacemaker, i el Colt Python. John Browning va treballar per Colt per un temps, i fou el primer responsable del disseny d'una pistola semiautomàtica que va debutar com la pistola Colt M1900, i que va evolucionar amb el temps fins a arribar a la pistola Colt M1911. Malgrat que no la van desenvolupar, durant molt de temps, Colt va ser el principal responsable de la producció dels fusells AR-15 i M16, així com molts derivats d'aquestes armes de foc."},{"page_url":"https://de.wikipedia.org/wiki/Wuhlehirsk","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Vuglegirsk_gerb.png","page_title":"Wuhlehirsk","context_page_description":"Wuhlehirsk ist eine Stadt in der Oblast Donezk in der Ukraine mit etwa 7500 Einwohnern. Die Stadt liegt etwa 49 Kilometer nordöstlich der Oblasthauptstadt Donezk im Rajon Bachmut.\\nZur Stadtgemeinde zählen auch die Siedlungen Bulawyne, Hrosne, Kajutyne, Stupakowe, und Saweliwka.\\nWuhlehirsk wurde 1879 als Chazapetiwka im Zuge des Baus einer Eisenbahnstrecke gegründet und trug diesen Namen bis 1958, als es auch zur Stadt erhoben wurde. Die Stadt lebt heute vom Kohlenbergbau und der Kohleverarbeitung. Von 1958 bis 1980 fuhr im Ort die Straßenbahn, von 1982 bis 2014 verkehrten Oberleitungsbusse.\\nAm 11. Dezember 2014 wurde die Stadt aus dem Stadtkreis von Jenakijewe ausgegliedert und dem Rajon Artemiwsk angeschlossen. Während des Kampfes um Debalzewe im Ukraine-Krieg wurde die Stadt Anfang des Jahres 2015 größtenteils zerstört und steht seit Februar 2015 unter der Kontrolle von pro-russischen Rebellen."},{"page_url":"https://it.wikipedia.org/wiki/San_Giorgio_(Brunico)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/SchwemmkegelGoas.jpg","page_title":"San Giorgio (Brunico)","context_page_description":"San Giorgio è una frazione del comune italiano di Brunico, in provincia di Bolzano, situata lungo il torrente Aurino a circa 1,5 km dal centro del capoluogo locale, dal quale la dividono dei terreni denominati Rienzfelder.\\nCentro abitato dalla lunga storia autonoma, fino al 1927 fu un comune autonomo. Oltre alla chiesa che ha dato il nome al paese, le cui origini si perdono nel tempo, numerosi edifici del borgo ne testimoniano il fiorente passato.\\nIl paese ha conservato molte usanze e tradizioni di antica genesi, caratterizzandosi altresì per una vivace attività associazionistica: vi hanno infatti sede, tra l'altro, un corpo di pompieri volontari e una banda musicale."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D0%B5%D0%B0%D0%BF%D0%B0%D0%BB%D1%96%D1%82%D0%B0%D0%BD%D1%81%D0%BA%D1%96_%D1%9E%D0%BD%D1%96%D0%B2%D0%B5%D1%80%D1%81%D1%96%D1%82%D1%8D%D1%82_%D1%96%D0%BC%D1%8F_%D0%A4%D1%80%D1%8B%D0%B4%D1%80%D1%8B%D1%85%D0%B0_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/FedericoII.jpg","page_title":"Неапалітанскі ўніверсітэт імя Фрыдрыха II","context_page_description":"Неапалітанскі ўніверсітэт — адзін з найстарэйшых універсітэтаў у Еўропе. Быў заснаваны 5 чэрвеня 1224 у Неапалі, як дзяржаўная ўстанова адукацыі Каралеўства Сіцылія. Універсітэт носіць імя імператара Свяшчэннай Рымскай імперыі Фрыдрыха II, у час уладарання якога Неапалітанскі ўніверсітэт прыняў першых студэнтаў. Партрэт Фрыдрыха змешчаны на ўніверсітэцкай пячатцы. Кароль, жадаючы дэцэнтралізаванага навучання ў Італіі, пайшоў супраць волі Папы рымскага і Неапалітанскі ўніверсітэт стаў першым універсітэтам у Еўропе, які дзейнічаў без папскай булы.\\nВа ўніверсітэце Неапаля выкладаюць 3000 педагогаў, сярод іх больш за дзвесце прафесараў."},{"page_url":"https://de.wikipedia.org/wiki/Ca%E2%80%99_da_Mosto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Paolo_Monti_-_Servizio_fotografico_%28Venezia%2C_1969%29_-_BEIC_6330557.jpg","page_title":"Ca’ da Mosto","context_page_description":"Die Ca’ da Mosto ist ein Palast aus dem 13. Jahrhundert in Venedig und das älteste Gebäude am Canal Grande. Er liegt nicht weit von der Rialtobrücke entfernt im Sestiere Cannaregio zwischen dem Casa Zago und dem Palazzo Dolfin."},{"page_url":"https://en.wikipedia.org/wiki/Glen_Roy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/NN2985_Glen_Roy_%26_parallel_roads.jpg","page_title":"Glen Roy","context_page_description":"Glen Roy in the Lochaber area of the Highlands of Scotland is a glen or valley much of which is designated as a national nature reserve noted for the geological phenomenon of the three 'roads'.\\nThe \\"Parallel Roads\\" of Glen Roy are loch terraces that formed along the shorelines of an ancient ice-dammed loch. The loch existed during a brief period of climatic deterioration, during a much longer period of deglaciation, subsequent to the last main ice age. From a distance they resemble man-made roads running along the side of the Glen, hence the name.\\nThe glen runs north from Glen Spean which takes the main A86 trunk road and the railway of the West Highland Line, both running about a further 23 kilometres southwest via Spean Bridge to Fort William. The village of Roybridge and Roy Bridge railway station are sited where the River Roy joins the River Spean, and from there a narrow single track road runs north up the glen for almost 16 kilometres to Brae Roy Lodge."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%B1%D9%86%DB%8C%D8%8C_%D8%A7%DB%8C%D9%86%D8%AF%DB%8C%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Clock_tower_in_Berne%2C_Indiana.jpg","page_title":"برنی، ایندیانا","context_page_description":"برنی، ایندیانا آمریکانین ایندیانا ایالتیندا یئر آلان بیر شهردیر و ۵٫۳۹ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۳۹۹۹ نفر و اها‌لی سیخلیغی ۷۴۲٫۳ اینسان کیلومتر موربّع دیر. بۇ شهر ۲۵۷ متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر."},{"page_url":"https://eo.wikipedia.org/wiki/Flughaveno_Bruselo_Nacia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Brussels_National_Terminal_A.jpg","page_title":"Flughaveno Bruselo Nacia","context_page_description":"La Flughaveno Bruselo Nacia, ankaŭ \\"Flughaveno de Zaventem\\" estas la nacia flughaveno de Belgio. Ĝi troviĝas en la flandra komunumo Zaventem. La urbo Bruselo troviĝas je distanco de 12 kilometroj. Temas pri la plej granda flughaveno de Belgio kun surfaco de 1245 hektaroj, ĉirkaŭ 264.000 flugoj kaj 18 milionoj da pasageroj jare.\\nLa flughaveno estas mastrumata de la kompanio Brussels International Airport Company, pli bone konata sub la mallongigo BIAC. La plej grava akciulo de BIAC estas la aŭstralia grupo Macquarie kun 70 % de la akcioj; la ceteron posedas la belga ŝtato. En la flughaveno de Zaventem la firmaoj SN Brussels Airlines, Virgin Express kaj DHL havas gravajn ŝanĝejojn."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%95%E1%83%94%E1%83%A1%E1%83%A2%E1%83%A4%E1%83%98%E1%83%A0%E1%83%93%E1%83%98%E1%83%A0%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Iceland2008-Latrabjarg.cliff.JPG","page_title":"ვესტფირდირი","context_page_description":"ვესთფირდირი — ნახევარკუნძული და რეგიონი ისლანდიაში."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B0%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%84%D1%80%D0%B0%D0%BD%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/100_saar_franken.jpg","page_title":"Саарський франк","context_page_description":"Саарский франк — грошова одиниця Території Саарського басейну з 1918 по 1935, і Протекторату Саар з 1947 по 1959 рік. Його курс до французького франка становив 1: 1."},{"page_url":"https://cy.wikipedia.org/wiki/Creighton,_Missouri","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/MOMap-doton-Creighton.png","page_title":"Creighton, Missouri","context_page_description":"Dinas yn Cass County, yn nhalaith Missouri, Unol Daleithiau America yw Creighton, Missouri."},{"page_url":"https://eo.wikipedia.org/wiki/Oberma%C3%9Ffeld-Grimmenthal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Oberma%C3%9Ffeld-Grimmenthal_in_SM.png","page_title":"Obermaßfeld-Grimmenthal","context_page_description":"Obermaßfeld-Grimmenthal estas komunumo en Germanio. Ĝi troviĝas en la distrikto Schmalkalden-Meiningen de la federacia lando Turingio, kaj krome estas parto de komunumaro, do grupiĝo de pluraj najbaraj komunumoj por komuna plenumo de iuj administraj servoj, nomata Verwaltungsgemeinschaft Dolmar-Salzbrücke. Fine de decembro 2015 la nova urba komunumo havis 1 213 loĝantojn. La areo situas en la geografia regiono Turingia Arbaro. En Grimmenthal estis ĝis forigo dum Reformacio konata pilgrimadkapelo."},{"page_url":"https://ceb.wikipedia.org/wiki/Rawlings_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Rawlings_Park.jpg","page_title":"Rawlings Park","context_page_description":"Parke ang Rawlings Park sa Ostralya. Nahimutang ni sa estado sa State of New South Wales, sa habagatan-sidlakang bahin sa nasod, 160 km sa kasadpan sa Canberra ang ulohan sa nasod. 200 metros ibabaw sa dagat kahaboga ang nahimutangan sa Rawlings Park.\\nAng yuta palibot sa Rawlings Park kay kasagaran patag, apan sa habagatan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 301 ka metro ug 2.9 km sa amihanan-kasadpan sa Rawlings Park. Ang kinadul-ang mas dakong lungsod mao ang Wagga Wagga, 5.2 km sa amihanan-kasadpan sa Rawlings Park.\\nHapit nalukop sa kaumahan ang palibot sa Rawlings Park. Dunay mga 12 ka tawo kada kilometro kwadrado sa palibot sa Rawlings Park may gamay nga populasyon. Ang klima umogon ug subtropikal. Ang kasarangang giiniton 17 °C. Ang kinainitan nga bulan Enero, sa 30 °C, ug ang kinabugnawan Hulyo, sa 6 °C. Ang kasarangang pag-ulan 716 milimetro matag tuig. Ang kinabasaan nga bulan Marso, sa 99 milimetro nga ulan, ug ang kinaugahan Oktubre, sa 32 milimetro."},{"page_url":"https://et.wikipedia.org/wiki/Surat_Thani","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Seal_of_Surat_Thani.png","page_title":"Surat Thani","context_page_description":"Surat Thani on linn Tais, Surat Thani provintsi keskus. Asub Tai lahe kaldal, Tapi jõe suudmes.\\n1915. aastani oli linna nimi Bandon.\\n20 km kaugusel linnast asub Surat Thani lennujaam."},{"page_url":"https://pt.wikipedia.org/wiki/Acanthostichus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Acanthostichus_arizonensis_casent0103128_profile_1.jpg","page_title":"Acanthostichus","context_page_description":"Acanthostichus é um gênero de insetos, pertencente a família Formicidae."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B4%A5%E7%94%B0%E6%B2%BC%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Tsudanuma_Parco.jpg","page_title":"津田沼駅","context_page_description":"津田沼駅は、千葉県習志野市津田沼一丁目にある、東日本旅客鉄道総武本線の駅である。運行系統としては快速線を走行する総武快速線、緩行線を走行する総武緩行線の2系統が停車する。駅番号は快速線がJO 26、緩行線がJB 33。新京成電鉄新京成線の新津田沼駅は相互乗換駅である。"},{"page_url":"https://sv.wikipedia.org/wiki/Andriy_Illenko","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Illenko100.jpg","page_title":"Andriy Illenko","context_page_description":"Andrij Illenko, född 24 juni 1987 i Kiev, Ukrainska SSR, Sovjetunionen, är en ukrainsk politiker medlem av Svoboda.\\nIllenko var tillsammans med två andre parlamentsledamöter från partiet Svoboda; Ihor Mirosjnitjenko och Bohdan Beniuk med till att tränga sig in i TV-kanalen Persjyj Natsionalnyjs högkvarter i Kiev och angripa direktören Oleksandr Pantelejmonov och tvingade honom att under hugg och slag underteckna sin egen avskedsansökan. En videoupptagning av hur de misshandlar Pantelejmonov fick enorm spridning på Internet. Svoboda lade själv ut videon på nätet, som vidarepublicerades av webbtidningen Ukrainska Pravda. De tre politikerna ses där högljutt ifrågasätta att Persjyj Natsionalnyj tidigare samma dag hade sänt den ryske presidenten Vladimir Putins tal om Rysslands annektering av Krimhalvön. De tre våldsmännen fördömdes efteråt samstämmigt av ukrainska politiker. ”Helt oacceptabelt”, förklarade premiärminister Arsenij Jatsenjuk och Vitalij Klytjko krävde att de tre männen lämnar sina parlamentsplatser. Även partiledaren för Svoboda, Oleh Tiahnybok, tog avstånd från angreppet. Amnesty International och Reportrar utan gränser stämde in i fördömandena."},{"page_url":"https://en.wikipedia.org/wiki/R259_road_(Ireland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/R259_Regional_Route_Shield_Ireland.png","page_title":"R259 road (Ireland)","context_page_description":"The R259 road is a regional road in Ireland, located in County Donegal. It is a scenic route around the coast of The Rosses."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B1%D8%A7%D9%8A%DA%A4%D9%8A%D8%B3_%D8%A8%D9%84%D9%88%D9%85%D9%81%D9%8A%D9%84%D8%AF%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Raivis_Blumfelds.jpg","page_title":"رايڤيس بلومفيلدس","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nرايڤيس بلومفيلدس سياسى من لاتفيا."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%86%D9%82%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Tn_Dates_Angou.JPG","page_title":"أنقو","context_page_description":"أنقو هو أحد أنواع التمور التونسية، وتنتجه واحات بلاد الجريد بينما هو غير معروف في واحات نفزاوة. هذا التمر يشبه تمر الكنتيشي من حيث صغر الحجم إذ لا يتعدى طوله 3 صم، وكذا من حيث جفافه، بما يسهل نقله ليباع في الأسواق التونسية. كما يشبهه من حيث ثمنه إذ بيع الكلغ الواحد من كليهما في أواخر سبتمبر 2008 بدينار واحد مقابل ما يقرب من أربعة دنانير بالنسبة للدقلة."},{"page_url":"https://en.wikipedia.org/wiki/Gotse_Delchev","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Gotse_Delchev_and_Cheta_Postcard_1904.jpg","page_title":"Gotse Delchev","context_page_description":"Georgi Nikolov Delchev, known as Gotse Delchev or Goce Delčev, was an important Bulgarian revolutionary figure in Ottoman-ruled Macedonia and Thrace at the turn of the 20th century. He was the most prominent leader of what is known today as Internal Macedonian Revolutionary Organization, a paramilitary organization active in Ottoman territories in the Balkans, at the end of the 19th and the beginning of the 20th century. Delchev was its representative in Sofia, the capital of Principality of Bulgaria. As such he was elected also a member of the Supreme Macedonian-Adrianople Committee, participating in the work of its governing body.\\nBorn into a Bulgarian family in Kilkis, then in the Salonica Vilayet of the Ottoman Empire, in his youth he was inspired by the ideals of earlier Bulgarian revolutionaries such as Vasil Levski and Hristo Botev, who envisioned the creation of a Bulgarian republic of ethnic and religious equality, as part of an imagined Balkan Federation."},{"page_url":"https://da.wikipedia.org/wiki/Chancellor_of_the_Exchequer","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Ken_Clarke_2010.jpg","page_title":"Chancellor of the Exchequer","context_page_description":"Chancellor of the Exchequer er den titel, som bæres af en den britiske minister i kabinettet med ansvar for regeringens økonomiske og finansielle politik og styring. Normalt kaldes han kansleren. Kansleren er den øverst ansvarlige minister i det ministerielle departement Her Majesty’s Treasury, der svarer til det danske finansministerium. Posten er et af de fire højeste statsembeder og er i nyere tid det næsthøjeste embede i Storbritannien, kun overgået af premierministeren og justitsministeren: lord kansleren.\\nForuden titlen kansler er han også Second Lord of the Treasury. Premierministeren har titlen som First Lord of the Treasury."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B5%B7%E4%B8%8A%E8%87%AA%E8%A1%9B%E9%9A%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/LCAC-55_maneuvers_to_enter_the_well_deck.jpg","page_title":"海上自衛隊","context_page_description":"海上自衛隊，簡稱海自，是日本自衛隊的海上部隊，成立於1954年7月1日，全體武職人員稱「海上自衛官」。由於現行日本國憲法的限制，因此編制上跟武器都是偏重防衛，原則上不配備具侵略性的艦種以及兵種，編制有限的防衛預算並透明化，但是軍艦的水準與噸位、裝備等仍維持世界主流水準。其主要任務是防衛日本領海，但近年來開始參與聯合國維和行動。\\n目前兵力約45500人左右，共擁有各式艦艇152艘，擁有4個八八艦隊，主要基地5座。與陸上自衛隊不同，海上自衛隊則允許沿用第二次世界大戰前的軍旗，其成員與日本俗稱的舊軍之間的關係與軍紀的傳承也較為密切，甚至也保留了禮拜五吃咖哩飯的習慣。"},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B5%8D%E0%B4%B0%E0%B4%BF%E0%B4%B8%E0%B5%8D%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%80%E0%B4%A8_%E0%B4%B2%E0%B5%86%E0%B4%97%E0%B4%BE%E0%B5%BC%E0%B4%A6%E0%B5%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Christine_Lagarde_Signature.jpg","page_title":"ക്രിസ്റ്റീന ലെഗാർദെ","context_page_description":"2011 ജൂലൈ മുതൽ 2019 നവംബർ വരെ അന്താരാഷ്ട്ര നാണയ നിധിയുടെ അഥവാ ഐ.എം.എഫ്-ന്റെ അധ്യക്ഷയും 2019 നവംബർ മുതൽ യൂറോപ്യൻ സെൻട്രൽ ബാങ്കിന്റെ പ്രസിഡന്റുമായി സേവനമനുഷ്ടിക്കുന്ന ഫ്രഞ്ച് രാഷ്ട്രീയ പ്രവർത്തകയും അഭിഭാഷകയുമാണ് ക്രിസ്റ്റീന ലെഗാർദെ. ഈ സംഘടനയുടെ പ്രഥമ വനിതാ മേധാവിയാണ് ക്രിസ്റ്റീന. ഫ്രഞ്ച് ധനകാര്യ മന്ത്രിയായിരുന്ന ഇവർ അതിനു മുൻപ് കൃഷിവകുപ്പ് മന്ത്രിയായും വാണിജ്യവകുപ്പ് മന്ത്രിയായും സേവനം അനുഷ്ടിച്ചിട്ടുണ്ട്. മുൻ ഐ.എം.എഫ് മേധാവി ഡൊമനിക് സ്ട്രാസ്‌കാൻ ലൈംഗിക അപവാദക്കേസിൽ അറസ്റ്റിലായതിനെ തുടർന്ന് സ്ഥാനം രാജിവെച്ചതോടെയാണ് പുതിയ മേധാവിയെ തെരഞ്ഞെടുക്കേണ്ടതായി വന്നത്. അഗസ്റ്റിൻ കാസ്റ്റൻസിനെയെയാണ്‌ ക്രിസ്റ്റീന പരാജയപ്പെടുത്തിയത്‌. അമേരിക്കയുടെയും യൂറോപ്യൻ രാജ്യങ്ങളുടെയും ഒപ്പം ഇന്ത്യയുടെയും പിന്തുണ ക്രിസ്റ്റീനക്കുണ്ടായിരുന്നു.\\nഫ്രാൻസിലെ ധനമന്ത്രി ആയി പ്രവർത്തിച്ചു വരികയായിരുന്നു അവർ. മെക്സിക്കോയുടെ കേന്ദ്ര ബാങ്കിന്റെ മേധാവി ആയ അഗസ്റ്റിൻ കാർസ്പെന്സിനെ വോട്ടെടുപ്പിൽ പരാജയപ്പെടുത്തിയാണ് ലാഗാർദെ ഈ പദവിയിൽ എത്തിയത്. ഐ.എം.എഫ് മാനേജിംഗ് ഡയറക്ടർ ആകുന്ന അഞ്ചാമത്തെ ഫ്രാൻസ് സ്വദേശി ആണ് ലഗാർദെ."},{"page_url":"https://nv.wikipedia.org/wiki/Bolbolii_%C3%ADiyis%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Brown-breasted_Bulbul.jpg","page_title":"Bolbolii íiyisígíí","context_page_description":"Bolbolii íiyisígíí éí tsídii tsídígíí dah yikahjí atah daasdzoh, áádóó éí Naakaii Łizhiní Bikéyahdi dóó Naakaii Dootłʼizhii Bikédaayah dóó Shádiʼááhjí Binááʼádaałtsʼózíidi dahólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Pycnonotus\\" deiłníigo deiyózhí. Bolbolii íiyisígíí éí 49 ałʼąą ádaatʼé.\\nDíí tsídii éí 7–9di asdzoh ádaníłtso łeh. Bitsʼíís éí łibá dóó yishtłizhgo łitso łeh; łaʼ éí daalgai dóó daalzhin.\\nBolbolii íiyisígíí éí naʼashjéʼii dóó chʼosh yázhí dóó wóʼałtaasʼéí deildeeł."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E9%80%A3%E5%90%88%E5%9B%BD%E3%81%AE%E5%9B%BD%E6%97%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Confederate_Rebel_Flag.svg","page_title":"アメリカ連合国の国旗","context_page_description":"アメリカ南部諸州が建国したアメリカ連合国の国旗や軍旗には以下のようなものがある。南北戦争終結以後、これらの旗が公に使われることはないが、南部の住民の中には自分達の歴史のシンボルとしてこれらの旗、特に有名な南軍旗やレベル・フラッグを使い続ける者もいる。\\n南軍旗はサウスカロライナ州の州議会議事堂に2000年まで翻っていた。またかつてはミシシッピ州およびジョージア州の州旗にも含まれていた。一方、アフリカ系アメリカ人や南部以外の住民の中には、これらの旗を奴隷制や有色人種差別を正当化する人々のシンボルとして忌避する者も多い。"},{"page_url":"https://cs.wikipedia.org/wiki/Du%C5%A1an_Jurkovi%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Bratislava_Vajanskeho_nabrezie_plastika_Dusana_Jurkovica_autor_Snopek_L_1972.jpg","page_title":"Dušan Jurkovič","context_page_description":"Dušan Samo Jurkovič byl slovenský architekt, návrhář nábytku a etnograf.\\nDušan Samo Jurkovič byl výrazným představitelem secesní architektury. Vytvořil velice osobitý styl, výrazně ovlivněný lidovou architekturou. Inspiraci hledal i u anglického hnutí Arts and Crafts. Byl vnukem Samuela Jurkoviče – zakladatele Spolku gazdovského v Sobotišti, prvního úvěrového družstva na evropském kontinentu a spoluzakladatele Matice slovenské."},{"page_url":"https://is.wikipedia.org/wiki/Hn%C3%BAfubakur","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/984-Baleines_St_Gilles_le_250911_HD11_copyright.jpg","page_title":"Hnúfubakur","context_page_description":"Hnúfubakur, einnig kallaður hnúðurbakur og skeljungur, er skíðishvalur af ætt reyðarhvala."},{"page_url":"https://cs.wikipedia.org/wiki/Z%C3%A1zmon%C3%ADky","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Zazmoniky_%283%29.jpg","page_title":"Zázmoníky","context_page_description":"Zázmoníky je přírodní rezervace ev. č. 1233 severně od obce Bořetice v okrese Břeclav.\\nDůvodem ochrany je zachování lesostepních strání, které jsou jedinou lokalitou na Moravě s výskytem vzácného včelníku rakouského."},{"page_url":"https://hu.wikipedia.org/wiki/Kanton%E2%80%93Sencsen-vas%C3%BAtvonal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/China_Railways_DJJ1_01.jpg","page_title":"Kanton–Sencsen-vasútvonal","context_page_description":"A Kanton–Sencsen-vasútvonal egy 146 km hosszú, normál nyomtávolságú, 25 kV 50 Hz-cel villamosított nagysebességű vasútvonal Kínában."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_classes_de_navires_de_la_Marine_royale_canadienne","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/HMCS_Fraser_%28DDH_233%29_underway_in_1983.JPEG","page_title":"Liste des classes de navires de la Marine royale canadienne","context_page_description":"Cet article liste les classes des navires utilisés par la Marine royale canadienne des Forces canadiennes depuis sa création."},{"page_url":"https://en.wikipedia.org/wiki/Vadim_Krasnoselsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Shoigu_in_Transnistria_04.jpg","page_title":"Vadim Krasnoselsky","context_page_description":"Vadim Nikolaevich Krasnoselsky is a Transnistrian politician who is the 3rd and current President of Transnistria. Previously, he served as a member of the Supreme Council of Transnistria from the 7th district, as 6th Speaker of the Supreme Council and the 7th Minister of the Interior."},{"page_url":"https://en.wikipedia.org/wiki/Dukes_of_the_Orient","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/AFJP-2011-BW-FINAL-750px.jpg","page_title":"Dukes of the Orient","context_page_description":"Dukes of the Orient are an English and American AOR and progressive rock band formed in 2017 by lead vocalist, guitarist and bassist John Payne and keyboardist Erik Norlander. Payne and formerly Norlander had worked together in Asia Featuring John Payne, an offshoot of British progressive rock group Asia of which Payne was a member from 1991 to 2006, when Asia's original lineup reunited. Following Asia lead singer John Wetton's death on 31 January 2017, Payne and Norlander formed Dukes of the Orient as a vehicle to release new material, both out of respect for Wetton, and to distinguish themselves from Payne's former band. Asia Featuring John Payne remains active in a touring capacity, and members and former members of the group; Jay Schellen, Bruce Bouillet, Guthrie Govan, Jeff Kollman and Moni Scaria, have contributed to Dukes of the Orient's debut album."},{"page_url":"https://no.wikipedia.org/wiki/%C3%85lvik_kirke","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/%C3%85lvik_kyrkje_01.JPG","page_title":"Ålvik kirke","context_page_description":"Ålvik kirke er en langkirke fra 1962 i Kvam kommune, Hordaland fylke.\\nByggverket er i tegl og har 280 plasser."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%B3%D8%A8%D9%88%D9%86%D9%8A%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Esponell%C3%A0.png","page_title":"إسبونيا","context_page_description":"بلدية إسبونيا هي بلدية تقع في مقاطعة جرندة التابعة لمنطقة كتالونيا شمال شرق إسبانيا."},{"page_url":"https://en.wikipedia.org/wiki/Huldrych_Zwingli","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Ulrich_Zwingli_Denkmal_-_Wasserkirche_-_Limmatquai_2011-08-10_11-47-50.jpg","page_title":"Huldrych Zwingli","context_page_description":"Huldrych Zwingli or Ulrich Zwingli was a leader of the Reformation in Switzerland, born during a time of emerging Swiss patriotism and increasing criticism of the Swiss mercenary system. He attended the University of Vienna and the University of Basel, a scholarly center of Renaissance humanism. He continued his studies while he served as a pastor in Glarus and later in Einsiedeln, where he was influenced by the writings of Erasmus.\\nIn 1519, Zwingli became the pastor of the Grossmünster in Zürich where he began to preach ideas on reform of the Catholic Church. In his first public controversy in 1522, he attacked the custom of fasting during Lent. In his publications, he noted corruption in the ecclesiastical hierarchy, promoted clerical marriage, and attacked the use of images in places of worship. In 1525, he introduced a new communion liturgy to replace the Mass. He also clashed with the Anabaptists, which resulted in their persecution. Historians have debated whether or not he turned Zürich into a theocracy.\\nThe Reformation spread to other parts of the Swiss Confederation, but several cantons resisted, preferring to remain Catholic."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Rudersdal_Municipality","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Grevinde_Danners_Pal%C3%A6_01.jpg","page_title":"Listed buildings in Rudersdal Municipality","context_page_description":"This is a list of listed buildings in Rudersdal Municipality, Denmark."},{"page_url":"https://pt.wikipedia.org/wiki/Linha_de_instabilidade","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Bow_echo_diagram.svg","page_title":"Linha de instabilidade","context_page_description":"Linha de instabilidade é uma zona de instabilidade na qual uma série de tempestades estão dispostas de forma alinhada. São tidas como uma tempestade multicelular, uma vez que são formadas por várias células convectivas de curta duração. A frente de rajada normalmente é mais intensa do que de tempestades de uma única célula, especialmente na direção do seu movimento frontal. Formam-se principalmente em regiões mais quentes, nas zonas tropicais. Sua ocorrência normalmente está associada a eventos de tempo severo, como chuva intensa, granizo, ventos fortes e até mesmo a formação de tornados. Podem ainda dar origem a um tipo de tempestade, o derecho, caracterizada por fortes ventos que atingem grandes áreas."},{"page_url":"https://nl.wikipedia.org/wiki/Salievedermot","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/%281494%29_Capperia_britanniodactyla_-_Flickr_-_Bennyboymothman.jpg","page_title":"Salievedermot","context_page_description":"De salievedermot is een vlinder uit de familie vedermotten. De wetenschappelijke naam is voor het eerst geldig gepubliceerd in 1867 door Gregson.\\nDe soort komt voor in Europa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%8E%D1%80%D0%B8_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/T%C3%BCri_jaama_kaubaait.jpg","page_title":"Тюри (станция)","context_page_description":"Тюри — железнодорожная станция в городе Тюри на линии Таллин — Рапла — Вильянди. Находится на расстоянии 97 км от Балтийского вокзала.\\nНа станции Тюри расположено два низких перрона и пять путей. На станции останавливаются пассажирские поезда, следующие в Таллин и Вильянди. Из Таллина в Тюри поезд идёт 1 час 36-40 минут, скорый — 1 час 27-33 минуты."},{"page_url":"https://de.wikipedia.org/wiki/Mazda_Carol_P360","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8b/Mazda_carol360.jpg","page_title":"Mazda Carol P360","context_page_description":"Der Mazda Carol P360 / P600 war eine Limousine in der japanischen Kei-Car-Klasse und wurde 1962 erstmals präsentiert. Das Modell basierte auf Mazdas erstem Pkw-Modell dem Mazda R360 und erweiterte dieses zweisitzige Coupé im Modellangebot. Bereits 1964 wurde die Limousine Carol P600 vom Mazda 800 Familia abgelöst. Die Carol P360 Limousine wurde noch bis 1970 gebaut und 1972 durch den Mazda Chantez ersetzt."},{"page_url":"https://en.wikipedia.org/wiki/Aristocracy_of_Norway","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Staffeldt-Wappen.png","page_title":"Aristocracy of Norway","context_page_description":"Aristocracy of Norway refers to modern and medieval aristocracy in Norway. Additionally, there have been economical, political, and military élites that—relating to the main lines of Norway's history—are generally accepted as nominal predecessors of the aforementioned. Since the 16th century, modern aristocracy is known as nobility.\\nThe very first aristocracy in today's Norway appeared during the Bronze Age. This bronze aristocracy consisted of several regional élites, whose earliest known existence dates to 1500 BC. Via similar structures in the Iron Age, these entities would reappear as petty kingdoms before and during the Age of Vikings. Beside a chieftain or petty king, each kingdom had its own aristocracy.\\nBetween 872 and 1050, during the so-called unification process, the first national aristocracy began to develop. Regional monarchs and aristocrats who recognised King Harald I as their high king, would normally receive vassalage titles like Earl. Those who refused were defeated or chose to migrate to Iceland, establishing an aristocratic, clan-ruled state there."},{"page_url":"https://en.wikipedia.org/wiki/Greek_diaspora","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/GreekClubKhartoumMainHall2_RomanDeckert23022015.jpg","page_title":"Greek diaspora","context_page_description":"The Greek diaspora, Hellenic diaspora or Omogenia refers to the communities of Greek people living outside Greece and Cyprus which are the traditional Greek homelands; such places include Albania, North Macedonia, parts of the Balkans, southern Russia, Ukraine, Asia Minor, the region of Pontus, Eastern Anatolia, Georgia, the South Caucasus, Egypt, southern Italy and Cargèse in Corsica. The term also refers to communities newly established by Greek migration outside these traditional areas during the 20th and 21st centuries."},{"page_url":"https://es.wikipedia.org/wiki/Samuel_Daniel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Samuel_Daniel.gif","page_title":"Samuel Daniel","context_page_description":"Samuel Daniel fue un poeta e historiador inglés, distinguido como poeta laureado."},{"page_url":"https://es.wikipedia.org/wiki/Tratado_de_%C3%85bo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Altfinnland.png","page_title":"Tratado de Åbo","context_page_description":"El Tratado de Åbo o Tratado de Turku fue un tratado de paz entre el Imperio ruso y Suecia en Turku fue firmado el 7 de agosto / 18 de agosto y marcó el final de la guerra ruso-sueca de 1741-1743.\\nHacia el final de la guerra, el Ejército Imperial Ruso había ocupado la mayoría de Finlandia, provocando que el mariscal Trubetskói y el canciller Aleksey Bestuzhev la reclamaran en virtud del principio de uti possidetis. Adquiriendo Finlandia, los políticos rusos esperaban mover la frontera sueca considerablemente al norte y reducir por el peligro de un ataque sueco sobre la nueva capital rusa, San Petersburgo. En la esperanza de obtener su independencia, los nobles y autoridades finlandesas ofrecieron el trono de su país al duque Pedro de Holsten-Gottorp, heredero aparente a la corona rusa.\\nOtra facción de la corte rusa, representado por el conde prosueco Lestocq y los parientes holsteinianos de Pedro, propusieron devolver Finlandia a Suecia a cambio de reconocer a su tío, Adolfo Federico de Holstein-Gottorp, como heredero al trono de Suecia."},{"page_url":"https://fr.wikipedia.org/wiki/Gastrophora_henricaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Gastrophora_henricaria1.jpg","page_title":"Gastrophora henricaria","context_page_description":"Gastrophora henricaria est un insecte lépidoptère de la famille des Geometridae vivant dans le quart sud-est de l'Australie.\\nIl a une envergure de 50mm.\\nSa larve se nourrit sur les eucalyptus et Lophostemon confertus."},{"page_url":"https://de.wikipedia.org/wiki/Bad_Zurzach","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Bad-Zurzach-Kapelle.jpg","page_title":"Bad Zurzach","context_page_description":"Bad Zurzach ist eine Einwohnergemeinde im Schweizer Kanton Aargau und der Hauptort des Bezirks Zurzach im Nordosten des Kantons. Der Ort bildet ein regionales Unterzentrum, hat sich jedoch nicht zu einer Stadt entwickelt, auch wenn er früh bereits ein Rathaus, das Marktrecht und ein Spital besass. Aus diesem Grund wird Bad Zurzach traditionell als «Flecken» bezeichnet.\\nDie Ortschaft liegt am Hochrhein an der Grenze zu Deutschland und ist in der neuesten Zeit vor allem wegen des Thermalbads Zurzach eine beliebte Touristendestination geworden. Seit dem Mittelalter bildete das Grab der Heiligen Verena das Ziel einer überregionalen Wallfahrt."},{"page_url":"https://ar.wikipedia.org/wiki/SH3GL3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/PBB_GE_SH3GL3_gnf1h02191_at_fs.png","page_title":"SH3GL3","context_page_description":"SH3GL3‏ هوَ بروتين يُشَفر بواسطة جين SH3GL3 في الإنسان."},{"page_url":"https://fr.wikipedia.org/wiki/Qixin_Zhong","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Qixin_Zhong.jpg","page_title":"Qixin Zhong","context_page_description":"Qixin Zhong, né le 7 avril 1989, est un grimpeur chinois. Il est spécialisé dans l'escalade de vitesse. Il en a établi le record sur 15 m à 6,40 s en octobre 2010. Alors que ce record est supplanté par Sergey Abdrakhmanov en juillet 2011, il dépasse à nouveau ce temps quelques jours plus tard avec 6,26 s."},{"page_url":"https://azb.wikipedia.org/wiki/%DB%B3-%D9%85%D8%AA%DB%8C%D9%84%E2%80%8C%D9%87%D9%82%D8%B2%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/3-methylhexane.png","page_title":"۳-متیل‌هقزان","context_page_description":"۳-متیل‌هقزان بیر اورقانیک بیلشیک.رنگ‌سیز و مایع حالتینده تاپیلار."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A0%E0%B8%B2%E0%B8%9E%E0%B8%A5%E0%B8%A7%E0%B8%87%E0%B8%95%E0%B8%B2%E0%B8%A7%E0%B8%B8%E0%B8%99%E0%B8%95%E0%B9%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Wundt_illusion.svg","page_title":"ภาพลวงตาวุนต์","context_page_description":"ภาพลวงตาวุนต์ เป็นภาพลวงตาชนิดหนึ่ง คิดค้นโดย วิลเฮล์ม วุนต์ นักจิตวิทยาชาวเยอรมัน เป็นภาพเส้นตรงในแนวตั้งสองเส้นที่ขนานกัน แต่ฉากหลังทำให้ดูเหมือนเส้นตรงทั้งสองเส้นบีบเข้าหากัน"},{"page_url":"https://de.wikipedia.org/wiki/Harrach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Jilemnick%C3%BD_z%C3%A1mek.jpg","page_title":"Harrach","context_page_description":"Harrach ist der Name eines alten österreichisch-böhmischen Adelsgeschlechts. Die Herren, Freiherren und Grafen von Harrach zählten zum Hochadel. Zweige der Familie bestehen bis heute."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%BE%D1%80%D1%88%D0%B0%D1%98%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Herl-Lorscheid02.jpg","page_title":"Лоршајд","context_page_description":"Лоршајд општина је у њемачкој савезној држави Рајна-Палатинат. Једно је од 103 општинска средишта округа Трир-Сарбург. Према процјени из 2010. у општини је живјело 595 становника. Посједује регионалну шифру 7235080."},{"page_url":"https://nl.wikipedia.org/wiki/Wereldkampioenschap_voetbal_onder_17_-_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/La_Portada_La_Serena.jpg","page_title":"Wereldkampioenschap voetbal onder 17 - 2015","context_page_description":"Het FIFA Wereldkampioenschap voetbal onder 17 - 2015 was de zestiende editie voor spelers tot 17 jaar. Het toernooi werd gespeeld van 17 oktober tot en met 8 november 2015 in Chili."},{"page_url":"https://it.wikipedia.org/wiki/Kralice_na_Han%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Kralice_na_Hane_CZ_CoA.jpeg","page_title":"Kralice na Hané","context_page_description":"Kralice na Hané è un comune mercato della Repubblica Ceca facente parte del distretto di Prostějov, nella regione di Olomouc."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%A9%E3%83%83%E3%82%B7%E3%83%A5%E3%83%90%E3%83%AB%E3%83%96_(%E6%A0%93)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/%E7%82%B9%E6%A4%9C.jpg","page_title":"フラッシュバルブ (栓)","context_page_description":"フラッシュバルブは、水などの流体における圧力・流量の出力を制御するバルブの一つで、バルブ操作後、一定量、一定時間水が流れて自動的に止まる機能を持つ自閉式のバルブで、主に水洗便器に洗浄水を供給する機器として使用される。このためにフラッシュバルブの末端は給水洗浄管を介して水洗便器に繋がっている。"},{"page_url":"https://pl.wikipedia.org/wiki/Juvaincourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Juvaincourt_2005.jpg","page_title":"Juvaincourt","context_page_description":"Juvaincourt – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Wogezy.\\nWedług danych na rok 1990 gminę zamieszkiwało 178 osób, a gęstość zaludnienia wynosiła 20 osób/km²."},{"page_url":"https://es.wikipedia.org/wiki/Kurtscheid","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Wappen_von_Kurtscheid.png","page_title":"Kurtscheid","context_page_description":"Kurtscheid es un municipio situado en el distrito de Neuwied, en el estado federado de Renania-Palatinado. Su población estimada a finales de 2016 era de 946 habitantes.​\\nSe encuentra ubicado al norte del estado, cerca de la orilla derecha del río Rin, y al norte de la ciudad de Coblenza."},{"page_url":"https://en.wikipedia.org/wiki/Matsu_Islands","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Matsu_Montage.png","page_title":"Matsu Islands","context_page_description":"The Matsu Islands are an archipelago of 36 islands and islets in the East China Sea officially named Lienchiang County in the Republic of China. It is the smallest county in the free area of the Republic of China. The islands are claimed by the People’s Republic of China."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B5%D1%80%D0%BA%D0%B8%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Douglas_Column_in_Corfu.JPG","page_title":"Керкира","context_page_description":"Ке́ркира, Ко́рфу — греческий остров, самый северный и второй по площади среди Ионических островов. Население — 102 071 житель по переписи 2011 года. Керкира — одно из самых популярных мест туристического отдыха в Греции."},{"page_url":"https://de.wikipedia.org/wiki/Sofitel_Berlin_Kurf%C3%BCrstendamm","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Hotel_Concorde.jpg","page_title":"Sofitel Berlin Kurfürstendamm","context_page_description":"Das Sofitel Berlin Kurfürstendamm ist ein Bauwerk der zeitgenössischen Architektur. Es befindet sich an der Ecke Augsburger Straße und Joachimsthaler Straße im Berliner Ortsteil Charlottenburg unweit des Boulevards Kurfürstendamm. Der Bau wurde nach Entwürfen des Architekten Jan Kleihues aus dem Büro Kleihues + Kleihues im Oktober 2005 fertiggestellt."},{"page_url":"https://de.wikipedia.org/wiki/Kentucky","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Precipitation_of_Kentucky.png","page_title":"Kentucky","context_page_description":"Kentucky ist ein Bundesstaat der Vereinigten Staaten von Amerika. Der Name des Staates ist shawnesischer oder irokesischer Herkunft, möglicherweise aus dem Wyandotischen, mit der Bedeutung „Wiese“, „Aue“, „Flur“. Im Senecaischen, ebenfalls einer irokesischen Sprache, bedeutet das Wort geda’geh „auf dem Feld“. Den Beinamen Bluegrass State, womit die von März bis April blaugrün blühenden Grasweiden gemeint sind, trägt Kentucky als verbreitete Umschreibung.\\nKentucky war zunächst ein Teil Virginias und trat 1792 als 15. Staat den Vereinigten Staaten bei. Im Sezessionskrieg versuchte Kentucky anfangs neutral zu bleiben, dann standen Einwohner des Staates auf beiden Seiten, wie z. B. Abraham Lincoln als Präsident der Union und Jefferson Davis als Präsident der Konföderation. Das United States Census Bureau zählt Kentucky heute jedoch eindeutig zu den Südstaaten.\\nNeben den Bundesstaaten Virginia, Pennsylvania und Massachusetts führt Kentucky den amtlichen Namen „Commonwealth of Kentucky“ im Gegensatz zu der sonst üblichen Gliedstaaten-Bezeichnung als „State“."},{"page_url":"https://cs.wikipedia.org/wiki/Andrea_Pininfarina","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Ferrari_P4-5.jpg","page_title":"Andrea Pininfarina","context_page_description":"Andrea Pininfarina byl italský podnikatel, majitel a výkonný ředitel rodinné karosářské firmy Pininfarina, kterou založil v roce 1930 jeho děd Battista \\"Pinin\\" Farina.\\nJeho otcem byl Sergio Pininfarina. Andrea studoval na polytechnice v Turíně. Promoval v roce 1981. Poté krátce pracoval pro společnost Fruehauf Trailer Corporation v USA. Od července 1983 působil jako koordinátor a později program-manažer na studii vozu Cadillac Allanté v rodinné firmě Industrie Pininfarina S.p.A.. Od roku 1987 zastupoval generálního ředitele a následujícího roku se stal generálním ředitelem firmy. Od roku 1994 byl obchodním ředitelem a 1. července 2001 nastoupil po svém otci do funkce výkonného ředitele. V roce 2006 byl zvolen předsedou představenstva společnosti.\\nPininfarina, mimo mnoha dalších funkcí, byl také viceprezidentem italského svazu zaměstnavatelů Confindustria. Byl ženat s Cristinou Pellion di Persano, se kterou měl tři děti.\\nAndrea Pininfarina zahynul 7. srpna 2008 při srážce svého mopedu Vespa s automobilem Ford Fiesta, jehož řidič mu nedal přednost v jízdě, v blízkosti sídla firmy v Cambianu."},{"page_url":"https://pl.wikipedia.org/wiki/Skar%C3%B0_(Wyspy_Owcze)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Skar%C3%B0%2C_Faroe_Islands_%2801%29.jpg","page_title":"Skarð (Wyspy Owcze)","context_page_description":"Skarð – opuszczona wioska położona na wschodnim wybrzeżu wyspy Kunoy w regionie Norðoyar na Wyspach Owczych.\\n23 grudnia 1913 wszyscy mężczyźni zamieszkujący osadę zginęli podczas połowu. W ciągu sześciu kolejnych lat kobiety wraz z dziećmi opuściły Skarð i zamieszkały w Haraldssund.\\nW 1872 roku urodził się tu Símun av Skarði, farerski pisarz, autor Mítt alfagra land - hymnu państwowego Wysp Owczych."},{"page_url":"https://pt.wikipedia.org/wiki/Fenioux_(Deux-S%C3%A8vres)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Clocher_denioux_79.JPG","page_title":"Fenioux (Deux-Sèvres)","context_page_description":"Fenioux é uma comuna francesa na região administrativa da Nova Aquitânia, no departamento de Deux-Sèvres. Estende-se por uma área de 33,65 km². Em 2010 a comuna tinha 688 habitantes."},{"page_url":"https://nl.wikipedia.org/wiki/Ormsby_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Ormsby_County_Courthouse.jpg","page_title":"Ormsby County","context_page_description":"Ormsby County is een voormalige county in de Amerikaanse staat Nevada.\\nOrmsby County werd in 1861 opgericht en omvatte Carson City, de hoofdstad van Nevada die twee jaar eerder werd gesticht. De county was vernoemd naar William Ormsby, die een belangrijke rol speelde in de oprichting van Nevada en de instelling van Carson City als hoofdstad.\\nMidden 20e eeuw werd overwogen om Ormsby County administratief samen te voegen met Carson City, daar er buiten de stad amper mensen in de county woonden. In 1966 stemde de bevolking hier in een volksraadpleging mee in. In 1968 volgde de vereiste grondwetswijziging en op 1 april 1969 werden de twee entiteiten officieel gefuseerd tot de Consolidated Municipality of Carson City. In tegenstelling tot eengemaakte stad-county's, zoals San Francisco, waar de stad en county samenvallen maar hun namen behouden, is Carson City sinds 1969 een onafhankelijke stad en is er geen sprake meer van Ormsby County."},{"page_url":"https://de.wikipedia.org/wiki/Kasachische_Autonome_Sozialistische_Sowjetrepublik","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Kazak_1920.jpg","page_title":"Kasachische Autonome Sozialistische Sowjetrepublik","context_page_description":"Die Kasachische Autonome Sozialistische Sowjetrepublik war eine Autonome Sozialistische Sowjetrepublik innerhalb der Russischen SFSR, die von 1925 bis 1936 bestand."},{"page_url":"https://en.wikipedia.org/wiki/List_of_University_of_Birmingham_academics","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/John_Robert_Schrieffer_1972.jpg","page_title":"List of University of Birmingham academics","context_page_description":"This is a list of notable academics related to the University of Birmingham and its predecessors, Mason Science College and Queen's College, Birmingham. This page includes those who work or have worked as lecturers, readers, professors, fellows, and researchers at Birmingham University. Administrators are included only in exceptional cases. Those who are/were academics of the university as well as alumni are included on the list of University of Birmingham alumni."},{"page_url":"https://fr.wikipedia.org/wiki/Eliezer_Kaplan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Eliezer_Kaplan.jpg","page_title":"Eliezer Kaplan","context_page_description":"Eliezer Kaplan, אליעזר קפלן, était un homme politique israélien."},{"page_url":"https://ca.wikipedia.org/wiki/Uhrovec","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Evangelick%C3%BD_kostel_v_Uhrovci.jpg","page_title":"Uhrovec","context_page_description":"Uhrovec és un poble d'Eslovàquia que es troba a la regió de Trenčín."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_sites_Ramsar_en_Inde","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Loktak_Lake_Another_view.jpg","page_title":"Liste des sites Ramsar en Inde","context_page_description":"Cet article recense les zones humides d'Inde concernées par la convention de Ramsar."},{"page_url":"https://en.wikipedia.org/wiki/Lolita_Tizol","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Lolita_Tizol%2C_Educadora_de_Ponce%2C_Puerto_Rico%2C_cerca_1920_%28DSC00465D%29.jpg","page_title":"Lolita Tizol","context_page_description":"Lolita Tizol was an early twentieth-century Puerto Rican violinist and music educator from Ponce."},{"page_url":"https://en.wikipedia.org/wiki/Mistletoebird","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Mistletoebird3208e.jpg","page_title":"Mistletoebird","context_page_description":"The mistletoebird, also known as the mistletoe flowerpecker, is a species of flowerpecker native to most of Australia and also to the eastern Maluku Islands of Indonesia in the Arafura Sea between Australia and New Guinea. The mistletoebird eats mainly the berries of the parasitic mistletoe and is a vector for the spread of the mistletoe's seeds through its digestive system."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Radebeul-Niederl%C3%B6%C3%9Fnitz_(A%E2%80%93L)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Radebeul_Ludwig-Richter-Allee_9.JPG","page_title":"Liste der Kulturdenkmale in Radebeul-Niederlößnitz (A–L)","context_page_description":"Die Liste der Kulturdenkmale in Radebeul-Niederlößnitz (A–L) gibt eine Übersicht über die Kulturdenkmale im Stadtteil Niederlößnitz der sächsischen Stadt Radebeul anhand des Stands der Denkmalliste vom 24. Mai 2012. Aufgrund der Größe der Liste wurden die Straßen auf zwei Teile verteilt.\\nEine weitere Liste zeigt ehemalige Bau- / Kulturdenkmale dieses Stadtteils.\\nEinen Überblick über die Radebeuler Kulturdenkmale gibt die Liste der Kulturdenkmale in Radebeul, eine Zusammenfassung aller Adressen mit Kulturdenkmalen gibt die Liste der Kulturdenkmaladressen in Radebeul. Die Zuordnung der Straßen zum Stadtteil findet sich in der Liste der Straßen und Plätze in Radebeul-Niederlößnitz.\\nGrundlage der Auflistung sind die angegebenen Quellen. Diese Angaben ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://fr.wikipedia.org/wiki/Colonia_Claudia_Ara_Agrippinensium","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/K%C3%B6ln_st_ursula_1499.jpg","page_title":"Colonia Claudia Ara Agrippinensium","context_page_description":"Colonia Claudia Ara Agrippinensium est une colonie romaine capitale de la Germanie inférieure, l'actuelle ville de Cologne, en Allemagne."},{"page_url":"https://pt.wikipedia.org/wiki/%C5%A0umice_(Mor%C3%A1via_do_Sul)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/%C5%A0umice_vlajka.jpg","page_title":"Šumice (Morávia do Sul)","context_page_description":"Šumice é uma comuna checa localizada na região de Morávia do Sul, distrito de Brno-Venkov."},{"page_url":"https://en.wikipedia.org/wiki/Mayors_and_Independents","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/V%C3%ADt_Raku%C5%A1an_2015.JPG","page_title":"Mayors and Independents","context_page_description":"The Mayors and Independents, abbreviated to STAN, is a political party in the Czech Republic. The Mayors and Independents focus on localism and promoting powers for municipalities. The party grew out of four minor parties, including Independent Mayors for the Region, which allied itself with the liberal-conservative SNK European Democrats, and cooperated with the similarly liberal-conservative TOP 09 until 2016.\\nIn the 2013 election to the Chamber of Deputies, STAN won five seats on the TOP 09 list: Jan Farský, Stanislav Polčák, Věra Kovářová, František Vácha and acting leader Petr Gazdík. In the Czech Senate, STAN has four members. The party competes separately in local government elections. In the 2010 local elections, the party won 1,243 councillors, making it the sixth-largest party on local councils.\\nIn the 2017 election to the Chamber of Deputies, STAN won six seats: Petr Gazdík, Jan Farský, Věra Kovářová, Vít Rakušan, Martin Půta and Jana Krutáková."},{"page_url":"https://tr.wikipedia.org/wiki/Torre_Latinoamericana","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Mexico_City_seen_from_Torre_Latinoamericana.JPG","page_title":"Torre Latinoamericana","context_page_description":"Torre Latinoamericana, Meksika'nın başkenti Meksiko'da yer alan gökdelen. İnşasına 1946'da başlanmış ve 1956'da inşası tamamlanarak 30 Nisan günü açılışı gerçekleştirilmiştir. 182 metre yükseklikle yapıldığı dönem ülkenin en uzun binası olsa da, bu unvanını inşası 1982'de tamamlanan 211,3 metre yüksekliğindeki Torre Ejecutiva Pemex'e kaptırmıştır. Günümüzde ülkedeki en yüksek 11., şehirdeki ise en yüksek 8. binadır.\\nModernist bir tarza sahip olan binanın mimarı Augusto H. Álvarez'dir. Francisco I. Madero Caddesi ile Eje Central'in kesiştiği köşede yer almaktadır."},{"page_url":"https://de.wikipedia.org/wiki/Farallon_de_Pajaros","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/Farallon_de_Pajaros.jpg","page_title":"Farallon de Pajaros","context_page_description":"Farallon de Pajaros ist eine kleine, unbewohnte Vulkaninsel im Pazifischen Ozean. Sie gehört geographisch zur Inselgruppe der Marianen und politisch zum US-Außengebiet der Nördlichen Marianen.\\nFarallon de Pajaros ist die nördlichste Insel der Marianen. Sie liegt 65 Kilometer nordwestlich der Maug Islands und 591 Kilometer nördlich von Saipan, der Hauptinsel der Nördlichen Marianen. Bis zur nächsten Inselgruppe Kazan-rettō, die zu Japan gehört, sind es 541 Kilometer. Die nahezu runde Insel hat eine Länge von 1,8 Kilometer, eine Breite von 1,6 Kilometer und weist eine Fläche von 2,3 km² auf. Farallon de Pajaros ist der Gipfel eines aktiven Stratovulkans mit einer Höhe von 360 Metern über dem Meer. An seiner Basis in über 2000 Meter unter dem Meeresspiegel hat der Vulkan einen Durchmesser von 15 bis 20 Kilometer. Zwischen 1864 und 1953 wurden 15 Vulkanausbrüche registriert.\\nVon 1899 bis 1914 war Farallon de Pajaros Teil der Kolonie Deutsch-Neuguinea. 1903 wurde die Insel an ein japanisches Unternehmen verpachtet. Es wurden Vögel gejagt, deren Federn über Japan nach Paris exportiert und dort zu Hutfedern verarbeitet wurden."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%AD%E1%83%90%E1%83%9A%E1%83%90_(%E1%83%A8%E1%83%A3%E1%83%90%E1%83%AE%E1%83%94%E1%83%95%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%A3%E1%83%9C%E1%83%98%E1%83%AA%E1%83%98%E1%83%9E%E1%83%90%E1%83%9A%E1%83%98%E1%83%A2%E1%83%94%E1%83%A2%E1%83%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Chala_%28G.N._2011%29.jpg","page_title":"ჭალა (შუახევის მუნიციპალიტეტი)","context_page_description":"ჭალა — სოფელი საქართველოში, შუახევის მუნიციპალიტეტში. მდებარეობს მდ. ნაღვარევის ხეობაში, ზღვის დონიდან 760 მ, ქ. შუახევიდან 16 კმ. საბჭოთა პერიოდში განვითარებული იყო მეთამბაქოეობა, მეცხოველეობა."},{"page_url":"https://de.wikipedia.org/wiki/Altgl%C3%A4ubige_in_Russland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Spas_vsederzhitel_sinay.jpg","page_title":"Altgläubige in Russland","context_page_description":"Altgläubige ist eine Bezeichnung für verschiedene christliche Richtungen und Gemeinschaften in Russland, die seit 1667 nicht mehr zur Russisch-Orthodoxen Kirche gehörten. Die Altgläubigen wandten sich gegen die Reformen des Patriarchen Nikon, der ab 1652 Texte und Riten der russisch-orthodoxen Gottesdienste reformierte. Sie unterteilen sich in priesterliche und priesterlose Altgläubige.\\nHeute gibt es altgläubige Gemeinschaften in Russland, Rumänien, den USA und anderen Ländern."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9B%B0%EC%8B%9C_%EC%8A%A4%ED%94%84%EB%A7%81%EC%96%B4_%EC%8A%A4%ED%8C%A8%EB%8B%88%EC%96%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Welsh_Springer_Spaniel_Dog.jpg","page_title":"웰시 스프링어 스패니얼","context_page_description":"웰시 스프링어 스패니얼은 영국 웨일스산인 적색과 백색, 체모의 스프링어 스패니얼 종 사냥개이다."},{"page_url":"https://sv.wikipedia.org/wiki/Amazontapakul","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/PteroptochusThoracicusJennens.jpg","page_title":"Amazontapakul","context_page_description":"Amazontapakul är en fågel i familjen tapakuler inom ordningen tättingar. Den placeras som enda art i släktet Liosceles. IUCN kategoriserar arten som livskraftig.\\nAmazontapakul delas in i tre underarter:\\nLiosceles thoracicus dugandi – förekommer i sydöstra Colombia och närliggande västra Brasilien\\nLiosceles thoracicus erithacus – förekommer i östra Ecuador och östra Peru\\nLiosceles thoracicus thoracicus – förekommer i sydöstra Peru och västra Amazonområdet i Brasilien"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BE%D0%B1%D0%B5%D0%BB%D0%B5%D0%B2,_%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/D.I._Skobelev.jpg","page_title":"Скобелев, Дмитрий Иванович","context_page_description":"Дми́трий Ива́нович Ско́белев — русский военный деятель, генерал-лейтенант, командир Собственного Его Императорского Величества конвоя, заведующий Ротой дворцовых гренадер. Отец генерала Михаила Скобелева."},{"page_url":"https://en.wikipedia.org/wiki/Rover_R8_platform","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Rover_416_GSi_16v_mk1.jpg","page_title":"Rover R8 platform","context_page_description":"The Rover R8 platform was an automobile platform used for the Mark I Rover 200 Series and the Mark II 200 and 400 Series, compact family cars produced by the Austin Rover Group, and later the Rover Group. The original Rover 200 Series dates back to 1984 with the launch of the SD3 213 and 216 saloons. The second generation was split into two distinct models: the 200 Series three- and five-door hatchbacks, coupé and convertible and 400 Series saloon and estate.\\nThe coupé, convertible and estate models continued after the demise of the hatchback and saloon models, without the 200 or 400 nomenclature, until 1999 as the successor model did not have these particular body styles. They were discontinued with the arrival of the Rover 25 and Rover 45, which were simple facelifts of the current range and not all-new models."},{"page_url":"https://nl.wikipedia.org/wiki/Ronde_van_Spanje_2007/Tweede_etappe","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Cacheiras.Volta_ciclista_a_Espana._2%C2%AA_etapa._1set2007_2.jpg","page_title":"Ronde van Spanje 2007/Tweede etappe","context_page_description":"De tweede etappe van de Ronde van Spanje 2007 vond plaats op 2 september 2007 en liep door Galicië van Allariz naar Santiago de Compostella. De rit was 148 kilometer lang en telde twee tussensprints en een beklimming van de derde categorie."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Nijmegen_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/31186-Hoekpand_Waalkade_70_-_79.jpg","page_title":"Lijst van rijksmonumenten in Nijmegen (plaats)","context_page_description":"De stad Nijmegen, hoofdplaats van de gemeente Nijmegen, telt 241 inschrijvingen in het rijksmonumentenregister. Hieronder een compleet overzicht.\\nVoor een overzicht van alle rijksmonumenten in de gemeente Nijmegen, zie lijst van rijksmonumenten in Nijmegen."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A6%A6%E0%A6%A8%E0%A6%AE%E0%A7%8B%E0%A6%B9%E0%A6%A8_%E0%A6%A4%E0%A6%B0%E0%A7%8D%E0%A6%95%E0%A6%BE%E0%A6%B2%E0%A6%99%E0%A7%8D%E0%A6%95%E0%A6%BE%E0%A6%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Madan_Mohan_Tarkalankar.jpg","page_title":"মদনমোহন তর্কালঙ্কার","context_page_description":"মদনমোহন তর্কালঙ্কার ভারতীয় উপমহাদেশের ঊনবিংশ শতাব্দীয় অন্যতম পণ্ডিত ব্যক্তিত্ব যিনি লেখ্য বাংলা ভাষার বিকাশে বিশেষ অবদান রেখে গেছেন। তিনি বাংলার নবজাগরণের অন্যতম অগ্রদূত হিসিবেও পরিগণিত। তিনি ফোর্ট উইলিয়াম কলেজের অধ্যাপক ছিলেন এবং বাল্যশিক্ষার জন্য একাধিক পাঠ্যপুস্তক রচনা করেন।"},{"page_url":"https://pt.wikipedia.org/wiki/Bapaume","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Bapaume-xv.jpg","page_title":"Bapaume","context_page_description":"Bapaume é uma comuna no departamento de Pas-de-Calais, norte da França."},{"page_url":"https://es.wikipedia.org/wiki/Geograf%C3%ADa_de_Marruecos","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Barrage_Youssef_Ibn_Tachfin.JPG","page_title":"Geografía de Marruecos","context_page_description":"Marruecos es un país africano que limita por el norte con el Mar Mediterráneo, con España en sus fronteras terrestres de Ceuta y Melilla y el océano Atlántico, unidos por el estrecho de Gibraltar. Al sur hace frontera con el Sahara Occidental. Al este y sureste hace frontera con Argelia y al oeste con el océano Atlántico."},{"page_url":"https://it.wikipedia.org/wiki/Forte_di_Uxegney","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Les_foss%C3%A9s_Fort_d%27Uxegney.JPG","page_title":"Forte di Uxegney","context_page_description":"Il forte di Uxegney, conosciuto anche come fort Roussel, è un forte francese situato a Uxegney, presso Épinal in Lorena. Fu costruito dal 1882 al 1884 poi rimodernato più volte negli anni fino al 1914.\\nÈ uno dei rari esempi di forte francese facente parte del Sistema Séré de Rivières, ancora equipaggiato dal suo armamento e giunto praticamente intatto fino ai nostri giorni.\\nVi si può vedere l'unico esemplare ancora completo e funzionante di torretta retrattile secondo il sistema a giganteschi contrappesi di 250 tonnellate detto \\"Galopin\\" con un canonone da 155 mm del 1907. Un altro gran numero di dotazioni originali si trova ancora al suo posto tra cui cucine, camerate e pezzi di artiglieria e il loro straordinario stato di conservazione ha giustificato l'iscrizione del forte nell'elenco dei monumenti storici di Francia.\\nIl forte di Uxegney è situato su di una altura a 379 m s.l.m. al di sopra della valle del fiume Avière e aveva il compito di sorvegliare l'asse Épinal-Mirecourt, la ferrovia Épinal-Nancy e il canal de l'Est."},{"page_url":"https://lv.wikipedia.org/wiki/Nikols_Pa%C5%A1injans","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Nikol_Pashinyan_signature.png","page_title":"Nikols Pašinjans","context_page_description":"Nikols Vovaji Pašinjans ir armēņu politiķis, Armēnijas premjerministrs. Pirms politiskās karjeras strādājis par žurnālistu un redaktoru."},{"page_url":"https://fr.wikipedia.org/wiki/N%C3%A9cropole_nationale_de_Sillery","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Necropole_nationale_Sillery_Plaque.JPG","page_title":"Nécropole nationale de Sillery","context_page_description":"La nécropole nationale de Sillery est un cimetière militaire français de la Première Guerre mondiale, situé sur le territoire de la commune de Sillery, dans la banlieue de Reims."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%88%D8%B1%D9%88%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D8%AF%D9%88%D8%B1%D9%88%D8%AF_%D8%AF%D8%B1_%D8%B4%D8%A80001.jpg","page_title":"دورود","context_page_description":"دورود یکی از شهرهای استان لرستان و مرکز شهرستان دورود است. دورود از نظر جمعیت بعد از خرم‌آباد و بروجرد سومین شهر پرجمعیت لرستان و هشتادمین شهر پر جمعیت ایران است. جمعیت شهرستان دورود طبق سرشماری سال ۱۳۹۵ مرکز آمار ایران، برابر با ۲۴۱۳۴۵ نفر گزارش شده‌است و از این بین، جمعیت شهر دورود برابر با ۱۲۱٬۶۳۸ بوده‌است. دورود در دامنه رشته کوه زاگرس و در کنار اشترانکوه قرار گرفته‌است. دو سر شاخه رود دز یکی از شمال و یکی از شرق به نام‌های «تیره» و «ماربره»، به دلیل تلاقی دو رودخانه بین‌النهرین نامیده می‌شد در دورود به هم می‌پیوندند و با نام رودخانه سزار سرچشمه اصلی رود دز می‌شوند. از لحاظ گردشگری، بیشتر توجه به جاذبه‌های طبیعی و تاریخی دورود معطوف می‌شود. وجود دریاچه گهر، اشترانکوه، کوه پریز و .. در دورود باعث شده‌است که این شهر لقب پایتخت طبیعت ایران را یدک بکشد. این شهر زیباترین شهر لرستان از نظر طبیعت محسوب می‌شود. هم چنین به دلیل وجود آبشارهای متعدد در این شهر لقب سزمین آبشارهای خروشان هم به این شهر داده می‌شود.\\nمردم شهر دورود عمدتاً مسلمان و پیرو مذهب شیعه هستند. زبان مردم، لری، شامل لری خرم‌آبادی، لری بختیاری و لری سیلاخوری است. دورود از شهرهای صنعتی ایران است.\\nهمچنین با رونق‌گیری اقتصاد شهر و عبور راه‌آهن سراسری از شهر، مهاجرت به شهر افزایش یافت."},{"page_url":"https://pl.wikipedia.org/wiki/Sarah_Kaufman","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Strikeforce_Women%27s_Welterweight_Champion%2C_Sarah_Kaufman.jpg","page_title":"Sarah Kaufman","context_page_description":"Sarah Kaufman − kanadyjska zawodniczka mieszanych sztuk walki, mistrzyni Strikeforce w wadze koguciej z 2010. W latach 2013−2015 związana z UFC. Od 2018 mistrzyni Invicta FC w wadze koguciej."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A0%BC%E5%85%B0%E7%89%B9%E5%B0%86%E5%86%9B%E5%9B%BD%E5%AE%B6%E7%BA%AA%E5%BF%B5%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Inside_the_memorial%2C_where_the_sarcophagi_are_stored.jpg","page_title":"格兰特将军国家纪念堂","context_page_description":"格兰特将军国家纪念堂，又称格兰特陵园、格兰特墓，是第18任美国总统尤利西斯·辛普森·格兰特及其妻子朱莉娅·格兰特的长眠之地。该陵园于1897年落成，位于纽约曼哈顿上城晨边高地社区的河滨公园内，与东南侧的河滨教堂隔河滨道相望。它于1958年起由美国国家公园管理局管理。"},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Grorud","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Grorud_rail_station_OSM_map.png","page_title":"Gare de Grorud","context_page_description":"La gare de Grorud est une gare ferroviaire de la ligne Hovedbanen."},{"page_url":"https://fr.wikipedia.org/wiki/Winds_of_Torment","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Winds_of_torment.jpg","page_title":"Winds of Torment","context_page_description":"Winds of Torment est un groupe de metal extrême français, originaire de Saint-Étienne, en Rhône-Alpes. Formé en 2001, le groupe se composait de Bertrand Arnaud, Jean-François Wujek, Hugo, Alban et Pierre. Il cesse officiellement son activité en 2012, mais annonce un timide retour au début de 2016."},{"page_url":"https://fr.wikipedia.org/wiki/Hersheypark","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/HersheyBus.JPG","page_title":"Hersheypark","context_page_description":"Hersheypark est un parc d'attractions situé à Hershey, en Pennsylvanie.\\nOuvert en 1907 comme parc de loisir pour les employés de la Hershey Chocolate Company, une compagnie américaine d'agro-alimentaire. Plus tard, la compagnie décida de l’ouvrir au public. Aujourd’hui le parc étendu sur 450 000 m² contient plus de 60 attractions.\\nL’entrée au parc inclut celle du zoo adjacent, le ZooAmerica.\\nÉgalement à côté se trouve Hershey’s Chocolate World, un centre contenant des boutiques, des restaurants et des attractions sur le thème du chocolat et les produits de la marque."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%96%D7%99%D7%90%D7%95%D7%9F_%D7%9C%D7%97%22%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Lehi_Museum_%E2%80%93_Memorial_Room.jpg","page_title":"מוזיאון לח\\"י","context_page_description":"מוזיאון לח\\"י, הנקרא גם בית יאיר על שם מפקד לח\\"י, אברהם שטרן, הוא מוזיאון הנמצא בבניין בו נרצח שטרן על ידי קצין בולשת בריטי."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%BE%D1%85%D0%B4%D0%B0%D1%80%D1%84%D1%81%D0%BA%D0%B0%D1%8F_%D0%B3%D1%80%D0%B0%D0%B1%D0%BD%D1%96%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Hochdorf_golden_shoes_ornaments.jpg","page_title":"Гохдарфская грабніца","context_page_description":"Грабніца правадыра ў Гохдарфе — багатае кельцкае пахаванне, датаванае каля 530 г. да н. э. Выяўлена археолагам-аматарам у 1977 г. каля паселішча Гохдарф-на-Энцы у муніцыпалітэце Эбердынген, федэральная зямля Бадэн-Вюртэмберг, Германія. Да таго часу курган ад першапачатковай вышыні і дыяметра у выніку прыроднай эрозіі і сельскагаспадарчай дзейнасці «зморшчыўся» да вышыні прыкладна 1 метра.\\nМужчына ва ўзросце каля 40 гадоў, ростам 178 см, быў пакладзены на бронзавы ложак даўжынёй 275 см. Мяркуючы па знойдзеных у пахавальнай камеры залатых упрыгожваннях гэты чалавек, верагодна, быў кельцкім правадыром. Ён быў пахаваны з залатой шыйнай грыўняй на шчацэ, бранзалетам на правай руцэ, у капелюшы з бяросты, апрануты ў багатыя адзенні, меў два залатыя кінжалы з лёзамі з жалеза і бронзы, бурштынавыя ўпрыгажэнні. Асабліва вылучаліся тонкія залатыя пласціны з арнаментам, якія захаваліся на яго амаль спарахнелым абутку. Каля ложка стаяў вялікі кацёл, упрыгожаны выявай трох львоў вакол абзы. Пры пахаванні кацёл быў запоўнены 400 літрамі мёду. Ва ўсходняй частцы грабніцы знаходзілася чатырохколавая павозка з наборам бронзавага посуду і рагоў для пітва, дастатковай для 9 чалавек."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%BA%D0%B0%D0%BD%D1%8B_%D0%A1%D0%A8%D0%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/MtCleveland_ISS013-E-24184.jpg","page_title":"Вулканы США","context_page_description":"Вулканы США — cписок вулканов, находящихся на территории Соединённых Штатов Америки.\\nМногие активные вулканы входят в состав Алеутских островов, а многие потухшие расположены на Аляске. Это часть Тихоокеанского огненного кольца.\\nАктивные вулканы расположены также на острове Гавайи."},{"page_url":"https://ceb.wikipedia.org/wiki/Benthophilus_granulosus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Benthophilus_granulosus.jpg","page_title":"Benthophilus granulosus","context_page_description":"Espesye sa isda ang Benthophilus granulosus. Una ning gihulagway ni Kessler ni adtong 1877. Ang Benthophilus granulosus sakop sa kahenera nga Benthophilus sa kabanay nga Gobiidae. Giklaseklase sa IUCN ang espesye sa kinaminosang kalabotan. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://it.wikipedia.org/wiki/William_Morris","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/The_Red_House%2C_Bexleyheath.JPG","page_title":"William Morris","context_page_description":"William Morris è stato un artista e scrittore britannico.\\nFu tra i principali fondatori del movimento delle Arts and Crafts; è considerato antesignano dei moderni designer ed ebbe una notevole influenza sull'architettura e sugli architetti del suo tempo. Da molti è considerato il padre del Movimento Moderno, sebbene non fosse architetto egli stesso. Ha fondato uno studio di design in collaborazione con l'artista Edward Burne-Jones, e il poeta e artista Dante Gabriel Rossetti che ha profondamente influenzato la decorazione di chiese e case nel ventesimo secolo. Ha dato anche un importante contributo al rilancio delle arti tessili tradizionali e gli annessi metodi di produzione. Ha fondato inoltre la Società per la protezione di edifici antichi, tuttora un elemento statutario per la conservazione degli edifici storici in Regno Unito.\\nDurante il corso della sua vita Morris ha scritto e pubblicato poesie, narrativa, e traduzioni di testi antichi e medievali. I suoi lavori più noti includono La difesa di Ginevra, Il paradiso terrestre, Un sogno di John Ball, Notizie da nessun luogo, e il fantasy La fonte ai confini del mondo."},{"page_url":"https://de.wikipedia.org/wiki/B%C3%BCrgelstra%C3%9Fe_1,_2_(Magdeburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/B%C3%BCrgelstra%C3%9Fe_%28Magdeburg%29.jpg","page_title":"Bürgelstraße 1, 2 (Magdeburg)","context_page_description":"Bürgelstraße 1, 2 ist die im örtlichen Denkmalverzeichnis genutzte Bezeichnung für einen denkmalgeschützten Straßenzug in Magdeburg in Sachsen-Anhalt."},{"page_url":"https://de.wikipedia.org/wiki/Bistum_Le_Mans","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Liborifenster.jpg","page_title":"Bistum Le Mans","context_page_description":"Das Bistum Le Mans ist ein Bistum der römisch-katholischen Kirche in Frankreich, das sich über das Gebiet des Départements Sarthe erstreckt. Bischof ist seit Januar 2009 Yves Le Saux."},{"page_url":"https://fr.wikipedia.org/wiki/Rhododendron_albrechtii","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Rhododendron_albrechtii.JPG","page_title":"Rhododendron albrechtii","context_page_description":"Rhododendron albrechtii, est une espèce de plantes de la famille des Ericaceae, originaire du Japon."},{"page_url":"https://ca.wikipedia.org/wiki/F%C3%B2ssamanha","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Fossemagne_%C3%A9glise.JPG","page_title":"Fòssamanha","context_page_description":"Fòssa Manha, o Fòssamanha segons les regles gràfiques normals, és un municipi francès, situat al departament de la Dordonya i a la regió de la Nova Aquitània."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Rothenburg_ob_der_Tauber/Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Rothenburg_ob_der_Tauber%2C_Spitalhof_4%2C_Wohnhaus-20160108-001.jpg","page_title":"Liste der Baudenkmäler in Rothenburg ob der Tauber/Altstadt","context_page_description":"Diese Liste ist eine Teilliste der Liste der Baudenkmäler in Rothenburg ob der Tauber. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDieser Teil der Liste beschreibt das Ensemble der Altstadt Rothenburgs und dessen Baudenkmäler.\\nDarin befinden sich folgende Straßen- und Platzbildern von besonderer Bedeutung und deren Baudenkmäler: Alter Stadtgraben, Galgengasse, Grüner Markt, Hafengasse, Herrngasse, Judengasse, Kapellenplatz, Klingengasse, Marktplatz, Obere Schmiedgasse, Plönlein, Spitalgasse, Spital Zum Heiligen Geist, Rödergasse, Schrannenplatz, Untere Schmiedgasse, Wenggasse."},{"page_url":"https://en.wikipedia.org/wiki/Llobregat%E2%80%93Anoia_Line","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/FGC_Metros_Comarcals_Sant_Esteve_Sesrovires.jpg","page_title":"Llobregat–Anoia Line","context_page_description":"The Llobregat–Anoia Line is an unconnected metre gauge railway line linking Barcelona with the Baix Llobregat, Bages and Anoia regions, in Catalonia, Spain. Its name refers to the fact that it follows the course of the Llobregat and Anoia rivers for most of its length. Plaça d'Espanya station serves as the Barcelona terminus of the line, then continuing northwards to Martorell, where two main branches to Manresa and Igualada are formed. It also includes several freight branches, accounting for a total line length of 138 kilometres and 41 passenger stations.\\nBarcelona Metro rapid transit line 8, together with a number of commuter and freight rail services, runs on the line's main route between Barcelona and Sant Boi de Llobregat. The section between Barcelona and Olesa de Montserrat is operated as a high-frequency commuter rail system known as Baix Llobregat Metro, with some services continuing northwards to Manresa and Igualada. This system further includes the temporarily closed Olesa de Montserrat–Esparreguera Cable Car, which is also operated by FGC."},{"page_url":"https://hu.wikipedia.org/wiki/Messier-katal%C3%B3gus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Fairy_of_Eagle_Nebula.jpg","page_title":"Messier-katalógus","context_page_description":"A Messier-katalógus Charles Messier francia csillagász által 1758 és 1782 között összeállított katalógus, amely a legfényesebb mélyégobjektumokat tartalmazza. Ezek között vannak nyílthalmazok, gömbhalmazok, ködök és galaxisok, tévedésből egy kettőscsillag is bekerült. A katalógus objektumait M betűvel és egy számmal szokás jelölni. Eredeti célja azon égi objektumoknak a felsorolása volt, amelyeket gyakran tévesztettek össze az akkor a csillagászat érdeklődésének középpontjába került üstökösökkel, ugyanis készítése évszázadában jött rá Edmond Halley, hogy az üstükösök a Naprendszer tagjai, így keresésük és pályájuk meghatározása rendszeres tevékenységgé vált. Napjainkban elsősorban amatőrcsillagászok használják, mert sok viszonylag fényes, könnyen megfigyelhető mélyég-objektum van benne.\\nA Messier által használt eszközök fejlettsége általában nem tette lehetővé, hogy a katalogizált csillaghalmazokban különálló csillagokat tudjon észlelni. Ezt a Messier-objektumok jelentős részénél William Herschel tudta először megtenni."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%84%9B%E7%9F%A5%E7%B8%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Aichi_museum_of_flight2.jpg","page_title":"愛知縣","context_page_description":"爱知县是位于日本中部地方的县，首府与第一大城为名古屋市。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_villages_in_Niue","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Niue_Verwaltungsgliederung.png","page_title":"List of villages in Niue","context_page_description":"Niue is subdivided into 14 villages. Each village has a village council that elects its chairman. The villages are at the same time electoral districts. Each village sends an assemblyman to the Parliament of Niue."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%82%85%E9%B9%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%E5%BC%B5%E9%8C%A6%E5%92%8C%E5%82%85%E9%B7%B9.jpg","page_title":"傅鹰","context_page_description":"傅鷹，男，祖籍福建閩縣，生於北京，中國物理化學家、教育家及中國膠體化學奠基人，中國科學院院士。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%99%D7%A9%D7%A8%D7%A0%D7%92%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Nova_Muixeranga_d%27Algemes%C3%AD.jpg","page_title":"מוישרנגה","context_page_description":"מוישרנגה הוא הכינוי שניתן לאסופה של מחולות עתיקים ולמגדלים אנושיים שמקורם בחבל ולנסיה ושמבוצעים כיום בעיקר בעיירה אלז'מזי.\\nהמוישרנגה היא יותר מריקוד אקרובטי אמנותי. היא גם אוסף של מבנים הבנויים מהרקדנים המפגינים גמישות מרהיבה והמוסעים בתהלוכת \\"גבירתנו אשר על הבריאות\\" החג העיקרי של אלז'מזי.\\nמוישרנגה הוא השם המקובל באלז'מזי לקסטל, מנהג של המגדלים האנושיים המודרניים הנפוץ בכל קטלוניה. ההבדל הוא שהמוישרנגה היא בעלת רקע דתי יותר ומלווה בריקוד, כאשר גובה המגדלים האנושיים פחות חשוב מהצורה הסמלית. בעבר הייתה מסורת המגדלים האנושיים נפוצה בכל רחבי חצי האי האיברי.\\nבשנת 2011 הכיר ארגון אונסק\\"ו בפסטיבל באלז'מזי שבו מבצעים מוישרנגה כמורשת תרבותית בלתי מוחשית."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%A6%99%E6%B8%AF%E5%B3%B6%E5%B0%88%E7%B7%9A%E5%B0%8F%E5%B7%B41%E8%99%9F%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/GM01RtMap.png","page_title":"香港島專線小巴1號線","context_page_description":"香港島專線小巴1號線為香港一條港島區專線小巴路線，由景益營運，來往中環香港站及山頂，途經馬己仙峽道，部分班次分別會繞經僑福道及加列山道，為香港境內首條專綫小巴路線。此路線起訖點和新巴15線相若，但取道較直接往來山頂及中環的馬己仙峽道，因此巴士必須繞經灣仔區方可上下山，本路線因而顯得較巴士直接。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%D8%AA%D8%B1%D8%B3%E2%80%8C%D9%87%D8%A7%D9%88%D8%B2%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Wappen_Waltershausen.png","page_title":"والترس‌هاوزن","context_page_description":"شهر والترس‌هاوزن در ایالت تورینگن در کشور آلمان واقع شده است."},{"page_url":"https://nl.wikipedia.org/wiki/Tongersepoort","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Alexander_Schaepkens%2C_veldzijde_Tongersepoort%2C_Maastricht_%2C_ca_1870.jpg","page_title":"Tongersepoort","context_page_description":"De Tongersepoort, ook wel Lenculenpoort, is een voormalige stadspoort in de Nederlandse stad Maastricht. De poort was onderdeel van de tweede middeleeuwse stadsmuur en was gelegen aan het einde van de Tongersestraat, waar de poort de toegang vormde tot de stad vanuit zuidwestelijke richting. De oorspronkelijke poort dateerde uit de late 13e of 14e eeuw, maar werd in de loop der eeuwen diverse malen vernieuwd. Vanaf de 17e eeuw was de veldzijde van de poort deels aan het oog onttrokken door de uitbreiding van de vestingwerken van Maastricht. De poort werd eind 1867, begin 1868 gesloopt."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%AE%89%E5%BE%B3%E5%A4%A9%E7%9A%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/%E5%AE%89%E5%BE%B3%E5%AE%AE.jpg","page_title":"安徳天皇","context_page_description":"安徳天皇は、第81代天皇。諱は言仁。\\n高倉天皇の第一皇子。母は平清盛の娘の徳子。"},{"page_url":"https://fr.wikipedia.org/wiki/Paul_Boiteau","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Boiteau_griselidis-01.jpg","page_title":"Paul Boiteau","context_page_description":"Dieudonné Alexandre Paul Boiteau, ou Paul Boiteau d'Ambly, est un économiste, maître des requêtes au Conseil d'État ami de Béranger et écrivain français, né à Paris le 25 novembre 1830, et mort dans la même ville le 11 juin 1886.\\nIl a aussi signé sous le pseudonyme Paul d'Ambly qui était le nom de sa mère."},{"page_url":"https://eu.wikipedia.org/wiki/Pukou_Barrutia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/ChinaNanjingPukou.png","page_title":"Pukou Barrutia","context_page_description":"Pukou Barrutia, Nanjing osatzen duten barrutietako bat da. 2004ko erroldaren arabera, 490.000 biztanle bizi ziren 913,08 kilometro koadroko azaleran."},{"page_url":"https://no.wikipedia.org/wiki/Bosnia-Hercegovinas_politiske_system","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Welcomesign_in_Brod_Republika_Srpska.jpg","page_title":"Bosnia-Hercegovinas politiske system","context_page_description":"Det politiske system i Bosnia-Hercegovina bygger på Daytonavtalen fra 1995. Landet er en forbundsstat, og består av de to entitetene Føderasjonen Bosnia-Hercegovina og Republika Srpska. Brčko-distriktet i nord er et kondominium mellom de to entitetene, men samtidig direkte underlagt nasjonalstatens, og ikke entitetenes lover.\\nLandets politiske system fungerer innenfor rammene av et parlamentarisk, representativt demokrati. Daytonavtalens tre «konstituerende folkegrupper» er representert i samtlige føderale organer.\\nDet øverste statsorgan er Bosnia-Hercegovinas presidentskap. Entitetene har også egne presidenter.\\nDen lovgivende makt forvaltes av parlamentets to kamre, Representantenes hus og Folkenes hus. Medlemmene av Representantenes hus velges ved forholdstallsvalg. Entitetenes parlamenter har også lovgivningsmakt, og det samme har kantonene i Føderasjonen Bosnia-Hercegovina.\\nDet føderale statsorganer regnes som relativt svake i forholdet til entitetene, sammenliknet med andre europeiske føderasjoner."},{"page_url":"https://de.wikipedia.org/wiki/Moncucco_Torinese","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Castello_di_Moncucco.jpg","page_title":"Moncucco Torinese","context_page_description":"Moncucco Torinese ist eine italienische Gemeinde mit 877 Einwohnern in der Provinz Asti, Region Piemont.\\nDie Nachbargemeinden sind Albugnano, Arignano, Berzano di San Pietro, Castelnuovo Don Bosco, Cinzano, Marentino, Mombello di Torino, Moriondo Torinese und Sciolze."},{"page_url":"https://de.wikipedia.org/wiki/Pfarrhaus_(Hattenhofen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Hattenhofen_Hauptstr4_Pfarrhaus_002_201505_500.JPG","page_title":"Pfarrhaus (Hattenhofen)","context_page_description":"Das katholische Pfarrhaus in Hattenhofen, einer Gemeinde im oberbayerischen Landkreis Fürstenfeldbruck, wurde 1915 errichtet. Das Pfarrhaus an der Hauptstraße 4 ist ein geschütztes Baudenkmal.\\nDer zweigeschossige kubische Walmdachbau mit Eckrustika im Stil des reduzierten Historismus wurde vom Architekten Balthasar Hafenmeier für den Gastwirt Andreas Eberl errichtet."},{"page_url":"https://de.wikipedia.org/wiki/Hurrikan_Felix","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Felix_from_ISS_03_sept_2007_1138Z.jpg","page_title":"Hurrikan Felix","context_page_description":"Der Hurrikan Felix war ein Kategorie-5-Hurrikan, der 2007 Zentralamerika traf. Felix, der sechste benannte Sturm, zweite Hurrikan und zweite Kategorie-5-Hurrikan der Saison, entstand am 31. August aus einer tropischen Welle und passierte am 1. September die südlichen Inseln unter dem Winde, bevor er sich zu einem Hurrikan verstärkte. Einen Tag später begann sich der Hurrikan rapide in einen großen Hurrikan zu verstärken, und erreichte am 3. September die höchste Kategorie auf der fünfstufigen Saffir-Simpson-Hurrikan-Windskala. Später an diesem Tag schwächte er sich zunächst wieder auf die Kategorie 4 ab, verstärkte sich jedoch am 4. September wieder in einen Kategorie-5-Sturm.\\nFelix ging am 4. September als Kategorie-5-Hurrikan nahe der Grenzregion von Nicaragua und Honduras, die auch als Miskitoküste bezeichnet wird, an Land, exakt einen halben Monat nachdem Hurrikan Dean Mexiko mit derselben Intensität traf. Hurrikan Felix traf am selben Tag Land, wie Hurrikan Henriette aus dem Ostpazifik, die auf die Küste der Baja California traf. Dies war erst das zweite Mal in der Geschichte, dass Hurrikane aus dem Atlantik und Ostpazifik am selben Tag auf Land trafen."},{"page_url":"https://en.wikipedia.org/wiki/H%C3%B4tel_du_Petit-Bourbon","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Balet_comique_de_la_Royne_1582_p4r%2C_illustration_by_Jacques_Patin_-_Gallica_2010_%28adjusted%29.jpg","page_title":"Hôtel du Petit-Bourbon","context_page_description":"The Hôtel du Petit-Bourbon, a former Parisian town house of the royal family of Bourbon, was located on the right bank of the Seine on the rue d'Autriche, between the Louvre to the west and the Church of Saint-Germain l'Auxerrois to the east. It was constructed in the 14th century, not long after the Capetian Kings of France enlarged the fortress of the Louvre in order to use it as a royal residence. On two 1550 maps it is shown simply as the Hôtel de Bourbon, but by 1652, as the Petit-Bourbon on the map of Gomboust. The Bourbons took control of France in 1589, at which time they also acquired the Louvre.\\nThe Great Hall, the Grande Salle du Petit-Bourbon, was larger than any room in the Louvre, and served as the first theatre of the troupe of Molière upon their arrival in Paris in 1658; but by 1660 Molière and his actors were evicted, and the Petit-Bourbon was pulled down to make space for the construction of the Louvre Colonnade."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D1%83%D0%B7%D0%B4%D1%8C_%D1%87%D1%91%D1%80%D0%BD%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Lactarius_necator3.jpg","page_title":"Груздь чёрный","context_page_description":"Чёрный груздь — гриб рода Млечник семейства Сыроежковые.\\nСинонимы\\nРусские: оливково-чёрный груздь, чернушка, черныш, чёрная дуплянка, чёрные губы, цыган, чёрный еловый груздь, оливково-коричневый груздь, варен, свинорыл.\\nЛатинские\\nAgaricus necator Bull., 1781basionym\\nGalorrheus necator Fr., 1825\\nAgaricus turpis Weinm., 1828\\nLactarius turpis Fr., 1838\\nLactifluus turpis Kuntze, 1891\\nAgaricus plumbeus Bull., 1786\\nLactarius plumbeus Gray, 1821\\nLactarius turpis var. plumbeus Cooke, 1883 и др."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Beechingin_leikkauksissa_suljetuista_rautatieasemista_%E2%80%93_Skotlanti","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Ellon_station_%28remains%29_geograph-3455202-by-Ben-Brooksbank.jpg","page_title":"Luettelo Beechingin leikkauksissa suljetuista rautatieasemista – Skotlanti","context_page_description":"A\\nAbbeyhill – 1964\\nAberfeldy – 1965\\nAberlour – 1965\\nAbington – 1965\\nAboyne – 1966\\nAchanalt – ei suljettu\\nAch-na-Cloich – 1965\\nAchnasheen – ei suljettu\\nAchnashellach – ei suljettu\\nAchterneed – 1965\\nAddiewell – ei suljettu\\nAdvie – 1965\\nAllanfearn – 1965\\nAltnabreac – ei suljettu\\nAlves – 1965\\nAlyth Junction – 1965\\nAnstruther – 1965\\nAppin – 1966\\nArdrossan Montogomerie Pier – 1967\\nArdrossan Town – 1968, uusi asema avattiin 1987\\nArnage – 1965\\nAttadale Halt – ei suljettu\\nAuchengray – 1966\\nAuchindachy – 1968\\nAuchinleck – 1965, avattiin uudelleen 1984\\nAuchnagatt – 1965\\nB\\nBack o’Loch Halt – 1964\\nBaillieston – 1964, avattiin uudelleen 1993\\nBalado – 1964\\nBallachulish – 1966\\nBallachulish Ferry – 1966\\nBallater – 1966\\nBallifurth Farm Halt – 1965\\nBallindalloch – 1965\\nBallinluig – 1965\\nBalloch Pier – 1986\\nBalnaguard Halt – 1965\\nBalquhidder – 1965\\nBanavie – ei suljettu\\nBanchory – 1966\\nBanff – 1964\\nBarassie – ei suljettu\\nBarcaldine Halt – 1966\\nBarleith – 1964\\nBarrhead – ei suljettu\\nBarrhill – ei suljettu\\nBeasdale – ei suljettu\\nBelses – 1969\\nBenderloch – 1966\\nBishopbriggs – ei suljettu\\nBlacksboat – 1965\\nBlackwood – 1965\\nBoat of Garten – 1965, museorautatieksi 1978\\nBogside Race Course – 1967"},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_valkoisten_muistomerkeist%C3%A4_Suomessa","image_url":"https://upload.wikimedia.org/wikipedia/fi/b/b5/Eura_1918_muistomerkki_1.jpg","page_title":"Luettelo valkoisten muistomerkeistä Suomessa","context_page_description":"Luettelo valkoisten muistomerkeistä Suomessa sisältää vuonna 1918 Suomen sisällissodan voittaneiden valkoisten muistopatsaat ja vapaudenpatsaat. Listassa on myös sisällissodassa kaatuneiden valkoisten muistoksi pystytetyt erilaiset muistomerkit: patsaat, veistokset, muistopaikat ja muistolaatat. Luettelossa voi olla myös hautausmailla tai niiden lähellä olevia yleisiä, mutta ei yksittäisillä haudoilla olevia muistomerkkejä. Luettelossa patsaat ovat maakunnittain ja kunnittain nimen mukaisessa järjestyksessä."},{"page_url":"https://pt.wikipedia.org/wiki/Festival_de_M%C3%BAsica_da_Ibiapaba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Festival_de_M%C3%BAsica.png","page_title":"Festival de Música da Ibiapaba","context_page_description":"O Festival de Música da Ibiapaba é um evento musical realizado anualmente que acontece na Região da Ibiapaba, na cidade de Viçosa do Ceará.\\nO Festival de Música da Ibiapaba é o primeiro projeto do Norte e Nordeste do estado do Ceará centrado na formação em Música Popular Brasileira, que visa contemplar a diversidade de expressão na música, destacando a musicalidade nordestina, através de oficinas e apresentações musicais, promovendo o intercâmbio de experiências e estimulando a prática musical e a criação de variadas formações como orquestras, bandas, corais e grupos instrumentais. Teve início em 2004 e é realizado em Viçosa do Ceará, em palcos montados na Praça da Igreja Matriz e na Igreja do Céu.\\nO Festival é uma realização do Instituto de Arte e Cultura do Ceará e do Centro Dragão-do-mar de Arte e Cultura, através do Governo do Estado do Ceará, com o apoio do Governo Municipal."},{"page_url":"https://en.wikipedia.org/wiki/Wheatlands_(Sevierville,_Tennessee)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Wheatlands-sevier-tn1.jpg","page_title":"Wheatlands (Sevierville, Tennessee)","context_page_description":"Wheatlands is an antebellum plantation in Sevier County, in the U.S. state of Tennessee. The plantation's surviving structures— which include the plantation house, a storage shed, and smokehouse— have been placed on the National Register of Historic Places. The plantation house has been called \\"the best example of a Federal-style building remaining in Sevier County.\\"\\nWheatlands, named after its large annual wheat crop, was established as a family farm by Revolutionary War veteran Timothy Chandler in 1791. Chandler's son, John Chandler, inherited Wheatlands in 1819, and under his direction the plantation grew to become one of Sevier County's largest farms, covering 3,700 acres by 1850. Chandler's freed slaves inherited part of Wheatlands in 1875, and formed the Chandler Gap community in the hills south of the plantation."},{"page_url":"https://en.wikipedia.org/wiki/Jaunjelgava","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Jelgavas_iela.JPG","page_title":"Jaunjelgava","context_page_description":"Jaunjelgava is a town in Latvia on the left bank of the Daugava River in the historical region of Selonia, about 80 km southeast of Riga."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/I%C3%BB-chiam-%C5%8Dng-khu","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/13-08-08-hongkong-by-RalfR-Panorama2.jpg","page_title":"Iû-chiam-ōng-khu","context_page_description":"Iû-chiam-ōng-khu sī Hiong-káng 18-ê hun-khu lāi-bīn kî-tiong chi̍t-ê, sio̍k Kiú-liông. 2006 nî ê jîn-khaú ū 28 bān."},{"page_url":"https://es.wikipedia.org/wiki/Elecciones_estatales_de_Hamburgo_de_2004","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ole_von_beust.jpg","page_title":"Elecciones estatales de Hamburgo de 2004","context_page_description":"La elección estatal de Hamburgo de 2004 se llevó a cabo el 29 de febrero de 2004 para elegir a los miembros del Parlamento de Hamburgo."},{"page_url":"https://sk.wikipedia.org/wiki/Blhovce","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Blhovce_-_Kostol_M%C3%A1rie-Magdal%C3%A9ny.jpg","page_title":"Blhovce","context_page_description":"Blhovce sú obec na Slovensku v okrese Rimavská Sobota."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%82%D0%B5%D1%80,_%D0%A0%D0%B8%D1%85%D0%B0%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Fotothek_df_ps_0000010_Blick_vom_Rathausturm.jpg","page_title":"Петер, Рихард","context_page_description":"Рихард Петер — немецкий фотограф. Наиболее известен серией фотографий разбомбленного Дрездена."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84_%D9%84%D8%A7%D9%8A%D9%85%D8%A8%D9%8A%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Laimbeer_2007.jpg","page_title":"بيل لايمبير","context_page_description":"بيل لايمبير ‏ مواليد 19 مايو 1957 في بوسطن، هو لاعب كرة سلة أمريكي لعب في الرابطة الوطنية لكرة السلة ثم أصبح مدرباً. بدأ مسيرته الاحترافية في سنة 1979 يدرب في مؤسسة النساء الدولية لكرة السلة. يبلغ طوله 6 قدم 11 بوصة. اعتزل اللعب في 1993."},{"page_url":"https://pl.wikipedia.org/wiki/Pa%C5%82ac_w_Sarnach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Kaplica_Pa%C5%82ac_Sarny_2019_07.jpg","page_title":"Pałac w Sarnach","context_page_description":"Pałac w Sarnach – powstał w 1661 r. w Sarnach z przebudowy renesansowego dworu, dokonanej przez von Götzenów."},{"page_url":"https://cy.wikipedia.org/wiki/Capel_Methodistaidd,_Trefynwy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Methodist_Chapel%2C_1837_%28geograph_5445975%29.jpg","page_title":"Capel Methodistaidd, Trefynwy","context_page_description":"Cynlluniwyd Capel y Methodistiaid, Trefynwy, Sir Fynwy, de-ddwyrain Cymru gan George Vaughan Maddox. Fe godwyd yr adeilad ychydig yn ôl o Sgwâr Sant Ioan a hynny yn 1837. Mae'r galeri gwreiddiol yn dal ynddo a llofft yr organ a'r pulpud cywrain yntau.\\nMae wedi ei osod yn ôl o'r brif stryd yn unol â threfn yr oes - lle fod yr adeilad anghydffurfiol i'w weld yn ormod o fwgan i'r drefn arferol ac i'r sefydliad. Fe'i benodwyd yn adeilad rhestredig Gradd II* gan Cadw. Mae'n un o ddau-ddeg-pedwar adeilad yn Nhrefynwy sydd ar y Llwybr Treftadaeth."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_Newcastle_upon_Tyne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Monument_Guerre_Boers_Newcastle_Tyne_6.jpg","page_title":"List of public art in Newcastle upon Tyne","context_page_description":"This is a list of public art in Newcastle upon Tyne, including statues, busts and other memorials. This list applies only to works of public art on permanent display in an outdoor public space and as such does not include, for example, artworks in museums."},{"page_url":"https://vi.wikipedia.org/wiki/Cichlasomatinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Ivanacara_adoketa5265.jpg","page_title":"Cichlasomatinae","context_page_description":"Cichlasomatinae là một phân họ trong họ Cá hoàng đế. Phân họ này bao gồm tất cả các loài cá hoàng đế bản địa của Caribe, Hoa Kỳ, México và Trung Mỹ, và một số loài khác ở Nam Mỹ. Phân họ Cichlasomatinae thường được chia thành 2 tông: Cichlasomatini và Heroini."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDidovsk%C3%A9_m%C4%9Bsto_v_Boskovic%C3%ADch","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Plackova.JPG","page_title":"Židovské město v Boskovicích","context_page_description":"Židovské město v Boskovicích se rozkládá v jižní části města Boskovice v okrese Blansko na ploše 5 hektarů. Patří k nejzachovalejším židovským památkám v Česku a je propagováno každoročním festivalem „Boskovice – Festival pro židovskou čtvrť“.\\nCelá židovská čtvrť vytváří samostatný urbanistický celek nacházející se jižně od historického jádra Boskovic. Stejně jako v jiných městech drželi Židé svou komunitu od zbytku města a žili po staletí bez jakýchkoliv omezení. Obyvatele ovšem doprovázelo mnoho nevýhod. Například zákaz provozu podomního obchodu v okolních vesnicích, který vešel v platnost roku 1565 a nemohli překročit hranice ghetta v době křesťanských svátků a po setmění.\\nStálo zde asi 100 domů, které byly rozděleny na 138 bytových jednotek. Ghetto zaznamenalo řadu požárů a to v letech 1696, 1823, 1839, 1870, 1882 a 1906."},{"page_url":"https://pl.wikipedia.org/wiki/Kodaline","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Kodaline_%282015%29_bei_Radio_Pilatus.jpg","page_title":"Kodaline","context_page_description":"Kodaline – irlandzki zespół muzyczny, grający alternatywnego rocka. Początkowo znany jako 21 Demands. Zadebiutowali kawałkiem Give Me A Minute, który znalazł się na Irish Singles Chart w marcu 2007 roku. W 2011 roku zespół zmienił nazwę na Kodaline.\\nStephen Garrigan i Mark Prendergast dorastali w Swords w Dublinie, znali się od dzieciństwa. Obaj uczęszczali do szkoły średniej w Colaiste Choilm, w swoim rodzinnym mieście, gdzie brali udział w wielu tzw. bitwach kapel. Zaczęli pokazywać swoją miłość do muzyki i mniej więcej w tym czasie do ich zespołu dołączył Vinny May, również mieszkający w Swords. Ich zespół nie był w pełni kompletny do stycznia 2012 roku, kiedy to ich przyjaciel – Jason Boland – mieszkający w Celbridge w hrabstwie Kildare, został zwerbowany."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Guinal_d%27Ergu%C3%A9-Gab%C3%A9ric","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/085_Ergu%C3%A9-Gab%C3%A9ric_Eglise_paroissiale.JPG","page_title":"Église Saint-Guinal d'Ergué-Gabéric","context_page_description":"L'église Saint-Guinal est l'église paroissiale d'Ergué-Gabéric, dans le département du Finistère, en Bretagne. Construite aux XVIᵉ et XVIIᵉ siècles sous l'invocation de saint Gwenaël, elle est entourée d'un enclos comprenant un ossuaire.\\nL'ensemble de l'église et son enclos sont classés « monument historique » en 1939."},{"page_url":"https://fr.wikipedia.org/wiki/Anderlecht","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Flag_of_Anderlecht.jpg","page_title":"Anderlecht","context_page_description":"Anderlecht est l'une des 581 communes de Belgique et une des 19 communes de la Région de Bruxelles-Capitale. Comme toutes les communes de Bruxelles, elle est officiellement bilingue.\\nLe 1ᵉʳ décembre 2019, elle comptait 121 019 habitants, appelés Anderlechtois en français et Anderlechtenaars en néerlandais, pour une superficie de 17,74 km² soit une densité de 6 821,82 hab./km².\\nElle est située dans le sud-ouest de l'agglomération bruxelloise et limitrophe aux communes de Bruxelles-ville, Dilbeek, Drogenbos, Forest, Molenbeek-Saint-Jean, Leeuw-Saint-Pierre et Saint-Gilles."},{"page_url":"https://la.wikipedia.org/wiki/Constantius_Chlorus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Argenteus-Constantius_I-antioch_RIC_033a.jpg","page_title":"Constantius Chlorus","context_page_description":"Flavius Valerius Constantius, dictus Chlorus ab historicis Byzantiis aut simpliciter Constantius I, fuit imperator Romanus et cum filio Constantino I conditor domus regnatricis eiusdem nominis. Regnavit Imperium Occidentale ut Caesar sub Augusto Maximiano ab anno 293 usque ad 305, et ut Augustus ab anno 305 usque ad 306 Galerio regnante Imperium Orientem."},{"page_url":"https://en.wikipedia.org/wiki/Monument_Metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Monument_T%26W_Metro_station_-_platfom_4_01.jpg","page_title":"Monument Metro station","context_page_description":"Monument is an underground station on the Tyne and Wear Metro, serving Newcastle City Centre. Monument station was opened in November 1981, with platforms 3 & 4 opening in November 1982.\\nThe station is used by almost 6 million passengers per year, and is the busiest on the network. It is named after Grey's Monument, which stands directly above the station. It is also the only station to be situated on a line crossing.\\nMonument is a busy interchange station, with four platforms. Trains run as shown:\\nPlatform 1: Trains towards South Hylton and trains towards South Shields\\nPlatform 2: Trains towards St. James via Whitley Bay and trains towards Newcastle Airport\\nPlatform 3: Trains towards South Shields via Whitley Bay\\nPlatform 4: Trains towards St. James"},{"page_url":"https://sh.wikipedia.org/wiki/Shaquille_O%27Neal","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Shaq_at_the_white_house.jpg","page_title":"Shaquille O'Neal","context_page_description":"Shaquille Rashaun O'Neal umirovljeni je američki profesionalni košarkaš. Igrao je na poziciji centra, a izabran je u 1. krugu NBA drafta 1992. od strane Orlando Magica. Igravši za Orlando Magice, Los Angeles Lakerse, Miami Heate, Phoenix Sunse, Cleveland Cavalierse i Boston Celticse, O'Neal je ostvario mnoge uspjehe. Osvojio je 4 NBA prstena, 1 puta proglašavan je najkorisnijim igračem lige te 3 puta najkorisnijim igračem NBA finala. O'Neal je petnaesterostruki NBA All-Star te je četrnaest puta biran u All-NBA momčad i tri puta u All-Defensive momčad.\\nU razdoblju od 2000. do 2002. godine O'Neal je uz pomoć Kobea Bryanta osvojio čak tri uzastopna NBA naslova te je sva tri puta odnio nagradu za najkorisnijeg igrača NBA finala. Nakon nesuglasica s Bryantom i izgubljenog NBA finala 2004. godine, O'Neal je mijenjan u Miami Heate. S njima je proveo četiri godine, a u sezoni 2005./06. O'Neal je uz Wadeovu pomoć osvojio svoj četvrti NBA prsten. Nakon sezone 2007./08. O'Neal je preselio u Phoenix Sunse te je s njima odigrao jednu sezonu, ali ipak nisu ostvarili doigravanje. Nakon završetka sezone 2008."},{"page_url":"https://sv.wikipedia.org/wiki/Oursbelille","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Oursbelille_IMG_9378.JPG","page_title":"Oursbelille","context_page_description":"Oursbelille är en kommun i departementet Hautes-Pyrénées i regionen Occitanien i sydvästra Frankrike. Kommunen ligger i kantonen Bordères-sur-l'Échez som tillhör arrondissementet Tarbes. År 2009 hade Oursbelille 1 212 invånare."},{"page_url":"https://en.wikipedia.org/wiki/First_Presidency","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Paul_Palmieri.jpeg","page_title":"First Presidency","context_page_description":"Among many churches in the Latter Day Saint movement, the First Presidency is the highest presiding or governing body. Present-day denominations of the movement led by a First Presidency include The Church of Jesus Christ of Latter-day Saints, the Community of Christ, Remnant Church of Jesus Christ of Latter Day Saints, and the Righteous Branch of the Church of Jesus Christ of Latter-Day Saints.\\nWhen the Church of Christ was organized on April 6, 1830, Joseph Smith and Oliver Cowdery led the church in their capacity as elders. Smith established the inaugural First Presidency on March 8, 1832, with the ordinations of Jesse Gause and Sidney Rigdon as his counselors. The term \\"first presidency,\\" though used at least as early as 1834, did not become standard until 1838. The presidency was to exercise authority over the entire church, whereas the jurisdictions of the Twelve Apostles and the Seventy were the outlying areas outside of the gathering places where the church had been organized on a more permanent basis."},{"page_url":"https://it.wikipedia.org/wiki/Muhen","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Bahnhof_Muhen.JPG","page_title":"Muhen","context_page_description":"Muhen è un comune svizzero di 3 862 abitanti del Canton Argovia, nel distretto di Aarau."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B5%D1%80%D0%B5%D0%BF%D0%B8%D1%81%D1%8B%D0%B2%D0%B0%D0%BD%D0%B8%D0%B5_%D0%B3%D1%80%D0%B0%D1%84%D0%BE%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/GraphRewriteExample.PNG","page_title":"Переписывание графов","context_page_description":"В информатике переписывание графов — техника по созданию нового графа из\\nисходного графа алгоритмическим образом.\\nПереписывание графов находит широкое применение в компьютерных науках, например, в конструировании программного обеспечения, в верификации программного обеспечения, в генерировании изображений, в компиляторах, в графовых базах данных.\\nПреобразования графов можно использовать в качестве абстракции вычислений.\\nОсновная идея заключается в том, что состояние вычисления может быть представлено в виде графа, дальнейшие шаги этого вычисления могут быть представлены как правила преобразования на этом графе.\\nТакие правила состоят из исходного графа, который должен быть сопоставлен с подграфом полного состояния, и заменяющего графа, который заменит сопоставленный подграф.\\nФормально система переписывания графа обычно состоит из множества правил переписывания графа в форме, где называется графом-образцом, а называется заменяющим графом. Правило переписывания\\nграфа применяется к исходному графу путем поиска вхождения шаблонного графа и\\nзамены найденного вхождения экземпляром заменяющего графа. Правила переписывания"},{"page_url":"https://ceb.wikipedia.org/wiki/Comuna_B%C4%83le%C8%99ti_(munisipyo_sa_Romaniya,_Gorj)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/RO_GJ_Ceauru_17.jpg","page_title":"Comuna Bălești (munisipyo sa Romaniya, Gorj)","context_page_description":"Munisipyo ang Comuna Bălești sa Romaniya. Nahimutang ni sa lalawigan sa Gorj, sa habagatan-kasadpang bahin sa nasod, 240 km sa kasadpan sa Bucharest ang ulohan sa nasod.\\nMga lungsod sa Comuna Bălești:\\nBălești\\nCeauru\\nTămășești\\nTălpășești\\nRasova\\nStolojani\\nCornești\\nGăvănești\\nVoinigești\\nAng klima hemiboreal. Ang kasarangang giiniton 11 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Disyembre, sa -4 °C. Ang kasarangang pag-ulan 1,068 milimetro matag tuig. Ang kinabasaan nga bulan Mayo, sa 148 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 50 milimetro."},{"page_url":"https://ca.wikipedia.org/wiki/Kokomo_(Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Kokomo-indiana-courthouse.jpg","page_title":"Kokomo (Indiana)","context_page_description":"Kokomo és una població dels Estats Units a l'estat d'Indiana. Segons el cens del 2006 tenia una població de 48.070 habitants."},{"page_url":"https://ro.wikipedia.org/wiki/Caranda%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Brasao_Caranda%C3%AD.png","page_title":"Carandaí","context_page_description":"Carandaí este un oraș în unitatea federativă Minas Gerais, Brazilia."},{"page_url":"https://es.wikipedia.org/wiki/Koutalisaurus_kohlerorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Koutalisaurus.jpg","page_title":"Koutalisaurus kohlerorum","context_page_description":"Koutalisaurus kohlerorum es la única especie conocida del género extinto Koutalisaurus de dinosaurio ornitópodo hadrosáurido, que vivió a finales del período Cretácico en el Maastrichtiense, hace aproximadamente 70 millones de años, en lo que es hoy Europa. La descripción de este género se basa en una dentadura muy completa, hallada en la Formación de Tremp, cerca del municipio de Abella de la Conca, en Lérida. Esta dentición, la IPS SRA 27, fue inicialmente atribuida al género Pararhabdodon, ​ pero proviene de una localidad diferente y presenta características inusuales. La dentadura posee una forma alargada y presenta una porción sin dientes bastante extensa. Prieto-Marquez et al, en el 2006, pensaron que el animal se trataba de un hadrosáurido, pero no se ha podido especificar el lugar que ocupa dentro de la familia.​"},{"page_url":"https://fr.wikipedia.org/wiki/London_Overground","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/378135_at_Wandsworth_Road_21-09-18.jpg","page_title":"London Overground","context_page_description":"London Overground est un réseau de transport ferroviaire, principalement en surface, qui dessert l'agglomération de Londres. London Overground couvre le Grand Londres et le comté d'Hertfordshire, il s'agit d'un réseau ferroviaire de banlieue, bien que les fréquences de passage tendent à se rapprocher de celles des fréquences du Tube."},{"page_url":"https://la.wikipedia.org/wiki/Expeditio_sacra","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Passages_d%27outremer_Fr5594%2C_fol._19r%2C_Concile_de_Clermont.jpg","page_title":"Expeditio sacra","context_page_description":"Expeditiones sacrae temporibus modernis Cruciatae vocatae fuerunt bella iussu Paparum mediaevalium ad inimicos religionis suae exstirpandos incepta et praesertim ad locos Christianitatis sacros, saeculo septimo a Machometanis captos, vindicandos. Expeditiones in Terram Sanctam missae omnes sub appellatione \\"peregrinationis\\" acceptae sunt: passagium generale appellabatur quaeque expeditio ab ipso Papa iussa; passagium particulare quaeque a rege quodam statuta.\\nMilites \\"Cruce signati\\" qui expeditionem susceperint aliique qui pecuniam ad hanc rem dedicaverint a presbyteris plene peccatorum absoluti sunt. Reges insuper et domini qui expeditiones conduxerint terras pro se seu sociis adquirere conati sunt. Bellis prospere confectis, mercatores qui naves et instrumenta bellica praebuerant nova emporia et negotia nacti sunt. Locis sanctis saeculo duodecimo ineunte redemptis, Christiani militum ordines Hospitalariorum et Templariorum mox conditi sunt ad regna Christiana Orientalia defendenda."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B8%D1%82%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BE%D0%BB%D0%BF%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/%D0%9F%D0%B0%D1%80%D0%BE%D0%B2%D0%BE%D0%B7_%D0%AD%D0%BC.JPG","page_title":"Питательный колпак","context_page_description":"Питательный колпак — элемент конструкции парового котла паровоза, расположенный преимущественно над цилиндрической частью ближе к дымовой коробке. Служит для ускорения нагревания воды.\\nПринцип действия питательного колпака следующий: по кольцевым каналам вода поступает от инжекторов в верхнюю часть колпака, где вытекает в виде душа на расположенную под трубами сетку, которая дробит воду на ещё более мелкие струи, которые гораздо легче прогреть, нежели один большой поток. Далее уже эти нагретые струи и поступают в паровой котёл. Так как от нагрева из воды выделяются соли, ил и прочий сор, в нижней части котла прямо под питательным колпаком устанавливают грязевик для сбора отлагающейся грязи. Таким образом питательный колпак способствовал и снижению загрязнения внутренней поверхности котла.\\nПитательные колпаки делались преимущественно штампованными из одного листа, так как это позволяло удешевить производство. С появлением более мощных паровозов с большими и высоко поднятыми котлами, от питательного колпака отказались, а для прогрева воды иногда использовали трубчатый водоподогреватель."},{"page_url":"https://de.wikipedia.org/wiki/Walter_Feichtinger","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Walter_Feichtinger_April_2016_%2826452586101%29.jpg","page_title":"Walter Feichtinger","context_page_description":"Walter E. Feichtinger ist ein österreichischer Offizier, derzeit Brigadier, des Bundesheeres und Politikwissenschaftler. Seit 2002 ist er Leiter des Instituts für Friedenssicherung und Konfliktmanagement an der Landesverteidigungsakademie in Wien."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B0%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Moai_Rano_raraku.jpg","page_title":"Моаи","context_page_description":"Моаи — Полинезия шығысындағы Пасха аралында Рапа Нуи халқы 1250 - 1500 жж аралығында қашап жасаған 900 шақты монолитті адам фигуралары. Олардың жартысына жуығы негізгі моай алаңы болған Рано Раракуда орналасса, жүздегені сол жерден тасымалданып, аралдың периметрі бойымен Аху деп аталатын тасты платформаларға орнатылған. Барлық дерлік моаилар үлкен басты болып, басы бүкіл мүсіннің үштен сегіз бөлігін құрайды. Моаи негізінен киелі ата-бабалардың тірі бейнесі. 1722 жылы еуропалықтар алғаш Пасха аралына жетіп барғанда моаи мүсіндері өз әулет жерлерінде тігіліп қарап тұрған еді.\\n900-ден астам мүсіннің жасалуы мен тасымалдануы керемет жаратымпаздық және еңбекқор ерлік деуге болады. Паро деп аталатын ең биік Моайдың биіктігі 10 метр, салмағы 82 тонна. Ең ауры есептелетін Аху Тонгарикидегі қысқа, бірақ жұмыр моаидың салмағы 86 тонна. Ал аяқталмаған бір мүсіннің ұзындығы 21 м, салмағы 145–165 тонна. ХІIIVғ аяғы мен XIXғ басында Моаи құлатылады, оны Еуропа отаршылдары қиратқан немесе аралдағы ішкі тайпалық соғыстар салдарынан құлаған деп болжайды."},{"page_url":"https://pl.wikipedia.org/wiki/Sza%C5%84ce_jab%C5%82onkowskie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Obraz_115.jpg","page_title":"Szańce jabłonkowskie","context_page_description":"Szańce jabłonkowskie – zespół fortyfikacji i umocnień polowych, wznoszonych systematycznie od połowy XVI w. do połowy XVIII w. wzdłuż ówczesnej granicy śląsko-węgierskiej w rejonie Przełęczy Jabłonkowskiej w celu obrony przed zagrożeniem tureckim."},{"page_url":"https://en.wikipedia.org/wiki/Rockhampton,_Gloucestershire","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Rockhampton_Education_%26_Qualifications_Graph.jpg","page_title":"Rockhampton, Gloucestershire","context_page_description":"Rockhampton is a village and civil parish in the English county of Gloucestershire, situated in the unitary district of South Gloucestershire. It is located 2.8 miles northeast of Thornbury, 18.6 miles north of Bristol and is approximately 4 miles east of the River Severn. It had a population of 166 people according to the 2011 census.\\nThe south end of the village is more properly called Newton, and is in the Thornbury postal area."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B1%D0%B0%D0%BD%D1%81%D0%BA%D0%B0_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%BD%D0%B0_%D1%82%D1%80%D1%83%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Partia_e_Pun%C3%ABs_e_Shqip%C3%ABris%C3%AB.svg","page_title":"Албанска партия на труда","context_page_description":"Албанската партия на труда, съкратено АПТ, или Партия на труда на Албания, е комунистическа партия в Албания, съществувала от 1941 до 1991 година. Нейна приемница е съвременната Социалистическа партия на Албания.\\nЕнвер Ходжа е основател и дългогодишен лидер на партията и държавата до смъртта си през 1985 г. Наследилият го Рамиз Алия започва демократизацията на партията и страната, преобразува АПТ в социалистическа партия и се оттегля.\\nОснована е с активно съдействие на югославските комунисти като Албанска комунистическа партия в резултат от обединение на комунистически групи на 8 ноември 1941 г. През Втората световна война активно участва и ръководи борбата на албанския народ против италианските и германските окупационни сили.\\nСлед освобождаването на Албания от окупацията през 1944 г. завзема политическата власт в страната. АКП е преименувана на Албанска партия на труда през 1948 г. Партията управлява държавата до масовите вълнения в началото на 1990-те години. На извънреден конгрес на 12 юни 1991 г. АПТ е преименувана на Албанска социалистическа партия или Социалистическа партия на Албания.\\nНейният печатен орган ежедневният вестник „Зери и популит“ е основан през 1942 г."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A5%D0%B8%D1%86%D1%85%D0%BE%D1%84%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Hofstetten01.JPG","page_title":"Хицхофен","context_page_description":"Хицхофен општина је у њемачкој савезној држави Баварска. Једно је од 30 општинских средишта округа Ајхштет. Према процјени из 2010. у општини је живјело 2.814 становника. Посједује регионалну шифру 9176132."},{"page_url":"https://de.wikipedia.org/wiki/Navina_Omilade","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Navida_Omilade_2.jpg","page_title":"Navina Omilade","context_page_description":"Navina Omilade-Keller ist eine ehemalige deutsche Fußballspielerin. Die Mittelfeldspielerin war von 1998 bis 2013 in der Bundesliga und von 2001 bis 2010 für die A-Nationalmannschaft aktiv. Nach Stationen in Brauweiler und Potsdam spielte sie zuletzt in Wolfsburg. Mittlerweile ist Omilade für das Ü35-Team des FC Bayern München, das sie im Jahr 2017 „ins Leben gerufen hat“, engagiert."},{"page_url":"https://es.wikipedia.org/wiki/Catedral_de_San_Pablo_Aureliano_(Saint-Pol-de-L%C3%A9on)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Saint-Pol-de-L%C3%A9on_%2829%29_Cath%C3%A9drale_14.JPG","page_title":"Catedral de San Pablo Aureliano (Saint-Pol-de-Léon)","context_page_description":"La catedral de San Pablo Aureliano de Saint-Pol-de-Léon es una antigua catedral medieval francesa, sede de la antigua diócesis de Léon, fundada en el siglo VI y abolida tras el Concordato de 1801.​ La iglesia es actualmente parte de la diócesis de Quimper.\\nFue objeto de una clasificación en el título de los monumentos históricos por la lista de 1840.​ y el 6 de marzo de 1901 el papa León XIII la elevó a la condición de basílica menor.​"},{"page_url":"https://en.wikipedia.org/wiki/Piz_Sezner","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Sezner.jpg","page_title":"Piz Sezner","context_page_description":"Piz Sezner is a mountain of the Swiss Lepontine Alps, overlooking Obersaxen in the canton of Graubünden. It is located between the main Rhine valley and the Val Lumnezia.\\nIn winter, the mountain is part of a ski area. A cable car station is located west of the summit at 2,269 metres."},{"page_url":"https://de.wikipedia.org/wiki/Jochberg_(Berg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Walchensee_Ort.jpg","page_title":"Jochberg (Berg)","context_page_description":"Der Jochberg liegt mit 1565 Metern Höhe in den Bayerischen Voralpen zwischen Walchen- und Kochelsee. Er war während der Würm-Eiszeit ein Nunatak, also ein Berg, dessen Gipfel ca. 150 m aus dem Eisstrom herausragte. Der Kesselberg, der Einschnitt zwischen Herzogstand und Jochberg, war ein Alpentor; hier floss ein Nebenarm des Isargletschers, der wiederum ein Seitenarm des Inntalgletschers war, in einer Höhe von ca. 1400 m ü. NN hindurch. Die Nordseite des Jochberges ist geprägt von senkrecht stehenden Hauptdolomitplatten aus der Oberen Trias. Die Südseite besticht vor allem durch steile Grashänge.\\nSeinen Namen hat der Jochberg von dem Ort Altjoch am Kochelsee. Die dort ansässigen Jocher besaßen am Jochberg Weiderechte und durften dort Holz schlagen. Sie errichteten auch die Jocheralm.\\nWegen seiner Aussicht auf die Umgebung ist er ein beliebter Ausflugsgipfel und gilt als leichte und auch für Familien geeignete Bergwanderung. Der Aufstieg erfolgt vom Kesselberg oberhalb Urfeld, alternativ etwas länger von Jachenau, Sachenbach am Ostufer des Walchensee oder ab Kochel. Unterhalb des Gipfels liegt auf 1382 m ü. NN die nur im Sommer bewirtschaftete Jocheralm."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%96%D1%8F_%D0%A1%D0%B0%D0%BA%D1%81%D0%B5%D0%BD-%D0%90%D0%BB%D1%8C%D1%82%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B7%D1%8C%D0%BA%D0%B0_(1888%E2%80%941947)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/FriedrichHibuAltenburg.jpg","page_title":"Марія Саксен-Альтенбурзька (1888—1947)","context_page_description":"Марія Саксен-Альтенбурзька, — принцеса Саксен-Альтенбурзька, герцогиня Саксонська, донька принца Саксен-Альтенбурзького Альберта та прусської принцеси Марії, дружина принца Ройсс цу Кьостриць Генріха XXXV."},{"page_url":"https://ro.wikipedia.org/wiki/Plesiosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Plesiosaurus_Scale.svg","page_title":"Plesiosaurus","context_page_description":"Plesiosaurus este un gen extinct de mari reptile marine sauropterygian, care a trăit în prima parte a Jurasicului și este cunoscut după scheletele aproape complete descoperite în Anglia. Se distinge prin capul mic, gâtul lung și subțire, corpul larg asemănător cu țestoasele, coada scurtă și două perechi de aripioare mari, alungite. El dă numele ordinului Plesiosauria, din care este un membru primitiv și tipic. Conține o singură specie, specia tip fiind Plesiosaurus dolichodeirus. Alte specii odată atribuite acestui gen, inclusiv P. brachypterygius, P. guilielmiiperatoris și P. tournemirensis au fost reasignate unor genuri noi, cum ar fi: Hydrorion, Seeleyosaurus și Occitanosaurus."},{"page_url":"https://fr.wikipedia.org/wiki/Termez","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Termez%2C_stallholders.JPG","page_title":"Termez","context_page_description":"Termez est une ville historique de la province de Sourkhan-Daria, en Ouzbékistan. Ville la plus méridionale du pays, elle est située à 487 km au sud-ouest de Tachkent, à la frontière de l'Afghanistan. Sa population s'élevait à 140 000 habitants en 2005."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BF%D5%B8%D6%80%D5%B8%D5%AC_%D5%AB_%D5%87%D5%B8%D6%82%D5%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%8C_%D0%B8_%D1%88%D1%83%D1%82_%D0%A0%D0%BE%D0%BA_%D0%BD%D0%B0%D0%B4_%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B9_2011.JPG","page_title":"Կորոլ ի Շուտ","context_page_description":"«Կորոլ ի Շուտ», ռուսական փանկ-ռոք խումբ է։ Հայտնի է պանկ-ռոքի համար անսովոր կատարմամբ, որ երգերը հիմնականում իրենցից ներկայացնում են միստիկական կամ պատմական հիմքերով կարճ սարսափ-պատմվածքներ։ Տեքստերում հիմնականում խոսվում է միստիկական թեմատիկայի շուրջ, մասամբ նաև սլավոնական դիցաբանության մասին։ Երգերի հերոսներն են հանդիսանում չար ծաղրածուներ, ծովահեններ, արնախումներ, տրոլլներ, զոմբիներ և այլ հեքիաթային և դիցաբանական էակներ։ Երգերի հեղինակներն են Անդրեյ Կնյազևը և Միխայիլ Գորշենյովը: Բեմական ոճում օգտագործվում է երգերի թեմատիկային բնորոշ վախեցնող դիմահարդարում և հագուստ։"},{"page_url":"https://bg.wikipedia.org/wiki/Junkers_Ju_52/3m","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Ju52_Motor.JPG","page_title":"Junkers Ju 52/3m","context_page_description":"Юнкерс Ju 52/3m е немски транспортен самолет, използван за превоз на пътници в гражданската авиация и като военно-транспортен самолет. Ju 52 първоначално е разработен като едномоторен самолет през 1930 година. Броят на двигателите е увеличен до три, в резултат на проведените изпитания, с което значително са подобрени летателните характеристики на тази добра конструкция, а в наименованието ѝ е добавено 3m. По въздушните линии на Deutsche Luft Hansa AG лети от май 1932 година. Превозва 15 – 17 пътника. По лиценз този самолет е произвеждан във Франция по време на Втората световна война с наименованието AAC.1 Toucan до 1947 г. и Испания CASA C-352, където производството е прекратено през 1952 година. До 80-те години на ХХ век тези самолети се експлоатират като граждански, а отделни екземпляри летят и до днес."},{"page_url":"https://bg.wikipedia.org/wiki/Pachycephala_pectoralis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Golden_Whistler.jpg","page_title":"Pachycephala pectoralis","context_page_description":"Pachycephala pectoralis е вид птица от семейство Pachycephalidae."},{"page_url":"https://id.wikipedia.org/wiki/His_Girl_Friday","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/His_Girl_Friday_%281939_poster%29.jpg","page_title":"His Girl Friday","context_page_description":"His Girl Friday adalah sebuah film komedi screwball Amerika tahun 1940 garapan Howard Hawks, dari sebuah adaptasi buatan Charles Lederer, Ben Hecht dan Charles MacArthur dari drama The Front Page karya Hecht dan MacArthur. Ini adalah kedua kalinya drama tersebut diadaptasi untuk layar lebar, yang pertama adalah film tahun 1931 yang juga berjudul The Front Page. Perubahan besar dalam versi ini, yang diperkenalkan oleh Hawks, adalah bahwa peran Hildy Johnson adalah seorang wanita.\\nFilm tersebut dibintangi oleh Cary Grant sebagai Walter Burns dan Rosalind Russell sebagai Hildy Johnson dan menampilkan Ralph Bellamy as Bruce Baldwin.\\nFilm tersebut meraih peringkat #19 di 100 Years...100 Laughs buatan American Film Institute dan terpilih untuk penyajian dalam Pendaftaran Film Nasional Amerika Serikat. Karena kegagalan pembaharuan pendaftaran hak cipta, film tersebut masuk domain publik di Amerika Serikat pada 1968, namun masih berhak cipta di Prancis. Drama tahun 1928 yang mendasarinya masih berada di bawah hak cipta di Amerika Serikat sampai tahun 2024."},{"page_url":"https://en.wikipedia.org/wiki/Integrated_injection_logic","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/IIL_circuit.png","page_title":"Integrated injection logic","context_page_description":"Integrated injection logic is a class of digital circuits built with multiple collector bipolar junction transistors. When introduced it had speed comparable to TTL yet was almost as low power as CMOS, making it ideal for use in VLSI integrated circuits. The gates can be made smaller with this logic family than with CMOS because complementary transistors are not needed. Although the logic voltage levels are very close, I2L has high noise immunity because it operates by current instead of voltage. I2L was developed in 1971 by Siegfried K. Wiedmann and Horst H. Berger who originally called it merged-transistor logic.\\nA disadvantage of this logic family is that the gates draw power when not switching unlike with CMOS."},{"page_url":"https://en.wikipedia.org/wiki/Hexham","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Stmaryschurchhexham_peter_brooks.jpg","page_title":"Hexham","context_page_description":"Hexham is a market town and civil parish in south west of the Northumberland, England, south bank of the River Tyne which forms by the confluence of two rivers: the North Tyne and the South Tyne. These two rivers converge at Warden Rock near Hexham at a place dubbed 'The Meeting of the Waters'. Hexham area has part of the Hadrian's wall. Hexham was the administrative centre for the Tynedale district from 1974 to 2009. In 2011, it had a population of 11,829.\\nSmaller towns and villages around Hexham include Corbridge, Riding Mill, Stocksfield and Wylam to the east, Acomb and Bellingham to the north, Allendale to the south and Haydon Bridge, Bardon Mill and Haltwhistle to the west. Newcastle upon Tyne is about 25 miles to the east and Carlisle is 37 miles to the west."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%B3%D0%B0%D1%80%D0%B8%D1%82%D0%B0_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Margit_of_Prussia.jpg","page_title":"Маргарита Прусская","context_page_description":"Маргари́та Пру́сская, или Маргари́та Беатри́са Феодо́ра Пру́сская — немецкая принцесса из дома Гогенцоллернов, принцесса Прусская, дочь Фридриха III, короля Пруссии и императора Германии. Супруга ландграфа Гессен-Касселя Фридриха Карла, титулярная королева Финляндии и Карелии."},{"page_url":"https://de.wikipedia.org/wiki/Vorstadtweiber/Episodenliste","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Vorstadtweiber_Logo_ORF.jpg","page_title":"Vorstadtweiber/Episodenliste","context_page_description":"Diese Episodenliste enthält alle Episoden der österreichischen Dramedyserie Vorstadtweiber, sortiert nach der deutschsprachigen Erstausstrahlung. Die Fernsehserie umfasst derzeit 4 Staffeln mit 40 Episoden."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%A7%D9%86_%D8%A8%D8%B1%D8%A7%D9%88%D9%86_%D8%A8%D8%A7%D8%B1%D9%88%D9%86_%D8%A8%D8%B1%D8%A7%D9%88%D9%86_%D9%85%D8%AF%DB%8C%D9%86%DA%AF%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Lord_John_Browne_at_the_L1_Energy_launch_New_York_%28cropped%29.jpg","page_title":"جان براون بارون براون مدینگلی","context_page_description":"جان براون بارون براون مدینگلی یک سیاست‌مدار اهل بریتانیا است.\\nوی همچنین برنده جوایزی همچون مدرک افتخاری شده است."},{"page_url":"https://id.wikipedia.org/wiki/Nepenthes_albomarginata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Nepenthes_adnata1.jpg","page_title":"Nepenthes albomarginata","context_page_description":"Nepenthes albomarginata adalah tumbuhan kantong semar yang berasal dari Kalimantan, Semenanjung Malaysia, dan Sumatra.\\nPenunjuk jenis albomarginata, dibentuk dari kata Latin albus dan marginatus, mengacu pada pita putih trikoma yang merupakan karakteristik dari spesies ini."},{"page_url":"https://zh.wikipedia.org/zh-my/MG3%E9%80%9A%E7%94%A8%E6%A9%9F%E6%A7%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/MG74_auf_Dreibein.jpg","page_title":"MG3通用機槍","context_page_description":"MG3是德国莱茵金属所生产的弹链供弹通用机枪，以二战德国的7.92×57毫米MG42通用机枪改为北约7.62×51毫米口径而成。"},{"page_url":"https://eo.wikipedia.org/wiki/Rothsohlberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/2014_Pf%C3%A4lzerwald_054_Rotsohlberg.JPG","page_title":"Rothsohlberg","context_page_description":"La Rotsohlberg, ankaŭ skribata Rothsohlberg, estas 607,1 m alta monto en la Meza Palatinata Arbaro. Ĝi situas sur la teritorio de la komunumo Maikammer en la rejnlando-palatinata distrikto Südliche Weinstraße. La monto apartenas al la montoj en la Palatinata Arbaro, kies alteco superas 600 m."},{"page_url":"https://en.wikipedia.org/wiki/%C3%86r%C3%B8sk%C3%B8bing","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Priors_Hus%2C_%C3%86r%C3%B8sk%C3%B8bing_2.jpg","page_title":"Ærøskøbing","context_page_description":"Ærøskøbing is a town in central Denmark, located in Ærø Municipality on the island of Ærø. The suffix -købing means a trade town in the languages that derive from Old Norse.\\nÆrøskøbing's houses and streets are delicately restored to retain the character of the olden days. Most of them are one story tall, and the oldest ones date back to 1645.\\nIn the old part of the town are many fine examples of the work of skilled bricklayers, carpenters, and blacksmiths. Behind the idyllic façade of the town is a live and active town that has solved successive generations' housing needs for centuries.\\nÆrøskøbing was awarded the Europa Nostra prize in 2002. The prize is awarded by the EU as a special appreciation of looking after cultural heritage."},{"page_url":"https://tr.wikipedia.org/wiki/Columbus,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/OOchurch.jpg","page_title":"Columbus, Ohio","context_page_description":"Columbus, ABD'nin en büyük 15. şehri ve Ohio eyâletinin en büyük şehri ve başkentidir. Cincinnatı ve Cleveland bölgelerinden sonra Ohio Eyaleti'nin en büyük 3. kentsel bölgesidir. Amerika'nın 15. Amerikan Orta-Batısı'nın 3. en büyük şehridir. Ünlü kâşif Kristof Kolomb'un adıyla 1812'de Scioto ve Olentangy Nehirleri'nin arasına kurulan şehir 1816'da başkent olmuştur. Şehrin ekonomisi eğitim, hükûmet işleri, sigortacılık, bankacılık, moda, savunma, havacılık, yiyecek, giyecek, taşıma, çelik, enerji, tıbbi araştırma, sağlık hizmetleri, turizm, perakendecilik ve teknoloji gibi pek çok farklı konuya dayanır. Modern Columbus teknolojik anlamda gelişmiş bir şehir olarak varlığını sürdürmektedir. Dünyanın en büyük özel ar-ge kuruluşu, the Battelle Memorial Institute; Chemical Abstracts Service, dünyanın en büyük kimyasal bilgi takas odası; dünyanın en büyük jet filosunun kısmı mülkiyet sahibi NetJets, ve ABD'nin en büyük kampüsüne sahip üniversitesi Ohio State Üniversitesi bu şehirdedir.\\n2009 yılında Business Week dergisi Columbus'u bir aile kurmak için en elverişli şehir seçmiştir."},{"page_url":"https://es.wikipedia.org/wiki/Chaetostoma_marginatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Chaetostoma_marginatum.jpg","page_title":"Chaetostoma marginatum","context_page_description":"Chaetostoma marcapatae es una especie de peces de la familia Loricariidae en el orden de los Siluriformes."},{"page_url":"https://en.wikipedia.org/wiki/Suncore_Photovoltaics","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Suncorelogo.png","page_title":"Suncore Photovoltaics","context_page_description":"Suncore Photovoltaic Technology Company Limited is a solar energy company that specializes in concentrator photovoltaics, an emerging photovoltaic technology. The company manufactures, develops, and finances CPV systems for ground mounted applications. Its products include CPV solar power systems, receivers, trackers and turnkey service."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D9%86%D8%AA%D9%8A_%D9%87%D8%A7%D8%B1%D9%8A%D8%B3%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Monte_Harrison.jpg","page_title":"مونتي هاريسون","context_page_description":"مونتي هاريسون ‏ هو لاعب كرة قدم أمريكية أمريكي، ولد في 10 أغسطس 1995 في ليز ساميت في الولايات المتحدة."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%B0%D0%B4_%D0%91%D0%BE%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Bad_Boll_in_GP.svg","page_title":"Бад Бол","context_page_description":"Бад Бол општина је у њемачкој савезној држави Баден-Виртемберг. Једно је од 38 општинских средишта округа Гепинген. Према процјени из 2010. у општини је живјело 5.198 становника. Посједује регионалну шифру 8117012."},{"page_url":"https://sv.wikipedia.org/wiki/B%C3%A0_Ch%C3%BAa_Kho","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/TamquandenBaChuaKho.jpg","page_title":"Bà Chúa Kho","context_page_description":"Bà Chúa Kho är en vietnamesisk gudinna. Hon tillhör den ursprungliga vietnamesiska folkreligionen thanismen snarare än den buddhism som senare kom till Vietnam. Hennes huvudtempel ligger i Bắc Ninh."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Linn","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Burg_linn.jpg","page_title":"Burg Linn","context_page_description":"Die Burg Linn ist eine Wasserburg im nordrhein-westfälischen Krefeld, Stadtteil Linn. Sie liegt rund fünf Kilometer östlich der Innenstadt."},{"page_url":"https://de.wikipedia.org/wiki/Benedict_Friedlaender","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Benedict_Friedlaender.jpg","page_title":"Benedict Friedlaender","context_page_description":"Benedict Friedlaender war ein deutscher Zoologe und Sexualwissenschaftler."},{"page_url":"https://fr.wikipedia.org/wiki/Arm%C3%A9e_bavaroise","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Die_Gartenlaube_%281870%29_b_789.jpg","page_title":"Armée bavaroise","context_page_description":"L’armée bavaroise était l’armée du duché, puis du royaume de Bavière. Elle a été intégrée à l’armée allemande après 1870. Elle a gardé des noms d’unité propres jusqu’à la Première Guerre mondiale."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%9A%94%EC%BD%94%ED%95%98%EB%A7%88%EC%8B%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/YokohamaBaysideMarina01.jpg","page_title":"요코하마시","context_page_description":"요코하마 시는 일본 가나가와현 동부에 있는 현청 소재지이다.\\n에도 시대 말기부터 일본을 대표하는 항만 도시로서 발전해 왔다. 교외 지역은 도쿄 도시권의 위성 도시로서의 성격도 갖고 있으며, 도쿄도 다음으로 간토지방에서 두 번째로 인구가 많다. 1956년에 일본에서 처음으로 정령지정도시로 지정되었다. 대한민국 부산광역시보다 인구가 조금 많다."},{"page_url":"https://fi.wikipedia.org/wiki/Dinosaurukset","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Allosaurus_Juvenile_Reconstruction.jpg","page_title":"Dinosaurukset","context_page_description":"Dinosaurukset eli hirmuliskot olivat mesotsooisella maailmankaudella elänyt hyvin menestyksekäs eläinryhmä. Ensimmäiset dinosaurukset kehittyivät triaskaudella noin 230 miljoonaa vuotta sitten, mutta niiden valtakausi alkoi vasta triaskauden joukkotuhon jälkeen, ja ne hallitsivat maapalloa jurakauden ja liitukauden ajan. Dinosaurukset kuolivat äkillisesti sukupuuttoon liitukauden joukkosukupuutossa noin 65 miljoonaa vuotta sitten. Joukkotuhon syynä on pidetty maahan iskeytynyttä asteroidia sekä tulivuorenpurkauksia.\\nDinosaurukset olivat tasalämpöisiä maaeläimiä. Jotkin niistä olivat kasvinsyöjiä, jotkin lihansyöjiä ja jotkin kaikkiruokaisia. Dinosaurusten koko vaihteli suuresti: pienimmät olivat alle 200-grammaisia, ja suurimpia on 80–100 tonnin painoiseksi arvioitu Argentinosaurus, joka olisi siten kaikkien aikojen suurin maaeläin.\\nDinosaurukset jaetaan kahteen lahkoon niiden lantion rakenteen perusteella: liskonlantioisiin ja linnunlantioisiin. Ne puolestaan jaetaan moniin sivuryhmiin. Lajeja on löytynyt yli tuhat, ja lisää löydetään koko ajan.\\nLinnut ovat polveutuneet pienistä liskonlantioisista, höyhenpeitteisistä Archaeopteryxin kaltaisista teropodeista."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%9B%A7%E9%9B%B7%E4%BA%9E%E6%A8%93%E9%BE%8D%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Lourinhanosaurus_antunesi_baby.jpg","page_title":"盧雷亞樓龍屬","context_page_description":"盧雷亞樓龍屬是獸腳亞目恐龍的一屬，是種生存於侏羅紀晚期的肉食性恐龍。化石是在1982年發現於葡萄牙的洛里尼揚附近，並在1998年由葡萄牙古生物學家奧克塔維奧·馬特烏斯所敘述、命名。\\n模式種是安氏盧雷亞樓龍，也是目前的唯一種。屬名是以化石發現地層的勞爾哈組為名，種名是為紀念葡萄牙古生物學家馬吉爾·泰雷斯·安頓涅斯。"},{"page_url":"https://en.wikipedia.org/wiki/African_Honey_Bee_(organization)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Transferring_catch_swarms_in_the_Sappi_plantations.jpg","page_title":"African Honey Bee (organization)","context_page_description":"African Honey Bee is a social-franchise beekeeping micro-business incubator established in 2007. Its purpose is to alleviate poverty through sustainable beekeeping, by enabling rural families to benefit from the unpolluted prime honey producing vegetation around them."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Douglas_County,_Washington","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Columbia_River_Bridge_at_Bridgeport.jpg","page_title":"National Register of Historic Places listings in Douglas County, Washington","context_page_description":"This list presents the full set of buildings, structures, objects, sites, or districts designated on the National Register of Historic Places in Douglas County, Washington, and offers brief descriptive information about each of them. The National Register recognizes places of national, state, or local historic significance across the United States. Out of over 90,000 National Register sites nationwide, Washington is home to approximately 1,500, and 14 of those are found partially or wholly in Douglas County.\\nThis National Park Service list is complete through NPS recent listings posted April 12, 2019."},{"page_url":"https://de.wikipedia.org/wiki/Chil_Brook","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Wharf_Stream_-_geograph.org.uk_-_1637737.jpg","page_title":"Chil Brook","context_page_description":"Der Chil Brook ist ein Zufluss der Themse in Oxfordshire. Er entsteht nordwestlich von Eynsham und verläuft zunächst im Westen, dann im Süden des Ortes. Nach dem Unterqueren der B4044 road, wo ein unbenannter Zufluss in ihn mündet, wechselt er seinen Namen zum Wharf Stream. Unter diesem Namen mündet er östlich der Swinford Toll Bridge in die Themse."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D0%BF%D0%BE%D1%81%D1%82%D0%BD%D1%8B%D0%B5_%D1%81%D1%82%D0%B5%D0%BD%D1%8B_%D0%91%D0%B0%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Qo%C5%9Fa_qala_qap%C4%B1lar%C4%B1.JPG","page_title":"Крепостные стены Баку","context_page_description":"Крепостные стены — крепостные стены и башни, окружающие средневековый Старый город Баку — Ичери-шехер. Город Баку, как свидетельствуют иллюстрации путешественников и фотографии конца XIX века, был некогда окружён двумя рядами стен. Из них до наших дней сохранилась лишь одна высокая каменная стена с несколькими воротами. Эти ворота во времена шаха Аббаса I и позднее неоднократно реставрировались.\\nКрепостная стена города снабжена башнями, бойницами, банкетами и машикули, и служила надёжной защитой города. Протяжённость крепостных стен сегодня составляет 500 м, хотя в Средние века она составляла 1500 м. Ширина стен — 3,5 м, высота же — 8—10 м."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Crasna_din_Vale","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/RO_GJ_Crasna_Vale_2011.39.jpg","page_title":"Biserica de lemn din Crasna din Vale","context_page_description":"Biserica de lemn din Crasna din Vale, comuna Crasna, județul Gorj, a fost construită în secolul XVIII. Are hramul „Adormirea Maicii Domnului”. Biserica se află pe noua listă a monumentelor istorice sub codul LMI: GJ-II-m-B-09291."},{"page_url":"https://pt.wikipedia.org/wiki/Monumentos_Megal%C3%ADticos_de_Alcalar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Megalwal111.png","page_title":"Monumentos Megalíticos de Alcalar","context_page_description":"Os Monumentos Megalíticos de Alcalar são um grupo de túmulos que compõem uma necrópole do período Calcolítico, localizado na freguesia da Mexilhoeira Grande, no concelho de Portimão, em Portugal. A família de monumentos inclui ainda um forno de cal.\\nEsta necrópole compõe-se por um conjunto de sepulturas espalhadas por uma área de dez hectares. A mais impressionante dessas sepulturas é a grande mamoa conhecida como monumento número sete, que se situa no centro da atual área museológica, formada por um tolo central cuja cripta é acessível por um estreito corredor voltado para nascente.\\nOs vestígios arqueológicos de Alcalar dão conta da existência de uma população organizada cujo modo de subsistência básico era a agricultura, com uma apreciável capacidade de exploração dos recursos da terra. Localiza-se numa área de terras aráveis, razoavelmente planas, e onde terminava o troço outrora navegável da Ribeira da Torre.\\nNo museu de Lagos podem ser observados machados de pedra e outros utensílios líticos desta região. Ao longo da faixa costeira do Barlavento algarvio têm sido identificados vários vestígios megalíticos, com destaque para os de Vila do Bispo."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%BA%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Hyokeikan_of_Tokyo_National_Museum_2010.jpg","page_title":"Токійський національний музей","context_page_description":"Токійський національний музей — державний музей в Японії. Найбільший і найстаріший музей мистецтв країни. Зберігає та експонує матеріали, присвячені археології, історії, мистецтву, ремеслам Японії та азійських країн. Розташований в парку Уено району Тайто, Токіо. Станом на березень 2009 року нараховував 110 тисяч експонатів. З них 87 мали статус національних скарбів, а 622 — статус цінних культурних надбань Японії."},{"page_url":"https://es.wikipedia.org/wiki/El_Cuadr%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Tabla_climatica_El_Cuadron.jpg","page_title":"El Cuadrón","context_page_description":"El Cuadrón es una pedanía del municipio español de Garganta de los Montes, situado en el valle del Lozoya, en la zona noroeste de la Comunidad de Madrid. Dista 72 km de Madrid. Cuenta con una población unos 30 habitantes, una superficie de 10,15 km² y se encuentra a una altura de 1.125 metros sobre el nivel del mar."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%AC%E3%83%83%E3%82%B0%E3%83%BB%E3%82%AC%E3%83%AB%E3%82%B7%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Ggarcia752017.jpg","page_title":"グレッグ・ガルシア","context_page_description":"グレッグ・ジョゼフ・ガルシアは、アメリカ合衆国カリフォルニア州サンディエゴ郡エルカホン出身のプロ野球選手。右投左打。MLBのサンディエゴ・パドレス所属。"},{"page_url":"https://de.wikipedia.org/wiki/Milit%C3%A4rflugplatz_Rom-Centocelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Rom_flughafen_01.jpg","page_title":"Militärflugplatz Rom-Centocelle","context_page_description":"Der Militärflugplatz Rom-Centocelle liegt an der Via Latina im Südosten der italienischen Hauptstadt Rom. Es handelt sich um den ältesten Flugplatz Italiens. Heute dient er als Standort verschiedener militärischer Kommandobehörden und als kleiner Heliport."},{"page_url":"https://it.wikipedia.org/wiki/Mercedes-Benz_Classe_GLE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Mercedes-AMG_C167_at_IAA_2019_IMG_0656.jpg","page_title":"Mercedes-Benz Classe GLE","context_page_description":"La Mercedes-Benz Classe GLE identifica quella fascia di gamma della casa automobilistica tedesca Mercedes-Benz che rappresenta i SUV di fascia alta. Tale fascia di gamma è stata introdotta a partire dal 2015 in sostituzione della precedente Mercedes-Benz Classe M."},{"page_url":"https://en.wikipedia.org/wiki/Saki_Naka_metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Sakinaka_Metro_Station.jpg","page_title":"Saki Naka metro station","context_page_description":"Saki Naka is a metro station on Line 1 of the Mumbai Metro serving the Saki Naka neighbourhood of Andheri in Mumbai, India. It was opened to the public on 8 June 2014."},{"page_url":"https://lv.wikipedia.org/wiki/Kosovas_starptautisk%C4%81_atz%C4%AB%C5%A1ana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Kosovo_relations.svg","page_title":"Kosovas starptautiskā atzīšana","context_page_description":"Kosovas starptautiskā atzīšana notiek kopš 2008. gada 17. februāra, kas ieguva neatkarību no Serbijas. Kosovas neatkarību ir atzinušas 110 no 193 Apvienoto Nāciju Organizācijas dalībvalstīm."},{"page_url":"https://zh.m.wikipedia.org/zh-my/%E5%9C%8B%E7%AB%8B%E4%B8%AD%E5%A4%AE%E5%8D%9A%E7%89%A9%E5%9C%96%E6%9B%B8%E9%99%A2%E9%A4%A8%E8%81%AF%E5%90%88%E7%AE%A1%E7%90%86%E8%99%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/The_appearance_of_the_exhibition_gallery_in_Beigou.jpg","page_title":"國立中央博物圖書院館聯合管理處","context_page_description":"国立中央博物图书院馆联合管理处，简称联管处，为国立故宫博物院等机构文物在北沟时期的管理机关。"},{"page_url":"https://ceb.wikipedia.org/wiki/Tracheophyta_sa_Bosniya_ug_Ersogobina","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Prestvannet-parkvei.jpg","page_title":"Tracheophyta sa Bosniya ug Ersogobina","context_page_description":"Ang lista sa mga tanum nga sa Tracheophyta sa Bosniya ug Ersogobina, kauban ang gipaila nga mga species ug endemic species sa Bosnia ug Herzegovina, usa ka dili kompleto nga pagtan-aw sa mga vascular mosses, ferns ug angiospermous species species nga gikutlo sa magamit nga literatura sa Bosnian Croatian, Serbian ug Serbo-Croatian. Wala giapil sa kultura ug usahay gipaila.\\nMubo nga sulat\\nTungod sa sublisubli nga mga pagbag-o sa rolohikal nga pag-uuri ug /o ranggo sa taxonomic ug mga ngalan sa taxa nga gilakip, ang pipila niini nagpakita sa kaduha sa gilakip nga lista. Tinuod kini labi sa mga ngalan nga binomial nga ngalan nga gigamit gihapon karon."},{"page_url":"https://cs.wikipedia.org/wiki/M%C3%A1rta_Sebesty%C3%A9nov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/M%C3%A1rta_Sebesty%C3%A9n.JPG","page_title":"Márta Sebestyénová","context_page_description":"Márta Sebestyénová je maďarská folková zpěvačka.\\nJejí matka Ilona Farkasová byla hudební skladatelka, žačka Zoltána Kodályho, otec József Sebestyén byl profesor matematiky. Nedokončila studium výtvarného umění a v roce 1973 stála u zrodu skupiny Muzsikás, zaměřené na interpretaci lidových písní z oblastí Somogy a Sedmihradsko. V jejím repertoáru je také romský, židovský a balkánský folklór.\\nSpolupracovala s francouzskou skupinou Deep Forest, Karlem Wallingerem a Davy Spillanem, její nahrávky jsou použity v hollywoodských filmech Anglický pacient a Americká rapsodie. Je zastoupena v antologii The Rough Guide to World Music.\\nByla jmenována mírovou velvyslankyní UNESCO. V roce 1999 získala Kossuthovu cenu."},{"page_url":"https://es.wikipedia.org/wiki/P%C3%A1ramo_de_Boedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Bandera_de_P%C3%A1ramo_Boedo.svg","page_title":"Páramo de Boedo","context_page_description":"Páramo de Boedo es una localidad, un municipio y también una pedanía españolas de la provincia de Palencia."},{"page_url":"https://en.wikipedia.org/wiki/Sheikh_Ali_Hisam-ad-Din_Naqshbandi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Hz._%C5%9Eah.jpg","page_title":"Sheikh Ali Hisam-ad-Din Naqshbandi","context_page_description":"Shah Muhammad Ali Hisâm-ad-Dîn Naqshbandî also known as Hâzrat-i Shâh and Bâbâ Ali was a 19th-century sufi, awliya' and Islamic scholar born in Tawella village which was part of Ottoman Empire lands at that time. He is sayyid and sherif also revindicated as an ancestor of Sayyid Battal Gazi. Muhammad Ali Hisâm-ad-Dîn is the grandson of Uthman Sirâj-ud-Dîn Naqshbandi of Tawella who is the first caliph of Mawlânâ Khâlid al-Baghdadî in Sulaymaniyah."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%B0%D0%BC%D1%8B%D1%85_%D0%B2%D1%8B%D1%81%D0%BE%D0%BA%D0%B8%D1%85_%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B9_%D0%A8%D0%B2%D0%B5%D0%B9%D1%86%D0%B0%D1%80%D0%B8%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Blosenbergturm.jpg","page_title":"Список самых высоких зданий Швейцарии","context_page_description":"Список самых высоких зданий Швейцарии — перечень самых высоких зданий страны."},{"page_url":"https://fr.wikipedia.org/wiki/Meteor_(brasserie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Meteor_1.JPG","page_title":"Meteor (brasserie)","context_page_description":"Meteor est une brasserie indépendante alsacienne fondée en 1640. Elle est installée à Hochfelden dans le département du Bas-Rhin."},{"page_url":"https://fi.wikipedia.org/wiki/Gong_Min-ji","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Minzy_-_2NE1_2011.jpg","page_title":"Gong Min-ji","context_page_description":"Gong Min-ji, paremmin tunnettu artistinimellä Minzy, on eteläkorealainen pop-laulaja ja tanssija. Minzy on syntynyt Gwangjussa, Etelä-Koreassa, 18. tammikuuta 1994, mutta muutti pian Souliin.\\nVuonna 2009 hän debytoi YG Entertainment-yhtiön tyttöbändissä 2NE1 yhdessä jäsenten CL, Dara ja Bom kanssa. Minzyn duettokappale CL:n kanssa, \\"Please Don't Go\\", ylsi sijalle kuusi Monthly Gaon Chartissa marraskuussa 2009.\\nHuhtikuussa 2016 YG Entertainment ilmoitti, että Minzy on päättänyt olla uusimatta levytyssopimustaan ja ettei jatka 2NE1:n jäsenenä.\\n2NE1:n uran ohella Minzy on perustanut oman tanssikoulunsa, Millenium dance studion. Huhtikuussa 2017 Minzy julkaisi sooloalbuminsa nimeltään: Minzy Work 01 \\"Uno\\"."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D8%A7%D9%88_%D9%BE%D9%8A%D9%86%D9%87%D9%8A%D8%B1%D9%88_%D8%AA%D8%B4%D8%A7%D8%AC%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Joao_Pinheiro_Chagas.jpg","page_title":"چواو پينهيرو تشاجاس","context_page_description":"چواو پينهيرو تشاجاس كان صحفى من البرتغال و البرازيل."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AC%D9%88%D8%B1%DA%88%D9%86_%D9%B9%D8%A7%D8%A4%D9%86_%D8%B4%D9%BE%D8%8C_%D9%84%D8%A7%D8%A6%DA%A9%D9%88%D9%85%D9%86%DA%AF_%DA%A9%D8%A7%D8%A4%D9%86%D9%B9%DB%8C%D8%8C_%D9%BE%D9%86%D8%B3%D9%84%D9%88%D8%A7%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Scenery_of_Jordan_Township%2C_Lycoming_County%2C_Pennsylvania.JPG","page_title":"جورڈن ٹاؤن شپ، لائکومنگ کاؤنٹی، پنسلوانیا","context_page_description":"جورڈن ٹاؤن شپ، لائکومنگ کاؤنٹی، پنسلوانیا ریاستہائے متحدہ امریکا کا ایک ٹاؤن شپ جو پنسلوانیا میں واقع ہے۔"},{"page_url":"https://sl.wikipedia.org/wiki/Ob%C4%8Dina_%C5%A0marje%C5%A1ke_Toplice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Cerkev_sv._marjete%2C_%C5%A0marjeta.jpg","page_title":"Občina Šmarješke Toplice","context_page_description":"Občina Šmarješke Toplice je ena mlajših in manjših občin v Republiki Sloveniji. Svojo samostojno pot je pričela 1. januarja 2007 z odcepitvijo od Mestne občine Novo mesto. V novonastali občini sta se združili dve krajevni skupnosti - Krajevna skupnost Bela Cerkev in Krajevna skupnost Šmarjeta.\\nObmočje Občine Šmarješke Toplice leži v jugovzhodnem delu Slovenije, njegova površina obsega 34,2 km² in meji na občine Mokronog - Trebelno, Škocjan, Šentjernej in omenjeno Mestno občino Novo mesto. Po zadnjih statističnih podatkih za leto 2016 občina šteje 3.293 prebivalcev."},{"page_url":"https://fr.wikipedia.org/wiki/H.P._Baxxter","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/H._P._Baxxter_beim_Echo_2013.jpg","page_title":"H.P. Baxxter","context_page_description":"H.P. Baxxter, de son vrai nom Hans Peter Geerdes, né le 16 mars 1964, est un guitariste et chanteur allemand et leader du groupe Scooter. Il fonde Scooter avec son ami Rick J. Jordan en 1993."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A8%D0%B0%D0%BA%D0%BA%D0%B5%D0%BD%D1%81%D0%BB%D0%B5%D0%B1%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Wappen_Schackensleben.png","page_title":"Шаккенслебен","context_page_description":"Шаккенслебен — Германия Федеративтік Республикасының Саксония-Анхальт жерінде орналасқан муниципалитет. Оре ауданының құрамына енеді.\\nМуниципалитеттің тұрақты тұрғындарының саны 715 адамды құрайды. Алып жатқан жер аумағы 11,66 км² шамасында. Мемлекет ішінде бекітілген ресми коды — 15 0 83 566. Муниципалитеттің басшысы — Рудольф Фурман."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D1%80%D0%BC%D0%BE%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D1%84%D0%B5%D0%B9%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Prozessork%C3%BChler_mit_verschmutzter_w%C3%A4rmeleitpaste_out_of_the_box_IMGP9528_smial_wp.jpg","page_title":"Термоинтерфейс","context_page_description":"Термоинтерфейс — слой теплопроводящего состава между охлаждаемой поверхностью и отводящим тепло устройством. Наиболее распространенным типом термоинтерфейса являются теплопроводящие пасты и компаунды.\\nВ быту наиболее известны термоинтерфейсы для тепловыделяющих компонентов персональных компьютеров. Также применяется в электронике для теплоотвода от компонентов силовых цепей и уменьшения градиента температур внутри блоков.\\nТермоинтерфейсы применяются в системах теплоснабжения и подогрева."},{"page_url":"https://en.wikipedia.org/wiki/Nan_Chiau_High_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Nan_Chiau_High_School_Entrance_Stone.png","page_title":"Nan Chiau High School","context_page_description":"Nan Chiau High School is a co-educational institution in Singapore affiliated to Singapore Hokkien Huay Kuan. It offers the four-year Express course for secondary education.\\nFounded in 1947, the institution operates under the Special Assistance Plan, with the mission to nurture bilingual and bi-cultural scholars who are highly knowledgeable in the Chinese language and culture. Affirmed as the North Zone Centre of Excellence for Chinese Language, the institution is known for its strong Chinese foundation in terms of teaching of the language and promulgation of the heritage and culture, which are not confined to the classrooms.\\nTo date, Nan Chiau High has nurtured three President's Scholars, and is currently one of Singapore's leading schools for Infocomm Technology. It is also one of the joint organisers of the National Secondary School Chinese Creative Writing Competition."},{"page_url":"https://en.wikipedia.org/wiki/Bolivar_Peninsula,_Texas","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/Galveston_County_BolivarPeninsula.svg","page_title":"Bolivar Peninsula, Texas","context_page_description":"Bolivar Peninsula is a census-designated place in Galveston County, Texas, United States. The population was 2,417 at the 2010 census. The communities of Port Bolivar, Crystal Beach, Caplen, Gilchrist, and High Island are located on Bolivar Peninsula."},{"page_url":"https://cs.wikipedia.org/wiki/Domenico_Morelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Domenico_Morelli_Portrait.jpg","page_title":"Domenico Morelli","context_page_description":"Domenico Morelli byl italský malíř, přední představitel neapolské malířské školy 19. století."},{"page_url":"https://pl.wikipedia.org/wiki/Saint-Gabriel-Br%C3%A9cy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Ch%C3%A2teau_de_Br%C3%A9cy%2C_logis_et_%C3%A9glise_vus_de_la_terrasse_des_fontaines.JPG","page_title":"Saint-Gabriel-Brécy","context_page_description":"Saint-Gabriel-Brécy – miejscowość i dawna gmina we Francji, w regionie Normandia, w departamencie Calvados. W 2013 roku populacja ludności wynosiła 400 mieszkańców.\\nW dniu 1 stycznia 2017 roku z połączenia trzech ówczesnych gmin – Creully, Saint-Gabriel-Brécy oraz Villiers-le-Sec – utworzono nową gminę Creully-sur-Seulles. Siedzibą gminy została miejscowość Creully."},{"page_url":"https://it.wikipedia.org/wiki/Gongyi_(contea)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Songling.jpg","page_title":"Gongyi (contea)","context_page_description":"Gongyi è una città-contea della Cina, situata nella provincia di Henan e amministrata dalla prefettura di Zhengzhou."},{"page_url":"https://en.wikipedia.org/wiki/Nassau_County,_New_York","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/HempsteadHouseSandsPoint.jpg","page_title":"Nassau County, New York","context_page_description":"Nassau County is a county in the U.S. state of New York. At the time of the 2010 census, the county's population was 1,339,532, estimated to have increased to 1,356,924 in 2019. The county seat is Mineola and the largest town is Hempstead.\\nNassau County is situated on western Long Island, bordering New York City's borough of Queens to the west, and Suffolk County to the east. It is the most densely populated and second-most populous county in New York state outside of New York City, with which it maintains extensive rail and highway connectivity, and is considered one of the central counties within the New York metropolitan area. Nassau County contains two cities, three towns, 64 incorporated villages, and more than 60 unincorporated hamlets. Nassau County has a designated police department, fire commission, and elected executive and legislative bodies.\\nA 2012 Forbes article based on the American Community Survey reported Nassau County as the most expensive county and one of the highest income counties in the United States, and the most affluent in the state of New York, with four of the nation's top ten towns by median income located in the county."},{"page_url":"https://ca.wikipedia.org/wiki/Lod%C3%ADcula","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/En_Aperta.png","page_title":"Lodícula","context_page_description":"Una lodícula és una, dues o tres petites esquames situada per sobre de la pàlea, a la base de l'ovari en una flor de gramínia que representa la corol·la, es creu que és un rudimentari periant. L'inflament de les lodícules aparten les bràctees de la flor i exposen els òrgans reproductius de la flor."},{"page_url":"https://pl.wikipedia.org/wiki/Jan_III_Sobieski","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/King_John_III_Sobieski_Sobieski_sending_Message_of_Victory_to_the_Pope%2C_after_the_Battle_of_Vienna_111.PNG","page_title":"Jan III Sobieski","context_page_description":"Jan III Sobieski herbu Janina – król Polski od 1674, hetman wielki koronny od 1668, hetman polny koronny od 1666, marszałek wielki koronny od 1665, chorąży wielki koronny od 1656, starosta jaworowski w latach 1644–1664, krasnostawski, kałuski po 1668 roku, stryjski po 1660 roku, gniewski w latach 1667–1696, barski w latach 1669–1672, międzyłęski w latach 1673–1696, osiecki w latach 1673–1696, pucki w latach 1678–1696.\\nJego dwudziestodwuletnie panowanie było okresem stabilizacji Rzeczypospolitej, po zawirowaniach powstania Chmielnickiego, wojny polsko-rosyjskiej i potopu szwedzkiego. Uchodził za wybitnego dowódcę wojskowego i był popularny wśród poddanych. Jego zwycięstwa, odniesione w wojnie z Imperium Osmańskim, umocniły jego pozycję polityczną. Najważniejsze zwycięstwo odniósł w bitwie pod Wiedniem w 1683. Po tym wydarzeniu Osmanie nazwali go „Lwem Lechistanu”, a papież Innocenty XI w 1684 uhonorował go tytułem fidei defensor. Uważany jest za jednego z najwybitniejszych polskich monarchów i wodzów."},{"page_url":"https://en.wikipedia.org/wiki/Free_City_of_Danzig","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Nazi_World_War_II_poster_Danzig_is_German.jpg","page_title":"Free City of Danzig","context_page_description":"The Free City of Danzig was a semi-autonomous city-state that existed between 1920 and 1939, consisting of the Baltic Sea port of Danzig and nearly 200 towns and villages in the surrounding areas. It was created on 15 November 1920 in accordance with the terms of Article 100 of the 1919 Treaty of Versailles after the end of World War I.\\nThe Free City included the city of Danzig and other nearby towns, villages, and settlements that were primarily inhabited by Germans. As the Treaty stated, the region was to remain separated from post-World War I Germany and from the newly independent nation of the Second Polish Republic, but it was not an independent state. The Free City was under League of Nations protection and put into a binding customs union with Poland.\\nPoland was given certain rights pertaining to communication, the railways and port facilities in the city. The Free City was created in order to give Poland access to a well-sized seaport. The Free City's population of 410,000 was 98% German, 1% Polish and 1% other."},{"page_url":"https://fr.wikipedia.org/wiki/Magnat_(surnom)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Podd%C4%99bice_-_Ko%C5%9Bci%C3%B3%C5%82_pw.%C5%9Bw._Katarzyny_Dziewicy_i_M%C4%99czennicy_%282%29.jpg","page_title":"Magnat (surnom)","context_page_description":"Magnat est le surnom de diverses personnalités puissantes dans les domaines de la finance et de l'industrie et des media. Elle correspond de nos jours à l'expression, \\"oligarque\\", qui s'attache parfois aux milliardaires de provenance russe.\\nDepuis le Moyen Âge c'était la dénomination, donnée au premier rang des membres de la haute noblesse dans plusieurs pays d'Europe. L'expression s'associe surtout avec la szlachta polonaise, et les familles puissantes en Lituanie en Hongrie, Moldavie, ainsi qu'en Irlande, Écosse, Angleterre, France et en Lombardie où elle s'adresse aux banquiers lombards. Le surnom est apparu dans le haut Moyen Âge.\\nUn magnat n'était pas seulement un grand propriétaire terrien, qui possédait des villes et des villages, et des moyens considérables dans sa trésorerie, il avait aussi une énorme influence sur l'économie et donc sur la politique du territoire. Comme a été montré dans le cas de la Pologne, un groupe de magnats, une véritable oligarchie au XVIIIᵉ siècle, fut capable de renverser le gouvernement du pays. Le surnom avec la renommée était souvent attaché au nom d'une famille et passait de génération en génération."},{"page_url":"https://sv.wikipedia.org/wiki/Sn%C3%B6strupig_kungstyrann","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Snowy-throated_Kingbird.jpg","page_title":"Snöstrupig kungstyrann","context_page_description":"Snöstrupig kungstyrann är en fågel i familjen tyranner inom ordningen tättingar. Den förekommer från sydvästligaste Colombia till västra Ecuador och nordvästra Peru. IUCN kategoriserar arten som livskraftig."},{"page_url":"https://sv.wikipedia.org/wiki/Anita_Ekberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Anitaekberg.jpg","page_title":"Anita Ekberg","context_page_description":"Kerstin Anita Marianne Ekberg, född 29 september 1931 i Malmö, död 11 januari 2015 i Rocca di Papa, Italien, var en svensk skådespelare. Hon var bosatt i Genzano di Roma söder om Rom i Italien."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8F%AC%EB%8D%A4_%EB%8C%80%ED%95%99%EA%B5%90_%EB%B2%95%ED%95%99%EB%8C%80%ED%95%99%EC%9B%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Fordham_University_School_of_Law_%2848047448923%29.jpg","page_title":"포덤 대학교 법학대학원","context_page_description":"포덤 대학교 법학대학원은 포덤 대학교내 법학전문대학원이다. 유에스 뉴스지 순위에 따르면 25위에 올랐으며 평균 LSAT 은 165점이였다. 직장인을 위해 야간 법학대학원과정을 운영하고 있다."},{"page_url":"https://sv.wikipedia.org/wiki/Garnisonssjukhuset_i_Stockholm","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Garnisonssjukhuset_Stockholm_planritning_1897.jpg","page_title":"Garnisonssjukhuset i Stockholm","context_page_description":"Garnisonssjukhuset i Stockholm även känt som Allmänna garnisonssjukhuset, var ett militärsjukhus inom svenska armén som verkade i olika former åren 1811–1969. Sjukhuset var beläget på Hantverkargatan 45 på Kungsholmen i Stockholm."},{"page_url":"https://nl.wikipedia.org/wiki/Ambulyx_obliterata","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Ambulyx_obliterata.jpg","page_title":"Ambulyx obliterata","context_page_description":"Ambulyx obliterata is een vlinder uit de familie van de pijlstaarten. De soort komt voor in Indonesië, Maleisië en Thailand."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A1%D7%A4%D7%99%D7%A0%D7%AA_%D7%90%D7%95%D7%95%D7%99%D7%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/R-38-rescue.jpg","page_title":"ספינת אוויר","context_page_description":"ספינת אוויר היא כלי הטיס הממונע הראשון, וממילא הראשון המסוגל לנווט. ספינת האוויר, כמו הכדור הפורח, מתגברת על כח הכבידה על ידי צפיפות נמוכה של הגז שבה, ביחס לצפיפות האוויר הממלא נפח זהה.\\nספינת האוויר, הייתה בשימוש מצומצם יחסית – בעיקר על ידי צבאות ובעלי אמצעים באירופה ובאמריקה, ובעיקר ממחצית המאה התשע עשרה ועד מלחמת העולם השנייה.\\nבספינת האוויר מעין שק, המחולק לעיתים למספר תאים, הממולא בגז – באמריקה עד שנות העשרים ובאירופה עד שנות השישים במימן, ולאחר מכן בהליום. כמו כן מצויים בספינה מנועים, מקום לאנשי הצוות ולעיתים גם מתחם לנוסעים, המצויים לרוב מתחת לשק, בקומה או במספר קומות."},{"page_url":"https://id.wikipedia.org/wiki/Khuda","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Khudainurdu.png","page_title":"Khuda","context_page_description":"Khuda atau Khoda adalah kata dalam bahasa Persia yang memiliki makna Dewa atau Tuhan. Awalnya istilah ini merujuk pada Ahura Mazda, Tuhan pada Zoroastrianisme. Bahasa Iran lain juga menggunakan istilah ini."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%B4%D0%BE%D0%BD,_%D0%98%D0%B3%D0%BE%D1%80%D1%8C_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Vladimir_Putin_and_Igor_Dodon_%282017-01-17%29_01.jpg","page_title":"Додон, Игорь Николаевич","context_page_description":"И́горь Никола́евич Додо́н — молдавский государственный и политический деятель. Президент Республики Молдова с 23 декабря 2016.\\nВ 2006—2009 годах возглавлял министерство экономики и торговли Молдавии, а в 2008—2009 годах занимал должность первого вице-премьер-министра. В 2011—2016 годах — председатель Партии социалистов Молдавии.\\nДепутат парламента Молдавии. Президент Федерации шахмат Молдавии с 24 сентября 2011.\\nВ 2017—2018 годах Конституционный суд Молдавии несколько раз временно отстранял Игоря Додона от должности из-за того, что Додон не соглашался подписать указы о назначении министров Правительства Молдавии и иные законы, принятые Парламентом Молдавии. Указы и законы подписывались лицом, которому временно переходили полномочия Президента Молдавии — председателем парламента Молдавии Андрианом Канду, после чего полномочия вновь возвращались Игорю Додону."},{"page_url":"https://it.wikipedia.org/wiki/Cyrano_de_Bergerac_(Rostand)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cyrano_de_Bergerac_%28statue%29.jpg","page_title":"Cyrano de Bergerac (Rostand)","context_page_description":"Cyrano de Bergerac è una celebre commedia teatrale in cinque atti pubblicata nel 1897 dal poeta drammatico francese Edmond Rostand e ispirata alla figura storica di Savinien Cyrano de Bergerac, uno dei più estrosi scrittori del seicento francese, precursore della letteratura fantascientifica.\\nIl Cyrano de Bergerac fu rappresentato per la prima volta il 28 dicembre di quello stesso 1897 al Théâtre de la Porte-Sain-Martin di Parigi, avendo come protagonista un celebre attore del tempo, Benoît-Constant Coquelin, lo stesso che glielo aveva commissionato. Rostand lo scrisse a cinque anni di distanza dalla clamorosa bocciatura, avvenuta appunto nel 1892, di un suo precedente lavoro in versi, Les Deux Pierrots, espressamente scritto per la Comédie-Française.\\nGrazie all'eccezionale trionfo di pubblico nelle 410 recite e critica che salutò questo dramma post-romantico, vera e propria summa delle potenzialità espressive nella sfera dei sentimenti e delle passioni umane, Rostand venne poi insignito della Legion d'onore ed eletto membro dell'Académie française.\\nNel 1923 andò in scena per il Broadway theatre con Walter Hampden arrivando a 232 recite."},{"page_url":"https://pl.wikipedia.org/wiki/Frankfurt-Niederrad_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Niederrad_Alter_Bahnhof_01052009.JPG","page_title":"Frankfurt-Niederrad (stacja kolejowa)","context_page_description":"Frankfurt-Niederrad – stacja kolejowa we Frankfurcie nad Menem, w kraju związkowym Hesja, w Niemczech. Znajdują się tu 2 perony."},{"page_url":"https://cy.wikipedia.org/wiki/Cloc","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Little_Ben_-_geograph.org.uk_-_1094627.jpg","page_title":"Cloc","context_page_description":"Dyfais sy'n mesur a chadw amser yw cloc.\\nDyfeisiwyd yr offer cyntaf i gadw amser 5,000 o flynyddoedd yn ôl. Dyfeisiwyd y clociau mecanyddol cyntaf, a weithiwyd trwy ganu cloch, yn y 13g. Erbyn y 16g roedd clociau mecanyddol yn defnyddio sbringiau. Heddiw ceir clociau cwarts ac atomig sy'n gallu mesur amser yn fanwl gywir."},{"page_url":"https://sh.wikipedia.org/wiki/Evolucija_%C4%8Dovjeka","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Maasai_woman_with_stretched_ears.jpg","page_title":"Evolucija čovjeka","context_page_description":"Evolucija čovjeka podrazumijeva evolutivni proces koji je tijekom vremena doveo do pojave anatomski modernog čovjeka. Čovječja je evolucija u biti dio evolucije primatâ, točnije razvoja roda Homo i pojave vrste Homo sapiens kao jedne od vrsta hominida ili velikih čovjekolikih majmuna. Izučavanje evolucije čovjeka obuhvaća niz različitih znanstvenih disciplina: paleontologiju, antropologiju, arheologiju, jezikoslovlje, embriologiju i genetiku.\\nEvolucija primatâ počinje u kasnoj kredi. Prema izvršenim genetičkim studijama, primati su se počeli odvajati od ostalih sisavaca prije 85 milijuna godina, a prvi sigurni fosili primatâ pojavljuju se u paleocenu prije 55 milijuna godina. Rod hominida ili velikih čovjekolikih majmuna odvaja se od roda Hylobatidae u razdoblju od 15-20 milijuna godina, a prije 14 milijuna godina Ponginae ili orangutani odvajaju se od roda Hominidae.\\nDvonožno je hodanje ili bipedalizam najvažnija prilagodba tribusa hominina. Smatra se da su prvi dvonožni hominini bili Sahelanthropus tchadensis ili Orrorin, dok se potpuno dvonožni Ardipithecus pojavio nešto kasnije."},{"page_url":"https://en.wikipedia.org/wiki/A_Skylit_Drive","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Askylitdrivelive.JPG","page_title":"A Skylit Drive","context_page_description":"A Skylit Drive was an American post-hardcore band from Lodi, California. The band has released one DVD, one EP and five studio albums: Wires...and the Concept of Breathing, Adelphia, Identity on Fire, Rise and, most recently, ASD. The band has toured internationally both as headliner and supporting act. In 2017, the band broke up after a dispute between Nick Miller and Michael Jagmin."},{"page_url":"https://en.wikipedia.org/wiki/Mount_Data","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Mount_Data_in_the_far_distance.jpg","page_title":"Mount Data","context_page_description":"Mount Data is a mountain located in the Cordillera Central mountain range rising to a height of 2,310 metres in the north of Luzon Island, Philippines. It is about 100 kilometres north of Baguio on the borders of the provinces of Benguet and Mountain Province along the Halsema Highway. The mountain and surrounding area has been declared a National Park since 1936. In 1940 the park was expanded to 5,513 hectares. The slopes of the mountain are covered with pine forests and mossy oak forests.\\nThe national park hosts five major rivers: the Chico, Ahin, Siffu, Abra, and Amburayan rivers. The Agno River also originates from Mount Data and flows through Benguet. The reserve is also a watershed, which serves towns in Mountain Province, Buenget, and Ifugao.\\nThe mountain is the site of the Mount Data Peace Accord of 1986 between the Government of the Philippines and the Cordillera People's Liberation Army."},{"page_url":"https://lmo.wikipedia.org/wiki/Guardia_del_Castell_de_Praga","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/2013_Praga%2C_Hradczany%2C_wartownik.JPG","page_title":"Guardia del Castell de Praga","context_page_description":"La Guardia del Castell de Praga a l'è 'n unità autonoma di forz armaa cecch sottoposta direttament a l'Offizi Militar del President de la Cechia che la gh'ha de fà la guardia d'onor al Castell de Praga, la sed de la Presidenza. Gh'è 672 soldaa e 43 impiegaa civij."},{"page_url":"https://fr.wikipedia.org/wiki/Doyen_de_la_Chambre","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Michael_Hicks_Beach%2C_Lock_%26_Whitfield_woodburytype%2C_1876-84.jpg","page_title":"Doyen de la Chambre","context_page_description":"Le doyen de la Chambre est un titre informel de la Chambre des communes du Royaume-Uni. Il est attribué au député qui siège depuis le plus longtemps et sans interruption.\\nL'actuel doyen de la Chambre est le conservateur Sir Peter Bottomley, député depuis 1975."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D1%8B%D1%81%D0%BE%D1%86%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Vysotsk_railway_station.JPG","page_title":"Высоцк","context_page_description":"Высоцк, да 1917 года Тронгзунд, у перыяд 1917—1948 гадоў Уурас, — партовы горад у Расіі, у Выбаргскім раёне Ленінградскай вобласці, на беразе Фінскага заліва. Чыгуначная станцыя Акцябрскай чыгункі."},{"page_url":"https://sw.wikipedia.org/wiki/Ukristo_nchi_kwa_nchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Temple_Saint_Sava.jpg","page_title":"Ukristo nchi kwa nchi","context_page_description":"Katika robo ya kwanza karne ya 21 Ukristo ndio dini kubwa zaidi duniani, ukikadiriwa kuwa na waumini walau bilioni 2.4 kati ya watu bilioni 7.5 duniani, ambao ni sawa na 1/3.\\nKati ya madhehebu yake, Kanisa Katoliki linaongoza kwa kuwa na waumini bilioni 1.3, likifuatwa na Uprotestanti, Waorthodoksi, Waorthodoksi wa Mashariki na wengineo.\\nNchi inayoongoza kwa idadi ya Wakristo ni Marekani, ikifuatwa na Brazil na Mexico.\\nUkristo, katika madhehebu yake mojawapo, ni dini rasmi ya nchi 15: Argentina, Bolivia, Costa Rica, Denmark, El Salvador, England, Greece, Armenia, Georgia, Ethiopia Iceland, Liechtenstein, Malta, Monaco, Norway, Vatican City."},{"page_url":"https://pl.wikipedia.org/wiki/Kostrzyn_nad_Odr%C4%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Rzeka_Warta_w_Kostrzynie.jpg","page_title":"Kostrzyn nad Odrą","context_page_description":"Kostrzyn nad Odrą – miasto w Polsce, będące jednocześnie gminą miejską, zlokalizowane w północno-zachodniej części województwa lubuskiego, w powiecie gorzowskim.\\nWedług danych GUS z 31 grudnia 2019 r. Kostrzyn nad Odrą liczył 17 730 mieszkańców.\\nNa skutek zaciętych walk w 1945 zniszczone zostało w blisko 100% – jest uznawane za najbardziej zniszczone wojną miasto na terenie dzisiejszej Polski, nazywane czasem „polską Hiroszimą”. Kostrzyńska Starówka stanowi obecnie zarośnięte pole z resztkami ruin dawnej zabudowy.\\nW Kostrzynie znajdują się pozostałości potężnej twierdzy pruskiej, której zasadniczą część wzniesiono w XVI wieku. Odrestaurowane zostały niektóre obiekty miasta twierdzy: Brama Berlińska, Brama Chyżańska, bastion Filip, bastion Brandenburgia oraz promenada Kattego. Na terenie twierdzy znajduje się również bastion Król oraz ruiny kościoła i zamku. Miasto należy do Euroregionu Pro Europa Viadrina."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%81_%D1%83%D0%B9%C4%95_(%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/View_to_St._Michael%27s_Castle.jpg","page_title":"Марс уйĕ (Санкт-Петербург)","context_page_description":"Ма́рс уйĕ — Санкт-Петербург варринчи лапам."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_the_Philippines","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Eight_Forbestown_Road_Fort.jpg","page_title":"List of tallest buildings in the Philippines","context_page_description":"The lists of tallest buildings in the Philippines, which ranks skyscrapers throughout the country."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A4%D0%B0%D1%82%D1%83%D0%B2%D0%B8%D0%BB%D1%8C-%D0%93%D1%80%D0%B5%D1%81%D1%82%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Vue_de_Fatouville_%28-Grestain%29.jpg","page_title":"Фатувиль-Грестен","context_page_description":"Фатувиль-Грестен — Францин гӀала-коммуна, лаьтта Норманди регионехь. Коммунан департамент — Эр. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://sh.wikipedia.org/wiki/Gateshead_Millennium_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Gateshead_Millennium_Bridge_-_coming_down.jpg","page_title":"Gateshead Millennium Bridge","context_page_description":"Gateshead Millennium Bridge zvan i Baltic Millennium Bridge je pješačko-biciklistički most, na sjeveroistoku Engleske u Metropolitanskoj grofoviji Tyne and Wear.\\nMost premošćuje Rijeku Tyne i povezuje gradove Gateshead i Newcastle upon Tyne."},{"page_url":"https://en.wikipedia.org/wiki/Suzuki_Vitara","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/2019_Suzuki_Vitara_facelift_Rear.jpg","page_title":"Suzuki Vitara","context_page_description":"The Suzuki Vitara is a compact SUV produced by Suzuki in four generations since 1988. The second and third generation models were known as the Suzuki Grand Vitara, with the fourth and current series eschewing the \\"Grand\\" prefix. In Japan and a number of other markets, all generations have used the name Suzuki Escudo.\\nThe original series was designed to fill the slot above the Suzuki Jimny. The first generation was known as Suzuki Sidekick in the United States. The North American version was produced as a joint venture between Suzuki and General Motors known as CAMI. The Sidekick was sold in various badges such as the Geo Tracker in the United States, and as the GMC Tracker, Chevrolet Tracker, Asüna Sunrunner and Pontiac Sunrunner in Canada. It was also sold as the Santana 300 and 350 in Spain. In the Japanese market, it was also sold as the Mazda Proceed Levante.\\nThe second generation was launched in 1998 under the \\"Grand Vitara\\" badge in most markets. It was accompanied by a still larger SUV known as the Suzuki XL-7. The third generation was launched in 2005."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%88%D8%B1%D9%87_%D9%82%D9%88%D8%B3_%D8%A7%D9%84%DA%A9%D8%AA%D8%B1%DB%8C%DA%A9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Forno_Stassano_-_Museo_scienza_e_tecnologia_Milano.jpg","page_title":"کوره قوس الکتریکی","context_page_description":"کوره قوس الکتریکی که به صورت مخفف EAF نامیده می‌شود، کوره‌ای است که مواد فلزی با استفاده از یک قوس الکتریکی ذوب می‌شود. این کوره‌ها اندازه‌های متفاوتی داشته و در ایران به صورت کوره‌های قوس الکتریکی سنتی و EBT استفاده می‌گردند. دمای ذوب و تخلیه در این کوره‌ها در حدود ۱۶۰۰ درجه و در بعضی از کوره‌های آزمایشگاهی گاهی دما به ۳۰۰۰ درجه سانتی‌گراد می‌رسد.\\nمهمترین مواد اولیه برای تولید فولاد و چدن در کوره‌های قوس الکتریکی عبارتند از آهن قراضه، آهن اسفنجی، شمش چدن کوره بلند، فرو آلیاژهای آهک و فلورین می‌باشد. در ایران عمدتاً از آهن قراضه و از آهن اسفنجی به صورت گندله یا خشته استفاده می‌گردد که می‌تواند به دلیل فراوانی واحدهای احیای مستقیم باتوجه به در دسترس‌بودن منابع گاز طبیعی در ایران باشد.\\nنوع دیگری از ماده شارژ کوره در برخی کشورها، تغذیه مداوم آهن اسفنجی خشته‌شده گرم است. کوره‌های قوس الکتریکی، از طریق ذوب شدن بار کوره توسط قوس الکتریکی ایجاد شده بین الکترودهای گرافیتی و بار فلزی، کار می‌کنند. در این روش، ابتدا آهن اسفنجی تولید شده در فرایند احیای مستقیم درون کوره قوس الکتریکی ریخته می‌شود تا ذوب گردد. دمای این کوره‌ها به حدی است که در همان ذوب اولیه فولاد با درصد کربن نسبتاً پایین تولید می‌شود. سپس فولاد تولیدشده درون کوره پاتیلی ریخته می‌شود تا در آنجا عملیات آلیاژسازی انجام شود."},{"page_url":"https://sv.wikipedia.org/wiki/Camponotus_pylartes","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5c/Camponotus_pylartes_casent0103237_dorsal_1.jpg","page_title":"Camponotus pylartes","context_page_description":"Camponotus pylartes är en myrart som beskrevs av Wheeler 1904. Camponotus pylartes ingår i släktet hästmyror, och familjen myror."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D8%A7_%D9%88%D8%A7%D9%86%D8%AA%D8%B2%D9%8A%D9%86%D8%A7%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Map_commune_FR_insee_code_67519.png","page_title":"لا وانتزيناو","context_page_description":"لا وانتزيناو ‏ هي بلدية تقع في إقليم الراين الأسفل من منطقة ألزاس في شمال شرق فرنسا. تبلغ مساحة هذه المدينة 25.39، وترتفع عن سطح البحر 130 م، يبلغ عدد سكانها 5892 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Claude Graebling البلدية خلال فترة."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%B5%D1%87%D0%B0%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/De%C4%8Dani1.jpg","page_title":"Дечани","context_page_description":"Дечани — город в исторической области Метохия. Административный центр одноимённой общины. С 2008 года находится под контролем частично признанной Республики Косово.\\nВ нескольких километрах к западу от него располагается один из крупнейших и наиболее известных монастырей Сербской православной церкви — Высокие Дечаны.\\nЧерез село проходит автомобильная дорога республиканского значения Печ-Джяковица."},{"page_url":"https://an.wikipedia.org/wiki/Arizkun","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Arizkun.jpg","page_title":"Arizkun","context_page_description":"Arizkun ye un lugar d'o municipio de Baztan, situato en a val de Baztan, Navarra. Ta plegar-ie s'ha de prener la N-121b y una vez pasato Elizondo pillar l'esbarre a man dreita que marca Arizkun. Poseye quatre vicos: Aintzialde, Bozate, Ordoki y Pertalats. Amés d'estos, tamien tien as agrupacions de casas de Otsanaiz, San Blas y Bergara, y os grupos de caseríos que forman en conchunto Aritzakun. Seguntes o censo de l'1 de chinero de 2010, o lugar teneba 610 habitants."},{"page_url":"https://nl.wikipedia.org/wiki/Anijs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Koehler1887-PimpinellaAnisum.jpg","page_title":"Anijs","context_page_description":"Anijs is een plant die behoort tot de schermbloemenfamilie. De \\"zaden\\" van anijs wordt gebruikt voor het aromatiseren van gerechten. Steranijs heeft een vergelijkbare smaak als anijs, maar behoort tot een andere familie."},{"page_url":"https://de.wikipedia.org/wiki/VSS_Unity","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Virgin_Galactic_SpaceShipTwo_%22Unity%22_rollout_19Feb2016%2C_FAITH_hangar%2C_Mojave%2C_California.jpg","page_title":"VSS Unity","context_page_description":"Die VSS Unity ist das zweite für die kommerzielle Nutzung ausgelegte Raumflugzeug der Firma Virgin Galactic und das zweite Raumfahrzeug der SpaceShipTwo-Klasse. Der ursprüngliche Name war VSS Voyager. Das „VSS“ in den Namen steht für „Virgin Space Ship“. Hersteller ist die Firma The Spaceship Company, ein ehemaliges Joint Venture der Unternehmen Virgin Group und Scaled Composites, seit 2012 eine hundertprozentige Tochter von Virgin Galactic.\\nNach dem Absturz des Schwesterschiffs VSS Enterprise am 31. Oktober 2014 wurde der Baufortschritt der VSS Unity auf 65 % beziffert. Am 20. Februar 2016 wurde die VSS Unity im Mojave Air & Space Port offiziell vorgestellt. Am 3. Dezember 2016 wurde der erste Gleitflug und am 5. April 2018 der erste Motorflug durchgeführt.\\nDas Mutterschiff White Knight Two der VSS Enterprise heißt VMS Eve, für die VSS Unity wird es voraussichtlich zu Ehren von Steve Fossett den Namen VMS Spirit of Steve Fossett tragen.\\nAm 13. Dezember 2018 erreichte die Unity eine Gipfelhöhe von 51,4 Meilen. Damit überschritt sie zum ersten Mal die Grenze von 50 Meilen, die in den USA als Grenze zum Weltraum gilt."},{"page_url":"https://fr.wikipedia.org/wiki/Cercle_sportif_Obercorn","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Stade_municipal_cso.jpg","page_title":"Cercle sportif Obercorn","context_page_description":"Le Cercle sportif Obercorn est un club de football luxembourgeois, fondé en 1930, et basé à Oberkorn. Il est présidé par Yves Bechet.\\nLe club évolue lors de la saison 2009-2010 en Promotion d'Honneur soit la deuxième division du Luxembourg."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%80%E1%80%94%E1%80%94%E1%80%BA%E1%80%B8_(%E1%80%9B%E1%80%B1%E1%80%9E%E1%80%90%E1%80%B9%E1%80%90%E1%80%9D%E1%80%AB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Carpilius_convexus_is_consuming_Heterocentrotus_trigonarius_in_Hawaii.jpg","page_title":"ကနန်း (ရေသတ္တဝါ)","context_page_description":"ရေသတ္တဝါများ၌ ခြေထောက်ပါသည်ကို အလွန်တွေ့ရခဲသည်။ များသောအားဖြင့် ခြေထောက် အတုအယောင်များသာ ပါရှိကြသည်။ ကဏန်းတွင် ထူးခြားစွာ ခြေထောက် ၁၀ချောင်း ပါရှိသည်ကို တွေ့ရသည်။ ယင်းတို့အနက် ၈ ချောင်းကိုသာ လမ်းလျှောက် သွားလာရန် အသုံးချ၍ ကဏန်းလက်မခေါ် ကြီးမားသန်စွမ်းသည့် ပထမအစုံကိုမူ လက်သဖွယ် အသုံးချသည်။ ထိုလက်မကြီးများသည် ကဏန်းအတွက် အကာအကွယ် လက်နက်လည်း ဖြစ်၏။ ကဏန်း၏ ကျောကုန်းမှာ အံ့ဖွယ်ကောင်းလောက်အောင် မာကျောသော အခွံထူဖြစ်၍ ဤအခွံကြီးက သူ၏ ကိုယ်ခန္ဓာကို ကာကွယ်ထားသည်။ ကိုယ်အရှေ့ပိုင်းတွင် ရင်အုပ်ကာသံချပ်သဖွယ် အကာအကွယ်ပါရှိ၍ ခြေထောက် ၁၀ ချောင်း စလုံးမှာလည်း မာကျောသော အခွံများဖြင့် အသီးသီး ဖုံးအုပ်လျက်ရှိပေသည်။ ကဏန်းသည် ရန်သူကို လက်မဖြင့် မြဲမြံစွာ ညှပ်တတ်သောကြောင့် ယင်းတို့ကို သတိနှင့် ကိုင်တွယ်ရာသည်၊ ကဏန်း၏ မျက်လုံးများတွင် အညှာတံပါရှိ၍ ယင်းတို့သည် ဝင်လိုက်ထွက်လိုက် လုပ်တတ်သောကြောင့် တစ်နည်းအားဖြင့် ရယ်ဖွယ်ကောင်းသည်။ သူ၏ ပါးစပ်မှာလည်း အလွန်အံ့ဩဖွယ်ကောင်းသည်ဟု ဆိုရပေမည်။ အဘယ်ကြောင့်ဆိုသော် ယင်းတွင် စမ်းသပ်ရန်၊ ကိုက်ဖဲ့ရန်နှင့် အစာကို ဝါးချေရန် အင်္ဂါအစိတ်အပိုင်းများ ပေါင်းစု ပါဝင်သောကြောင့် ဖြစ်၏။\\nကဏန်းသည် မိမိနှင့် အမျိုးတော်စပ်သော ကျောက်ပုဇွန်၊ ပုဇွန်ထုပ်ကြီးများနှင့် ဆင်တူသည်။ ဆင်တူပုံမှာ အဆိုပါ ရေသတ္တဝါများကဲ့သို့ပင် ကဏန်း၌ အာရုံမှင်၊ မျက်စိနှာတံ၊ မေးရိုး၊ ထူးဆန်းသော ပါးစပ်၊"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%D9%86%DB%8C%D9%84_%DA%A9%D8%A7%D8%B1%D9%88%D8%A7%D9%84%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/DanielCarvalho.jpg","page_title":"دانیل کاروالیو","context_page_description":"دانیل کاروالیو هافبک اهل برزیل است که در شهر پلوتاس و در تاریخ ۱ مارس ۱۹۸۳ به دنیا آمده‌است. وی تک گل تیمش مقابل لیورپول در دیدار سوپرجام ۲۰۰۵ را برای زسکا مسکو به ثمر رساند.\\nدانیل کاروالیو در تیم‌های فوتبال باشگاه ورزشی اینترناسیونال،زسکا مسکو، باشگاه ورزشی اینترناسیونال، باشگاه ورزشی العربی قطر سابقهٔ حضور دارد. این بازیکن همچنین در سال، اتلتیکو مینیرو ۲۰۰۴ بار برای، پالمیراس به میدان رفته‌است و طی این مدت ۸ گل به ثمر رسانده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Carlo_Sellitto","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Sellitto_Magcapodimonte.jpg","page_title":"Carlo Sellitto","context_page_description":"Carlo Sellitto war ein neapolitanischer Maler des Barock in der Nachfolge von Caravaggio.\\nSellitto hieß eigentlich Carlo Infantino und nahm als Künstlernamen den Geburtsnamen der Mutter, die aus Neapel stammte. Er war der Sohn eines Malers aus Montemurro in der Region Basilicata. Er lernte kurz bei dem Piedmonteser Maler Giovanni Antonio Ardito und ab 1591 bei dem flämischen Maler Louis Croys. 1608 gründete er seine eigene Werkstatt. Er war in Neapel als Porträtmaler begehrt und einer der frühesten Caravaggisten – sein Johannes der Täufer wurde mehrere Jahre gemalt, bevor Caravaggio 1606/07 Neapel besuchte. Später war er durch Guido Reni beeinflusst, der 1611/12 Neapel besuchte.\\nNeben Porträts und religiösen Sujets malte er auch Stillleben und Genreszenen. Von diesem Aspekt seines Schaffens ist aber nichts erhalten.\\nEin Bacchus von ihm ist im Städelschen Kunstinstitut in Frankfurt am Main.\\nEr war eine Zeitlang mit Claudia Croys, der Tochter seines Lehrherrn, verlobt, heiratete aber 1613 Portia Pirrone aus Montemurro."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%95%E3%81%AE%E9%A0%AD%E5%85%AC%E5%9C%92%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Inokashira_Koen_Station-1.jpg","page_title":"井の頭公園駅","context_page_description":"井の頭公園駅は、東京都三鷹市井の頭三丁目にある、京王電鉄井の頭線の駅である。駅番号はIN16。"},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EC%9D%B4%ED%81%B4_W._%EC%8A%A4%EB%AF%B8%EC%8A%A4","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Michael_W._Smith.jpg","page_title":"마이클 W. 스미스","context_page_description":"마이클 휘태커 스미스는 그래미 상을 받은 미국의 싱어송라이터, 작곡가, 배우이다. 그는 현대 기독교 음악에서 가장 영향력 있는 아티스트 가운데 한 명이다. 또, 스미스는 주류가 되는 음악 산업에서 상당한 성공을 거두고 있다. 1978년 데뷔하여 지금까지 40년간 그래미 상을 세 번 받았으며, 40개의 도브상을 거머쥐었다.\\n이러한 가운데 그는 13,000,000개가 넘는 음반을 팔았다. 또, 아메리칸 뮤직 어워드를 받았으며 《피플》 지에서 \\"가장 아름다운 사람들\\" 가운데 한 명으로 이름을 올리기도 하였다. 여담으로 서양인치고 동양인 기준의 시각으로도 드물게 굉장한 동안이다.\\n내한공연\\n2005년 7월 3일 잠실체조경기장\\n2015년 11월 15일 고려대화정체육관"},{"page_url":"https://de.wikipedia.org/wiki/Maus_au_Chocolat","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Ingang_Maus_au_Chocolat.JPG","page_title":"Maus au Chocolat","context_page_description":"Maus au Chocolat ist ein interaktiver Darkride im Freizeitpark Phantasialand in Brühl. Die Attraktion wurde am 9. Juni 2011 im Themenbereich Berlin eröffnet. Die Geschichte der Fahrattraktion rankt sich um die fiktive Berliner Tortenfabrik Gustav E. Lehmann, in die Mäuse eingedrungen sind, und mit Hilfe der Fahrgäste beseitigt werden sollen. Die Besucher schießen dabei mit Tortenguss-Klumpen auf die, in interaktiven 3D-Filmszenen agierenden, Nagetiere. Ziel ist es, dabei eine möglichst hohe Punktzahl zu erreichen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA%D1%96%D0%B2_%D0%A2%D0%B0%D1%80%D0%B0%D1%81%D0%BE%D0%B2%D1%96_%D0%A8%D0%B5%D0%B2%D1%87%D0%B5%D0%BD%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/uk/8/8e/SHEVCHENKO.JPG","page_title":"Список пам'ятників Тарасові Шевченку","context_page_description":"Пам'ятники Тарасові Григоровичу Шевченкові встановлені в усіх обласних центрах України, багатьох містах і селах держави, а також у численних столицях і містах за кордоном.\\nПерший пам'ятник Т. Шевченку відкрито у 1881 році до 20-річчя від дня смерті митця у м. Форт-Шевченко під керівництвом І. О. Ускова, який був комендантом Новопетровського укріплення, коли Шевченко перебував там на засланні.\\nВ Україні перший пам'ятник Шевченку встановлено у Харкові у садибі Алчевських у 1881 році.\\nЗагалом, в Україні та світі є 1384 пам'ятники Кобзареві, з них 1256 — в Україні та 128 — за кордоном у 35 країнах. Це найбільша у світі кількість монументів, встановлених діячеві культури. В Україні найбільше пам'ятників встановлено на Прикарпатті."},{"page_url":"https://it.wikipedia.org/wiki/Iperplasia_prostatica_benigna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Benign_Prostatic_Hyperplasia_nci-vol-7137-300.jpg","page_title":"Iperplasia prostatica benigna","context_page_description":"L'iperplasia prostatica benigna, conosciuta anche come adenoma prostatico o in maniera inesatta come \\"ipertrofia prostatica benigna\\", è una condizione caratterizzata dall'aumento di volume della ghiandola prostatica. Non è una neoplasia maligna.\\nL'aumento di volume infatti non è dovuto a una ipertrofia, ma a una iperplasia della componente parenchimale e stromale della ghiandola. Anche se entrambe le condizioni comportano un aumento volumetrico globale, il termine ipertrofia indica l'aumento di volume delle singole cellule componenti un organo, che mantengono invariato il loro numero, mentre iperplasia indica l'aumento del numero delle cellule. In questo caso l'aumento del numero delle cellule ha luogo nella zona centrale della prostata, che si trova a contatto con l'uretra prostatica, o nelle ghiandole periuretrali e nella zona di transizione.\\nInizia generalmente con lo sviluppo di noduli microscopici costituiti principalmente da elementi stromali e parenchimali, che col passare degli anni, aumentando in numero e dimensioni, comprimono e distorcono l'uretra prostatica producendo un'ostruzione che ostacola la fuoriuscita dell'urina."},{"page_url":"https://fr.wikipedia.org/wiki/Abbaye_de_L%C4%85d","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Lad-06-4A%281%29_kosciol_wnetrze.jpg","page_title":"Abbaye de Ląd","context_page_description":"L’abbaye de Ląd est une abbaye fondée par les Cisterciens en 1145 en Grande-Pologne, à environ un kilomètre au sud du village actuel de Ląd, au bord de la rivière Warta. Elle est l'une des sept abbaye-filles de l'abbaye d'Altenberg. Les bâtiments principaux actuels datent du XVIIᵉ siècle et du XVIIIᵉ siècle. En 1796, la plupart des propriétés de l'abbaye sont confisquées par le royaume de Prusse, et en 1819 l'abbaye est dissoute. Depuis 1921, l'abbaye est entretenue et occupée par les Salésiens. Le 1ᵉʳ juillet 2009, l'abbaye est inscrite aux monuments historiques de Pologne."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D1%84%D1%82_%D0%92%D0%9D%D0%91%D0%90_2005_%D0%B3%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Janel_McCarville_20161011.jpg","page_title":"Драфт ВНБА 2005 года","context_page_description":"Драфт ВНБА 2005 года прошёл 16 апреля, в субботу, в студии развлечений НБА в городке Сикокас, штат Нью-Джерси. К участию в драфте были допущены игроки после окончания колледжа и игроки-иностранцы. Лотерея драфта состоялась 1 декабря 2004 года, по её результатам право выбора под первым номером получила команда «Шарлотт Стинг», который был использован ею на 22-летнюю Джанель Маккарвилл, центровую из Миннесотского университета. Первый раунд драфта транслировался на канале ESPN2.\\nВсего на этом драфте было выбрано 39 баскетболисток, из них 37 из США, по одной с Сент-Винсента и Гренадин и из Австралии. Санчо Литтл с 2006 года выступала в чемпионате Испании, а в 2010 году стала натурализованной испанкой, чтобы играть за сборную этой страны."},{"page_url":"https://sq.wikipedia.org/wiki/Sistemi_koordinativ_polar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Euler%27s_formula.svg","page_title":"Sistemi koordinativ polar","context_page_description":"Në matematikë, sistemi koordinativ polar është një sistemin koordinativ dy-dimensional në të cilin çdo pikë në plan jepet nga një distancë nga një pikë e caktuar dhe një kënd nga një drejtim i caktuar.\\nPika fikse quhet poli, dhe rrezja nga ky pol me drejtim të caktuar quhet boshti polar. Distanca nga poli quhet koordinata rrezore ose rrezja, kurse këndi quhet koordinata këndore, këndi polar, apo azimuti."},{"page_url":"https://id.wikipedia.org/wiki/Kaisar_Suizei","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Suizei_thumb_1.jpg","page_title":"Kaisar Suizei","context_page_description":"Kaisar Suizei bisa dipanggil sebagai Kaisar Suisei dan dikenal sebagai Kamu-nuna-kaha-mimi no Mikoto, adalah kaisar Jepang yang kedua,\\nTidak ada catatan kapan dia memerintah, tetapi diperkirakan telah memerintah 581 SM - 549 SM."},{"page_url":"https://es.wikipedia.org/wiki/Seeheim-Jugenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Seeheim-Jugenheim-Heiligenberg-Schloss.jpg","page_title":"Seeheim-Jugenheim","context_page_description":"Seeheim-Jugenheim es un municipio del distrito de Darmstadt-Dieburg en Hesse, Alemania. Tiene una población de aproximadamente 17,000 habitantes.\\nSeeheim-Jugenheim consiste en siete pueblos:\\nBalkhausen\\nJugenheim\\nMalchen\\nOber-Beerbach\\nSeeheim\\nSteigerts\\nStettbach"},{"page_url":"https://en.wikipedia.org/wiki/Cambridge_rules","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Robert_Burn.png","page_title":"Cambridge rules","context_page_description":"The Cambridge Rules were several formulations of the rules of football made at the University of Cambridge during the nineteenth century. One of these codes, dating from 1863, had a significant influence on the creation of the original Laws of the Game of the Football Association."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%A2%E3%83%BC%E3%82%AC%E3%82%B9%E3%83%9C%E3%83%BC%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Julbord_1990b.jpg","page_title":"スモーガスボード","context_page_description":"スモーガスボードは、様々な料理を一つのテーブルに並べてビュッフェ形式で提供するスウェーデン起源のスカンジナヴィア料理である。\\nスウェーデン以外の国では、ノルウェー語: koldtbord、デンマーク語: det kolde bord、アイスランド語: hlaðborð、フィンランド語: seisova pöytä、エストニア語: rootsi laud、ラトビア語: aukstais galds、リトアニア語: švediškas stalas、クロアチア語: švedski stol、ドイツ語: kaltes Buffet、ポーランド語: szwedzki stółと呼ばれる。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Rheinbreitbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Rheinbreitbach_Hauptstra%C3%9Fe_21.jpg","page_title":"Liste der Kulturdenkmäler in Rheinbreitbach","context_page_description":"In der Liste der Kulturdenkmäler in Rheinbreitbach sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Rheinbreitbach aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://tr.wikipedia.org/wiki/Aida","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Aida_poster_colors_fixed.jpg","page_title":"Aida","context_page_description":"Aida misafir veya dönen anlamında bir dişi isimden gelme Giuseppe Verdi tarafından bestelenmiş dört perdelik bir operadır. İtalyanca librettoyu, Fransız eski Mısır uzmanı Auguste Mariette tarafından yazılmış bir senaryodan uyarlayarak, Antonio Ghislanzoni yazmıştır.\\nOperanın prömiyeri 24 Aralık 1871'de Kahire, Mısır'da Hidivlik Opera evinde orkestra şefi Giovanni Bottesini idaresi altında yapılmıştır.\\nBu eser dünya opera evleri repertuvarlarında devamlı olarak bulunan ve popüler olarak seyirci çeken bir opera eseridir. Son hazırlanan Kuzey Amerika opera evlerinde sahnelenen baş 20 opera eseri listesi içinde 16. sırayı almıştır. Birçok ses ve video kayıtları bulunmaktadır."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Blankenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Berlin_Blankenburg_Dorfkirche_0003.JPG","page_title":"Liste der Kulturdenkmale in Berlin-Blankenburg","context_page_description":"In der Liste der Kulturdenkmale von Blankenburg sind die Kulturdenkmale des Berliner Ortsteils Blankenburg im Bezirk Pankow aufgeführt."},{"page_url":"https://en.wikipedia.org/wiki/Ypthima_tabella","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ypthima_tabella_2_by_V_K_Chandrasekharan.jpg","page_title":"Ypthima tabella","context_page_description":"Ypthima tabella is a species of Satyrinae butterfly found in South India, described by Marshall and De Nicéville in 1883. Some experts still consider this as a subspecies of Ypthima philomela, baby fivering."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%B7%D0%BD%D0%B5%D1%86%D0%BA%D0%B8%D0%B9_%D0%9C%D0%BE%D1%81%D1%82_(%D1%83%D0%BB%D0%B8%D1%86%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Kuznetsky_Most_13.jpg","page_title":"Кузнецкий Мост (улица)","context_page_description":"Кузне́цкий Мост — улица в Мещанском и Тверском районах Центрального административного округа города Москвы. Проходит от улицы Большая Дмитровка до улицы Большая Лубянка. Нумерация домов ведётся от Большой Дмитровки.\\nКузнецкий Мост — одна из старейших улиц Москвы, появление которой связано со строительством в этом районе Пушечного двора, а название сохраняет имя стоявшего по линии улицы Кузнецкого моста через реку Неглинную. В XVII—XVIII веках на улице жили представители знатных фамилий Мясоедовых, Салтыковых, Гагариных, Щербатовых, Долгоруковых, Волынских, Воронцовых, Голицыных и многих других. Начиная с XVIII века и вплоть до революции 1917 года Кузнецкий Мост являлся главной торговой улицей Москвы — «святилищем роскоши и моды», славился магазинами одежды, книжными лавками, фотоателье и ресторанами. Исторические традиции Кузнецкого Моста сохраняются и в настоящее время.\\nКузнецкий Мост проходит по территории культурных слоёв «Старая Кузнецкая слобода», «Кузнецкий мост» и «Звонарская слобода», которые охраняются в качестве объектов культурного наследия федерального значения. Улица изобилует памятниками истории и архитектуры."},{"page_url":"https://da.wikipedia.org/wiki/Sidi-Bouzid","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Sidi_bouzid.jpg","page_title":"Sidi-Bouzid","context_page_description":"Sidi-Bouzid er en by, der ligger midt i Tunesien. Det var her Mohamed Bouazizi var med til at starte Jasminrevolutionen, der har bredt sig til hele Mellemøsten."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D9%86%DB%8C%D8%B3%D9%87_%D8%A7%D8%A8%D8%B1%DB%8C%D8%B4%D9%85%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Abrishami_-_3.JPG","page_title":"کنیسه ابریشمی","context_page_description":"کنیسه ابریشمی یکی از کنیسه‌های یهودیان ایرانی در مرکز تهران است."},{"page_url":"https://pl.wikipedia.org/wiki/Gorenji_Novaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/DolenjiNovaki.JPG","page_title":"Gorenji Novaki","context_page_description":"Gorenji Novaki – wieś w Słowenii, w gminie Cerkno. W 2018 roku liczyła 233 mieszkańców."},{"page_url":"https://fr.wikipedia.org/wiki/Strasbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Ettore_Bugatti%2C_plaque_rue_de_la_Nu%C3%A9e_Bleue_%C3%A0_Strasbourg.jpg","page_title":"Strasbourg","context_page_description":"Strasbourg est une commune française située dans le département du Bas-Rhin. Préfecture du département, elle est également, depuis le 1ᵉʳ janvier 2016, le chef-lieu de la région Grand Est. Capitale de la région historique d'Alsace, la ville est bordée par le Rhin et frontalière avec l'Allemagne.\\nStrasbourg est une des trois « capitales européennes » aux côtés de Bruxelles et Luxembourg. La ville accueille en effet de multiples institutions européennes, notamment le Conseil de l'Europe dont dépendent la Cour européenne des droits de l'homme et la Pharmacopée européenne, mais également le Parlement européen ou encore le Médiateur européen.\\nAvec notamment Bâle, Genève et New York, Strasbourg est l'une des rares villes au monde à être le siège de plusieurs institutions internationales sans être capitale politique d’un État. Strasbourg est également la deuxième ville de France en termes de nombre de congrès internationaux, après Paris.\\nPar sa population, Strasbourg intra-muros est la première commune du Grand Est français et, à la date du 1ᵉʳ janvier 2018, la huitième de France."},{"page_url":"https://zh.wikipedia.org/wiki/2015%E5%B9%B4%E6%AF%94%E5%88%A9%E6%99%82%E5%A4%A7%E7%8D%8E%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Jenson_Button_Belgium_2015.jpg","page_title":"2015年比利時大獎賽","context_page_description":"2015年比利時大獎賽，官方名稱為2015年一級方程式賽車殼牌公司比利時大獎賽，是2015年8月23日舉辦於比利時的一場一級方程式賽車賽事。比賽在斯帕-弗朗科爾尚賽道進行，總計44圈。這是2015年世界一級方程式錦標賽的第11場分站賽事。同時也是第71屆比利時大獎賽。\\n梅賽德斯車手路易斯·漢米爾頓帶著領先隊友尼可·羅斯堡21分的差距來到此站，緊追在後的是落後42分的法拉利車手賽巴斯蒂安·維泰爾。梅賽德斯在車隊冠軍積分榜上以146分的積分差距領先法拉利，位居第3的威廉斯則以85分落後法拉利。紅牛車隊車手丹尼爾·里卡多是上屆的分站冠軍。最終，漢米爾頓從桿位發車贏得他本季的第6座分站冠軍，其隊友羅斯堡取得亞軍，蓮花車手羅曼·格羅斯讓在比賽尾聲擊敗爆胎的賽巴斯蒂安·維泰爾，繼2013年美國大獎賽後，再度站上頒獎台取得季軍。\\n這場分站是法拉利車隊參加的第900場大獎賽，而麥拉倫車隊因為對其本田動力單元做出多樣變更，以105位打破了一級方程式賽車的罰退紀錄。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%27%D1%8F%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Vias_rempart.jpg","page_title":"В'яс","context_page_description":"В'яс — муніципалітет у Франції, у регіоні Лангедок-Руссільйон, департамент Еро. Населення — 5328 осіб.\\nМуніципалітет розташований на відстані близько 630 км на південь від Парижа, 50 км на південний захід від Монпельє."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%80%D1%83%D0%BD%D0%B0%D1%81%D1%82%D0%B8_%D0%BB%D0%B5%D0%BC%D1%83%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Crowned_Lemur_area.png","page_title":"Крунасти лемур","context_page_description":"Крунасти лемур је врста полумајмуна из породице лемура."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_F%C3%A9camp","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Gare_de_F%C3%A9camp._Autorail_X_73500_pour_Le_Havre.jpg","page_title":"Gare de Fécamp","context_page_description":"La gare de Fécamp est une gare ferroviaire française de la ligne de Bréauté - Beuzeville à Fécamp, située à proximité du centre de la ville de Fécamp, dans le département de la Seine-Maritime, en région Normandie.\\nUne gare provisoire est mise en service en 1856, par la Compagnie des chemins de fer de l'Ouest. La gare définitive est édifiée à l'emplacement actuel en 1858, avec le prolongement de la ligne jusqu'au port.\\nC'est une gare de la Société nationale des chemins de fer français, desservie par des trains TER Normandie."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D8%A7%D8%B1%D9%88%D8%B3%D9%84%D8%A7%DA%A4_%D8%AA%D8%B4%D8%A7%D9%86%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Jaroslav-chana-portrait-child.png","page_title":"چاروسلاڤ تشانا","context_page_description":"چاروسلاڤ تشانا كان لاعب كورة قدم من تشيكوسلوفاكيا."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B9%BF%E5%B7%9E%E5%B8%82%E5%8E%86%E5%8F%B2%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/%E4%B8%AD%E5%9B%BD%E5%87%BA%E5%8F%A3%E5%95%86%E5%93%81%E4%BA%A4%E6%98%93%E4%BC%9A%E6%B5%81%E8%8A%B1%E8%B7%AF%E6%97%A7%E5%9D%80.jpg","page_title":"广州市历史建筑列表","context_page_description":"本條目是關於在廣州市內的歷史建築的介紹。"},{"page_url":"https://nl.wikipedia.org/wiki/Moeraswalstrospanner","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Orhtonama_vittata_FvL.jpg","page_title":"Moeraswalstrospanner","context_page_description":"De moeraswalstrospanner is een nachtvlinder uit de familie Geometridae, de spanners. De voorvleugellengte bedraagt tussen de 11 en 14 millimeter. De soort overwintert als rups."},{"page_url":"https://en.wikipedia.org/wiki/Media_in_the_San_Francisco_Bay_Area","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/KNTVNBC11MainStudios.JPG","page_title":"Media in the San Francisco Bay Area","context_page_description":"The media in the San Francisco Bay Area has historically focused on San Francisco but also includes two other major media centers, Oakland and San Jose. The Federal Communications Commission, Nielsen Media Research, and other similar media organizations treat the San Francisco-Oakland-San Jose Bay Area as one entire media market. The region hosts to one of the oldest radio stations in the United States still in existence, KCBS, founded by engineer Charles Herrold in 1909. As the home of Silicon Valley, the Bay Area is also a technologically advanced and innovative region, with many companies involved with Internet media or influential websites."},{"page_url":"https://en.wikipedia.org/wiki/Leigh-on-Sea","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Old_Leigh.jpg","page_title":"Leigh-on-Sea","context_page_description":"Leigh-on-Sea, also referred to as Leigh, is a town and civil parish in Essex, England. A district of Southend-on-Sea, with its own town council, it is currently the only civil parish within the borough."},{"page_url":"https://af.wikipedia.org/wiki/Mercedes-Benz_W124","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/1995_Mercedes-Benz_E_220_%28S_124%29_station_wagon_%282015-07-06%29_02.jpg","page_title":"Mercedes-Benz W124","context_page_description":"W124 is Mercedes-Benz se interne onderstelbenaming vir die 1984/85 tot 1995/96 weergawe van die Mercedes-Benz E-klas, sowel as die eerste generasie wat amptelik na as die E-klas verwys is. Die W124-model het die W123-model ná 1985 vervang en is ná 1995 deur die W210 E-klas opgevolg.\\nIn Noord-Amerika is die W124 begin November 1985 as 'n 1986-model bekendgestel en dit is tot op 7 November 1995 verkoop.\\nReeksproduksie het in November 1984 begin, met die personthulling wat op Maandag 26 November 1984 in Sevilla, Spanje, plaasgevind het. Kliënte-aflewerings en die bekendstelling op Europese markte het in Januarie 1985 begin."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%BCdischer_Friedhof_(Assen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Assen-joodsgedenkteken-01.jpg","page_title":"Jüdischer Friedhof (Assen)","context_page_description":"Der Jüdische Friedhof in Assen, der Hauptstadt der niederländischen Provinz Drenthe, wurde im 18. Jahrhundert angelegt. Der Jüdische Friedhof am Oude Haarweg ist einen halben Hektar groß. Heute sind noch 394 Grabsteine auf dem Friedhof erhalten.\\nIm Jahr 1951 wurde ein Denkmal zur Erinnerung an die Opfer der Schoa errichtet."},{"page_url":"https://en.wikipedia.org/wiki/Bibury_Court","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Bibury_Court_Hotel_-_geograph.org.uk_-_1440335.jpg","page_title":"Bibury Court","context_page_description":"Bibury Court is a Grade I listed Jacobean country house in Bibury, Gloucestershire, England.\\nThe River Coln flows to the south of the property."},{"page_url":"https://uk.wikipedia.org/wiki/Air_Seychelles","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Air_seychelles_twin_otter.jpg","page_title":"Air Seychelles","context_page_description":"Air Seychelles — національна державна авіакомпанія Сейшельських островів зі штаб-квартирою в Сейшельському міжнародному аеропорту, що виконує регулярні комерційні перевезення по 9 пунктах призначення на трьох континентах світу."},{"page_url":"https://fr.wikipedia.org/wiki/Ogata_Kenzan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Guimet_Kenzan_01.JPG","page_title":"Ogata Kenzan","context_page_description":"Ogata Kenzan, né Ogata Shinsei, et connu aussi sous le pseudonyme Shisui, était un peintre et céramiste japonais de l'époque d'Edo, frère cadet du célèbre peintre Ogata Kōrin. Leur œuvre, à tous deux, ressortit à l'école Rimpa.\\nLe travail céramique de Kenzan débute en 1699, en tant qu'amateur avec un enthousiasme maladroit et un iconoclasme naïf. Cette combinaison improbable l'amène à créer des vases qui contrastent fortement avec la porcelaine d'Arita alors à la mode.\\nSon nom est devenu celui d'une dynastie de céramistes, pas forcément héréditaire. Ogata Ihachi, durant la l'époque d'Edo, était le deuxième du nom. L'anglais Bernard Leach a reçu le titre de Kenzan VII.\\nDans les plats quadrangulaires du Musée Guimet, il reprend le format, presque carré, dévolu depuis l'époque Heian à la calligraphie et à la peinture « de motifs sous-jacents ». Tandis que d'autres artistes de l'école Rimpa - dont Hon'ami Kōetsu et Tawaraya Sōtatsu - ont repris dès le XVIIᵉ siècle ce type de format en peinture, c'est Ogata Kenzan qui a suivi cette même démarche dans le champ de la céramique. Dans le plat à décor d'iris, le fond d'engobe blanche rapproche ainsi ce grès d'une feuille de papier blanc."},{"page_url":"https://fr.wikipedia.org/wiki/Maurice_Dayan","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Maurice_Dayan_2016.jpg","page_title":"Maurice Dayan","context_page_description":"Maurice Dayan, né le 25 janvier 1935 à Paris et mort le 2 mai 2020 dans la même ville, est un psychanalyste et universitaire français. Auteur de plusieurs essais psychanalytiques, il a été professeur de psychopathologie à l'université Paris-VII."},{"page_url":"https://cs.wikipedia.org/wiki/Ho%C5%A1tice_(okres_Strakonice)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Hostice2.jpg","page_title":"Hoštice (okres Strakonice)","context_page_description":"Obec Hoštice se nachází v okrese Strakonice, kraj Jihočeský, zhruba 3,5 kilometru severovýchodně od Volyně a 7,5 km jižně od Strakonic. Leží pod vrchem Kalný v nadmořské výšce 480 až 540 metrů. Žije zde 154 obyvatel.\\nV Hošticích se natáčela filmová trilogie Slunce, seno…. Každý rok koncem srpna se zde koná vzpomínkový country koncert Stodola Michala Tučného."},{"page_url":"https://fr.wikipedia.org/wiki/Phare_De_Ven","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Enkhuizen_-_Vuurtoren_-_De_Ven_v1.jpg","page_title":"Phare De Ven","context_page_description":"Le phare De Ven est un phare actif situé à Oosterdijk un village de la commune d'Enkhuizen, province de Hollande-Septentrionale aux Pays-Bas.\\nIl est géré par le Rijkswaterstaat, l'organisation nationale de l'eau des Pays-Bas.\\nConstruit en 1699-1700, il est l’un des plus anciens phares des Pays-Bas.\\nIl est classé monument national en 1966 par l'Agence du patrimoine culturel des Pays-Bas."},{"page_url":"https://id.wikipedia.org/wiki/Pacu_jawi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Spirit_of_Pacu_Jawi.jpg","page_title":"Pacu jawi","context_page_description":"Pacu jawi adalah acara olahraga tradisional yang dilombakan di Kabupaten Tanah Datar, Sumatra Barat, Indonesia. Dalam acara ini, sepasang sapi berlari di lintasan sawah berlumpur dengan panjang sekitar 60–250 meter, sementara seorang joki berdiri di belakangnya dengan memegang kedua sapi. Walaupun namanya mengandung arti \\"balapan\\", sapi-sapi hanya dilepas sepasang tanpa lawan tanding, dan tidak ada pemenang secara resmi. Tiap pasang sapi berlari secara bergiliran, sementara penonton menilai sapi-sapi tersebut, dan kadang membeli sapi-sapi unggulan dengan harga jauh di atas harga normal. Penduduk Tanah Datar telah menyelenggarakan acara ini selama berabad-abad untuk merayakan masa panen padi. Acara ini juga diiringi pesta desa dan budaya yang disebut alek pacu jawi. Belakangan, acara ini menjadi atraksi wisata yang didukung pemerintah, dan menjadi objek fotografi yang mendapatkan berbagai penghargaan di bidang fotografi."},{"page_url":"https://de.wikipedia.org/wiki/Liste_irischer_Loughs","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Ireland_physical_medium.png","page_title":"Liste irischer Loughs","context_page_description":"Die Liste irischer Loughs bezieht sich auf die Insel Irland.\\nDas Wort lough kommt aus dem Irischen und bedeutet See. Es entspricht damit auch der in Schottland üblichen Bezeichnung loch.\\nEs gibt viele Seen in Irland. Die meisten von ihnen werden als Lough bezeichnet. Die Liste enthält jene Loughs, die von geographischer, geologischer oder historischer Bedeutung sind."},{"page_url":"https://simple.wikipedia.org/wiki/T-ara","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/T-ara_at_the_Mnet_20%27s_Choice_Awards.jpg","page_title":"T-ara","context_page_description":"T-ara is a South Korean girl group. They are one of the best-selling girl groups of all time. T-ara was formed in 2009. The group mainly makes dance-pop music. This is partly due to their partnership with composer Shinsadong Tiger, who has favored that genre. T-ara uses a wide variety of visual looks in their dance and performances.\\nT-ara debuted in July 2009 with the single \\"Lies\\". Their first studio album was called the Absolute First Album. It was released in December 2009 and lead to several hit songs. These included \\"TTL\\", \\"Bo Peep Bo Peep\\", and \\"You Drive Me Crazy\\".\\nIn 2011, T-ara released the song \\"Roly-Poly\\". It became the best-selling single of the year on the Gaon chart in South Korea. The group also became popular in Japan. Later that year they signed a contract with agency J-Rock to manage their sales in Japan. The contract was for USD 4.7 million. This was the most any Korean girl group had made in a foreign market at the time. T-ara went on to make a Japanese studio album called Jewelry Box. This album reached number one on the Oricon weekly charts in Japan. Also in 2011, T-ara released the Korean album Black Eyes. It lead to three number ones songs in a row."},{"page_url":"https://en.wikipedia.org/wiki/Eleventh_Night","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/11th_Night_Bonfire_-_geograph.org.uk_-_1394886.jpg","page_title":"Eleventh Night","context_page_description":"In Northern Ireland, the Eleventh Night or 11th Night refers to the night before the Twelfth of July, a yearly Ulster Protestant celebration. On this night, large towering bonfires are lit in many Protestant/loyalist neighbourhoods in Northern Ireland and are often accompanied by street parties and loyalist marching bands. The bonfires are mostly made up of wooden pallets and tyres, with the Irish tricolour being burnt. The bonfires are lit to celebrate and victory of Protestant king William of Orange over Catholic king James II at the Battle of the Boyne, which began the Protestant Ascendancy in Ireland. The event has been condemned for displays of sectarian or ethnic hatred, anti-social behaviour, and for the damage and pollution caused by the fires. The flag of the Republic of Ireland, Irish nationalist/republican symbols, Catholic symbols, and effigies, are burnt on many bonfires. There have been attempts to make the event more family-friendly and environmentally-friendly. It is also known as \\"bonfire night\\", in common with other events in which bonfires are lit."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%BE%D8%A7%D9%86%DB%8C_%D9%BE%D8%AA_%D8%AF%DB%8C_%D8%AA%DB%8C%D8%AC%DB%8C_%D9%84%DA%91%D8%A7%D8%A6%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Afghan_royal_soldiers_of_the_Durrani_Empire.jpg","page_title":"پانی پت دی تیجی لڑائی","context_page_description":"ایہہ لڑائی احمد شاہ ابدالی والی کابل تے مرہٹےآں دے وچکار 1761ء چ ہوئی ۔ اوس ویلے تک مرہٹے ہندستان دے وڈے حصے نوں فتح کر چکے سن ۔ اینہاں دے سردار رگھوناتھ نے مغلاں نوں شکست دے کے دلی تے مل مار لئیا سی، فیر لہور تے قبضہ کر کے اٹک تک دا علاقہ فتح کر لئیا ۔ احمد شاہ ابدالی نے اپنے علاقے واپس لین لئی چوتھی وار برصغیر تے حملہ کیتا ۔ 14 جون 1761ء نوں پانی پت دے میدان چ گھمسان دا رن پئیا، جس چ مرہٹےآں نے شکست کھادی ۔ احمد شاہ ابدالی نے دلی پہنچ کے شہزادہ علی گوہر نوں مغلیہ سلطنت دے تخت تے بیٹھایا تے 2 مہینے بعد واپس پرت گئیا ۔ پانی پت دی تیجی لڑائی چ شکست دے مگروں موہٹےآں دی کمر ٹٹ گئی تے چھیتی ای مرہٹہ سلطنت وی زوال پزیر ہو گئی تے پنجاب تے اتلے ہندستان دے مسلماناں نں وی ہندو مرہٹےآں دے ظلماں تں نجات ملی ۔"},{"page_url":"https://fr.wikipedia.org/wiki/Citro%C3%ABn_ZX_Rallye-raid","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Zx_rr_ferte_vidame.jpg","page_title":"Citroën ZX Rallye-raid","context_page_description":"La Citroën ZX Rallye-Raid est un véhicule tout-terrain de classe T3 « prototype » construit par Citroën Sport pour courir en rallye-raid."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%87%AA%E6%B2%BB%E5%B8%82%E5%85%AC%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Montauk_IS223_jeh.jpg","page_title":"自治市公園","context_page_description":"自治市公園是美國紐約市布魯克林區西南部的一個社區，南到本森赫斯特，西南到灣脊區，西到日落公園，東北到肯辛頓，東到夫拉特布希，東南到米德伍德。\\n菠蘿園是以色列以外最大的猶太教正統派社區之一，是美國最大的猶太人集中地之一。由於哈西迪猶太教和哈雷迪猶太教家庭中的平均兒童數是6.72，菠蘿園正在經歷人口急劇增長。它是一個經濟多樣化的社區。"},{"page_url":"https://en.wikipedia.org/wiki/Ossie_Davis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Ossie_Davis_and_Ruby_Dee.jpg","page_title":"Ossie Davis","context_page_description":"Raiford Chatman \\"Ossie\\" Davis was an American film, television and Broadway actor, director, poet, playwright, author, and civil rights activist.\\nHe was married to Ruby Dee, with whom he frequently performed, until his death.\\nHe and his wife were named to the NAACP Image Awards Hall of Fame; were awarded the National Medal of Arts and were recipients of the Kennedy Center Honors. He was inducted into the American Theater Hall of Fame in 1994."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B2%D0%B8_%D0%A0%D0%B8%D0%BC%D1%81%D1%8C%D0%BA%D0%BE%D1%97_%D1%96%D0%BC%D0%BF%D0%B5%D1%80%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/%D0%9A%D0%BE%D0%BF%D1%82%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D0%B4%D0%B5%D0%BA%D1%81.jpg","page_title":"Мови Римської імперії","context_page_description":"Латинська та грецька мови були офіційними мовами Римської імперії, але інші мови мали важливе значення на регіональному рівні. Латинська мова була мовою римлян і залишалася мовою імперської адміністрації, законодавства та військових протягом усього класичного періоду. На Заході вона стала lingua franca і стала використовуватись навіть для місцевого управління, включаючи ведення судових справ. Зрештою, коли в 212 р. всі вільнонароджені мешканці Імперії були визнані громадянами, велика їх кількість не знали латині на високому рівні, хоча вони, як очікується, отримали принаймні базові знання, В ту епоху латинська мова залишається маркером «римлянства». Грецьке койне стало загальною мовою регіону Східного Середземномор'я та мовою дипломатичного спілкування на Сході, навіть за межами Імперії. Міжнародне використання грецької мови було однією з умов, які сприяли поширенню християнства, на що вказує, наприклад, написання Нового Завіту грецькою мовою у Біблії та використання її, а не латини, для вселенських соборів у Римській імперії. З розпадом Імперії на Східну і Західну Римську імперію, грецька мова стала домінуючою мовою у східній частині імперії — Візантії."},{"page_url":"https://it.wikipedia.org/wiki/Travem%C3%BCnder_Woche","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Tornadokils.jpg","page_title":"Travemünder Woche","context_page_description":"Il Travemünder Woche è la seconda maggiore settimana velica in Germania. Si tiene dal 1892 dalla fine di luglio al resort di Travemünde nella baia di Lubecca nel mar Baltico.\\nNel 2007 ci sono stati circa 3000 velisti partecipanti a 118 regate con più di 800 imbarcazioni."},{"page_url":"https://it.wikipedia.org/wiki/Karel_Doorman","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/HNLMS_De_Ruyter.jpg","page_title":"Karel Doorman","context_page_description":"Karel Willem Frederik Marie Doorman è stato un ammiraglio e militare olandese durante la seconda guerra mondiale che fu comandante della squadra navale interalleata dell'ABDACOM durante la campagna delle Indie orientali olandesi innalzando la sua insegna sull'incrociatore leggero Hr. Ms. De Ruyter. Il 5 maggio 1942 fu insignito, postumo, del titolo di Ufficiale dell'Ordine militare di Guglielmo.\\nTale onorificenza gli era stata concessa il 23 maggio 1947 dall'allora Comandante della marina olandese Tenente-ammiraglio C.E.L. Helfrich, e consegnata al figlio maggiore nel corso di una cerimonia tenutasi a bordo della portaerei Karel Doorman alla presenza del principe consorte Bernardo. In suo onore la Koninklijke Marine varò numerose navi chiamate HNLMS Karel Doorman."},{"page_url":"https://id.wikipedia.org/wiki/Penghormatan_orang_yang_telah_meninggal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Sarcophagus_death_of_Meleager_Louvre_Ma539.jpg","page_title":"Penghormatan orang yang telah meninggal","context_page_description":"Penghormatan orang yang telah meninggal atau venerasi orang yang telah meninggal, termasuk pada leluhur, didasarkan kecintaan dan rasa hormat kepada orang yang telah meninggal dunia. Dalam beberapa budaya, hal ini berkaitan dengan keyakinan dan kepercayaan bahwa mereka yang telah meninggal memiliki kehidupan yang berkelanjutan, serta mungkin memiliki kemampuan untuk mempengaruhi keberuntungan mereka yang masih hidup di dunia. Beberapa kelompok menghormati nenek moyangnya sendiri yang masih kerabatnya; beberapa komunitas agama atau kepercayaan, terutama Gereja Katolik, menghormati orang-orang suci sebagai perantara dengan Allah, serta berdoa bagi jiwa-jiwa yang telah meninggal yang berada di purgatorium.\\nDalam budaya Eropa, Asia, dan Oseania, serta beberapa budaya Afrika dan Afro-Amerika, tujuan penghormatan nenek moyang adalah memastikan kesejahteraan nenek moyang secara berkelanjutan dan kecenderungan positif atas mereka yang masih hidup di dunia, dan terkadang untuk dimintakan pertolongan atau bantuan khusus."},{"page_url":"https://sv.wikipedia.org/wiki/Skonert","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Schooner_%27Thomas_W._Lawson%27_1902-1907a.jpg","page_title":"Skonert","context_page_description":"Skonert, även kallad skonare, är ett fartyg med två eller fler master, med stormasten som andra mast, riggat helt eller i huvudsak med snedsegel. Benämningen skonert används i första hand om skonare med råsegelriggad fockmast. Bland traditionella fartygstyper är skonarna de bästa seglarna på bidevind och kryss.\\nDen ursprungliga skonerten var ett mindre tvåmastat fartyg med gaffelsegel på båda masterna, försegel och eventuellt gaffeltoppsegel. Senare har många andra typer förekommit, med varierande riggning och upp till sju master. På nutida skonare kan gaffel- och toppsegel på den aktre masten vara ersatta med ett bermudasegel.\\nSkonarna utvecklades först i Nederländerna på 1600- och 1700-talen. Namnet är dock från USA, där det första fartyg kallat så lär ha byggts 1713 och där riggen blev mycket vanlig. Skonarriggen är effektiv för bidevind och halvvind och rätt lätthanterad på mindre fartyg. Skonare användes främst i kust-, flod- och insjöfart.\\nI slutet av 1800-talet, och tills maskindrivna fartyg helt tog över, var tremastade barkentiner och slätskonare vanliga också i östersjö- och nordsjötrafik."},{"page_url":"https://it.wikipedia.org/wiki/Rainer_Maria_Rilke","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Rilke_in_Moscow_by_L.Pasternak_%281928%29.jpg","page_title":"Rainer Maria Rilke","context_page_description":"Rainer Maria Rilke, nome completo René Karl Wilhelm Johann Josef Maria Rilke, è stato uno scrittore, poeta e drammaturgo austriaco di origine boema.\\nÈ considerato uno dei più importanti poeti di lingua tedesca del XX secolo. Autore di opere sia in prosa che in poesia, è famoso soprattutto per le Elegie duinesi, i Sonetti a Orfeo e I quaderni di Malte Laurids Brigge."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B1%D8%A7%D9%83%D9%8A%D8%A8_%D8%AD%D9%8A%D8%A7%D9%83%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/8%D8%AD%D9%8A%D8%A7%D9%83%D8%A9%D8%AD%D8%B3%D8%A7%D9%85_%D9%87%D8%B7%D9%84%D8%A7%D9%86%D9%8A.jpg","page_title":"تراكيب حياكة","context_page_description":"أقمشة التريكو هي التي يمكن تصنيعها عن طريق تكوين غرز من خيط واحد أو من عدة خيوط تتداخل مع الغرز المكونة من قبل مكونة تركيب نسجي متصل له خواص فيزيائية وميكانيكية مختلفة عن الأقمشة المنسوجة وتعرف الغرز العرضية باسم courses بينما تعرف الغرز الطولية باسم wales ويمكن تصنيف هذه الأقمشة إلى نوعين أساسيين وهما أقمشة تريكو اللحمة ‏ وأقمشة تريكو السداء ‏، التراكيب النسجية لأقمشة تريكو اللحمة ‏ هو وصف لطريقة تعاشق خيوط عرضية تسمى خيوط اللحمة لتشكل قماشًا منسوجًا. إن تراكيب الحياكة الرئيسية هي الجرسيه ‏ والريب ‏ والإنترلوك وذو الغرزة المعكوسة وذو الغرزة الوبرية، الكارديجان ونصف الكارديجان."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B8%D1%85%D0%BE%D0%BD%D0%B5%D0%BD%D0%BA%D0%BE,_%D0%9A%D1%81%D0%B5%D0%BD%D0%B8%D1%8F_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Ksenia_Tikhonenko_2.jpg","page_title":"Тихоненко, Ксения Борисовна","context_page_description":"Ксе́ния Бори́совна Тихоне́нко — российская профессиональная баскетболистка, выступающая за клуб «Надежда». Играет на позиции центровой, а также тяжёлого форварда. Серебряный призёр чемпионата Европы по баскетболу среди девушек до 20 лет, самый ценный игрок этого турнира. Является мастером спорта по баскетболу."},{"page_url":"https://eu.wikipedia.org/wiki/Saint-Paul-en-Pareds","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Eglise_de_Saint_Paul-en-Pareds.jpg","page_title":"Saint-Paul-en-Pareds","context_page_description":"Saint-Paul-en-Pareds Frantziako udalerri bat da, Vendée departamenduan dagoena, Pays de la Loire eskualdean. 2013an 1.123 biztanle zituen."},{"page_url":"https://nl.wikipedia.org/wiki/Grafheuvels_in_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Zicht_op_een_grafheuvel_uit_het_Neoliticum_of_de_Bronstijd_op_de_Ginkelse_heide_met_wandelpaaltje%2C--Archeoregio_2_-_Ede_-_20425893_-_RCE.jpg","page_title":"Grafheuvels in Nederland","context_page_description":"De grafheuvels in Nederland zijn afkomstig uit zeer verschillende periodes, van de late steentijd tot de Romeinse tijd. Ook in meer recentere jaren zijn grafheuvels opgeworpen, deze vallen echter buiten deze beschouwing."},{"page_url":"https://ca.wikipedia.org/wiki/Tadao_Ando","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Church_of_Light.JPG","page_title":"Tadao Ando","context_page_description":"Tadao Ando. Arquitecte mitjançant l'autoaprenentatge. Els seus viatges conjuntament amb nombroses lectures li han atorgat els coneixements necessaris del seu ofici. Va visitar edificis dissenyats per famosos arquitectes com Le Corbusier, Mies van der Rohe, Frank Lloyd Wright i Louis Kahn abans de tornar a Osaka per fundar l'any 1968 el seu estudi: Tadao Ando Architects & Associates.\\nClassificat per Francesco Dal Co dins del corrent anomenat regionalisme crític. Rebutja la utilització indiscriminada de l'arquitectura moderna a les diferents cultures del món. La seva obra combina formes actuals i materials contemporanis amb principis estètics i espacials tradicionals japonesos, destacant en la integració dels edificis dins del seu entorn natural. Empra el formigó llis, on resten les empremtes visibles de l'encofrat, per crear plans murals tectònics que serveixen com a superfícies per capturar la llum.\\nEn els seus dissenys Ando rebutja el materialisme consumista de la societat actual visible en moltes obres arquitectòniques."},{"page_url":"https://fr.wikipedia.org/wiki/Alexe%C3%AF_A%C3%AFgui","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Aigui_Alexei_life.jpg","page_title":"Alexeï Aïgui","context_page_description":"Alexeï Guennadievitch Aïgui, né le 11 juillet 1971 à Moscou, est un compositeur et violoniste, chef de l'Ensemble 4'33\\"."},{"page_url":"https://ceb.wikipedia.org/wiki/Court_(lungsod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Court_BE_CH.jpg","page_title":"Court (lungsod)","context_page_description":"Lungsod ang Court sa Nasod nga Swiss. Nahimutang ni sa distrito sa Jura bernois ug kanton sa Canton de Berne, sa sentro nga bahin sa nasod, 30 km sa amihanan sa Bern ang ulohan sa nasod. 667 metros ibabaw sa dagat kahaboga ang nahimutangan sa Court, ug adunay 1,328 ka molupyo.\\nAng yuta palibot sa Court kay kasagaran kabungtoran, apan sa habagatang-sidlakan nga kini mao ang kabukiran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,172 ka metro ug 1.5 km sa habagatan-sidlakan sa Court. Dunay mga 248 ka tawo kada kilometro kwadrado sa palibot sa Court medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Biel/Bienne, 13.3 km sa habagatan-kasadpan sa Court. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Court. Sa rehiyon palibot sa Court, kabukiran, ug mga bungtod talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -4 °C. Ang kasarangang pag-ulan 1,618 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 189 milimetro nga ulan, ug ang kinaugahan Marso, sa 67 milimetro."},{"page_url":"https://it.wikipedia.org/wiki/Gary_Kagelmacher","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Gary_Kagelmacher%2C_Valenciennes_FC.JPG","page_title":"Gary Kagelmacher","context_page_description":"Gary Christofer Kagelmacher Pérez è un calciatore uruguaiano con passaporto tedesco, difensore del Peñarol."},{"page_url":"https://en.wikipedia.org/wiki/Avro_549_Aldershot","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Avro_Aldershot.jpg","page_title":"Avro 549 Aldershot","context_page_description":"The Avro 549 Aldershot was a British single-engined bomber aircraft built by Avro."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%B1%D9%8A%D8%A7%D9%86_%D8%B1%D9%8A%D9%86%D9%88%D9%84%D8%AF%D8%B2_(%D8%B5%D8%AD%D9%81%D9%89)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Fractalicious%2C_Rehearsal_San_Diego%2C_Oct_2012.jpg","page_title":"بريان رينولدز (صحفى)","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبريان رينولدز صحفى من امريكا."},{"page_url":"https://de.wikipedia.org/wiki/Dieter_Gantz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Das_Rad_Marzahn.jpg","page_title":"Dieter Gantz","context_page_description":"Dieter Gantz war ein deutscher Maler, Grafiker und Professor."},{"page_url":"https://en.wikipedia.org/wiki/Takifugu_xanthopterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Naturalis_Biodiversity_Center_-_RMNH.ART.172_-_Takifugu_xanthopterus_%28Temminck_and_Schlegel%29_-_Kawahara_Keiga_-_1823_-_1829_-_Siebold_Collection_-_pencil_drawing_-_water_colour.jpeg","page_title":"Takifugu xanthopterus","context_page_description":"Takifugu xanthopterus is a species of fish in the family Tetraodontidae. It is found in Hong Kong, Japan, and Taiwan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Pirmasens-Kernstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Pirmasens-Pettenkoferstr._10-Altersheim-ehemaliges_Krankenhaus-04-gje.jpg","page_title":"Liste der Kulturdenkmäler in Pirmasens-Kernstadt","context_page_description":"In der Liste der Kulturdenkmäler in Pirmasens sind alle Kulturdenkmäler in der rheinland-pfälzischen Stadt Pirmasens aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://en.wikipedia.org/wiki/Rudolf_Nureyev","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Fontyn_Astaire_Nureyev_Hollywood_Palace_1965.jpg","page_title":"Rudolf Nureyev","context_page_description":"Rudolf Khametovich Nureyev was a Soviet ballet dancer and choreographer. Nureyev is regarded by some as the greatest male ballet dancer of his generation.\\nNureyev was born on a Trans-Siberian train near Irkutsk, Siberia, Soviet Union to a Bashkir-Tatar family. He began his early career with the company that in the Soviet era was called the Kirov Ballet in Leningrad. He defected from the Soviet Union to the West in 1961, despite KGB efforts to stop him. This was the first defection of a Soviet artist during the Cold War, and it created an international sensation. He went on to dance with The Royal Ballet in London and from 1983 to 1989 served as director of the Paris Opera Ballet. In addition to his technical prowess, Nureyev was an accomplished choreographer serving as the chief choreographer of the Paris Opera Ballet. He produced his own interpretations of numerous classical works, including Swan Lake, Giselle, and La Bayadère."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%A0%D0%B8%D0%BB%D1%94%D1%94%D0%B2%D0%B0_(%D0%9A%D0%B8%D1%97%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/%D0%9A%D0%B8%D1%97%D0%B2._%D0%92%D1%83%D0%BB%D0%B8%D1%86%D1%8F_%D0%A0%D0%B8%D0%BB%D0%B5%D1%94%D0%B2%D0%B0._%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D1%96_%D0%B6%D0%B5%D1%80%D1%82%D0%B2_%D0%93%D0%BE%D0%BB%D0%BE%D0%B4%D0%BE%D0%BC%D0%BE%D1%80%D1%83_1932%E2%80%941933_%D1%80%D0%BE%D0%BA%D1%96%D0%B2.jpg","page_title":"Вулиця Рилєєва (Київ)","context_page_description":"Ву́лиця Рилє́єва — вулиця в Подільському районі міста Києва, місцевості Куренівка, Сирець. Пролягає від Кирилівської вулиці до Петропавлівської вулиці.\\nПрилучаються вулиця Копилівська, провулок Рилєєва, Захарівська, провулки Веселковий та Артезіанський, вулиці Шполянська та Верболозна."},{"page_url":"https://ca.wikipedia.org/wiki/Disc_Zip","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Zip-100a.jpg","page_title":"Disc Zip","context_page_description":"La unitat Iomega Zip, anomenada també unitat Zip, és un perifèric d'emmagatzematge, que utilitza discs Zip com a suport d'emmagatzematge; aquests suports són de tipus magnètic, extraïbles de mitjana capacitat, llançada per Iomega el 1994. La primera versió tenia una capacitat de 100 megabyte, però versions posteriors ho van ampliar a 250 i 750 MB.\\nEs va convertir en el més popular candidat a succeir el disquet de 3,5 polzades, seguit pel SuperDisk. Encara que mai va aconseguir-ho, va substituir a la majoria de mitjans extraïbles com els SyQuest i va robar part del terreny del disc magneto-òptic en ser integrat de sèrie en diverses configuracions de portàtils i Apple Macintosh. La caiguda de preus de gravadores i consumibles CD-R i CD-RW i, sobretot dels pendrives i les targetes flash, van acabar per treure'l del mercat i de l'ús quotidià.\\nEn un intent de retenir part del mercat que perdia, Iomega comercialitzar sota la marca Zip, una sèrie de gravadores de CD, conegudes com a Zip-650 o Zip-CD."},{"page_url":"https://hu.wikipedia.org/wiki/Petite-Rosselle","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Population_-_Municipality_code_57537.svg","page_title":"Petite-Rosselle","context_page_description":"Petite-Rosselle település Franciaországban, Moselle megyében. Petite-Rosselle Forbach községekkel határos."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Frankfurt-Nordend_(L%E2%80%93Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Frankfurt%2C_Lersnerstra%C3%9Fe_36.jpg","page_title":"Liste der Kulturdenkmäler in Frankfurt-Nordend (L–Z)","context_page_description":"In der Liste der Kulturdenkmäler in Frankfurt-Nordend sind alle Kulturdenkmäler im Sinne des Hessischen Denkmalschutzgesetzes in Frankfurt-Nordend, einem Stadtteil von Frankfurt am Main aufgelistet. Aufgrund der Größe ist die Liste in drei Teillisten aufgeteilt.\\nGrundlage ist die Denkmaltopographie aus dem Jahre 1994, die zuletzt 2000 durch einen Nachtragsband ergänzt wurde. In der Denkmaltopographie überwiegend abgekürzte Namen von Architekten, Baumeistern und Künstlern sind, soweit möglich, nach der unter dem Abschnitt Werke zu Architekten und Künstlern genannten Literatur aufgelöst. Kursiv dargestellt sind nicht auf der Literatur beruhende Zusatzangaben."},{"page_url":"https://sco.wikipedia.org/wiki/28_November","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Flag_of_Albania.svg","page_title":"28 November","context_page_description":"The 28t o November is the 332t day o the year in the Gregorian Calendar, wi 33 days bidin."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D9%8A%D8%A7%D9%86_%D8%A8%D9%88%D8%B3%D9%88%D8%B1%D8%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Brian_Bosworth.jpg","page_title":"برايان بوسورث","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبرايان بوسورث ممثل من امريكا."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B1%D0%B0%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/Habas_-_Mairie.jpg","page_title":"Абас","context_page_description":"Аба́с — муніципалітет у Франції, у регіоні Нова Аквітанія, департамент Ланди. Населення — 1438 осіб.\\nМуніципалітет розташований на відстані близько 640 км на південний захід від Парижа, 145 км на південь від Бордо, 50 км на південний захід від Мон-де-Марсана."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BB%8A%E6%B4%A5%E8%BB%8A%E7%AB%99_(%E5%85%B5%E5%BA%AB%E7%B8%A3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Hankyu_Imazu_Station_platform_-_panoramio_%283%29.jpg","page_title":"今津車站 (兵庫縣)","context_page_description":"今津車站位於兵庫縣西宮市，是阪神電氣鐵道及阪急電鐵的鐵路車站。阪急的車站編號為HK-21，阪神則是HS 16。阪神本線和今津線可在此換乘，本站為今津線的始發車站。"},{"page_url":"https://it.wikipedia.org/wiki/Stazione_di_Varedo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Varedo_FN_Train_Station.JPG","page_title":"Stazione di Varedo","context_page_description":"La stazione di Varedo è la stazione ferroviaria situata lungo la ferrovia Milano-Asso e ubicata nel comune di Varedo. È gestita da FerrovieNord."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%8A%AF%E7%BD%AA%E6%8D%9C%E6%9F%BB%E5%AE%98%E3%83%8D%E3%82%A4%E3%83%93%E3%83%BC%E3%83%95%E3%82%A1%E3%82%A4%E3%83%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/RADM_Donald_Guter%2C_JAGC%2C_USN_visited_the_JAG_television_series_set%2C_2001-02-20.jpg","page_title":"犯罪捜査官ネイビーファイル","context_page_description":"『犯罪捜査官ネイビーファイル』は、アメリカのパラマウント・ピクチャーズ製作により、1995年から2005年までCBSネットワークで放送された連続テレビドラマである。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD%D1%82%D0%B5%D1%80%D1%82%D0%B0%D1%83%D0%BD_(%D0%9A%D0%B5%D0%BD%D1%82%D0%B0%D0%BA%D0%B8)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/KYMap-doton-Centertown.PNG","page_title":"Сентертаун (Кентаки)","context_page_description":"Сентертаун град је у америчкој савезној држави Кентаки."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AD%A6%E6%B1%89%E5%B8%82%E4%BC%98%E7%A7%80%E5%8E%86%E5%8F%B2%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/%E5%8E%9F%E6%B1%9F%E6%B1%89%E8%B7%AF%E6%97%B6%E4%BB%A3%E9%92%9F%E8%A1%A8.JPG","page_title":"武汉市优秀历史建筑列表","context_page_description":"1993年，武汉市市政府首批公布了102处优秀历史建筑。截止2013年12月，武汉市已经公布了8批优秀历史建筑，总共有优秀历史建筑209处，分布在武汉市7个中心城区内。其中已有6处被拆毁，54处升级为省市级文物保护单位 。2003年4月，《武汉市旧城风貌区和优秀历史建筑保护管理办法》颁布实施，对武汉市优秀历史建筑的确认、安全、使用、修缮等方面以政府令的形式做出明确规定。武汉市住房保障和房屋管理局负责对该市优秀历史建筑的安全、使用、修缮的日常监督管理。2014年8月，武汉市房管局推出优秀历史建筑保护图则，颁发给20多处建筑的相关产权人、使用人代表，使得优秀历史建筑的保护更加规范。武汉市民用建筑设计研究院定做了首批保护图则。\\n1993年，第一批共102处，其中一级建筑14处，二级建筑88处 。\\n2005年2月21日，第二批共16处，其中一级建筑3处，二级建筑13处。\\n2006年8月12日，第三批共20处，其中一级建筑3处，二级建筑17处 。\\n2007年3月9日，第四批共16处，其中二级建筑16处。\\n2010年12月16日，第五批共15处，其中一级建筑14处，二级建筑1处 。\\n2012年1月31日，第六批共12处，其中一级建筑1处，二级建筑11处 。\\n2012年11月23日，第七批共20处，其中一级建筑12处，二级建筑8处 。\\n2013年12月26日，第八批共8处，其中一级建筑7处，二级建筑1处 。"},{"page_url":"https://bs.wikipedia.org/wiki/Beli%C5%A1%C4%87e","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Beli%C5%A1%C4%87e_5.jpg","page_title":"Belišće","context_page_description":"Belišće je grad u Hrvatskoj, u Osječko-baranjskoj županiji."},{"page_url":"https://bs.wikipedia.org/wiki/Sablja","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Imperial_Armoury_Topkapi_Istanbul_%287%29.JPG","page_title":"Sablja","context_page_description":"Sablja je naziv za hladno oružje slično maču koje ima zakrivljenu oštricu. Sablja je nastala kao oružje konjice kod evroazijskih naroda stepe. Na Balkan je dospjela na samom početku osmanlijskih osvajanja. Sablja je jedno od rijetkih dugih hladnih oružja iz Srednjeg vijeka koje se zadržala sve do današnjih dana u brojnim armijama kao paradno oružje. Jedan od najranijih prikaza sablje predstavlja kompozicije ratnika na freskama u manastiru Lesnovo 1341. godine, u današnjoj Republici Makedoniji. Prikazana je također i na fresci ratnika u manastiru Manasija iz 1418. godine kao i na stećcima u Tobutu s kraja 16. i početka 17. vijeka. Jedna od reprezentivnijih ručno rađenih i dekoriranih starih sablji čuva se danas na odsjeku za metal i nakit Muzeja primijenjene umjetnosti u Beogradu a datirana je u vrijeme osvajanja sultana Sulejmana Beograda 1521. godine."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B8%D1%97%D0%B2_(%D0%B5%D0%BD%D1%86%D0%B8%D0%BA%D0%BB%D0%BE%D0%BF%D0%B5%D0%B4%D0%B8%D1%87%D0%BD%D0%B8%D0%B9_%D0%B4%D0%BE%D0%B2%D1%96%D0%B4%D0%BD%D0%B8%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Encyclopedic_Reference_Kiev_1986_ru.jpg","page_title":"Київ (енциклопедичний довідник)","context_page_description":"Енциклопедичний довідник «Київ» — перший універсальний енциклопедичний довідник про Київ видання Головної редакції Української радянської енциклопедії за редакцією Анатолія Кудрицького. Виданий 1981 року українською мовою; 1982 року — перше видання російською мовою, 1985 та 1986 років — друге видання, 1986 року — третє видання."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Kempfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Kempfeld%2C_Evangelische_Kirche_P1070296c.jpg","page_title":"Liste der Kulturdenkmäler in Kempfeld","context_page_description":"In der Liste der Kulturdenkmäler in Kempfeld sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Kempfeld einschließlich des Ortsteils Katzenloch aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://fr.wikipedia.org/wiki/Saborsko","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Saborsko%2C_Croatia.JPG","page_title":"Saborsko","context_page_description":"Saborsko est un village et une municipalité située dans le comitat de Karlovac, en Croatie. Au recensement de 2001, la municipalité comptait 860 habitants, dont 78,49 % de Croates et 19,19 % de Serbes ; le village seul comptait 666 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Universit%C3%A9_de_l%27Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Iowa_Hall.JPG","page_title":"Université de l'Iowa","context_page_description":"L'université de l'Iowa est un centre de recherche universitaire américain majeur située dans un campus à Iowa City, sur la rivière Iowa, près du croisement des routes fédérales 80 et 380. L'Iowa comprend onze facultés, la plus grande étant le College of Liberal Arts and Sciences.\\nDans le domaine sportif, les Iowa Hawkeyes défendent les couleurs de l'université de l'Iowa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BB%D0%B0%D0%B7%D1%83%D0%BD%D0%BE%D0%B2,_%D0%98%D0%B2%D0%B0%D0%BD_%D0%98%D0%BB%D1%8C%D0%B8%D1%87_(1826)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Ivan_Khrutsky._Portrait_of_I._I._Glazunov._1843._The_Art_Museum_of_Belarus%2C_Minsk..JPG","page_title":"Глазунов, Иван Ильич (1826)","context_page_description":"Иван Ильич Глазунов — тайный советник, издатель и книготорговец; Санкт-Петербургский городской голова."},{"page_url":"https://en.wikipedia.org/wiki/English_cricket_team_in_Australia_in_1932%E2%80%9333","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/StateLibQld_1_101384.jpg","page_title":"English cricket team in Australia in 1932–33","context_page_description":"A cricket team representing England toured Australia in the 1932–33 season. The tour was organised by the Marylebone Cricket Club and matches outside the Tests were played under the MCC name. The tour included five Test matches in Australia, and England won The Ashes by four games to one. The tour was highly controversial because of the bodyline bowling tactics used by the England team under the captaincy of Douglas Jardine. After the Australian tour was over, the MCC team moved on to play in New Zealand, where two further Test matches were played."},{"page_url":"https://de.wikipedia.org/wiki/Exerzitienzentrum_der_G%C3%B6ttlichen_Barmherzigkeit_f%C3%BCr_die_Reevangelisation","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/St._Clemens_Berlin_innen.JPG","page_title":"Exerzitienzentrum der Göttlichen Barmherzigkeit für die Reevangelisation","context_page_description":"Das Exerzitienzentrum der Göttlichen Barmherzigkeit für die Reevangelisation ist ein Exerzitienzentrum der Römisch-katholischen Kirche in der Stresemannstraße 66 im Berliner Ortsteil Kreuzberg. Es wurde am 15. März 2008 von Erzbischof Georg Kardinal Sterzinsky im Rahmen eines Pontifikalamtes neu begründet und wird von vier Patres der Vinzentinerkongregation aus Cochin im Bundesstaat Kerala und einem privaten Förderverein betrieben."},{"page_url":"https://en.wikipedia.org/wiki/Episcopal_Church_of_the_Good_Shepard-Lakota","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Episcopal_Church_of_The_Good_Shepherd_-_Lakota2_NRHP_100001743_Nelson_County%2C_ND.jpg","page_title":"Episcopal Church of the Good Shepard-Lakota","context_page_description":"The Episcopal Church of the Good Shepard-Lakota was listed on the National Register of Historic Places in 2017.\\nIt was bought in 2015 by Steve Martens, a retired architecture professor of North Dakota State University.\\nIt was then renovated over a nine-month period and serves as a vacation home for two couples."},{"page_url":"https://da.wikipedia.org/wiki/Mia_Hamm","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Mia_Hamm_signing_an_autograph.jpg","page_title":"Mia Hamm","context_page_description":"Mariel Margaret 'Mia' Hamm er en tidligere professionel amerikansk fodboldspiller. Hamm spillede mange år som angriber for det amerikanske landshold og var en af grundlæggerne af fodboldklubben Washington Freedom. Hamm har scoret flere internationale mål i sin karriere en nogen anden spiller, både hos mænd og kvinder. Hun er den spiller der har spillet næstflest internationale kampe."},{"page_url":"https://uz.wikipedia.org/wiki/Islomobod","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Islamabad_skyline.jpg","page_title":"Islomobod","context_page_description":"Islomobod — Pokistonning poytaxti, mamlakatning shimoli-sharqida, Himolay togʻlari etagida, Potvar platosidagi vodiyda, 550 m balandlikda joylashgan. Iqlim sharoiti juda qulay, iyulda eng yuqori temperatura 39°, yanvar da eng past temperatura 3°.\\nIslomobod maʼmuriy jihatdan markaziy hukumat tomonidan boshqariladigan federal poytaxt okrugi. Aholisi 529,2 ming kishi. Transport yoʻllari tuguni. Xalqaro aeroport bor. Oziqovqat, yengil sanoat korxonalari mavjud. Hunarmandchilik rivojlangan. Islomobodni qurish toʻgʻrisidagi qaror 1959 yilda qabul qilingan. Shaharni qurish 1961 yildan, avval poytaxt boʻlib turgan Ravalpindi sh.dan 28 km narida boshlandi. Islomobod mahalliy meʼmoriy xu-susiyatlar bilan uygʻunlashtirilgan holda qoz. zamon Yevropa shaharlari uslubida qurilgan. Shaqar muntazam rejaga ega va zonalarga boʻlingan. I.da Atom energiyasi instituti, Islomshunoslik instituti, Milliy kutubxona bor."},{"page_url":"https://pt.wikipedia.org/wiki/Alaska_Railroad","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Alaska_Railroad_Denali_station.jpg","page_title":"Alaska Railroad","context_page_description":"A Alaska Railroad é uma empresa ferroviária dos Estados Unidos operante no Alasca."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_d%27Abancourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Gare_d%27Abancourt_-_B%C3%A2timent_voyageurs_-_WP_20181110_14_08_58_Pro.jpg","page_title":"Gare d'Abancourt","context_page_description":"La gare d'Abancourt est une gare ferroviaire française de la ligne d'Épinay - Villetaneuse au Tréport - Mers et de la ligne de Saint-Roch à Darnétal-Bifurcation, située sur le territoire de la commune d'Abancourt, dans le département de l'Oise, en région Hauts-de-France.\\nElle est mise en service en 1867 par la Compagnie des chemins de fer du Nord. C'est une gare de la Société nationale des chemins de fer français, desservie par des trains TER Hauts-de-France."},{"page_url":"https://fr.wikipedia.org/wiki/Bundestag","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Bundestag-9-1980.png","page_title":"Bundestag","context_page_description":"Le Bundestag [bundɛstaɡ] est l’assemblée parlementaire de la République fédérale d'Allemagne assurant la représentation du peuple allemand dans son ensemble. Établi par la Loi fondamentale de 1949 comme successeur du Reichstag, il siège depuis 1999 à Berlin, et est présidé par le chrétien-démocrate Wolfgang Schäuble, en poste depuis le 24 octobre 2017. Il élit le chancelier fédéral, qui est le chef de gouvernement allemand. Il est élu lors des élections législatives fédérales allemandes."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D1%86%D0%B8%D0%BC%D0%B5%D0%BD%D0%B5%D0%B2,_%D0%AE%D1%80%D0%B8%D0%B9_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Stamp_of_Moldova_293.jpg","page_title":"Арцименев, Юрий Николаевич","context_page_description":"Арцименев Ю́рий Никола́евич — российский художник-миниатюрист, автор более 200 советских и российских почтовых марок, более 500 конвертов и односторонних почтовых карточек с оригинальной маркой, а также первых марок некоторых постсоветских республик. Художник Издательско-торгового центра «Марка»."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B6%D5%BF%D5%AB%D5%B8%D6%84%D5%AB_%D5%A4%D6%84%D5%BD%D5%B8%D6%82%D5%A9%D5%B5%D5%B8%D6%82%D5%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Anatolian_Seljuk_Sultanate.JPG","page_title":"Անտիոքի դքսություն","context_page_description":"Անտիոքի դքսություն, միջնադարյան պետություն հյուսիսարևմտային Սիրիայում 1098-1268 թվականներին։ Հիմնադրել է Բոհեմունդ Տարենտցին 1098 թվականին՝ խաչակրաց առաջին արշավանքի ժամանակ։ Երկիրը կառավարել են ֆրանսիական ու նորմանդական ծագում ունեցող ազնվական ընտանիքներ։ Տարածքը կազմել է առավելագույնը 20 000 քառ. կմ՝ Բոհեմունդ II կոմսի օրոք ։\\nՊետության մայրաքաղաքն էր վաճառաշահ Անտիոք քաղաքը, որը հարևան գյուղերի ու բերդերի հետ միասին ուներ 30 000 բնակիչ։ Հզորության շրջանում, երբ դեռ չէր գրավվել Եդեսիայի կոմսությունը, Անտիոքի դուքսերը նրա ավատատերերն էին։ 1163 թվականից գերիշխանությունը տարածվում է նաև Տրիպոլիի կոմսության վրա։ Երբեմն Անտիոքի դքսությունը ենթարկվում էր հարևան ազդեցիկ պետությունների՝ Բյուզանդական կայսրության, Երուսաղեմի թագավորության և Կիլիկիայի հայկական թագավորության ենթակայության տակ։\\n1268 թվականի Անտիոքի անկումից հետո տիրույթների մեծ մասն անցնում է Մամլուքների սուլթանությանը, մամլուքների սուլթան Բեյբարս I-ի կողմից այն գրավելուց հետո և դադարում է գոլություն ունենալ, սակայն «Անտիոքի կոմս» տիտղոսը շարունակում էին կրել Տրիպոլիի կոմսերը, մինչ նրա գրավումը 1287 թվականին։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BC%D0%BF%D0%B5%D1%80%D0%B0%D1%82%D0%BE%D1%80_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB_I_(%D0%B1%D1%80%D0%BE%D0%BD%D0%B5%D0%BD%D0%BE%D1%81%D0%B5%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Imperator_Pavel_battleship.jpg","page_title":"Император Павел I (броненосец)","context_page_description":"«Император Павел I» — русский броненосец."},{"page_url":"https://hu.wikipedia.org/wiki/J%C3%BAlia-borbolya","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Berberis_julianae_HRM.jpg","page_title":"Júlia-borbolya","context_page_description":"A Júlia-borbolya a boglárkavirágúak rendjébe sorolt borbolyafélék családjában a névadó borbolya nemzetség egyik faja."},{"page_url":"https://da.wikipedia.org/wiki/Husum_Slot","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/Husum_castle%2C_gate_house_0898.JPG","page_title":"Husum Slot","context_page_description":"Husum Slot er et slot i det nordlige Tyskland, bygget i nederlandsk renæssancestil i årene 1577-1582. Bygherren var den slesvigske hertug Adolf af Gottorp.\\nDet trefløjede slot blev opført på et område, hvor franciskanere i 1400-tallet havde opført et kloster, og som dengang ikke var del af byen Husum. Slottet er forsynet med tre tårne og flere spir. Forbilledet var Frederik 2.s Frederiksborg Slot i Hillerød, og dets udseende kendes fra en gengivelse i Den Danske Vitruvius.\\nI 1600-tallet benyttedes slottet fortrinsvis som enkesæde for gottorpske hertuginder. Hertuginde Augusta, datter af Frederik 2. af Danmark, gjorde slottet til et kulturelt center. Hun døde på slottet den 5. februar 1639.\\nEfter den Store Nordiske Krig kom slottet i år 1721 i dansk eje. Slottet var forfaldent, og Frederik 5. gennemførte en omfattende ombygning og forenkling i årene 1750-1752 ved Otto Johann Müller og Cay Dose. Ved ombygningen, hvorved der blev etableret en række repræsentative trapper og værelser på slottet, forsvandt de svungne gavle, der endnu kan ses på portbygningen. Midtertårnets spir blev rekonstrueret i 1970'erne ved den danske arkitekt Karsten Rønnow efter stikket i Thurahs Vitruvius."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_v%C3%BDznamn%C3%BDch_budov_a_dal%C5%A1%C3%ADch_objekt%C5%AF_na_Hanspaulce","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Mat%C4%9Bjsk%C3%A1_1985-19-02.jpg","page_title":"Seznam významných budov a dalších objektů na Hanspaulce","context_page_description":null},{"page_url":"https://de.wikipedia.org/wiki/Kirchhain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Kirchhain_Gillhof.jpg","page_title":"Kirchhain","context_page_description":"Kirchhain ist eine Stadt im mittelhessischen Landkreis Marburg-Biedenkopf. Sie liegt an den Flüssen Ohm, Wohra und Klein."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%81%D9%8A%D8%A7%D9%86%D9%83%D8%A7_%D8%A7%D9%84%D8%B1%D8%AD%D9%84%D8%A9_52","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/CrashAVA052.jpg","page_title":"أفيانكا الرحلة 52","context_page_description":"أفيانكا الرحلة 52 طائرة بوينغ 707-321B التابعة لأفيانكا المتجهة من بوغوتا إلي نيويورك عبر ميديلين في 25 يناير 1990 وبينما كانت طائرة أفيانكا تقترب للهبوط في نيويورك في ليلة عاصفة قرر المراقبين الجويين في مطار جون إف كينيدي الدولي وحول مسارها للانتظار عدة مرات وبعد ساعتين ونصف منحت الطائرة الكولومبية الإذن للهبوط ولكن وقود الطائرة كان سيكفي لنصف ساعة فقرر الطيارين الكولومبيون البحث عن المدرج 33 يمين للمطار الأمريكي ولكن بسبب الطقس السئ كان الأمر صعبا حين ضربتها رياح قاسية منحرفة وحينها بدأ وقود الطائرة بالنفاذ بسرعة وسقطت الطائرة في كوف نيك بمدينة نيويورك قرب الباحة الخلفية لمنزل سام تاسينبايم وأتصلت زوجته برقم الطوارئ للإبلاغ عن تحطم طائرة في الباحة الخلفية لمنزلهم وبعد 35 دقيقة من التحطم وصل المسعفون ورجال الإطفاء للبحث عن ناجين وإطفاء النيران ولحسن الحظ لم يكن هناك نيران وقد وجد رجال الطوارئ 85 ناجي و73 قتيلا من بينهم الطيارين الثلاثة وقد جرح جميع الناجون البالغ عددهم 85 شخصا."},{"page_url":"https://uk.wikipedia.org/wiki/MAGI2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/PBB_GE_MAGI2_207702_s_at_fs.png","page_title":"MAGI2","context_page_description":"MAGI2 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 7-ї хромосоми. Довжина поліпептидного ланцюга білка становить 1 455 амінокислот, а молекулярна маса — 158 754.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як нейрогенез, альтернативний сплайсинг.\\nЛокалізований у клітинній мембрані, цитоплазмі, мембрані, клітинних контактах, синапсах, синаптосомах, ендосомах."},{"page_url":"https://simple.wikipedia.org/wiki/Creuzier-le-Neuf","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Blason_de_la_ville_de_Creuzier-le-Neuf_%2803%29.svg","page_title":"Creuzier-le-Neuf","context_page_description":"Creuzier-le-Neuf is a French commune. It is in the Allier department in the center of France."},{"page_url":"https://en.wikipedia.org/wiki/Teleost_leptins","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Phylogenetic_tree.JPG","page_title":"Teleost leptins","context_page_description":"Teleost leptins are a family of peptide hormones found in fish that are orthologs of the mammalian hormone leptin. The teleost and mammalian leptins appear to have similar functions, namely, regulation of energy intake and expenditure.\\nThe leptin hormone was long thought to be specific to mammals, but in recent years the gene has been found in amphibia such as the tiger salamander, and the African clawed frog. The discovery of lep in puffer fish demonstrates the ancient ancestry of this hormone."},{"page_url":"https://de.wikipedia.org/wiki/Bullengrabenweg","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Bullengraben_7a_Abschnitt_4.JPG","page_title":"Bullengrabenweg","context_page_description":"Der Bullengrabenweg ist mit der Nummer 20 in der Bullengrabenniederung einer der 20 grünen Hauptwege. Das ist eine Zusammenstellung von 20 Wanderwegen durch das Berliner Stadtgebiet mit einer Gesamtlänge von rund 550 Kilometern. Ziel ist es, „Wohngebiete mit den vielfältigen Erholungsmöglichkeiten in Parkanlagen und Naherholungsgebieten von Berlin und Brandenburg“ miteinander zu verknüpfen. Der Fußgänger soll dabei die Möglichkeit haben, „die Stadt als eine Verbindung von Kultur, Geschichte und Ökologie intensiv zu erleben“."},{"page_url":"https://az.wikipedia.org/wiki/T%C9%99cil","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Kinematics.svg","page_title":"Təcil","context_page_description":"Təcil — vahid zamanda cismin sürətinin dəyişməsidir. Cismin təcilllənməsi Nyutonun ikinci qanununda da göstərildiyi kimi cismə təsir edən qüvvələrin əvəzləyicisinin hesabına baş verir. Beynəlxalq vahidlər sistemində təcilin vahidi metr bölünsünsaniyə kvadratıdır. Təcil vektorial kəmiyyətdir və paraleloqram qanununa görə cəmlənir. Bir vektor kimi hesablanan əvəzləyici qüvvə cismin kütləsi ilə onun təcilinin hasilinə bərabərdir.\\nMisal üçün bir avtomobil hərəkətsiz haldan düz xətt boyunca sürətini artıraraq hərəkət edərkən, təcilin istiqaməti hərəkət istiqamətində yönəlir. Əgər avtomobil dönərsə, təcil istiqamətini dəyişərək yeni istiqamət alır. Bu misalda avtomobildəki sərnişinlərin müşahidə etdiyi onları oturacağa doğru itələyən ve ya basan qüvvəni maşının təcili və ya xətti təcil adlanır. Avtomobil istiqamətini dəyişərkən avtomobildəki sərnişinlər onları yan tərəfə doğru itələyən qüvvələrin yarandığını müşahidə edəcəklər belə təcil qeyri xətti təcil adlanir."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Knights_Grand_Cross_of_the_Order_of_the_Bath","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Ernst_zu_H.-Langenburg.jpg","page_title":"List of Knights Grand Cross of the Order of the Bath","context_page_description":"\`\\nThis is an incomplete list of those who were made Knights/Dames Grand Cross of the Order of the Bath from the date of the Order's structural change by the Prince Regent on behalf of his father, King George III, on 2 January 1815. Knights/Dames Grand Cross use the post-nominal GCB. Those Knights living at the time of the reorganisation of the Order automatically became Knights Grand Cross, with the post-nominal GCB."},{"page_url":"https://de.wikipedia.org/wiki/Filmjahr_1927","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Sir_Roger_Moore_Allan_Warren.jpg","page_title":"Filmjahr 1927","context_page_description":"10. Februar: Uraufführung von Metropolis. Nach schwachem kommerziellen Erfolg entwickelt sich dieser Film in den folgenden Jahrzehnten zu einem der visuell einflussreichsten Werke der Filmgeschichte. Im Jahr 2001 wird er in die Liste des Weltdokumentenerbes der UNESCO aufgenommen.\\n27. Februar: Grauman’s Chinese Theatre wird mit der Uraufführung von Cecil B. DeMilles König der Könige eröffnet.\\n11. März: Das Roxy Theatre eröffnet in New York. Mit 6.214 Sitzplätze gilt es als das größte Kino der Welt.\\n11. Mai: Die Academy of Motion Picture Arts and Sciences wird in Los Angeles gegründet.\\n6. Oktober: The Jazz Singer hat Premiere. Der Film gilt als erster Tonfilm der Filmgeschichte, obwohl es bereits früher zahlreiche Experimente mit Vertonungen von Filmen gegeben hat."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%AB%D5%AC%D5%A2%D5%A1%D5%B8%D5%B5%D5%AB_%D4%B3%D5%B8%D6%82%D5%A3%D5%A5%D5%B6%D5%B0%D5%A1%D5%B5%D5%B4_%D5%A9%D5%A1%D5%B6%D5%A3%D5%A1%D6%80%D5%A1%D5%B6","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/GuggenheimBilbao.jpg","page_title":"Բիլբաոյի Գուգենհայմ թանգարան","context_page_description":"Բիլբաոյի Գուգենհայմ թանգարան, ժամանակակից և մերօրյա արվեստի թանգարան, որի նախագծի հեղինակը կանադաամերիկացի ճարտարապետ Ֆրանկ Գեհրին է։ Այն գտնվում է Իսպանիայի Բասկերի երկրի Բիլբաո քաղաք-վարչական շրջանում։ Թանգարանի պաշտոնական բացումը եղել է 1997 թվականի հոկտեմբերի 18-ին Իսպանիայի նախկին թագավոր Ժուան Կորլոսի 1-ինի կողմից։\\nԿառուցված լինելով Ներվիոն գետի երկայնքով, որը հոսում է Բիլաբաո քաղաքի միջով դեպի Կանտաբրյան ծով՝ թանգարանը Սողոմոն Ռ. Գուգենհայմ հիմնադրամի թանգարաններից մեկն է, որն առանձնանում է իր ՝ իսպանացի և այլ երկրների արվեստագործների մշտական և ժամանակավոր ցուցադրության նմուշներով։\\nԱյն Իսպանիայի և աշխարհի ամենամեծ թանգարաններից մեկն է համարվում։ Լինելով ժամանակակից ճարտարապետության ամենահիասքանչ աշխատանքներից մեկը՝ թանգարանի շենքը համարվել է, որպես «նշանակալից պահ ճարտարապետական մշակույթում», քանի որ այն ներկայացնում է «այն հազվագյուտ պահերից մեկը, երբ քննադատները, ակադեմիկոսներն ու ընդհանուր հասարակությունը ամբողջապես միավորվում է մի բանի շուրջ»։ 2010 թվականի ճարտարապետության մասնագետների շրջանում անցկացված Աշխարհի Ճարտարապետության հարցման ժամանակ այս թանգարանը ամենաշատն է հիշատակվել, որպես ամենակարևոր աշխատանքներից մեկը, որոնք իրենց ավարտին են հասցվել սկսած 1980 թվականից։"},{"page_url":"https://en.wikipedia.org/wiki/K%C3%A9gresse_track","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Austin-Kegress_%C2%ABUkrainets%C2%BB_in_Zhytomyr%2C_1920.jpg","page_title":"Kégresse track","context_page_description":"A Kégresse track is a kind of rubber or canvas continuous track which uses a flexible belt rather than interlocking metal segments. It can be fitted to a conventional car or truck to turn it into a half-track, suitable for use over rough or soft ground. Conventional front wheels and steering are used, although skis may also be fitted. A snowmobile is a smaller ski-only type."},{"page_url":"https://pt.wikipedia.org/wiki/Pr%C3%A9-Alpes_de_Digne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/SOIUSA03-Provence.png","page_title":"Pré-Alpes de Digne","context_page_description":"Os Pré-Alpes de Dignet é um maciço que faz parte dos Alpes Ocidentais na sua secção da Alpes da Provença e se encontra no departamento francês dos Alpes Marítimos e dos Alpes da Alta Provença, região de Provença-Alpes-Costa Azul. O ponto mais alto é do Cheval Blanc com 2.323 m."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A2%D0%B0%D1%80%D0%BE%D0%BF%D0%B5%D1%86%D0%BA%D1%96_%D1%80%D0%B0%D1%91%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Coat_of_Arms_of_Toropets_%28Tver_oblast%29.png","page_title":"Таропецкі раён","context_page_description":"Таропецкі раён — адміністрацыйна-тэрытарыяльная адзінка на захадзе Цвярской вобласці Расіі. Адміністрацыйны цэнтр — горад Таропец."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9A%E0%B4%BE%E0%B4%AE%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%81%E0%B4%A8%E0%B5%8D%E0%B4%A8%E0%B5%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Chamakunnu-ml-AyyappaTempleChamakunnu.jpg","page_title":"ചാമക്കുന്ന്","context_page_description":"കേരളത്തിലെ തൃശ്ശൂർ ജില്ലയിലെ വെളാംകല്ലൂർ പഞ്ചായത്തിലെ ഒരു ഗ്രാമമാ‍ണ് ചാമക്കുന്ന്. ഇരിഞ്ഞാലക്കുട നഗരത്തിൽ നിന്നും ഏകദേശം അഞ്ചു കിലോമീറ്റർ ദൂരത്തിലാണ് ചാമക്കുന്ന് സ്ഥിതി ചെയുന്നത്. നെൽകൃഷിയും, ഇടതൂർന്ന് നിൽക്കുന്ന തെങ്ങിൻത്തോപ്പുകളും അടക്കാമരത്തോപ്പുകളും ചാമക്കുന്നിനെ മനോഹരമാക്കുന്നു."},{"page_url":"https://fr.wikipedia.org/wiki/Thonon-les-Bains","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/H%C3%B4tel_de_ville_de_Thonon-les-Bains_02.jpg","page_title":"Thonon-les-Bains","context_page_description":"Thonon-les-Bains est une commune française située dans le département de la Haute-Savoie, en région Auvergne-Rhône-Alpes.\\nSituée dans la région historique du Chablais et plus précisément du Chablais savoyard, au bord du lac Léman, la commune fait également partie de l'agglomération urbaine du Grand Genève. C'est la troisième commune la plus peuplée du département, après Annecy et Annemasse, selon les chiffres des populations légales 2016.\\nEn 2010, la commune de Thonon-les-Bains a été récompensée par le label « Ville Internet @@@ ».\\nSes habitants sont appelés les Thononais et les Thononaises."},{"page_url":"https://eu.wikipedia.org/wiki/Mazerulles","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Mazerulles_%28M-et-M%29_mairie%2C_%C3%A9cole_et_salle_polyvalente.jpg","page_title":"Mazerulles","context_page_description":"Mazerulles Frantziako udalerri bat da, Meurthe-et-Moselle departamenduan dagoena, Ekialde Handia eskualdean. 2013an 247 biztanle zituen."},{"page_url":"https://pl.wikipedia.org/wiki/Jacek_Odrow%C4%85%C5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Straszyn%2C_figura_%C5%9Bw._Jacka_Odrow%C4%85%C5%BCa.png","page_title":"Jacek Odrowąż","context_page_description":"Jacek Odrowąż – polski duchowny katolicki, dominikanin, misjonarz, kaznodzieja, święty Kościoła katolickiego oraz historyczny patron Polski. Był pierwszym Polakiem, który wstąpił do nowo utworzonego Zakonu Kaznodziejskiego. Święty Jacek Odrowąż i jego towarzysze byli pierwszymi dominikanami w Polsce. Ewangelizował ludność Karyntii, Moraw, Czech, Polski, Rusi i Prus. Nazywany był przeto Apostołem Słowian, Apostołem Ludów Słowiańskich, Apostołem Północy, Światłem Północy lub Światłem ze Śląska.\\nWywodził się z możnej rodziny o tradycjach chrześcijańskich. Przyjął habit dominikański w Rzymie od założyciela zakonu, św. Dominika. Wracając do Polski, wspólnie z towarzyszami założył klasztory we Friesach, Pradze, Wrocławiu i Kamieniu. Osiadłszy w Krakowie, zorganizował klasztor w kościele św. Trójcy, a następnie udał się na Pomorze i założył placówkę w Gdańsku. W 1228 roku podążył na Ruś i spędził tam około pięciu lat. Z Rusi ponownie udał się na Pomorze, aby nawracać Prusów. Ostatnie lata życia spędził w Krakowie.\\nProwadził życie aktywne, wielokrotnie zmieniał miejsce pobytu; kilkukrotnie przemierzył Polskę pieszo. Już za życia otoczyła go sława cudotwórcy."},{"page_url":"https://en.wikipedia.org/wiki/WRSB_(AM)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/WRSB_Rochester_logo.png","page_title":"WRSB (AM)","context_page_description":"WRSB is a radio station broadcasting a Spanish tropical format to the Brockport, New York, United States area. The station is currently owned by Brian McGlynn, through licensee Genesee Media Corporation, and is operated by William Santiago through his company Uno Communications."},{"page_url":"https://cs.wikipedia.org/wiki/Vakovka_lidsk%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Balantidium_trophB.JPG","page_title":"Vakovka lidská","context_page_description":"Vakovka lidská je paraziticky žijící nálevník, nejčastěji se vyskytující ve střevech prasat domácích. V některých případech dochází k přenosu na člověka, kde může způsobovat zoonické onemocnění balantidiózu."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1910","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Ge-bakker-apeldoorn-1967.jpg","page_title":"Lijst van personen geboren in 1910","context_page_description":"Dit is een lijst van personen die geboren zijn in 1910.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://it.wikipedia.org/wiki/Rabbi_(fiume)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Rabbi_presso_premilcuore.JPG","page_title":"Rabbi (fiume)","context_page_description":"Il Rabbi è un fiume italiano, noto anche come Acquaviva, che nasce in Toscana ma scorre quasi interamente in Romagna."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D8%A7%D8%AD%D8%A9_%D8%A7%D9%84%D9%85%D8%B1%D9%81%D8%A3_(%D8%A8%D9%8A%D8%B1%D9%88%D8%AA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/%D8%B3%D8%A7%D8%AD%D8%A9_%D8%A7%D9%84%D9%85%D8%B1%D9%81%D8%A3_%D8%A8%D9%8A%D8%B1%D9%88%D8%AA.jpg","page_title":"ساحة المرفأ (بيروت)","context_page_description":"ساحة المرفأ هي ساحة في بيروت، لبنان."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%BE%D1%8F%D0%B2%D0%BE%D1%80%D0%BE%D0%B2%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Saint_George_church%2C_Novoyavorivsk_%2802%29.jpg","page_title":"Новояворовск","context_page_description":"Новоя́воровск — город районного значения в Яворовском районе Львовской области Украины."},{"page_url":"https://en.wikipedia.org/wiki/Commentarii_in_Somnium_Scipionis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Macrobius%2C_universe_with_the_earth_in_the_centre.jpg","page_title":"Commentarii in Somnium Scipionis","context_page_description":"Commentary on Cicero's Dream of Scipio is a philosophical treatise of Macrobius based on the famous dream narrated in On the republic of Cicero.\\nIn Cicero's work, Scipio Africanus appears to his adoptive grandson, Scipio Aemilianus, and reveals him his future destiny, and that of his country, explains the rewards that await the virtuous man in another life, describes the universe and the place of the Earth and of man inside the universe.\\nMacrobius does not offer an exhaustive comment of the text of Cicero, but expounds a series of theories on the dreams from neoplatonic background, on the mystic properties of the numbers, on the nature of the soul, on astronomy and on music. He quotes a number of authorities, but is unlikely to have read them all, or even the majority. Plotinus and Porphyry are his main sources, and he quotes frequently from Virgil with ornamental purpose. Nevertheless, the work incorporates ideas of neoplatonism that have not been preserved in a direct form elsewhere. The style is quite uneven, since Macrobius copies or translates his sources without unifying the style."},{"page_url":"https://pt.wikipedia.org/wiki/Aproxima%C3%A7%C3%A3o_final","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/ILS_localizer_illustration.svg","page_title":"Aproximação final","context_page_description":"Uma aproximação final é a última \\"perna\\" na aproximação de uma aeronave para o pouso, quando ela está alinhada com a pista e descendo para o pouso. Na fraseologia padrão da aviação, o termo é frequentemente reduzido para \\"final\\".\\nEm um circuito de tráfego padrão, que é normalmente utilizado em condições meteorológicas visuais, a aeronave gira da perna base para a final com uma distância aproximada de 2 a 3 quilômetros do aeroporto. Em aproximações por instrumentos, bem como aproximações em um aeródromo controlado sob regras de voo visual, normalmente usa-se uma aproximação direta, onde todas as outras pernas são dispensadas As aproximações diretas não são recomendadas nos Estados Unidos e na maioria dos países ao redor do mundo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%A4%D1%80%D0%B8%D0%B4%D0%B5%D1%80%D0%B8%D0%BA%D0%B0_%D0%A8%D0%BE%D0%BF%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Chopin_Museum_in_Warsaw_05.JPG","page_title":"Музей Фридерика Шопена","context_page_description":"Музей Фредерика Шопена — музей в Варшаве, основанный в 1954 году и посвящённый польскому композитору Фредерику Шопену.\\nВ состав музея входят 2 филиала: Родной дом Фредерика Шопена в Желязова-Воля и Маленький салон семьи Шопен на проспекте Краковское предместье в Варшаве."},{"page_url":"https://eo.wikipedia.org/wiki/Simono_el_Cireno","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/StationV.JPG","page_title":"Simono el Cireno","context_page_description":"Simono el Cireno, kromnomita la cirenano, estas la viro kiun, laŭ evangelioj, romiaj soldatoj devigis porti la krucon de Jesuo, kiu estis puŝita al Golgoto. Jesuo, fakte, krude elĉerpigita pro la skurĝado kaj aliaj turmentoj al li suferigitaj, ne plu kapablis marŝi kun surŝultre la peza ligno. Evangelioj ne liveras kroman informon pri la Cirenano se ne ke li estis «patro de Aleksandro kaj Rufo», membroj certe konitaj en la komunumo al kiu Marko ideale adresas sian evangelion.\\n« Kaj ili devigis al servado unu preterpasanton, venantan de la kamparo, Simonon, Kirenanon, patron de Aleksandro kaj Rufo, ke li portu lian krucon. Origine greka: \\"Καὶ ἀγγαρεύουσι παράγοντά τινα Σίμωνα Κυρηναῖον, ἐρχόμενον ἀπ' ἀγροῦ, τὸν πατέρα Ἀλεξάνδρου καὶ Ρούφου, ἵνα ἄρῃ τὸν σταυρὸν αὐτοῦ\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%9B%E8%9A%81%E9%B5%99%E5%B1%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/ClytoctantesAlixiiKeulemans.jpg","page_title":"丛蚁鵙属","context_page_description":"丛蚁鵙属是蚁鵙科下的一个属，现存两种，均分布于南美洲。该属的两种物种曾均被认为已经灭绝，直至2004年被重新发现。"},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame-du-Bon-Conseil_de_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/P1310777_Paris_XVIII_eglise_ND_bon_conseil_nef_choeur_rwk.jpg","page_title":"Église Notre-Dame-du-Bon-Conseil de Paris","context_page_description":"L'église catholique Notre-Dame du Bon Conseil est située au 140 rue de Clignancourt dans le 18ᵉ arrondissement de Paris."},{"page_url":"https://es.wikipedia.org/wiki/Fuego_amigo","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/United_States_bombing_raid_over_a_German_city_-_NARA_-_197269.jpg","page_title":"Fuego amigo","context_page_description":"En la jerga militar se denomina fuego amigo o fuego aliado a los disparos provenientes del propio bando. Este tipo de incidentes suelen estar producidos por errores, casi siempre humanos, debidos normalmente a fallos en la identificación del objetivo. Dentro de las naciones de la OTAN se suele identificar a estos incidentes con el término azul contra azul. También se usa el término fratricidio, aunque erróneamente, pues el fratricidio es a propósito y el Fuego Amigo siempre es accidental.\\nPor lo general, las bajas propias por fuego amigo se producen frecuentemente en acciones aire-tierra o tierra-aire, al ser la coordinación del espacio aéreo una de las cuestiones más complicadas en una acción bélica. Así, uno de los casos más comunes de ataques sobre fuerzas del mismo bando involucra a unidades de defensa antiaérea y aviones aliados o amigos. La altitud, los reflejos de la luz del sol, la falta de experiencia o entrenamiento de los servidores de baterías antiaéreas y muchos otros factores conducen a incidentes de fuego amigo."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_models_de_motocicleta_de_carretera_Montesa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Montesa_A45_1945_MB_98_a.jpg","page_title":"Llista de models de motocicleta de carretera Montesa","context_page_description":"Aquesta és una llista amb els models de motocicleta de carretera produïts per Montesa al llarg de la seva existència, ordenada cronològicament per l'any de llançament del model. La llista aplega tots els models dissenyats per al seu ús en carretera produïts mai per Montesa, tant si foren simples prototips com si es passaren després a la sèrie.\\nLa llista inclou també el model King Scorpion, ja que malgrat la seva aparença de motocicleta d'enduro era més aviat un model de carretera adaptat a un ús polivalent, com les actuals motocicletes de tipus trail."},{"page_url":"https://fi.wikipedia.org/wiki/Challenger","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Shuttle.svg","page_title":"Challenger","context_page_description":"Challenger oli yhdysvaltalainen avaruussukkula, joka tuhoutui 73 sekuntia laukaisunsa jälkeen 28. tammikuuta 1986.\\nChallenger oli avaruussukkula Columbian jälkeen toinen kiertoradalle laukaistu avaruussukkula. Challengerin ensilento oli 4. huhtikuuta 1983, ja se tuhoutui kymmenennellä lennollaan 28. tammikuuta 1986."},{"page_url":"https://az.wikipedia.org/wiki/Qara_alabayqu%C5%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/SOOTY_OWL_%40_SCRUBBY_CREEK_21APRIL15_%282%29.JPG","page_title":"Qara alabayquş","context_page_description":"Qara alabayquş — alabayquş cinsinə aid heyvan növü."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%82%AB%E3%82%A6%E3%83%88%E9%81%8B%E5%8B%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Scout_mem_jamb_1979_1980_perry_lakes_gnangarra.jpg","page_title":"スカウト運動","context_page_description":"スカウト運動、スカウティングは、若者の社会で有用とされ得る肉体的・精神的スキル向上の手助けを目的とする教育運動。その教育はアウトドアとサバイバル技能に重きを置く。この運動は20世紀の前半期にカブスカウト・ボーイスカウト・ローバースカウトの三つの部門をもつまでに成長し、また1910年には新たに女子教育のためにガールガイドが設立された。今日では世界的な青少年組織の一つとなっている。イギリス陸軍中将であったロバート・ベーデン＝パウエルは1906年と1907年に少年向けの偵察・斥候術の本を著した。1908年に、ベーデン＝パウエルは先に出版した自らの軍事関係の著書を基に、フレデリック・ラッセル・バーナム、アーネスト・トンプソン・シートン、ウィリアム・アレクサンダー・スミスの助言と援助を得てピアソンからスカウティング・フォア・ボーイズを出版する。この本ために、ベーデン＝パウエルは1907年の夏にブラウンシー島で実験キャンプを行っている。一般的にはこの実験キャンプとスカウティング・フォア・ボーイズの出版をもって、スカウト運動が始まったとみなされている。\\nスカウト運動はスカウト教育法と呼ばれる、キャンプ、工作、ウォータースポーツ、ハイキング、トレッキング、スポーツなどを含む実践的アウトドア活動に重きを置くインフォーマル教育プログラムを採用している。他にスカウト運動の特徴としては制服の存在が広く知られている。ネッカチーフとハットなどからなる制服は、加盟員の社会経済的背景や人種といったものを隠す役割を持っている。フルール・ド・リスないし矢じりをかたどった制服に用いられる独特の記章が用いられる。\\nスカウト運動には二つの世界的な包括的団体が存在する。世界スカウト機構は男性のみないしコエデュケーションの団体で、ガールガイド・ガールスカウト世界連盟は基本的に女性のみの団体で構成される。2007年はスカウト運動100周年の年であり、世界的な規模で祝賀行事が執り行われた。\\n日本においては、第二次世界大戦以前から活動が開始されていたが、敗戦後の占領政策により活動禁止処分を受けた。しかし、日銀総裁・三島弥太郎の長男で旧子爵であった三島通陽および、元朝日新聞記者の村山有が中心となっておこなわれたダグラス・マッカーサー元帥あての請願によって活動の再開が許可され、一般への普及が図られた。"},{"page_url":"https://fi.wikipedia.org/wiki/Liitokiekko","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Frisbee_090719.jpg","page_title":"Liitokiekko","context_page_description":"Liitokiekko on yleensä muovista valmistettu kiekonmuotoinen esine, jonka läpimitta on 20–25 cm ja jossa on pyöristetyn kannen tapaan taitettu reuna. Muotonsa ansiosta kiekon kannen alapuolinen tila muodostaa kantavan, ilman nostetta synnyttävän pinnan, kun kiekko heitetään pyörivään liikkeeseen. Ultimatessa käytettävä kiekko painaa yleensä 175 grammaa.\\nLiitokiekosta käytetään yleisesti myös nimeä Frisbee, joka on kuitenkin leluja valmistavan Wham-O -yhtiön rekisteröity tavaramerkki."},{"page_url":"https://hu.wikipedia.org/wiki/Lila_%C3%B6k%C3%B6rfarkk%C3%B3r%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Verbascum_phoeniceum2.jpg","page_title":"Lila ökörfarkkóró","context_page_description":"A lila ökörfarkkóró a görvélyfűfélék családjába tartozó növényfaj. Generikus nevét onnan kapta, hogy csoportos, fürtös virága ökörfark-vastagságú."},{"page_url":"https://eo.wikipedia.org/wiki/Saint-Di%C3%A9-des-Vosges","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/IUTSaintDie.JPG","page_title":"Saint-Dié-des-Vosges","context_page_description":"Saint-Dié-des-Vosges [sandiedevoĝ] estas urbo en departemento Vosges, en regiono Loreno en Francio. Ĝia loĝantoj nomiĝas franclingve Déodatiens.\\nĜis la 29-a de decembro 1999 la urbonomo estas nur Saint-Dié.\\nSaint-Dié-des-Vosges estas kun Neufchâteau subprefektejo de sia departemento."},{"page_url":"https://de.wikipedia.org/wiki/Dusty-Gletscher","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Mt._Kennedy_from_Lowell_Glacier_to_north..jpg","page_title":"Dusty-Gletscher","context_page_description":"Der Dusty-Gletscher liegt im Kluane-Nationalpark im kanadischen Territorium Yukon.\\nEr bildet eine Teil des Kluane Icefield, das sich vom nordöstlichen Abhang der Eliaskette bis in tiefere Lagen erstreckt. Das Nährgebiet des Dusty-Gletschers befindet sich zwischen den Gebirgskämmen von Pinnacle Peak im Norden und Mount Alverstone im Süden auf einer Höhe von 2800 m. Er strömt anfangs 35 km nach Osten. Dann trifft er auf den von Süden heranströmenden Lowell-Gletscher. Während der Lowell-Gletscher nach Osten abbiegt, wendet sich der Dusty-Gletscher nach Norden und durchschneidet den ihn bis dahin nach Norden hin flankierenden Bergkamm. Im Anschluss wendet sich der Dusty-Gletscher erneut nach Osten. Nach insgesamt 60 km endet der Gletscher nördlich vom Lowell Peak auf einer Höhe von 900 m. Der Gletscher weist eine durchschnittliche Breite von 3,6 km auf. Unterhalb der Gletscherzunge fließt der Dusty River über eine Strecke von 32 km in nordnordöstlicher Richtung und mündet schließlich rechtsseitig in den Kaskawulsh River."},{"page_url":"https://it.wikipedia.org/wiki/Artoce","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Pompey_the_Great%2C_Augustean_copy_of_a_70-60_BC_original%2C_Venice_Museo_Archeologico_Nazionale_%2822205132751%29.jpg","page_title":"Artoce","context_page_description":"Artoce è stato un re di Iberia che regnò dal 78 a.C. al 63 a.C. e fu un membro della dinastia degli Artassidi."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BC%8A%E6%A1%91%E8%8B%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Pic_du_Lizieux_Araules_2017-05_n17.jpg","page_title":"伊桑若","context_page_description":"伊桑若，法国东南部城市，奥弗涅-罗讷-阿尔卑斯大区上卢瓦尔省的一个市镇。伊桑若位于上卢瓦尔省东部，其市镇面积为80.57平方公里，2017年1月1日时人口数量为7202人，在法国城市中排名第1,456位。\\n伊桑若也是上卢瓦尔省的一个副省会，下辖伊桑若区，同时也是叙克市镇公共社区的办公驻地。"},{"page_url":"https://en.wikipedia.org/wiki/Hawkinsinuria","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Hawkinsin.png","page_title":"Hawkinsinuria","context_page_description":"Hawkinsinuria, is an autosomal dominant metabolic disorder affecting the metabolism of tyrosine.\\nNormally, the breakdown of the amino acid tyrosine involves the conversion of 4-hydroxyphenylpyruvate to homogentisate by 4-Hydroxyphenylpyruvate dioxygenase. Complete deficiency of this enzyme would lead to tyrosinemia III. In rare cases, however, the enzyme is still able to produce the reactive intermediate 1,2-epoxyphenyl acetic acid, but is unable to convert this intermediate to homogentisate. The intermediate then spontaneously reacts with glutathione to form 2-L-cystein-S-yl-1,4-dihydroxy-cyclohex-5-en-1-yl acetic acid.\\nPatients present with metabolic acidosis during the first year of life, and growth arrest around the time of weaning off breast milk. Treatment involves a diet containing a low amount of phenylalanine and tyrosine. Tolerance toward these amino acids normalizes as the patients get older. Then only a chlorine-like smell of the urine indicates the presence of the condition. Patients have a normal life and do not require treatment or a special diet.\\nThe production of hawkinsin is the result of a gain-of-function mutation."},{"page_url":"https://kk.wikipedia.org/wiki/Phoenix_(%D2%9B%D0%BE%D0%BD%D1%83_%D0%B1%D3%A9%D0%BB%D1%96%D0%B3%D1%96)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Phoenix-Medium.jpg","page_title":"Phoenix (қону бөлігі)","context_page_description":"Phoenix, Mars Scout бағдарламасы құрамындағы бір ғарыш зерттеуінде қызмет ететін роботты ғарыш аппараты Ғалымдар микробиология көзқарасынан Қызылжұлдыздағы тіршілік жағдайларының сәйкес келетін-келмейтінін және ондағы судың өткенін зерттеу үшін Phoenix ғарыш аппараты құрамындағы аспаптары қолданылмақ. Көп серіктестер атсалысқан бағдарлама NASAның бақылауы астында Аризона университетіндегі Ай және ғаламшарлар зертханасы жетекшілігімен жүзеге асырылуда. Бағдарлама АҚШ, Канада, Швейцария, Дания, Германия және Англиядан түрлі университеттер, Канада ғарыш агенттігі және ғарыш өнеркәсібі тарапынан қолдау көріп отыр.\\nФеникс құсы, 4 тамыз 2007 күні жерден ұшырылып және 26 мамыр 2008 күні сағат 02:55-те Қызылжұлдыздың су-мұз жағынан бай солтүстік полюс бөлігіндегі Vastitas Borealisқа мына координаттармен 68.2°N 234.3°W табысты бір қону жүзеге асырды. Енді робот қолы полюс топырағын қазу үшін қолданады. ғарыш аппаратының табысты қонуымен алғашқы хабар АҚШ-тың EDT Аризонаның сағат белдеуі) бойынша сағат 19:53-те келді сағаты бойынша 26 мамыр таңғы 5:53)"},{"page_url":"https://en.wikipedia.org/wiki/On_Leong_Chinese_Merchants_Association","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/95/Chicago-chinatown2.jpg","page_title":"On Leong Chinese Merchants Association","context_page_description":"The On Leong Chinese Merchants Association or simply Chinese Merchants Association, formerly known as the On Leong Tong, is a tong society operating out of its territory in Mott Street in New York's Chinatown. Established in November 1893, the tong fought a violent war for control of Chinatown's rackets and businesses with the Hip Sing Tong. In recent years the Tong has been linked to the Ghost Shadows street gang led by Wing Yeung Chan. Currently, there are over 30,000 registered On Leong members, the majority of them with a commercial or industrial background."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%BA%D1%82%D0%BE%D1%97%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Oktoikh_1630_Lvov.jpg","page_title":"Октоїх","context_page_description":"Окто́їх — богослужбова книга Православної Церкви, яка містить в собі чинопослідування вечірні, повечір'я, утрені та літургії для шести буденних днів тижня, а для недільних днів, крім того — малої вечірні і полуношниці. Всі ці піснеспіви за способом співу поділяються на вісім гласів або наспівів, з яких кожен вживається в продовження однієї седмиці. Названий за належністю мелодійної системі осьмогласся."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_pomn%C3%ADk%C5%AF_z_bitvy_u_Hradce_Kr%C3%A1lov%C3%A9_roku_1866,_%C4%8D%C3%A1st_1%E2%80%93150","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Pomn%C3%ADky-%C4%8D.-22%2C-381%2C-416.jpg","page_title":"Seznam pomníků z bitvy u Hradce Králové roku 1866, část 1–150","context_page_description":"Prostor prusko-rakouské bitvy u Hradce Králové z 3. července 1866 byl vyhláškou Ministerstva kultury ČR č. 208/1996 Sb. prohlášen památkovou zónou „Areál bojiště bitvy 1866 u Hradce Králové“. Evidováno je více než 460 památek, z nichž většina se nachází v této památkové zóně. Nejvíce koncentrovány jsou v lese Svíb.\\nPři honu 16. listopadu 1888 byl položen základ Komitétu pro udržování památek z války roku 1866, který měl ustavující schůzi 2. prosince 1888 a začal o pomníky jednotně pečovat. Podobné spolky z dalších východočeských měst zastřešilo Centrální komité a vznikla nadace při odborné škole sochařské a kamenické v Hořicích. V roce 1891 spolek udržoval 227 pomníků ve více než 40 obcích a v následujících letech pracoval na vyhledávání a evidenci dalších pomníků. Také vyzval všechny zúčastněné vojenské jednotky, aby vybudovaly své pomníky, pokud tak ještě neučinily. V roce 1898 bylo v evidenci 319 pomníků, v roce 1901 přesně 400 a v roce 1912 již 419. Zhruba do roku 1914 nabyl soubor dnešního rozsahu. Od roku 1904 vznikalo v místech bojiště turistické značení."},{"page_url":"https://de.wikipedia.org/wiki/Asiatische_Kr%C3%B6tenfr%C3%B6sche","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Leptob_hasselt_M_080208-4532_clobk.jpg","page_title":"Asiatische Krötenfrösche","context_page_description":"Die Asiatischen Krötenfrösche sind eine Familie innerhalb der Froschlurche. Mit 218 Arten bilden sie die bei weitem formenreichste Gruppe der Krötenfrösche, zu denen noch die Europäischen Schaufelfußkröten mit Arten wie Knoblauchkröte und Messerfuß gehören."},{"page_url":"https://ms.wikipedia.org/wiki/Mukim_Gemas,_Negeri_Sembilan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Pekan_Gemas.jpg","page_title":"Mukim Gemas, Negeri Sembilan","context_page_description":"Mukim Gemas merupakan sebuah mukim yang terletak di Daerah Tampin, Negeri Sembilan, Malaysia.\\nNegeri Sembilan dibahagikan kepada beberapa buah daerah dan setiap daerah dibahagikan kepada beberapa mukim."},{"page_url":"https://fr.wikipedia.org/wiki/Alexander_Schleicher_ASK_23","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Solist_in_ASK23.JPG","page_title":"Alexander Schleicher ASK 23","context_page_description":"Le Schleicher ASK 23 est un planeur monoplace de classe Club qui est fabriqué par la société Alexander Schleicher."},{"page_url":"https://en.wikipedia.org/wiki/List_of_nearest_terrestrial_exoplanet_candidates","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/HD_85512_b_%28Artists%27s_impression%29.jpg","page_title":"List of nearest terrestrial exoplanet candidates","context_page_description":"This list of nearest terrestrial exoplanet candidates contains possible terrestrial exoplanets spaced at a distance of up to 50 light-years from our Solar System, ordered by increasing distance.\\nThey may be composed primarily of silicate rocks and/or metals. Within the Solar System, the terrestrial planets are the inner planets closest to the Sun."},{"page_url":"https://nl.wikipedia.org/wiki/Paul_Lukas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Paul_Lukas_in_The_Casino_Murder_Case_trailer.jpg","page_title":"Paul Lukas","context_page_description":"Paul Lukas was een Hongaarse acteur."},{"page_url":"https://fr.wikipedia.org/wiki/Basilique_de_la_Candelaria","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Cristo_de_la_Reconciliaci%C3%B3n_-_Bas%C3%ADlica_de_Candelaria_%28Tenerife%29.jpg","page_title":"Basilique de la Candelaria","context_page_description":"La Basilique et le Royale Sanctuaire Marial de Notre-Dame de la Candelaria, également connue sous le nom Basilique de la Candelaria est une basilique, le premier sanctuaire marial des îles Canaries, situé dans la municipalité de Candelaria sur l'île de Tenerife.\\nLa basilique est dédiée à la Vierge de la Candelaria. Elle est située à 20 kilomètres au sud de la capitale de l'île, Santa Cruz de Tenerife. Il est le plus important sanctuaire catholique dans les îles Canaries et l'un des plus importants en Espagne, avec plus de 2,5 millions de visiteurs par an."},{"page_url":"https://de.wikipedia.org/wiki/Maihingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Maihingen_Kirche.jpg","page_title":"Maihingen","context_page_description":"Maihingen ist eine Gemeinde im schwäbischen Landkreis Donau-Ries und ein Mitglied der Verwaltungsgemeinschaft Wallerstein."},{"page_url":"https://cs.wikipedia.org/wiki/Adelheid_Rakousk%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Maria_Adelheid_habsburg_toscana_1822_1855.jpg","page_title":"Adelheid Rakouská","context_page_description":"Adléta či Adéla Rakouská byla rakouská arcivévodkyně, vévodkyně savojská a královna Sardinie."},{"page_url":"https://no.wikipedia.org/wiki/Acad%C3%A9mie_Colarossi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Academy-colarossi-paris-rue-grand-chaumiere-montparnasse-amedeo-modigliani.jpg","page_title":"Académie Colarossi","context_page_description":"Académie Colarossi var et fransk privat kunstakademi. Det var grunnlagt av den italienske skulptøren Filippo Colarossi, og lå i rue de la Grande-Chaumière nr. 10 i Paris, like i nærheten av Académie de la Grande Chaumière, nr. 14 i samme gate.\\nAkademiet ble grunnlagt som et alternativ til det offentlige École des Beaux Arts, som etter mange unge kunstneres mening var blitt for konservativt.\\nAcadémie Colarossi stengte i 1920. Collarossis ektefelle brente arkivene som gjengjeld for ektefellens ekteskapelige sidesprang."},{"page_url":"https://sq.wikipedia.org/wiki/L%C3%B8renskog","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Sandvika_Baerum_Norway.jpg","page_title":"Lørenskog","context_page_description":"Lørenskog është një komunë në qarkun Akershus, Norvegji. Komuna ka një sipërfaqe 71 km² dhe popullsi 30496 banorë."},{"page_url":"https://es.wikipedia.org/wiki/Jean-Antonie_Alavoine","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Place_de_la_Bastille_en_1858.jpg","page_title":"Jean-Antonie Alavoine","context_page_description":"Jean-Antoine Alavoine fue un arquitecto francés.\\nAlumno de Jean-Thomas Thibault​ en la École nationale supérieure des beaux-arts, fue tres veces logista del Prix de Rome.​ Tras sus estudios, fue nombrado arquitecto de la ciudad de París.​\\nEs principalmente recordado por la Columna de Julio, levantada en la Plaza de la Bastilla de París para conmemorar la revolución de 1830. Realizada conscientemente a una escala mayor que la columna de la Place Vendôme, es una interpretación libre de la columna corintia, exagerando las volutas de las esquinas y añadiendo putti; un diseño que ha sido calificado de complicado e incoherente, y que no ha gozado de imitadores. Iniciada en 1831, se concluyó en 1840, ya muerto Alavoine, siendo sucedido en la dirección de las obras por Joseph-Louis Duc.​\\nEn 1813, por orden de Napoleón y junto con el también arquitecto Bridan y bajo la dirección de Ambroise Tardieu, ya había diseñado, para la misma Plaza de la Bastilla, un proyecto de fuente que incluía la escultura colosal de un elefante ​ que se pretendía realizar con el bronce de los cañones tomados en España."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%86%D9%88%D9%85_%D8%B1%D9%88%D9%86%D9%8A%D9%87_14_%D8%A5%D9%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Gnome_Rhone_M05_Mars.JPG","page_title":"جنوم رونيه 14 إم","context_page_description":"جنوم رونيه 14 إم هو محرك شعاعي صغير، مكون من 14 أسطوانة ويُبرد بالهواء. استُخدم في العديد من الطائرات الفرنسية والألمانية في الحرب العالمية الثانية."},{"page_url":"https://bar.wikipedia.org/wiki/St%C3%A4dt_in_Kansas","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/11/Emporia_kanasas_2009.jpg","page_title":"Städt in Kansas","context_page_description":"Des is a Listn vo de gresstn Städt in Kansas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BA%D1%80%D1%82%D1%87%D1%8F%D0%BD_%D0%9D%D0%B0%D1%82%D0%B0%D0%BB%D1%8F_%D0%92%27%D1%8F%D1%87%D0%B5%D1%81%D0%BB%D0%B0%D0%B2%D1%96%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/%D0%9D%D0%B0%D1%82%D0%B0%D0%BB%D1%8F_%D0%9C%D0%BA%D1%80%D1%82%D1%87%D1%8F%D0%BD_%D0%BF%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82_%C2%AB%D0%86%D0%B2%D0%B0%D0%BD_%D0%A8%D1%83%D0%BB%D1%8F%D0%BA%C2%BB.jpg","page_title":"Мкртчян Наталя В'ячеславівна","context_page_description":"Мкртчян Наталя В'ячеславівна — сучасна українська художниця, живописець, лауреат Міжнародної премії імені Володимира Винниченка."},{"page_url":"https://fr.wikipedia.org/wiki/Interactions_homme-machine","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Realite_virtuelle.jpg","page_title":"Interactions homme-machine","context_page_description":"Les interfaces homme-machine ou IHM sont les moyens et outils mis en œuvre afin qu'un humain puisse contrôler et communiquer avec une machine. Les ingénieurs en ce domaine étudient la façon dont les humains interagissent avec les ordinateurs ou entre eux à l'aide d'ordinateurs, ainsi que la façon de concevoir des systèmes qui soient ergonomiques, efficaces, faciles à utiliser ou plus généralement adaptés à leur contexte d'utilisation.\\nL'amélioration de l'ergonomie de l'interface Homme-machine a aussi pour objectif d'optimiser l'aménagement du poste de travail et de limiter ainsi les risques du travail sur écran."},{"page_url":"https://nl.wikipedia.org/wiki/Gravel","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Rochusclub_Duesseldorf.jpg","page_title":"Gravel","context_page_description":"Gravel is een mengsel van gemalen puin, zoals baksteen en dakpannen. Het vindt onder andere toepassing als ondergrond voor tennisbanen, voor het zogeheten binnenveld in de honkbalsport, en soms voor atletiekbanen, de zogenoemde sintelbanen. Gravel kan ook worden gebruikt als ondergrond bij petanque. De gebruikte gravel bij een tennisbaan is doorgaans fijner vermalen dan bij andere sporten.\\nGravel wordt vaak gebruikt als ondergrond bij tennisbanen, omdat het een goedkoop materiaal is. Het heeft daarentegen wel veel onderhoud nodig en moet bijvoorbeeld na elke wedstrijd aangeveegd worden. Daarnaast kan een gravelbaan niet gebruikt worden bij temperaturen onder het vriespunt.\\nGravel werd aan het eind van de 19ᵉ eeuw voor het eerst als ondergrond voor een tennisbaan gebruikt door de gebroeders Renshaw, die tennisbanen wilden bouwen in de Franse Riviera. Vanwege de hoge temperatuur en de felle zon werd het gras snel dor, waardoor de banen niet goed bespeelbaar bleken. De banen hadden een beschermlaag nodig om goed bespeelbaar te blijven. De gebroeders Renshaw vonden deze toplaag bij een terracottafabriek in Vallauris."},{"page_url":"https://vi.wikipedia.org/wiki/Nguy%C3%AAn_nh%C3%A2n_c%E1%BB%A7a_cu%E1%BB%99c_C%C3%A1ch_m%E1%BA%A1ng_Ph%C3%A1p","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Declaration_of_the_Rights_of_Man_and_of_the_Citizen_in_1789.jpg","page_title":"Nguyên nhân của cuộc Cách mạng Pháp","context_page_description":"Nguyên nhân gây nên cuộc Cách mạng Pháp bao gồm những yếu tố lịch sử quan trọng dẫn đến cuộc đại cách mạng năm 1789 tại Pháp.\\nSự sụp đổ của chế độ cũ ở Pháp có thể xuất phát một phần từ bộ máy điều khiển. Nhóm quý tộc đã phải đối mặt với tham vọng đang tăng cao của con buôn, thương gia hay những nông dân giàu có, những người đã liên minh với những nông dân bị đói, công nhân ăn lương và trí thức chịu ảnh hưởng bởi những ý tưởng của các nhà triết học Khai sáng. Khi cuộc cách mạng được tiến hành, sức mạnh phân cấp từ chế độ quân chủ đại diện nhiều cơ quan chính trị, như hội đồng lập pháp, nhưng mâu thuẫn giữa nhóm tiền cộng hòa là đồng minh đã trở thành nguồn gốc cho một mối bất hòa to tát cùng những cuộc đổ máu sau này.\\nSố lượng người Pháp thấm nhuần tư tưởng \\"bình đẳng\\" và \\"tự do cá nhân\\" như trình bày của Voltaire, Denis Diderot, Turgot, và các triết gia khác và các nhà lý thuyết xã hội của thời Khai sáng ngày càng tăng. Cách mạng Mỹ đã chứng minh rằng điều này thực sự chính đáng cho những ý tưởng giác ngộ về việc làm thế nào một chính phủ nên được tổ chức thực sự có thể được đưa vào thực tế."},{"page_url":"https://en.wikipedia.org/wiki/Seward,_Illinois","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Seward%2C_IL_Downtown.JPG","page_title":"Seward, Illinois","context_page_description":"Seward is an unincorporated community in Winnebago County, Illinois, United States, and is located west of Rockford. It is part of the Rockford, Illinois Metropolitan Statistical Area."},{"page_url":"https://en.wikipedia.org/wiki/Inferior_pharyngeal_constrictor_muscle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Musculusconstrictorpharyngisinferior.png","page_title":"Inferior pharyngeal constrictor muscle","context_page_description":"The Inferior pharyngeal constrictor, the thickest of the three constrictors, arises from the sides of the cricoid and thyroid cartilage. Similarly to the superior and middle pharyngeal constrictor muscles, it is innervated by the vagus nerve, specifically, by branches from the pharyngeal plexus and by neuronal branches from the recurrent laryngeal nerve."},{"page_url":"https://en.wikipedia.org/wiki/New_Cathedral_of_Cuenca","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Cathedral_1_.jpg","page_title":"New Cathedral of Cuenca","context_page_description":"The Cathedral of the Immaculate Conception, commonly referred to as the New Cathedral of Cuenca, is the cathedral church in Cuenca, Ecuador. It is situated in front of Parque Calderon.\\nThe plan of the Cathedral was drawn up by Juan Bautista Stiehle — a German-born friar who arrived in Cuenca from Alsace in 1873 — on suggestions made by Bishop León Garrido. The Cathedral took over the function of the nearby Old Cathedral that had become too small. Construction works started in 1885 and lasted for almost a century. This building combines many architecture styles, but Romanesque Revival is predominant. The cathedral is surmounted by three giant domes covered by striking blue and white glazed tile from Czechoslovakia. Its stained glass windows were created by Spanish artist Guillermo Larrazábal.\\nIts towers are truncated due to a calculation error of the architect. If they had been raised to their planned height, the foundation of this Church to the Immaculate Conception, would not have been able to bear the weight. In spite of the architect's immense mistake, the skyline of its domes has become a symbol for the city."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Uebigau-Wahrenbr%C3%BCck","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Markt_6_Uebigau_Uebigau-Wahrenbr%C3%BCck.jpg","page_title":"Liste der Baudenkmale in Uebigau-Wahrenbrück","context_page_description":"In der Liste der Baudenkmale in Uebigau-Wahrenbrück sind alle Baudenkmale der brandenburgischen Stadt Uebigau-Wahrenbrück und ihrer Ortsteile aufgelistet. Grundlage ist die Veröffentlichung der Landesdenkmalliste mit dem Stand vom 31. Dezember 2019. Die Bodendenkmale sind in der Liste der Bodendenkmale in Uebigau-Wahrenbrück aufgeführt."},{"page_url":"https://ro.wikipedia.org/wiki/10_februarie","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Collision_iridium33_kosmos2251.jpg","page_title":"10 februarie","context_page_description":"10 februarie este a 41-a zi a calendarului gregorian."},{"page_url":"https://it.wikipedia.org/wiki/Nyarlathotep","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/The_Haunter_of_the_Dark_by_Ern%C5%91_Juh%C3%A1sz.jpg","page_title":"Nyarlathotep","context_page_description":"Nyarlathotep è un'entità immaginaria appartenente al Ciclo di Cthulhu. Scaturito dalla fantasia dello scrittore Howard Phillips Lovecraft, Nyarlathotep è uno degli Dei Esterni e appare nei lavori dello stesso Lovecraft e di August Derleth, tra gli altri."},{"page_url":"https://eu.wikipedia.org/wiki/Belrupt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Belrupt1%2888%29.jpg","page_title":"Belrupt","context_page_description":"Belrupt Frantziako udalerria da, Vosges departamenduan dagoena, Ekialde Handia eskualdean. 2013an 107 biztanle zituen."},{"page_url":"https://nl.wikipedia.org/wiki/Joe_Morello","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Davebrubeckquartet1967a.jpg","page_title":"Joe Morello","context_page_description":"Joe Morello was een Amerikaans jazzdrummer die wereldwijd tot een van de beste gerekend wordt, voornamelijk vanwege zijn periode als drummer van het Dave Brubeck Quartet, van 1956 tot 1967. Bij deze jazzformatie kreeg hij faam als drummer van technisch moeilijkere stukken, met minder gangbare maatsoorten, zoals de 5/4 en 9/8 maatsoort.\\nMorello staat voornamelijk bekend vanwege zijn drumsolo op de jazzklassieker Take Five, die in 1959 uit kwam op de Dave Brubeck Quartet-cd Time Out. Hier staat ook de klassieker Blue Rondo a la Turk op. In totaal speelde Morello op 120 cd's en albums mee, waarvan 60 van het Dave Brubeck Quartet.\\nVanwege Morello's steeds slechter wordende ogen legde hij zich door de jaren heen meer toe op het geven van drumlessen. Hij was de drumleraar van onder andere Danny Gottlieb en Max Weinberg. Daarnaast bracht hij ook studieboeken voor drums uit. Ondanks zijn verminderde zicht speelde Morello nog wel af en toe met Dave Brubeck Quartet-reünies mee.\\nIn 1988 werd Morello door Modern Drummer Magazine opgenomen tot de Hall of Fame. Van Downbeat magazine kreeg hij vijf jaar achter elkaar de prijs voor beste drummer."},{"page_url":"https://en.wikipedia.org/wiki/Ferdinand_Qu%C3%A9nisset","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/M._Ferdinand_Quenisset.jpg","page_title":"Ferdinand Quénisset","context_page_description":"Ferdinand Jules Quénisset was a French astronomer who specialized in astrophotography."},{"page_url":"https://de.wikipedia.org/wiki/Ruprecht_(HRR)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Ruprecht_III_%28Pfalz%29.jpg","page_title":"Ruprecht (HRR)","context_page_description":"Ruprecht aus der Dynastie der Wittelsbacher war von 1398 bis 1410 als Ruprecht III. Pfalzgraf bei Rhein und von 1400 bis 1410 römisch-deutscher König.\\nDas römisch-deutsche Königtum war zu Beginn des 15. Jahrhunderts in eine schwere Krise geraten. Zusammen mit den anderen drei rheinischen Kurfürsten setzte Ruprecht den zunehmend unbeliebt gewordenen König Wenzel 1400 ab, woraufhin er selbst zum König gewählt wurde, wenngleich Wenzel seinen Anspruch nicht aufgab. Ruprechts zehnjähriges Königtum war durch eine nachlassende Integrationskraft des königlichen Hofes und permanente Geldnot geprägt. Ein geplanter Italienzug endete im Fiasko. Ruprecht blieb ohne Kaiserkrone und konnte auch nicht das Herzogtum Mailand für das Reich zurückgewinnen. Finanziell angeschlagen kehrte er an den Rhein zurück. Das legitimatorische Defizit seines Königtums versuchte er durch repräsentative Symbolik wie Grablege, Königssiegel oder eigene Münzprägungen auszugleichen.\\nEr war der einzige mittelalterliche König aus Heidelberg. Ihm gelang es, das Territorium der Kurpfalz zu erweitern. Unter ihm erhielt Heidelberg für kurze Zeit den Charakter einer Hauptstadt des Reiches."},{"page_url":"https://is.wikipedia.org/wiki/M%C3%A4rsta","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/M%C3%A4rsta_fr%C3%A5n_luften_nr_2_Publish.jpg","page_title":"Märsta","context_page_description":"Märsta er þéttbýli í sveitarfélaginu Märsta i Svíþjóð. Þar búa 28.000 manns og 48.000 í sveitarfélaginu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AF%D1%83%D0%B7%D0%B0_(%D0%B2%D0%B0%D0%B3%D0%BE%D0%BD_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/%D0%9C%D0%B0%D1%80%D1%88%D1%80%D1%83%D1%82%D0%BD%D0%B0%D1%8F_%D1%81%D1%85%D0%B5%D0%BC%D0%B0_%D0%9B%D1%8E%D0%B1%D0%BB%D0%B8%D0%BD%D1%81%D0%BA%D0%BE-%D0%94%D0%BC%D0%B8%D1%82%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BB%D0%B8%D0%BD%D0%B8%D0%B8_%D0%B2_%D0%B2%D0%B0%D0%B3%D0%BE%D0%BD%D0%B5_%C2%AB%D0%AF%D1%83%D0%B7%D0%B0%C2%BB_%28%D0%BC%D0%B0%D1%80%D1%82_2018%29.jpg","page_title":"Яуза (вагон метро)","context_page_description":"81-720/721 «Яуза» — тип электровагонов метрополитена. Вагоны модели 81-720 — моторные головные, 81-721 — промежуточные."},{"page_url":"https://en.wikipedia.org/wiki/Kol%C3%AB_Idromeno","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Kol%C3%AB_Idromeno_%28i_ri%29.jpg","page_title":"Kolë Idromeno","context_page_description":"Nikoll Idromeno, better known as Kolë Idromeno, was an Albanian painter, sculptor, architect, photographer, cinematographer, composer and engineer during the Albanian Renaissance in the nineteenth century. He is widely regarded as a precursor of both realism and landscape art in Albania.\\nKolë Idromeno was born in Shkodër, which was at that time part of the Ottoman Empire and the center of culture and religion in Albania. At age 16, he moved to Venice for six months and began his studies at the Accademia di Belle Arti di Venezia. Subsequently, he travelled throughout Europe and moved back to Shkodër and worked essentially in a variety of artistic fields. In addition, he made himself strongly committed for the Independence of Albania whereby he was forced to emigrate to Ulcinj.\\nAmong his important works are a series of paintings where he tried to depict the social aspects of everyday life, customs and religion exactly as it appears. He was also distinguished for its rich use of colours and decorative shades with certain ethnographic elements and landscapes depicting places in or near Shkodër.\\nAs an architect, he drew the plans for around fifty buildings either private and public."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BD%D0%BA%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Inca_Empire_South_America.png","page_title":"Інки","context_page_description":"І́нки — панівний рід народу кечуа, що мешкав на території сучасного Перу та деяких інших країн і створив велику централізовану імперію зі столицею у місті Куско в Андах. Історично інками називали лише чоловічу частину роду правителів. Однак на сьогодні в побуті словом «інки» називають усіх підданих Синів Сонця. Імперія інків існувала досить короткий час — з 1438 до 1533 року. У 1533 році останнього правителя інків Атуальпу задушили іспанські загарбники.\\nАрхеологічні дослідження показують, що велику кількість цивілізаційних здобутків інки успадкували від попередніх цивілізацій, а також від підкорених ними сусідніх народів. До появи на історичній арені інків у Південній Америці існував ряд цивілізацій: Моче, Уарі, Чан-Чан, Наска, Тіауанако, Чачапоя.\\nІмперія інків простягалась довгою смугою у Південній Америці з півночі на південь і включала частини територій сучасних Колумбії, Чилі, Перу, Болівії, Еквадору, Аргентини, а з Куско у чотири сторони виходили чотири дороги і кожну з них іменували згідно з назвою тієї частини імперії, в яку вона вела."},{"page_url":"https://de.wikipedia.org/wiki/Kantega","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Kangtega_%26_Thamserku.JPG","page_title":"Kantega","context_page_description":"Der Kantega ist ein Sechstausender in der Khumbu-Region in Nepal, östlich von Namche Bazar und südlich von Pangboche im sogenannten Hinku Himal.\\nSüdlich des 6783 m hohen Kantega liegen der Kyashar und Kusum Kanguru, westlich der Thamserku, östlich Malanphulan und Peak 41 und nordöstlich die Ama Dablam.\\nDer Kantega ist über einen Bergkamm mit dem Thamserku verbunden. Beide Berge bilden auf den von Namche Bazar ausgehenden Trekkingrouten ein prominentes südliches Panorama. Von ihrem Zwischenkamm ergießt sich in nordöstliche Richtung der Phungi-Gletscher, der in tieferen Lagen in einen Gletscherbach, den Phungi Khola, übergeht. Von der Südseite des Kantega ergießt sich der mächtige King-Taiga-Gletscher, von der Südostseite der Hinku-Nup-Gletscher, die bereits zum Makalu-Barun-Nationalpark gehören."},{"page_url":"https://de.wikipedia.org/wiki/Turmbefestigung_Linz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Linzer_Turmlinie_Turm_9.jpg","page_title":"Turmbefestigung Linz","context_page_description":"Die Turmbefestigung Linz bzw. Maximilianische Turmlinie war eine im frühen 19. Jahrhundert errichtete Befestigungsanlage. Sie bestand aus einem Gürtel von Befestigungstürmen rund um die Stadt Linz und ist auch unter den Namen Donaufestung Linz, Verschanztes Lager von Linz oder Maximilianische Befestigungsanlage bekannt."},{"page_url":"https://ceb.wikipedia.org/wiki/Morelia_nauta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Morelia_nauta_xanthic.jpg","page_title":"Morelia nauta","context_page_description":"Espesye sa bitin ang Morelia nauta. Una ning gihulagway ni HARVEY, BARKER, AMMERMAN ug CHIPPINDALE ni adtong 2000. Ang Morelia nauta sakop sa kahenera nga Morelia sa kabanay nga Boidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://eu.wikipedia.org/wiki/B%C3%A6jarhreppur","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Hr%C3%BAtafj%C3%B6r%C3%B0ur.jpg","page_title":"Bæjarhreppur","context_page_description":"Bæjarhreppur Islandiako ipar-mendebaldean dagoen udalerria da, Vestfirðir eskualdekoa.\\n2011n 100 biztanle zituen."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Notre-Dame_de_Chemill%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Chemill%C3%A9-Melay_%2849%29_%C3%89glise_Notre-Dame_Ext%C3%A9rieur_08.jpg","page_title":"Église Notre-Dame de Chemillé","context_page_description":"L’église Notre-Dame est une église située à Chemillé-en-Anjou, dans le département de Maine-et-Loire, en France."},{"page_url":"https://en.wikipedia.org/wiki/Concourse","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Liverpool_Street_concourse_by_Thos_Nugent.jpg","page_title":"Concourse","context_page_description":"A concourse is a place where pathways or roads meet, such as in a hotel, a convention center, a railway station, an airport terminal, a hall, or other space.\\nThe term is not limited to places where there are literally pathways or roadways or train tracks joining. An alternate meaning now is \\"an open space or hall where crowds gather.\\" In this meaning as a place where crowds gather, while many persons in any crowd no doubt have followed different paths in their lives to get to the place, there need not be notable specific roadways leading to the place."},{"page_url":"https://es.wikipedia.org/wiki/Pierre_d%27Ailly","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Ailly%2C_Pierre_d%27_%E2%80%93_Toledo%2C_Biblioteca_de_la_Catedral_de_Toledo%2C_Manuscritos%2C_40-10%2C_secolo_XIV_%E2%80%93_BEIC_10108998.jpg","page_title":"Pierre d'Ailly","context_page_description":"Pierre d'Ailly fue un geógrafo y teólogo francés que escribió un tratado cosmográfico en 1410, el Imago Mundi."},{"page_url":"https://en.wikipedia.org/wiki/DeGray_Lake_Resort_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/DeGray_Lake_Resort_State_Park_002.jpg","page_title":"DeGray Lake Resort State Park","context_page_description":"DeGray Lake Resort State Park is a 984-acre Arkansas state park in Clark and Hot Spring counties, Arkansas in the United States. Situated in the Ouachita Mountains, the park features the 13,800-acre DeGray Lake, the park features a championship rated 18 hole golf course and Arkansas's only state park resort. The United States Army Corps of Engineers began constructing DeGray Dam on the Caddo River in 1963, and support for a state park began growing shortly after. The park was created in 1974, and the resort and golf course were added by 1975."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D8%A7%D9%86%DA%AF%DB%8C_%D9%88%DB%8C%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Tanguy_Viel.jpg","page_title":"تانگی ویل","context_page_description":"تانگی ویل رمان‌نویس قرن بیستم میلادی اهل فرانسه است."},{"page_url":"https://de.wikipedia.org/wiki/Huaca_de_la_Luna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Two_layers_at_Huaca_de_la_Luna.JPG","page_title":"Huaca de la Luna","context_page_description":"Die Huaca de la Luna ist eine Pyramide aus luftgetrockneten Lehmziegeln im Moche-Tal im Norden Perus in der Nähe von Trujillo."},{"page_url":"https://en.wikipedia.org/wiki/Light-mantled_albatross","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Albatros_fuligineux.jpg","page_title":"Light-mantled albatross","context_page_description":"The light-mantled albatross also known as the grey-mantled albatross or the light-mantled sooty albatross, is a small albatross in the genus Phoebetria, which it shares with the sooty albatross. The light-mantled albatross was first described as Phoebetria palpebrata by Johann Reinhold Forster, in 1785, based on a specimen from south of the Cape of Good Hope."},{"page_url":"https://en.wikipedia.org/wiki/Jubilee_Medal_%2230_Years_of_the_Soviet_Army_and_Navy%22","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/30YSAF.jpg","page_title":"Jubilee Medal \\"30 Years of the Soviet Army and Navy\\"","context_page_description":"The Jubilee Medal \\"30 Years of the Soviet Army and Navy\\" was a state military commemorative medal of the Soviet Union established on February 22, 1948 by decree of the Presidium of the Supreme Soviet of the USSR to denote the thirtieth anniversary of the creation of the Soviet Armed Forces. Its statute was later amended by decree of the Presidium of the Supreme Soviet of the USSR of July 18, 1980."},{"page_url":"https://sv.wikipedia.org/wiki/Jussi_Paatela","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Vanha_kirjastotalo.JPG","page_title":"Jussi Paatela","context_page_description":"Jussi Edvard Paatela, till 1906 Pavén, född 27 februari 1886 i Helsinge, död 30 maj 1962 i Helsingfors var en finländsk arkitekt.\\nPaatela var professor vid Tekniska högskolan 1930–1949 och dess rektor 1943–1946. Han drev 1919–1929 gemensam byrå med brodern Toivo Paatela, med vilken han planerade bland annat Vasa vattentorn, Atlas-banken hushållslärarskolan i Träskända och Anatomiska institutionen vid Helsingfors universitet. Paatela, som räknas till de tidiga funktionalisterna, var synnerligen produktiv och specialiserade sig på sjukhusbyggnader och sanatorier. Av honom ritade byggnader är bland annat Ahvenisto sanatorium i Tavastehus, länssjukhuset i S:t Michel, Tölö sjukhus, Kvinnokliniken, Ögon- och öronkliniken i Helsingfors samt Kiljava sanatorium i Nurmijärvi. Han ritade även Forssa skyddskårshus och agrikultur-forstvetenskapliga fakultetens byggnad vid Helsingfors universitet, det så kallade Forsthuset. Paatelas söner Veli Paatela och Jaakko Paatela fortsatte hans arbete, och han blev sålunda huvudman i en arkitektsläkt i flera led med sjukhusbyggnader som specialitet. Arkitektbyrån Paatela-Paatela & Co drivs numera av sonsonen Mikael Paatela."},{"page_url":"https://hu.wikipedia.org/wiki/Tuvalu","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Display_of_objects_from_Kiribati_and_Tuvalu%2C_Otago_Museum%2C_2016-01-29-2.jpg","page_title":"Tuvalu","context_page_description":"Tuvalu egy óceániai állam, szigetország, a Polinéziához tartozó Ellice-szigetek területén, Hawaii és Ausztrália között, a Csendes-óceánban fekszik. Legközelebbi szomszédai Kiribati, Szamoa és a Fidzsi-szigetek. Négy szigetből, és öt valódi korallzátonyból áll. Teljes szárazföldi területe 26 km². Vatikán és Nauru után a legkisebb népességgel rendelkező ország a Földön. Az ENSZ második legkisebb népességű tagállama. Fizikai méretét illetően Vatikán, Monaco és Nauru után a negyedik legkisebb ország.\\nTuvalu első lakosai polinézek voltak. A sziget a 19. század végén került Egyesült Királyság érdekszférájába. Az Ellice-szigeteket az ország 1892 és 1918 között a Gilbert- és Ellice-szigetek protektorátus részeként kezelte. 1916 és 1974 között gyarmatterület volt. 1974-ben az Ellice-szigeteken szavazást írtak ki, hogy elszakadjanak-e Nagy-Britanniától, s Tuvalu néven új államot hozzanak-e létre. Ennek eredményeként váltak el a Gilbert-szigetektől, mely a függetlenség elnyerése után Kiribati területe lett. Tuvalu a Nemzetközösségen belül 1978-ban lett teljesen független ország."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%87%D8%B1%D8%A8%D8%B1%D8%AA_%D8%A3%D8%B3%D9%83%D9%88%D9%8A%D8%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Herbert_Henry_Asquith.jpg","page_title":"هربرت أسكويث","context_page_description":"هربرت هنري أسكويث ‏.سياسي بريطاني وزعيم حزب الأحرار. تولى رئاسة الوزارة في بريطانيا من 5 أبريل 1908 إلى 5 ديسمبر 1916. في عهده دخلت بلاده الحرب العالمية الأولى عام 1914.\\nولد في مورلي في مقاطعة يوركشاير شمال شرق إنجلترا، تلقى تعليمه في جامعة أوكسفورد وأصبح محاميا في عام 1876.\\nفي عام 1906 تقلد منصب مستشار وزير الخزانة حتى 1908. وفي 1908 أصبح رئيسا للوزراء وطالب مجلس اللوردات بعدد من الإصلاحات بما فيها قانون معاشات المسنين والميزانية العمومية وأدى ذلك إلى خصامه مع مجلس اللوردات في بريطانيا، ولكنه حصل بعد ذلك على موافقة البرلمان على تلك الميزانية وذلك القانون.\\nعام 1916 أثناء الحرب العالمية الأولى أُجبر أسكويث على الاستقالة على إثر ضغوط من الرأي العام الذي أبدى ارتيابا ًكبيراً في قدرة أسكويث في قيادة البلاد في فترة حرجة كتلك. خلفه في رئاسة الوزراء لويد جورج.\\nتوفي بمنزله الريفي في يوركشاير في عام 1928 وطلب قبل أن يموت ألاّ تكون جنازته جنازةً عامةً."},{"page_url":"https://nl.wikipedia.org/wiki/Etropole","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/BUL_%D0%95%D1%82%D1%80%D0%BE%D0%BF%D0%BE%D0%BB%D0%B5_COA.png","page_title":"Etropole","context_page_description":"Etropole is een stad en gemeente in het westen van Bulgarije in de oblast Sofia. Op 31 december 2018 telde Etropole 9.628 inwoners, terwijl de gemeente Etropole, samen met 9 nabijgelegen dorpen, 11.153 inwoners had."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%97%E1%83%A3%E1%83%A0%E1%83%A5%E1%83%94%E1%83%97%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%90%E1%83%9E%E1%83%90%E1%83%A0%E1%83%9A%E1%83%90%E1%83%9B%E1%83%94%E1%83%9C%E1%83%A2%E1%83%9D_%E1%83%90%E1%83%A0%E1%83%A9%E1%83%94%E1%83%95%E1%83%9C%E1%83%94%E1%83%91%E1%83%98_(2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Devlet_Bah%C3%A7eli_VOA_2015_%28cropped%29.jpg","page_title":"თურქეთის საპარლამენტო არჩევნები (2018)","context_page_description":"2018 წლის თურქეთის საპარლამენტო არჩევნები ტარდება საპრეზიდენტო არჩევნების პარალელურად, ამა წლის 24 ივნისს."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BB%D1%8C%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Vista_de_Cella.jpg","page_title":"Селья","context_page_description":"Селья — город и муниципалитет в Испании, входит в провинцию Теруэль, в составе автономного сообщества Арагон. Муниципалитет находится в составе района Большой Теруэль. Занимает площадь 124,30 км². Население — 2951 человек. Находится на расстоянии 22 км от административного центра провинции."},{"page_url":"https://vi.wikipedia.org/wiki/L%C3%BCderitz,_Stendal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Wappen_Luederitz.png","page_title":"Lüderitz, Stendal","context_page_description":"Lüderitz là một đô thị thuộc huyện Stendal, bang Sachsen-Anhalt, Đức. Đô thị Lüderitz, Stendal có diện tích 38,84 kilômét vuông, dân số thời điểm ngày 31 tháng 12 năm 2006 là 1127 người."},{"page_url":"https://de.wikipedia.org/wiki/Landtagswahl_in_Schleswig-Holstein_2017","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/1473-ri-110-Patrick_Breyer_Piraten.jpg","page_title":"Landtagswahl in Schleswig-Holstein 2017","context_page_description":"Die Landtagswahl in Schleswig-Holstein 2017 war die Wahl zum 19. Landtag von Schleswig-Holstein. Sie fand am 7. Mai 2017 statt. Wahlberechtigt waren mehr als 2,3 Millionen Schleswig-Holsteiner, darunter zum ersten Mal auch rund 57.000 Jugendliche ab 16 Jahren. Die Wahlbeteiligung lag bei 64,2 Prozent, 2012 hatte sie bei 60,2 Prozent gelegen.\\nEtwa fünf Wochen nach der Wahl vereinbarten CDU, Grüne und FDP, eine Koalition zu schließen. Am 28. Juni 2017 wurde Daniel Günther zum Ministerpräsidenten gewählt, er hat daraufhin sein Kabinett ernannt."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%84%D9%88%D8%B1%D8%AF%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Mosaic_in_the_in_the_Rosary_Basilica%2C_Lourdes_2.JPG","page_title":"لوردس","context_page_description":"لوردس، فرانسه‌ده یئر آلان بیر کومون دیر و متر دنیز سویه‌سیندن اۇجالیقی وار. ۳۶٫۹۴ کیلومتر موربّع ساحه‌سی وار. بۇ شهرین نۆفوسو، ۲۰۱۴-نجی ایلين نۆفوس ساییمی اساسيندا ۱۵۲۵۴ نفر ایمیش."},{"page_url":"https://fr.wikipedia.org/wiki/Oscar_Hedstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Three-wheeled_Mail_Collection_Motorcycle_%282551110108%29.jpg","page_title":"Oscar Hedström","context_page_description":"Oscar Hedström est un industriel américain, d'origine suédoise, co-fondateur du constructeur de moto américaine de légende Indian en 1901."},{"page_url":"https://de.wikipedia.org/wiki/Hans-J%C3%BCrgen_Treder","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Hans-J%C3%BCrgen_Treder.jpg","page_title":"Hans-Jürgen Treder","context_page_description":"Hans-Jürgen Treder war einer der führenden theoretischen Physiker und Astrophysiker in der DDR und international anerkannte Autorität auf dem Gebiet der Gravitationsphysik und Kosmologie. Außerdem beschäftigte er sich mit Wissenschaftsgeschichte und -philosophie."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1845","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Smits%2C_Johannes_Theodorus.jpg","page_title":"Lijst van personen overleden in 1845","context_page_description":"Dit is een lijst van personen die overleden zijn in 1845.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B5%D0%BD%D0%BD%D1%8B%D0%B9_%D0%B4%D0%BE%D0%BC-%D0%BC%D1%83%D0%B7%D0%B5%D0%B9_%D0%9F._%D0%98._%D0%A7%D0%B0%D0%B9%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Pjotr_T%C5%A1aikovskin_kotimuseo_2.jpg","page_title":"Государственный дом-музей П. И. Чайковского","context_page_description":"Государственный мемориальный музыкальный музей-заповедник П. И. Чайковского — музей в городе Клин Московской области. Расположен в доме, который знаменитый русский композитор Пётр Ильич Чайковский снимал у мирового судьи В. С. Сахарова в последние 2 года жизни, с мая 1892 года.\\nСтарейший мемориальный музыкальный музей в России, созданный младшим братом композитора — М.И. Чайковским, был открыт через год после смерти композитора. Своих первых посетителей принял 9 декабря 1894 года. В доме полностью сохранена бытовая обстановка последних лет жизни композитора, его личные вещи, библиотека, архив.\\nОбъект культурного наследия народов России федерального значения."},{"page_url":"https://en.wikipedia.org/wiki/1891_Martinique_hurricane","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/1891_Atlantic_hurricane_3_track.png","page_title":"1891 Martinique hurricane","context_page_description":"The 1891 Martinique hurricane, also known as Hurricane San Magín, was an intense major hurricane that struck the island of Martinique and caused massive damage. It was the third hurricane of the 1891 Atlantic hurricane season and the only major hurricane of the season. It was first sighted east of the Lesser Antilles on August 18 as a Category 2 hurricane. The storm made landfall on the island of Martinique, where it caused severe damage, over 700 deaths and at least 1,000 injuries. It crossed eastern Dominican Republic while tracking on a northwestward direction on August 19–20, passed the Mona Passage on August 20 and the Bahamas on August 22–23. It crossed the U.S. State of Florida and dissipated in the Gulf of Mexico after August 25. Total damage is estimated at $10 million. The storm is considered to be the worst on Martinique since 1817."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%83%D1%80%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Vourles_-_%C3%89glise_Saint-Bonnet.jpg","page_title":"Вурль","context_page_description":"Вурль — муніципалітет у Франції, у регіоні Рона-Альпи, департамент Рона. Населення — 3338 осіб.\\nМуніципалітет розташований на відстані близько 400 км на південний схід від Парижа, 13 км на південний захід від Ліона."},{"page_url":"https://en.wikipedia.org/wiki/Petasites_spurius","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Petasites_spurius.JPG","page_title":"Petasites spurius","context_page_description":"Petasites spurius is a flowering plant of the genus Petasites in the family Asteraceae."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%83%D0%BB%D0%BE%D0%BA_(%D0%93%D0%BE%D1%80%D1%9A%D0%B0_%D0%93%D0%B0%D1%80%D0%BE%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Bouloc_Eglise_Plafond_de_l%27abside.jpg","page_title":"Булок (Горња Гарона)","context_page_description":"Булок насеље је и општина у јужној Француској у региону Миди Пирене, у департману Горња Гарона која припада префектури Тулуз.\\nПо подацима из 2011. године у општини је живело 4144 становника, а густина насељености је износила 223,4 становника/km². Општина се простире на површини од 18,55 km². Налази се на средњој надморској висини од 196 метара."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B8%B7%E0%B8%99%E0%B9%84%E0%B8%A3%E0%B9%80%E0%B8%9F%E0%B8%B4%E0%B8%A5%E0%B8%8B%E0%B8%B8%E0%B9%88%E0%B8%A1%E0%B8%A2%E0%B8%B4%E0%B8%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/M-40A3.jpg","page_title":"ปืนไรเฟิลซุ่มยิง","context_page_description":"คำศัพท์ในทางการทหารและหน่วยงานบังคับใช้กฎหมาย ปืนไรเฟิลซุ่มยิง คือปืนเล็กยาวที่สามารถวางตำแหน่งกระสุนได้แม่นยำในระยะยิงที่ไกลกว่าอาวุธปืนประจำกายชนิดอื่น ปืนไรเฟิลซุ่มยิงโดยทั่วไปจะถูกสร้างขึ้นอย่างระมัดระวังในความถูกต้องเหมาะสม ติดตั้งกล้องเล็ง และรังเพลิงสำหรับปลอกกระสุนชนวนกลาง คำๆนี้บ่อยครั้งที่ในสื่อใช้บรรยายถึงปืนที่ติดตั้งกล้องส่องเพิ่มที่ใช้กับเป้าหมายที่เป็นบุคคล\\nบทบาททางทหารของพลซุ่มยิง สามารถสืบย้อนไปได้ถึงคริสต์ศตวรรษที่ 18 แต่ปืนไรเฟิลซุ่มยิงที่แท้จริงกลับมีการพัฒนาเป็นอย่างมากเมื่อเร็วๆนี้ ความก้าวหน้าของเทคโนโลยีโดยเฉพาะกล้องส่องและอุตสาหกรรมการผลิตยิ่งช่วยเพิ่มความแม่นยำให้กับปืน ยิ่งถูกใช้ด้วยบุคลากรทางกองทัพที่ได้รับการฝึกเป็นพิเศษปืนจะยิ่งได้แม่นยำไกลกว่าปืนไรเฟิลปกติ ปืนไรเฟิลซุ่มยิงอาจมีพื้นฐานจากปืนไรเฟิลพื้นฐานแต่เมื่อติดกล้องส่องมันก็จะกลายเป็นปืนไรเฟิลซุ่มยิง"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Seifhennersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Kronenweg_3.jpg","page_title":"Liste der Kulturdenkmale in Seifhennersdorf","context_page_description":"In der Liste der Kulturdenkmale in Seifhennersdorf sind die Kulturdenkmale der sächsischen Stadt Seifhennersdorf verzeichnet, die bis Februar 2019 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale im Landkreis Görlitz."},{"page_url":"https://de.wikipedia.org/wiki/Kabinett_Jazenjuk_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Vyacheslav_Kyrylenko_2012.jpg","page_title":"Kabinett Jazenjuk II","context_page_description":"Am 2. Dezember 2014 wurde das zweite Ministerkabinett Jazenjuk von der Werchowna Rada, dem Parlament der Ukraine, als neue Regierung der Ukraine, bestätigt, nachdem fünf der Parteien, die bei der Parlamentswahl im Oktober 2014 in das neue Parlament gewählt worden waren, am 21. November einen Koalitionsvertrag vorgestellt hatten.\\nArsenij Jazenjuk wurde am 27. November 2014 erneut zum Ministerpräsidenten der Ukraine gewählt und kann die in der vergangenen Regierungsperiode begonnene Annäherung an die Europäische Union fortsetzen. Er erhielt 341 Stimmen der Parlamentsabgeordneten, notwendig zur Wiederwahl waren lediglich 226 Stimmen.\\nDas zweite Ministerkabinett Jazenjuk wurde am 14. April 2016 durch das Ministerkabinett Hrojsman abgelöst."},{"page_url":"https://es.wikipedia.org/wiki/La_Uni%C3%B3n_(Lempira)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/16/La_Union%2CLempira_3.JPG","page_title":"La Unión (Lempira)","context_page_description":"La Unión es un municipio del departamento de Lempira, Honduras."},{"page_url":"https://en.wikipedia.org/wiki/Daniel_Hitchcock","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/SiegeBoston.jpg","page_title":"Daniel Hitchcock","context_page_description":"Daniel Hitchcock was born in Massachusetts and graduated from Yale University. He moved to Providence, Rhode Island where he became an attorney and was suspected by the authorities of involvement in the Gaspee Affair. At the start of the American Revolutionary War he formed Hitchcock's Regiment of infantry in the Rhode Island Army of Observation. He was first appointed lieutenant colonel in command of the regiment when it marched to serve in the Siege of Boston in 1775. His regiment was renamed the 11th Continental Regiment during 1776. That year, he led his troops at Long Island, Harlem Heights, and White Plains.\\nHe was promoted to colonel in November 1776. His regiment was renamed the 2nd Rhode Island Regiment at the start of 1777. He led a small brigade of Rhode Island troops at Assunpink Creek and Princeton. At the latter action on 3 January 1777, George Washington publicly thanked him for his efforts. He died ten days later of tuberculosis at Morristown, New Jersey."},{"page_url":"https://de.wikipedia.org/wiki/Cantique_de_Jean_Racine_(Faur%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Verbe%2C_%C3%A9gal_au_Tr%C3%A8s-Haut.jpg","page_title":"Cantique de Jean Racine (Fauré)","context_page_description":"Cantique de Jean Racine, Op. 11, ist eine Komposition für gemischten Chor und Klavier oder Orgel von Gabriel Fauré. Die Textgrundlage ist eine französische Nachdichtung eines ambrosianischen Hymnus durch Jean Racine. Fauré vollendete die Vertonung im Jahr 1865 noch als Student für einen Kompositionswettbewerb und erzielte den ersten Preis. Das Werk weist auf sein späteres Requiem voraus, mit dem es oft zusammen aufgeführt wird."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Ferrovi%C3%A1ria_de_Santa_Margarida","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Flickr_-_nmorao_-_IC_540%2C_Esta%C3%A7%C3%A3o_de_Santa_Margarida%2C_2009.09.15.jpg","page_title":"Estação Ferroviária de Santa Margarida","context_page_description":"A Estação Ferroviária de Santa Margarida é uma gare ferroviária da Linha da Beira Baixa, que serve a localidade de Santa Margarida da Coutada, no Distrito de Santarém, em Portugal."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9B%CE%B5%CE%BF%CF%80%CF%8C%CE%BB%CE%B4%CE%BF%CF%82_%CE%94%CE%84_%CF%84%CE%BF%CF%85_%CE%86%CE%BD%CF%87%CE%B1%CE%BB%CF%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Leopold_IV_Anhalt.jpg","page_title":"Λεοπόλδος Δ΄ του Άνχαλτ","context_page_description":"Ο Λεοπόλδος Δ΄, γερμ. Luitpold IV από τον Οίκο των Ασκάνια ήταν δούκας του Άνχαλτ-Ντεσάου, Άνχαλτ-Κέτεν, Άνχαλτ-Μπέρνμπουρκ και μετά την ενοποίησή τους, του Άνχαλτ."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D1%8B%D0%B5_%D0%93%D0%BE%D1%80%D0%BA%D0%B8_(%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/%D0%A1%D1%82%D0%B0%D1%80%D1%8B%D0%B5_%D0%93%D0%BE%D1%80%D0%BA%D0%B8%28%D0%9A%D0%B0%D0%B7%D0%B0%D0%BD%D1%8C%29%3D2.JPG","page_title":"Старые Горки (Казань)","context_page_description":"Старые Горки — бывшая деревня Горки, в настоящее время — посёлок в составе Казани, официально имеющий статус жилого массива."},{"page_url":"https://sh.wikipedia.org/wiki/Pacifikacija_Kube","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/TAFT1909.JPG","page_title":"Pacifikacija Kube","context_page_description":"Pacifikacija Kube, znana i kao Druga okupacija Kube, bila je velika američka vojna operacija koja je formalno započela u rujnu 1906. godine, a smatra se dijelom Banana ratova. Nakon što je režim Tomása Estrade Palme bio pred kolapsom, ovaj je zatražio pomoć Sjedinjenih Država, koje su bile spremne intervenirati kako bi zaštitile svoje interese.\\nPredsjednik Theodore Roosevelt, zaprimivši Palminu molbu, šalje svogtajnika za rat, Williama Howarda Tafta, i zamjenika državnog tajnika, Roberta Bacona, na Kubu kako bi dogovorili diplomatsko rješenje. Međutim, Taft se na Kubi pozvao na odredbe Kubansko-američkog sporazuma iz 1903. te je uspostavio privremenu vladu na čijem je čelu kratko bio on, a nakon njega Charles Edward Magoon. Amerikanci su intervenirali na Kubi s ciljem sprječavanja građanskih nemira i održavanja slobodnih izbora, ali primarno kako bi zaštitili vlastite ekonomske interese na Kubi.\\nNakon gotovo četiri godine okupacije, američke trupe su konačno napustile Kubu nakon procjene da je izbor Joséa Miguela Gómeza za predsjednika znak dovoljne političke stabilnosti. Povlačenje trupa zaključeno je u veljači 1909. godine."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%88%D8%B3%D9%8A%D9%82%D9%89_%D8%A7%D9%84%D8%AA%D8%A8%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Street_musician_Xigatse_1993.JPG","page_title":"موسيقى التبت","context_page_description":"تعكس موسيقى التبت التراث الثقافي لمنطقة ما وراء جبال الهيمالايا، متركزة في التبت ولكن تُعرف أيضًا لدى أي جماعات عرقية تبتية توجد في نيبال وبوتان والهند وفي الخارج. الموسيقى التبتية في المقام الأول هي موسيقى دينية، تعكس التأثير العميق للبوذية التبتية على الثقافة.\\nفي الغرب، يسوّق لموسيقى أجراس «أواني الغناء» التابعة لنمط موسيقى العصر الجديد على أنها «موسيقى تبتبة»، في حين أنها من أصل أمريكي يعود لسبعينيات القرن المنصرم."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%B4%D5%A2%D5%A5%D6%80%D5%A4_(%D5%A1%D5%B4%D6%80%D5%B8%D6%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Amberd_arch.jpg","page_title":"Ամբերդ (ամրոց)","context_page_description":"Ամբերդ, Ամպիր, Անբերդ, Համբերդ, Հանբերդ, Ղըզղալա, միջնադարյան նախկին բերդաքաղաք և ամրոց։ Կառուցվել է 11-13-րդ դարերում, Արագած լեռան հարավային լանջին՝ Բյուրական գյուղից 7 կմ հյուսիս: Տեղադրված է եռանկյունաձև հրվանդանին, ծովի մակերևույթից 2300 մետր բարձրության վրա՝ Արքաշեն և Ամբերդ գետերի միացման տեղում:\\nԳտնվել է Մեծ Հայքի Այրարատ նահանգի Արագածոտն գավառում, իսկ ներկա վարչական բաժանման համաձայն՝ Արագածոտնի մարզում՝ մայրաքաղաք Երևանից 55 կիլոմետր դեպի հյուսիս:"},{"page_url":"https://en.wikipedia.org/wiki/Bagad_Kemper","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Photo_-_Festival_de_Cornouaille_2013_-_Dan_ar_Braz_en_concert_le_27_juillet_-_135.jpg","page_title":"Bagad Kemper","context_page_description":"Bagad Kemper is one of the oldest bagad, Breton pipe bands. Formed in 1949, its first president was none other than Loeïz Ropars, renovator of the Fest Noz and kan ha diskan singer. This ensemble holds the record for the most national Championship title wins.\\nOver time, this bagad has gradually reoriented itself toward collaborations with musicians from other traditions, like the Galician Susana Seivane and Carlos Núñez or South-African Johnny Clegg. Bagad Kemper were also a main feature of the very successful Heritage des Celtes series of concerts, which brought together musicians from all horizons of the Celtic world. They celebrated their 60th anniversary with Breizh Balkanik, a show blending Balkan and Breton music worlds, with the Breton singer Erik Marchand. Except Dan Ar Braz, the bagad also accompanied on stage the band Red Cardell."},{"page_url":"https://pl.wikipedia.org/wiki/Wybory_prezydenckie_na_Ukrainie_w_2019_roku","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/%D0%9A%D1%80%D0%B8%D0%B2%D0%B5%D0%BD%D0%BA%D0%BE_3_%28cropped%29.jpg","page_title":"Wybory prezydenckie na Ukrainie w 2019 roku","context_page_description":"Wybory prezydenckie na Ukrainie w 2019 roku – zostały przeprowadzone w dwóch turach 31 marca i 21 kwietnia. W pierwszej turze wyborów zwyciężył Wołodymyr Zełenski z wynikiem 30,2%. Drugie miejsce z wynikiem ponad 15,9% głosów zajął urzędujący prezydent Petro Poroszenko. Według sondaży exit poll II turę wyborów wygrał Wołodymyr Zełenski zdobywając około 73% głosów. Petro Poroszenko zdobył 27,3% głosów."},{"page_url":"https://en.wikipedia.org/wiki/Metropolis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/2_Chome_Hamamatsuch%C5%8D%2C_Minato-ku%2C_T%C5%8Dky%C5%8D-to_105-0013%2C_Japan_-_panoramio_%284%29.jpg","page_title":"Metropolis","context_page_description":"A metropolis is a large city or conurbation which is a significant economic, political, and cultural center for a country or region, and an important hub for regional or international connections, commerce, and communications. The term is Ancient Greek and means the \\"mother city\\" of a colony, that is, the city which sent out settlers. This was later generalized to a city regarded as a center of a specified activity, or any large, important city in a nation.\\nA big city belonging to a larger urban agglomeration, but which is not the core of that agglomeration, is not generally considered a metropolis but a part of it. The plural of the word is metropolises, although the Latin plural is metropoles, from the Greek metropoleis.\\nFor urban centers outside metropolitan areas that generate a similar attraction on a smaller scale for their region, the concept of the regiopolis was introduced by urban and regional planning researchers in Germany in 2006."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E3%81%AE%E3%82%B9%E3%82%AD%E3%83%BC%E5%A0%B4%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Hatchibuseyama02s2048.jpg","page_title":"日本のスキー場一覧","context_page_description":"日本のスキー場一覧は、日本に現存する、あるいはかつて存在したスキー場の一覧である。以下は地域別・五十音順。\\nクロスカントリースキー場については日本のクロスカントリースキー場一覧を参照のこと。"},{"page_url":"https://pt.wikipedia.org/wiki/Temporada_de_furac%C3%B5es_no_oceano_Atl%C3%A2ntico_de_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Gert_2017_track.png","page_title":"Temporada de furacões no oceano Atlântico de 2017","context_page_description":"A temporada de furacões no Atlântico de 2017 foi uma temporada hiperactiva, extremamente mortal e catastrófica de ciclones tropicais que, com um total de danos de ao menos $ 282.28 bilhões, foi a temporada mais cara da história. Com mais de 3,300 mortes, dito ano foi a temporada mais mortífera desde a ano de 2005 e também o sétimo com o valor mais alto Energia ciclônica acumulada. A maior parte do dano da temporada deveu-se a três furacões maiores: Harvey, Irma e Maria. Outro furacão notável, Nate, foi o pior desastre natural na história da Costa Rica; Harvey, Irma, Maria e Nate tiveram que retirar os nomes devido aos seus altos custos de danos e perda de vidas. Com dezassete tempestades nomeadas, dez furacões e seis furacões maiores, a temporada localiza-se junto à temporada de 1936 como a quinta temporada mais activa desde que começaram os registos confiáveis em 1851. A temporada teve os furacões mais importantes desde 2005. Esta temporada também é uma de seis anos na história à apresentar múltiplos número total furacões de categoria 5 e a única temporada que não seja 2007 com dois furacões tocando terra com essa intensidade."},{"page_url":"https://fr.wikipedia.org/wiki/Koenigsegg_Agera_RS","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Koenigsegg_Agera_RS.JPG","page_title":"Koenigsegg Agera RS","context_page_description":"La Koenigsegg Agera RS est une voiture de sport produite par le constructeur automobile suédois Koenigsegg, dévoilée au salon international de l'automobile de Genève 2015. Version évoluée de la Koenigsegg Agera, elle est propulsée par un moteur V8 de 5 L de cylindrée développant 1 160 à 1 383 ch. Sa production est limitée à 25 exemplaires. La Koenigsegg Agera RS produit 450 kg d'appui aérodynamique à 250 km/h."},{"page_url":"https://gl.wikipedia.org/wiki/Procavia_capensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/20130925_Serengeti5517_Daman_des_rochers.jpg","page_title":"Procavia capensis","context_page_description":"Procavia capensis, é unha especie de mamífero da orde dos hiracoideos, o tipo da familia dos procavíidos e única especie actual do xénero Procavia.\\nÉ un dos damáns máis estendidos por toda África, chegando tamén ao oeste da península Arábiga. Habitante dos rochedos, en aparencia aseméllase a unha marmota común ou a un coello de Indias, coas súas curtas orellas e cola."},{"page_url":"https://en.wikipedia.org/wiki/T._S._Ramasamy_Pillai","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/T.S._Ramaswami_Pillai.jpg","page_title":"T. S. Ramasamy Pillai","context_page_description":"T. S. Ramaswami Pillai was an Indian politician, freedom fighter and former Member of the Legislative Assembly. He was elected to the Travancore-Cochin assembly from Thovalai Agastheeswaram constituency in 1952 election as an Indian National Congress candidate. Thovalai Agastheeswaram was a two-member constituency and the other winner was A. Samraj from the same party.\\nHe won the 1954 election again as a Praja Socialist Party candidate from Thovalai constituency. He was elected to Tamil Nadu legislative assembly as an Independent candidate from Kanyakumari constituency in 1957 election."},{"page_url":"https://vi.wikipedia.org/wiki/Ulmus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Callus_cuttings_of_elm.jpg","page_title":"Ulmus","context_page_description":"Ulmus là một chi thực vật trong họ Ulmaceae."},{"page_url":"https://pt.wikipedia.org/wiki/Jogos_Ol%C3%ADmpicos_de_Ver%C3%A3o_de_2028","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/14/11-11-06-GalenCenter.jpg","page_title":"Jogos Olímpicos de Verão de 2028","context_page_description":"Os Jogos Olímpicos de 2028, conhecidos oficialmente como os Jogos da XXXIV Olimpíada, mais comumente Los Angeles 2028, será um evento multiesportivo realizado no segundo semestre de 2028, em Los Angeles, Estados Unidos.\\nA escolha da cidade-sede era programada para iniciar em 2019, com a escolha da sede em 2021. No entanto, após dificuldades com as cidades que retiraram suas postulações no processo de escolha para as sedes dos jogos de Inverno de 2022 e Verão de 2024, o Comitê Olímpico Internacional decidiu, em julho de 2017, escolher ao mesmo tempo a sede das edições de 2024 e 2028. Em 31 de julho de 2017, o COI anunciou que Los Angeles sediaria a edição de 2028, enquanto Paris sediaria a edição de 2024. Em 13 de setembro de 2017, durante a 131ª Sessão em Lima, Peru, o Comitê Olímpico Internacional ratificou e oficializou a decisão.\\nSerá a quinta edição dos Jogos Olímpicos de Verão sediada nos Estados Unidos e a terceira sediada em Los Angeles após 1932 e 1984. Los Angeles também será a terceira cidade a sediar três edições dos Jogos, depois de Londres e Paris."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8A%E6%B5%B7%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Pudong_International_Airport_at_night.jpg","page_title":"上海市","context_page_description":"上海市，簡稱滬，別稱申，是中華人民共和國直轄市，中國的經濟、金融、貿易和航運中心，世界著名的港口城市，是中國人口最多的城市。上海位於中國東部弧形海岸線的正中間，長江三角洲最東部，東臨東海，南瀕杭州灣，西與江蘇、浙江兩省相接，北端的崇明島處於長江入海口中，與周圍的江蘇、浙江、安徽三省多個城市共同構成世界級城市群長江三角洲城市群，是其重要的組成部分。\\n最晚在新石器時代，上海地區已經有先民聚居. 春秋時代，上海由吳國管轄，戰國時代則是楚國領土.\\n晉代，上海的人口聚集起來，初步發展為一個區域的漁港、鹽產地和商貿集鎮。唐代到元代，上海所屬地區歸華亭縣、松江府管轄。明清兩朝，已成較為繁榮的村落，棉紡織業發達。1843年，《南京條約》簽訂，正式開埠，上海作為指定通商五口之一，開始上海租界的歷史，亦開啟上海取得舉足輕重地位的歷程。當時名蘇淞太常道與上海縣，從小聚落成為港口之後，得益獨特的政治環境，上海經濟憑藉通商口岸，各方面得到空前迅速的發展，吸引江蘇、浙江、廣東、安徽、山東等周邊省份及外國移民，成為中國乃至遠東地區最大的都會至今。吸收江南地區附近傳統的吳越文化與各地移民帶入的多樣文化，及開埠後的西方近現代文化融合，逐漸形成上海本地特有的海派文化。\\n中華民國時期，上海是亞洲最大的城市之一，中國最重要的工商業中心，被蔣中正評價為「中外觀瞻之所系」。中華人民共和國政府成立後，中央政府實行計劃經濟，主要發展內陸的重工業等。上海大量支援中國大陸其他地區的發展。1990年，上海迎來浦東開發開放政策，經濟成長速度加快；2005年設立國家綜合配套改革試驗區，2013年批准成立上海自貿區，令上海經濟進一步發展，成為中國大陸的經濟、金融、貿易中心城市，在世界金融、商貿及交通領域亦取得重要地位。上海港已經是世界規模最大的貨櫃港口，上海證券交易所作為中國大陸兩所證券交易所之一，市值排名世界第四位。\\n上海是中國近、現代經濟發展的典範，擁有不少著名地標景觀，包括豫園、城隍廟、南京路、外灘、陸家嘴摩天大樓天際線等。上海也是中國重要的旅遊城鎮之一，被《米其林旅遊指南》評為「三星級旅遊推薦」。"},{"page_url":"https://de.wikipedia.org/wiki/Nanjing_S%C3%BCdbahnhof","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/South_Nanjing_Station_2011.JPG","page_title":"Nanjing Südbahnhof","context_page_description":"Nanjing Südbahnhof, auch bekannt als Bahnhof Nanjing Nan, ist ein Bahnhof in der Stadt Nanjing in der chinesischen Provinz Jiangsu. Er wurde 2011 eröffnet und dient vorrangig dem Hochgeschwindigkeitsverkehr."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D1%86%D0%B8%D0%BB%D0%BB%D1%8B_(%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Bacillus_subtilis_Gram.jpg","page_title":"Бациллы (род)","context_page_description":"Бациллы — обширный род грамположительных палочковидных бактерий, образующих внутриклеточные споры. Большинство бацилл — почвенные редуценты. Некоторые бациллы вызывают болезни животных и человека, например сибирскую язву, токсикоинфекции. Типовой вид — сенная палочка typus."},{"page_url":"https://en.wikipedia.org/wiki/List_of_current_members_of_the_United_States_House_of_Representatives","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Brian_Babin_115th_Congress_%28cropped%29.jpg","page_title":"List of current members of the United States House of Representatives","context_page_description":"This is a list of individuals currently serving in the United States House of Representatives."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_z%C3%A1mk%C5%AF_v_Kr%C3%A1lov%C3%A9hradeck%C3%A9m_kraji","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Starkov_zamek1.jpg","page_title":"Seznam zámků v Královéhradeckém kraji","context_page_description":"Seznam zámků v Královéhradeckém kraji. Jedná se o seznam dosud stojících zámků v Královéhradeckém kraji:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BC%D0%BE%D1%80%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D1%96_%D0%BC%D1%83%D1%87%D0%B5%D0%BD%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/uk/d/da/Siege-of-amorium1-300x175.jpg","page_title":"Аморійські мученики","context_page_description":"Аморійські мученики — святі, мученики, 42 полонених в Аморії візантійські воєначальники. За відмову перейти в іслам були вбиті за наказом халіфа Аль-Васіка 845 р. у місті Самаррі. Пам'ять — 19 березня"},{"page_url":"https://en.wikipedia.org/wiki/Stefan_Szczesny","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Szczesny-Portrait.jpg","page_title":"Stefan Szczesny","context_page_description":"Stefan Szczesny is a German painter, draughtsman, and sculptor.\\nHe is best known for co-founding the Neue Wilde movement in the early 1980s."},{"page_url":"https://es.wikipedia.org/wiki/Hacienda_de_Santa_Mar%C3%ADa_Regla","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Santa_Maria_Regla_32.JPG","page_title":"Hacienda de Santa María Regla","context_page_description":"La hacienda de Santa María Regla; esta construcción del siglo XVIII que fuera la residencia del conde de Regla, Pedro Romero de Terreros. Se localiza en Santa María Regla, 4 km al noreste de la localidad de Huasca de Ocampo en el municipio homónimo, dentro del estado de Hidalgo en México.​"},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%DB%8C%D8%B1%D8%B4%D8%A7%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Hirschberg_%28Saale%29-2008-03b.jpg","page_title":"هیرشاو","context_page_description":"هیرشبرق آلمانین تورینقن ایالتینده یئر آلان بیر شهردیر و ۴۵۴ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۲۵۲۶ نفر دیر. بۇ شهرین ۲۴٫۱۲ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://pt.wikipedia.org/wiki/Kepler-11d","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Kepler-11_planets_comparison.jpg","page_title":"Kepler-11d","context_page_description":"Kepler-11d é um exoplaneta descoberto na órbita de uma estrela parecida com o Sol, Kepler-11. Possui esse nome pelo telescópio que o descobriu, uma sonda da NASA chamado Kepler que é projetado para detectar planetas semelhantes à Terra, medindo pequenas variações no brilho de suas estrelas, quando os planetas cruzam na sua frente. Este processo, conhecido como o método de trânsito, foi usado para observar a presença de seis planetas em órbita ao redor de Kepler-11, dos quais Kepler-11d é o terceiro mais próximo de sua estrela. Kepler-11d orbita Kepler-11, aproximadamente a cada 23 dias. O planeta tem aproximadamente seis vezes mais massa da Terra e tem um raio que é três vezes e meia maior do que a da Terra. É, no entanto, muito mais quente do que a Terra. A sua baixa densidade, comparável ao de Saturno, sugere que Kepler-11d tem uma grande atmosfera de hidrogênio e hélio. Kepler-11d foi anunciado com seus cinco planetas irmãos em 2 de fevereiro de 2011, após extensos estudos de acompanhamento."},{"page_url":"https://vi.wikipedia.org/wiki/Calumma_gastrotaenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Furcifer_campani_-_Juwelencham%C3%A4leon_-_Peyrieras-Reservat_%286459431155%29.jpg","page_title":"Calumma gastrotaenia","context_page_description":"Calumma gastrotaenia là một loài thằn lằn trong họ Chamaeleonidae. Loài này được Boulenger mô tả khoa học đầu tiên năm 1888."},{"page_url":"https://en.wikipedia.org/wiki/Sinyavino_Offensive_(1942)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Sinyavin_offensive_25_09.JPG","page_title":"Sinyavino Offensive (1942)","context_page_description":"The Sinyavino Offensive was an operation planned by the Soviet Union in the summer of 1942 with the aim of breaking the Siege of Leningrad, which had begun the previous summer, and establish a reliable supply line to Leningrad. At the same time, German forces were planning Operation Northern Light to capture the city and link up with Finnish forces. To achieve that heavy reinforcements were arriving from Sevastopol, which the German forces captured in July 1942. Both sides were unaware of the other's preparations, and this made the battle unfold in an unanticipated manner for both sides.\\nThe Soviet offensive began first in two stages. The Leningrad Front began the offensive on August 19 and the Volkhov Front launched the main offensive on August 27. From August 28, the German side shifted the forces which were building up for their own offensive to gradually halt the Soviet offensive. Initial German counterattacks failed, but the Soviet forces could not advance either. After a ten-day stalemate, the significantly reinforced Germans launched a counterattack against the Soviet forces on September 21."},{"page_url":"https://de.wikipedia.org/wiki/Charta_von_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Europa_Organisationen.png","page_title":"Charta von Paris","context_page_description":"Die Charta von Paris ist ein grundlegendes internationales Abkommen über die Schaffung einer neuen friedlichen Ordnung in Europa nach der Wiedervereinigung Deutschlands und der Einstellung der Ost-West-Konfrontation. Sie wurde am 21. November 1990 in Paris als Schlussdokument der KSZE-Sondergipfelkonferenz von 32 europäischen Ländern sowie den USA und Kanada unterschrieben. Die Staats- und Regierungschefs der Teilnehmerstaaten erklärten die Spaltung Europas für beendet, verpflichteten sich zur Demokratie als einziger Regierungsform und sicherten ihren Völkern die Gewährleistung der Menschenrechte und Grundfreiheiten zu. Die Charta von Paris dokumentierte das Ende des Kalten Krieges und der Teilung Europas.\\nDurch die Krimkrise und den kriegerischen Konflikt in der Ostukraine sehen einige Politiker und Publizisten das Ergebnis in Frage gestellt."},{"page_url":"https://de.wikipedia.org/wiki/Kahlgrachtm%C3%BChle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/AC-Kahlgracht54.JPG","page_title":"Kahlgrachtmühle","context_page_description":"Die Kahlgrachtmühle war eine oberschlächtige Wassermühle am Haarbach in der Stadt Aachen in der nordrhein-westfälischen Städteregion Aachen im Regierungsbezirk Köln."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D1%80%D0%BD%D0%B0%D1%80,_%D0%A1%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Sarah_Bernhardt%2C_par_Nadar%2C_1864.jpg","page_title":"Бернар, Сара","context_page_description":"Сара Берна́р — французская актриса, которую в начале XX века называли «самой знаменитой актрисой за всю историю». Успеха она добилась на сценах Европы в 1870-х годах, а затем с триумфом гастролировала и в Америке. В её амплуа были в основном серьёзные драматические роли, из-за чего актриса получила прозвище «Божественная Сара». В её честь назван кратер Бернар на Венере."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D8%AA_%D8%AC%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Beit_Jann%2C_Israel.JPG","page_title":"بيت جن","context_page_description":"بيت جن هي قرية عربيَّة درزية تقع ضمن أراضي الجليل الأعلى، وتقع إداريًا في المنطقة الشمالية شمال إسرائيل، وعلى ارتفاع 930 - 1030 مترًا فوق سطح البحر، وهي اعلى قرى إسرائيل. مناخها غالباً بارد نسبة لارتفاعها وفي فصل الشتاء تتساقط فيها الثلوج. وتمتد مساحتها على 9,079 دونم من الأراضي، وهذا ما يعادل حوالي 50% من الاراضي الأصلية لسكان لقريه، حيث أن باقي الاراضي صودرت تدريجياً من عام 1948 حتى يومنا هذا من قبل دولة إسرائيل."},{"page_url":"https://es.wikipedia.org/wiki/Naultinus_grayii","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Naultinus-distribution-map.jpg","page_title":"Naultinus grayii","context_page_description":"Naultinus grayii es una especie de gecko que pertenece a la familia Diplodactylidae.​ Es endémica de Nueva Zelanda.​"},{"page_url":"https://en.wikipedia.org/wiki/Neujmin_(crater)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Dark-halo_crater_in_Neujmin_AS15-P-9597.jpg","page_title":"Neujmin (crater)","context_page_description":"Neujmin is a lunar impact crater on the Moon's far side. It is nearly attached to the west-southwest of the smaller crater Waterman, and lies to the southwest of the prominent Tsiolkovskiy.\\nThis is an eroded crater formation that has been somewhat deformed by subsequent impacts. The circular crater Neujmin P lies across the southwestern rim. There are multiple small craterlets along the northwestern rim and inner wall, most likely secondary impacts from Tsiolkovskiy, and both the northern and southern rims are disrupted.\\nThere is a dark-halo crater on the floor of Neujmin, which typically indicates that darker material, such as mare lava, exists below present the surface."},{"page_url":"https://id.wikipedia.org/wiki/Skema_Sertifikasi_Proses_Kimberley","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Kimberly_Process_Map.svg","page_title":"Skema Sertifikasi Proses Kimberley","context_page_description":"Skema Sertifikasi Proses Kimberley adalah proses yang ditetapkan untuk menyertifikasi asal usul intan kasar dari sumber-sumber yang bebas dari konflik yang didanai oleh produksi intan.\\nKPCS diperkenalkan oleh Resolusi Majelis Umum Perserikatan Bangsa-Bangsa 55/56 setelah rekomendasi Laporan Fowler. Proses ini dibentuk tahun 2003 untuk mencegah hasil penjualan intan mengalir ke gerakan-gerakan pemberontak. Skema sertifikasi ini bertujuan untuk mencegah \\"intan berdarah\\" memasuki arus utama pasar intan kasar. Skema ini dibentuk untuk menjamin konsumen bahwa dengan membeli intan mereka tidak mendanai perang dan pelecehan hak asasi manusia."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D1%80%D0%BE%D0%BD_%D0%A1%D0%BB%D1%8A%D0%BD%D1%86%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/1892_throne_of_Fath_Ali_Shah_Teheran.png","page_title":"Трон Слънце","context_page_description":"Трон Слънце е императорски трон на персийската династия Каджар, създаден в началото на 19 век по нареждане на Фатх Али Шах.\\nТронът носи името на централния декоративен елемент – слънце, украсено със скъпоценни камъни. Второто си название тронът получава след женитбата на Фатх Али Шах, който го нарича на съпругата си, Тавус (в превод от персийски – паун). Днес тронът, като част от колекцията на национални съкровища на Иран, се намира в трезора на Централната банка на страната."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1993","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Niels_van_der_pijl-1536097950.jpg","page_title":"Lijst van personen geboren in 1993","context_page_description":"Dit is een lijst van personen die geboren zijn in 1993.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://sl.wikipedia.org/wiki/Ciril_%C5%BDnidar%C5%A1i%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Ciril_%C5%BDnidar%C5%A1i%C4%8D.jpg","page_title":"Ciril Žnidaršič","context_page_description":"Ciril Žnidaršič, slovenski gradbeni inženir, * 3. avgust 1882, Ilirska Bistrica, † 2. november 1938, Ljubljana."},{"page_url":"https://en.wikipedia.org/wiki/Adriaen_van_de_Velde","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Het_Strand_van_Scheveningen%2C_Adriaen_van_de_Velde_%281658%29.jpg","page_title":"Adriaen van de Velde","context_page_description":"Adriaen van de Velde, was a Dutch animal and landscape painter, son of Willem van de Velde the Elder and brother of Willem van de Velde the Younger, the marine painter."},{"page_url":"https://no.wikipedia.org/wiki/Agni_Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/LuklaAirport.jpg","page_title":"Agni Air","context_page_description":"Agni Air er et flyselskap i Nepal som startet med flyvninger i mars 2006."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D1%84%D1%8B_%D0%B8_%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3%D0%B8_%D0%A8%D0%B0%D1%80%D1%82%D1%80%D1%81%D0%BA%D0%B8%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Blason_Chartres.svg","page_title":"Графы и герцоги Шартрские","context_page_description":"Первоначально герцогство Шартр было графством со столицей в городе Шартр. Титул графа Шартра был повышен до титула герцога Шартрского в 1528 году. В 1674 году король Франции Людовик XIV пожаловал титул герцога Шартрского своему новорожденному племяннику Филиппу II Орлеанскому. Филипп II был младшим сыном и наследником Филиппа Французского, герцога Орлеанского, младшего брата Людовика XIV."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B2%D0%BE_%D0%9C%D0%B8%D1%85%D0%B5%D0%BB%D1%8C%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Ivo_michiels676.jpg","page_title":"Иво Михельс","context_page_description":"Иво Михельс, собственно Henri Ceuppens — бельгийский писатель, сценарист и кинорежиссёр, журналист."},{"page_url":"https://sv.wikipedia.org/wiki/Tomaskyrkan,_G%C3%A4vle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Tomaskyrkan_i_S%C3%B6rby%2C_G%C3%A4vle.jpg","page_title":"Tomaskyrkan, Gävle","context_page_description":"Tomaskyrkan är en kyrkobyggnad i södra delen av Gävle. Den tillhör Gävle Heliga Trefaldighets församling i Uppsala stift."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%83%BC%E3%83%87%E3%83%B3%E3%83%99%E3%83%AB%E3%82%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Cadenberge_2015-06_Bahnhof_by-RaBoe_01.jpg","page_title":"カーデンベルゲ","context_page_description":"カーデンベルゲは、ドイツ連邦共和国ニーダーザクセン州クックスハーフェン郡ザムトゲマインデ・ラント・ハーデルンに属す町村である。このザムトゲマインデにはカーデンベルゲを含め14市町村が含まれる。"},{"page_url":"https://pt.wikipedia.org/wiki/Jitex_Bollklubb","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Jitex_BK_before_the_match.JPG","page_title":"Jitex Bollklubb","context_page_description":"Jitex BK é um clube sueco de futebol feminino em Mölndal, na Suécia."},{"page_url":"https://en.wikipedia.org/wiki/Maersk_Air","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Boeing_737-4Y0%2C_Maersk_Air_JP6189271.jpg","page_title":"Maersk Air","context_page_description":"Maersk Air A/S was a Danish airline which operated between 1969 and 2005. Owned by the A. P. Møller–Mærsk Group, it operated a mix of scheduled and chartered passenger and cargo services. Headquartered at Dragør, its main operating bases were Copenhagen Airport, Billund Airport and Esbjerg Airport. The airline had offshore helicopter operations from 1975 to 1999 and had three airline subsidiaries: Maersk Air UK, Maersk Commuter, and Star Air.\\nThe airline was founded on the foundations on the purchase of Falck Air on 21 February 1969. Fokker F27s were bought and domestic services from Copenhagen to Odense and Stauning. From 1971 to 1995 Maersk participated in Danair, which held a monopoly on all domestic services. Maersk Air was heavily involved in the inclusive tours market during the 1970s, operating the Boeing 720B and 737-200. From 1981 Maersk started international flights, first out of Billund and from the 1990s out of Copenhagen.\\nMaersk Air gradually invested in new aircraft, including the Fokker 50, Boeing 737 Classic, and later the 737-700. During the 1990s the number of international services increased, often codesharing with foreign airlines."},{"page_url":"https://uz.wikipedia.org/wiki/MAN_Truck_%26_Bus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Wzwz_munich_mtb_dachauer_strasse.jpg","page_title":"MAN Truck & Bus","context_page_description":"MAN Truck & Bus SE — MAN SE korporatsiyasining eng yirik shoʻba korxonasi boʻlib, tijorat transport vositalarini yetkazib beruvchi yetakchi xalqaro korxonalardan biri hisoblanadi. Kompaniyaning bosh qarargohi Germaniyaning Myunxen shaxrida joylashgan boʻlib, kompaniya umumiy oʻgʻirligi 3.0 tonnadan 5.5 tonnagacha boʻlgan furgonlar, umumiy ogʻirligi 7.49 t. dan 44 tonnagacha boʻlgan yuk mashinalari, umunmiy ogʻirligi 250 t. gacha boʻlgan poyezdlar, avtobus-shassilari, turistik avtobuslar, shaharlararo va shahar avtobuslari ishlab chiqaradi. Shu bilan birga „MAN Truck & Bus“ dizel va tabiiy gaz dvigatellarini ham ishlab chiqaradi. „MAN“ qisqartmasi dastlab „Maschinenfabrik Augsburg-Nürnberg AG“ deb atalgan, ilgarigi „MAN AG“.\\n„MAN“ kompaniyasining yuk mashinalari va avtobuslari, hamda „Neoplan“ markasi ostidagi avtobuslar „MAN Truck & Bus Group“ga tegishli sanaladi.\\n2011-yil 1-yanvarda MAN Nutzfahrzeuge kompaniyaning mahsulotlarini xalqaro bozorda yaxshiroq namoyish etish uchun „MAN Truck & Bus“ deb nomlandi."},{"page_url":"https://de.wikipedia.org/wiki/L%C3%B6bej%C3%BCner_Porphyr","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Loebejuener_porphyr_geflammt.jpg","page_title":"Löbejüner Porphyr","context_page_description":"Der Löbejüner Porphyr, auch Löbejüner Rhyolith, ist ein felsischer Vulkanit von rötlicher Farbe und ein wirtschaftlich bedeutender Naturwerkstein."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%B3%B6%E4%B8%AD%E5%A4%AE%E8%BB%8A%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Kobe_New_Transit_Island_Center_Station.jpg","page_title":"島中央車站","context_page_description":"岛中央站位于兵库县神户市东滩区向洋町中2丁目，是神户新交通六甲人工岛线的铁路车站。副站名为时装市场前。车站编号为R05。\\n入选第4届近畿车站百选。"},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B5%D0%BC%D0%B1%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Climbach-protestantische_Kirche-04-gje.jpg","page_title":"Клембак","context_page_description":"Клембак — Франциядағы коммуна. Эльзас аймағына қарасты Төменгі Рейн департаментінде орналасқан. Висембур округінің құрамына енеді. Алып жатқан жер аумағы 7,15 км² шамасында.\\nКоммунаның INSEE коды — 67075, пошта индексі — 67510."},{"page_url":"https://cy.wikipedia.org/wiki/Lorenzo,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Lorenzo01_mural.jpg","page_title":"Lorenzo, Texas","context_page_description":"Dinas yn Crosby County, yn nhalaith Texas, Unol Daleithiau America yw Lorenzo, Texas."},{"page_url":"https://en.wikipedia.org/wiki/Kampsville,_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Kamp_Store.jpg","page_title":"Kampsville, Illinois","context_page_description":"Kampsville is a village in Calhoun County, Illinois, United States, located on the west bank of the Illinois River. The population was 328 at the 2010 census, an increase from 302 in 2000."},{"page_url":"https://en.wikipedia.org/wiki/Steep_Canyon_Rangers","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Steep_Canyon_Rangers_2013.jpg","page_title":"Steep Canyon Rangers","context_page_description":"Steep Canyon Rangers is an American bluegrass band based in Asheville and Brevard, North Carolina. Though formed in 2000, the band has become widely known since 2009 for collaborating with actor/banjoist Steve Martin. In 2013, the Steep Canyon Rangers' solo album Nobody Knows You won the Grammy Award for Best Bluegrass Album. The previous year, their 2012 collaboration with Steve Martin, Rare Bird Alert, was nominated for the same award. Steep Canyon Rangers have recorded 9 solo albums plus two collaborative albums with Steve Martin. SCR performed as a quintet for nearly a decade before intermittent touring began as a sextet with Steve Martin; the band still performs in both configurations. In May 2013, Steve Martin and SCR began performing with Edie Brickell after she and Martin co-wrote and recorded Love Has Come for You."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%81%D0%B8%D1%85%D0%B8%D0%BA%D0%B0%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Koshihikari.jpg","page_title":"Косихикари","context_page_description":"Косихикари — японский сорт риса. Выведен в 1956 году в префектуре Фукуи. Имеет хорошие вкусовые качества, но уязвим для болезней. Выращивается в Японии, на территории от острова Кюсю до региона Тохоку. Крупнейший японский производитель — префектура Ниигата. По состоянию на 2005 год доля косихикари на японском рынке риса составляет 38 %. За пределами Японии выращивается в Австралии и США."},{"page_url":"https://ca.wikipedia.org/wiki/Detroit_Pistons","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/2004_Detroit_Pistons_congratulated_by_George_Bush.jpg","page_title":"Detroit Pistons","context_page_description":"Detroit Pistons és una franquícia de bàsquet de l'NBA amb seu a Detroit, Michigan. Participa en la Divisió Central de la Conferència Est de l'NBA. Els Pistons es van fundar el 1941, jugant primerament a l'NBL fins a la seva entrada a l'NBA el 1948. Fins al 1957 l'equip va jugar a Fort Wayne, Indiana. Entre els èxits de la franquícia es troben dos campionats de l'NBL i altres tres de l'NBA, dos d'ells consecutius el 1989 i el 1990, i el tercer el 2004. També compten amb 7 títols de conferència i 15 de divisió. Els seus partits locals els juguen al pavelló Little Caesars Arena."},{"page_url":"https://fr.wikipedia.org/wiki/Vasio","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/BridgeVaison.jpg","page_title":"Vasio","context_page_description":"Vasio ou Vasio Vocontiorum est le nom gallo-romain de l'actuelle ville de Vaison-la-Romaine, une des deux capitales du peuple celte des Voconces au Iᵉʳ siècle av. J.-C."},{"page_url":"https://ro.wikipedia.org/wiki/Tramvaiul_din_Bucure%C8%99ti","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Bucharest_V3A_tram_1.jpg","page_title":"Tramvaiul din București","context_page_description":"Bucureștiul are cea mai lungă rețea de tramvaie din România, rețea administrată de STB."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_im_Rhein-Lahn-Kreis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Wappen_Burgschwalbach.png","page_title":"Liste der Wappen im Rhein-Lahn-Kreis","context_page_description":"Diese Liste beinhaltet – geordnet nach der Verwaltungsgliederung – alle in der Wikipedia gelisteten Wappen des Rhein-Lahn-Kreises in Rheinland-Pfalz. In dieser Liste werden die Wappen mit dem Gemeindelink angezeigt."},{"page_url":"https://en.wikipedia.org/wiki/Jackson_Dinky","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/JacksonDK2customtrussrodcover.jpg","page_title":"Jackson Dinky","context_page_description":"The Jackson Dinky is a Superstrat-style double-cutaway electric guitar built by Jackson Guitars. The \\"Dinky\\" is named for its slightly smaller than normal body size. Usually fitted with a two humbucker pickup configuration, some models also include single-coil pickups and/or just one bridge humbucker. The fretboard can be made out of ebony, rosewood and more recently maple, or rock maple, with 24 jumbo frets and is always built with a bolt-on neck. Most of the guitars have a Floyd Rose original or licensed tremolo, and a locking nut to help maintain stable tuning. Some Dinkys have hardtail, or String-Thru bridges. The Jackson Dinky is usually preferred by players of hard rock and heavy metal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D0%B2%D0%B7%D0%BE%D0%BB%D0%B5%D0%B9_%D0%93%D1%80%D0%B0%D0%BD%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Battleships_pass_Grant%27s_Tomb.JPG","page_title":"Мавзолей Гранта","context_page_description":"Национальный мемориал генерала Гранта — нео-ампирный мавзолей американского президента Улисса Гранта в манхэттенском Риверсайд-парке, самая большая гробница на территории Северной Америки."},{"page_url":"https://nl.wikipedia.org/wiki/%C5%98ehlovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/%C5%98ehlovice_kostel_Nejsv%C4%9Bt%C4%9Bj%C5%A1%C3%AD_Trojice.JPG","page_title":"Řehlovice","context_page_description":"Řehlovice is een Tsjechische gemeente in de regio Ústí nad Labem, en maakt deel uit van het district Ústí nad Labem. Řehlovice telt 1235 inwoners."},{"page_url":"https://de.wikipedia.org/wiki/Parodia_werneri","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Parodia_werneri_pm_02.JPG","page_title":"Parodia werneri","context_page_description":"Parodia werneri ist eine Pflanzenart aus der Gattung Parodia in der Familie der Kakteengewächse. Das Artepitheton werneri ehrt den Schweizer Gärtner und Fachmann für brasilianische Kakteen Werner Uebelmann."},{"page_url":"https://hu.wikipedia.org/wiki/Mennybemenetel_fatemplom_(Bugyfalva)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Biserica_de_lemn_din_Budesti_-_arhiva.jpg","page_title":"Mennybemenetel fatemplom (Bugyfalva)","context_page_description":"A bugyfalvi Mennybemenetel fatemplom műemlékké nyilvánított épület Romániában, Arad megyében. A romániai műemlékek jegyzékében az AR-II-m-A-00592 sorszámon szerepel."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%BB%A3%E7%A5%BF_(%E5%AD%94%E5%8F%A4%E7%88%BE%E6%B0%8F)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Guanglu.jpg","page_title":"廣祿 (孔古爾氏)","context_page_description":"廣祿，號季高，孔古爾氏，滿族，新疆伊犁區寧西縣正藍旗人，祖籍遼寧瀋陽，錫伯營副都統銜領隊大臣春圃諱富勒怙倫之子。中華民國政治人物、學者。"},{"page_url":"https://vo.wikipedia.org/wiki/Leonard_Bernstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/BernsteinLeonardSignature01_mono_25p_transp.png","page_title":"Leonard Bernstein","context_page_description":"Hiel Leonard Bernstein äbinom noatädan, dilekönan, musigispikädan e pianodan Lamerikänik. De 1951 jü 1978 äbinom himatan jidramatana Felicia Montealegre.\\nHiel Bernstein binön el reigäb de Google Doodle ün 2018 gustul 25, el 100. yelam de omik motedadel."},{"page_url":"https://id.wikipedia.org/wiki/Sakta","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Tripura_sundari_4.jpg","page_title":"Sakta","context_page_description":"Sakta atau Saktam adalah aliran dalam agama Hindu yang berfokus pada pemujaan Sakti atau Dewi—Ibu Dewi bagi umat Hindu—sebagai Tuhan Yang Maha Esa dan Mahakuasa. Beserta Saiwa dan Waisnawa, Sakta merupakan salah satu aliran utama Hinduisme.\\nUmat Sakta memandang Dewi sebagai Brahman—Yang Maha Esa—dengan beragam wujud ilahi, baik wanita ataupun pria, yang dianggap sebagai aneka manifestasi-Nya semata. Dalam rincian filsafat dan praktik keagamaan, Sakta mirip dengan Saiwa. Akan tetapi, umat Sakta memuja seluruh manifestasi Sakti sebagai aspek kewanitaan yang dinamis dari Tuhan Yang Mahakuasa. Siwa—sebagai aspek kejantanan dari Tuhan—dianggap transenden, dan pemujaan kepada-Nya dianggap sebagai pelengkap saja.\\nPenganut Sakta meyakini Sakti sebagai kekuatan yang mendasari segala prinsip-prinsip kelakian, sedangkan Dewi biasanya digambarkan sebagai Parwati atau Laksmi. Ia dapat pula digambarkan dengan wujud berbeda, seperti Kali atau Durga yang menyeramkan. Sakta erat kaitannya dengan Hinduisme Tantra, yang mengajarkan ritus dan praktik pembersihan pikiran dan raga. Umat Sakta memakai mantra, sihir, gambar sakral, yoga, dan ritual untuk memanggil kekuatan-kekuatan kosmis."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D0%B0%D1%85%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Brno%2C_Bystrc%2C_hrad_Veve%C5%99%C3%AD_%2823%29.jpg","page_title":"Шахин","context_page_description":"Шахин, или рыжеголовый сапсан, пустынный сокол — вид хищных птиц рода соколов."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%B8%D5%B8%D6%82%D5%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/Alicia_Keys.jpg","page_title":"Սոուլ","context_page_description":"Սոուլ, երաժշտության հայտնի ժանր, աֆրո-ամերիկյան ծագմամբ, առաջացել է ԱՄՆ-ի հարավային շրջաններում 1950-ական թվականներին։ Բնորոշ է զգացմունքայնությունը, զմայլվածությունը, փոքր-ինչ հուզավառվածությունը, հոգեկան վոկալային ոճը գալիս է ավանդական հոգևոր օրհներգներից և ավետարաններից, ինչպես նաև ջազային, վոկալային իմպրովիզացիայից։"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Sains-en-Ami%C3%A9nois","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Map_commune_FR_insee_code_80696.png","page_title":"Sains-en-Amiénois","context_page_description":"Sains-en-Amiénois sī ūi-tī Hoat-kok Picardie toā-khu Somme koān ê chi̍t ê commune."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%99%D7%9C%D7%94_%D7%90%D7%9E%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Villa_Emo_pianta_Bertotti_Scamozzi_1781.jpg","page_title":"וילה אמו","context_page_description":"וילה אמו היא אחת הווילות הכפריות שבנה האדריכל האיטלקי אנדראה פלאדיו באזור ונטו שבצפון איטליה.\\nהווילה תוכננה ונבנתה לפי הזמנתו של לאונרדו אמו איש ונציה, והבנייה הסתיימה, ככל הידוע, סביב שנת 1565. וילה אמו הוכרזה על ידי ארגון אונסק\\"ו כאתר מורשת עולמית במסגרת הווילות הפלדיאניות בוונטו."},{"page_url":"https://en.wikipedia.org/wiki/Clint_Hartung","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Clint_Hartung.png","page_title":"Clint Hartung","context_page_description":"Clint Hartung, nicknamed \\"The Hondo Hurricane,\\" was a right-handed pitcher and right fielder in Major League Baseball who played with the New York Giants from 1947 to 1952."},{"page_url":"https://ca.wikipedia.org/wiki/Carlemany","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Raphael_Charlemagne.jpg","page_title":"Carlemany","context_page_description":"Carlemany fou rei dels francs, rei dels llombards i emperador d'Occident. Fou un personatge central en la consolidació i prosperitat de l'Imperi carolingi. Expandí els diferents regnes francs fins a transformar-los en un imperi, al qual va incorporar gran part d'Europa occidental i central. Conquerí Itàlia i fou coronat Imperator Augustus pel papa Lleó III el 25 de desembre de 800 a Roma. D'aquesta manera succeí a l'Imperi Romà d'Orient com a protector de la cristiandat. Davant la indignació inicial de Constantinoble, l'any 812 se signà un acord entre els dos imperis: tornà a haver-hi dos emperadors a Europa, l'un a l'Orient i un altre a l'Occident. El regnat de Carlemany se sol associar amb el «renaixement carolingi», un ressorgiment de la cultura, religió i arts llatines al llarg dels dominis carolingis dirigits per l'Església Catòlica. Mitjançant les seves conquestes i les seves reformes internes, Carlemany assentà les bases del que va esdevenir l'Europa occidental a l'edat mitjana.\\nFill del rei dels francs, Pipí dit «el Breu» i de Bertrada de Laon, succeí el seu pare, corregnant amb el seu germà, Carloman I."},{"page_url":"https://en.wikipedia.org/wiki/Burlington,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Walworth_County_Wisconsin_Incorporated_and_Unincorporated_areas_Burlington_Highlighted.svg","page_title":"Burlington, Wisconsin","context_page_description":"Burlington is a city in Racine and Walworth counties in the U.S. state of Wisconsin, with the majority of the city located in Racine County. The population of the city was 10,464 as of the 2010 census."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%81%D0%B3%D0%B0%D1%80%D0%B4%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/%D0%93%D0%B5%D1%80%D0%B1_%D0%B2%D0%B8%D1%80%D1%82%D1%83%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B3%D0%BE%D1%81%D1%83%D0%B4%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%B0_%D0%90%D1%81%D0%B3%D0%B0%D1%80%D0%B4%D0%B8%D1%8F.jpg","page_title":"Асгардия","context_page_description":"Асгардия — создаваемое в космосе государство и нация, рассматриваемое основателями как свободное от существующих стран. Заявленной стратегической задачей Асгардии является обеспечение выживания человечества вне Земли и, в связи с этим, создание условий для рождения первого ребенка в космосе.\\nОснователь Аэрокосмического международного исследовательского центра Игорь Ашурбейли объявил о намерении создать Асгардию 12 октября 2016 года. 12 ноября 2017 года Асгардия запустила свой первый спутник."},{"page_url":"https://hu.wikipedia.org/wiki/Guatemala","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Chichicastenango-004.jpg","page_title":"Guatemala","context_page_description":"Guatemala egy közép-amerikai ország, amelynek indián eredetű neve nem egyértelműen tisztázott. Egyesek szerint „farakások helye”, mások szerint „tűzokádó hegy” a jelentése. A volt spanyol gyarmat, rövid kitérők után, 1839-ben nyerte el végleges függetlenségét. Felszínének jelentős részét a Kordillerák magas, vulkánokkal tűzdelt hegyláncai uralják, amelyhez délen – szavannával fedett, keskeny – parti síkság, északon – trópusi őserdő borította – táblás vidék kapcsolódik."},{"page_url":"https://es.wikipedia.org/wiki/Mario_Meoni","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Escudo_de_Jun%C3%ADn.jpg","page_title":"Mario Meoni","context_page_description":"Mario Andrés Meoni es un político argentino perteneciente al Frente Renovador, ocupa el cargo de ministro de Transporte de la Nación desde el 10 de diciembre de 2019. Fue intendente del Partido de Junín, en la provincia de Buenos Aires, entre 2003 y 2015."},{"page_url":"https://de.wikipedia.org/wiki/Polizei_(Saudi-Arabien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Saudi_police_car.jpg","page_title":"Polizei (Saudi-Arabien)","context_page_description":"Die Polizei in Saudi-Arabien heißt offiziell Behörde für öffentliche Sicherheit. Sie ist ein Exekutivorgan des Staates im Königreich Saudi-Arabien. Sie sind jedoch keine komplett unabhängige Staatsgewalt. In Artikel 44 der Grundordnung des Landes heißt es: Die Behörden des Staates setzen sich wie folgt zusammen: die Justizbehörden, die exekutiven Behörden, die Regulierungsbehörden. Diese Behörden kooperieren miteinander bei der Erfüllung ihrer Aufgaben im Einklang mit den Gesetzen. Der regierende König ist der Bezugspunkt und die höchste Autorität für die Behörden. Die Polizei ist über den Notruf mit der Durchwahl 999 erreichbar."},{"page_url":"https://es.wikipedia.org/wiki/Oqaban_Hindukush","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Ahmad_Faisal_-_football_-_D.jpg","page_title":"Oqaban Hindukush","context_page_description":"Oqaban Hindukush es un equipo de fútbol de Afganistán.​ Juegan en la Liga Premier de Afganistán. Fue fundada en agosto de 2012 por la creación de la Liga Premier de Afganistán y sus jugadores han sido elegidos a través de un casting-show llamado Maidan-E-Sabz. Representan la región central de Afganistán. En la temporada 3 de la Liga Premier de Afganistán, Oqaban Hindukush FC se clasificó para la final en 2014, por primera vez en su liga. Ellos perdieron en tiempo extra contra Shaheen Asmayee F.C. 3-2, y recibió el título de Subcampeón."},{"page_url":"https://fr.wikipedia.org/wiki/Province_de_Jujuy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Archivo_General_de_la_Naci%C3%B3n_Argentina_1890_aprox%2C_Puna%2C_poblaci%C3%B3n_kolla_colla.jpg","page_title":"Province de Jujuy","context_page_description":"La province de Jujuy est une province argentine, située dans le nord-ouest du pays, limitée à l'est et au sud par la province de Salta, à l'ouest par le Chili et au nord par la Bolivie. Sa capitale est San Salvador de Jujuy."},{"page_url":"https://pl.wikipedia.org/wiki/Owingsville_(Kentucky)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Downtown_Owingsville%2C_Kentucky.jpg","page_title":"Owingsville (Kentucky)","context_page_description":"Owingsville – miasto w Stanach Zjednoczonych, w stanie Kentucky, w hrabstwie Bath. Zamieszkane przez 1488 ludzi."},{"page_url":"https://oc.wikipedia.org/wiki/Esquil","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Aischylos_B%C3%BCste.jpg","page_title":"Esquil","context_page_description":"Esquil foguèt un dramaturg grèc. Predecessor de Sofòcles e Euripides, es considerat coma creador de la tragedia grèga."},{"page_url":"https://ga.wikipedia.org/wiki/Liosta_speiceas_na_n-iasc_a_choinn%C3%ADtear_in_uiscead%C3%A1in_fhionnuisce","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Lamprichthys_tanganicanus.JPG","page_title":"Liosta speiceas na n-iasc a choinnítear in uisceadáin fhionnuisce","context_page_description":"D'éirigh le líon mór speiceas uisceach oiriúnú go rathúil chun cónaí san uisceadán fionnuisce. Tugann an liosta seo roinnt samplaí de na speicis is coitianta atá le fáil in uisceadáin bhaile."},{"page_url":"https://vi.wikipedia.org/wiki/Xeranthemum_inapertum","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Xeranthemum_inapertum_MHNT.BOT.2007.40.102.jpg","page_title":"Xeranthemum inapertum","context_page_description":"Xeranthemum inapertum là một loài thực vật có hoa trong họ Cúc. Loài này được Mill. miêu tả khoa học đầu tiên năm 1768."},{"page_url":"https://af.wikipedia.org/wiki/Hoendervleis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Crispy_Roast_chicken.JPG","page_title":"Hoendervleis","context_page_description":"Hoendervleis is die vleis afkomstig van 'n hoender. Dit is die vleissoort wat die meeste geëet word ter wêreld. Hoender word as deel van 'n maaltyd soos middagete of aandete geëet. Dikwels is dit ook 'n spesialiteit in 'n restaurant of tydens feesdae soos Paasfees en Kersfees. Hoendervleis word, net soos die vleis van ander pluimvee, witvleis genoem. Dit is in teenstelling met die rooivleis van soogdiere.\\nHoendervleis kan op baie maniere voorberei word as voedsel, byvoorbeeld gerooster, op 'n braaier, gebak of gekook met allerlei kruie en speserye, selfs gekook in sop."},{"page_url":"https://be.wikipedia.org/wiki/%D0%AF%D0%BD_%D0%97%D0%B0%D0%BC%D0%BE%D0%B9%D1%81%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Pomnik_zamoyskiego6.jpg","page_title":"Ян Замойскі","context_page_description":"Ян Замойскі — польскі дзяржаўны дзеяч з роду Замойскіх, прыхільнік кальвінізму, затым каталік. Буйны магнат, каралеўскі сакратар, падканцлер каронны, канцлер вялікі каронны, генеральны староста кракаўскі, гетман вялікі каронны, першы ардынат Замойскі, староста белзскі, мендзыжэцкі, кшэшаўскі, кнышынскі, тыкоцінскі і дорпацкі. Заснавальнік і будаўнік горада Замасць."},{"page_url":"https://es.wikipedia.org/wiki/Gut_(ritual)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Hyewon-Munyeo.sinmu.jpg","page_title":"Gut (ritual)","context_page_description":"Gut o kut son los ritos realizados por los chamanes coreanos, que implican ofrendas y sacrificios a dioses, espíritus y antepasados.​ Se caracterizan por movimientos rítmicos, canciones, oráculos y oraciones.​ Estos ritos están destinados a crear bienestar, promoviendo el compromiso entre los espíritus y la humanidad. Las principales categorías de ritos son el naerim-gut, el dodang-gut y el ssitgim-gut.\\nA través de la canción y la danza, el chamán ruega a los dioses que intervengan en la fortuna de los hombres. El chamán viste un traje muy colorido y normalmente habla en éxtasis. Durante un rito, el chamán cambia su vestimenta varias veces. Los rituales consisten en varias fases, llamadas gori.​"},{"page_url":"https://zh.wikipedia.org/wiki/%E9%98%BF%E7%BE%85%E4%BA%9E_(%E7%A7%91%E7%BE%85%E6%8B%89%E5%A4%9A%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Aroya%2C_Colorado_vicinity_map.png","page_title":"阿羅亞 (科羅拉多州)","context_page_description":"阿罗亚是位于美国科罗拉多州夏延县的一个非建制地区。该地的面积和人口皆未知。"},{"page_url":"https://de.wikipedia.org/wiki/Liefering","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Salzburger_Stadtteil_liefering.jpg","page_title":"Liefering","context_page_description":"Liefering ist ein Stadtteil im Nordwesten der Stadt Salzburg in Österreich. Begrenzt wird der geschlossene Stadtteil Liefering im Südosten vom Glanbach und dem Glankanal, im Südwesten bildet die Bahnlinie Salzburg–Rosenheim die Grenze und im Nordwesten die Saalach. Im Osten begrenzt die Salzach den Stadtteil. Der Siedlungskern von Liefering endet dabei am Grünraum um Mühlbach und Altglan. An diesen Grünraum schließt östlich räumlich deutlich getrennt die Salzachseesiedlung an, die ebenfalls zum Stadtteil Liefering zählt. In Liefering mit seinen 697,9 ha leben heute 14.500 Bewohner; Liefering ist damit nach Lehen der bevölkerungsreichste Stadtteil Salzburgs."},{"page_url":"https://simple.wikipedia.org/wiki/Karolina_Bock","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Karolina_Bock.jpg","page_title":"Karolina Bock","context_page_description":"Karolina Sofia Bock, was a Swedish dancer, actor and singer. She also became principal for the famous theatre-school, Dramatens elevskola.\\nKarolina Bock was born as Karolina Richter. She was a student at the theatrical school Dramatens elevskola in Stockholm between 1806 and 1809, were she was instructed by the principal Sofia Lovisa Gråå. Many of the girls graduating from the school between 1804 and 1812, when Gråå was principal, became famous in Sweden, and were called \\"the girls of Gråå\\".\\nKarolina worked at the theatres Djurgårdsteatern and Nya Komiska Teatern before she was hired at the Royal Dramatic Theatre in 1814. She worked there for fifty years, and became one of the most popular actors there. But she never became a star because of the parts she played; she always played old women in comedys, never heroines and main parts. She was very well used and never lacked parts to play, but she was not given main parts. It was said, that she had a rare quality; she knew her limitations.\\nHer most popular parts were in the plays Min tante Aurore, Bildhuggaren, Brodertvisten, Syrsan, Preciosa, Jane Eyre and Mäster Smith."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AC%A7%E6%96%87%E9%A1%BF_(%E8%82%AF%E5%A1%94%E5%9F%BA%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/KYMap-doton-Owenton.PNG","page_title":"欧文顿 (肯塔基州)","context_page_description":"欧文顿，是美国肯塔基州的一座城市。建立于1822年，面积约为2.8平方公里。根据2010年美国人口普查，该市的人口为1,327人。"},{"page_url":"https://nl.wikipedia.org/wiki/Volgogradski_Prospekt","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Volgograsky_Prospekt_station_entry_%28%D0%92%D1%85%D0%BE%D0%B4_%D0%BD%D0%B0_%D1%81%D1%82%D0%B0%D0%BD%D1%86%D0%B8%D1%8E_%D0%92%D0%BE%D0%BB%D0%B3%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D1%80%D0%BE%D1%81%D0%BF%D0%B5%D0%BA%D1%82%29_%284933956493%29.jpg","page_title":"Volgogradski Prospekt","context_page_description":"Volgogradski Prospekt is een station aan de Tagansko-Krasnopresnenskaja-lijn van de Moskouse metro."},{"page_url":"https://fr.wikipedia.org/wiki/Pylos-Nestor","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/2011_Dimos_Pylou-Nestoros.png","page_title":"Pylos-Nestor","context_page_description":"Le dème de Pylos-Nestor est une municipalité du district régional de Messénie en Grèce. Il a été créé en 2010 dans le cadre du plan Kallikratis par la fusion de 6 anciennes municipalités devenues des « districts municipaux ».\\nSon siège est la localité de Pylos. Son nom fait référence au roi mythique Nestor.\\nSa population était de 23780 habitants en 2001."},{"page_url":"https://sv.wikipedia.org/wiki/Burg_auf_Fehmarn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Fehmarn_Stadt-Wappen.png","page_title":"Burg auf Fehmarn","context_page_description":"Burg auf Fehmarn är en Stadtteil och sätet för den centrala administrationen i staden Fehmarn på ön med samma namn i Kreis Ostholstein i den tyska delstaten Schleswig-Holstein. Invånarantalet är ungefär 6 000. Fram till 1 januari 2003 var Burg auf Fehmarn en egen stad, men är numera en del av staden Fehmarn som bildades det året."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D1%81%D1%8B_Dungeons_%26_Dragons","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Dwarf.jpg","page_title":"Расы Dungeons & Dragons","context_page_description":"При создании персонажа для ролевой игры игрок выбирает его расу. В D&D и AD&D каждая раса обладает своими преимуществами и недостатками."},{"page_url":"https://pl.wikipedia.org/wiki/Gates_Avenue","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Gates_Av_J_BMT_platform_jeh.JPG","page_title":"Gates Avenue","context_page_description":"Gates Avenue – stacja metra nowojorskiego, na linii J i Z. Znajduje się w dzielnicy Brooklyn, w Nowym Jorku i zlokalizowana jest pomiędzy stacjami Halsey Street i Kosciuszko Street. Została otwarta 13 maja 1885."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%DB%8C%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/South_Pars_Onshore_Facilities_%288%29.jpg","page_title":"ایران","context_page_description":"ایران کشوری در آسیای غربی است. این کشور با ۱٫۶۴۸٫۱۹۵ کیلومتر مربع پهناوری، دومین کشور بزرگ خاورمیانه است. ایران از شمال غرب با ارمنستان و آذربایجان، از شمال با دریای خزر، از شمال شرق با ترکمنستان، از شرق با افغانستان و پاکستان، از جنوب با خلیج فارس و دریای عمان و در غرب با عراق و ترکیه هم‌مرز است. این کشور خاورمیانه‌ای، جایگاه استراتژیکی در منطقهٔ خلیج فارس دارد و تنگه هرمز در جنوب آن، مسیری حیاتی برای انتقال نفت خام است. جمعیت کل استان‌های ایران از ۸۳٫۵ میلیون تن، می‌گذرد و تهران، پایتخت و بزرگ‌ترین شهر این کشور است. ایران، جامعه‌ای با قومیت و فرهنگ‌های گوناگون دارد و گروه قومی و فرهنگی غالب این کشور، برآمده از فارسی‌زبانان آن است. در کنار آنان، قومیت‌های دیگری، همانند اقوام پرجمعیت آذری و کرد وجود دارند. قانون اساسی جمهوری اسلامی ایران، اسلام شیعه را دین رسمی ایران اعلام کرده‌است و اکثریت مردم این کشور، پیروان همین مذهب هستند. زبان رسمی این کشور نیز فارسی است.\\nسرزمین ایران، میزبان تمدن‌های کهنی چون ایلام، جیرفت و زاینده‌رود بوده‌است. نخستین‌بار در سدهٔ هفتم پیش از میلاد، در دوران پادشاهی ماد بود که بخش‌های قابل توجهی از فلات ایران یکپارچه شد. در سدهٔ ششم پ. م، شاهنشاهی هخامنشی توسط کوروش بزرگ بنیان نهاده شد تا ایران یکی از بزرگ‌ترین امپراتوری‌های تاریخ را تشکیل دهد."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_bij_Paleis_Soestdijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Rijksmonument-8568-Stalgebouw-Soestdijk.jpg","page_title":"Lijst van rijksmonumenten bij Paleis Soestdijk","context_page_description":"Paleis Soestdijk met bijhorende gronden telt 31 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://nl.wikipedia.org/wiki/Robin_Pors","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Robin-pors-1314652557.jpg","page_title":"Robin Pors","context_page_description":"Robin Pors is een Nederlandse zanger van de Vengaboys."},{"page_url":"https://pt.wikipedia.org/wiki/Aspach_(Alto_Reno)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Aspach%2C_Mairie.jpg","page_title":"Aspach (Alto Reno)","context_page_description":"Aspach é uma comuna francesa na região administrativa de Grande Leste, no departamento Alto Reno. Estende-se por uma área de 4,2 km². Em 2010 a comuna tinha 1 144 habitantes."},{"page_url":"https://en.wikipedia.org/wiki/Arachnocampa_luminosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Nz_glowworm.jpeg","page_title":"Arachnocampa luminosa","context_page_description":"Arachnocampa luminosa, commonly known as New Zealand glowworm or simply glowworm, is a species of fungus gnat endemic to New Zealand. The larval stage and the imago produce a blue-green bioluminescence. The species is known to dwell in caves and on sheltered banks in native bush where humidity is high. Its Māori name is titiwai, meaning \\"projected over water\\".\\nThe first written record of the species dates from 1871 when it was collected from a gold mine in New Zealand's Thames region. At first it was thought to be related to the European glowworm beetle but, in 1886, a Christchurch teacher showed it was a larva of a gnat, not a beetle. The species was first formally described in 1891 with the species name Bolitiphila luminosa and was assigned to the family Mycetophilidae. In 1924, it was placed within a new genus of its own, Arachnocampa, because the wing venation of the adults and the behaviour of the larvae differed significantly from other Bolitophila fly species. It was given the genus name on the basis of its building a silk nest and using silk threads to capture prey."},{"page_url":"https://eo.wikipedia.org/wiki/Tyres%C3%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Tyreso_slott_view1.jpg","page_title":"Tyresö","context_page_description":"La komunumo Tyresö situas en la sveda provinco Stockholms län kaj la historia provinco Södermanland. En la komunumo inter alie situas samnoma urbo Tyresö, sed la administra centro de la komunumo estas la urbo Bollmora.\\nInter esperantistoj la urbeto aparte konatiĝis en somero 1969, kiam la 25-a Internacia Junulara Kongreso de TEJO okazis tie, kaj pro la en tiu kongreso ekestiĝinta deklaracio de Tyresö."},{"page_url":"https://sl.wikipedia.org/wiki/Sikorsky_S-64_Skycrane","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/S64-Ahorn_Fire-USFS-01.jpg","page_title":"Sikorsky S-64 Skycrane","context_page_description":"Sikorsky S-64 Skycrane - »zračno dvigalo« je ameriški dvomotorni helikopter za težke tovore. Je civilna verzija vojaškega CH-54 Tarhe. Helikopter je zasnoval Igor Sikorsky, originalno ga je proizvajal Sikorsky Aircraft, potem je leta 1992 tipski certifikat kupil Erickson Air-Crane, ki proizvaja trenutno verzijo.\\nS-64 je bil zasnovan kot povečana verzija prototipa zračnega dvigala Sikorsky S-60. S-64 ima šestkraki glavni rotor in dva 4050 KM turbogredna motorja Pratt & Whitney JFTD12A. Prvič je poletel 9. maja 1962. Sledilo je več prototipov, ki je preizkusila nemška vojska, a se Nemci niso odločili za nakup. Šest helikopterjev z oznako YCH-54A Tarhe je potem naročila Kopenska vojska ZDA. Sedem S-64E so zgradili za civilno tržišče.\\nErickson Air-Crane je z leti postal glavni operater helikopterja. Novi proizvajalec je naredil okrog 1350 majhnih sprememb.\\nNa Aircrane se lahko namesti 10.000-litrski rezervoar z gasilnim sredstvom za zračno gašenje požarov. Na tem področju je bil zelo uspešen. Za ta namen ga uporabljajo Italijani in Korejci.\\nPodjetje Erickson Air-Crane ponuja helikopterje na lizing za uporabo po vsem svetu."},{"page_url":"https://es.wikipedia.org/wiki/Kristiansand","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/SuperSpeed_1.jpg","page_title":"Kristiansand","context_page_description":"Kristiansand —antiguamente Christianssand— es una ciudad y municipio de Noruega, capital de la provincia de Vest-Agder. Por su población, es el sexto mayor municipio de Noruega y la quinta ciudad más grande del país, detrás de Oslo, Bergen, Trondheim y Stavanger. En enero de 2015, el municipio tenía una población de 87 446 habitantes, ​ convirtiéndola en la mayor ciudad de la región histórica de Sørlandet."},{"page_url":"https://war.wikipedia.org/wiki/Ornithoptera_meridionalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ornithoptera_meridionalis_m.jpg","page_title":"Ornithoptera meridionalis","context_page_description":"An Ornithoptera meridionalis in uska species han Lepidoptera nga syahan ginhulagway ni Rothschild hadton 1897. An Ornithoptera meridionalis in nahilalakip ha genus nga Ornithoptera, ngan familia nga Papilionidae. Ginklasipika han IUCN an species komo nangangarat-an. Waray hini subspecies nga nakalista."},{"page_url":"https://da.wikipedia.org/wiki/Netv%C3%A6rkseffekt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Network_effect.png","page_title":"Netværkseffekt","context_page_description":"Netværkseffekt eller netværkslogik er, at værdien af en vare eller ydelse er afhængig af antallet af kunder, som i forvejen ejer eller bruger denne vare. Hver gang man f.eks. køber man en telefon, øges værdien af andres telefoner, idet sidstnævnte nu får mulighed for at kommunikere med endnu flere."},{"page_url":"https://vi.wikipedia.org/wiki/Minh_H%C3%B3a","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/NR12_Minh_Hoa.jpg","page_title":"Minh Hóa","context_page_description":"Minh Hóa là một huyện biên giới nằm ở phía tây Quảng Bình, Việt Nam."},{"page_url":"https://fr.wikipedia.org/wiki/Tahar_Haddad","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Tahar_Haddad.jpg","page_title":"Tahar Haddad","context_page_description":"Tahar Haddad, né le 4 décembre 1899 à Tunis et mort le 7 décembre 1935, est un penseur, syndicaliste et homme politique tunisien.\\nIl a milité pour l'évolution de la société tunisienne au début du XXᵉ siècle. Il est connu pour avoir lutté activement en faveur des droits syndicaux des travailleurs tunisiens, de l'émancipation de la femme tunisienne et de l'abolition de la polygamie dans le monde arabo-musulman.\\nTahar Haddad est un contemporain et ami du poète Abou el Kacem Chebbi et du syndicaliste Mohamed Ali El Hammi."},{"page_url":"https://es.wikipedia.org/wiki/Antonio_Le%C3%B3n_Ortega","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/ALOporBRUNT.jpg","page_title":"Antonio León Ortega","context_page_description":"Antonio León Ortega escultor español. Se formó en Madrid y creó un estilo propio en la imaginería andaluza del siglo XX."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/2013._%D0%94%D0%BE%D0%BD%D0%B5%D1%86%D0%BA_336.jpg","page_title":"Донецк","context_page_description":"Доне́цк — город на востоке Украины, на реке Кальмиус. Согласно законодательству Украины — административный центр Донецкой области. С апреля 2014 года контролируется непризнанной Донецкой Народной Республикой и рассматривается ею как столица.\\nПятый город Украины по количеству населения, численность которого на 1 января 2014 года составляла 950372 человек. На территории, подчинённой Донецкому горсовету, на 1 января 2014 года проживало 965 828 человек.\\nУкраинские власти в ходе вооружённого конфликта на востоке страны перенесли учреждения Донецкой областной государственной администрации сначала в Мариуполь, а в октябре 2014 года — в Краматорск. На данный момент фактическим центром Донецкой области является Краматорск."},{"page_url":"https://en.wikipedia.org/wiki/Michael_Tippett","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Royal_College_of_Music_-_April_2007.jpg","page_title":"Michael Tippett","context_page_description":"Sir Michael Kemp Tippett OM CH CBE was an English composer who rose to prominence during and immediately after the Second World War. In his lifetime he was sometimes ranked with his contemporary Benjamin Britten as one of the leading British composers of the 20th century. Among his best-known works are the oratorio A Child of Our Time, the orchestral Fantasia Concertante on a Theme of Corelli, and the opera The Midsummer Marriage.\\nTippett's talent developed slowly. He withdrew or destroyed his earliest compositions, and was 30 before any of his works were published. Until the mid-to-late 1950s his music was broadly lyrical in character, before changing to a more astringent and experimental style. New influences, including those of jazz and blues after his first visit to America in 1965, became increasingly evident in his compositions. While Tippett's stature with the public continued to grow, not all critics approved of these changes in style, some believing that the quality of his work suffered as a consequence. From around 1976 Tippett's late works began to reflect the works of his youth through a return to lyricism."},{"page_url":"https://de.wikipedia.org/wiki/Hern%C3%A1n_Cort%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Van_Beecq_-_Cort%C3%A9s_sinkink_ships.jpeg","page_title":"Hernán Cortés","context_page_description":"Hernán Cortés de Monroy y Pizarro Altamirano – der Vorname wird mitunter mit Hernando oder Fernando angegeben, der Nachname auch mit Cortez wiedergegeben – war ein spanischer Konquistador. Mit Hilfe seiner indianischen Verbündeten eroberte er das Aztekenreich und dessen Hauptstadt Tenochtitlan. In den Jahren von 1521 bis 1530 war Hernán Cortés Generalgouverneur von Neuspanien."},{"page_url":"https://pt.wikipedia.org/wiki/Henderson_(Tennessee)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Downtown_henderson_tennessee.jpg","page_title":"Henderson (Tennessee)","context_page_description":"Henderson é uma cidade localizada no estado norte-americano de Tennessee, no Condado de Chester."},{"page_url":"https://bar.wikipedia.org/wiki/Listn_vo_de_Woppm_in_Tirol","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Wappen_at_seefeld_in_tirol.png","page_title":"Listn vo de Woppm in Tirol","context_page_description":"Rickelt, K.: die Wappen der Städte und Märkte von Tirol. Innsbrück, 1894.\\nKöfler, W. und Beimrohr, W.: Wappen der Tiroler Gemeinden. Innsbruck, 1995.\\nHye, F-H.: Die Entwicklung der Municipal-Heraldik in Tirol mit besonderer Berücksichtigung der Geschichte des Wappens der Landeshauptstadt Innsbruck, in: Bertenyi, I. and Czona, L.: Acta contionis heraldicae municipalis modiernae anno 1988 in oppido Keszthely habitae. Keszthely, 1990. ISBN 963-04-0574-1"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%82%D9%88%D8%A7%D8%AA_%D8%A7%D9%84%D9%85%D8%B3%D9%84%D8%AD%D8%A9_%D8%A7%D9%84%D8%B9%D8%B1%D8%A7%D9%82%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/May_movemant_1941_medal.jpg","page_title":"القوات المسلحة العراقية","context_page_description":"القوات المسلحة العراقية هي القوات المسلحة النظامية لجمهورية العراق، وتنقسم إلى خمسة أفرع رئيسية، القوة البرية، والقوة الجوية، والقوة البحرية، وطيران الجيش، والدفاع الجوي،اضافة إلى أفرع اخرى،جهاز مكافحة الارهاب،الحشد الشعبي. تخضع جميع أفرع القوات المسلحة العراقية لسلطة وزارة الدفاع العراقية ويرأسها وزير الدفاع جمعة عناد الجبوري. جهاز مكافحة الارهاب، الحشد الشعبي تتبع، رئاسة الوزراء القائد العام للقوات المسلحة هو رئيس الوزراء العراقي، والذي يشغل المنصب حالياً [مصطفى الكاظمي ]]، ويقوم رئيس الجمهورية بمهمة القيادة العليا للقوات المسلحة للأغراض التشريفية والاحتفالية. أما رئيس أركان الجيش فهو الفريق الأول الركن عثمان الغانمي.\\nتاريخ العسكرية في العراق ضارب في القِدم، حيث ظهر أول جيش نظامي في الأرض التي تشكل العراق المعاصر خلال القرن التاسع قبل الميلاد. وعلى مدى عدة قرون ظهرت في العراق عدة جيوش اختلفت باختلاف الحضارة التي نمت في كنفها، بدءاً من العصر الآشوري ومروراً بالعصر الأكدي والبابلي والإسلامي وحتى العصر الحديث."},{"page_url":"https://en.wikipedia.org/wiki/LGBT_rights_in_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Lohana_Berkins_y_Carlos_J%C3%A1uregui.jpg","page_title":"LGBT rights in Argentina","context_page_description":"Lesbian, gay, bisexual, and transgender rights in Argentina are among the most advanced in the world. Upon legalising same-sex marriage on 15 July 2010, Argentina became the first country in Latin America, the second in the Americas, and the tenth in the world to do so. Following Argentina's transition to a democracy in 1983, its laws have become more inclusive and accepting of LGBT people, as has public opinion.\\nArgentina also \\"has one of the world's most comprehensive transgender rights laws\\": its Gender Identity Law, passed in 2012, allows people to change their legal gender without facing barriers such as hormone therapy, surgery or psychiatric diagnosis that labels them as having an abnormality. Because of the law, as well as the creation of alternative schools and the first transgender community centre in Latin America, BBC Mundo reported in 2014 that \\"Argentina leads the trans revolution in the world.\\" In 2015, the World Health Organization cited Argentina as an exemplary country for providing transgender rights.\\nSocietal acceptance is also very high."},{"page_url":"https://id.wikipedia.org/wiki/Kim_Ryeowook","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Experience_korea_ryeowook_%283%29.jpg","page_title":"Kim Ryeowook","context_page_description":"Kim Ryeo-wook lahir 21 Juni 1987, Dikreditkan sebagai Ryeowook. Ia adalah seorang penyanyi-penulis lagu dan Radio DJ Korea Selatan. Ia dikenal sebagai anggota boyband Korea Selatan, Super Junior dan subgrupnya, Super Junior-M dan Super Junior-K.R.Y. Ia adalah satu dari tiga vokal utama dalam Super Junior. Seiring dengan empat anggota lain Super Junior, dia adalah salah satu artis Korea pertama yang muncul di perangko Tiongkok."},{"page_url":"https://en.wikipedia.org/wiki/Charles_Sumner_Tainter","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Charles_Sumner_Tainter_seated.jpg","page_title":"Charles Sumner Tainter","context_page_description":"Charles Sumner Tainter was an American scientific instrument maker, engineer and inventor, best known for his collaborations with Alexander Graham Bell, Chichester Bell, Alexander's father-in-law Gardiner Hubbard, and for his significant improvements to Thomas Edison's phonograph, resulting in the Graphophone, one version of which was the first Dictaphone.\\nLater in his career Tainter was associated with the International Graphopone Company of West Virginia, and also managed his own research and development laboratory, earning him the title: 'Father Of The Talking Machine'."},{"page_url":"https://sv.wikipedia.org/wiki/Aphaenogaster_araneoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Aphaenogaster_araneoides_casent0102145_label_1.jpg","page_title":"Aphaenogaster araneoides","context_page_description":"Aphaenogaster araneoides är en myrart som beskrevs av Carlo Emery 1890. Aphaenogaster araneoides ingår i släktet Aphaenogaster och familjen myror."},{"page_url":"https://fr.wikipedia.org/wiki/Grotte_de_Marsoulas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Cau-Durban_Marsoulas_MHNT.PRE.201.0.6.jpg","page_title":"Grotte de Marsoulas","context_page_description":"La grotte de Marsoulas, dite encore grotte des Fées, est une petite grotte ornée située sur la commune française de Marsoulas, dans le département de la Haute-Garonne en région Midi-Pyrénées.\\nElle est célèbre pour avoir été la première grotte ornée paléolithique officiellement reconnue dans les Pyrénées."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9C%A8%E6%9B%B4%E6%B4%A5%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Center_of_Kisarazu_2019.jpg","page_title":"木更津市","context_page_description":"木更津市，位於日本千葉縣中西部的房總半島、東京灣的中部東岸，對岸為橫濱市，是上總地方中代表的都市之一。就如同地名使用日文中表示港的津字一般，自古代以來就做為房總半島的物流據點發展為港町之一。\\n曾經是明治維新期間廢藩置縣時成立的木更津縣縣廳所在地，自1950年代以後的高度成長期中，縣的東京灣岸發展成京葉工業地帶時，木更津市具有很強的商業都市性質，在縣南地方形成木更津商圈，成為商業中心都市，因1990年代泡沫經濟崩壞的影響，區域經濟低迷。現在，在為了緩和向東京都心一極集中的第4次首都圈基本計畫中，被賦予業務核都市的位置，在第5次首都圏基本計畫中整備為東京圈內的大範圍合作據點。此外，也被認定為以推動國際會議為目的的國際會議觀光都市。\\n市內主要之名勝有海螢以及以狸囃子傳説知名的證誠寺等。在歌舞伎劇碼『與話情浮名橫櫛』中成為故事舞台而知名，2002年以本市為舞台，於TBS系列中放映的電視連續劇『木更津貓眼』也一時成為話題。\\n市章是以木更津的「木」字外加圓框圖案。圓代表港，上方部分表示港口，合起來代表市民團結發展。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%83%D0%BF%D0%B5%D1%80%D0%BA%D1%83%D0%B1%D0%BE%D0%BA_%D0%A3%D0%B3%D0%BE%D1%80%D1%89%D0%B8%D0%BD%D0%B8_%D0%B7_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_2002","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Bianco_e_Viola_%28Strisce%29.png","page_title":"Суперкубок Угорщини з футболу 2002","context_page_description":"Суперкубок Угорщини з футболу 2002 — 4-й розіграш турніру. Матч відбувся 20 липня 2002 року між чемпіоном Угорщини клубом Залаегерсег та володарем кубка Угорщини клубом Уйпешт."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%8A%D9%83%D9%88%D9%84%D8%A7%D8%B3_%D9%81%D8%B1%D9%8A%D8%AA%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Nicol%C3%A1s_Freitas.jpg","page_title":"نيكولاس فريتاس","context_page_description":"نيكولاس فريتاس ‏ هو لاعب كرة قدم أوروغواني في مركز الوسط. لعب مع إيفرتون دي فينا ديل مار وبنيارول وبيلا فيستا وروزاريو سنترال ومونتيفيديو واندررز ونادي إنترناسيونال."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%B0%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/%D0%92%D0%BD%D1%83%D1%82%D1%80%D0%B5%D0%BD%D0%BD%D0%B8%D0%B9_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D1%8C%D0%B5%D1%80_%D0%BA%D0%BE%D1%81%D1%82%D1%91%D0%BB%D0%B0_%D0%92%D0%BE%D0%B7%D0%BD%D0%B5%D1%81%D0%B5%D0%BD%D0%B8%D1%8F_%D0%9F%D1%80%D0%B5%D1%81%D0%B2%D1%8F%D1%82%D0%BE%D0%B9_%D0%94%D0%B5%D0%B2%D1%8B_%D0%9C%D0%B0%D1%80%D0%B8%D0%B8_%D0%B2_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D0%B5_%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D0%B5_%281%29.jpg","page_title":"Краснае","context_page_description":"Кра́снае — вёска ў Беларусі, на рацэ Вушы. Цэнтар сельсавету Маладэчанскага раёну Менскай вобласьці. Насельніцтва на 2010 год — 2868 чалавек. Знаходзіцца за 16 км на паўднёвы ўсход ад Маладэчна, на аўтамабільнай дарозе Менск — Маладэчна. Чыгуначная станцыя Вуша на лініі Менск — Маладэчна.\\nКраснае — даўняе мястэчка гістарычнай Меншчыны."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%81%D1%82%D0%BE%D0%BF%D0%BA%D0%B0,_%D0%9A%D1%8F%D1%81%D1%82%D1%83%D1%82%D0%B8%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/K%C4%99stutis_Nastopka_and_Juozas_Tumalis.JPG","page_title":"Настопка, Кястутис","context_page_description":"Кясту́тис Насто́пка — литовский литературовед, литературный критик, переводчик; хабилитированный доктор гуманитарных наук, профессор, лауреат Национальной премии."},{"page_url":"https://de.wikipedia.org/wiki/Thalheim_(Oschatz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/ThalheimO-Bf.JPG","page_title":"Thalheim (Oschatz)","context_page_description":"Thalheim ist ein Ortsteil der Stadt Oschatz im Landkreis Nordsachsen in Sachsen. Zu Thalheim gehören die Ortsteile Saalhausen und Kreischa."},{"page_url":"https://eo.wikipedia.org/wiki/Rusia_rublo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Banknote_5_rubles_%281997%29_back.jpg","page_title":"Rusia rublo","context_page_description":"Rusia rublo estas la monunuo de Rusio. La centono de rusa rublo nomiĝas kopeko.\\nInternacia ISO-kodo de rublo estas RUB, estas erare plu uzata ankaŭ la antaŭa kodo — RUR."},{"page_url":"https://en.wikipedia.org/wiki/Korean_People%27s_Army","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Mansudae_Grand_Monument_26.JPG","page_title":"Korean People's Army","context_page_description":"The Korean People's Army is the de facto military forces of North Korea and the armed wing of the Workers' Party of Korea. Under the Songun policy, it is the central institution of North Korean society. Kim Jong-un serves as Supreme Commander and the chairman of the Central Military Commission. The KPA consists of five branches: the Ground Force, the Naval Force, the Air and Anti-Air Force, the Strategic Rocket Forces, and the Special Operation Force.\\nThe KPA considers its primary adversaries to be the South Korean military and United States Forces Korea, across the Korean Demilitarized Zone, as it has since the Armistice Agreement of July 1953. As of 2016, with 5,889,000 paramilitary personnel, it is the largest paramilitary organisation in the world. This number serves as 25% of the North Korean population."},{"page_url":"https://en.wikipedia.org/wiki/%C4%90eravica_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Gjerovica_3.jpg","page_title":"Đeravica Lake","context_page_description":"Đeravica Lake or Gjeravica Lake is a mountain lake in Kosovo located just under the summit of Gjeravica. The lake is about 2,200 m above sea level. It is shaped like a tooth and is the origin of the Erenik river which flows down to the Metohija region of western Kosovo. The maximum length of this lake is 240 m and the width is 120 m. The lake is known for is its many salamanders, which feast on flying insects. The lake has a maximum depth of 3.8 m.\\nThe Lake contains many fish. It has an area of 2 hectares."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%87%AA%E8%BB%A2%E8%BB%8A%E3%82%AD%E3%83%A3%E3%83%AA%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/W%C3%B3z_techniczny_Cofidis.JPG","page_title":"自転車キャリア","context_page_description":"自転車キャリアは、自転車を輸送するために自動車やバスに取り付けられた装置。バイクラックとも呼ばれる。"},{"page_url":"https://ca.wikipedia.org/wiki/Port_Sulphur","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Port_Sulphur_Louisiana_aerial_view.jpg","page_title":"Port Sulphur","context_page_description":"Port Sulphur és una població dels Estats Units a l'estat de Louisiana. Segons el cens del 2000 tenia una població de 3.115 habitants."},{"page_url":"https://ru.wikipedia.org/wiki/PZL-104_Wilga","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/%D0%92%D0%B8%D0%BB%D1%8C%D0%B3%D0%B0-35%D0%90.jpg","page_title":"PZL-104 Wilga","context_page_description":"ПЗЛ-104 «Вильга» — польский лёгкий учебно-спортивный самолёт.\\nСпроектирован и производился компанией PZL."},{"page_url":"https://en.wikipedia.org/wiki/Daihatsu_Mira_Tocot","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Daihatsu_Mira_TOCOT_G%22SA_III%22_%28DBA-LA550S-GBVF%29_rear.jpg","page_title":"Daihatsu Mira Tocot","context_page_description":"The Daihatsu Mira Tocot is a kei car built by the Japanese automaker Daihatsu. It is the successor to the Mira Cocoa. Its 658 cc KF-VE inline-three petrol engine produces 38 kW and 60 N⋅m of torque.\\nThe name \\"Tocot\\" is a coined word inspired by \\"To Character\\", \\"To Comfortableness\\" and \\"To Convenience\\"."},{"page_url":"https://it.wikipedia.org/wiki/Hallenkirche","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Pseudobasilica.png","page_title":"Hallenkirche","context_page_description":"L'Hallenkirche o chiesa a sala è una particolare tipologia relativa alla costruzione delle chiese nella quale la navata centrale è alta quanto le navate laterali, o di poco più alta, contrariamente a quanto si riscontra nella prevalente tipologia basilicale."},{"page_url":"https://ca.wikipedia.org/wiki/Francavilla_al_Mare","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Francavilla_al_Mare_07_%28RaBoe%29.jpg","page_title":"Francavilla al Mare","context_page_description":"Francavilla al Mare és un municipi italià, situat a la regió dels Abruços i a la província de Chieti. El 2004 tenia 23.733 habitants."},{"page_url":"https://pt.wikipedia.org/wiki/Vitorino","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/AV_Antoninian_Victorinus.JPG","page_title":"Vitorino","context_page_description":"Marco Piavônio Vitorino foi um imperador gálico entre 269 e 271 e sucessor do fugaz Mário no trono do Império das Gálias. Ele foi assassinado por um marido enciumado depois de tentar seduzir a mulher dele."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B8%D1%80%D1%8C%D1%8F%D1%81%D0%B0%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Kirjasalo1885.jpg","page_title":"Кирьясало","context_page_description":"Ки́рьяса́ло, Ки́рияса́ло — упразднённая деревня в междуречье Волчьей и Смородинки на территории Куйвозовского сельского поселения Всеволожского района Ленинградской области, ранее относившаяся к лютеранскому приходу Лемпаала. Известна богатым историческим прошлым."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%B9%BC%EB%9D%BC%EB%94%94%EC%9B%80%EC%86%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Caladium_white1.JPG","page_title":"칼라디움속","context_page_description":"칼라디움속은 남아메리카 아마존 지방 원산의 여러해살이 식물로 천남성과에 속하며 잎이 토란잎과 유사한 관엽식물이다. 잎에는 레이스나 화살 모양의 다양한 무늬가 있어 매우 아름다우므로 온실에서 흔히 가꾼다. 기온이 20℃ 이하에서는 아름다운 잎이 되지 않으며, 5℃ 이하에서는 알뿌리가 잘 썩는다. 번식은 알뿌리로 하는데, 큰 알뿌리는 2-3개로 나누어 심는다. 칼라디움은 땅 속의 굵은 덩이줄기에서 자란다. 온대지역에서는 덩이줄기를 양분과 수분이 많은 흙에 심어 실내에서 재배하는데, 가을이 되어 잎이 떨어지면 덩이줄기에 한 달에 한 번씩 물을 준다.\\n이 식물은 15~35인치 높이로 자라고 잎은 대개 6~18인치 길이로 넓은 편이다."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%D8%A8%D9%88%D9%84%DB%8C%D9%88%D8%A7%D8%B1_(%D8%A7%DB%8C%E2%80%8C%D9%BE%DB%8C%E2%80%8C%D8%A7%DB%8C-%DB%B3%DB%B4)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/USS_Bolivar_Circa_1944.jpg","page_title":"یواس‌اس بولیوار (ای‌پی‌ای-۳۴)","context_page_description":"یواس‌اس بولیوار (ای‌پی‌ای-۳۴) یک کشتی بود که طول آن ۴۹۲ فوت بود. این کشتی در سال ۱۹۴۲ ساخته شد."},{"page_url":"https://es.wikipedia.org/wiki/Gillenbeuren","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Wappen_Gillenbeuren.jpg","page_title":"Gillenbeuren","context_page_description":"Gillenbeuren es un municipio situado en el distrito de Cochem-Zell, en el estado federado de Renania-Palatinado. Su población estimada a finales de 2016 era de 244 habitantes.​\\nSe encuentra ubicado en la zona centro-norte del estado, cerca de la orilla del río Mosela, uno de los principales afluentes del Rin por su margen izquierda."},{"page_url":"https://de.wikipedia.org/wiki/Cascade_Tunnel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Cascade_Tunnel_Stevens_Pass.jpg","page_title":"Cascade Tunnel","context_page_description":"Der Cascade Tunnel ist ein eingleisiger Eisenbahntunnel und verläuft unter Stevens Pass durch die nordamerikanische Kaskadenkette. Der Name Cascade Tunnel bezeichnet sowohl den aktuellen Tunnel zwischen Scenic und Berne im US-Bundesstaat Washington mit einer Länge von 12,5 km als auch einen älteren, 1929 stillgelegten Scheiteltunnel zwischen Tye und dem Betriebsbahnhof Cascade Station mit einer Länge von 4,2 km."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%81%D9%8A%D9%84%D9%8A%D8%A8_%D8%A7%D8%AF%D8%B1%D9%8A%D8%A7%D9%86_%D8%B1%D8%A7%D9%8A%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Picture_of_Adrain_Wright-_2013-08-15_21-54.jpg","page_title":"فيليب ادريان رايت","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nفيليب ادريان رايت عازف مزيكا من المملكه المتحده."},{"page_url":"https://pl.wikipedia.org/wiki/Dyn%C3%B3w_(gmina_wiejska)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Harta_kosciol_sw._Mikolaja_20._04.09_p.jpg","page_title":"Dynów (gmina wiejska)","context_page_description":"Dynów – gmina wiejska położona w południowo-wschodniej Polsce, w województwie podkarpackim, w powiecie rzeszowskim. Siedziba gminy znajduje się w mieście Dynów. Jest to gmina o charakterze rolniczo-leśnym, której funkcjami, prócz rolnictwa, są produkcja żywności oraz obsługa ludności i związane z tym osadnictwo.\\nGmina stanowi około 10% powierzchni powiatu i zamieszkuje ją około 4% jego mieszkańców. Charakteryzuje się najniższą gęstością zaludnienia oraz najwyższą lesistością terenu spośród gmin powiatu.\\nTeren gminy jest słabo uprzemysłowiony. Ważnym aspektem jej funkcjonowania jest turystyka, co przejawia się w dużym stosunku obszarów chronionych do jej powierzchni oraz licznych szlakach turystycznych, przebiegających przez jej terytorium.\\nSieć dróg w gminie opiera się na dwóch ważnych szlakach komunikacyjnych, dobrze łączących ją z pozostałą częścią województwa."},{"page_url":"https://sl.wikipedia.org/wiki/James_Spader","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/James_Spader_by_Gage_Skidmore.jpg","page_title":"James Spader","context_page_description":"James Spader, ameriški igralec, * 7. februar 1960.\\nSpader je najbolj poznan po ekscentričnih vlogah v filmih Lepotica v rožnatem, Seks, laži in videotrakovi, Crash, Zvezdna vrata in Tajnica ter po upodobitvi dinamičnega odvetnika Alana Shora v serijah Praksa in Zvezde na sodišču."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%95%D0%BB%D0%B5%D0%BD%D0%B0_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%BF%D0%BE%D0%BB%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Follis-Helena-trier_RIC_465.jpg","page_title":"Елена Константинополска","context_page_description":"Флавия Юлия Елена, позната също като Света Елена, Елена Августа и Елена от Константинопол, е наложница на римския император Констанций Хлор и майка на сина им император Константин I, наричан Константин Велики.\\nТрадиционно се счита, че Елена е издирила къде е била Голготата в Ерусалим, наредила там да се извършат разкопки и открила Гроба господен и Светия кръст."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%81%E3%82%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Korean.food-Budaejjigae-01.jpg","page_title":"チゲ","context_page_description":"チゲは、キムチや肉、魚介類、豆腐などを出汁で煮込んだ朝鮮半島の鍋料理のひとつ。"},{"page_url":"https://en.wikipedia.org/wiki/Lade_(crater)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Lade_crater_AS16-M-0835.jpg","page_title":"Lade (crater)","context_page_description":"Lade is the remains of a lunar impact crater that has been flooded by lava. Its diameter is 58 km. It was named after German astronomer Heinrich Eduard von Lade. To the north is the crater Godin and to the south-southwest is the worn, lava-flooded Saunder.\\nThe southern rim of Lade has been completely covered or destroyed, and there are gaps in the relatively thin southeast rim. The surviving crater wall is worn and somewhat hexagonal in outline. There is a smaller bowl-shaped crater attached to the interior of the western rim. To the north the crater designated Lade B has been completely filled with lava."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Neundorfer_Vorstadt_(Plauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Stra%C3%9Fberger_Stra%C3%9Fe_85_Plauen_2.jpg","page_title":"Liste der Kulturdenkmale in der Neundorfer Vorstadt (Plauen)","context_page_description":"In der Liste der Kulturdenkmale in der Neundorfer Vorstadt sind die Kulturdenkmale des Plauener Stadtteils Neundorfer Vorstadt verzeichnet, die bis Januar 2020 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale in Plauen."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB_%D0%A0%D0%BE%D1%81%D1%81%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Hermitage_from_inside.jpg","page_title":"Карл Россі","context_page_description":"Карл Россі, Карло ді Джованні Россі, також російське адаптоване Карл Іванович Россі — російський архітектор італійського походження, автор багатьох будівель й архітектурних ансамблів в Санкт-Петербурзі та його околицях."},{"page_url":"https://en.wikipedia.org/wiki/Bitola","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Hajdar_Kadi_Mosque_%28Bitola%29.jpg","page_title":"Bitola","context_page_description":"Bitola is a city in the southwestern part of North Macedonia. It is located in the southern part of the Pelagonia valley, surrounded by the Baba, Nidže and Kajmakčalan mountain ranges, 14 kilometres north of the Medžitlija-Níki border crossing with Greece. The city stands at an important junction connecting the south of the Adriatic Sea region with the Aegean Sea and Central Europe, and is an administrative, cultural, industrial, commercial, and educational centre. It has been known since the Ottoman period as \\"The City of The Consuls\\", since many European countries had consulates in Bitola.\\nBitola, known during the Ottoman Empire as Manastir or Monastir, is one of the oldest cities in North Macedonia. It was founded as Heraclea Lyncestis in the middle of the 4th century BC by Philip II of Macedon. The city was the last capital of Ottoman Rumelia, from 1836 to 1867. According to the 2002 census, Bitola is the second-largest city in the country. Bitola is also the seat of the Bitola Municipality."},{"page_url":"https://bar.wikipedia.org/wiki/Hippie","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/RussianRainbowGathering_4Aug2005.jpg","page_title":"Hippie","context_page_description":"A Hippie is a Person in oana Jugendbewegung, de wo in de 1960er Joar ian Afschwung ghobd hod. Typisch fia Hippies san Rockmusi und Drogn. De Bewegung setzt si owa voa oim fia n Friedn ei."},{"page_url":"https://en.wikipedia.org/wiki/Melanogastraceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Melanogaster_tuberiformis_17757.jpg","page_title":"Melanogastraceae","context_page_description":"Melanogastraceae is a family of fungi in the order Boletales."},{"page_url":"https://en.wikipedia.org/wiki/Paris_M%C3%A9tro_entrances_by_Hector_Guimard","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/EGRaspail.JPG","page_title":"Paris Métro entrances by Hector Guimard","context_page_description":"Between 1900 and 1913, Hector Guimard was responsible for the first generation of entrances to the underground stations of the Paris Métro. His Art Nouveau designs in cast iron and glass dating mostly to 1900, and the associated lettering that he also designed, created what became known as the Métro style and popularized Art Nouveau. However, arbiters of style were scandalized and the public was also less enamored of his more elaborate entrances. In 1904 his design for the Opéra station at Place de l'Opéra was rejected and his association with the Métro ended; many of his station entrances have been demolished, including all three of the pavilion type. Those that remain are now all protected historical monuments, one has been reconstituted, and some originals and replicas also survive outside France."},{"page_url":"https://en.wikipedia.org/wiki/Fresnel_lens","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Oita_sekizaki_lighthouse_old_lense.jpg","page_title":"Fresnel lens","context_page_description":"A Fresnel lens is a type of composite compact lens originally developed by French physicist Augustin-Jean Fresnel for lighthouses. It has been called \\"the invention that saved a million ships.\\"\\nThe design allows the construction of lenses of large aperture and short focal length without the mass and volume of material that would be required by a lens of conventional design. A Fresnel lens can be made much thinner than a comparable conventional lens, in some cases taking the form of a flat sheet. A Fresnel lens can capture more oblique light from a light source, thus allowing the light from a lighthouse equipped with one to be visible over greater distances."},{"page_url":"https://nn.wikipedia.org/wiki/Shafir","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Shafir.jpg","page_title":"Shafir","context_page_description":"Shafir er ein moshav sør i Israel. Han ligg i Shephelah nær Kiryat Malakhi og høyrer til Shafir regionale kommune. I 2006 hadde han 499 innbyggjarar.\\nShafir vart grunnlagd den 15. august 1949 av immigrantar frå Ungarn og Tsjekkoslovakia. Han vart kalla opp etter den bibelske byen Shafir som er nemnt i Mika 1:11, og som òg tyder «god og vakker». Han er bygd nær den avfolka palestinske landsbyen Al-Sawafir al-Shamaliyya, på landområdet som høyrte til landsbyen Al-Sawafir al-Sharqiyya.\\nI 1956 opna ein fedayeen eld mot ei synagoge full av barn og tenåringar. Tre barn og ein ung arbeidar vart drepne, medan fem andre vart skadde, tre alvorlege."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Nymburce","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Nymburk%2C_socha_svat%C3%A9ho_Vojt%C4%9Bcha.jpg","page_title":"Seznam kulturních památek v Nymburce","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Nymburk v okrese Nymburk vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://hu.wikipedia.org/wiki/Fogasker%C3%A9k","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Gener%C3%A1l%C3%A1s.jpg","page_title":"Fogaskerék","context_page_description":"A fogaskerék egy tengellyel rendelkező gépelem fogakkal a kerülete mentén, feladata az, hogy egy másik alkalmasan elkészített alkatrészhez csatlakoztatva forgatónyomatékot tudjon átadni egy másik gépelemnek megváltoztatva a mozgás jellemzőit: irányát, szögsebességét, nyomatékát, forgóról haladó mozgás jellegét. Egymáshoz szorított fogazás nélküli kerekek is képesek a súrlódás segítségével nyomatékot átvinni, azonban terhelés esetén csúsznak, ezért kopnak és melegednek. A fogaskerekek csúszásmentesen tudják ugyanezt a feladatot megoldani nagyságrendekkel nagyobb nyomatékok esetében is. Ezért sorolják a kényszerhajtások közé.\\nA fogaskereket Kínában találták föl az i. e. 4. században, a Csou-dinasztia idején. Valószínűleg onnan került nyugatra, Alexandriai Hérón az i. sz. 1. században már a Ptolemaida Egyiptomban is alkalmazta."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A2%D7%A8%D7%9B%D7%AA_%D7%94%D7%A9%D7%9E%D7%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/NewtonsTelescopeReplica.jpg","page_title":"מערכת השמש","context_page_description":"מערכת השמש היא מערכת כוכבי לכת, שבה מקיפים שמונה כוכבי לכת וגופים נוספים רבים את השמש בהתאם לכוחות הכבידה הרלוונטיים. הגופים הגדולים העיקריים שסובבים את השמש הם שמונת כוכבי הלכת, ואליהם מצטרפים כוכבי לכת ננסיים ומספר גדול של גופים קטנים כמו אסטרואידים, שביטים ומטאורואידים. לחלק מהגופים שסובבים את השמש, ובייחוד לגדולים שבהם, יש ירחים משל עצמם, שמתלווים אליהם לאורך ההקפה.\\nמערכת השמש נוצרה לפני כ־4.6 מיליארד שנה, והיא נמצאת בבועה המקומית על זרוע אוריון, אחת משש הזרועות של גלקסיית שביל החלב. גלקסיית שביל החלב מכילה בין 200 ל־400 מיליארד כוכבים, והיא ממוקמת, יחד עם כ־35 גלקסיות נוספות, בתוך קבוצת גלקסיות המכונה הקבוצה המקומית. הקבוצה המקומית היא רק אחת מקבוצות גלקסיות וצבירי גלקסיות רבים המרכיבים את צביר־על הבתולה, אחד מצבירי־על רבים ביקום. מעריכים שביקום כולו יש מאות מיליארדי גלקסיות, ויותר מ־‎10²²‎ כוכבים.\\nהמרכיב הדומיננטי של מערכת השמש הוא השמש עצמה, שתופסת 99.86% מהמסה הידועה של המערכת כולה. במרחק הקצר ביותר לשמש נמצאים ארבעת \\"כוכבי הלכת הפנימיים\\", הקרויים גם \\"כוכבי הלכת הארציים\\": כוכב חמה, נוגה, כדור הארץ ומאדים. אחריהם נמצאת חגורת האסטרואידים, המורכבת ממאות אלפי אסטרואידים, וביניהם כוכב לכת ננסי אחד ‒ קרס."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D9%86%D9%8A%D8%B3%D8%A9_%D8%A3%D9%85_%D8%A7%D9%84%D9%85%D8%B4%D9%88%D8%B1%D8%A9_%D8%A7%D9%84%D8%B5%D8%A7%D9%84%D8%AD%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/%D9%83%D9%86%D9%8A%D8%B3%D8%A9_%D8%A7%D9%85_%D8%A7%D9%84%D9%85%D8%B4%D9%88%D8%B1%D8%A9_%D8%A7%D9%84%D8%B5%D8%A7%D9%84%D8%AD%D8%A9.jpg","page_title":"كنيسة أم المشورة الصالحة","context_page_description":"تعد كنيسة ام المشورة الصالحة وسط بعقوبة مع كنيسة البشارة للكلدان في خانقين من أبرز المعالم المسيحية في محافظة ديالى\\nو تعد من أقدم الكنائس في محافظة ديالى حيث تم انشائها في اربعينيات القرن الماضي وتم ترك هذه الكنيسة سنة 2006 بسبب سيطرة تنظيم القاعدة الإسلامي على مدينة بعقوبة حيث تم تهجير غالبية المسيح من المدينة وكان تعدادهم أكثر من ثلاث الاف شخص.\\nوبعد استقرار الأوضاع الأمنية في مدينة بعقوبة رممت هذه الكنيسة وأعيد افتتاحها بعد 13 سنة من إغلاقها بواسطة منظمات إنسانية في المدينة مثل منظمة ديالاس وفريق نساء الحالمات التطوعي بالتعاون مع شرطة ديالى بحضور الأستاذ هاني قسطو من رئاسة الوقف المسيحي وأقيمت أول صلاة لمسيحيي ديالى فيها في 1 كانون الثاني 2019 حيث تقام فيها الصلاوات والقداس ومراسيم الزواج والعزاء."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%8F%99%E5%88%A9%E4%BA%9A%E8%A1%8C%E6%94%BF%E5%8C%BA%E5%88%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Qunaitra.jpg","page_title":"叙利亚行政区划","context_page_description":"敘利亞行政區劃包括13個省和1個直轄市：\\n哈塞克省\\n阿勒頗省\\n大馬士革\\n德拉省\\n代爾祖爾省\\n哈馬省\\n霍姆斯省\\n伊德利卜省\\n拉塔基亞省\\n庫奈特拉省\\n拉卡省\\n大馬士革省\\n蘇韋達省\\n塔爾圖斯省"},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_evanghelic%C4%83_fortificat%C4%83_din_Rodbav","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/RO_BV_Biserica_fortificata_din_Rodbav_%2843%29.jpg","page_title":"Biserica evanghelică fortificată din Rodbav","context_page_description":"Biserica evanghelică fortificată din Rodbav este un ansamblu de monumente istorice aflat pe teritoriul satului Rodbav, comuna Șoarș. În Repertoriul Arheologic Național, monumentul apare cu codul 41989.04.\\nAnsamblul este format din două monumente:\\nBiserica evanghelică\\nIncintă fortificată, anexe"},{"page_url":"https://lv.wikipedia.org/wiki/P%C4%BCavnieki","image_url":"https://upload.wikimedia.org/wikipedia/lv/e/e1/Plavnieku_mikrorajons.jpg","page_title":"Pļavnieki","context_page_description":"Pļavnieki ir Rīgas pilsētas apkaime Latgales priekšpilsētā, A daļā. Pļavnieki ir visblīvāk apdzīvotā Rīgas apkaime. Tā robežojas ar Purvciema, Dreiliņu, Šķirotavas un Dārzciema apkaimēm. Pļavnieku ZA atrodas Rīgas robeža, aiz kuras sākas Stopiņu novads. Pļavnieku apkaimes robežas ir Lubānas iela, Ilūkstes iela, Augusta Deglava iela.\\nPļavnieku apkaimes kopējā platība ir 2,985 km², kas ir apmēram 2/5 mazāk nekā vidējais apkaimes platības rādītājs Rīgā. Pa perimetru apkaimes robežas garums ir 7 664 metri. Noteiktās Pļavnieku apkaimes robežas dabā ir skaidri nolasāmas, jo tās iet pa maģistrālajām ielām. Pašreizējais apbūves raksturs Pļavniekos pārsvarā atšķiras no apbūves rakstura kaimiņu apkaimēs. Pļavnieki ir blīvi apbūvēta apkaime, kurā dominē 9 līdz 16 stāvu ēkas, kā arī atsevišķas 18 stāvu ēkas.\\nPļavniekus var uzskatīt par telpiski vienotu un funkcionāli savstarpēji saistītu teritoriju jeb apkaimi, kas lielā mērā jau ir izveidota."},{"page_url":"https://en.wikipedia.org/wiki/1995%E2%80%9396_Australian_region_cyclone_season","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Jacob_1996_track.png","page_title":"1995–96 Australian region cyclone season","context_page_description":"The 1995–96 Australian region cyclone season was an active Australian cyclone season, with Western Australia experiencing a record number of landfalling intense storms in the Pilbara region. The season produced a total of 19 tropical cyclones, of which 14 developed into named storms and 9 reached severe tropical cyclone status. The strongest of the season was Severe Tropical Cyclone Olivia, which also produced the highest recorded wind gust on record of 408 km/h. Though several systems impacted land, the general sparsity of population centres in Australia limits the scale of damage. One person was confirmed to have been killed and cumulative losses were estimated at A$77 million."},{"page_url":"https://sv.wikipedia.org/wiki/Karin_Olsson_(journalist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Karin_Olsson_-_2.jpg","page_title":"Karin Olsson (journalist)","context_page_description":"Ingrid Karin Olsson, född 23 april 1979 i Hörby, Skåne, är en svensk journalist, kulturchef på Expressen.\\nKarin Olsson var tidigt i karriären chefredaktör för studenttidningen Lundagård, mellan 2003 och 2005. Hon har också varit nyhetsreporter på bland annat Resumé. Sedan 2004 arbetar Olsson på Expressen. Hon har bland annat varit nyhetschef på Expressen.se och politisk krönikör. 2008 blev hon redaktionssekreterare för ledare och debatt. Våren 2010 efterträdde hon Björn Wiman som kulturchef på Expressen och sedan 2014 är hon även ställföreträdande ansvarig utgivare för tidningen."},{"page_url":"https://de.wikipedia.org/wiki/Franz_Jakob_Schwanthaler","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Grabmal_f%C3%BCr_den_Prinzen.jpg","page_title":"Franz Jakob Schwanthaler","context_page_description":"Franz Jakob Schwanthaler war ein deutscher Bildhauer. Er gilt als Hauptmeister der Plastik des Münchner Frühklassizismus."},{"page_url":"https://ms.wikipedia.org/wiki/Daerah_Alor_Gajah","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/AG_Sentral_Bus_Terminal.jpg","page_title":"Daerah Alor Gajah","context_page_description":"Daerah Alor Gajah merupakan salah satu daerah di Melaka, Malaysia, 24 kilometer dari Bandaraya Melaka dan juga merupakan salah satu pintu masuk utama ke negeri Melaka melalui Lebuhraya Utara-Selatan. Ibu daerah Alor Gajah berpusat di Bandar Alor Gajah. Daerah Alor Gajah yang mengandungi tiga buah bandar dan 16 buah pekan-pekan kecil. Keluasan daerah Alor Gajah adalah seluas 66,302 hektar yang merangkumi 31 buah mukim."},{"page_url":"https://pl.wikipedia.org/wiki/Kortowo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Kortowo.jpg","page_title":"Kortowo","context_page_description":"Kortowo – osiedle w Olsztynie, stanowiące część oficjalnego podziału administracyjnego miasta, usytuowane w południowej jego części, nad Jeziorem Kortowskim.\\nKortowo tworzy wyodrębnione z pozostałej części miasta miasteczko uniwersyteckie, w którym siedzibę ma większość instytucji uniwersyteckich lub związanych z Uniwersytetem Warmińsko-Mazurskim w Olsztynie. Na terenie osiedla znajdują się jeziora Stary Dwór i Modrzewiowe.\\nW latach 1886–1889 na terenach Kortowa wybudowano szpital psychiatryczny, jego pensjonariusze zostali wymordowani podczas II wojny światowej. Po wojnie ocalałe zabudowania zaadaptowano na siedzibę następujących szkół wyższych:\\nWyższa Szkoła Rolnicza w Olsztynie 1950-1968\\nAkademia Rolniczo-Techniczna w Olsztynie 1969-1999\\nUniwersytet Warmińsko-Mazurski od 1999\\nDla corocznych olsztyńskich Juwenaliów utarła się nazwa Kortowiady."},{"page_url":"https://no.wikipedia.org/wiki/Warner_Bros.","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Water_tower_WB.jpg","page_title":"Warner Bros.","context_page_description":"Warner Bros. Entertainment Inc. er et amerikansk mediaselskap som produserer spillefilm, fjernsynsprogrammer, og musikk. Som et av de største filmstudioer er det et datterselskap av Time Warner med hovedkontor i Burbank i nærheten av Los Angeles i California. Warner Bros. har selv flere datterselskaper, blant annet innenfor produksjon av spillefilm, underholdningsprodukter, fjernsynsproduksjon, tegnefilm, tegneserier, video, populærmusikk, og fjernsynskanaler. Warner Bros. eier også halvparten av CW Television Network. Noen av dets mest berømte filmstjerner er Bette Davis, James Cagney, Humphrey Bogart, Doris Day, og i nyere tid Clint Eastwood."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santa_Maria_Assunta_(Palazzone)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/PalazzoneSanCascianoDeiBagniSantaMariaAssunta1.jpg","page_title":"Chiesa di Santa Maria Assunta (Palazzone)","context_page_description":"La chiesa di Santa Maria Assunta è un luogo di culto cattolico situato a Palazzone, nel comune di San Casciano dei Bagni, in provincia di Siena."},{"page_url":"https://it.wikipedia.org/wiki/Roberto_Octavio_Gonz%C3%A1lez_Nieves","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Archbishop_Roberto_Gonz%C3%A1lez_Nieves.jpg","page_title":"Roberto Octavio González Nieves","context_page_description":"Roberto Octavio Gonzalez Nieves è un arcivescovo cattolico portoricano."},{"page_url":"https://et.wikipedia.org/wiki/Garry_Conille","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Garry_Conille_2012.jpg","page_title":"Garry Conille","context_page_description":"Garry Conille on Haiti arst, tervishoiuametnik ja poliitik.\\nTa oli 18. oktoobrist 2011 kuni 4. maini 2012 Haiti peaminister."},{"page_url":"https://pt.wikipedia.org/wiki/Yaya_Tour%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Yaya_Toure_9229.JPG","page_title":"Yaya Touré","context_page_description":"Gnégnéri Yaya Touré é um futebolista marfinense que atua como volante. Atualmente está sem clube.\\nNa sua família, tem dois irmãos que também foram jogadores: Kolo Touré, aposentado, e Ibrahim Touré, que morreu em decorrência de câncer.\\nComeçou no Mimosas, do seu país natal, sendo contratado ainda em idade de base pelo belga Beveren, onde jogou por três temporadas, até ser contratado pelo ucraniano Metalurh Donetsk, em 2003.\\nDois anos depois, se destacando no clube, se transferiu para o Olympiakos, permanecendo apenas por uma temporada, assim como no Monaco, que o contratou em 2006 e o liberou em 26 de julho de 2007, quando Yaya se juntou ao elenco do Barcelona após o clube pagar 10 milhões de euros ao time francês.\\nTrês temporadas depois, tendo conquistado vários títulos, foi contratado pelo Manchester City por 30 milhões de euros.\\nNas semi-finais da Copa da Inglaterra de 2010–11, no jogo contra o grande rival Manchester United, Yaya Touré marcou o gol da vitoria do City por 1 a 0, classificando a equipe para a final do torneio."},{"page_url":"https://en.wikipedia.org/wiki/De_Kooy_Airfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Vliegveld_De_Kooy-Helikopters.jpg","page_title":"De Kooy Airfield","context_page_description":"De Kooy Airfield is an airfield 2.9 NM south of Den Helder, Netherlands, named after the nearby hamlet De Kooy. It serves as both a civilian airport under the name Den Helder Airport and a naval airport under the name Maritiem Vliegkamp De Kooy.\\nMost movements on the De Kooy are made by helicopters, bringing workers to and from offshore oilrigs and naval helicopters such as the NH90 of the Royal Netherlands Navy. But fixed-wing aircraft visit and operate from the airport as well. Skyline Aviation operates from De Kooy, who mainly operate business aircraft but also do airwork such as aerial photography for both civilian and military contractors. Amongst their fleet of aircraft most noticeable are several Aero L-39 Albatros jets."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%8A%D9%85_%D8%A8%D9%84%D9%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Jame_Pollock.jpg","page_title":"جيم بلك","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجيم بلك لاعب هوكى الجليد من كندا."},{"page_url":"https://ca.wikipedia.org/wiki/Rad","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/PDB_2gjs_EBI.jpg","page_title":"Rad","context_page_description":"Les RAD pertanyen a la superfamília de les proteïnes G petites Ras, i que estan classificades dins de la subfamília de les RGK.\\nLes GTPases associades amb les Ras estan involucrades en el control de diferents funcions cel·lulars essencials, com el creixement cel·lular, la diferenciació cel·lular, l'organització del citoesquelet, el transport vesicular i la transducció de senyal. Tot i això, es creu que les Rad estan associades com a mínim a tres malalties i processos principalment: en la diabetis tipus II, en la hipertròfia cardíaca, degut a la seva implicació com a lligand de la calmodulina; i en la reparació de trencaments en dobles cadenes de DNA i com a regulador del cicle cel·lular, degut a la interacció amb la polimerasa ε.\\nCom a membres de la subfamília de les RGK, les Rad tenen característiques que les distingeixen dels altres membres de la superfamília de les Ras, bàsicament en la seqüència d'unió al GTP."},{"page_url":"https://fr.wikipedia.org/wiki/Houthalen-Helchteren","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Houthalen_-_Sint-Martinuskerk.jpg","page_title":"Houthalen-Helchteren","context_page_description":"Houthalen-Helchteren est une commune néerlandophone de Belgique située en Région flamande dans la province de Limbourg.\\nAu 1ᵉʳ juillet 2004, la population totale de cette commune est de 29 721 habitants. La superficie totale est de 78,27 km².\\nCode postal : 3530"},{"page_url":"https://it.wikipedia.org/wiki/Mayo_GAA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/MacHale_Park%2C_Castlebar%2C_Ireland%2C_November_2016.jpg","page_title":"Mayo GAA","context_page_description":"Il Mayo County Board, più conosciuto come Mayo GAA è uno dei 32 county boards irlandesi responsabile della promozione degli sport gaelici nella contea di Mayo e dell'organizzazione dei match della propria rappresentativa con altre contee. La squadra ha un'ottima tradizione nel calcio gaelico, lo sport maggiormente praticato nella contea, avendo vinto ripetutamente titoli All-Ireland in tutte le fasce di età. La prima squadra partecipa regolarmente all'All-Ireland Senior Football Championship, dove nella prima fase gioca il torneo della sua provincia, il Connacht Senior Football Championship.\\nNonostante gli eccellenti risultati a livello provinciale, che gli hanno consentito di conquistare 47 titoli e quindi la vetta dell'albo d'oro, Mayo non vanta un invidiabile palmarès a livello All-Ireland, avendo conquistato il titolo solo 3 volte, ultima nel 1951. La carenza di titoli è dovuta al poco cinismo nelle finali: Mayo ha infatti raggiunto l'atto conclusivo ben 16 volte, ma in ben 13 occasioni è uscita sconfitta. Peraltro vanta il poco invidiabile record di finali perse consecutivamente: ben 9, striscia ancora aperta."},{"page_url":"https://en.wikipedia.org/wiki/Lanchester_Motor_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Lanchester-10001.JPG","page_title":"Lanchester Motor Company","context_page_description":"The Lanchester Motor Company Limited was a car manufacturer located until early 1931 at Armourer Mills, Montgomery Street, Sparkbrook, Birmingham, and afterwards at Sandy Lane, Coventry England. The marque has been unused since the last Lanchester was produced in 1955. The Lanchester Motor Company Limited is still registered as an active company and accounts are filed each year, although as of 2014 it is marked as \\"non-trading\\".\\nThe Lanchester company was purchased by the BSA Group at the end of 1930, after which its cars were made by Daimler on Daimler's Coventry sites. So, with Daimler, Lanchester became part of Jaguar Cars in 1960.\\nIn 1990 Ford Motor Company bought Jaguar Cars and it remained in their ownership, and from 2000 accompanied by Land Rover, until they sold both Jaguar and Land Rover to Tata Motors in 2008, who created Jaguar Land Rover as a subsidiary holding company for them. In 2013, Jaguar Cars was merged with Land Rover to form Jaguar Land Rover Limited, and the rights to the Lanchester car brand were transferred to the newly formed British multinational car manufacturer Jaguar Land Rover."},{"page_url":"https://fr.wikipedia.org/wiki/Nordhofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Wappen_Nordhofen.png","page_title":"Nordhofen","context_page_description":"Nordhofen est une municipalité de la Verbandsgemeinde de Selters, dans l'arrondissement de Westerwald, en Rhénanie-Palatinat, dans l'ouest de l'Allemagne."},{"page_url":"https://no.wikipedia.org/wiki/Maribo-Saksk%C3%B8bing_kraftvarmeverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Maribo-Saksk%C3%B8bing_Kraftvarmev%C3%A6rk.JPG","page_title":"Maribo-Sakskøbing kraftvarmeverk","context_page_description":"Maribo-Sakskøbing kraftvarmeverk er et varmekraftverk utenfor Køge sør for København i Danmark. Dette anlegget er et såkalt kraftvarmeverk som utnytter inntil 90% av energien i det fossile brenselet, ved at spillvarmen utnyttes til levering av fjernvarme. Operatør er DONG Energy.\\nAnlegget ble installert i 1999. Brenselskilden er biomasse i form av 40.000 tonn strå årlig, som leveres av bøndene på Lolland og Falster. Kraftvarmeverket produserer 9 MW elektrisitet og 20 MJ/sek fjernvarme, nok til å dekke 90% av behovet for fjernvarme i Maribo og Sakskøbing, og elektrisitetsbehovet til 10 000 husholdninger."},{"page_url":"https://lb.wikipedia.org/wiki/Mars_Science_Laboratory","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Mars_%27Curiosity%27_Rover%2C_Spacecraft_Assembly_Facility%2C_Pasadena%2C_California_%282011%29.jpg","page_title":"Mars Science Laboratory","context_page_description":"De Mars Science Laboratory ass eng NASA-Missioun, déi de Mars erfuersche soll, fir erauszefannen ob a wéi wäit en als Biosphär kéint benotzt ginn. Dofir gouf um Mars e Rover mam Numm Curiosity ausgesat, dee praktesch autonom schaffe kann. En ass mat zéng Instrumenter ekipéiert, fir ë. a. Gestengs, Atmosphär a Stralung z'analyséieren. Nieft Spektrographe kommen och Kameraen a meteorologesch Instrumenter zum Asaz. D'Donnéeë ginn op d'Äerd gefunkt. De Curiosity huet eng Mass vu knapps 900 kg an d'Gréisst vun engem klengen Auto; et ass dee bis ewell gréissten Objet, deen d'Mënschen op der Marsuewerfläch ausgesat hunn.\\nD'Technik gouf op Basis vun den Erfarunge mat de béide Mars-Roveren entwéckelt an huet an alle Beräicher däitlech méi Leeschtung. Zousätzlech gouf et nach e puer Innovatiounen, besonnesch am Beräich vum Landesystem. Donieft krut de Curiosity bei der Energieversuergung Radionuklidbatterien amplaz vu wiederofhängege Solarzellen.\\nDe 26. November 2011 um 15:02 UTC war d'Sond u Bord vun enger Atlas V vun der Cape Canaveral Air Force Station aus gestart, d'Landung war de 6. August 2012 ëm 05:31 UTC.\\nDe 27."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_personnages_de_Vampire_Diaries","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Kelly_Hu_on_April_10%2C_2013_%28by_May_S.Young%29.jpg","page_title":"Liste des personnages de Vampire Diaries","context_page_description":"Cet article présente les personnages de la série télévisée américaine Vampire Diaries, qui compte actuellement huit saisons.\\nLa série est centrée sur Elena Gilbert et le triangle amoureux qu'elle forme avec Damon Salvatore et Stefan Salvatore.\\nBien que la série s'inspire de livres Journal d'un vampire, l'histoire comporte des différences. En effet, dans Vampire Diaries, Elena Gilbert est décrite différemment, aussi bien physiquement que mentalement. Son histoire diffère des livres sur quelques points. Les noms de plusieurs personnages, notamment Bonnie Bennett, Matt Donovan, Tyler, Katherine et Jenna, ont été modifiés dans la série.\\nDe plus, quelques personnages, comme Jeremy Gilbert, n'apparaissent pas dans les livres, tandis que d'autres ne figurent pas dans l'adaptation télévisée."},{"page_url":"https://es.wikipedia.org/wiki/Shamsia_Hassani","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Graffiti_at_Darul_Aman_Palace%2C_Kabul%2C_Afghanistan.jpg","page_title":"Shamsia Hassani","context_page_description":"Ommolbahni Hassani, mejor conocida como Shamsia, es una grafitera afgana y profesora de escultura en la Universidad de Kabul. Ella ha popularizado el arte urbano en las calles de Kabul.​​​ Expone su arte digital y su arte urbano en India, Irán, Alemania, Italia, Suiza y en las misiones diplomáticas de Kabul. En 2014, fue nombrada una entre las 100 Public Intellectual Poll.​\\nHassani pinta grafitis en Kabul para sensibilizar el público acerca de los años de guerra.​​"},{"page_url":"https://es.wikipedia.org/wiki/Shamsia_Hassani","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Graffiti_at_Darul_Aman_Palace%2C_Kabul%2C_Afghanistan.jpg","page_title":"Shamsia Hassani","context_page_description":"Ommolbahni Hassani, mejor conocida como Shamsia, es una grafitera afgana y profesora de escultura en la Universidad de Kabul. Ella ha popularizado el arte urbano en las calles de Kabul.​​​ Expone su arte digital y su arte urbano en India, Irán, Alemania, Italia, Suiza y en las misiones diplomáticas de Kabul. En 2014, fue nombrada una entre las 100 Public Intellectual Poll.​\\nHassani pinta grafitis en Kabul para sensibilizar el público acerca de los años de guerra.​​"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Pers%C3%B6nlichkeiten_aus_Brooklyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Jimmy_Fallon%2C_Montclair_Film_Festival%2C_2013.jpg","page_title":"Liste von Persönlichkeiten aus Brooklyn","context_page_description":"Diese Liste enthält Persönlichkeiten, die in Brooklyn geboren wurden. Brooklyn ist seit 1898 ein Stadtbezirk von New York City."},{"page_url":"https://en.wikipedia.org/wiki/Buick_Regal","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/1999_Buick_Regal_LS_3.8L_rear_6.1.19.jpg","page_title":"Buick Regal","context_page_description":"The Buick Regal is an upscale mid-sized automobile that was first introduced by Buick for the 1973 model year. The model was originally positioned as a personal luxury car, and typically offered in both coupe and sedan forms until 1997, when the Regal became sedan-only due to the decline of the personal luxury coupe market. For certain model years between 1973 and 2004, the Regal shared bodies and powertrains with the similar Buick Century, although the Regal was positioned as a more upmarket vehicle.\\nThe Regal was discontinued in the North American market in 2004, being succeeded by the Buick LaCrosse. In 2008, a new version of the Regal was introduced for the Chinese market, which is a badge engineered version of the Opel Insignia. The new Regal was introduced to the North American market in 2011, positioned as a mid-size vehicle. A new model was introduced for 2018, which is offered in a liftback sedan and a \\"TourX\\" station wagon version. GM plans to discontinue the Regal in the North American market after the 2020 model year, making Buick exclusively a CUV marque there."},{"page_url":"https://pt.wikipedia.org/wiki/Miss%C3%B5es_diplom%C3%A1ticas_da_Su%C3%AD%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Swiss_embassy_Prague_2872.jpg","page_title":"Missões diplomáticas da Suíça","context_page_description":"Abaixo se encontram as embaixadas e consulados da Suíça:"},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D0%B5%D0%BD-%D0%94%D1%8C%D0%B5%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Saint-Di%C3%A9ry-Bas_Ch%C3%A2teau1.JPG","page_title":"Сен-Дьери","context_page_description":"Сен-Дьери — Францин гӀала-коммуна, лаьтта Овернь — Рона — Альпаш регионехь. Коммунан департамент — Пюи-де-Дом. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%9A%E6%91%A9%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Tama_newtown_No._57_site_20120104.jpg","page_title":"多摩市","context_page_description":"多摩市は、東京都の多摩地域南部に位置する市。\\n人口は約14万7千人。"},{"page_url":"https://no.wikipedia.org/wiki/Katalin_Kov%C3%A1cs","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/KovacsKatalinFotoThalerTamas.jpg","page_title":"Katalin Kovács","context_page_description":"Katalin Kovács er en ungarsk padler som spesialiserer seg i kajakk flatvann. Hun representerte landet sitt under Sommer-OL 2012 i London, der hun tok gull i K-4 500 meter.\\nHun har i tillegg to andre gull, og fem sølv fra fire forskjellige OL, samt 40 medaljer fra VM."},{"page_url":"https://no.wikipedia.org/wiki/Parlamentsvalget_i_S%C3%B8r-Korea_2012","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Park_Geun-hye.jpg","page_title":"Parlamentsvalget i Sør-Korea 2012","context_page_description":"Parlamentsvalget i Sør-Korea 2012 ble avholdt den 11. april 2012. Samtidig ble det avholdt suppleringsvalg i flere provinser, byer og fylker. 40,18 millioner stemmeberettigede kunne avlegge stemmer ved 13 470 stemmesteder. Valgdeltakelsen steg fra 46 prosent for fire år siden til 54,3 prosent. Valget anses å være en indikator for resultatet i presidentvalget i desember.\\nDet konservative partiet Ny verden fikk fornyet tillit og beholdt sin absolutte majoritet i nasjonalforsamlingen med 152 av 300 mandater. Det største opposisjonspartiet, Det demokratiske enhetspartiet gikk mest fram, men ikke nok og endte med 127 mandater. Partiet samarbeidet med Det forente framskrittspartiet som fikk 13 mandater. Det mindre høyrepartiet, Det frihetlige framskrittspartiet, får fem mandater, mens det bare blir innvalgt tre uavhengige. Opposisjonen dominerer i Seoul og Gyeonggi-provinsen, men Ny verden ble overlegent størst i Gangwon, Chungcheong-provinsene og i sin tradisjonelle bastion, Gyeongsang-provinsene."},{"page_url":"https://en.wikipedia.org/wiki/Magle%C3%A5s","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Magle%C3%A5s_herreg%C3%A5rd.jpeg","page_title":"Magleås","context_page_description":"Magleås is a mansion in Høsterkøb near Birkerød in northern Zealand, Denmark. It is located in Rudersdal Municipality in the Capital Region of Denmark, 25 km. outside Copenhagen. The mansion includes 8 hectare park, and borders on the Rude Forest. It also includes stables and a caretaker's house.\\nIt was built in 1910 for businessman Aage Westenholz, an uncle of Karen Blixen who was a co-owner and chairman of the board of her coffee farm. He had previously made a fortune as a businessman in Asia. The main building, with its 50 rooms, was designed by the Westenholz' brother-in-law, the architect Torben Grut, in a neo-baroque style. In 1910, the Westenholz family moved in with a large staff. The nearby mansion Aasebakken was also designed by Torben Grut and built for land-owner Lennart Grut.\\nIn 1942, Magleås was bought by papal chamberlain and count Christopher de Paus, who had sold his estate Herresta in Sweden in 1938 to a relative and who died in 1943. Magleås was inherited by Thorleif Paus, who sold the property in 1945 to the Catholic Church in Denmark."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%ADmskokatolick%C3%A1_farnost_Havra%C5%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Havra%C5%88_-_kostel.jpg","page_title":"Římskokatolická farnost Havraň","context_page_description":"Římskokatolická farnost Havraň je zaniklé územní společenství římských katolíků v Havrani a okolí. Organizačně spadalo do krušnohorského vikariátu, který je jedním z deseti vikariátů litoměřické diecéze."},{"page_url":"https://fy.wikipedia.org/wiki/Kuala_Lumpur","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/KL_Composite2.jpg","page_title":"Kuala Lumpur","context_page_description":"Kuala Lumpur is de haadstêd fan Maleizje.\\n\\"Kuala Lumpur\\" betsjut safolle as \\"modderige gearrin fan rivieren\\"."},{"page_url":"https://sv.wikipedia.org/wiki/Lupinus_bicolor","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Lupinus_bicolor_8016.JPG","page_title":"Lupinus bicolor","context_page_description":"Lupinus bicolor är en ärtväxtart som beskrevs av John Lindley. Lupinus bicolor ingår i släktet lupiner, och familjen ärtväxter."},{"page_url":"https://en.wikipedia.org/wiki/Easel","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Tripod_easel.jpg","page_title":"Easel","context_page_description":"An easel is an upright support used for displaying and/or fixing something resting upon it, at an angle of about 20° to the vertical. In particular, easels are traditionally used by painters to support a painting while they work on it, normally standing up, and are also sometimes used to display finished paintings. Artists' easels are still typically made of wood, in functional designs that have changed little for centuries, or even millennia, though new materials and designs are available. Easels are typically made from wood, aluminum or steel.\\nEasel painting is a term in art history for the type of midsize painting that would have been painted on an easel, as opposed to a fresco wall painting, a large altarpiece or other piece that would have been painted resting on the floor, a small cabinet painting, or a miniature created sitting at a desk, though perhaps also on an angled support. It does not refer to the way the painting is meant to be displayed; most easel paintings are intended for display framed and hanging on a wall.\\nIn a photographic darkroom, an easel is used to keep the photographic paper in a flat or upright position to the enlarger."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1973","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Vladimir_Smicer.jpg","page_title":"Lijst van personen geboren in 1973","context_page_description":"Dit is een lijst van personen die geboren zijn in 1973.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://is.wikipedia.org/wiki/Sepultura","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Sepultura_-_Wacken_Open_Air_2018-1237.jpg","page_title":"Sepultura","context_page_description":"Sepultura er brasilísk þrass-sveit stofnuð í Belo Horizonte árið 1984 af bræðrunum Max og Igor Cavalera.\\nHljómsveitin var áhrifamikil seint á 9. áratugnum og snemma á 10. áratugnum. Bræðurnir yfirgáfu sveitina síðar, Max árið 1996 og Igor árið 2006. Max stofnaði Soulfly og síðar Cavalera Conspiracy með bróður sínum. Frá 1998 hefur bandaríski söngvarinn Derrick Green verið með sveitinni. Sepultura þýðir gröf á portúgölsku."},{"page_url":"https://en.wikipedia.org/wiki/Parliament_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Ottawa_Parliament_Gardens_Famous_Five_Women_are_Persons.jpg","page_title":"Parliament Hill","context_page_description":"Parliament Hill, colloquially known as The Hill, is an area of Crown land on the southern banks of the Ottawa River in downtown Ottawa, Ontario, Canada. Its Gothic revival suite of buildings is the home of the Parliament of Canada and has architectural elements of national symbolic importance. Parliament Hill attracts approximately 3 million visitors each year. Law enforcement on Parliament Hill and in the parliamentary precinct is the responsibility of the Parliamentary Protective Service.\\nOriginally the site of a military base in the 18th and early 19th centuries, development of the area into a governmental precinct began in 1859, after Queen Victoria chose Ottawa as the capital of the Province of Canada. Following a number of extensions to the parliament and departmental buildings and a fire in 1916 that destroyed the Centre Block, Parliament Hill took on its present form with the completion of the Peace Tower in 1927. Since 2002, an extensive $1 billion renovation and rehabilitation project has been underway throughout all of the precinct's buildings; work is not expected to be complete until after 2028."},{"page_url":"https://ca.wikipedia.org/wiki/Monument_a_Rafael_Casanova","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Mare_de_D%C3%A9u_de_la_Merc%C3%A8_-_Barcelona_01.JPG","page_title":"Monument a Rafael Casanova","context_page_description":"El Monument a Rafael Casanova és una escultura que rememora l'últim conseller en cap de Barcelona. El conjunt monumental està situat actualment a l'encreuament de la Ronda de Sant Pere amb els carrers d'Ali Bei i de Girona, a la ciutat de Barcelona. És obra de l'escultor Rossend Nobas, i es va fabricar el 1888."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A2%D9%84%D9%88%DB%8C_%D8%AA%D8%A7%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Ximenia_americana_leaves_%26_fruit_at_Chilkur_near_Hyderabad%2C_AP_W2_IMG_7288.jpg","page_title":"آلوی تالو","context_page_description":"آلوی تالو یا آلوی زرد یا لیموی دریایی نام یک گونه از فرمانرو گیاه است."},{"page_url":"https://eu.wikipedia.org/wiki/NGC_488","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/N488s.jpg","page_title":"NGC 488","context_page_description":"NGC 488 galaxia espiral bat da, Pisces konstelazioan. William Herschelek aurkitu zuen 1784ko abenduaren 13an."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B7%D0%B0%D1%80%D1%8B%D1%86%D1%8F%D0%BD%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/%D0%9D%D0%B0%D0%B7%D0%B0%D1%80%D1%8D%D1%86%D1%8F%D0%BD%D0%BA%D1%96.PNG","page_title":"Назарыцянкі","context_page_description":"Назарэтанкі — каталіцкая жаночая манаская кангрэгацыя, заснаваная ў Рыме ў 1875 годзе польскай манахіняй блажэннай Францыскай Седліскай.\\nПершапачаткова кангрэгацыя стваралася як чыста сузіральная, але з 1880 назарэтанкі пачалі весці актыўную дабрачынную і катэхітычную дзейнасць. З 1881 цэнтрам кангрэгацыі стаў Кракаў, у 1884 была прынята канстытуцыя назарэтанак. 1 верасня 1896 рымскі папа Леў XIII зацвердзіў канстытуцыю, а канчаткова стварэнне кангрэгацыі было пацверджана папам Бенедыктам XII у 1923.\\nЗ самага пачатку манашкі-назарэтанкі пачалі актыўную дзейнасць у розных краінах свету. Першапачаткова гэта былі краіны са шматлікай польскай дыяспарай — ЗША, Вялікабрытанія і інш., затым геаграфія дзейнасці назарэтанок пашырылася яшчэ больш. У 1918 годзе ў ЗША былі ўтвораны тры правінцыі назарэтанак, колькасць кляштараў у гэтай краіне перавысіла лічбу 30.\\nУ Беларусі вядомы манашкі-назарэтанкі, якія былі расстраляны гітлераўцамі 1 жніўня 1943 каля Навагрудка замест закладнікаў з ліку мясцовага насельніцтва. У 2000 папа Ян Павел II правёў беатыфікацыю 11 манашак, якія ў жніўні 1943 года загінулі ад рук нацыстаў."},{"page_url":"https://de.wikipedia.org/wiki/Radmer","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ab/Radmer_im_Bezirk_LN.png","page_title":"Radmer","context_page_description":"Radmer ist eine Gemeinde mit 537 Einwohnern in der Steiermark, im Gerichtsbezirk bzw. Bezirk Leoben in Österreich."},{"page_url":"https://nl.wikipedia.org/wiki/Arminiuskerk_(Rotterdam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Overzicht_van_de_oostgevel_-_Rotterdam_-_20426690_-_RCE.jpg","page_title":"Arminiuskerk (Rotterdam)","context_page_description":"De Remonstrantse Kerk, in Rotterdam ook bekend als Arminiuskerk, is een kerkgebouw van de Remonstrantse gemeente, gebouwd in 1895-1897 in het centrum van Rotterdam. De kerk, het orgel en de consistorie zijn aangewezen als rijksmonument."},{"page_url":"https://es.wikipedia.org/wiki/Poveda_de_la_Sierra","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Alto_Tajo._Poveda_de_la_Sierra.jpg","page_title":"Poveda de la Sierra","context_page_description":"Poveda de la Sierra es un municipio español de la provincia de Guadalajara, en la comunidad autónoma de Castilla-La Mancha. Tiene una superficie de 51,7 km² con una población de 131 habitantes y una densidad de 2,61 hab/km²."},{"page_url":"https://en.wikipedia.org/wiki/Temple_of_Literature,_Hanoi","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Trang_ph%E1%BB%A5c_nho_sinh.JPG","page_title":"Temple of Literature, Hanoi","context_page_description":"Văn Miếu is a temple dedicated to Confucius in Hanoi, northern Vietnam. The temple also hosts the Imperial Academy, Vietnam's first national university. The temple was built in 1070 at the time of Emperor Lý Thánh Tông. It is one of several temples in Vietnam which is dedicated to Confucius, sages and scholars. The temple is located to the south of the Imperial Citadel of Thăng Long. The various pavilions, halls, statues and stelae of doctors are places where offering ceremonies, study sessions and the strict exams of the Đại Việt took place. The temple is featured on the back of the 100,000 Vietnamese đồng banknote. Just before the Vietnamese New Year celebration Tết, calligraphists will assemble outside the temple and write wishes in Hán characters. The art works are given away as gifts or are used as home decorations for special occasions."},{"page_url":"https://es.wikipedia.org/wiki/Privezac","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ce/Map_commune_FR_insee_code_12191.png","page_title":"Privezac","context_page_description":"Privezac es una población y comuna francesa, situada en la región de Mediodía-Pirineos, departamento de Aveyron, en el distrito de Villefranche-de-Rouergue y cantón de Montbazens."},{"page_url":"https://nl.wikipedia.org/wiki/Amerikaanse_presidentsverkiezingen_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Bill_Weld_campaign_portrait.jpg","page_title":"Amerikaanse presidentsverkiezingen 2016","context_page_description":"De Amerikaanse presidentsverkiezingen van 2016 waren de 58e presidentsverkiezingen van de Verenigde Staten van Amerika en vonden plaats op 8 november 2016. Het US Elections Project schat dat 131,7 miljoen Amerikanen stemden van de 231 miljoen die daartoe gerechtigd waren - een opkomst van 56,9 procent. Gekozen werden de 45e president en de 48e vicepresident van de Verenigde Staten. De zittende Amerikaanse president Barack Obama kon zich niet kandidaat stellen voor deze verkiezingen omdat hij reeds aan zijn tweede ambtstermijn bezig was.\\nIn de vroege ochtend van 9 november werd duidelijk dat de Republikeinse Partij de overwinning ging behalen. Donald Trump werd de 45e president van de Verenigde Staten met Mike Pence als vicepresident. Hoewel Trump de meerderheid in het kiescollege haalde, slaagde hij er niet in de zogenaamde popular vote te winnen: 65,844,954 stemmen voor Clinton tegenover 62,979,879 voor Trump, oftewel bijna drie miljoen stemmen minder voor hem.\\nOok in het Amerikaans Congres behaalden de republikeinen een meerderheid, zowel in de Senaat als in het Huis van Afgevaardigden."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%91%E5%8D%97%E9%AB%98%E9%80%9F%E5%85%AC%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/S11-CN_%28YN%29_no_name.png","page_title":"云南高速公路","context_page_description":"云南省高速公路是中国国家高速公路网和云南省骨架公路网的重要组成部分。1996年10月25日，云南省第一条高速公路——全长45公里的昆明－嵩明高速公路建成通车。截至2016年底，云南省高速公路通车里程达到4,134公里，其中国家高速公路3,570公里，省高速公路564公里。全省16个州、市中，已有13个开通了高速公路；129个县、市、区中，已有72个开通了高速公路。"},{"page_url":"https://eu.wikipedia.org/wiki/Cr%C3%A9pon_(Calvados)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Crepon_eglise_clocher.jpg","page_title":"Crépon (Calvados)","context_page_description":"Crépon Frantziako udalerria da, Calvados departamenduan dagoena, Normandia Beherea eskualdean. 2013an 222 biztanle zituen."},{"page_url":"https://he.wikipedia.org/wiki/MI5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/MI5BuildingThamesHouse.jpg","page_title":"MI5","context_page_description":"סוכנות הביון הבריטית, נקראת בשמה הרשמי MI5, או בקיצור 5 וידועה גם בכינוי 500 Box, הוא שירות ביטחון לאומי הפועל במסגרת גבולות בריטניה, בדומה ל-FBI האמריקאי, ל-DGSI הצרפתי ולשב\\"כ הישראלי.\\nסוכנות הביון נוסדה בשנת 1909 יחד עם ה-MI6 וה-GCEQ.\\nבשנת 2002 התמנתה לתפקיד המנהל הכללי של הארגון אליזה מנניגהם-באלר. כאשה היא דמות חריגה בניהול גופי ביון. בשנת 2007 מונה לתפקיד במקומה של אליזה ג'ונתן איוונס.\\nשירות הביטחון הידוע בכינויו ה-MI5 הוא שירות המודיעין הפנימי בבריטניה, חלק ממנגנון המודיעין לצד המודיעין של השירות החשאי החיצוני MI6, שאחריותו כוללת את ההגנה על הדמוקרטיה הפרלמנטרית הבריטית והמונרכיה והאינטרסים הכלכליים, טיפול בטרור וריגול נגדי בתוך בריטניה. השירות כולל תשעה משרדים ברחבי בריטניה כולל מטה ראשי בצפון אירלנד, ויש הטוענים כי גם בגלאזגו. ארגון שירות הביטחון MI5 פועל תחת סמכותו של שר הפנים בתוך הממשלה, כמו כן השירות מופקד על ידי ועדת המודיעין והביטחון של חברי הפרלמנט, אשר מונתה ישירות על ידי ראש הממשלה.\\nביקורת שיפוטית על התנהלות של הארגון מבוצעת על ידי בית הדין לחקירת סמכויות.\\nלארגון השירות MI5 יש מטה הארצי הממוקם בבית התמזה מילבנק לונדון מאז 1995, מקום המאחד כמה מחלקות שונות של השירות. בית התמזה משותף גם למטה המודיעין של צפון אירלנד, וגם ביתם של המרכז לניתוח והערכת פעולות הטרור."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Nevele","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Merendree_-_Nevele_-_Belgium_-_Rectorie.jpg","page_title":"Lijst van onroerend erfgoed in Nevele","context_page_description":"Een overzicht van het onroerend erfgoed in de deelgemeente Nevele. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://pt.wikipedia.org/wiki/Quadr%C3%A2ngulo_de_Tharsis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Ulysses_Patera_-_topography_map.png","page_title":"Quadrângulo de Tharsis","context_page_description":"O quadrângulo de Tharsis é um de uma série de 30 quadrângulos em Marte estabelecidos pelo Programa de Pesquisa de Astrogeologia do Serviço Geológico dos Estados Unidos. Também pode-se referir ao quadrângulo de Tharsis como MC-9.\\nO quadrângulo cobre uma área que vai de 90° a 135º longitude oeste e 0° a 30° latitude norte em Marte, essa região abriga a maior parte do Planalto de Tharsis. O platô é quase tão alto quanto o Monte Everest na Terra e quase tão vasto quanto a Europa inteira. Tharsis abriga um grupo de grandes vulcões. Olympus Mons é o maior deles."},{"page_url":"https://en.wikipedia.org/wiki/Dar_Batha","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/DSC00198_%283770970%29.jpg","page_title":"Dar Batha","context_page_description":"Dar Batḥa, or Qasr al-Batḥa, is a former royal palace in the city of Fez, Morocco. The palace was commissioned by the Alaouite Sultan Hassan I in the late 19th century and finished under his successor Abdelaziz. It was converted into a museum of historical arts and crafts in 1915 with a collection that now comprises over 6,500 objects. The palace is located near Bab Bou Jeloud at the western edge of Fes el-Bali, the old medina quarter of the city, and close to Fes el-Jdid, the new medina quarter."},{"page_url":"https://fr.wikipedia.org/wiki/Klimavitchy","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/%D0%91%D1%83%D0%B4%D1%8B%D0%BD%D0%B0%D0%BA._%D0%B3._%D0%9A%D0%BB%D1%96%D0%BC%D0%B0%D0%B2%D1%96%D1%87%D1%8B.jpg","page_title":"Klimavitchy","context_page_description":"Klimavitchy ou Klimovitchi est une ville de la voblast de Moguilev, en Biélorussie, et le centre administratif du raïon de Klimavitchy. Sa population s'élevait à 16 346 habitants en 2017."},{"page_url":"https://ru.wikipedia.org/wiki/USS_Skate_(SSN-578)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/USS_Skate_%28SSN-578%29%3B0857816.jpg","page_title":"USS Skate (SSN-578)","context_page_description":"USS Skate — американская атомная подводная лодка, построенная в 1955—1958 годах. Была головным кораблём проекта «Скейт» и вторым кораблём в ВМС США с таким названием."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%BB%8A%E8%BB%B8%E8%97%BB%E6%A4%8D%E7%89%A9%E9%96%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/CharaHispida.jpg","page_title":"車軸藻植物門","context_page_description":"車軸藻植物門は、車軸藻綱の上位分類である。"},{"page_url":"https://fy.wikipedia.org/wiki/N%27Dea_Davenport","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Brand_New_Heavies_at_the_Porgy_%26_Bess_in_Vienna_2008d.jpg","page_title":"N'Dea Davenport","context_page_description":"N'Dea Davenport is in Amerikaanske R&B/soul sjonger-songwriter dy't meast bekend is fan har oandiel yn de Brand New Heavies, in Britske funk/R&B band, dy't ferantwurdlik wie foar de Acid Jazz-weach yn de iere jierren '80. Hja is alris nominearre foar in Grammy Award"},{"page_url":"https://sk.wikipedia.org/wiki/Raray","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Map_commune_FR_insee_code_60525.png","page_title":"Raray","context_page_description":"Raray je francúzska obec, ktorá sa nachádza v departemente Oise, v regióne Pikardia."},{"page_url":"https://en.wikipedia.org/wiki/Ground_rule_double","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Bill_Miller_and_Fredi_Gonzalez_in_Arlington_in_September_2014.jpg","page_title":"Ground rule double","context_page_description":"A ground rule double is a baseball rule that awards two bases from the time of pitch to all baserunners including the batter-runner, as a result of the ball leaving play after being hit fairly and leaving the field under a condition of the ground rules in effect at the field where the game is being played. An automatic double is the term used to refer to a fairly hit ball leaving the field in circumstances that do not merit a home run. The automatic double is quite often mistakenly called a ground rule double."},{"page_url":"https://pl.wikipedia.org/wiki/Puchar_Islandii_w_pi%C5%82ce_no%C5%BCnej","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Laugardalsvollur_6.jpg","page_title":"Puchar Islandii w piłce nożnej","context_page_description":"Puchar Islandii w piłce nożnej - cykliczne, coroczne rozgrywki piłkarskie o charakterze pucharowym, w których uczestniczą kluby z Islandii. Pierwsza edycja została rozegrana w 1960 roku. Pierwszym triumfatorem został klub Reykjavíkur, który jest także rekordzistą pod względem zwycięstw w finałach. Zwycięzca danej edycji Pucharu Islandii zyskuje prawo występu w Lidze Europy w następnym sezonie.\\nDo sezonu 1972 finał Pucharu Islandii rozgrywany był w październiku lub listopadzie na stadionie Melavöllur w Reykjavíku. Od 1973 roku rozgrywa się je w sierpniu lub wrześniu na stadionie Laugardalsvöllur znajdującym się także w stolicy kraju."},{"page_url":"https://nl.wikipedia.org/wiki/Nehalennia_(godin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Leiden-Nehalennia-statue.JPG","page_title":"Nehalennia (godin)","context_page_description":"Nehalennia was een inheemse beschermgodin die in het 2e- en 3e-eeuwse Gallia Belgica door reizigers, vooral zeelui en handelaars, werd vereerd bij de monding van de Schelde.\\nNehalennia is alleen bekend van grote hoeveelheden gevonden altaren bij Colijnsplaat en Domburg in wat nu Zeeland is. De votiefstenen stammen van twee in steen gebouwde tempels die lagen aan de Oosterschelde. Dit was toen de hoofdmonding van de Schelde en vormde de grens tussen de civitates der Menapii en Frisiavones. Deze streek was toentertijd een belangrijke schakel in het Romeinse handelsverkeer tussen de Rijnstreek en Britannia. De vereerders van Nehalennia kwamen dan ook uit een groot gebied dat Gallia Belgica, Germania Inferior, Germania Superior en Britannia omvatte.\\nEr is voorlopig geen uitsluitsel of het om een Keltische of een Germaanse godin gaat of dat zij uit een oudere, inheemse traditie stamt. Ook in Keulen en zelfs in Tongeren zijn dergelijke altaren opgedoken. Haar cultus is vrijwel zeker ouder dan de periode waaruit de altaren stammen.\\nEen deel van de enorme collectie staat opgesteld in het Rijksmuseum van Oudheden."},{"page_url":"https://en.wikipedia.org/wiki/Cerussite","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Cerussite-18566.jpg","page_title":"Cerussite","context_page_description":"Cerussite is a mineral consisting of lead carbonate, and is an important ore of lead. The name is from the Latin cerussa, white lead. Cerussa nativa was mentioned by Conrad Gessner in 1565, and in 1832 F. S. Beudant applied the name cruise to the mineral, whilst the present form, cerussite, is due to W. Haidinger. Miners' names in early use were lead-spar and white-lead-ore.\\nCerussite crystallizes in the orthorhombic system and is isomorphous with aragonite. Like aragonite it is very frequently twinned, the compound crystals being pseudo-hexagonal in form. Three crystals are usually twinned together on two faces of the prism, producing six-rayed stellate groups with the individual crystals intercrossing at angles of nearly 60°. Crystals are of frequent occurrence and they usually have very bright and smooth faces. The mineral also occurs in compact granular masses, and sometimes in fibrous forms. The mineral is usually colorless or white, sometimes grey or greenish in tint and varies from transparent to translucent with an adamantine lustre. It is very brittle, and has a conchoidal fracture. It has a Mohs hardness of 3 to 3.75 and a specific gravity of 6.5."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Saint-Genest-de-Beauzon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Saintgenest03.jpg","page_title":"Saint-Genest-de-Beauzon","context_page_description":"Saint-Genest-de-Beauzon sī ūi-tī Hoat-kok Rhône-Alpes toā-khu Ardèche koān ê chi̍t ê commune."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%DB%8C%D8%AA_%D8%A8%DB%8C%D8%B1%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Pete_Burns.jpg","page_title":"بیت بیرنز","context_page_description":"بیت بیرنز اینگیلیسلی شارکی یازیچی، شارکیچی و موسیقیچی - پاپ موسیقی ژانرلاریندا اثرلر یارادیب. بیت بیرنز ۵ آقوست ۱۹۵۹ تاریخینده حیاتا گؤز آچیب و ۲۳ اوْکتوبر ۲۰۱۶ میلادی تاریخینده لندن شهرینده وفات ائدیب."},{"page_url":"https://ro.wikipedia.org/wiki/2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Kepler_spacecraft_artist_render_%28crop%29.jpg","page_title":"2009","context_page_description":"2009 a fost un an obișnuit al calendarului gregorian, care a început într-o zi de joi. A fost desemnat:\\nAnul Internațional al Astronomiei.\\nAnul Internațional al Fibrelor Naturale.\\nAnul Internațional al Reconcilierii.\\nAnul Internațional al Gorilei desemnat de ONU.\\nAnul european al creativității și inovării.\\nAnul orașelor Vilnius și Linz numite Capitale Europene ale Culturii.\\nÎn astrologia chineză, începând cu 7 februarie se va intra în Anul boului. Următorul An al boului va fi în 2021."},{"page_url":"https://vi.wikipedia.org/wiki/Protein_ribosome_40S_S27","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/PBB_GE_RPS27_200741_s_at_fs.png","page_title":"Protein ribosome 40S S27","context_page_description":"Protein ribosome 40S S27 còn được gọi là metallopan-stimulin 1 hoặc MPS-1 là một protein mà ở người được mã hóa bởi gen RPS27. Metallopan stimulin là một protein\\nzinc finger và được cho là có tham gia sửa chữa DNA cũng như trong tạo khối u."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%92%D7%A4%D7%99%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/New-Rock-boots.jpg","page_title":"מגפיים","context_page_description":"מַגָּף הוא פריט-הנעלה סגור וגבוה המכסה את קימור כף הרגל והקרסול בשלמותם. מִפתח מגף עשוי להיות גבוה יותר ולהגיע עד לברך ולעיתים נדירות עד סמוך למפרק הירך.\\nבעבר שימשו מגפיים כמחסה לרגל כמו גם כסממן מעמדי, והיו עשויים בעיקר מעור; כיום ניתן לאפיין שתי קבוצות של מגפיים מודרניים: האחת - פונקציונלית, שבה מיוצרים מגפיים המיועדים להליכה בתנאי מזג אוויר קשים, גשם או תנאי שטח, רכיבה או צבא, אלה עשויים מחומרים עבים וגסים החל מעור דרך גומי מוקשח ועד סוגים שונים של אריגים סינתטיים, הקבוצה השנייה היא מגפיים יומיומיים, שהתפתחו כפריט אופנה.\\nבאופן מסורתי, מגף הוא בעל סוליה עבה וקשיחה יותר מנעל רגילה; עם זאת שכיחים גם דגמים - שהמוכּר בהם הוא מגף-הגשם שמזוהה עם ילדים - שעשויים יריעת גומי סינתטי וכל תכליתם היא מניעת הירטבות הגרב בשלוליות עירוניות. ככלל, מגפיים אינם מעוצבים לאפשר גמישות יתרה או אווירודינמיות מיוחדת של התנועה ושל הרגליים, כי אם להליכה או רכיבה תוך יציבות מקסימלית של הנועל.\\nאת טווח אפשרויות השימוש בחוץ - לכאן או לכאן - קובעת מידת האטימות והחומרים."},{"page_url":"https://af.wikipedia.org/wiki/Groenmamba","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Eastern_Green_Mamba_02.jpg","page_title":"Groenmamba","context_page_description":"Die Groenmamba is 'n slang wat meestal woon in die kusstreke van Suider-Oos-Afrika. Die slang leef in bome en word dikwels vir 'n boomslang aangesien."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B7%D0%B8%D0%B0%D1%82%D1%81%D0%BA%D0%BE-%D0%A2%D0%B8%D1%85%D0%BE%D0%BE%D0%BA%D0%B5%D0%B0%D0%BD%D1%81%D0%BA%D0%B8%D0%B9_%D1%82%D0%B5%D0%BB%D0%B5%D1%84%D0%B5%D1%81%D1%82%D0%B8%D0%B2%D0%B0%D0%BB%D1%8C_%D0%BF%D0%B5%D1%81%D0%BD%D0%B8_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/TVXQ_in_BKK.jpg","page_title":"Азиатско-Тихоокеанский телефестиваль песни 2012","context_page_description":"Азиатско-Тихоокеанский телефестиваль песни 2012 — является первым ежегодным Азиатско-Тихоокеанским телефестивалем песни, который не носил соревновательный характер. Прошёл 14 октября 2012 года в «KBS Hall», который расположен в столице Южной Кореи — Сеуле. Данное мероприятие совпало с 49-й генеральной ассамблеей Азиатско-Тихоокеанского вещательного союза. В фестивале подтвердили своё участие 11 стран.\\nАзиатско-Тихоокеанский вещательный союз ранее уже запускал проекты международных конкурсов, таких как Евровидение, для своих членов в период с 1985 по 1987 года. Европейский вещательный союз предложил сотрудничать с АВС в 2008 году для создания «Конкурса песни Азиявидение», однако переговоры не дали результатов. В 2011 году АВС заявил, что организует свои собственные Азиатско-Тихоокеанские радио- и телефестивали песни.\\nИспользуемый формат отличается от формата конкурса песни Евровидение, поскольку существует два одноимённых фестиваля. Азиатско-Тихоокеанский фестиваль песни представлял собой несоревновательное музыкальное гала-шоу, в то время, как радиофестиваль песни являлся соревновательным."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%95%E0%A6%BE%E0%A6%9E%E0%A7%8D%E0%A6%9C%E0%A6%BF%E0%A6%B0_%E0%A6%B9%E0%A6%BE%E0%A6%81%E0%A6%A1%E0%A6%BC%E0%A6%BF_%E0%A6%A2%E0%A6%BF%E0%A6%AC%E0%A6%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Kanjir_Hari_Dhap_%2831%29.jpg","page_title":"কাঞ্জির হাঁড়ি ঢিবি","context_page_description":"কাঞ্জির হাঁড়ি ঢিবি বা কাঞ্জির হাড়ি ধাপ বাংলাদেশের রাজশাহী বিভাগে অবস্থিত একটি প্রাচীন স্থাপনা। এটি মূলত বগুড়া জেলার শিবগঞ্জ উপজেলায় অবস্থিত ও বাংলাদেশ প্রত্নতত্ত্ব অধিদপ্তর এর তালিকাভুক্ত একটি প্রত্নতাত্ত্বিক স্থাপনা। স্থাপনাটি খুল্লনার ধাপ থেকে প্রায় ১ কিলোমিটার পশ্চিমে এই ঢিবিটি অবস্থিত।"},{"page_url":"https://fr.wikipedia.org/wiki/Frank_Lundy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Aspettando_Clint_Keith_Carradine_fcm.jpg","page_title":"Frank Lundy","context_page_description":"L'agent spécial Frank Lundy est un personnage de la série télévisée Dexter. C'est un chasseur de tueurs en série et il passe la majeure partie de son temps à les traquer à travers les États-Unis. Lors de ses déplacements à Miami, il enquête notamment sur les affaires du Boucher de Bay Harbor et du Tueur de la trinité."},{"page_url":"https://id.wikipedia.org/wiki/Jaringan_saraf","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Blausen_0672_NeuralTissue.png","page_title":"Jaringan saraf","context_page_description":"Jaringan saraf adalah komponen jaringan utama dari sistem saraf. Sistem saraf mengatur dan mengontrol fungsi tubuh dan aktivitas dan terdiri dari dua bagian: sistem saraf pusat yang terdiri dari otak dan sumsum tulang belakang, dan percabangan saraf perifer dari sistem saraf tepi. Jaringan ini terdiri dari neuron atau sel-sel saraf, yang menerima dan mengirimkan impuls, dan neuroglia, yang juga dikenal sebagai sel-sel glial atau lebih sering hanya sebagai glia, yang membantu penghantaran impuls saraf serta memberikan nutrien bagi neuron.\\nJaringan saraf terdiri dari berbagai jenis sel-sel saraf, yang semuanya memiliki sebuah akson. Akson adalah bagian sel yang panjang seperti batang yang mengirimkan sinyal potensial aksi ke sel berikutnya. Kumpulan akson membentuk saraf di SST dan and tract di CNS.\\nFungsi dari sistem saraf mencakup masukan sensorik, integrasi, kontrol dari otot-otot dan kelenjar, homeostasis, dan aktivitas mental."},{"page_url":"https://fr.wikipedia.org/wiki/Thor","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Thor_threatens_Greybeard.jpg","page_title":"Thor","context_page_description":"Thor est le dieu du Tonnerre dans la mythologie nordique. Il est l'un des principaux dieux du panthéon nordique, et fut vénéré dans l'ensemble du monde germanique. On trouve ainsi différentes formes et graphies de son nom selon les époques et les régions du monde germanique : Þórr en vieux norrois, Þunor en anglo-saxon, Þonar en frison occidental, Donar en vieux haut-allemand, etc. Initialement, Thor est le « Tonnerre », un attribut du Ciel-Père.\\nSon culte dans le monde germanique antique est d'abord rapporté par des chroniqueurs extérieurs, notamment par Tacite. Toutefois, les mythes qui lui sont associés se retrouvent principalement dans les Eddas, textes scandinaves beaucoup plus tardifs rédigés et compilés aux alentours du XIIIᵉ siècle, soit quelques siècles après la christianisation officielle des derniers royaumes vikings et la Völuspá.\\nD'après ces textes scandinaves, Thor est le plus puissant des dieux guerriers. Symbolisant la force, la valeur, l'agilité et la victoire, il utilise la foudre et apaise ou excite les tempêtes. Ses pouvoirs sont ainsi liés au ciel. Il possède un char tiré par deux boucs qui lui permet de traverser les mondes."},{"page_url":"https://en.wikipedia.org/wiki/Physician_Preparing_an_Elixir","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Pedanius_Dioscorides_-_Folio_from_an_Arabic_translation_of_the_Materia_Medica_by_Dioscorides_-_Google_Art_Project.jpg","page_title":"Physician Preparing an Elixir","context_page_description":"The Physician Preparing an Elixir is a miniature on a folio from an illustrated manuscript copy, now in the Metropolitan Museum of Art in New York of De Materia Medica, a large herbal or work on the medical uses of plants originally written by the ancient Greco-Roman physician, Pedanius Dioscorides, in the first century AD. This page of the manuscript, dated 1224 AD, is made from paper, sized 24.8 cm wide and 33.2 cm long, and is decorated by opaque watercolor, ink, and gold detailing. It is visually split into three horizontal portions from the top of the page to the bottom; the top of the page is dominated by two lines of Arabic script, followed by the image and then five more lines of text in Arabic. The writing below the image is predominantly black with the exception of one line, which is written in red ink and is therefore highlighted to the viewer. The page is usually not on display.\\nExperts believe that the image was made in Iraq, Northern Jazira or Baghdad. Its Middle Eastern origin is corroborated with the physician’s appearance. In the image, he is wearing a headscarf, his clothing is quite colorful and it is detailed with gold decorations."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B0%D0%BC%D0%B0%D0%BB%D1%8C_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%86%D0%BB%D0%BB%D1%96%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/uk/7/73/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%9F%D0%B5%D1%82%D1%80%D1%83-%D0%9A%D0%BE%D0%BD%D0%B0%D1%88%D0%B5%D0%B2%D0%B8%D1%87%D1%83_%D0%A1%D0%B0%D0%B3%D0%B0%D0%B9%D0%B4%D0%B0%D1%87%D0%BD%D0%BE%D0%BC%D1%83_%28%D0%A5%D0%BE%D1%82%D0%B8%D0%BD%2C_%D0%B7%D0%BC%D0%B5%D0%BD%D1%88%D0%B5%D0%BD%D0%B0_%D0%BA%D0%BE%D0%BF%D1%96%D1%8F%29.JPG","page_title":"Гамаль Володимир Ілліч","context_page_description":"Володимир Ілліч Гамаль — український скульптор."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%97%E3%83%AA%E3%83%A0%E3%82%B9%E3%83%BB%E3%83%99%E3%83%AB%E3%83%B4%E3%82%A7%E3%83%87%E3%82%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Plymouth_Belvedere_Maple_St.jpg","page_title":"プリムス・ベルヴェデア","context_page_description":"ベルヴェデアは、1951年から1970年までプリムスのブランドで製造販売されたアメリカ車である。"},{"page_url":"https://de.wikipedia.org/wiki/Schwindlinge","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/2010-10-16_Marasmius_oreades_%28Bolton%29_Fr_112276.jpg","page_title":"Schwindlinge","context_page_description":"Die Schwindlinge sind eine Pilzgattung saprob lebender Blätterpilze aus der Familie der Schwindlingsverwandten, die überwiegend kleine und dünnfleischige Fruchtkörper bilden.\\nDie Typusart ist der Halsband-Schwindling."},{"page_url":"https://en.wikipedia.org/wiki/Dodecagon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Isotoxal_12-gon_rhombic_dissection-size2.svg","page_title":"Dodecagon","context_page_description":"In geometry, a dodecagon or 12-gon is any twelve-sided polygon."},{"page_url":"https://en.wikipedia.org/wiki/Eurocopter_AS350_%C3%89cureuil","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Anaheim_PD_AS350.jpg","page_title":"Eurocopter AS350 Écureuil","context_page_description":"The Eurocopter AS350 Écureuil, now Airbus Helicopters H125, is a single-engine light utility helicopter originally designed and manufactured in France by Aérospatiale and Eurocopter. In North America, the AS350 is marketed as the AStar. The AS355 Ecureuil 2 is a twin-engine variant, marketed in North America as the TwinStar. The Eurocopter EC130 is a derivative of the AS350 airframe and is considered by the manufacturer to be part of the Écureuil single-engine family."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Friedberg_(Bayern)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/D-7-71-130-118_BY-FDB_Georgstra%C3%9Fe_36.JPG","page_title":"Liste der Baudenkmäler in Friedberg (Bayern)","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Stadt Friedberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDie Liste gibt den Fortschreibungsstand vom 18. September 2019 wieder und umfasst 135 Baudenkmäler."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_%27s-Hertogenbosch_Centrum","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Hinthamerstraat_88B-90A%2C_%27s-Hertogenbosch.jpg","page_title":"Lijst van gemeentelijke monumenten in 's-Hertogenbosch Centrum","context_page_description":"Het centrum van 's-Hertogenbosch kent 327 gemeentelijke monumenten. Hieronder een overzicht:"},{"page_url":"https://pt.wikipedia.org/wiki/Pori","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Pori_town_hall.jpg","page_title":"Pori","context_page_description":"Pori é uma cidade finlandesa localizada na província de Finlândia Ocidental, costa oeste do país.\\nÉ a décima maior cidade da Finlândia, com aproximadamente 83.000 habitantes."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%AE%D0%B4%D0%B5%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Uedem_-_Hohe_M%C3%BChle_01_ies.jpg","page_title":"Юдем","context_page_description":"Юдем — громада в Німеччині, знаходиться в землі Північний Рейн-Вестфалія. Підпорядковується адміністративному округу Дюссельдорф. Входить до складу району Клеве.\\nПлоща — 60,94 км². Населення становить 8128 ос."},{"page_url":"https://ast.wikipedia.org/wiki/La_Pola_Siero","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/La_pola_de_siero_001.jpg","page_title":"La Pola Siero","context_page_description":"La Pola de Siero ye una parroquia y capital del conceyu de Siero. Cunta con una población de 12.615 habitantes.\\nEsti artículu ye un entamu. Pues ayudar a la Wikipedia n'asturianu ampliándolu.\\nDatos: Q1018362\\nMultimedia: Pola de Siero"},{"page_url":"https://it.wikipedia.org/wiki/Esercito_mitridatico","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/The_charge_of_the_Persian_scythed_chariots_at_the_battle_of_Gaugamela_by_Andre_Castaigne_%281898-1899%29.jpg","page_title":"Esercito mitridatico","context_page_description":"Per esercito mitridatico si intende l'insieme delle forze che componevano l'armata di Mitridate VI re del Ponto, comprendenti l'organizzazione delle loro unità, la loro gerarchia interna di comando, la tattica, l'armamento e la strategia, durante il periodo delle guerre mitridatiche, durate quasi trent'anni contro la Repubblica romana."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%83%9F%E5%8F%B0%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/ChinaShandongYantai.png","page_title":"烟台市","context_page_description":"煙臺市，簡稱煙，古稱芝罘，別稱港城，是中華人民共和國山東省下轄的地級市，國務院確定的沿海開放城市，位於山東省東部。市境東鄰威海市，西南界青島市，西接濰坊市、北瀕渤海，南濱黃海，與遼東半島、北韓、南韓隔海相望。地處膠東半島中北部，市境南北臨海，東西聯陸，地形可分為低山、丘陵、平原、海岸四個區域，有大小島嶼63個。西部有大澤山，中部有艾山，東部有昆俞山。主要河流有五龍河、辛安河、大沽夾河、黃水河、界河、王河、大沽河等。全市總面積13,852平方公里，人口701.41萬，市人民政府駐萊山區。煙臺是山東半島城市群中心城市，最佳中國魅力城市，聯合國人居獎獲獎城市。"},{"page_url":"https://pl.wikipedia.org/wiki/Klanec_pri_Gabrovki","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Klanec_pri_Gabrovki.jpg","page_title":"Klanec pri Gabrovki","context_page_description":"Klanec pri Gabrovki – wieś w Słowenii, w gminie Litija. W 2018 roku liczyła 33 mieszkańców."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%92%D1%80%D0%B0%D0%BF%D1%86%D0%B8_(%D0%BF%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/MontifringillaAdamsiGould.jpg","page_title":"Врапци (породица)","context_page_description":"Врапци су породица малих птица из реда Passeriformes. Такође су познати и као прави врапци, односно носе име као и род Passer из ове породице. Многе врсте врабаца се гнезде на кућама и зградама, а поједине врсте, попут домаћег или пољског врапца су једне од најпознатијих свих дивљих птица. Они се, пре свега, хране семенима, али такође конзумирају и мање инсекте. Неке врсте сакупљају храну по градовима, попут галебова или дивљих голубова, али готово све врсте из ове породице ће радо појести готово све у малим количинама."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Praha-v%C3%BDchod","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Klecany_-_fara.JPG","page_title":"Seznam kulturních památek v okrese Praha-východ","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Praha-východ vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Brandýse nad Labem-Staré Boleslavi\\nSeznam kulturních památek v Brandýse nad Labem\\nSeznam kulturních památek ve Staré Boleslavi\\nSeznam kulturních památek v Čelákovicích včetně částí Císařská Kuchyně, Sedlčánky a Záluží\\nSeznam kulturních památek v Lázních Toušeni\\nSeznam kulturních památek v Kostelci nad Černými lesy\\nSeznam kulturních památek ve Škvorci\\nSeznam kulturních památek v Říčanech včetně části Jažlovice"},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%A8%D7%95%D7%A8_%D7%A4%D7%99%D7%99%D7%9C%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Dror_Feiler_2.jpg","page_title":"דרור פיילר","context_page_description":"דרור אלימלך פֵיילר הוא פעיל שמאל רדיקלי, מוזיקאי ואמן; ישראלי לשעבר, המתגורר בסטוקהולם שבשוודיה מאז 1973. פיילר התפרסם בתקשורת הודות לביטויים קשים נגד מדינת ישראל. הוא הגדיר את חמאס \\"תנועת שחרור לאומית\\" לגיטימית ויזם מאמץ אירופאי להעמדת קצינים ישראלים לדין בינלאומי."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Geiselwind","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Geiselwind%2C_Marktplatz_2%2C_002.jpg","page_title":"Liste der Baudenkmäler in Geiselwind","context_page_description":"Auf dieser Seite sind die Baudenkmäler des unterfränkischen Marktes Geiselwind zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 59 Baudenkmäler."},{"page_url":"https://pl.wikipedia.org/wiki/Piau","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Piau01.JPG","page_title":"Piau","context_page_description":"Piau – miasto i gmina w Brazylii, w stanie Minas Gerais. Znajduje się w mezoregionie Zona da Mata i mikroregionie Juiz de Fora."},{"page_url":"https://fr.wikipedia.org/wiki/Ieoh_Ming_Pei","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Artmuseum22.jpg","page_title":"Ieoh Ming Pei","context_page_description":"Ieoh Ming Pei, communément appelé I. M. Pei, est un architecte américain d'origine chinoise né le 26 avril 1917 à Canton et mort le 16 mai 2019 à New York.\\nEn 1948, Pei est recruté par le promoteur immobilier William Zeckendorf ; il établit sept ans plus tard son cabinet d'études indépendant, I. M. Pei & Associates, futur Pei Cobb Freed & Partners. Pei prend officiellement sa retraite en 1990. Depuis, il est consultant en architecture principalement pour le cabinet d'architecture de ses fils Pei Partnership Architects.\\nC'est un architecte prolifique qui participe à la construction de la chapelle commémorative Luce de Taichung, du National Center for Atmospheric Research à Boulder dans le Colorado, à la conception de l'hôtel de ville de Dallas, du bâtiment est de la National Gallery of Art, de la John F. Kennedy Presidential Library and Museum dans le Massachusetts et du 200 Clarendon Street à Boston. Il conçoit le Morton H. Meyerson Symphony Center de Dallas, le musée Miho, le musée de Suzhou et le musée d'Art islamique de Doha. En Chine, il conçoit un hôtel dans le parc Xiangshan de Pékin et la tour de la Bank of China à Hong Kong."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%A2%E0%B8%A8%E0%B8%97%E0%B8%AB%E0%B8%B2%E0%B8%A3%E0%B8%A3%E0%B8%B2%E0%B8%8A%E0%B8%AD%E0%B8%B2%E0%B8%93%E0%B8%B2%E0%B8%88%E0%B8%B1%E0%B8%81%E0%B8%A3%E0%B8%AD%E0%B8%B4%E0%B8%95%E0%B8%B2%E0%B8%A5%E0%B8%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Rank_insignia_of_sottotenente_of_the_Italian_Army_%281940%29.png","page_title":"ยศทหารราชอาณาจักรอิตาลี","context_page_description":"ตารางข้างล่างต่อไปนี้คือข้อมูลเกี่ยวกับยศทหารของกองทัพราชอาณาจักรอิตาลี ระหว่าง ค.ศ. 1861-1946. ในสมัยสงครามโลกครั้งที่ 2 ทหารตำรวจอิตาลีใช้เครื่องหมายยศลักษณะเดียวกับทหารบก."},{"page_url":"https://fr.wikipedia.org/wiki/Championnat_du_monde_des_rallyes_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Monte_Carlo_2017_-_Pontus_Tidemand.jpg","page_title":"Championnat du monde des rallyes 2017","context_page_description":"Le championnat du monde des rallyes 2017 est la 45ᵉ édition du championnat du monde des rallyes. Il est remporté par Sébastien Ogier et Julien Ingrassia au volant d'une Ford Fiesta WRC '17 engagée par M-Sport World Rally Team, équipe qui est sacré champion du monde des constructeurs."},{"page_url":"https://sv.wikipedia.org/wiki/Pyongyang","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Pyongyang_Metro-1.jpg","page_title":"Pyongyang","context_page_description":"Pyongyang, äldre namn Changan, är huvudstaden och den största staden i Nordkorea, belägen i den sydvästra delen av landet, vid Taedonfloden. Staden är i egenskap av landets huvudstad en så kallad direktstyrd stad och hade 3,3 miljoner invånare vid folkräkningen 2008. Själva centralorten hade vid samma tidpunkt 2,6 miljoner invånare."},{"page_url":"https://nl.wikipedia.org/wiki/Gevelkapel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Bildtafel-KircheReichst%C3%A4dt.jpg","page_title":"Gevelkapel","context_page_description":"Een gevelkapel is een kapel in de vorm van een nis in de gevel of een kastje aan de gevel van een pand met daarin een crucifix of heiligenbeeld.\\nHet gebruik om gevelkapellen in te werken in het metselwerk is terug te voeren op de laren. Vaak werden deze laren geplaatst bij de toegang van een woning. In de Provence zijn hier nog vele voorbeelden van te vinden.\\nGevelkapellen werden om diverse redenen aangebracht. De voornaamste reden was ter bescherming van het erf en de bewoners. Andere redenen waren dankbaarheid en toewijding tot een heilige. Een laatste reden was noodzakelijkheid om een processie te kunnen laten doorgaan."},{"page_url":"https://it.wikipedia.org/wiki/Universit%C3%A0_di_Dacca","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Pond_at_Shahidullah_Hall%2C_University_of_Dhaka.jpg","page_title":"Università di Dacca","context_page_description":"L'Università di Dacca, è la più antica università del moderno Bangladesh."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%85%D8%A7%D8%B1%D8%A9_%D8%B9%D8%AF%D8%A7%D8%A6%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Too_short_adjacent_benches.jpg","page_title":"عمارة عدائية","context_page_description":"العمارة العدائية هي استراتيجية تصميم حضري، تستخدم عناصر من البيئة المبنية لتوجيه السلوك أو تقييده بشكل مقصود لمنع الجريمة والحفاظ على النظام. غالبًا ما تستهدف العمارة العدائية الأشخاص الذين يستخدمون أو يعتمدون على الأماكن العامة أكثر من غيرهم، مثل الشباب والمشردين عن طريق تقييد السلوكيات البدنية التي يمكنهم الانخراط فيها. تُعرف أيضًا بكل من المصطلحات التالية، العمارة الدفاعية والتصميم العدائي والتصميم غير السار والتصميم الإقصائي والتصميم الحضري الدفاعي، وغالبًا ما يرتبط مصطلح العمارة العدائية «بالأشواك المضادة للمشردين»، وهي عبارة عن مسامير توضع على الأسطح المستوية لجعل النوم عليها أمرًا غير مريح وغير عملي. تشمل التدابير الأخرى عتبات النوافذ المنحدرة لمنع الناس من الجلوس، والمقاعد ذات مساند الأذرع الموضوعة بطريقة تمنع الأشخاص من الاستلقاء عليها، ومرشات المياه التي «تعمل بشكل متقطع، ولكنها لا تسقي أي شيء حقيقة». تُستخدم العمارة المعادية أيضًا لمنع التزلج على الألواح ورمي القمامة والتسكع والتبول في الأماكن العامة. يجادل النقاد بأن مثل هذه التدابير تعزز الانقسامات الاجتماعية وتخلق مشاكل لجميع الناس وخاصة لكبار السن والأطفال وذوي الإعاقة."},{"page_url":"https://de.wikipedia.org/wiki/Fez_(Computerspiel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Fez_%28video_game%29_cover_art.png","page_title":"Fez (Computerspiel)","context_page_description":"Fez ist ein Puzzle- und Plattform-Videospiel des kanadischen unabhängigen Entwicklerstudios Polytron Corporation. Es erschien erstmals am 13. April 2012 für die Spielkonsole Xbox 360, 2013 wurde das Spiel zudem für Windows veröffentlicht. Weitere Umsetzungen folgten. Projektleiter Phil Fish und die späten Entwicklungsstufen von Fez waren Teil des Dokumentarfilms Indie Game: The Movie.\\nDie Entwicklung eines Nachfolgers wurde 2013 von Phil Fish eingestellt."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%96%E4%BA%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Iwakura_mission.jpg","page_title":"外交","context_page_description":"外交とは、国家間の国際関係における交渉のことで、関連するさまざまな政治活動を指す。一般に、外交官や首相などの国家の代表と、外国の代表とが国際社会における問題に対応している。\\n外交戦略に基づき立案される政策を外交政策、または実際に二国間ないし多国間で行われる具体的な国家間交渉を外交交渉という。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D1%81%D1%82%D0%BE%D1%80%D1%96%D1%8F_%D0%A1%D0%BA%D0%BE%D0%BB%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Ukraine-Skole-map1877.jpg","page_title":"Історія Сколе","context_page_description":"Історія Сколе — історія маленького бойківського містечка, Сколівського району Львівської області. Відоме в історичних документах з 1397 року, Сколе протягом своєї понад 600-літньої історії належало до Галицько-Волинського князівства, Речі Посполитої, Австро-Угорська імперія, ЗУНР, Польщі, Радянського Союзу, а після розпаду останнього перебуває в складі незалежної України. Сколе було спочатку маленьким гірським поселенням, потім біля села у 1660 році граф Олександр Януш Заславський заснував містечко, яке з часом об'єдналось з Старим Сколе. Пізніше до міста були приєднані присілки Демня і Святослав. 2001 року Сколе увійшло до Списку історичних населених місць України."},{"page_url":"https://sv.wikipedia.org/wiki/Pheidole_diana","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Pheidole_diana_jtlc000014083_head_1.jpg","page_title":"Pheidole diana","context_page_description":"Pheidole diana är en myrart som beskrevs av Auguste-Henri Forel 1908. Pheidole diana ingår i släktet Pheidole och familjen myror. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Incidente_de_Charlie_Brown_y_Franz_Stigler","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/384th_Bomb_Group_8th_AF_B-17_Bombers_in_Formation_Over_Clouds.2.jpg","page_title":"Incidente de Charlie Brown y Franz Stigler","context_page_description":"El incidente de Charlie Brown y Franz Stigler ocurrió el 20 de diciembre de 1943, cuando, después de un exitoso bombardeo aéreo sobre la ciudad alemana de Bremen, la Fortaleza Volante B-17 del segundo teniente Charles «Charlie» Brown fue severamente dañada por cazas alemanes. El piloto de la Luftwaffe Franz Stigler tuvo la oportunidad de derribar al bombardero dañado, tras localizarlo en el cielo, mientras repostaba su caza.\\nFranz Stigler despegó y comenzó a perseguir al bombardero americano, se colocó en paralelo a este y le hizo señas al piloto, Charlie Brown, de que aterrizara el avión; a lo que este se negó y prosiguió su marcha.\\nFue entonces cuando el caza alemán aminoró la velocidad y se colocó en la parte trasera del bombardero B-17, para asombro de Brown, no para dispararle, sino para escoltarlo hasta las costas francesas y así evitar que los antiaéreos alemanes derribaran al maltrecho y dañado avión americano, que finalmente y gracias a la ayuda del piloto alemán, logró escapar dirección Inglaterra."},{"page_url":"https://en.wikipedia.org/wiki/Hydrazone_iodination","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/HydrazoneIodizationReactionMechanism.png","page_title":"Hydrazone iodination","context_page_description":"Hydrazone iodination is an organic reaction in which a hydrazone is converted into a vinyl iodide by reaction of iodine and a non-nucleophilic base such as DBU. First published by Derek Barton in 1962 the reaction is sometimes referred to as the Barton reaction or, more descriptively, as the Barton vinyl iodine procedure.\\nThe reaction has earlier roots with the 1911 discovery by Wieland and Roseeu that the reaction of hydrazones with iodine alone results in the azine dimer.\\nIn the original Barton publication the reaction was optimized by using a strong guanidine base, the inverse addition of the hydrazone to an iodine solution, and by exclusion of water.\\nWhen iodine as an electrophile is replaced by aromatic selenyl bromides, the corresponding vinyl selenides are obtained:"},{"page_url":"https://en.wikipedia.org/wiki/Gmelina_leichhardtii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/White_Beech_-_fruit.JPG","page_title":"Gmelina leichhardtii","context_page_description":"Gmelina leichhardtii, the white beech, is a tropical forest tree of eastern Australia. Scattered individuals or small groups of trees naturally occur from the Illawarra district of New South Wales to near Proserpine in tropical Queensland. The white beech or grey teak is a fast-growing tree, growing on volcanic and alluvial soils in areas of moderate to high rainfall. It also grows on poorer sedimentary soils in fire free areas. White beech may occasionally be seen in Australian rainforests, though their status is considered \\"uncommon\\". Unlike the Australian red cedar, the white beech has not recovered particularly well after logging in the 19th and 20th centuries."},{"page_url":"https://it.wikipedia.org/wiki/Pays_de_Buch","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/GemmeursPDB.jpg","page_title":"Pays de Buch","context_page_description":"Il Pays de Buch è una delle zone del territorio francese delle Landes de Gascogne. Esso si estende sul territorio di 17 comuni intorno al bacino di Arcachon e alla valle dell'Eyre, da Le Porge a nord a La Teste-de-Buch a sud, passando ad est per Belin-Béliet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%93%D7%A8%D7%95_%D7%A4%D7%A8%D7%95%D7%90%D7%A0%D7%A1%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Pedro_Proen%C3%A7a.JPG","page_title":"פדרו פרואנסה","context_page_description":"פדרו פרואנסה אוליביירה אלבס גרסיה הוא שופט כדורגל פורטוגלי לשעבר. כיום משמש כנשיא הליגה הפורטוגלית לכדורגל מקצועני. פרואנסה שפט משחקים בפורטוגל, וכן במסגרות משחקים של אופ\\"א ופיפ\\"א. בשנת 2012 פרואנסה היה לשופט הראשון ששפט באותה שנה הן בגמר ליגת האלופות והן בגמר יורו 2012."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88_%D9%86%D8%A7%D8%AB%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/0923_493c_Joe_Nathan.jpg","page_title":"جو ناثان","context_page_description":"جو ناثان لاعب بيسبول من امريكا."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B9%D1%87%D0%B5%D0%BD%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Villa_Piovene_FoNo.jpg","page_title":"Сейченто","context_page_description":"Сейче́нто — период итальянской истории и культуры, охватывающий XVII век. Сейченто ознаменовал закат эпохи Возрождения в Италии и начало и эпохи барокко.\\nБольшинство важных культурных, политических и художественных прорывов в итальянских княжествах и в Европе не были начаты в XVII веке. Они были лишь логическим продолжением мощных идеологических процессов, которые возникли в XVI веке и получили дальнейшее развитие в XVII веке. Среди таких изменений рождение маньеризма и барокко, возникновение первых художественных академий, первые победы научного знания над средневековым мировоззрением.\\nВсе лучшие достижения итальянского искусства первой половины XVII века принадлежат, или начаты художниками, которые родились ещё в XVI веке:\\nДоменико Фонтана 1543 г.р., выдающийся инженер и градостроитель, реализовавший трёхлучевую планировку главных улиц Рима, которая станет образцом для других городов.\\nМикеланджело да Караваджо 1573 г.р., реформатор итальянской и европейской живописи.\\nАннибале Карраччи 1560 г.р., художник декоратор мирового уровня и один из основателей Болонской школы живописи в 1580-х годах.\\nЛоренцо Бернини 1598 г.р., архитектор и скульптор, глава крупной римской мастерской."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E6%9D%BE%E8%BB%8A%E7%AB%99_(%E5%A4%A7%E9%98%AA%E5%BA%9C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Mizuma_Railway_Mitsumatsu_Station.jpg","page_title":"三松車站 (大阪府)","context_page_description":"三松站 是属水间铁道水间线之车站，位于大阪府贝冢市三松879-3。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D0%B5_%D0%BC%D0%B0%D1%80%D0%BA%D0%B8_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B8_(2003)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Russia_stamp_2003_%E2%84%96_879.jpg","page_title":"Почтовые марки России (2003)","context_page_description":"Почтовые марки России (2003) — каталог знаков почтовой оплаты, введённых в обращение «Почтой России» в 2003 году.\\nВсего в этом году было выпущено 86 почтовых марок, 13 почтовых блоков и 28 малых листов."},{"page_url":"https://en.wikipedia.org/wiki/Provencher","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Provencher_2013_Riding.png","page_title":"Provencher","context_page_description":"Provencher is a federal electoral district in Manitoba, Canada, that has been represented in the House of Commons of Canada since 1871. It is primarily a rural district. Its largest community is the city of Steinbach."},{"page_url":"https://bg.wikipedia.org/wiki/Poospiza_hispaniolensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/PoospizaBonapartiiSmit.jpg","page_title":"Poospiza hispaniolensis","context_page_description":"Poospiza hispaniolensis е вид птица от семейство Тангари."},{"page_url":"https://en.wikipedia.org/wiki/Richard_T._Davis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/15_Inf_Regt_DUI.jpg","page_title":"Richard T. Davis","context_page_description":"Specialist Richard Thomas Davis was an Infantryman in the United States Army. The son of two US Army veterans, Lanny and Remy Davis, he was born on an Army base in Germany. Davis enlisted in the Army in 1998 and served in Operation Joint Forge in Bosnia and later in the Iraq War, where he and his comrades participated in the April 11, 2003, \\"Midtown Massacre,\\" a five-hour firefight in downtown Baghdad. On July 15, 2003, less than two days after returning from deployment to Iraq, Davis was murdered outside Fort Benning, Georgia by a fellow soldier from Baker Company, Alberto Martinez. Three other soldiers were also present and involved in the events that led up to the killing and followed the killing.\\nInitially, the Army concluded that Davis deserted and despite pleas from Davis' father, would not initiate an investigation into his son's disappearance for nearly two months. Davis' remains were not found until November 2003. He had been stabbed in the head, neck, and chest at least thirty-three times. His body was later dismembered, doused in lighter fluid, and burned."},{"page_url":"https://fr.wikipedia.org/wiki/Sergines","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Sergines-FR-89-mairie-08.jpg","page_title":"Sergines","context_page_description":"Sergines est une commune française située dans le département de l'Yonne en région Bourgogne-Franche-Comté."},{"page_url":"https://vi.wikipedia.org/wiki/Gallegos_de_Sobrinos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/VirgenDelEspino.jpg","page_title":"Gallegos de Sobrinos","context_page_description":"Gallegos de Sobrinos là một đô thị trong tỉnh Ávila, Castile và León, Tây Ban Nha. Theo điều tra dân số 2004, đô thị này có dân số là 94."},{"page_url":"https://pt.wikipedia.org/wiki/Dom%C3%ADnio_de_Shimotsuma","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Tagaya_Castle_Site_02.JPG","page_title":"Domínio de Shimotsuma","context_page_description":"O Domínio de Shimotsuma foi um Han do Período Edo da História do Japão. Localizava-se na Província de Hitachi na atual Ibaraki."},{"page_url":"https://sv.wikipedia.org/wiki/Vieno_Simonen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Vieno_Simonen.jpg","page_title":"Vieno Simonen","context_page_description":"Vieno Simonen, född 27 december 1898 i Peräseinäjoki, död 20 juni 1994 i Pyhäselkä, var en finländsk politiker.\\nSimonen var representant för Agrarförbundet i Finlands riksdag 1948–1961. Hon var andra socialminister i Urho Kekkonens regering 1953 och i Ralf Törngrens regering 1954, andra lantbruksminister i Karl-August Fagerholms regering 1956–1957 och socialminister i V.J. Sukselainens och Martti Miettunens regeringar 1959–1962. Hon var ordförande för Marttaliitto, den finska grenen av martharörelsen, 1953–1969."},{"page_url":"https://hu.wikipedia.org/wiki/Microsoft_Lumia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Nokia_Lumia_620.JPG","page_title":"Microsoft Lumia","context_page_description":"A Nokia Lumia a finn Nokia Corporation 2011-ben bevezetett Windows Phone alapú telefon és táblagépcsaládja. Az első telefonok operációs rendszere Windows Phone 7 volt, majd Windows Phone 8-ra váltott a Nokia. A Lumia elnevezés a finn Lumi \\"hó\\" szóból ered.\\nA termékcsalád jelenlegi és várható tagjai:\\nNokia Lumia Icon\\nNokia Lumia 2520\\nNokia Lumia 1520\\nNokia Lumia 1320\\nNokia Lumia 1020\\nNokia Lumia 930\\nNokia Lumia 928\\nNokia Lumia 925\\nNokia Lumia 920\\nNokia Lumia 900\\nNokia Lumia 822\\nNokia Lumia 820\\nNokia Lumia 800\\nNokia Lumia 735\\nNokia Lumia 720\\nNokia Lumia 710\\nNokia Lumia 630\\nNokia Lumia 625\\nNokia Lumia 620\\nNokia Lumia 610\\nNokia Lumia 530\\nNokia Lumia 525\\nNokia Lumia 520\\nNokia Lumia 510\\nNokia Lumia 505"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BE%D0%BB%D1%91%D0%B2,_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D0%BC%D0%B8%D1%80_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Military_parade_on_Red_Square_2016-05-09_003.jpg","page_title":"Королёв, Владимир Иванович","context_page_description":"Влади́мир Ива́нович Королёв — российский военачальник. Главнокомандующий Военно-морским флотом Российской Федерации. Адмирал.\\nВице-президент АО «Объединённая судостроительная корпорация» по военному кораблестроению с 10 июля 2019 года."},{"page_url":"https://pl.wikipedia.org/wiki/Muzeum_Geologiczne_Pa%C5%84stwowego_Instytutu_Geologicznego%E2%80%93Pa%C5%84stwowego_Instytutu_Badawczego","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Ursus_spelaeus_skeleton_left.jpg","page_title":"Muzeum Geologiczne Państwowego Instytutu Geologicznego–Państwowego Instytutu Badawczego","context_page_description":"Muzeum Geologiczne Państwowego Instytutu Geologicznego–Państwowego Instytutu Badawczego – muzeum mieszczące się w budynku Państwowego Instytutu Geologicznego w Warszawie przy ul. Rakowieckiej 4."},{"page_url":"https://fr.wikipedia.org/wiki/Zack_Gibson","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Zack_Gibson_2018.jpg","page_title":"Zack Gibson","context_page_description":"Jack Rea est un catcheur britannique. Il travaille actuellement à la World Wrestling Entertainment dans la division NXT sous le nom de Zack Gibson."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%B5%D0%BC%D0%BF%D0%B8%D0%BE%D0%BD%D0%B0%D1%82_%D0%BC%D0%B8%D1%80%D0%B0_%D0%BF%D0%BE_%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D1%83_%D1%81%D1%80%D0%B5%D0%B4%D0%B8_%D0%B6%D0%B5%D0%BD%D1%89%D0%B8%D0%BD_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/BC_Place_2015_Women%27s_FIFA_World_Cup.jpg","page_title":"Чемпионат мира по футболу среди женщин 2015","context_page_description":"Седьмой чемпионат мира по футболу среди женщин прошёл в Канаде с 6 июня по 5 июля 2015 года. В третий раз соревнования состоялись на территории Северной Америки. Победителем чемпионата в третий раз в истории стала сборная США, в финале одержавшая победу над Японией со счётом 5:2.\\nВпервые в турнире приняло участие двадцать четыре команды. Сборная Канады квалифицировалась в финальную часть напрямую как организатор чемпионата, остальные двадцать три участника определились по итогам отборочного турнира. Восемь команд впервые в своей истории вышли в финальную часть чемпионата мира.\\nДля определения взятия ворот на турнире применялась система Hawk-Eye. Впервые в истории чемпионатов мира под эгидой ФИФА матчи проходили на полях с искусственным покрытием."},{"page_url":"https://es.wikipedia.org/wiki/Rep%C3%BAblica_Gal%C3%A1ctica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Flag_of_the_Galactic_Republic.svg","page_title":"República Galáctica","context_page_description":"La República Galáctica fue una organización política en el universo ficticio de Star Wars. También llamada comúnmente Antigua República, era la mayor y prácticamente única potencia galáctica de tal tamaño durante gran parte de la historia galáctica, y comprendía decenas de miles de sistemas solares.\\nLa República Galáctica cubre 25.000 años de historia y sus andanzas transcurren en literatura, videojuegos, películas y otras historias.\\nDespués de la batalla de Endor y la posterior implosión del Imperio Galáctico, la Alianza Rebelde restauró a la República, pero fue nuevamente desmantelada por la Primera Orden gracias a la destrucción del sistema Hosnian, en donde se encontraban el canciller, el Senado y la Flota de la Nueva República."},{"page_url":"https://de.wikipedia.org/wiki/Bahnstrecke_Ibbenb%C3%BCren%E2%80%93H%C3%B6velhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Bad_Laer_-_M%C3%BCschen_01_20.05.2020.jpg","page_title":"Bahnstrecke Ibbenbüren–Hövelhof","context_page_description":"Die Bahnstrecke Ibbenbüren–Hövelhof ist eine 93 Kilometer lange, eingleisige und nicht elektrifizierte Nebenbahn des öffentlichen Verkehrs, die abschnittsweise zwischen 1899 und 1903 durch die Berliner Eisenbahn-Bau- und Betriebsgesellschaft Vering & Waechter erbaut wurde und seitdem durch die Teutoburger Wald-Eisenbahn als Nichtbundeseigene Eisenbahn betrieben wird.\\nDie Strecke ist in Ibbenbüren, Lengerich, Gütersloh und Hövelhof mit dem Streckennetz der Deutschen Bahn verknüpft. Zweigstrecken schließen den Hafen Saerbeck am Dortmund-Ems-Kanal in Ibbenbüren-Dörenthe, die Landmaschinenfabrik Claas in Harsewinkel West und den Flughafen Gütersloh in Richtung Gütersloh an.\\nFür den 50,6 Kilometer langen nördlichen Teil der TWE-Infrastruktur Ibbenbüren – Lengerich – Versmold wurde im November 2014 ein Verfahren zur Abgabe bzw. Streckenstilllegung nach § 11 Allgemeines Eisenbahngesetz eingeleitet. Seit dem 1. Dezember 2015 ist die LWS Lappwaldbahn Service GmbH der neue Eigentümer dieses Abschnitts."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%88%AA%E7%A9%BA%E5%A4%A7%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/JA4167_Beech_A36_%285537244739%29.jpg","page_title":"航空大学校","context_page_description":"航空大学校は、固定翼機のパイロットを養成する省庁大学校である。略称は『航空大』または『航大』。"},{"page_url":"https://de.wikipedia.org/wiki/F%C3%BChrerhauptquartier_Wolfsschlucht_1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Wolfsschlucht_1_04.jpg","page_title":"Führerhauptquartier Wolfsschlucht 1","context_page_description":"Das Führerhauptquartier Wolfsschlucht, gelegen im belgischen Dorf Brûly-de-Pesche, nahe Couvin, war eines von insgesamt 18 Führerhauptquartieren, die während des Zweiten Weltkrieges, teilweise unvollendet, errichtet wurden.\\nUm näher am Kriegsgeschehen zu sein, forderte Hitler mit Beginn des Westfeldzuges die Verlegung seines Hauptquartiers weiter nach Westen; infolgedessen wurde das FHQu Wolfsschlucht errichtet."},{"page_url":"https://en.wikipedia.org/wiki/Oedemera_flavipes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Oedemeridae_-_Oedemera_flavipes-1.JPG","page_title":"Oedemera flavipes","context_page_description":"Oedemera flavipes is a very common species of beetle of the family Oedemeridae, subfamily Oedemerinae.\\nThese beetles are present in most of Europe and in the Near East.\\nTheir body is gray-green, dark green or coppery, while forelegs are yellow or reddish. The male of Oedemera flavipes, as in most Oedemera species, possesses the hind femora very swollen, whereas in female the femora are thin.\\nThe adults grow up to 9–11 millimetres long and can mostly be encountered from May through July feeding on pollen and nectar, mainly on Asteraceae, Rosaceae, Convolvulaceae and Apiaceae species. They are a common prey of the checkered beetle, Trichodes alvearius.\\nThe larvae develop in stems of herbaceous plants or in decaying branches."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Groitzsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/SaasdorfTrafo.JPG","page_title":"Liste der Kulturdenkmale in Groitzsch","context_page_description":"Die Liste der Kulturdenkmale in Groitzsch enthält die Kulturdenkmale in Groitzsch.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://en.wikipedia.org/wiki/Rockstar_North","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/DMA_Design_original_team_in_2011.jpg","page_title":"Rockstar North","context_page_description":"Rockstar North Limited is a British video game development company and a studio of Rockstar Games based in Edinburgh. The company was founded as DMA Design in Dundee in 1987 by David Jones, soon hiring former classmates Mike Dailly, Russell Kay, and Steve Hammond. During its early years, DMA Design was backed by its publisher Psygnosis, primarily focusing on Amiga, Atari ST and Commodore 64 games. During this time, they created successful shooters such as Menace, and Blood Money, but it soon turned to platform games after the release of Lemmings in 1991, which was an international success and led to several sequels and spin-offs. After developing Unirally for Nintendo, DMA Design was set to become one of their main second-party developers, but this partnership ended after Nintendo's disapproval of Body Harvest.\\nIn 1997, DMA released Grand Theft Auto, which was a huge success; the game sparked a successful series. The company was soon acquired by Gremlin Interactive. Following the release of Grand Theft Auto 2, Gremlin was acquired by Infogrames. After the Infogrames acquisition, the DMA Design assets were sold to Take-Two Interactive."},{"page_url":"https://en.wikipedia.org/wiki/Sydney_rock_engravings","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/%281%29rock_carving_Bondi.jpg","page_title":"Sydney rock engravings","context_page_description":"Sydney rock engravings, or Sydney rock art, are a form of Australian Aboriginal rock art in the sandstone around Sydney, New South Wales, Australia, that consist of carefully drawn images of people, animals, or symbols. Many thousands of such engravings are known to exist in the Sydney region, although the locations of most are not publicised to prevent damage by vandalism, and to retain their sanctity, as they are still regarded as sacred sites by Indigenous Australians. There are two art environments in Sydney Basin, rock shelters and engraving sites.\\nThere are 1,500 pieces of Aboriginal art in Sydney, more than half of which contain rock art, and around 1,500 caves or shelters which contain cultural deposit. They are comparable with the petroglyphs of Native Americans and the rock art found elsewhere in Australia, but have their own distinctive style which is quite unlike rock art found anywhere else in Australia. Dating to around 5,000 years, with some possibly as old as 7,000 years, Sydney rock art is predominantly found in Ku-ring-gai Council, Sydney Harbour and the Blue Mountains."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9F%D1%80%D0%B0%D0%BB%D1%96%D1%9E_%D0%91%D1%96%D0%B3%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Beagle-Kanal_Ushuaia.JPG","page_title":"Праліў Бігля","context_page_description":"Праліў Бігля — праліў, які адасабляе галоўны востраў архіпелага Вогненная Зямля і астравы на поўдні ад яго Остэ і Наварына, а таксама маленькія астравы.\\nНа беразе праліва размешчаны такія вядомыя населеныя пункты, як горад Горад Ушуая, ваенная база Пуэрта-Уільямс, рыбацкая вёска Пуэрта-Тора, які лічыцца самым паўднёвым населеным пунктам у свеце.\\nПраліў названы ў гонар карабля «Бігл », на якім Чарльз Дарвін падчас свайго знакамітага падарожжа абмінуў Паўднёвую Амерыку.\\nПраліў вузкі, месцамі ўсяго 5-6 кіламетраў."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%B0%D0%BB%D0%B5%D1%80%D0%B8%D1%98%D0%B0_%D0%B3%D1%80%D0%B1%D0%BE%D0%B2%D0%B0_%D0%88%D0%B0%D0%BF%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Fuji_Shizuoka_chapter.JPG","page_title":"Галерија грбова Јапана","context_page_description":"Галерија грбова Јапана обухвата актуелни Грб Јапана, грбове јапанских префектура и грбове јапанских градова по азбучном реду."},{"page_url":"https://es.wikipedia.org/wiki/Distrito_de_Zlatibor","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Zlatibor_in_Serbia.svg","page_title":"Distrito de Zlatibor","context_page_description":"El Distrito de Zlatibor es uno de los 18 ókrug o distritos en que está dividida Serbia Central, la región histórica de Serbia. Tiene una extensión de 6.140 km², y según el censo de 2002, una población de 313.396 habitantes.​ Su capital administrativa es la ciudad de Užice.​"},{"page_url":"https://zh.wikipedia.org/zh-tw/2010%E5%B9%B4%E6%B3%A2%E5%85%B0%E7%A9%BA%E5%86%9B%E5%9B%BE-154%E5%9D%A0%E6%9C%BA%E4%BA%8B%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/JKRUK_20090429_GRA%C5%BBYNA_G%C4%98SICKA_IMG_6411.jpg","page_title":"2010年波兰空军图-154坠机事件","context_page_description":"2010年4月10日，一架載有波蘭總統列赫·卡辛斯基、政府和立法機構眾多高官的圖-154型專機在俄羅斯斯摩棱斯克墜毀，機上包括多名波蘭政府高官、國會議員及軍事將領，連同機組人員在內共96人全部遇難，駕駛失誤導致了這起事故的發生。"},{"page_url":"https://nl.wikipedia.org/wiki/Kabinet-Obama","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Jacob_Lew.jpg","page_title":"Kabinet-Obama","context_page_description":"Het kabinet-Obama was de uitvoerende macht van de Verenigde Staten van Amerika van 20 januari 2009 tot 20 januari 2017. Senator voor Illinois Barack Obama van de Democratische Partij werd gekozen als de 44e president van de Verenigde Staten na het winnen van de presidentsverkiezingen van 2008 over de kandidaat van de Republikeinse Partij senator voor Arizona John McCain, Obama werd herkozen voor een tweede termijn in 2012."},{"page_url":"https://fr.wikipedia.org/wiki/Vitr%C3%A9_(Ille-et-Vilaine)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Vitr%C3%A9_La_rue_Balaz%C3%A9.jpg","page_title":"Vitré (Ille-et-Vilaine)","context_page_description":"Vitré /vi.tʁe/ est une commune française située dans le département d'Ille-et-Vilaine. Ses habitants sont les Vitréens et les Vitréennes. La ville comptait 18 037 habitants en 2017, ce qui en fait la 14ᵉ plus grande ville de la région et la 522ᵉ de France. Elle est au cœur de la communauté d'agglomération de Vitré Communauté.\\nSous-préfecture d'Ille-et-Vilaine jusqu'en 1926, Vitré est aujourd'hui chef-lieu de canton. Elle occupe la région des Marches en Haute-Bretagne. En 2008, la cité a fêté son premier millénaire d'histoire connue, bien que son passé soit beaucoup plus ancien. Son important patrimoine médiéval et classique lui a valu le label Ville d'art et d'histoire et l'inscription à la liste des Plus beaux détours de France. Vitré est la 37ᵉ commune française comptant le plus de monuments historiques et regroupe 14 % des monuments historiques du département. Elle a été promue « Ville fleurie », a obtenu quatre fleurs au palmarès 2018 du concours des villes et villages fleuris et possède deux étoiles au Guide vert Michelin. Vitré est aussi concerné par de l'étalement urbain et par une pollution aux cyanobactéries de l'étang de la Valière."},{"page_url":"https://hu.wikipedia.org/wiki/Suffolk_megye_(New_York)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/WesthamptonInnerWaterway.jpg","page_title":"Suffolk megye (New York)","context_page_description":"Suffolk megye az Amerikai Egyesült Államokban, New York államban, Long Island szigetének keleti részén található. Megyeszékhelye Riverhead, legnagyobb városa Brookhaven. Lakosainak száma 1 499 738 fő. +/-"},{"page_url":"https://es.wikipedia.org/wiki/Isla_Adams_(Nunavut)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Adams_Island.png","page_title":"Isla Adams (Nunavut)","context_page_description":"La Isla Adams es una isla deshabitada en la Región de Qikiqtaaluk en el territorio de Nunavut, en el norte de Canadá. La isla está situada en la bahía de Baffin en la costa noreste de la isla de Baffin, es parte del archipiélago ártico canadiense. Muy cerca se encuentran la isla Dexterity, la isla de Baffin, el Fiordo Tromso, la entrada Paterson, y la isla Bergesen.​\\nLa isla Adams es de forma irregular, las partes oriental y occidental se encuentran divididas por el brazo Ratcliffe. Sus costas poseen pendientes fuertes, mientras que las montañas del interior alcanzan más de 800 m de altura.​ La isla cuenta con un área de 267 km².​"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%95%D7%A8%D7%A0%D7%A1_%D7%90%D7%95%D7%98%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Lawrence_Oates_photo.jpg","page_title":"לורנס אוטס","context_page_description":"קפטן לורנס אדוארד גרייס אוטס היה חוקר אנטארקטיקה אנגלי, שנודע בדרך מותו במסע משלחת טרה נובה, כאשר יצא מן האוהל אל תוך סופת שלגים במילים \\"אני רק יוצא החוצה ואולי אתעכב קצת\\". מותו נתפס כאקט של הקרבה עצמית, משום שהבין, כי במצב הנמק שפשה ברגליו הקפואות הוא פוגע בסיכוייהם של שלושת חבריו הנותרים לשרוד, ועל כן בחר במוות בטוח."},{"page_url":"https://sv.wikipedia.org/wiki/Franziskaner_(%C3%B6l)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Spaten-Franziskaner-Braeu_factory.jpg","page_title":"Franziskaner (öl)","context_page_description":"Franziskaner är ett tyskt öl av veteölstyp, Weissbier från München i tyska delstaten Bayern. Bryggeriet grundades redan 1363 och slogs år 1922 samman med Spaten till Spaten-Franziskaner-bryggeriet som i sin tur ägs av Spaten-Löwenbräu-gruppen som i sin tur ägs av InBev. Franziskaner säljs i tre varianter av veteöl i Tyskland Hefe Weißbier, Dunkles och sedan 2006 även som Alkoholfrei med blå etikett.\\nFranziskaner Hefe Weißbier är uppskattat av många för dess ovanligt höga andel vetemalt vilket ger ölet en fylligare smak än de flesta andra veteöl."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%83%D0%BA%D1%81%D0%BE%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Winter_Palace_Luxor_front.jpg","page_title":"Луксор","context_page_description":"Луксо́р — город в Верхнем Египте, на восточном берегу Нила, административный центр мухафазы Луксор с населением более полумиллиона жителей.\\nВ Луксоре и вокруг города находятся некоторые из важнейших археологических мест Египта. Из-за значимости и обилия памятников древнеегипетской архитектуры туризм играет важнейшую роль в городе, который посещают сотни тысяч туристов в год. В Луксоре имеется международный аэропорт, вокзал одной из первых в стране и Африке железных дорог, грузовой речной порт и пристани крупных круизных и малых прогулочных и рыбацких судов. Для большинства путешествий по Нилу Луксор является стартовой или конечной точкой."},{"page_url":"https://pt.wikipedia.org/wiki/Merl%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Almeria_Zinnen_der_Alcazaba_fcm.jpg","page_title":"Merlão","context_page_description":"O merlão, em arquitectura militar, é a parte saliente do parapeito de uma fortificação, entre duas seteiras ou ameias. Refere-se a cada um dos intervalos dentados das ameias de uma fortaleza."},{"page_url":"https://no.wikipedia.org/wiki/Partisjon_(mengdel%C3%A6re)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Set_partition.svg","page_title":"Partisjon (mengdelære)","context_page_description":"En partisjon av en mengde M er i matematikk en oppdeling av mengden i ikke-tomme, disjunkte delmengder, slik at unionen av undermengdene er lik M. Ethvert element i M er dermed inneholdt i én og kun én av delmengdene. Delmengdene blir gjerne kalt blokker, deler eller celler.\\nTil enhver partisjon svarer det en ekvivalensrelasjon, og alle elementene i en og samme celle kan kalles ekvivalente.\\nPartisjoner spiller en viktig rolle i integralteori."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B0%D0%BB_(%D0%B1%D0%B5%D1%80%D0%B5%D0%B3%D0%BE%D0%B2%D0%B8%D0%B9_%D1%80%D0%B0%D0%BA%D0%B5%D1%82%D0%BD%D0%B8%D0%B9_%D0%BA%D0%BE%D0%BC%D0%BF%D0%BB%D0%B5%D0%BA%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/BAL-E001.jpg","page_title":"Бал (береговий ракетний комплекс)","context_page_description":"Бал — російський береговий мобільний ракетний комплекс з протикорабельної ракетою Х-35. Випробування комплексу \\"Бал\\" завершені в 2004. Прийнятий на озброєння ЗС РФ в 2008 році."},{"page_url":"https://de.wikipedia.org/wiki/Juli_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Wimbledon_Men%27s_final_2008%2C_Federer_serves_for_3rd_set.jpg","page_title":"Juli 2008","context_page_description":"Dieser Artikel behandelt aktuelle Nachrichten und Ereignisse im Juli 2008."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%95%D7%A1%D7%A0%D7%99_%D7%9E%D7%95%D7%91%D7%90%D7%A8%D7%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Mubark_behind_the_bars.JPG","page_title":"חוסני מובארכ","context_page_description":"מוחמד חוסני סייד אבראהים מובארכ היה מנהיג צבאי ופוליטי מצרי, שכיהן כנשיא מצרים מ-14 באוקטובר 1981 עד 11 בפברואר 2011. הוא ירש את מקומו של הנשיא הקודם, אנואר סאדאת, שנרצח שבוע קודם לכן על ידי הג'יהאד האסלאמי המצרי.\\nבתקופת כהונתו בנשיאות נחשב מובארכ לאחד המנהיגים החזקים והמשפיעים ביותר במזרח התיכון ובעולם הערבי. הוא התפטר מכהונתו בעקבות מהפכת 2011, ולאחר מכן נעצר, הועמד למשפט על הרג מפגינים, הורשע ונדון למאסר עולם; אך התקבלה בקשתו למשפט חוזר בינואר 2013. ב-22 באוגוסט 2013 שוחרר מובארכ למעצר בית. ב-29 בנובמבר 2014 זוכה מובארכ במשפטו החוזר מהאישום בהרג מפגינים, וכן מאישום בפרשת שחיתות שלטונית במסגרת סחר גז עם ישראל. עם זאת, משפט חוזר חל בפרשת השחיתות ובמאי 2015 הורשעו מובארכ ובניו, ונשפטו למאסר 3 ו-4 שנים בהתאמה. מובארכ הוחזק בבית חולים צבאי, ובניו שוחררו באוקטובר 2015 על ידי בית משפט בקהיר. במרץ 2017 זוכה מההאשמות בהרג מפגינים והוא שוחרר ממאסרו. ב-25 בפברואר 2020, מת, לאחר שסבל מסיבוכים בניתוח שעבר בסוף ינואר."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%A8%D7%9E%D7%A0%D7%93_%D7%93%D7%95%D7%A4%D7%9C%D7%A0%D7%98%D7%99%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Armand_Duplantis_in_2019-9-2.jpg","page_title":"ארמנד דופלנטיס","context_page_description":"ארמנד \\"מונדו\\" דופלנטיס הוא אתלט אמריקאי-שוודי, סגן אלוף העולם, אלוף אירופה ושיאן העולם בקפיצה במוט."},{"page_url":"https://an.wikipedia.org/wiki/Sobrarbe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Penya_Montanyesa_dende_A_Buerda.jpg","page_title":"Sobrarbe","context_page_description":"O Sobrarbe ye una comarca oficial d'Aragón situada en o norte d'a provincia de Uesca, que fa muga con o departamento d'os Altos Pireneus de Francia per o norte, con a tamién comarca aragonesa de Ribagorza per l'este, con o Semontano de Balbastro per o sud, con l'Alto Galligo per l'ueste. A suya capitalidat, per motivos de tradición historica y d'importancia demografica, ye compartita d'entre as villas de L'Aínsa y Boltanya.\\nCheograficament parlando, o Sobrarbe ye una comarca de montanya, con qualques d'as alturas mayors de tot lo Pireneu, y que se prolarga dende as alturas d'o Pireneu Axial en norte y en a muga con Francia, dica las sierras exteriors pirenencas, en sud, que la deseparan contra os semontanos aragoneses. A dita limitación clara con sierras y formacions cheolochicas envistables fa que siempre s'haiga considerato una comarca natural y que os suyos habitants y tamién os de demés l'haigan apreciata tradicionalment como aital. Ademés, as mugas actuals d'a comarca d'o Sobrarbe coinciden, alto u baixo, con as que en fuén de lo condato de Sobrarbe."},{"page_url":"https://en.wikipedia.org/wiki/CDC_3000_series","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/CDC_3800_-_Udvar-Hazy_Center.JPG","page_title":"CDC 3000 series","context_page_description":"The CDC 3000 series computers from Control Data Corporation were mid-1960s follow-ons to the CDC 1604 and CDC 924 systems.\\nOver time, a range of machines were produced - divided into\\nthe 48-bit upper 3000 series and\\nthe 24-bit lower 3000 series.\\nEarly in the 1970s CDC phased out production of the 3000 series, which had been the cash cows of Control Data during the 1960s; sales of these machines funded the company while the 6000 series was designed."},{"page_url":"https://sv.wikipedia.org/wiki/Mayaruiner","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Chacchoben_2.jpg","page_title":"Mayaruiner","context_page_description":"Följande lista är en förteckning av mera betydande förkolumbianska fyndplatser från mayakulturen. Dessa hittas i det mesoamerikanska området som i dag omfattar fem stater:\\nMexiko\\nBelize\\nGuatemala\\nHonduras\\nEl Salvador:"},{"page_url":"https://fr.wikipedia.org/wiki/Lion_de_l%27Atlas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Atlas_lion.JPG","page_title":"Lion de l'Atlas","context_page_description":"Le Lion de l'Atlas, également appelé Lion de Barbarie, est une sous-espèce de lion, aujourd'hui éteinte à l'état sauvage. On le trouvait autrefois sur toute l'Afrique du Nord. Les derniers spécimens sauvages ont disparu vers le milieu du XXᵉ siècle. Moins d'une centaine de lions de l'Atlas subsistent en captivité.\\nL'ours de l'Atlas et le léopard de Barbarie, les deux autres principaux prédateurs d'Afrique du Nord, sont désormais, respectivement, disparus et près de l'extinction."},{"page_url":"https://es.wikipedia.org/wiki/Lophornis_magnificus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Lophornis_magnificus_-_Frilled_Coquette_%28male%29.jpg","page_title":"Lophornis magnificus","context_page_description":"La coqueta magnífica ​ es una especie de ave apodiforme perteneciente la familia colibríes. Es endémica de los bosques de tierras bajas húmedas tropicales y subtropicales del sur de Brasil. Fue descrita por primera vez en el siglo XIX cerca de Río de Janeiro"},{"page_url":"https://en.wikipedia.org/wiki/Swisscom","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Tower_St._Chrischona.jpg","page_title":"Swisscom","context_page_description":"Swisscom AG is a major telecommunications provider in Switzerland. Its headquarters are located in Worblaufen near Bern. The Swiss government owns 51.0 percent of Swisscom AG. According to its own published data, Swisscom holds a market share of 60% for mobile, 67% for broadband and 33% for TV telecommunication in Switzerland. Its Italian subsidiary Fastweb is attributed 16% of private clients and 29% of corporate clients share of Italian broadband and is also active in the mobile market.\\nThe Swiss telegraph network was first set up in 1852, followed by telephones in 1877. The two networks were combined with the postal service in 1920 to form the PTT. It struggled to develop a homegrown digital network, with the first digital exchange launched in 1986, but pioneered the NATEL A mobile service in 1978 and the GSM-based NATEL D offering a digital service in 1993. The Swiss telecommunications market was deregulated in 1997. Telecom PTT was spun off and rebranded Swisscom ahead of a partial privatisation in 1997, which has left the Swiss government with a 51% stake."},{"page_url":"https://tr.wikipedia.org/wiki/Eugenius","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Siliqua_Eugenius-_trier_RIC_0106d.jpg","page_title":"Eugenius","context_page_description":"Flavius Eugenius, Roma İmparatoru I. Theodosius'e karşı mücadele etmiş Roma'lı gaspçı. Roma tahtında hak iddia eden son pagan gaspçıdır."},{"page_url":"https://en.wikipedia.org/wiki/Frodsham","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Vr_frodsham.png","page_title":"Frodsham","context_page_description":"Frodsham is a market town, civil parish and electoral ward in the unitary authority of Cheshire West and Chester and the ceremonial county of Cheshire, England. Its population was 8,982 in 2001, increasing to 9,077 at the 2011 Census. It is approximately 3 miles south of Runcorn, 16 miles south of Liverpool, and 28 miles southwest of Manchester. The River Weaver runs to its northeast and on the west it overlooks the estuary of the River Mersey. The A56 road and the Chester–Manchester railway line pass through the town, and the M56 motorway passes to the northwest.\\nIn medieval times Frodsham was an important borough and port belonging to the Earls of Chester. Its parish church, St. Laurence's, still exhibits evidence of a building present in the 12th century in its nave and is referenced in Domesday Book.\\nA market is held each Thursday, and Frodsham's viability as a trading centre was emphasised by the presence of the \\"big five\\" clearing banks and several building societies, though the branches of HSBC and NatWest have recently closed."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%A4%A9%E6%81%A9%E9%82%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Lok_Sin_Tong_Leung_Kau_Kui_Primary_School_%28Branch%29.jpg","page_title":"天恩邨","context_page_description":"天恩邨是香港的一个公共屋邨，位于元朗区天水围新市镇北部，由房屋署总建筑师及何显毅建筑师事务所设计，并由香港房屋委员会负责屋邨管理。"},{"page_url":"https://pt.wikipedia.org/wiki/Energy_(ag%C3%AAncia_de_publicidade)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Energy_AG%C3%8ANCIA.jpg","page_title":"Energy (agência de publicidade)","context_page_description":"Energy é uma agência de publicidade brasileira, criada em 2008, em associação à Y&R Brands. Desde a fundação, o presidente da agência é o executivo Fernando Taralli e a área de Criação está sob o comando de Vitor Knijnik, VP de Criação da agência.\\nA agência já atuou em projetos como o Control C Control V, a primeira série interativa da internet no Brasil, acessada pelo canal I Love Messenger do portal MSN Brasil; as webseries Desempacotando Nova York e Desempacotando o Rio de Janeiro, para divulgar o site Hotéis.com; e a plataforma multimídia Eu Vivo a Seleção, que alcançou mais de 200 mil participantes e quatro milhões de visitas. Também são assinados pela agência o fórum de novas ideias Life’s Good Lab, da LG, e a ação Miley Cyrus \\"Eu Quero Sym\\", para a marca de cuidados íntimos da empresa Santher.\\nA agência é controlada pelo Grupo Newcomm, presidido pelo empresário Roberto Justus, sócio da holding britânica WPP - e de Marcos Quintela."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_North_Shenango_(condado_de_Crawford,_Pensilvania)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Pymatuning_State_Park_%28Ohio%29_%284102938252%29.jpg","page_title":"Municipio de North Shenango (condado de Crawford, Pensilvania)","context_page_description":"El municipio de North Shenango es un municipio ubicado en el condado de Crawford en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 1.387 habitantes y una densidad poblacional de 28 personas por km².​"},{"page_url":"https://ceb.wikipedia.org/wiki/Silpha_americana","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/American_carrion_beetle.JPG","page_title":"Silpha americana","context_page_description":"Espesye sa bakukang nga una nga gihulagway ni N ang Silpha americana. O. D. C.. Ang Silpha americana sakop sa kahenera nga Silpha sa kabanay nga Silphidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://hu.wikipedia.org/wiki/Artur_Juszupov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Jussupow-Artur.jpg","page_title":"Artur Juszupov","context_page_description":"Artur Majakovics Juszupov német sakkozó, nagymester, sakkíró."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_Santa_Maria_della_Candelora","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Santa_Maria_della_Candelora_%28Napoli%29.jpg","page_title":"Chiesa di Santa Maria della Candelora","context_page_description":"La chiesa di Santa Maria della Candelora è un edificio sconsacrato di Napoli, ubicato tra via della Candelora e via Banchi Nuovi."},{"page_url":"https://de.wikipedia.org/wiki/Hindenburg-Medaillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/DR_1932_470_Paul_von_Hindenburg.jpg","page_title":"Hindenburg-Medaillon","context_page_description":"Die Briefmarkendauerserie Hindenburg-Medaillon wurde von der Deutschen Reichspost ab dem 1. Oktober 1932 ausgegeben und war bis zur Kapitulation 1945 gültig, da sich das Reichspostministerium kriegsbedingt 1944 dazu entschloss, dass alle Briefmarken bis auf weiteres ihre Gültigkeit behalten.\\nEs war nach der Reichspräsidenten-Briefmarkenserie die zweite Markenserie, die den Reichspräsidenten Paul von Hindenburg als Motiv hatte; bereits zu seinem 80. Geburtstag waren 1927 vier Wohlfahrtsmarken mit seinem Bildnis erschienen. Der Erstausgabetag der Dauerserie lag einen Tag vor seinem 85. Geburtstag.\\nNach seinem Tod erschien eine Teilauflage mit schwarzem Trauerrand. Diese zählt zwar als Sonderausgabe nicht zur Dauermarkenserie, ist aber aufgrund der Motivgleichheit in diesem Artikel mit aufgeführt.\\nNeben der erst ab August 1941 eingeführten Dauerserie Reichskanzler Adolf Hitler bot die Hindenburg-Serie fast die einzige Möglichkeit, Postsendungen zum reinen Portowert zu frankieren. Sondermarken wurden nämlich spätestens ab dem Ausgabejahr 1936 fast nur noch als Zuschlagmarken mit einem erheblichen Aufschlag ausgegeben."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_dei_Santi_Martiri_(Torino)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Turin_-_Chiesa_dei_Santi_Martiri_01.jpg","page_title":"Chiesa dei Santi Martiri (Torino)","context_page_description":"La chiesa dei Santi Martiri è una chiese di Torino. Si trova lungo via Garibaldi, all'angolo con la via Botero.\\nÈ dedicata ai più antichi patroni di Torino: i martiri Avventore, Ottavio e Solutore e ne custodisce le loro reliquie fin dal 1584."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E6%A8%AA%E6%B5%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Shinyokohamaraumenshops1.jpg","page_title":"新横浜","context_page_description":"新横浜は、横浜市港北区にある新横浜駅を中心とする地域及び地名である。狭義の地名としては、新横浜一丁目から三丁目まである。住居表示未実施区域。郵便番号は222-0033。広義には、新横浜北部地区・新横浜長島地区・新横浜南部地区、大豆戸町の環状2号沿いも含む。略称は新横。\\n新横浜区域は、横浜市における都心の一つである新横浜都心に指定されている。都心としての新横浜には、上記3地区に城郷地区、羽沢地区、新羽地区が加わる。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%82%AB%E3%83%A1%E3%82%AC%E3%82%B7%E3%83%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Mallotus_japonicus.jpg","page_title":"アカメガシワ","context_page_description":"アカメガシワは、トウダイグサ科アカメガシワ属の落葉高木。主に山野に生えており、春にでる若葉が紅色をしている。"},{"page_url":"https://nl.wikipedia.org/wiki/ATB_Nieuwe_Generatie","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/09/Baken_ATB-NG.jpg","page_title":"ATB Nieuwe Generatie","context_page_description":"Automatische Treinbeïnvloeding Nieuwe Generatie, afgekort ATB-NG, is een treinbeïnvloedingssysteem. Een treinbeïnvloedingssysteem helpt machinisten te voorkomen dat zij spoorwegseinen missen. ATB-NG is gebaseerd op technologie van Alstom, die ook is toegepast in het TBL 2-systeem in België en in proeven in het Verenigd Koninkrijk, op de Chiltern line."},{"page_url":"https://simple.wikipedia.org/wiki/Ginuwine","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/80/Ginuwine_wiki.jpg","page_title":"Ginuwine","context_page_description":"Elgin Baylor Lumpkin, better known by his stage name Ginuwine, is an American singer, songwriter, dancer, and actor. He was born in Washington. He rose to fame as a member of the band Swing Mob in 1991."},{"page_url":"https://en.wikipedia.org/wiki/Hakea_corymbosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Hcorymbosa3.JPG","page_title":"Hakea corymbosa","context_page_description":"Hakea corymbosa, commonly known as the cauliflower hakea is a plant of the family Proteaceae which is endemic to the south-west of Western Australia. An attractive extremely prickly bush with sweetly scented yellowish flowers. The nectar rich blooms and dense form provides a good habitat for wildlife."},{"page_url":"https://pt.wikipedia.org/wiki/Juan_Bautista_Ag%C3%BCero","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Juan_Ag%C3%BCero_%281965%29.jpg","page_title":"Juan Bautista Agüero","context_page_description":"Juan Bautista Agüero Sánchez, ou simplesmente Juan Agüero foi um ex-futebolista paraguaio que atuava como atacante. Ele fez parte da Seleção Paraguaia de Futebol que jogou na Copa do Mundo FIFA de 1958 na Suécia, onde foi o capitão da equipe e marcou dois gols."},{"page_url":"https://pt.wikipedia.org/wiki/Muka%C5%99ov_(Praha-v%C3%BDchod)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/af/Mukarov-Praha_vychod-vlajka.png","page_title":"Mukařov (Praha-východ)","context_page_description":"Mukařov é uma comuna checa localizada na região da Boêmia Central, distrito de Praha-východ."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D9%88%D9%86%D8%AA%DB%8C%D9%86%D9%82%D8%AA%D9%88%D9%86%D8%8C_%D9%86%DB%8C%D9%88%DB%8C%D9%88%D8%B1%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Hecksher_Park_Huntington-1.JPG","page_title":"هونتینقتون، نیویورک","context_page_description":"هونتینقتون آمریکانین نیویوک ایالتینده یئرلشن بیر شهر. ۲۰۱۱-جی ایلده وئریلن معلوماتا گؤره اهالیسینین سایی ۲۰۳۲۶۴ نفر ایدی."},{"page_url":"https://es.wikipedia.org/wiki/Blyth_Valley","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/NorthumberlandBlythValley.png","page_title":"Blyth Valley","context_page_description":"Blyth Valley fue un distrito no metropolitano con el estatus de municipio, ubicado en el condado de Northumberland."},{"page_url":"https://sv.wikipedia.org/wiki/No_Fun_at_All","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/08.05.10_-_Groezrock_2008_No_Fun_At_All.jpg","page_title":"No Fun at All","context_page_description":"No Fun at All är ett svenskt skatepunk-band bildat i Skinnskatteberg sommaren 1991.\\nBandet splittrades 2001 men har senare gjort flera återföreningsspelningar. I november 2008 släppte det ett nyinspelat album, Low Rider under sin egen skivetikett Beat 'Em Down Records."},{"page_url":"https://hu.wikipedia.org/wiki/Wehrmacht","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Bundesarchiv_Bild_101I-126-0347-09A%2C_Paris%2C_Deutsche_Truppen_am_Arc_de_Triomphe.jpg","page_title":"Wehrmacht","context_page_description":"A Wehrmacht a Harmadik Birodalom fegyveres erejének megnevezése volt 1935-től, a sorkatonaság bevezetésétől, 1946-ig. Három nagy haderőből állt: Heer, Kriegsmarine és a Luftwaffe.\\nAdolf Hitler 1933-as hatalomra jutása után – a versailles-i békeszerződés korlátait figyelmen kívül hagyva – komoly fegyverkezésbe kezdett. A korábban használatos nevet: a Reichswehrt 1935-ben nevezték át Wehrmachtra. A Wehrmacht első komoly bevetésére a spanyol polgárháborúban került sor. A második világháború elején az összehangolt hadműveletek jellemezték, amiből a harckocsik, a gyalogság, a tüzérség, a műszakiak és a légierő is kivették a részüket. Ez a terv a későbbiekben villámháború néven vált ismertté. A Wehrmacht egy új katonai struktúrával, egyedi harcászati technikáival és az újonnan kifejlesztett fegyverekkel, a korábban nem tapasztalt sebességgel és pontossággal mérhetett megsemmisítő csapást az ellenséges célpontokra.\\n1941 decemberében a sikertelen Barbarossa hadművelet után Adolf Hitler saját magát nevezte ki a Wehrmacht szárazföldi ereje főparancsnokává."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B2%D8%A7%D9%BE%D8%A7%D8%AA%D8%A7%D8%8C_%D8%AA%DA%A9%D8%B2%D8%A7%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Highway_83_in_Zapata%2C_TX_IMG_2045.JPG","page_title":"زاپاتا، تکزاس","context_page_description":"زاپاتا، تکزاس آمریکانین تکزاس ایالتیندا یئر آلان بیر شهردیر و 5 کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا 14390 نفر دیر."},{"page_url":"https://en.wikipedia.org/wiki/Henry_Harrison_Chase_Dunwoody","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Cartridge_carborundum_detector.jpg","page_title":"Henry Harrison Chase Dunwoody","context_page_description":"Known in his own time for his work with the Army's Weather Bureau, Henry Harrison Chase Dunwoody invented the carborundum radio detector in 1906. It was the first practical mineral radio wave detector and the first commercial semiconductor device."},{"page_url":"https://sv.wikipedia.org/wiki/Gustaf_Larson_(direkt%C3%B6r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Assar_Gabrielsson_Volvo_1960.jpg","page_title":"Gustaf Larson (direktör)","context_page_description":"Erik Gustaf Larson, född 8 juli 1887 i Vintrosa i Örebro län, död 4 juli 1968 i Båstad i Kristianstads län, var en svensk civilingenjör och teknologie doktor, verksam inom AB Volvo som vice verkställande direktör och teknisk chef från det att bolaget grundades 1926.\\nHan var son till lantbrukaren Lars Larsson och Hulda, född Magnusson. Han gifte sig den 9 november 1918 med Elin Octavia Fröberg. De fick fyra barn: Erik, Anders, Gunnel och Britt. Sonen Erik köpte 1954 Volvos återförsäljarbolag Verdexa i Malmö."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90i%E1%BB%87n_Invalides","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Edouard_Detaille00.jpg","page_title":"Điện Invalides","context_page_description":"Điện Invalides là một công trình nổi tiếng của thành phố Paris. Được vua Louis XIV cho xây dựng vào cuối thế kỷ 17, mục đích ban đầu của Invaldes là bệnh viện dành cho các thương bệnh binh của quân đội hoàng gia. Ngày nay, Invalides tiếp tục duy trì một phần nhỏ cho chức năng dưỡng đường quân y, phần lớn dành cho bảo tàng vũ khí và lăng quân đội. Đây là nơi an nghỉ của hoàng đế Napoléon Bonaparte cùng nhiều nhân vật nổi tiếng khác như Vauban, Turenne, Napoléon II."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%99%AE%E7%93%A6%E6%B3%B0%E9%BE%99%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Poix-Terron_%28Ardennes%29_gare%2C_l%27entr%C3%A9e.JPG","page_title":"普瓦泰龙站","context_page_description":"普瓦泰龍站是法國的一個鐵路車站，位於法國東北部城市普瓦泰龍。"},{"page_url":"https://fr.wikipedia.org/wiki/BRP_Tarlac_(LD-601)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/BRP_Tarlac_homebound.jpg","page_title":"BRP Tarlac (LD-601)","context_page_description":"Le BRP Tarlac (LD-601), est le navire de tête de la classe Tarlac de Landing Platform Dock issue de la classe Makassar indonésienne qui équipe la marine philippine à deux exemplaires."},{"page_url":"https://de.wikipedia.org/wiki/Bake_(Seezeichen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Scharh%C3%B6rnbake_1898.png","page_title":"Bake (Seezeichen)","context_page_description":"Als Bake oder Kap bezeichnet man heute im Seezeichenwesen ein festes Seezeichen, das unbefeuert ist oder nach seiner Bauart oder Größe nicht die Kriterien eines Leuchtturms erfüllt. Meist werden Baken zur räumlichen Orientierung von Verkehrsteilnehmern eingesetzt.\\nDie 1661 erstmals errichtete Scharhörnbake war von 1898 bis zum 23. Dezember 1914 mit 29,10 m die höchste Bake der Nordseeküste."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_cattolica_in_Kosovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Church_of_Morava_e_Bin%C3%A7%C3%ABs%2C_Kosovo.jpg","page_title":"Chiesa cattolica in Kosovo","context_page_description":"La Chiesa cattolica in Kosovo al termine dell'anno 2012 su una popolazione di 2.160.000 persone contava 66.800 battezzati, corrispondenti al 3,1% del totale."},{"page_url":"https://fr.wikipedia.org/wiki/Allen_Ginsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Ginsberg-leary-lilly.jpg","page_title":"Allen Ginsberg","context_page_description":"Irwin Allen Ginsberg, né le 3 juin 1926 à Newark et mort le 5 avril 1997 à New York, est un poète américain, membre fondateur de la Beat Generation, du mouvement hippie et de la contre-culture américaine. Ses prises de position homosexuelles, pacifistes et bouddhistes lui valurent de fréquents démêlés avec la justice. Son œuvre, scandaleuse dans les années 1960, fut récompensée à partir des années 1970."},{"page_url":"https://en.wikipedia.org/wiki/Royal_Philharmonic_Orchestra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Clifford-Curzon.jpg","page_title":"Royal Philharmonic Orchestra","context_page_description":"The Royal Philharmonic Orchestra, based in London, was formed by Sir Thomas Beecham in 1946. In its early days, the orchestra secured profitable recording contracts and important engagements including the Glyndebourne Festival Opera and the concerts of the Royal Philharmonic Society. After Beecham's death in 1961 the orchestra's fortunes declined steeply; it battled for survival until the mid-1960s, when its future was secured after an Arts Council report recommended that it should receive public subsidy; a further crisis arose in the same era when it seemed that the orchestra's right to call itself \\"Royal\\" could be withdrawn.\\nSince Beecham's death, the RPO has had seven chief conductors, including Rudolf Kempe, Antal Doráti, André Previn and Vladimir Ashkenazy. Others closely associated with the orchestra have included Sir Charles Groves, Sir Charles Mackerras, Peter Maxwell Davies, Yehudi Menuhin and Leopold Stokowski.\\nIn 2004, the orchestra acquired its first permanent London base, at the new Cadogan Hall in Chelsea. The RPO also gives concerts at the Royal Festival Hall, the Royal Albert Hall and venues around the UK and other countries."},{"page_url":"https://en.wikipedia.org/wiki/British_industrial_narrow-gauge_railways","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Tramway_Bridge_over_the_Allt_Leachdach_-_geograph.org.uk_-_748973.jpg","page_title":"British industrial narrow-gauge railways","context_page_description":"British industrial narrow-gauge railways are narrow-gauge railways in the United Kingdom and the Isle of Man that were primarily built to serve one or more industries. Some offered passenger services for employees or workmen, but they did not run public passenger trains. They are categorized by the primary industry they served."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%BA%D9%88%D8%B1%D9%87%E2%80%8C%D8%A7%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Senecio_rowleyanus_leaves.jpg","page_title":"غوره‌ای","context_page_description":"غوره‌ای یا دانه‌تسبیحی یا رشته‌مرواریدی گونه‌ای گیاه گلدار از سرده پیرگیاه و خانوادهٔ کاسنیان است."},{"page_url":"https://ca.wikipedia.org/wiki/Observatori_Astron%C3%B2mic_de_Quito","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Antique_Telescope_at_the_Quito_Astronomical_Observatory_002.JPG","page_title":"Observatori Astronòmic de Quito","context_page_description":"L'Observatori Astronòmic de Quito és un observatori astronòmic situat a la ciutat de Quito, al mig del parc de La Alameda, fundat el 1873 i el primer observatori nacional de l'Amèrica del Sud. Actualment pertany a l'Escuela Politécnica Nacional."},{"page_url":"https://en.wikipedia.org/wiki/English_Montreal_School_Board","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/EMSB_Circle_Logo.jpg","page_title":"English Montreal School Board","context_page_description":"The English Montreal School Board is one five public school boards on the island of Montreal.\\nAt 92.4 per cent, the English Montreal School Board has the highest success rate among public school boards in Quebec. This success rate is only slightly lower than the success rate for private schools.\\nThe EMSB is one of two English school boards on the island of Montreal. Its territory consists of the city of Montreal proper as well as the centre and eastern sectors of the island. Anglophone public education in the western portion of Montreal Island is administered by the Lester B. Pearson School Board.\\nThe current Director General of the EMSB is Ann Marie Matheson, She is the school board's chief administrative officer. Currently, the EMSB is under partial trusteeship. The Ministry of Education appointed former Liberal Member of Parliament, Marlene Jennings, as the trustee in November.\\nStructurally, the EMSB has two Assistant Director Generals: Evelyne Alfonsi and Benoît Duhême. The school board divides its territory into two regions for administrative purposes, with two regional directors overseeing each territory and all its schools."},{"page_url":"https://en.wikipedia.org/wiki/Society_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/City_of_Philadelphia%2C_Original_Division_into_10_Wards.jpg","page_title":"Society Hill","context_page_description":"Society Hill is a historic neighborhood in Center City Philadelphia, Pennsylvania with a population of 6,215 as of the 2010 United States Census. Settled in the early 1680s, Society Hill is one of the oldest residential neighborhoods in Philadelphia. After urban decay developed between the late 19th and early 20th centuries, an urban renewal program began in the 1950s, restoring the area and its many historic buildings. Society Hill has since become one of the most expensive neighborhoods with the highest average income and second highest real estate values in Philadelphia. Society Hill's historic colonial architecture, along with intelligent planning and restoration efforts, led the American Planning Association to designate it, in 2008, as one of the great American neighborhoods and a good example of sustainable urban living.\\nThe neighborhood contains one of the largest concentrations of original 18th- and early 19th-century buildings in the United States."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%83%D0%B5_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Marciac_Bou%C3%A8s.JPG","page_title":"Буе (река)","context_page_description":"Буе је река у Француској. Дуга је 63 km. Улива се у Аро."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%8E%E7%B4%A2%E4%B8%8D%E8%BE%BE%E7%B1%B3%E4%BA%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Stele_of_Vultures_detail_01-transparent.png","page_title":"美索不达米亚","context_page_description":"美索不達米亞是古希臘對兩河流域的稱謂，meso意為中間，potamia為古希臘文中河流之意，轉化成為「河流中間的地方」。這兩條河指的是幼發拉底河和底格里斯河，在兩河之間的美索不達米亞平原上產生和發展的古文明稱為兩河文明或美索不達米亞文明，它大體位於現今的伊拉克，其存在時間從公元前4000年到公元前2世紀，是人類最早的文明。由於這兩條河流每年出現氾濫，所以下游土壤肥沃，富含有機物和礦物質，水源和土壤提供種植糧食的必需品，成為孕育文明的基礎，但同時該地氣候乾旱缺水，所以當地人公元前4000年就開始運用灌溉技術，灌溉為當地帶來大規模的人力協作和農業豐產。經過數千年的演化，美索不達米亞於公元前2900年左右形成成熟文字、眾多城市及周圍的農業社會。\\n由於美索不達米亞缺少天然屏障，所以在幾千年的歷史中有多個民族在此經歷接觸、入侵、融合的過程，蘇美人、阿卡德人、阿摩利人、亞述人、埃蘭人、喀西特人、胡里特人、迦勒底人等其他民族先後進入美索不達米亞，他們先經歷史前的歐貝德、早期的烏魯克、蘇美和阿卡德時代，後來又建立起先進的古巴比倫和龐大的亞述帝國。迦勒底人建立的新巴比倫將美索不達米亞古文明推向鼎盛時期。但隨著波斯人和希臘人的先後崛起和征服，已經輝煌幾千年的文字和城市逐步被荒廢，接著漸漸為沙塵掩埋，最後被人們所遺忘。直到19世紀中期，伴隨考古發掘的開始和亞述學的興起，越來越多的實物被出土，同時楔形文字逐漸被破解，塵封18個世紀的美索不達米亞古文明才慢慢呈現在當今世人面前。\\n蘇美人於公元前3200年左右發明的楔形文字、公元前2100年左右尼普爾的書吏學校、三四千年前蘇美人和巴比倫人的文學作品、距今2600多年前藏有2.4萬塊泥板書的亞述巴尼拔圖書館、有前言和後記及282條條文構成的《漢摩拉比法典》、有重達30多噸的人面帶翼神獸守衛的亞述君王宮殿、古巴比倫人關於三角的代數的運算、公元前747年巴比倫人對日食和月蝕的準確預測、用琉璃磚裝飾的新巴比倫城和傳說中的巴別塔和巴比倫空中花園，以及各時期的雕塑和藝術品，這些成就都屬於美索不達米亞這個古老的文明。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%BC%E3%83%97%E3%82%BF%E3%82%A6%E3%83%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Klimadiagramm_Kapstadt.png","page_title":"ケープタウン","context_page_description":"ケープタウンは、南アフリカ共和国西ケープ州に位置する都市である。立法府所在地で、同州の州都。アフリカ有数の世界都市である。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D1%80%D0%B5_%D0%A5%D0%BC%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Wolf_%28LRO%29.png","page_title":"Море Хмар","context_page_description":"Море Хмар — море на видимому боці Місяця, біля південно-східного краю Океану Бур. Це просторе, але неглибоке море неправильної форми з невиразними межами, що лежить у древньому поруйнованому басейні або в кількох великих кратерах, що накладаються. Сполучається з Морем Пізнаним, яке раніше розглядали як його частину, та з Океаном Бур. Має чимало примітних деталей поверхні — зокрема, найвидовищніші на Місяці скид та концентричний кратер, кілька кратерів-привидів, великий молодий кратер Булліальд і різноманітні вулканічні об'єкти."},{"page_url":"https://it.wikipedia.org/wiki/Rete_tranviaria_di_Gorizia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Gorizia_-_Corso_Vittorio_Emanuele_III.jpg","page_title":"Rete tranviaria di Gorizia","context_page_description":"La rete tranviaria di Gorizia si componeva di due linee che collegavano le principali stazioni ferroviarie cittadine e il sobborgo di San Pietro di Gorizia. Rimasti in esercizio solo fra il 1909 e il 1933, gli impianti subirono le conseguenze delle vicende belliche della città e le successive scelte dell'amministrazione comunale."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Charleston_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Will_Rogers_Theatre_and_Commercial_Block_2012-10-31_12-28-18.jpg","page_title":"Charleston (Illinois)","context_page_description":"Charleston sī Bí-kok Illinois chiu Coles kūn ê chi̍t ê chng-thâu."},{"page_url":"https://es.wikipedia.org/wiki/Mercado_Met%C3%A1lico_(Badajoz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/UEX-Badajoz.Edificio_met%C3%A1lico._01.jpg","page_title":"Mercado Metálico (Badajoz)","context_page_description":"El Mercado Metálico es una gran nave de estructura metálica del siglo XIX que inicialmente estaba situado en la Plaza Alta de Badajoz, en la provincia del mismo nombre de la comunidad autónoma de Extremadura en España. La Plaza Alta se halla en la zona antigua, cerca de la Alcazaba de Badajoz y el edificio se inauguró como «Mercado de Abastos» el 17 de septiembre de 1899. A esta estructura, que ocupaba casi la totalidad de la plaza, se trasladaron los puestos de venta que anteriormente estaban situados en los soportales de la plaza quedando estos más libres para el paso de personas y acceso a las viviendas."},{"page_url":"https://en.wikipedia.org/wiki/Jonathan_Maxcy","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/JonathanMaxcy.jpg","page_title":"Jonathan Maxcy","context_page_description":"Jonathan Maxcy was the second president of Brown University; the third president of Union College; and the first president of the University of South Carolina."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%8F%D0%BE%D0%BB%D1%96%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/MingXiaoLing-CSMTZZM.JPG","page_title":"Сяолін","context_page_description":"Мавзолей Сяолін — мавзолей Чжу Юаньчжана, засновника Династії Мін в Нанкіні. Скульптурно-архітектурний комплекс кінця XIV — початку XV століть, з окремими більш пізніми доповненнями та змінами. Один з компонентів пам'ятника Світової спадщини ЮНЕСКО «Гробниці імператорів династій Мін і Цін», який також включає гробниці соратників Чжу Юаньчжана в Нанкіні та більш пізні мінські й цінські імператорські гробниці під Пекіном, в Ляоніні та Хубеї."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%B4%D1%83%D0%BD%D0%BE%D0%B2,_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B9_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Godunov_sergei.jpg","page_title":"Годунов, Сергей Константинович","context_page_description":"Серге́й Константи́нович Годуно́в — советский и российский математик и механик, академик РАН. Работы по теории обыкновенных дифференциальных уравнений, уравнений в частных производных, вычислительной математике, механике сплошных сред, линейной алгебре. Лауреат Ленинской премии."},{"page_url":"https://sv.wikipedia.org/wiki/Moldaviska_republikens_kommunistiska_parti","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/PCRM_logo.png","page_title":"Moldaviska republikens kommunistiska parti","context_page_description":"Republiken Moldaviens kommunistiska parti, är ett marxist-leninistiskt politiskt parti i Moldavien, lett av forna presidenten Vladimir Voronin.\\nPartiet har cirka 20 000 medlemmar och hammaren och skäran i sin logotyp."},{"page_url":"https://ro.wikipedia.org/wiki/Districtul_Mueang_Phuket","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Amphoe_8301.png","page_title":"Districtul Mueang Phuket","context_page_description":"Mueang Phuket este un district din provincia Phuket, Thailanda, cu o populație de 196.733 de locuitori și o suprafață de 224,0 km²."},{"page_url":"https://cs.wikipedia.org/wiki/Antoine_Griezmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Antoine_Griezmann_in_2018_%28cropped%29.jpg","page_title":"Antoine Griezmann","context_page_description":"Antoine Griezmann je francouzský fotbalista, hrající ve španělském klubu FC Barcelona a za francouzskou reprezentaci, který je schopný zahrát na všech pozicích v útoku.\\nNarodil se a vyrůstal ve francouzském Mâconu, ale profesionální kariéru začal v roce 2009 ve španělském Realu Sociedad, se kterým ve své první sezóně vyhrál Segundu División. Po pětiletém působení přestoupil do Atlética Madrid za tehdejší rekordní klubovou částku 30 000 000€. Zatímco v Realu Sociedad nastupoval především jako křídelník, v Atléticu se začínal adaptovat na roli podhrotového útočníka a postupně se stával velmi důležitým hráčem klubu. Prosadil se ale už v první sezóně, když vyhrál Španělský superpohár a dostal se do 2014/15 Týmu sezóny La Ligy. V roce 2016 byl jmenován Nejlepším hráčem La Ligy a Nejlepším francouzským fotbalistou roku. Byl také nominován na Nejlepšího hráče světa podle FIFA a Zlatý míč, přičemž v obou anketách skončil třetí. V roce 2018 byl znovu nominován na Zlatý míč a i tentokrát se umístil na třetím místě. V sezóně 2017/18 vyhrál s Atléticem Evropskou Ligu, poté co dal ve finále dva góly a následně také Superpohár UEFA."},{"page_url":"https://sv.wikipedia.org/wiki/PGC_39058","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/PGC_39058.jpg","page_title":"PGC 39058","context_page_description":"PGC 39058 är en dvärggalax i stjärnbilden Draken. Galaxen är ljussvag och svår att observera p.g.a. HD 106381, en stjärna alldeles bredvid galaxen."},{"page_url":"https://en.wikipedia.org/wiki/Superior_colliculus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Gray712.png","page_title":"Superior colliculus","context_page_description":"The superior colliculus is a structure lying on the roof of the mammalian midbrain. In non-mammalian vertebrates, the homologous structure is known as the optic tectum, or optic lobe. The adjective form tectal is commonly used for both structures.\\nIn mammals, the superior colliculus forms a major component of the midbrain. It is a paired structure and together with the paired inferior colliculi forms the corpora quadrigemina. The superior colliculus is a layered structure, with a number of layers that varies by species. The layers can be grouped into the superficial layers and the deeper remaining layers. Neurons in the superficial layers receive direct input from the retina and respond almost exclusively to visual stimuli. Many neurons in the deeper layers also respond to other modalities, and some respond to stimuli in multiple modalities. The deeper layers also contain a population of motor-related neurons, capable of activating eye movements as well as other responses.\\nThe general function of the tectal system is to direct behavioral responses toward specific points in egocentric space."},{"page_url":"https://it.wikipedia.org/wiki/Donatella_Turri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Donatella_Turri.JPG","page_title":"Donatella Turri","context_page_description":"Donatella Turri, nome d'arte di Maria Donatella Turri Gandolfi, è un'attrice italiana attiva negli anni sessanta."},{"page_url":"https://tr.wikipedia.org/wiki/Nohut_(t%C3%BCr)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Cicer_arietinum_Taub129.png","page_title":"Nohut (tür)","context_page_description":"Nohut, baklagiller familyasının Faboideae alt familyasına ait Cicer cinsinden bir baklagil türü."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D1%96%D1%8F%D0%BB%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/La_Dame_du_Palais_de_la_Reine_by_P.A._Martini_after_Jean-Michel_Moreau_le_Jeune.jpg","page_title":"Віяло","context_page_description":"Віяло — невелике, як правило, складане опахало для створення потоку повітря, яке овіює обличчя, шию і плечі. Складані віяла були завезені до Європи на початку XVII століття спочатку єзуїтами, а потім і торговцями, які селилися на узбережжі Китаю. Західні майстри дуже швидко навчилися їх копіювати.\\nЯк технічне пристосування віяло є лопаткою, прикріпленою до рукоятки."},{"page_url":"https://fr.wikipedia.org/wiki/Province_de_Corrientes","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/43/Rio_Parana_Lavalle.jpg","page_title":"Province de Corrientes","context_page_description":"La province de Corrientes est une province du nord-est de l'Argentine, dont la capitale est la ville de Corrientes. Au nord comme à l'ouest elle est délimitée par le Río Paraná, qui la sépare du Paraguay et des provinces du Chaco et de Santa Fe ; sa frontière orientale est constituée par le río Uruguay, qui la sépare de la République d'Uruguay et du Brésil ; les rivières Guayquiraró et Mocoretá délimitent sa frontière sud avec la province d'Entre Ríos. Au nord-est se trouve sa seule frontière artificielle, qui la sépare de la province de Misiones."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%BA%D0%BD%D0%B5%D1%80,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%AD%D0%B4%D1%83%D0%B0%D1%80%D0%B4%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/%D0%91%D1%80%D0%BE%D0%BA%D0%BD%D0%B5%D1%80_-_%D0%9F%D0%BE%D1%80%D1%82%D1%80%D0%B5%D1%82_%D0%BA%D1%83%D0%BF%D1%87%D0%B8%D1%85%D0%B8_%281875%29.jpg","page_title":"Брокнер, Константин Эдуардович","context_page_description":"Константин Эдуардович Брокнер — русский живописец, портретист, академик Императорской Академии художеств."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%BD%D0%B5%D0%BD%D0%BE%D1%81%D0%BD%D1%8B%D0%B5_%D0%BA%D1%80%D0%B5%D0%B9%D1%81%D0%B5%D1%80%D0%B0_%D1%82%D0%B8%D0%BF%D0%B0_%C2%AB%D0%A8%D0%B0%D1%80%D0%BD%D1%85%D0%BE%D1%80%D1%81%D1%82%C2%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/SMS_Scharnhorst.jpg","page_title":"Броненосные крейсера типа «Шарнхорст»","context_page_description":"Броненосные крейсера типа «Шарнхорст» — тип крейсеров германского императорского флота времён Первой мировой войны. Самые знаменитые броненосные крейсера Германии. Построены два корабля: «Шарнхорст» и «Гнейзенау»."},{"page_url":"https://sv.wikipedia.org/wiki/Nothofagus_alessandrii","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Nothofagus_alessandri.jpg","page_title":"Nothofagus alessandrii","context_page_description":"Nothofagus alessandrii är en tvåhjärtbladig växtart som beskrevs av Marcial Ramón Espinosa Bustos. Nothofagus alessandrii ingår i släktet Nothofagus och familjen Nothofagaceae. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_des_Tourneurs_(Toulouse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Rue_des_Tourneurs_%28Toulouse%29_Plaque_ancienne.jpg","page_title":"Rue des Tourneurs (Toulouse)","context_page_description":"La rue des Tourneurs est une rue du centre historique de Toulouse, en France. Elle traverse les quartiers des Carmes et du Capitole, dans le secteur 1 de la ville. Elle appartient au secteur sauvegardé de Toulouse."},{"page_url":"https://pl.wikipedia.org/wiki/Grzegorz_Ku%C5%BAniewicz","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/G_Ku%C5%BAniewicz_pomnik_w_Hory%C5%84cu.JPG","page_title":"Grzegorz Kuźniewicz","context_page_description":"Grzegorz Kuźniewicz, ukr. Григорій Кузневич – Hryhorij Kuznewycz – ukraiński rzeźbiarz, początkowo jeden z bruśnieńskich kamieniarzy. Studiował we Lwowie, potem we Włoszech. Wykonywał wiele rzeźb do obiektów kościelnych i świeckich we Lwowie, a po wyjeździe do USA w Nowym Jorku, Cleveland, Pittsburghu i Filadelfii."},{"page_url":"https://nl.wikipedia.org/wiki/Oxen_End","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Oxen_End_-_geograph.org.uk_-_289592.jpg","page_title":"Oxen End","context_page_description":"Oxen End is een gehucht in het bestuurlijke gebied Uttlesford, in het Engelse graafschap Essex. Het maakt deel van de civil parish Little Bardfield."},{"page_url":"https://fi.wikipedia.org/wiki/Ian_Boswell","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Ian_Boswell_TC_2012_copy.jpg","page_title":"Ian Boswell","context_page_description":"Ian Boswell on yhdysvaltalainen maantiepyöräilijä. Häm aloitti ammattilaisuransa harjoittelijana Argos-Shimano-tallissa syksyllä 2012, edusti Team Skyta 2013–2017 ja Katjuša-Alpecinia vuodesta 2018.\\nBoswell sijoittui kolmanneksi Tour of Utahin kokonaiskilpailussa 2010. Hän oli kolmas 11. etapilla Espanjan ympäriajossa 2015. Hän sijoittui viidenneksi Kalifornian ympäriajossa 2017."},{"page_url":"https://az.wikipedia.org/wiki/Columba_hodgsonii","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/ColumbaHodgsonii.jpg","page_title":"Columba hodgsonii","context_page_description":"Columba hodgsonii — göyərçin cinsinə aid heyvan növü."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%82%D0%BE%D0%BB_%D0%94%D0%B6%D0%BE%D0%BD%D1%81%D1%82%D1%8A%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Aerial_view_of_Johnston_Atoll_and_Sand_Island.jpg","page_title":"Атол Джонстън","context_page_description":"Атол Джонстън е отвъдморска територия на САЩ. Тя е национално убежище за дивата природа и публичният достъп към нея е забранен. Ограниченият достъп за нуждите на управлението се упълномощава от американските военновъздушните сили.\\nВ продължение на почти 70 години атолът е под контрола на въоръжените сили на САЩ. През това време той се използва като военноморско депо за презареждане на гориво, военновъздушна база, полигон за изпитания на ядрени и биологични оръжия, тайна ракетна база и място за съхранение и изхвърляне на химическото оръжие Агент Ориндж. Тези дейности са замърсили района на атола, а усилията по изчистването и мониторинга му продължават и до ден днешен.\\nАтол Джонстън е един от най-изолираните атоли на Земята."},{"page_url":"https://vi.wikipedia.org/wiki/R%C3%A3nh_(th%E1%BB%9Di_ti%E1%BA%BFt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Nov-12-2012-7am.gif","page_title":"Rãnh (thời tiết)","context_page_description":"Rãnh hay máng trong thuật ngữ khí tượng học là một khu vực dài có áp suất khí quyển tương đối thấp, thường gắn liền với frông thời tiết.\\nKhông giống như frông, không có biểu tượng phổ quát cho một rãnh trên biểu đồ thời tiết. Biểu đồ thời tiết ở một số quốc gia hoặc khu vực đánh dấu rãnh bằng một đường. Tại Hoa Kỳ, một rãnh có thể được đánh dấu là một đường nét đứt. Tại Anh, Hồng Kông và Fiji, and Fiji, nó được đại diện bởi một đường đậm mở rộng từ trung tâm áp suất thấp hoặc giữa hai trung tâm áp suất thấp, Macau và Australia, đó là một đường nét đứt. Nếu chúng không được đánh dấu, rãnh vẫn có thể được xác định là một phần mở rộng của các isobar cách xa trung tâm áp suất thấp.\\nĐôi khi khu vực giữa hai trung tâm áp suất cao có thể giả định tính chất của một rãnh khi có một sự thay đổi gió có thể phát hiện được ghi nhận ở bề mặt. Nếu không có sự thay đổi của gió, khu vực này được gọi là col, giống như một cái yên ngựa địa lý giữa hai đỉnh núi.\\nNếu máng hình thành ở vĩ độ trung, sự chênh lệch nhiệt độ giữa hai bên máng thường tồn tại dưới dạng frông thời tiết. Frông thời tiết thường ít bị đối lưu hơn là rãnh trong vùng nhiệt đới hoặc cận nhiệt đới."},{"page_url":"https://he.wikipedia.org/wiki/%D7%98%D7%A8%D7%99%D7%A4%D7%9C_H","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/D-Generation_X.jpg","page_title":"טריפל H","context_page_description":"פול מייקל לווק, הידוע גם בשם הבמה שלו טריפל H, הוא מתאבק מקצועני ושחקן סרטים אמריקאי, המופיע במסגרת ארגון ה-WWE. בשנת 2010 מונה לתפקיד מנהלי במטה החברה בקונטיקט, ארצות הברית, במקביל להיותו מתאבק פעיל."},{"page_url":"https://be.wikipedia.org/wiki/NSU_Spider","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/1967_NSU_Spider_engine.JPG","page_title":"NSU Spider","context_page_description":"NSU Spider — легкавы аўтамабіль, які выпускаўся кампаніяй NSU Motorenwerke з 1964 па 1967 год. Першы ў свеце аўтамабіль з ротарна-поршневым рухавіком Ванкеля. Усяго выпушчана 2375 машын."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D1%80%D1%96_(%D0%BE%D0%B4%D1%8F%D0%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Blue_sari_2.jpg","page_title":"Сарі (одяг)","context_page_description":"Сарі — традиційний жіночий одяг у Південній Азії у вигляді шматка тканини довжиною від 4,5 до 9 метрів і шириною до 1,2 м, особливим чином обернутого навколо тіла. Носиться сарі з блузою, відомою як чолі або равіка, і нижньою спідницею. Найпоширеніший стиль носіння сарі — ніві, коли один кінець двічі обертається навколо стегон, драпіруючи ноги, а верхній край зміцнюється на тугому поясочку нижньої спідниці і потім перекидається через одне плече. На вулиці жінки зазвичай накидають вільний кінець сарі на голову, як шаль. Традиційно матеріал, з якого вироблялося сарі, залежав від соціального і матеріального положення жінки, але сам спосіб носити його був єдиним для даної місцевості."},{"page_url":"https://en.wikipedia.org/wiki/Palpita_nigropunctalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Palpita_nigropunctalis.jpg","page_title":"Palpita nigropunctalis","context_page_description":"Palpita nigropunctalis, the lilac pyralid, is a moth of the family Crambidae. It is found in eastern Asia, including China, Taiwan, Korea, Japan and the Russian Far East.\\nThe wingspan is 29–31 mm. Adults are on wing from April to October. Adults are on wing from late March to early April, from mid May to early June and from early September to mid November in Japan. There are three generations per year.\\nThe larvae feed on the flowers, fruits and leaves of Ligustrum species, including Ligustrum japonicum and Ligustrum lucidum. They have also been recorded on Fraxinus mandschurica. First-instar larvae occur three times per year in Japan."},{"page_url":"https://fr.wikipedia.org/wiki/HMS_Nith_(K215)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/HMS_Nith_FL3359.jpg","page_title":"HMS Nith (K215)","context_page_description":"Le HMS Nith est une frégate de classe River en service dans la Royal Navy pendant la Seconde Guerre mondiale. En 1948, il est transféré dans la Marine égyptienne sous le nom de Domiat."},{"page_url":"https://pl.wikipedia.org/wiki/Bilma","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Oasis-Bilma.jpg","page_title":"Bilma","context_page_description":"Bilma – miasto w północno-wschodnim Nigrze, w regionie Agadez, w departamencie Bilma, na Saharze, u stóp progu Kawari. Znajdują się tu eksploatowane od wieków saliny – cel dorocznych karawan ludu Tuaregów po sól kamienną. Trasa karawan wiedzie z gór Aïr, poprzez piaszczystą pustynię Ténéré. W 2005 populacja Bilmy wynosiła około 2300 mieszkańców."},{"page_url":"https://en.wikipedia.org/wiki/Gut-specific_homing","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Blausen_0625_Lymphocyte_T_cell_%28crop%29.png","page_title":"Gut-specific homing","context_page_description":"Gut-specific homing is the mechanism by which activated T cells and antibody-secreting cells are targeted to both inflamed and non-inflamed regions of the gut in order to provide an effective immune response. This process relies on the key interaction between the integrin α4β7 and the addressin MadCAM-1 on the surfaces of the appropriate cells. Additionally, this interaction is strengthened by the presence of CCR9, a chemokine receptor, which interacts with TECK. Vitamin A-derived retinoic acid regulates the expression of these cell surface proteins."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%AD%E5%A4%AE%E9%83%8A%E5%A4%96%E6%97%85%E5%AE%A2%E4%BC%9A%E7%A4%BEEG2Tv%E5%BD%A2%E9%9B%BB%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/EG2Tv_head_car_interior_-_front_zone_%28back_view%29.jpg","page_title":"中央郊外旅客会社EG2Tv形電車","context_page_description":"EG2Tv形は、ロシア連邦の列車運行会社である中央郊外旅客会社が所有する直流電化区間用電車。通勤・近郊輸送に適した構造を持つロシア国産車両として開発され、イヴォルガの愛称を持つ。"},{"page_url":"https://ceb.wikipedia.org/wiki/Schoodic_Peninsula","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/BlackDike_SchoodicHeadME.jpg","page_title":"Schoodic Peninsula","context_page_description":"Punta ang Schoodic Peninsula sa Tinipong Bansa. Ang Schoodic Peninsula nahimutang sa kondado sa Hancock County ug estado sa Maine, sa sidlakang bahin sa nasod, 900 km sa amihanan-sidlakan sa ulohang dakbayan Washington, D.C.\\nAng yuta sa Schoodic Peninsula kay patag. Sa habagatan, dagat ang pinakaduol sa Schoodic Peninsula. Kinahabogang dapit sa palibot ang Schoodic Head, 134 ka metros ni kahaboga ibabaw sa dagat, 1.8 km sa habagatan sa Schoodic Peninsula. Dunay mga 18 ka tawo kada kilometro kwadrado sa palibot sa Schoodic Peninsula may gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Bar Harbor, 11.8 km sa kasadpan sa Schoodic Peninsula. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Schoodic Peninsula. Sa rehiyon palibot sa Schoodic Peninsula, kagaangan, mga luuk, mga lawis, kapuloan, ug mga estretso talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 5 °C. Ang kinainitan nga bulan Agosto, sa 16 °C, ug ang kinabugnawan Pebrero, sa -9 °C. Ang kasarangang pag-ulan 1,543 milimetro matag tuig. Ang kinabasaan nga bulan Disyembre, sa 219 milimetro nga ulan, ug ang kinaugahan Agosto, sa 72 milimetro."},{"page_url":"https://fi.wikipedia.org/wiki/Ilmaj%C3%A4%C3%A4hdytteinen_moottori","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Newjug1.jpg","page_title":"Ilmajäähdytteinen moottori","context_page_description":"Ilmajäähdytteinen moottori on moottori, jonka tuottama lämpö luovutetaan suoraan ympäröivään ilmaan. Ilmajäähdytys ei ole yhtä tehokasta kuin nestejäähdytys, mutta sen ansiosta moottorista tulee kevyempi, halvempi ja helpommin huollettava, minkä vuoksi sitä käytetään nykyäänkin."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_ponts_sur_la_Seine","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Pont_premiere_armee_-_juvisy_-_mars_2015_%283%29.jpg","page_title":"Liste des ponts sur la Seine","context_page_description":"Cette liste contient les ponts présents sur la Seine et ses bras. Elle est donnée par département de l'aval du fleuve vers son amont et précise, après chaque pont, le nom des communes qu'elle relie, en commençant par celle située sur la rive gauche du fleuve.\\nOn en dénombre environ 257, de toutes sortes :\\nvoies routières ou autoroutières +\\nvoies ferrées\\npasserelles piétonnes\\nponts mixtes +\\nCertains relient une berge à une île et ne franchissent donc qu'un bras. D'autres sont en ruine et infranchissables.\\nCertains ponts sont inscrits ou classés aux monuments historiques, ou encore répertoriés dans l’inventaire général du patrimoine culturel du Ministère de la Culture :\\npont inscrit\\npont classé\\nCette liste n'indique pas les ponts présents au-dessus des affluents de la Seine."},{"page_url":"https://fr.wikipedia.org/wiki/Projection_st%C3%A9r%C3%A9ographique","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/4mmm_point_group.png","page_title":"Projection stéréographique","context_page_description":"En géométrie et en cartographie, la projection stéréographique est une projection cartographique azimutale permettant de représenter une sphère privée d'un point sur un plan. On convient souvent que le point dont on prive la sphère sera un des pôles de celle-ci ; le plan de projection peut être celui qui sépare les deux hémisphères, nord et sud, de la sphère, qu'on appelle plan équatorial. On peut également faire une projection stéréographique sur n'importe quel plan parallèle au plan équatorial pourvu qu'il ne contienne pas le point dont on a privé la sphère.\\nSoit S le point situé au pôle sud de la sphère à projeter. L’image Z’ d’un point Z de cette sphère sera définie par l’intersection entre le plan équatorial et la droite.\\nDeux propriétés importantes :\\ntout cercle sur la sphère — hormis ceux passant par le pôle sud — sera transformé en un autre cercle dans le plan équatorial ;\\nles angles sont conservés pendant la transformation.\\nRemarques :\\nl’équateur reste lui-même durant cette transformation ;\\nun point de l’hémisphère nord sera projeté à l’intérieur de l’équateur, un point de l’hémisphère sud à l’extérieur ;"},{"page_url":"https://bs.wikipedia.org/wiki/Majanski_kalendar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Maya-Dresden-Kayab.png","page_title":"Majanski kalendar","context_page_description":"Majanski kalendar je sistem kalendara koji se koristio tokom prekolumbovske ere na područje Mezoamerike a koristi se i u mnogim modernim zajednicama gvatemalanskog gorja: Veracruzu, Oaxacau, Chiapasu i Meksiku.\\nOsnove kalendarskog sistema Maja se zasnivaju na sistemu koji je bio u širokoj upotrebi u cijeloj regiji a čiji počeci sežu sve do 5. vijeka p.n.e. Taj kalendarski sistem ima zajedničke osnove s kalendarima koje su koristile druge mezoameričke civilizacije kao što su Zapoteci i Olmeci ali i savremeniji narodi kao što su Mixteci i Asteci.\\nPrema mitološkoj tradiciji Maja, koje se navode u kolonijalnim zapisima s Yucatána u i rekonstrukciji kasnih klasičnih i postklasičnih natpisa, božanstvu Itzamni se često pripisuje to da je precima Maja donio znanje o kalendarskom sistemu kao i pismo i općenito druge osnove kulture Maja."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A8%D7%A7%D7%95%D7%95%D7%99%D7%90%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Manuscript_of_the_last_page_of_Requiem.jpg","page_title":"רקוויאם","context_page_description":"רקוויאם היא מיסה קתולית הנכתבת ומבוצעת לזכר אדם מת, בלטינית נקראת היצירה גם \\"מיסה פרו דפונקטיס\\", כלומר \\"מיסה עבור המתים\\".\\nלרוב נכללת המיסה בטקסי אשכבה וכן משמשת כתפילה ביום כל הנשמות, מועד נוצרי המתקיים כל שנה ב-2 בנובמבר ובו מתפללים לעילוי נשמות כל המתים. הקתולים מאמינים כי ביצוע מיסת הרקוויאם לכבודו של נפטר מסוים, יכול לזרז את מסלול הייסורים שנגזר על נשמתו לעבור בדרכה אל גן העדן.\\nהשם רקוויאם מגיע מהמשפט הפותח את המיסה: Requiem æternam dona eis, Domine, et lux perpetua luceat eis ומשמעותו בלטינית: \\"מנוחה\\".\\nרקוויאם היא גם יצירה מוזיקלית הנכתבת לטקסטים ולפיוטים של טקס האשכבה הקתולי. ברוב המיסות הקתוליות, חלק מהטקסטים שביצירה יכולים להיות מוחלפים בהתאם ליום ולמועד בו מנוגנת היצירה, אולם במיסת הרקוויאם, הטקסטים המושרים קבועים תמיד. פיוטים אלו, אשר נושאים אופי דרמטי וסוער, היוו מאז ומתמיד מוקד משיכה ללחניהם של מלחינים אשר שאפו להציג את יכולתם להביע פאתוס בהלחינם את המילים הדרמטיות. בין הרקוויאמים המוכרים שנכתבו ניתן למנות את אלה של מוצרט, ורדי ושל ברליוז.\\nקיימת גם מסורת מוזיקלית של רקוויאם לא-קתולי."},{"page_url":"https://id.wikipedia.org/wiki/Kedarnath_(film)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Sara_Ali_Khan_promoting_Kedarnath.jpg","page_title":"Kedarnath (film)","context_page_description":"Kedarnath adalah sebuah film drama romantis India tahun 2018 yang disutradarai dan diproduksi oleh Abhishek Kapoor. Dibintangi oleh Sushant Singh Rajput dan Sara Ali Khan dalam peran utama, ini menceritakan kisah cinta antar agama antara seorang gadis Hindu Brahmana kaya yang keluarganya memiliki pondok dan toko-toko di dekat Kedarnath yang bersejarah di pegunungan Uttarakhand dan seorang anak lelaki Muslim yang rendah hati yang merupakan 'pithoo' bekerja di area yang sama. Ketika hubungan mereka semakin dekat, pasangan menghadapi banyak kendala, termasuk ketidaksetujuan keluarga dan latar belakang yang kontras; ketika hujan tiba-tiba dari banjir Uttarakhand 2013 menghancurkan wilayah tersebut, pasangan ini dipaksa untuk bertahan melawan unsur-unsur dan menghadapi ujian akhir dari cinta mereka.\\nFilm ini diproduksi oleh Ronnie Screwvala dari RSVP Moviess dan Sky Pictures, bersama dengan Pragya Kapoor dan Abhishek Nayyar; itu ditulis bersama dengan Kapoor oleh Kanika Dhillon. Produksi film dimulai pada Juni 2017, dan fotografi utama dimulai pada 5 September 2017. Film ini dirilis pada 7 Desember 2018 untuk ulasan campuran, tetapi dengan pujian untuk kinerja debut Khan."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Radebeul_(Gemarkung)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Radebeul_Einsteinstr_28.JPG","page_title":"Liste der Kulturdenkmale in Radebeul (Gemarkung)","context_page_description":"Die Liste der Kulturdenkmale in der Gemarkung Radebeul gibt eine Übersicht über die Kulturdenkmale im Ursprungsstadtteil Alt-Radebeul der sächsischen Stadt Radebeul anhand des Stands der Denkmalliste vom 24. Mai 2012.\\nEine weitere Liste zeigt ehemalige Bau-/Kulturdenkmale dieses Stadtteils.\\nEinen Überblick über die Radebeuler Kulturdenkmale gibt die Liste der Kulturdenkmale in Radebeul, eine Zusammenfassung aller Adressen mit Kulturdenkmalen gibt die Liste der Kulturdenkmaladressen in Radebeul. Die Zuordnung der Straßen zum Stadtteil findet sich in der Liste der Straßen und Plätze in Radebeul.\\nGrundlage der Auflistung sind die angegebenen Quellen. Diese Angaben ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://gl.wikipedia.org/wiki/Escalivada","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Escalivada.jpg","page_title":"Escalivada","context_page_description":"A escalivada é un prato típico da Cataluña que contén verduras asadas: berenxena, pemento, cebola e tomate. O nome provén do verbo catalán escalivar que vén dicir ‘asar ao rescaldo’ e ten a súa orixe nas comunidades rurais. É un prato baixo en calorías e de alto contido en fibra."},{"page_url":"https://nn.wikipedia.org/wiki/Tel_Aviv_storbyomr%C3%A5de","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Modiin-vue_general.jpg","page_title":"Tel Aviv storbyområde","context_page_description":"Tel Aviv storbyområde eller Gush Dan, er eit storbyområde inkludert område frå både Tel Aviv og Sentral-distriktet i Israel. Området er nært knytt til byen Tel Aviv gjennom sosiale, økonomiske og kulturelle band. Han ligg langs den israelske Middelhavskysten. Tel Aviv storbyområde er det største storbyområdet i Israel og har eit estimert folketal på 3 464 100 innbyggjarar, av desse er 95 % israelske jødar. 42 % av innbyggjarane i Israel bur i dette området."},{"page_url":"https://de.wikipedia.org/wiki/Klaussteinkapelle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Klaussteinkapelle_im_Herbst.JPG","page_title":"Klaussteinkapelle","context_page_description":"Die Klausstein-Kapelle ist eine Kapelle der ehemaligen Burg Ahorn bei Klausstein, einem Ortsteil der Gemeinde Ahorntal im Landkreis Bayreuth in Bayern."},{"page_url":"https://hu.wikipedia.org/wiki/Ebernhahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Ebernhahn2.jpg","page_title":"Ebernhahn","context_page_description":"Ebernhahn település Németországban, Rajna-vidék-Pfalz tartományban. Lakosainak száma 1253 fő. +/-"},{"page_url":"https://es.wikipedia.org/wiki/Jules_Bache","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Jules_Bache.jpg","page_title":"Jules Bache","context_page_description":"Jules Semon Bache fue un empresario y banquero estadounidense de origen alemán, coleccionista de arte y filántropo.\\nNació en Alemania y al poco tiempo su familia emigró a los Estados Unidos, estableciéndose en Nueva York. En 1886, comenzó a trabajar como cajero en Leopold Cahn & Co., una firma de corredores de bolsa fundada por su tío. En 1886 fue nombrado socio minoritario y en 1892 tomó el control total del negocio. Cambió el nombre por JS Bache & Co.. Bache convirtió la compañía en una de las principales casas de corretaje de Estados Unidos, sólo superada por Merrill Lynch & Co., Inc. En el proceso, Bache se convirtió en una persona inmensamente rica, un mecenas de las artes, y un filántropo.​\\nDurante la Primera Guerra Mundial, Bache hizo donaciones al American Field Service en Francia y su mujer era la tesorera honoraria de la War Babies 'Cradle, una obra de caridad que proporcionaba ayuda a las madres y los niños en peligro por la guerra en el norte de Francia y Bélgica.\\nJules Bache fue accionista de varias empresas importantes y participó en los consejos de administración de muchas de ellas. Tenía intereses importantes en las empresas mineras canadienses."},{"page_url":"https://ro.wikipedia.org/wiki/Sul%C4%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Sewing_awl.jpg","page_title":"Sulă","context_page_description":"Sula este o unealtă formată dintr-un ac lung și gros de oțel, drept sau curb, fixat într-un mâner, cu care se găurește pielea, talpa etc. spre a putea petrece acul sau ața prin ele."},{"page_url":"https://en.wikipedia.org/wiki/New_Siberian_Islands","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Belkowski-Insel_2_2014-08-24.jpg","page_title":"New Siberian Islands","context_page_description":"The New Siberian Islands are an archipelago in the Extreme North of Russia, to the North of the East Siberian coast between the Laptev Sea and the East Siberian Sea north of the Sakha Republic."},{"page_url":"https://pl.wikipedia.org/wiki/Fort_Ricasoli","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Malta_-_Kalkara_-_Triq_Santu_Rokku_-_Fort_Ricasoli_03_ies.jpg","page_title":"Fort Ricasoli","context_page_description":"Fort Ricasoli – fort bastionowy znajdujący się w miejscowości Kalkara na Malcie. Został zbudowany przez Zakon Rycerzy Joannitów w latach 1670–1698. Zajmuje cypel, znany jako Gallows’ Point oraz północny brzeg Rinella Bay. Nadzoruje on, na równi z Fortem St. Elmo, wejście do Grand Harbour. Jest on największym fortem na Malcie; w roku 1998 został wpisany na wstępną Listę światowego dziedzictwa UNESCO jako część Knights’ Fortifications around the Harbours of Malta.\\nFort Ricasoli chrzest bojowy przeszedł podczas francuskiej inwazji na Maltę w 1798 roku, a następnie powstania Maltańczyków przeciw Francuzom, po którym został przejęty przez Brytyjczyków. Fort Ricasoli był miejscem buntu Regimentu Froberga w roku 1807, a później w XIX wieku używany był jako szpital wojskowy. Używany był raz jeszcze podczas II wojny światowej, kiedy jego część została zniszczona przez bombardowania lotnicze. Po tym, jak został wycofany z użycia w latach 60. XX wieku, był wykorzystywany do celów przemysłowych. Dziś kompleks jest w większości zachowany, lecz podupadły. Używany jest do celów filmowych oraz jako zakład czyszczenia zbiorników."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9B%BD%E9%9A%9B%E3%82%B4%E3%82%B7%E3%83%83%E3%82%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Le_Mort_devant_son_juge%2C_Maitre_de_Rohan.jpg","page_title":"国際ゴシック","context_page_description":"国際ゴシックは、ゴシック美術のうち、14世紀後半から15世紀前半にかけてブルゴーニュ、フランス、北イタリアで発達した様式を指す。その後、この様式が西ヨーロッパ全域に広がっていったことから、19世紀末にフランスの美術史家ルイ・クラジョによって「国際ゴシック」と名付けられた。\\nこの様式は、ドイツ語で weicher Stil すなわち「柔和様式」と呼ばれていることに窺えるが、宮廷文化の影響を受けている。国際ゴシックは聖母など宗教的題材における表現の深化を特徴としており、このことは、原色を積極的に盛り込むことで従前よりも鮮やかなものとなった色づかいや、全体に縦に引き伸ばされ先行のゴシック様式よりも静的かつ厳粛なフォルムに改まった人物造形、細部への非常なこだわり、動植物をはじめとする自然のつぶさな観察に表れている。一方、国際ゴシックはこの時代の不安を反映してある種の陰鬱さに突き動かされたものともなっており、なまなましい死の表現に執着がみられる。また、国際ゴシックは教会美術以外へも進出していき、その享受者は宮廷に伺候する社会の上層であったが、彼らは15世紀に勃興した都市住民の注文を取り次ぐこともできた。\\n芸術家が各地を移動したのはもちろんのこと、装飾写本など持ち運びの可能な作品も欧州全土を巡り、王侯と上級貴族に各地で共通する美意識を形成した。写本は運搬も容易であるため、国際ゴシック様式の普及に果たした役割は大きい。そのためこうした宮廷のエリートに向けて作られた作品には国ごとの多様性はあまり見られない。国際ゴシックの主要な流行源は、北フランス、ブルゴーニュ公国、プラハ、イタリアである。イングランド国王リチャード2世とボヘミア王女アンとの結婚など、王侯の結婚はこの様式の拡大を助けた。\\n国際ゴシックはもともとは宮廷的洗練を有する様式だったが、勃興しつつあった商人階級や中小貴族の依頼になるものはいくぶん粗野であった。北ヨーロッパでは、「後期ゴシック」としてのこの様式は特に装飾要素で用いられつづけ、16世紀初期にも依然としてみることができる。結局装飾表現ではとってかわられることがないままルネサンス美術にいたった。国際ゴシックという術語は美術史家の間でもいくらか用法に幅があり、この語の利用が避けられることもある。国際ゴシックという術語は「多くの場合あまり役に立たないが、というのも差異や変遷の詳細を誤魔化してしまいがちだからである」とする評も存在する。"},{"page_url":"https://sk.wikipedia.org/wiki/Dinosaury","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/THERIZINOSAURUS.jpg","page_title":"Dinosaury","context_page_description":"Dinosaury [jednotné číslo dinosaurus] je nadrad plazov rôznej veľkosti, ktorí mali pred 200 až 66 miliónmi rokov dominantné postavenie. Išlo väčšinou o suchozemské stavovce."},{"page_url":"https://it.wikipedia.org/wiki/La_Sagne","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ac/La-Sagne-Mieville-2.jpg","page_title":"La Sagne","context_page_description":"La Sagne è un comune svizzero di 963 abitanti del Canton Neuchâtel, nel distretto di La Chaux-de-Fonds."},{"page_url":"https://ca.wikipedia.org/wiki/El_viatge_del_Beagle","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Journal_of_researches_-_Darwin.jpg","page_title":"El viatge del Beagle","context_page_description":"El viatge del Beagle, The Voyage of the Beagle, és el títol que de forma més comuna es dona al llibre escrit per Charles Darwin i publicat el 1839 com el seu Journal and Remarks. Aquest llibre li va donar fama i respecte considerables. Aquest va ser el tercer volum de The Narrative of the Voyages of H.M. Ships Adventure and Beagle, i cobreix la part de Darwin en el Segon viatge del vaixell HMS Beagle, el qual salpà de Plymouth Sound el 27 de desembre capitanejat per Robert FitzRoy, R.N. A causa de la popularitat assolida pel relat de Darwin, es va reeditar a finals de l'any 1839 amb el títol de Journal of Researches de Darwin, i una segona edició revisada es va publicar l'any 1845 amb aquest títol. L'any 1905 es va tornar a publicar, ja amb el títol de The Voyage of the Beagle.\\nMalgrat que aquesta expedició estava planificada per durar dos anys, en va durar gairebé cinc. Darwin va explorar tres anys i tres mesos sobre terra ferma i 18 mesos sobre la mar.\\nAquest llibre és una memòria del viatge i tracta de biologia, geologia i antropologia. Està ordenat pels llocs de l'exploració en comptes de per les dates de les exploracions."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%9F%B3%E9%96%80%E7%9C%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Shimen.jpg","page_title":"石門県","context_page_description":"石門県は中華人民共和国湖南省常徳市に位置する県。"},{"page_url":"https://ca.wikipedia.org/wiki/Sant_Isidre_i_Sant_Serni_de_Cab%C3%B3_Nou","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Esgl%C3%A9sia_parroquial_de_Sant_Isidre_i_Sant_Serni_de_Cab%C3%B3_Nou_%28Cab%C3%B3%29_-_5.jpg","page_title":"Sant Isidre i Sant Serni de Cabó Nou","context_page_description":"Sant Isidre i Sant Serni de Cabó Nou és una obra del municipi de Cabó protegida com a bé cultural d'interès local."},{"page_url":"https://pl.wikipedia.org/wiki/Buljarica","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Buljarice1.jpg","page_title":"Buljarica","context_page_description":"Buljarica – wieś w Czarnogórze, w gminie Budva. W 2011 roku liczyła 203 mieszkańców."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D0%B8%D0%BF%D0%BF%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%B5%D1%81%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/2011phil10pisoobv.jpg","page_title":"Филиппинское песо","context_page_description":"Пе́со — национальная валюта Филиппин. В настоящее время состоит из 100 сентимо, в 1958—1966 годах состояло из 100 сентаво. Появилось 1 мая 1852 года, когда Испано-Филиппинский банк выпустил «твёрдые песо», которые вытеснили реалы, ходившие до этого на Филиппинах."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%AD%E8%B2%9D%E5%BE%B7%E7%A6%8F%E5%BE%B7%E9%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/BedfordshireMid.png","page_title":"中貝德福德郡","context_page_description":"中贝德福德郡在1974年设立，英国英格兰东部区域贝德福德郡的非都市区，有133,900人口，占地502.85平方公里，行政总部位于奇克桑兹。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%96%D0%B5%D0%B1%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%9C%D0%B8%D1%85%D0%B0%D0%B9%D0%BB%D0%BE%D0%B2%D0%B8%D1%87_%D0%96%D0%B5%D0%B1%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9%2C_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82_%D0%93%D0%94.jpg","page_title":"Жебровский, Станислав Михайлович","context_page_description":"Станислав Михайлович Жебровский — советский и российский политический деятель, один из основателей ЛДПР, депутат Государственной Думы ФС РФ первого созыва и второго созыва, заместитель председателя фракции «Либерально-демократическая партия России » в Государственной думе I и II созыва, заместитель председателя ЛДПР, член Высшего совета ЛДПР."},{"page_url":"https://de.wikipedia.org/wiki/Triangulierung_(Topologie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Delaunay_Triangulation_%28100_Points%29.svg","page_title":"Triangulierung (Topologie)","context_page_description":"In der Topologie, einem Teilgebiet der Mathematik, ist eine Triangulierung oder Triangulation eine Zerlegung eines Raumes in Simplizes."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%BB%8A%E6%A1%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Luzern_Kapellbruecke.jpg","page_title":"廊桥","context_page_description":"廊橋亦稱虹橋、蜈蚣橋等，為有頂的橋，可保護橋樑，同時亦可遮陽避雨、供人休憩、交流、聚會等作用。主要有木拱廊橋、石拱廊橋、木平廊橋、風雨橋、亭橋等。世界各地，譬如歐洲、北美、亞洲等地都有廊橋，各具特色。"},{"page_url":"https://sk.wikipedia.org/wiki/Chavenat","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Chavenat2.JPG","page_title":"Chavenat","context_page_description":"Chavenat je francúzska obec, ktorá sa nachádza v departemente Charente, v regióne Poitou-Charentes."},{"page_url":"https://en.wikipedia.org/wiki/Allied_Command_Operations","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Golden_star.svg","page_title":"Allied Command Operations","context_page_description":"Allied Command Operations is one of the two strategic commands of the North Atlantic Treaty Organization, the other being Allied Command Transformation. The headquarters and commander of ACO is Supreme Headquarters Allied Powers Europe and Supreme Allied Commander Europe, respectively."},{"page_url":"https://de.wikipedia.org/wiki/Hillsborough_(North_Carolina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Eno.jpg","page_title":"Hillsborough (North Carolina)","context_page_description":"Hillsborough ist ein Ort im und zugleich der Verwaltungssitz von Orange County, North Carolina in den Vereinigten Staaten von Amerika. Im Jahr 2000 hatte der Ort 5.446 Einwohner und eine Bevölkerungsdichte von 459 Einwohnern pro Quadratkilometer. Der Name wurde inoffiziell im Lauf der Jahre zu Hillsboro abgekürzt, aber seit den späten 1960ern wird die ursprüngliche Schreibweise wieder verwendet."},{"page_url":"https://vi.wikipedia.org/wiki/Prosopis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Arizona46.jpg","page_title":"Prosopis","context_page_description":"Prosopis là một chi thực vật có hoa trong họ Đậu."},{"page_url":"https://pl.wikipedia.org/wiki/Piotr_Szumlewicz","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Piotr_Szumlewicz.JPG","page_title":"Piotr Szumlewicz","context_page_description":"Piotr Szumlewicz – polski dziennikarz i publicysta, a także działacz związków zawodowych."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%BE%D0%B2%D1%82%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Bohyt_kunyci_2008_102_1892.jpg","page_title":"Товтри","context_page_description":"То́втри, або То́лтри — сильно розчленовані, скелясті вапнякові пасма. Це єдиний у світі гірський кряж, що з'явився не внаслідок тектонічних процесів, а утворений живими організмами."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%8F%A4%E7%94%B0%E5%AF%9B%E5%B9%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Hiroyuki_Furuta.jpg","page_title":"古田寛幸","context_page_description":"古田寛幸（1991年5月23號—）係日本足球員，司職中場，效力秋田藍閃電。"},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9ninges","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Meninges_diagram_-_fr.jpg","page_title":"Méninges","context_page_description":"Les méninges sont les membranes qui enveloppent le système nerveux central : encéphale et moelle épinière, la portion intracrânienne des nerfs crâniens et les racines des nerfs spinaux.\\nDe la surface vers la profondeur, on distingue la dure-mère, l'arachnoïde et la pie-mère.\\nDans les méninges se trouve le liquide cérébrospinal qui amortit les chocs lors des mouvements.\\nLa pie-mère est adhérente au système nerveux central. Vient ensuite l'arachnoïde, séparée de la pie-mère par l'espace subarachnoïdien, où circule le liquide céphalorachidien. Enfin, la dure-mère constitue la partie la plus superficielle, séparée de l'arachnoïde par un espace subdural ou sous-dural théorique. La dure-mère est constituée de deux feuillets : le feuillet dural interne et le feuillet dural externe. Entre ces derniers se situe le sinus veineux qui draine le sang veineux de l'encéphale, des méninges et du crâne dans les veines jugulaires internes. L'arachnoïde émet des prolongements dans la dure-mère, à proximité des sinus veineux. Il s'agit des granulations arachnoïdiennes de Pacchioni qui permettent la résorption du liquide céphalorachidien."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%84%D9%8A%D8%B3%D9%8A%D9%88_%D9%86%D9%8A%D9%83%D9%88%D9%84%D8%A7%D8%B3_%D8%A3%D9%84%D9%88%D9%86%D8%B3%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/P5237471_LISE_WIKIPWDIA.jpg","page_title":"إليسيو نيكولاس ألونسو","context_page_description":"إليسيو نيكولاس ألونسو ‏ هو نحات إسباني، ولد في 15 فبراير 1955 في Agones في إسبانيا، وتوفي في 2 يونيو 2012."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BB%8A%E5%88%A5%E7%94%BA%E5%B7%A1%E5%9B%9E%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/ImabetsuTownBus_No.539.jpg","page_title":"今別町巡回バス","context_page_description":"今別町巡回バスは、青森県東津軽郡今別町内を運行する自治体バスである。青森市営バス蟹田・三厩線の廃止代替バスとして運行している。"},{"page_url":"https://zh.wikipedia.org/zh-mo/%E8%8C%B6%E5%85%B7%E5%9B%BE%E8%B5%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Shimo.jpg","page_title":"茶具图赞","context_page_description":"《茶具圖贊》，由宋朝的審安老人撰於南宋咸淳五年，是中國第一部茶具圖譜。其中記載了十二種宋代的茶具，且不以原名稱之，而是冠以官吏之名；每幅圖附有一贊，隱喻茶具的功用與特點。"},{"page_url":"https://nl.wikipedia.org/wiki/PortableApps.com","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/PortableApps.png","page_title":"PortableApps.com","context_page_description":"PortableApps.com is een opensourceplatform voor portable software. Het platform is beschikbaar voor Windows. Draagbare applicaties maken geen wijzigingen aan het besturingssysteem en kunnen geïnstalleerd worden op draagbare media zoals een cd-rom of USB-stick. De programma's worden apart gedownload in een .paf.exe-formaat waarna deze via het menu in de suite geïntegreerd kunnen worden."},{"page_url":"https://de.wikipedia.org/wiki/Liebe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Chemical_basis_of_love.svg","page_title":"Liebe","context_page_description":"Liebe ist eine Bezeichnung für stärkste Zuneigung und Wertschätzung.\\nNach engerem und verbreitetem Verständnis ist Liebe ein starkes Gefühl, mit der Haltung inniger und tiefer Verbundenheit zu einer Person, die den Zweck oder den Nutzen einer zwischenmenschlichen Beziehung übersteigt und sich in der Regel durch eine entgegenkommende tätige Zuwendung zum anderen ausdrückt. Das Gefühl der Liebe kann unabhängig davon entstehen, ob es erwidert wird oder nicht. Hierbei wird zunächst nicht unterschieden, ob es sich um eine tiefe Zuneigung innerhalb eines Familienverbundes oder um eine Geistesverwandtschaft handelt oder aber um ein körperliches Begehren gegenüber einem anderen Menschen. Dieses Begehren ist als körperliche Liebe eng mit der Sexualität verbunden, die jedoch nicht unbedingt auch ausgelebt zu werden braucht.\\nLiebe wird von der zeitlich begrenzten Phase der Verliebtheit unterschieden. „Die erste Liebe, sagt man mit Recht, sei die einzige: denn in der zweiten und durch die zweite geht schon der höchste Sinn der Liebe verloren. Der Begriff des Ewigen und Unendlichen, der sie eigentlich hebt und trägt, ist zerstört, sie erscheint vergänglich wie alles Wiederkehrende“."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D8%B4%D9%84%D9%88%D9%84_%D9%88%D8%A8%D9%84%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Webleypocket.jpg","page_title":"ششلول وبلی","context_page_description":"ششلول وبلی اسلحه کمری سازمانی امپراتوری بریتانیا و اتحادیه کشورهای همسود میان سال‌های ۱۸۸۷ تا ۱۹۶۳ میلادی بود.\\nاز لحاظ مکانیزم پر کردن، وبلی به صورت کمرشکن باز شده و با باز شدن ناخن فشنگ‌کش پوکه‌ها را خالی می‌کرد. مشهورترین نسخه این سلاح ام‌کی ۶ بود که در سال ۱۹۱۵ و در خلال جنگ جهانی اول تولید شد."},{"page_url":"https://en.wikipedia.org/wiki/Pearl_River_(Mississippi%E2%80%93Louisiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Pearl_River_backwater_in_Mississippi.jpg","page_title":"Pearl River (Mississippi–Louisiana)","context_page_description":"The Pearl River is a river in the U.S. states of Mississippi and Louisiana. It forms in Neshoba County, Mississippi from the confluence of Nanih Waiya and Tallahaga creeks. and has a meander length of 444 miles. The lower part of the river forms part of the boundary between Mississippi and Louisiana. The river watershed contains large areas of bottomland hardwood swamp and cypress swamp, providing habitat for many species of wildlife, including sturgeon and black bears. As recently as 2008, endangered Ivory-billed woodpeckers were reportedly sighted here. The mouth of the river creates important marsh habitat along salinity gradients; these marshes have been the subject of many scientific studies. It is considered to be one of the most critical areas of natural habitat remaining in Louisiana.\\nMississippi‘s capital and largest city, Jackson, is located along the upper reaches of the river. Most of the towns along the river, starting with Philadelphia, Mississippi in the north, are within the boundaries of that state."},{"page_url":"https://de.wikipedia.org/wiki/Marama_Vahirua","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Marama_Vahirua_2008.jpg","page_title":"Marama Vahirua","context_page_description":"Marama Vahirua ist ein französisch-tahitischer Fußballspieler und Technischer Leiter des tahitischen Fußballverbands."},{"page_url":"https://en.wikipedia.org/wiki/Thunderbird_(train)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fb/Thunderbird_express.jpg","page_title":"Thunderbird (train)","context_page_description":"The Thunderbird is a limited express train service operated by the West Japan Railway Company between Osaka and Kanazawa\\nor Wakuraonsen in Japan, using portions of the Tokaido Main Line, Kosei Line, Hokuriku Main Line, IR Ishikawa Railway Line, and Nanao Line."},{"page_url":"https://en.wikipedia.org/wiki/Johnson_Grammar_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Johnson_Grammar_School_basketball_court.jpg","page_title":"Johnson Grammar School","context_page_description":"Johnson Grammar School is a private school in Nacharam, Hyderabad, India. It was established in 1974 by the late Mr.S.R.N Mudiraj. It is now administered by B Suresh"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/John_(Eng-l%C3%A2n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Jan_tomb.jpg","page_title":"John (Eng-lân)","context_page_description":"John sī Eng-lân ê kok-ông, chāi-ûi kî-kan sī 1199 nî 4 goe̍h 6 ji̍t kàu 1216 nî 10 goe̍h 19 ji̍t."},{"page_url":"https://fr.wikipedia.org/wiki/Dominique_Boschero","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Dominique_Boschero_73.jpg","page_title":"Dominique Boschero","context_page_description":"Dominique Boschero est une actrice française née le 27 avril 1937 à Paris. Elle est la sœur de l'acteur et producteur de cinéma Martial Boschero."},{"page_url":"https://sv.wikipedia.org/wiki/Chrysolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Chrysolina_numida_Reiche%2C_1864_%283502036144%29.jpg","page_title":"Chrysolina","context_page_description":"Chrysolina är ett släkte av skalbaggar som beskrevs av Victor Ivanovitsch Motschulsky 1860. Chrysolina ingår i familjen bladbaggar.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://de.wikipedia.org/wiki/Eggenfelden","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Gern_%28Sch%C3%BCtzenhaus%29.jpg","page_title":"Eggenfelden","context_page_description":"Eggenfelden ist einwohnerbezogen die größte Stadt sowie das wirtschaftliche Zentrum im niederbayerischen Landkreis Rottal-Inn in Bayern."},{"page_url":"https://eo.wikipedia.org/wiki/Allhartsberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/2011.12.11_-_Allhartsberg_Pfarrkirche_-_01.jpg","page_title":"Allhartsberg","context_page_description":"Allhartsberg [ALhartsberk] estas komunumo de Aŭstrio. Ĝi apartenas al la federacia lando Malsupra Aŭstrio kaj al la distrikto Amstetten. Komence de la jaro 2016 en la komunumo vivis 2 109 loĝantoj."},{"page_url":"https://fr.wikipedia.org/wiki/Tophet_de_Carthage","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Tunisise_Carthage_Tophet_Salambo_03.JPG","page_title":"Tophet de Carthage","context_page_description":"Le tophet de Carthage, aussi appelé tophet de Salammbô, est une ancienne aire sacrée dédiée aux divinités phéniciennes Tanit et Baal situé dans le quartier carthaginois de Salammbô, en Tunisie, à proximité des ports puniques. Ce tophet, « hybride de sanctuaire et de nécropole », regroupe un grand nombre de tombes d'enfants qui, selon les interprétations, auraient été sacrifiés ou inhumés en ce lieu après leur mort prématurée. Le périmètre est rattaché au site archéologique de Carthage classé au patrimoine mondial de l'Unesco.\\nLa question du sort de ces enfants est fortement liée à la religion phénicienne et punique mais surtout à la manière dont les rites religieux — et au-delà la civilisation phénicienne et punique — ont été perçus par les Juifs dans le cas des Phéniciens ou par les Romains à l'occasion des conflits qui les opposèrent aux Puniques."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%8C%B6%E5%A4%AA%E6%88%B0%E9%AC%A5%E7%B5%84%E7%B9%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Flag_of_ZOB_%28Jewish_Fighting_Organization%29.svg","page_title":"猶太戰鬥組織","context_page_description":"犹太战斗组织是波兰犹太民族对抗犹太人大屠杀行动的秘密战斗组织，也是二次大战期间犹太武装抵抗运动中最知名的一支，其武力来自波兰救国军及人民保卫队。政治上，波兰政府代表团与波兰工党都承认犹太战斗组织为犹太区里的犹太民族战斗组织。\\n犹太战斗组织在政治上隶属于1942年10月15日设立的国家犹太委员会，间接属于波兰政府代表团。其主要活动为在犹太区内建立崩得，在区内进行征收，包括抢夺犹太委员会财库及犹太区银行，好取得购买所须武器之金钱。该组织将武器运入区内囤积，大肆宣传抵抗理念，对抗潜入抵抗行动中的通敌犹太成员，将亲敌或通敌分子肃清处死。不久，这个地下组织便从犹太委员会手中接过权力，实质统治犹太区。1943年1月，犹太战斗组织移除了犹太区内的反动势力，甚至逼退了当时的德国人。"},{"page_url":"https://fr.wikipedia.org/wiki/Laas_Geel","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Laas_Geel_cow_herd.jpg","page_title":"Laas Geel","context_page_description":"Laas Geel, ou Laas Gaal, parfois écrit Las Geel, est un ensemble d'abris sous roches ornés datant du Néolithique. Ils sont situés à mi-chemin entre Hargeisa et Berbera, au Somaliland. Ce site préhistorique, dont les peintures seraient vieilles de 5 000 à 4 000 ans, est le plus important foyer d'art rupestre de la corne de l'Afrique."},{"page_url":"https://he.wikipedia.org/wiki/Girls_Aloud","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Girls_Aloud_at_Rock_On%21_by_David_Jones.jpg","page_title":"Girls Aloud","context_page_description":"Girls Aloud היא להקת בנות בריטית שנוצרה בתוכנית המציאות \\"Popstars: The Rivals\\" בשנת 2002. הלהקה, שחברותיה הן שריל קול, נדין קויל, שרה הרדינג, ניקולה רוברטס וקימברלי וולש, הפכה לאחת מלהקות הבריטיות המצליחות ביותר בעשור, כולל שבירת שיא בשל הכנסת 20 סינגלים ברצף לעשרת המובילים במצעדי הפזמונים הבריטיים. הלהקה מכרה יותר מארבעה מיליון עותקים מאלבומיה, ועל-פי גינס, זוהי להקת הבנות המצליחה ביותר שנוצרה מתוכנית מציאות.\\nללהקה מספר הישגים כגון להקת הבנות הכי מצליחה בעשור, להקת הבנות בעלת מספר הסינגלים הרב ביותר בטופ 10 - 21 שירים.\\nבבריטניה מכרה להקה יותר מ-4.3 מיליון סינגלים, ו-4 מיליון אלבומים כאשר האוסף האחרון \\"עשר\\" מכר רק 156,000.\\nבארצות הברית הלהקה אינה מוכרת אך מכרה 80,000 אלף שירים וכ-8000 אלבומים דרך הורדות חוקיות.\\nב-20 במרץ 2013, הכריזו בנות הלהקה על הפירוקה באופן רשמי דרך הטוויטר."},{"page_url":"https://en.wikipedia.org/wiki/San_Antonio_Springs","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/SanAntonioSprings04.JPG","page_title":"San Antonio Springs","context_page_description":"San Antonio Springs is a cluster of springs in Bexar County, Texas. These springs provide a large portion of the water for the San Antonio River, which flows from San Antonio to the Gulf of Mexico. The San Pedro Springs also feed into the San Antonio River."},{"page_url":"https://et.wikipedia.org/wiki/Isomorfismiprobleem","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Equivalence.jpg","page_title":"Isomorfismiprobleem","context_page_description":"Isomorfismiprobleemiks nimetatakse ülesannet konstrueerida efektiivne algoritm, mis antud klassi kahe suvalise algebralise süsteemi korral selgitab, kas nad on isomorfsed või mitte.\\nIsomorfismiprobleemi on rühmateooria seisukohalt käsitlenud C. Hoffman väites, et rühmade \\"struktuur\\" sarnanevat isomorfismiprobleemiga. Paraku jääb see sarnasus kõrvaltvaatajale raskelt tabatavaks. See probleem on seni lahendamata paljude oluliste algebra klasside puhul."},{"page_url":"https://it.wikipedia.org/wiki/Piero_Sraffa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Carlo_Rosselli_1.jpg","page_title":"Piero Sraffa","context_page_description":"Piero Sraffa è stato un economista italiano."},{"page_url":"https://es.wikipedia.org/wiki/Modelo_Brander%E2%80%93Spencer","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Brender_spencer.JPG","page_title":"Modelo Brander–Spencer","context_page_description":"El modelo Brander–Spencer es un modelo económico sobre el comercio internacional, desarrollado originalmente por James Brander y Barbara Spencer a inicios de los años 1980. El modelo ilustra una situación donde, bajo ciertos supuestos, un gobierno puede subsidiar a las empresas domésticas o nacionales para ayudarlas frente a la competencia de productores extranjeros y, al hacerlo, aumentar el bienestar nacional. Esta conclusión contrasta con los resultados de la mayor parte de modelos de comercio internacional, en los cuales la no interferencia gubernamental es socialmente óptima.\\nEl modelo básico es una variación del juego de duopolio \\"líder y seguidor\\" Stackelberg-Cournot. Por otra parte, el modelo puede ser interpretado en términos de la teoría de juegos inicialmente como un juego con múltiples equilibrios de Nash, con el gobierno con la capacidad de afectar los pagos para cambiar a un juego con solo un equilibrio.​"},{"page_url":"https://eo.wikipedia.org/wiki/Ora_medalo_de_CNRS","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Claude_Hag%C3%A8ge.jpg","page_title":"Ora medalo de CNRS","context_page_description":"La ora medalo de CNRS estas la plej alta franca scienca premio, kiun la instituto de la CNRS atribuas. Ekde 1954, tiu distingo ĉiujare honoras la laboraron de mondfama sciencisto, kiu eksterordinare kontribuas al la progresado de la scienca esplorado."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%95%D1%83%D0%B3%D0%B5%D0%BD%D0%B8%D1%8F_%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D0%BD%D0%B8%D1%86%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Eug%C3%A9nie_Sokolnicka.jpeg","page_title":"Еугения Соколницка","context_page_description":"Еугѐния Соколнѝцка или Йожени Соколницка, с моминско име Кутнер е полско-френски психоаналитик, основател на Парижкото психоаналитично общество."},{"page_url":"https://hr.wikipedia.org/wiki/Zemljopis_Burkine_Faso","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Burkina_Faso_Map.jpg","page_title":"Zemljopis Burkine Faso","context_page_description":"Burkina Faso je kopnena Sahel zemlja koja graniči s šest država. Nalazi se između pustinje Sahare i Gvinejskog zaljeva, južno od rijeke Niger.\\nJužni dio zemlje je zelen prekriven šumama i voćnjacima, dok je sjever prekriven pustinjom. Većina središnje Burkine Faso leži na platou savane na nadmorskoj visini od 198 do 305 metara, s poljima, grmljem i raštrkanim stablima. Velika područja države su zaštićena u kojima obitavaju lavovi, slonovi, nilski konji, majmuni, bradavičaste svinje i antilope. Zadnji primjerci afričkog divljeg psa zabilježeni su u Nacionalnom parku Arli, sada se smatra da je vrsta istrebljena u Burkini Faso."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Karelia_Ki%C5%8Dng-h%C3%B4-kok","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Karelia_in_Russia.svg","page_title":"Karelia Kiōng-hô-kok","context_page_description":"Karelia Kiōng-hô-kok sī Lō͘-se-a Liân-pang ê 1 ê Chū-tī Kiōng-hô-kok."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D1%81%D0%B0%D0%B2%D1%86%D1%96%D0%B2_%D0%9F%D1%96%D0%B2%D0%BD%D1%96%D1%87%D0%BD%D0%BE%D1%97_%D0%90%D1%84%D1%80%D0%B8%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/uk/3/38/Africa-northern-iucn.png","page_title":"Список ссавців Північної Африки","context_page_description":"Список ссавців Північної Африки містить перелік із 188 видів ссавців, записаних на території Північної Африки згідно з МСОП, а саме на території таких країн: Алжир, Єгипет, Лівія, Марокко, Туніс, Західна Сахара. У список не включені свійські тварини, регіонально зниклі види, а також види, зареєстровані на островах, що належать Іспанії та Португалії."},{"page_url":"https://fr.wikipedia.org/wiki/Justus_Carl_Hasskarl","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Acta_Horti_berg._-_1905_-_tafl._132_-_Julius_Carl_Hasskarl.jpg","page_title":"Justus Carl Hasskarl","context_page_description":"Justus Carl Hasskarl, est un explorateur et botaniste allemand, qui séjourna à Java et au Pérou. Un genre d'Euphorbiacées lui a été dédié : Hasskarlia."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Old_Abingdonians","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Robin_Bourne-Taylor.jpg","page_title":"List of Old Abingdonians","context_page_description":"Old Abingdonians are former pupils of Abingdon School or, in some cases, Honorary Old Abingdonians who have been awarded the status based on service to the School. The Old Abingdonians also run the Old Abingdonian Club which is an organisation hosted by the school. It was founded in 1743."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDichlice","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Hromnice%2C_T%C5%99emo%C5%A1n%C3%A1_River.jpg","page_title":"Žichlice","context_page_description":"Žichlice je vesnice v jihovýchodní části okresu Plzeň-sever, část obce Hromnice, 5,5 km severovýchodně od Třemošné. Katastrální území Žichlice u Hromnic zaujímá plochu 781 ha a PSČ všech adres je 330 11. V roce 2011 zde trvale žilo 379 obyvatel.\\nŽichlice sousedí na severovýchodě s Chotinou, na východě s Nynicemi, na jihu s Dolany, na jihozápadě s Zručí-Sencem, na západě s Českou Břízou a na severozápadě s Hromnicemi. Na severním okraji vsi protéká říčka Třemošná."},{"page_url":"https://en.wikipedia.org/wiki/Diethyl_dithiophosphoric_acid","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Diethyl-dithiophosphoric-acid-from-AHRLS-2011-3D-balls.png","page_title":"Diethyl dithiophosphoric acid","context_page_description":"Diethyl dithiophosphoric acid, sometimes mistakenly called diethyl dithiophosphate, is the organophosphorus compound with the formula (C₂H₅O)₂PS₂H. It is the processor for production of the organophosphate insecticide Terbufos. Although samples can appear dark, it is a colorless liquid.\\nIt is prepared by treating phosphorus pentasulfide with ethanol:\\nP₂S₅ + 4 C₂H₅OH → 2 (C₂H₅O)₂PS₂H + H₂S"},{"page_url":"https://it.wikipedia.org/wiki/Charitum_Montes","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Charitum_Montes_Gullies.JPG","page_title":"Charitum Montes","context_page_description":"I Charitum Montes sono una struttura geologica della superficie di Marte."},{"page_url":"https://de.wikipedia.org/wiki/Fu%C3%9Fsohle_(Felsritzung)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Scotland_Dunadd_1.jpg","page_title":"Fußsohle (Felsritzung)","context_page_description":"Fußsohlen sind ein häufiges Bildelement in Felsritzungen der Nordischen Bronzezeit. Es gibt sie als Petrosomatoglyphen, hauptsächlich von Händen und Fußsohlen. Im Gegensatz zu den seit der Altsteinzeit in Höhlenmalereien bekannten Hand-Darstellungen sind Fußsohlen ein erst deutlich später erscheinendes Motiv auf Felsbildern. Sie treten frühestens in der Jungsteinzeit in Norwegen und Schweden auf, gesichert und in großer Zahl erst in der Nordischen Bronzezeit, dann auch in England."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%95%D7%93_%D7%A8%D7%96%D7%99%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/PikiWiki_Israel_12301_david_raziel_grave_on_mouht_herzl.jpg","page_title":"דוד רזיאל","context_page_description":"דוד רזיאל, \\"האלוף בן ענת\\", היה ממייסדי האצ\\"ל ומפקדו הרביעי ונציב בית\\"ר בארץ ישראל. נהרג בעיראק בשליחות צבאית מטעם בריטניה."},{"page_url":"https://en.wikipedia.org/wiki/Saint_George%27s_Church,_Tbilisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Sayat_Nova_memorial.jpg","page_title":"Saint George's Church, Tbilisi","context_page_description":"Saint George's Church is a 13th-century Armenian church in the old city of Tbilisi, Georgia's capital. It is one of the two functioning Armenian churches in Tbilisi and is the cathedral of the Georgian Diocese of the Armenian Apostolic Church. It is located in the south-western corner of Vakhtang Gorgasali Square and is overlooked by the ruins of Narikala fortress."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AA%D9%88%D9%85_%D9%83%D8%A7%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Tom_Carey_1940_Play_Ball.jpeg","page_title":"توم كارى","context_page_description":"توم كارى كان لاعب بيسبول من امريكا."},{"page_url":"https://cs.wikipedia.org/wiki/Krom%C4%9B%C5%99%C3%AD%C5%BEsk%C3%A9_pam%C4%9Btn%C3%AD_desky","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/LorencFM.JPG","page_title":"Kroměřížské pamětní desky","context_page_description":"Kroměřížské pamětní desky uvádí seznam pamětních desek a památníků, které se v tomto městě nacházejí."},{"page_url":"https://en.wikipedia.org/wiki/Yana_Mulyana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Vice_Mayor_of_Bandung_Yana_Mulyana.jpg","page_title":"Yana Mulyana","context_page_description":"H. Yana Mulyana, S.E. is an entrepreneur, businessman, and politician who is the current Vice Mayor of Bandung period 2018–2023, accompanying the Mayor of Bandung, Oded Muhammad Danial.\\nBefore he serves as Vice Mayor of Bandung, Yana is known as a successful entrepreneur. He also owns a property business and several other business lines. He is also the founder of Radio Rase FM. Yana's work at Rase FM began in 1987 when he continued the licensing process for the establishment of Radio Rase, which had previously been delayed."},{"page_url":"https://bar.wikipedia.org/wiki/Gmoana_in_Griachaland","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/2011_Dimos_Egialias.png","page_title":"Gmoana in Griachaland","context_page_description":"Des is a Listn vo de Gmoana vo Griachaland."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2017/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/DonnaWilliams2011.jpg","page_title":"Lijst van personen overleden in 2017/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2017.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D8%AF_%D9%87%D8%A7%D8%AF%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Brad_Haddin_at_Test_2010.jpg","page_title":"براد هادين","context_page_description":"براد هادين لاعب كريكت من اوستراليا."},{"page_url":"https://en.wikipedia.org/wiki/TVR","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Tvrtuscan.jpg","page_title":"TVR","context_page_description":"TVR is a British manufacturer of high-end sports cars. The company manufactures lightweight sports cars with powerful engines and was, at one time, the third-largest specialised sports car manufacturer in the world, offering a diverse range of coupés and convertibles."},{"page_url":"https://hu.wikipedia.org/wiki/Modul_programtervez%C3%A9si_minta","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Module-software-design-pattern.png","page_title":"Modul programtervezési minta","context_page_description":"A szoftverfejlesztésben a modul minta egy olyan programtervezési minta, amit a moduláris programozásban definiált szoftver modulok létrehozására használnak egy olyan programozási nyelven, ami nem rendelkezik teljes támogatással a modul koncepció megvalósítására.\\nA minta több különböző módon is implementálható, a konkrét programozási nyelvtől függően, mint például az egyke minta, az objektumorientált nyelvek osztályaiban a statikus tagok vagy a procedurális nyelvek globális függvényei. A Python nyelvben a modul minta egy beépített tulajdonság, minden .py kiterjesztésű fájl automatikusan egy-egy modul is."},{"page_url":"https://en.wikipedia.org/wiki/Hal_Gill","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Hal_Gill_2008.jpg","page_title":"Hal Gill","context_page_description":"Harold Priestley Gill III is a retired American professional ice hockey defenseman who played 16 NHL seasons with six different teams, winning the Stanley Cup with the Pittsburgh Penguins in 2009.\\nHe also played for the Boston Bruins, Toronto Maple Leafs, Montreal Canadiens, Nashville Predators and Philadelphia Flyers. Gill was formerly manager of player development for the Florida Panthers.\\nHe is currently the radio color commentator for the Predators on the Nashville Predators Radio Network."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%97%A5%E6%99%B7%E7%9A%84%E6%AD%B7%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/SunDialAiKhanoum.jpg","page_title":"日晷的歷史","context_page_description":"日晷是以太阳的位置来测量时间的装置，它测量的是所在地的太阳时。在铁路出现之前的1830年代和1840年代，地方时由政府或商业机构建造的日晷来显示。"},{"page_url":"https://en.wikipedia.org/wiki/Henri_Delavall%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Delavall%C3%A9e_Maisons_en_Bretagne.jpg","page_title":"Henri Delavallée","context_page_description":"Henri Delavallée was a French Post-Impressionist painter who became a member of the artists colony in Pont-Aven."},{"page_url":"https://ca.wikipedia.org/wiki/Line_dance","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Line_Dancing.jpg","page_title":"Line dance","context_page_description":"El line dance és una tipus de dansa on un grup de gent balla alineats els uns als altres, i tots ells fan els mateixos moviments individualment."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%B8%D6%82%D6%80%D5%BF%D5%B6%D5%AB%D5%A5%D5%AF%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Asti_ordulinnuse_m%C3%BC%C3%BCrid_02.JPG","page_title":"Բուրտնիեկի","context_page_description":"Բուրտնիեկի, գյուղ Լատվիայի հյուսիսում, վարչական կենտրոնը գտնվում է Բուրտնիեկսիի շրջանում: Քաղաքը գտնվում է Բուրտնիեկու լճի հարավային ափին: Մինչև 2009 թվականի հուլիսի 1-ը քաղաքը գտնվում էր Վալմիերսկիի շրջանում:\\nՎալմիերա քաղաքից հեռավորությունը կազմում է ընդամենը 24 կմ:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B6%D0%B8%D0%BC%D0%B8_%D0%B1%D0%BB%D0%BE%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D1%88%D0%B8%D1%84%D1%80%D1%83%D0%B2%D0%B0%D0%BD%D0%BD%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Ctr_encryption.png","page_title":"Режими блочного шифрування","context_page_description":"У криптографії, режими дії — це математичні операції для уможливлення повторюваного і убезпеченого використання блочного шифру з одним ключем.\\nБлочний шифр дозволяє шифрування тільки одного блоку даних встановленої довжини. Для роботи з блоками різних довжин, дані спочатку потрібно розбити на окремі блоки встановленої даним шифром довжини. Зазвичай, останній блок треба доповнити до відповідної довжини підхожим доповненням. Режими дій описують процес шифрування кожного з цих блоків і звичайно використовують рандомізацію основану на додатковому значені на вході, відомим як ініціалізаційний вектор, з ціллю зробити це безпечно.\\nРежими дії первісно були розроблені для шифрування й автентифікації.\\nІсторично, режими шифрування широко вивчались зважаючи на їх властивості поширення помилок при різних сценаріях зміни даних. Подальший розвиток поставив цілісність інформації як цілком окрему від шифрування ціль криптографії. Деякі сучасні режими дії поєднують шифрування і автентифікацію ефективним чином, і відомі як режими автентифікованого шифрування."},{"page_url":"https://eo.wikipedia.org/wiki/Jacques-Yves_Cousteau","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Cousteau1972_%28cropped%29.jpg","page_title":"Jacques-Yves Cousteau","context_page_description":"Jacques-Yves COUSTEAU [ĵak iv kusto] aŭ la komandanto Cousteau estis oficiro de la franca ŝiparo, oceanografisto, kaj internacie konata kiel komandanto de la ŝipo Kalipso. Lia identigilo en liaj filmoj estis ruĝa lanĉapo."},{"page_url":"https://vi.wikipedia.org/wiki/S%C3%BAng","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Bullet.svg","page_title":"Súng","context_page_description":"Súng là một loại vũ khí dùng sức đẩy của thuốc phóng để phóng/bắn đạn tới mục tiêu; được trang bị cho cá nhân hoặc một nhóm sử dụng. Loại vũ khí có nguyên tắc cấu tạo như súng nhưng lớn hơn về kích thước nòng súng, đạn, tầm bắn, phương pháp xạ kích... được gọi là pháo, theo quy ước trong kỹ thuật vũ khí, cỡ nòng nhỏ hơn 20 mm gọi là súng, còn lớn hơn gọi là pháo, tuy nhiên có các trường hợp ngoại lệ, ví dụ B40, B41 cỡ nòng 30 mm, cối 60 mm... vẫn gọi là súng...\\nSúng được phân loại theo kích thước; số lượng nòng; kết cấu nòng; đặc tính cấu tạo; mức độ tự động hoá; tính năng tác dụng...\\nTrước đây, người ta dùng nỏ và cung để bắn tên hay đạn đến mục tiêu, tuy nhiên, ngày nay nhiều thứ nỏ vẫn được gọi là súng, như \\"súng cao su\\", hay các ống phụt dùng làm công cụ cũng được gọi là súng, như \\"súng bắn đinh\\". Loại dùng trong quân sự như súng phun lửa có lúc cũng không phải là súng đúng nghĩa.\\nTuy có nhiều loại súng, nhưng nhiều hơn cả là loại súng dùng thuốc phóng phóng đạn từ một cái ống, gọi là \\"nòng\\". Nòng súng có tác dụng chắn khí áp cao và định hướng đạn đi chính xác."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Radebeul-Niederl%C3%B6%C3%9Fnitz_(M%E2%80%93Z)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Obere_Bergstra%C3%9Fe_7_Radebeul.JPG","page_title":"Liste der Kulturdenkmale in Radebeul-Niederlößnitz (M–Z)","context_page_description":"Die Liste der Kulturdenkmale in Radebeul-Niederlößnitz (M–Z) gibt eine Übersicht über die Kulturdenkmale im Stadtteil Niederlößnitz der sächsischen Stadt Radebeul anhand des Stands der Denkmalliste vom 24. Mai 2012. Aufgrund der Größe der Liste wurden die Straßen auf zwei Teile verteilt.\\nEine weitere Liste zeigt ehemalige Bau-/Kulturdenkmale dieses Stadtteils.\\nEinen Überblick über die Radebeuler Kulturdenkmale gibt die Liste der Kulturdenkmale in Radebeul, eine Zusammenfassung aller Adressen mit Kulturdenkmalen gibt die Liste der Kulturdenkmaladressen in Radebeul. Die Zuordnung der Straßen zum Stadtteil findet sich in der Liste der Straßen und Plätze in Radebeul-Niederlößnitz.\\nGrundlage der Auflistung sind die angegebenen Quellen. Diese Angaben ersetzen nicht die rechtsverbindliche Auskunft der zuständigen Denkmalschutzbehörde."},{"page_url":"https://sv.wikipedia.org/wiki/Arhopala_achelous","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/ArhopalaAchelousHew1862MUpUnAC1.jpg","page_title":"Arhopala achelous","context_page_description":"Arhopala achelous är en fjärilsart som beskrevs av William Chapman Hewitson 1862. Arhopala achelous ingår i släktet Arhopala och familjen juvelvingar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Manaurie","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Map_commune_FR_insee_code_24249.png","page_title":"Manaurie","context_page_description":"Manaurie es una población y comuna francesa, situada en la región de Aquitania, departamento de Dordoña, en el distrito de Sarlat-la-Canéda y cantón de Le Bugue."},{"page_url":"https://eo.wikipedia.org/wiki/Su%C4%9Do","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%9C.%D0%A1_%D0%A9%D0%B5%D0%BF%D0%BA%D0%B8%D0%BD%D1%83..JPG","page_title":"Suĝo","context_page_description":"Suĝo estas urbo en Kurska provinco en Rusio.\\nKodo de OKATO de la urbo estas 38240501.\\nLa urbo estis fondita en la 17-a jarcento.\\nLa interurba telefona kodo estas 07143, 47143, la enurbaj telefonnumeroj estas kvinciferaj.\\nLa loka tempo estas la sama kiel moskva tempo.\\nLa urbo estas ĉe riveroj Suĝa kaj Oloŝnja, 3 km for de fervoja stacio kun la sama nomo kiel la urbo.\\nEn jaro 1959 la urbo havis 4 mil loĝantojn.\\nEn jaro 2002 la urbo havis 7 mil loĝantojn."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1980","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Mariacarla_Boscono.jpg","page_title":"Lijst van personen geboren in 1980","context_page_description":"Dit is een lijst van personen die geboren zijn in 1980.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_im_12._Arrondissement_(Paris)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/EGGareLyon.JPG","page_title":"Liste der Monuments historiques im 12. Arrondissement (Paris)","context_page_description":"Die Liste der Monuments historiques im 12. Arrondissement (Paris) führt die Monuments historiques im 12. Arrondissement der französischen Hauptstadt Paris auf."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D1%83%D0%B7%D0%BE%D0%BA_%D0%95%D0%BC%D0%BE%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Himalaya-Flieder.jpg","page_title":"Бузок Емода","context_page_description":"Бузок Емода — кущова рослина, вид роду бузок родина маслинові."},{"page_url":"https://en.wikipedia.org/wiki/Guliakhali_Beach","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Herons_on_a_small_boat_in_guliakhali_sea_beach_19-01-2019.jpg","page_title":"Guliakhali Beach","context_page_description":"Guliakhali sea beach is one of the lesser known beaches of Bangladesh. It is also known as Muradpur beach to the local people. The beach is full of greenery, which makes it special."},{"page_url":"https://it.wikipedia.org/wiki/Jorn","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/Metalmania_2007_-_J%C3%B8rn_Lande_02.jpg","page_title":"Jorn","context_page_description":"Gli Jorn sono un gruppo heavy metal norvegese."},{"page_url":"https://en.wikipedia.org/wiki/50th_Golden_Globe_Awards","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Joan_Plowright_1960_%28cropped%29.jpg","page_title":"50th Golden Globe Awards","context_page_description":"The 50th Golden Globe Awards, honoring the best in film and television for 1992, were held on Saturday January 23, 1993 at the Beverly Hilton. The nominations were announced on December 29, 1992."},{"page_url":"https://en.wikipedia.org/wiki/List_of_equestrian_statues_in_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/G%C3%A9n%C3%A9ral_Faidherbe_Lille_12018_3.jpg","page_title":"List of equestrian statues in France","context_page_description":"This is a list of equestrian statues in France."},{"page_url":"https://hu.wikipedia.org/wiki/Tigriscs%C3%ADkos_r%C3%B3zsa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Tealia_felina.jpg","page_title":"Tigriscsíkos rózsa","context_page_description":"A tigriscsíkos rózsa a virágállatok osztályának a tengerirózsák rendjébe, ezen belül az aktíniák családjába tartozó faj."},{"page_url":"https://nn.wikipedia.org/wiki/H%C3%A4llefors_kommun","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/H%C3%A4llefors_kyrka.jpg","page_title":"Hällefors kommun","context_page_description":"Hällefors kommun er ein kommune i nordvestre delen av Örebro län i landskapet Västmanland. Kommunesenteret er Hällefors og nest største stad er Grythyttan. Kommunen grensar i vest mot Filipstads kommun og i nors mot Ludvika kommun.\\nKommunen samarbeider i ulike lokale konstellasjonar med både Värmlandshållet og Bergslagen, mellom anna med inntilliggande kommunar i KNÖL-gruppen, Nora, Ljusnarsberg og Lindesberg. For brannforsvar skjer samarbeidet vestover og til i ein viss grad òg i turistspørsmål."},{"page_url":"https://en.wikipedia.org/wiki/E._Irving_Couse","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Sierra_Vista_Cemetery_7.jpg","page_title":"E. Irving Couse","context_page_description":"Eanger Irving Couse was an American artist and a founding member and first president of the Taos Society of Artists. Born and reared in Saginaw, Michigan, he went to New York City and Paris to study art. While spending summers in Taos, he began to make the paintings of Native Americans, New Mexico, and the American Southwest for which he is best known. He later settled full time in Taos.\\nHis house and studio in Taos have been preserved as the Eanger Irving Couse House and Studio—Joseph Henry Sharp Studios. The complex is listed on the National Register of Historic Places and the New Mexico Register of Cultural Properties. His work was also part of the art competitions at the 1928 Summer Olympics and the 1932 Summer Olympics."},{"page_url":"https://lt.wikipedia.org/wiki/Vilniaus_oro_uostas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/FlyLAL_technics_hangar_at_Vilnius_airport.JPG","page_title":"Vilniaus oro uostas","context_page_description":"Vilniaus oro uostas – didžiausias civilinis oro uostas Lietuvoje, įsikūręs Vilniaus pietinėje dalyje, Naujininkų seniūnijoje ant plynaukštės, apie 7 km nuo Vilniaus centro. Vieną pakilimo taką turintis oro uostas 2019 m. aptarnavo 5,0 mln. keleivių. Čia veikia „airBaltic“, „Ryanair“ ir „Wizz Air“ orlaivių aptarnavimo bazės. Valdomas valstybinės įmonės Lietuvos oro uostai."},{"page_url":"https://cs.wikipedia.org/wiki/Ludwig_van_Beethoven","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Beethoven_Hornemann.jpg","page_title":"Ludwig van Beethoven","context_page_description":"Ludwig van Beethoven byl německý hudební skladatel, dovršitel první vídeňské školy klasicistní hudby. V průběhu svého života rozvinul klasicistní slohové a formové prostředky do svého individuálního hudebního stylu a otevřel tak dveře nové hudební epoše – romantismu.\\nK jeho nejslavnějším dílům patří 3., 5., 6., 7. a 9. symfonie, monumentální mše Missa solemnis, opera Fidelio, houslový koncert D dur op. 61, řada klavírních skladeb a další skladby."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%BE%B3%E9%96%80%E5%B7%B4%E5%A3%AB31T%E8%B7%AF%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/TCM_1050_31T.jpg","page_title":"澳門巴士31T路線","context_page_description":"澳门巴士31T路线是一条由澳门公共汽车有限公司经营，往返综艺馆和外港码头的巴士路线。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1883","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Victor_Puiseux_par_Pirou.JPEG","page_title":"Lijst van personen overleden in 1883","context_page_description":"Dit is een lijst van personen die overleden zijn in 1883.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ca.wikipedia.org/wiki/18%C3%A8_districte_de_Par%C3%ADs","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Paris_18th_arrondissement_map_with_listings_2.png","page_title":"18è districte de París","context_page_description":"El 18è districte és un dels vint districtes de París, França. Es troba a la riba dreta del Sena. amb una àrea de 6,005 km² és s especialment cèlebre perquè conté el districte de Montmartre, amb una cota dominada per la Basílica del Sacré Cœur, així com el famós Moulin Rouge.\\nEl 18è districte també conté el barri africà i nord-africà de la Goutte d'Or, famós pel seu mercat, el marché Barbès, en què es poden comprar productes africans.\\nEl 18è districte va assolir la seva població màxima el 1931, quan tenia 288.810 habitants. Des d'aleshores, ha perdut una mica més de cent mil habitants. A l'últim cens, la població era de 184.586 habitants, i comptava amb 70.285 llocs de treball."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%84%D9%81%D8%A7%D8%B1%D8%A7%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Alvarado_gazebo.JPG","page_title":"ألفارادو","context_page_description":"ألفارادو ‏ هي مدينة أمريكية تقع في ولاية تكساس.تبلغ مساحة هذه المدينة 10.1،ويبلغ عدد سكانها 4289 نسمة حسب إحصاء سنة 2010 م. تشير إحصاءات سنة 2000م بأن الكثافة السكانية في هذه المدينة تقدر بـ نسمة/كم2."},{"page_url":"https://en.wikipedia.org/wiki/Hirtstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Hirtstein_von_S%C3%BCdosten.JPG","page_title":"Hirtstein","context_page_description":"Hirtstein is a mountain of Saxony, in southeastern Germany. It is situated near the village Satzung, in the Ore Mountains, about 1.5 km from the border to the Czech Republic. Its elevation is 890 m."},{"page_url":"https://en.wikipedia.org/wiki/List_of_inactive_United_States_Navy_aircraft_squadrons","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Recon_Heavy_Attack_Squadron_7_%28USN%29_patch.PNG","page_title":"List of inactive United States Navy aircraft squadrons","context_page_description":"There are hundreds of US Navy aircraft squadrons which are not currently active dating back to before World War II. To be more accurate: there are hundreds of former U.S. Navy aircraft squadrons which have been disestablished and no longer exist and there are approximately 40 or so U.S. Navy aircraft squadrons which have been deactivated and which currently exist only \\"on paper\\" in an inactive status. These disestablished and/or deactivated squadrons are sometimes incorrectly referred to as \\"decommissioned\\" squadrons, but proper usage prior to 1998, was that squadrons were \\"established\\" and \\"disestablished\\" and after 1998, squadrons are \\"established\\", \\"deactivated\\" and sometimes \\"reactivated\\". It has never been correct to refer to U.S. Navy aircraft squadrons as being \\"commissioned\\" and \\"decommissioned\\", ships are commissioned and decommissioned, U.S. Navy aircraft squadrons are not."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B8%8C%E5%B0%94%E9%A1%BF%E6%AC%A2%E6%9C%8B%E9%85%92%E5%BA%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Hampton_by_Hilton_Liverpool_John_Lennon_Airport.jpg","page_title":"希尔顿欢朋酒店","context_page_description":"希尔顿欢朋酒店，是希尔顿全球酒店集团最大的酒店品牌，也是全球最大的国际酒店品牌之一，旗下的2300多家酒店遍布21个国家。"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%B5%90%E6%99%B6%E6%A7%8B%E9%80%A0","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Perovskita-wiki.jpg","page_title":"結晶構造","context_page_description":"結晶構造 とは、結晶中の原子の配置構造のことをいう。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%99%D7%99%D7%91%D7%9C_%D7%A4%D7%A8%D7%99%D7%99%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/%27The_Harlequin%27%2C_oil_on_canvas_painting_by_Mabel_Pryde%2C_c._1910%2C_Tate_Gallery.jpg","page_title":"מייבל פרייד","context_page_description":"מייבל סקוט לאודר פרייד הייתה אמנית, ואשתו של האמן ויליאם ניקולסון ואמם של האמנים בן ניקולסון וננסי ניקולסון והאדריכל כריסטופר ניקולסון."},{"page_url":"https://fr.wikipedia.org/wiki/Armstrong_Siddeley","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Armstrong_Siddeley_1921_advert_30HP_Landaulette.jpg","page_title":"Armstrong Siddeley","context_page_description":"Armstrong Siddeley était une société anglaise spécialisée dans la production de voitures et d'avions, créée en 1919 après le rachat de Siddeley-Deasy, un fabricant de belles voitures, par Armstrong Whitworth.\\nLa compagnie a poursuivi après cette fusion une politique de qualité, et, si elle est surtout connue pour la production de véhicules de luxe et de moteurs d'avion, elle a aussi produit des boîtes de vitesses pour les chars et les autobus, des moteurs de fusées et de torpilles, et des wagons. La production automobile s'est poursuivie lors des fusions et acquisitions d'entreprises avec Hawker Aviation et Bristol Aero Engines ont vu la poursuite de la production automobile, mais elle a finalement cessé en août 1960.\\nLa société a été absorbée en 1960 par le groupe Rolls-Royce, qui s'intéressait aux activités des avions et des moteurs d'avions. Subséquemment, les pièces de rechange restantes et tous les intérêts automobiles ont été vendus à l'Armstrong Siddeley Owners Club Ltd, qui détient maintenant les brevets, dessins, droits d'auteur et marques de commerce, y compris le nom d'Armstrong Siddeley."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%99%D0%BE%D1%80%D0%B4%D0%B0%D0%BD_%D0%99%D0%BE%D0%B2%D1%87%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/JordanJ_wiki.JPG","page_title":"Йордан Йовчев","context_page_description":"Йордан Йовчев Йовчев — болгарський гімнаст."},{"page_url":"https://sk.wikipedia.org/wiki/Chisar_kapija","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/HisarKapiya006.jpg","page_title":"Chisar kapija","context_page_description":"Chisar kapija je brána v mestskom opevnení pôvodne z obdobia antiky a v dnešnej podobe zo stredoveku nachádzajúca sa v architektonickej rezervácii Starý Plovdiv na ulici Canka Lavrenova približne 150 metrov východne od Východnej brány antického mesta Filipopol v centre mesta Plovdiv v Plovdivskej oblasti v južnom Bulharsku. Má štatút kultúrnej pamiatky."},{"page_url":"https://ceb.wikipedia.org/wiki/Nanpiao_Qu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Nanpiao%2C_Huludao%2C_Liaoning%2C_China_-_panoramio_-_Matthew_Summerton_%284%29.jpg","page_title":"Nanpiao Qu","context_page_description":"Gatos ang Nanpiao Qu sa Pangmasang Republika sa Tśina. Nahimutang ni sa prepektura sa Huludao Shi ug lalawigan sa Liaoning Sheng, sa sidlakang bahin sa nasod, 400 km sa sidlakan sa Beijing ang ulohan sa nasod. Adunay 120,969 ka molupyo. Ang populasyon sa naglangkob sa 60,251 ka babae ug 60,718 ka lalaki. Mga anak ubos sa edad nga 15 mao ang 14.0%, ang mga hamtong nga nag-edad 15-64 73%, ug mga tigulang labaw sa 65 11.0%.\\nNanpiao Qu may sa mosunod nga mga subdibisyon:\\n赵家屯街道\\n沙锅屯街道\\n邱皮沟街道\\n苇子沟街道\\n三家子街道\\n小凌河街道\\n九龙街道\\n缸窑岭镇\\n暖池塘镇\\n高桥镇\\n沙锅屯乡\\n黄土坎乡\\n乌金塘水库\\nAng klima klima sa kontinente. Ang kasarangang giiniton 11 °C. Ang kinainitan nga bulan Hunyo, sa 24 °C, ug ang kinabugnawan Enero, sa -8 °C. Ang kasarangang pag-ulan 717 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 165 milimetro nga ulan, ug ang kinaugahan Enero, sa 4 milimetro."},{"page_url":"https://ceb.wikipedia.org/wiki/Prirechnyy","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/%D0%9F%D0%B0%D0%BD%D0%BE%D1%80%D0%B0%D0%BC%D0%B0_%D0%BF%D0%BE%D1%81%D0%B5%D0%BB%D0%BA%D0%B0_3._2010_%D0%B3._-_panoramio.jpg","page_title":"Prirechnyy","context_page_description":"Lungsod ang Prirechnyy sa Rusya. Nahimutang ni sa lalawigan sa Murmanskaya Oblast', sa kasadpang bahin sa nasod, 1,500 km sa amihanan sa Moscow ang ulohan sa nasod. 161 metros ibabaw sa dagat kahaboga ang nahimutangan sa Prirechnyy, ug adunay 103 ka molupyo. Prirechnyy nga nahimutang sa lanaw sa Ozero Ala-Akkayarvi.\\nAng yuta palibot sa Prirechnyy kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 212 ka metro ug 2.4 km sa amihanan-kasadpan sa Prirechnyy. Dunay mga 2 ka tawo kada kilometro kwadrado sa palibot sa Prirechnyy may kaayo gamay nga populasyon. Hapit nalukop sa durowan ug kabugangan ang palibot sa Prirechnyy.\\nAng klima boreal. Ang kasarangang giiniton -4 °C. Ang kinainitan nga bulan Hulyo, sa 14 °C, ug ang kinabugnawan Pebrero, sa -18 °C."},{"page_url":"https://en.wikipedia.org/wiki/Cambodian_cuisine","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/2016_Phnom_Penh%2C_Amok_trey_%2801%29.jpg","page_title":"Cambodian cuisine","context_page_description":"Cambodian cuisine or Khmer cuisine, is the cuisine of the people of Cambodia."},{"page_url":"https://tr.wikipedia.org/wiki/Rivington_Street","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Orchard_St_looking_south_at_Rivington_St.jpg","page_title":"Rivington Street","context_page_description":"Rivington Street, New York'un Manhattan bölgesinde, Lower East Side'da bulunan bir sokak. Sokakta trafik tek yönlü olarak, batıya doğru akar. Adını gazeteci James Rivington'dan almıştır.\\nSokak yıllarca Lower East Side'ın işlek caddelerine giden geçiş yolu olarak kullanıldıysa da, son yıllarda açılan saygın restoranlar sayesinde, kendisi de gezilecek bir yer haline geldi.\\nSokakta bulunan halen faal durumdaki birçok sinagog, bir zamanlar Lower East Side'a yerleşmiş olan Yahudi nüfusu hatırlatır. Burada bulunan kayda değer kurumlar arasında, University Settlement House, Streit's Matzos, Schiller'in restoranı, müzisyen Moby'nin vegan dükkânı TeaNY, ABC No Rio adlı sosyal merkez, the Clemente Soto Velez Cultural and Educational Center ve yeni yapılan 21 katlı Hotel on Rivington sayılabilir."},{"page_url":"https://it.wikipedia.org/wiki/Castello_Sonnino","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/13/Costa_livorno.jpg","page_title":"Castello Sonnino","context_page_description":"Il castello Sonnino si erge su un promontorio a picco sul mare a pochi chilometri dalla città di Livorno, nei pressi della frazione di Quercianella, in località Romito."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Orgeln_im_Wetteraukreis","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/St._Gottfried_%28Butzbach%29_Orgel_01.JPG","page_title":"Liste der Orgeln im Wetteraukreis","context_page_description":"Die Liste der Orgeln im Wetteraukreis umfasst alle erhaltenen Pfeifenorgeln im Wetteraukreis. Sie ist eine Ergänzung zum Hauptartikel Orgellandschaft Hessen, in dem sich weitere Literatur findet."},{"page_url":"https://bs.wikipedia.org/wiki/Svjetsko_prvenstvo_u_biatlonu_2015_%E2%80%93_7,5_km","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Marie_Dorin_-_22-01-2010.jpg","page_title":"Svjetsko prvenstvo u biatlonu 2015 – 7,5 km","context_page_description":"Utrka u sprintu na 7,5 km na Svjetskom prvenstvu u biatlonu 2015. u ženskoj konkurenciji održala se 7. marta 2015. u finskom gradu Kontiolahtiju."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A2%D1%8D%D1%80%D0%BC%D0%B5%D0%BD%D0%B0-%D1%81%D1%83%D0%BB%D0%B0-%D0%A1%D1%82%D1%80%D0%B0%D0%B4%D0%B0-%D0%B4%D1%8D%D0%BB%D1%8C-%D0%92%D1%96%D0%BD%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Tramin-vogelperspektive.jpg","page_title":"Тэрмена-сула-Страда-дэль-Віна","context_page_description":"Тэрмена-сула-Страда-дэль-Віна — камуна ў Італіі, размяшчаецца ў рэгіёне Трэнціна — Альта-Адыджэ, падпарадкоўваецца адміністрацыйнаму цэнтру Бальцана.\\nНасельніцтва складае 3231 чалавек, шчыльнасць насельніцтва складае 170 чал./км². Займае плошчу 19 км². Паштовы індэкс — 39040. Тэлефонны код — 0471.\\nЗаступнікам населенага пункта лічыцца святы."},{"page_url":"https://sv.wikipedia.org/wiki/Parnassius_glacialis","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Parnassiusglacialiskyotoni.JPG","page_title":"Parnassius glacialis","context_page_description":"Parnassius glacialis är en fjärilsart som beskrevs av Butler 1866. Parnassius glacialis ingår i släktet Parnassius och familjen riddarfjärilar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Torneo_Provincial_de_F%C3%BAtbol_(Catamarca)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Icon_CDSCE.png","page_title":"Torneo Provincial de Fútbol (Catamarca)","context_page_description":"El Torneo Provincial de Fútbol de Catamarca es un torneo oficial organizado por la Federación Catamarqueña de Fútbol, que se juega previamente por fase de grupo y finalmente por el sistema de eliminación directa, cuyo ganador obtiene la clasificación al Torneo Regional Federal Amateur.\\nLos clubes que más veces participaron de este certamen desde 2008 fueron: Chacarita, Progreso de Tinogasta, Racing y Tiro Federal, todos ellos en seis ocasiones.\\nEl actual campeón es el Club Unión Sportiva de Recreo, que ganó por penales 5-4 tras igualar 2-2 en el global contra el Club Juventud Unida de Tinogasta, el 5 de mayo en la ciudad últimamente mencionada."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BA%A4%E9%80%9A%E5%A4%A7%E5%AD%A6%E6%A0%A1%E5%8F%8B%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Maoyushi_2011.JPG","page_title":"交通大学校友列表","context_page_description":"交通大學校友列表，旨在包括五所交通大學及其歷史淵源的交通大學的校友名錄。"},{"page_url":"https://eu.wikipedia.org/wiki/Heterobranchus_isopterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/FMIB_45845_Heterobranchus_macronema.jpeg","page_title":"Heterobranchus isopterus","context_page_description":"Heterobranchus isopterus Heterobranchus generoko animalia da. Arrainen barruko Clariidae familian sailkatzen da."},{"page_url":"https://tr.wikipedia.org/wiki/Sion,_%C4%B0svi%C3%A7re","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Sion%2C_la_ville%2C_vue_depuis_Val%C3%A8re_2..jpg","page_title":"Sion, İsviçre","context_page_description":"Sion, İsviçre'de şehir; Valais kantonunun merkezi ve aynı kantonun en büyük kenti."},{"page_url":"https://fr.wikipedia.org/wiki/Ahimsa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Jain.gif","page_title":"Ahimsa","context_page_description":"Ahimsa signifie littéralement « non-violence », et plus généralement « respect de la vie ». C'est aussi un concept de la philosophie indienne : la « bienveillance ». Le mot ahiṃsā désigne proprement « l'action ou le fait de ne causer de nuisance à nulle vie », hiṃsā signifiant « action de causer du dommage, blessure » et a- étant un préfixe privatif. Il est interprété de diverses manières, le plus souvent comme une forme de relation pacifique avec tout être vivant, et personnifié par la déesse du même nom, épouse de Dharma, mère de Nara.\\nL'ahiṃsā est une composante importante de l'hindouisme, du bouddhisme, du jaïnisme et de la philosophie mahométane de Kabir qui l'appliquent strictement. Le sikhisme défend aussi cette valeur tout comme l'égalité sociale au sein de l'ordre chevaleresque nommé Khālsā. Ce terme apparaît dans la Chāndogya Upaniṣad qui appartient au corpus des Mukhya Upaniṣad. Cette Upaniṣad est l'une des plus anciennes et a été commentée par Ādi Śaṅkara."},{"page_url":"https://ceb.wikipedia.org/wiki/Digitaria_ischaemum","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Digitaria_glabra_%E2%80%94_Flora_Batava_%E2%80%94_Volume_v7.jpg","page_title":"Digitaria ischaemum","context_page_description":"Espesye sa balili nga una nga gihulagway ni Johann Christian Daniel von Schreber, ug nga gihatagan sa eksakto nga ngalan ni Henry Ernest Muhlenberg ang Digitaria ischaemum. Ang Digitaria ischaemum sakop sa kahenera nga Digitaria sa kabanay nga Poaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A7%D0%B5%D1%80%D0%BD%D0%B8%D1%86%D1%8F_(%D0%92%D1%80%D0%BE%D1%86%D0%BB%D0%B0%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B2%D1%96%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Kosciol_w_czernicy.JPG","page_title":"Черниця (Вроцлавський повіт)","context_page_description":"Черниця — село в Польщі, у гміні Черниця Вроцлавського повіту Нижньосілезького воєводства.\\nНаселення — 1286 осіб.\\nУ 1975-1998 роках село належало до Вроцлавського воєводства."},{"page_url":"https://hu.wikipedia.org/wiki/Lorry-l%C3%A8s-Metz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Mairie_Lorry_Metz.JPG","page_title":"Lorry-lès-Metz","context_page_description":"Lorry-lès-Metz település Franciaországban, Moselle megyében. Lorry-lès-Metz Saulny, Plappeville, Lessy, Amanvillers, Châtel-Saint-Germain, Metz és Woippy községekkel határos."},{"page_url":"https://en.wikipedia.org/wiki/Hong_Kong_Disneyland_Hotel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Hong_Kong_Disneyland_Hotel_Outdoor_Pool_2017.jpg","page_title":"Hong Kong Disneyland Hotel","context_page_description":"Hong Kong Disneyland Hotel is the second Disney hotel in the Hong Kong Disneyland Resort in Penny's Bay, Lantau Island, Hong Kong. The theme of the hotel is of a Victorian style, and is located near Disneyland Harbour. The hotel is built on reclaimed land and opened on 12 September 2005.\\nThe hotel has 400 guestrooms and a convention centre with ballrooms and function rooms.\\nThe Convention Centre offers three ballrooms.\\nIt is in Islands District."},{"page_url":"https://de.wikipedia.org/wiki/Volutenranke","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Anthemion%2C_Hamlin_1916%2C_Fig._121_A.jpg","page_title":"Volutenranke","context_page_description":"In der Ornamentik wird eine Ranke mit einer oder mehreren Voluten als Volutenranke bezeichnet. Statt des speziellen Begriffs Volutenranke wird meist der allgemeine Begriff Ranke verwendet.\\nVoluten an den Rankenenden oder am Ende von Seitentrieben bezeichnet man als Rankenvoluten. Auch hier wird meist der allgemeine Begriff Volute vorgezogen.\\nVom Haupttrieb einer Volutenranke können Seitentriebe abzweigen, die wie der Haupttrieb in Voluten endigen können.\\nEin Haupttrieb ohne Seitentriebe bildet eine S-förmige oder C-förmige Doppelvolute. Mehrere Doppelvoluten können unverbunden oder mit Klammern aneinandergereiht werden und so ein Rankenband bilden. Gleichsinnig gerichtete S-förmige Doppelvoluten können auch zu einem als laufender Hund bezeichneten Band miteinander verbunden werden.\\nRankenvoluten können frei auslaufen, mit anderen Ornamentgliedern verbunden sein und in vielfacher Verschlingung schwer entwirrbare Netze oder Flechtwerke bilden. Die Voluten können an den freien Enden auch Blätter, Blüten oder Früchte tragen, oder es kann ein beliebiges anderes Objekt oder eine menschliche oder tierische Figur aus ihnen hervorsprießen."},{"page_url":"https://de.wikipedia.org/wiki/Cirey-l%C3%A8s-Mareilles","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Cirey-les-Mareilles_10.jpg","page_title":"Cirey-lès-Mareilles","context_page_description":"Cirey-lès-Mareilles ist eine französische Gemeinde mit 136 Einwohnern im Département Haute-Marne in der Region Grand Est. Sie gehört zum Arrondissement Chaumont und zum Kanton Bologne."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%8B%89%E9%A9%AC%E5%BE%B7%E8%8E%B1%E5%A8%9C","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Map_commune_FR_insee_code_59368.png","page_title":"拉马德莱娜","context_page_description":"拉馬德萊娜是法國上法蘭西大區北部省的一個市鎮，位於該省中部偏西北，里爾市區北部，屬於里爾區。該市鎮2009年時的人口為21,173人。"},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E5%8F%B2%E4%B8%B9%E7%A6%8F%E6%A9%8B%E7%90%83%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Stamford_Bridge_-_West_Stand.jpg","page_title":"史丹福橋球場","context_page_description":"史丹福橋球場（粵拼：si² daan¹ fuk¹ kiu⁴ kau⁴ coeng⁴）\\n（英文：Stamford Bridge）係位於英國倫敦富林區嘅專業足球場，係英格蘭超級聯賽球會車路士嘅主場，容量41,841人，係英超第八大球場。\\n由1887年開幕到1905年，爾個球場係倫敦體育會嘅主場，響1905年，球場嘅新主人同車路士創辦人Gus Mears接手咗爾個球場，之後爾個主場就一直作為車路士嘅主場。由開幕至今爾個球場經歷過好大轉變，尤其係響1990年代翻新為一個現代全座位球場。\\n史丹福橋球場設有四個看臺，包括東看臺（East Stand），西看臺（West Stand），馬修哈丁看臺（Matthew Harding Stand），同舒赫特看台（Shed End）。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A1%E1%83%90%E1%83%9A%E1%83%90_(%E1%83%90%E1%83%A0%E1%83%A5%E1%83%98%E1%83%A2%E1%83%94%E1%83%A5%E1%83%A2%E1%83%A3%E1%83%A0%E1%83%90)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Hua_Hin_trainstation_sala.jpg","page_title":"სალა (არქიტექტურა)","context_page_description":"სალა, იგივე sala Thai, გამოიყენება, როგორც შეხვედრების ადგილი, დაცულია მზისგან და წვიმისგან. უმეტესწილად ისინი ოთხივე მხრიდან ღიანი არიან ოთხივე მხრიდან. ძირითადად გვხვდება ტაილანდში, ბუდისტური ტაძრების ან ვატების მახლობლად, მაგრამ ასევე შეიძლება სხვა ადგილებშიც იყონ. ადამიანი, რომელიც სალას ააშენებს ტაძარში ან საზოგადოებრივ ადგილას, ზრდის თავის რელოგიურ დამსახურებას. ტაილანდში სალები სხვადასხვა მიზნით გამოიყენება და შესაბამისად, სხვადასხვა დასახელებები აქვთ."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%80%CE%B1%CF%81%CE%AF%CE%B4%CE%B5%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Sarpa_salpa_by_Line1.jpg","page_title":"Σπαρίδες","context_page_description":"Οι Σπαρίδες είναι μια οικογένεια ψαριών που ανήκει στην τάξη των Περκόμορφων και περιλαμβάνει 38 γένη. Τα γένη Centracanthus και Spicara ενσωματώθηκαν με τις Σπαρίδες το 2014, καθιστώντας έτσι την οικογένεια των Κεντρακανθιδών παρωχημένη."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D8%A7%D8%B1%D9%89_%D9%87%D8%A7%D9%83%D8%A7%D9%85%D9%8A%D8%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Kari_H%C3%A4k%C3%A4mies.jpg","page_title":"كارى هاكاميس","context_page_description":"كارى هاكاميس سياسى من فينلاندا."},{"page_url":"https://vi.wikipedia.org/wiki/Tr%C4%A9_sao_l%E1%BB%9Bn","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Great_Argus_Pheasant_SMTC.jpg","page_title":"Trĩ sao lớn","context_page_description":"Argusianus argus là một loài chim trong họ Phasianidae."},{"page_url":"https://fr.wikipedia.org/wiki/Palmette","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/Demidov_bridge_St_Petersburg_fence.jpg","page_title":"Palmette","context_page_description":"La palmette est un motif ornemental et décoratif en forme de feuille de palmier.\\nLes palmettes peuvent prendre différentes formes : larges et lobées, ou au contraire plus effilées, à un lobe ou deux.\\nOn combine fréquemment la palmette au rinceau : motif en forme de rameau."},{"page_url":"https://en.wikipedia.org/wiki/Capacitor_types","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Supercapacitor_types_overview.svg","page_title":"Capacitor types","context_page_description":"Capacitors are manufactured in many forms, styles, lengths, girths, and from many materials. They all contain at least two electrical conductors separated by an insulating layer. Capacitors are widely used as parts of electrical circuits in many common electrical devices.\\nCapacitors, together with resistors, and inductors, belong to the group of \\"passive components\\" used in electronic equipment. Although, in absolute figures, the most common capacitors are integrated capacitors, this article is concentrated on the various styles of capacitors as discrete components.\\nSmall capacitors are used in electronic devices to couple signals between stages of amplifiers, as components of electric filters and tuned circuits, or as parts of power supply systems to smooth rectified current. Larger capacitors are used for energy storage in such applications as strobe lights, as parts of some types of electric motors, or for power factor correction in AC power distribution systems. Standard capacitors have a fixed value of capacitance, but adjustable capacitors are frequently used in tuned circuits."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%90%96%E6%BB%BE%E5%90%8D%E4%BA%BA%E5%A0%82%E6%88%90%E5%93%A1%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Stevie_Nicks_Austin_2017_%2813%29.jpg","page_title":"搖滾名人堂成員列表","context_page_description":"本条目为摇滚名人堂成员的列表。摇滚名人堂成立于1986年，坐落于美国俄亥俄州克里夫兰，专建以纪录那些最为著名且价值巨大的音乐家、乐队、制作人，及其他对音乐产业有重大影响的人的历史，特别是摇滚乐领域。"},{"page_url":"https://nl.wikipedia.org/wiki/Duncan_Laurence","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Duncan_Laurence_GFDress-048-20190517-EuroVisionary.jpg","page_title":"Duncan Laurence","context_page_description":"Duncan Laurence, artiestennaam van Duncan de Moor, is een Nederlandse singer-songwriter. Hij kreeg in Nederland bekendheid door zijn deelname aan het vijfde seizoen van het televisieprogramma The voice of Holland, waar hij de halve finale bereikte. In 2019 won hij het Eurovisiesongfestival met het door hemzelf geschreven en gecomponeerde nummer Arcade."},{"page_url":"https://fr.wikipedia.org/wiki/Gouvernement_populaire_d%27Azerba%C3%AFdjan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Old_stamp_of_Democratic_Republic_of_Azerbaijan.jpg","page_title":"Gouvernement populaire d'Azerbaïdjan","context_page_description":"Le Gouvernement populaire d'Azerbaïdjan est un État éphémère soutenu par l'Union soviétique et situé dans le nord-ouest de l'Iran. Établi dans l'Azerbaïdjan iranien, la capitale du GPA était Tabriz. La fondation et la fin de ce gouvernement populaire rentrait dans le cadre de la crise irano-soviétique, la première de la guerre froide.\\nPendant la Seconde Guerre mondiale et l'occupation anglo-soviétique de l'Iran, l'URSS de Staline occupait le nord de l'Iran et souhaitait « répandre le socialisme » en créant des États séparatistes chez les pays voisins.\\nLa république de Mahabad, mise en place au même moment par des Kurdes, était l'une de ces tentatives sécessionnistes. Pendant la guerre, l'utilisation de la langue azérie avait été encouragée par les écrivains, journalistes et professeurs, dont certains étaient envoyés depuis la république socialiste soviétique d'Azerbaïdjan, l'une des républiques fédérées de l'Union soviétique. Le GPA a été annoncé en novembre 1945 par Jafar Pishevari, dirigeant du Parti démocratique azerbaïdjani. Le premier et seul Premier ministre de cette république fut Ahmad Kordari."},{"page_url":"https://nl.m.wikipedia.org/wiki/Lijst_van_personen_overleden_op_6_augustus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Diego_Vel%C3%A1zquez_-_The_Surrender_of_Breda_%28detail%29_-_WGA24406.jpg","page_title":"Lijst van personen overleden op 6 augustus","context_page_description":"Dit is een lijst van personen die overleden zijn op 6 augustus.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n258 - Paus Sixtus II, paus, klerk en rooms-katholiek priester bewerken\\n523 - Paus Hormisdas, paus en kardinaal, klerk en rooms-katholiek priester bewerken\\n750 - Marwan II, militair leider van de Omajjaden bewerken\\n962 - Guillem II Talleyrand, graaf bewerken\\n1027 - Richard III van Normandië, hertog, hertog van Normandië bewerken\\n1156 - Vratislav van Moravië, hertog bewerken\\n1162 - Raymond Berengarius IV van Barcelona, regent en Monarch van Aragon uit het Graafschap Barcelona bewerken\\n1195 - Hendrik de Leeuw, Duitse hertog, Hertogdom Beieren bewerken\\n1221 - Dominicus Guzman, lijst van magisters-generaal van de dominicanen, rooms-katholiek priester en oprichter uit het Koninkrijk Castilië bewerken\\n1272 - Stefanus V van Hongarije, Hongaarse koning van het Koninkrijk Hongarijë bewerken"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%96%E6%A7%8D%E9%B0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Acroteuthis_subquadrata_-_Naturhistorisches_Museum%2C_Braunschweig%2C_Germany_-_DSC05160.JPG","page_title":"尖槍鰂","context_page_description":"尖枪鲗是生存在早白垩纪海洋中的一属箭石。它们的游水速度可能很慢。其化石分布于旧苏联地区、加拿大和格陵兰等地。"},{"page_url":"https://pt.wikipedia.org/wiki/Est%C3%A1dio_Estadual_Jornalista_Edgar_Augusto_Proen%C3%A7a","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Est%C3%A1dio_Ol%C3%ADmpico_-_Par%C3%A1.jpg","page_title":"Estádio Estadual Jornalista Edgar Augusto Proença","context_page_description":"O Estádio Estadual Jornalista Edgar Proença é um estádio da cidade de Belém, capital do estado brasileiro do Pará."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%8C%AA%E8%B0%B7%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/JRW-inotani-station-yard.jpg","page_title":"猪谷駅","context_page_description":"猪谷駅は、富山県富山市猪谷字旦暮にある、西日本旅客鉄道と東海旅客鉄道の高山本線の駅である。JRの境界駅の一つである。富山県最南端の駅。\\nかつては神岡鉄道神岡線も乗り入れていたが、2006年に廃線となった。"},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Franciszka_Ksawerego_w_Krasnymstawie","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Zdejmowanie_dzwonu_z_ko%C5%9Bcio%C5%82a_%C5%9Bw._Franciszka.JPG","page_title":"Kościół św. Franciszka Ksawerego w Krasnymstawie","context_page_description":"Kościół św. Franciszka Ksawerego – zabytkowy kościół projektu Jana Delamarsa wzniesiony na przełomie XVII i XVIII wieku w Krasnymstawie, znajdujący się przy ul. Piłsudskiego 3.\\nZbudowany został w latach 1695-1717 jako świątynia zakonu jezuitów. W 1774 roku po kasacie zakonu kościół stał się katedrą diecezji chełmskiej. Funkcję tę pełnił do roku 1805, kiedy przeniesiono siedzibę diecezji do Lublina.\\nJest to typowa budowla jezuicka. Kościół na planie krzyża, trójnawowy, z transeptem i zamkniętym półkoliście prezbiterium. Wnętrze urządzone z przepychem i bogactwem dekoracji sztukatorskiej i malarskiej. W prezbiterium znajduje się ołtarz główny z XVIII wieku. W ramionach transeptu znajdują się dwa duże ołtarze boczne: Matki Boskiej Różańcowej i św. Antoniego, również z XVIII wieku. Na chórze znajdują się 26 głosowe organy z 1912 roku, wbudowane w XVII-wieczny prospekt; remontowane w 1950 i 1991 roku. Sklepienie pokrywa polichromia zakonnika Adama Swacha z 1721 roku ze scenami z życia św. Franciszka Ksawerego."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BD%D1%82%D0%B5%D1%80%D0%BD%D0%B0%D1%81%D1%8C%D0%BE%D0%BD%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/SCIneternacional1977Crest.jpg","page_title":"Интернасьонал","context_page_description":"«Интернасьона́л», либо просто «И́нтер», также встречается вариант с добавлением общепринятой в стране аббревиатуры штата для отличия от других команд с похожей краткой формой названия — Inter RS — бразильский футбольный клуб из города Порту-Алегри, штат Риу-Гранди-ду-Сул.\\nЯвляется одним из двух сильнейших и наиболее титулованных клубов своего штата и одним из самых титулованных во всей Бразилии.\\n«Интернасьонал» — единственный клуб, который сумел стать чемпионом Бразилии, не проиграв ни одного матча в ходе турнира. В 1969—1976 годах клуб восемь раз подряд становился чемпионом штата Риу-Гранди-ду-Сул, а в 1970-е трижды становился чемпионом Бразилии. С 1975 по 1998 год «Интер» удерживал первое место в рейтинге клубов Конфедерации футбола Бразилии. В августе 2011 года, после победы в Рекопе, «Интернасьонал» возглавил рейтинг клубов КОНМЕБОЛ.\\nВ 2006 году «Интернасьонал» впервые в своей истории стал обладателем Кубка Либертадорес. В декабре того же года «Интер» выиграл клубный чемпионат мира ФИФА, обыграв в финале победителя европейской Лиги Чемпионов испанскую «Барселону»."},{"page_url":"https://pl.wikipedia.org/wiki/Koperta_(je%C5%BAdziectwo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/be/Haflinger_obstacle_cropped.jpg","page_title":"Koperta (jeździectwo)","context_page_description":"Koperta – pojedyncza pionowa przeszkoda do skoków konnych, wykorzystywana w ćwiczeniach skoku na wysokość. Zbudowana jest z dwóch stojaków i drągów skrzyżowanych w płaszczyźnie pionowej, gdzie jedna strona drągu spoczywa na kłódce/łyżce a druga na ziemi. Koperta używana jest tylko na treningach, ponieważ w czasie zawodów drągi nie mogą dotykać gruntu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%BD%D0%BD%D0%B8%D1%86%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Coat_of_Arms_of_Bronnitsy_%28Moscow_oblast%29_%282005%29.png","page_title":"Бронницы","context_page_description":"Бро́нницы — город в Московской области России. Город областного подчинения, образует одноимённый городской округ.\\nНаселение — 22 531 чел."},{"page_url":"https://fr.wikipedia.org/wiki/Tabebuia_pallida","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Plaque-Tabebuia-pallida-R%C3%A9union.JPG","page_title":"Tabebuia pallida","context_page_description":"Le calice du pape est un arbre de la famille des Bignoniaceae, originaire d'Amérique tropicale. Il produit des fruits comestibles.\\nIl est connu sous le nom vernaculaire de poirier-pays ou pwayé aux Antilles françaises. Il est invasif à La Réunion ou à Maurice où il est localement connu sous le nom de tecoma. On peut admirer des sujets au jardin botanique de Pamplemousses."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A8%D7%93%D7%95%D7%A4%D7%99%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Trachomitum_venetum_1.jpg","page_title":"הרדופיים","context_page_description":"הַרְדּוּפִיִּים היא משפחה מסדרת הגנציינאים, עמה נמנים כ-300 סוגים וכ-1300 מינים. המשפחה כוללת עצים, שיחים או עשבים רב-שנתיים, אשר ברובם נפוצים באזורים הטרופיים ובמעוטם באזורים הממוזגים. מינים אחדים ממשפחת ההרדופיים גדלים בר בארץ ישראל ביניהם הרדוף הנחלים, וינקה עשבונית וסם הכלב המזרחי.\\nעל פי המיון העדכני ביותר של מכוסי הזרע, משפחת ההרדופיים במתכונתה המסורתית היא קבוצה פאראפילטית. התיאור העדכני של המשפחה לפי שיטת מיון זו כולל בתוך ההרדופיים את כל הסוגים ששויכו בעבר למשפחת האסקלפיים. הערך הנוכחי מתייחס למשפחת ההרדופיים במתכונתה הישנה, ללא האסקלפיים."},{"page_url":"https://pl.wikipedia.org/wiki/Sa%C5%82ata_trwa%C5%82a","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Lactuca_perennis_flower.jpg","page_title":"Sałata trwała","context_page_description":"Sałata trwała – gatunek rośliny należący do rodziny astrowatych. Występuje w większej części Europy. W Polsce prawdopodobnie nie rośnie."},{"page_url":"https://en.wikipedia.org/wiki/Francesco_Menzio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Francesco_Menzio%2C_Nudo_disteso_du_fondo_rosso%2C_1928.jpg","page_title":"Francesco Menzio","context_page_description":"Francesco Menzio was an Italian painter."},{"page_url":"https://la.wikipedia.org/wiki/Curtae_bracae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Schoolshorts1.jpg","page_title":"Curtae bracae","context_page_description":"Curtae bracae sive femoralia vel feminalia vestimenta sunt mulierum virorumque, quae femora tegunt. Nonnunquam femoralia genua quoque tegunt."},{"page_url":"https://en.wikipedia.org/wiki/CocoCay","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/CocoCaySign.JPG","page_title":"CocoCay","context_page_description":"CocoCay or Little Stirrup Cay, Bahamas, is one of the Berry Islands, a collection of cays and small islands, and is located approximately 55 miles north of Nassau. It is used for tourism by Royal Caribbean Cruises Ltd exclusively."},{"page_url":"https://cs.wikipedia.org/wiki/Dan%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Meridianas_2019_m.jpg","page_title":"Danė","context_page_description":"Akmena-Danė je řeka na západě Litvy, v Žemaitsku, v okresech Kretinga a Klaipėda. Je dlouhá 62,5 km. Povodí má rozlohu 580,2 km². Pramení u vsi Mažieji Žalimai protéká okresem Kretinga, městem Kretinga, okresem Klaipėda a v Klaipėdě se vlévá do Kurského zálivu, 3 km od jeho ústí do Baltského moře.\\nOd pramene až k hranici Klaipėdského okresu, která prochází po jižním okraji jižní městské čtvrti Kretingy „Bajorai“ se řeka jmenuje Akmena, od této hranice až k ústí se jmenuje Danė, dříve také Dangė. Poprvé byla tato řeka zmíněna 29. července1252 ve smlouvě mezi vedením Livonského řádu a kuršským biskupem Heinrichem o stavbě Klaipėdského hradu, zde je pojmenována Dange.\\nMezi 55–57 km a v Klaipėdě je řeka zregulována. Střední tok prochází erozním údolím, je tu mnoho balvanitých peřejí. Pod Kretingou teče širokým údolím. Průměrná šířka údolí je 400–500 m, výška strání je 5–10 m. Šíře koryta v horním a středním toku průměrně 5–18 m, v dolním toku do 40 m. Hloubka 0,3–1,3 m, v Klaipėdě 5–7 m. Průměrný spád je 88 cm/km, v dolním toku 7 cm/km. Rychlost proudu je 0,1–0,2 m/s. Průtok u ústí: max. 90, min. 0,7 m³/s. Jarní povodňové zvýšení hladiny: v horním toku do +3 m, u Klaipėdy do 1,7 m."},{"page_url":"https://en.wikipedia.org/wiki/Stockelsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Stockelsdorf_Wappen.png","page_title":"Stockelsdorf","context_page_description":"Stockelsdorf is a municipality in the district of Ostholstein, in Schleswig-Holstein, Germany. It is situated directly northwest of Lübeck and forms an agglomeration with the easterly town of Bad Schwartau.\\nThe municipality contains the villages of Arfrade, Curau, Dissau, Eckhorst, Horsdorf, Klein Parin, Krumbeck, Malkendorf, Obernwohlde and Pohnsdorf.\\nBy measure of population Stockelsdorf is the second largest municipality without town status in Schleswig-Holstein."},{"page_url":"https://lv.wikipedia.org/wiki/Hos%C4%93_Pekermans","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Jose_pekerman_colombia_uruguay.jpg","page_title":"Hosē Pekermans","context_page_description":"Hosē Nestors Pekermans Krimens ir argentīniešu futbola treneris un bijušais futbolists, spēlējis pussarga pozīcijā. No 2012. līdz 2018. gadam bija Kolumbijas futbola izlases galvenais treneris, 2006. gada FIFA Pasaules kausā vadīja Argentīnas izlasi."},{"page_url":"https://en.wikipedia.org/wiki/Queen%27s_Lawn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Sherfield_Building_over_Queen%27s_Lawn_from_Imperial_College_Road.jpg","page_title":"Queen's Lawn","context_page_description":"The Queen's Lawn is a green lawned area situated at the centre of Imperial College London's South Kensington campus, next to the Queen's Tower and immediately to the north of Imperial College Road. It provides an open space of 1,600 sq metres, and is surrounded by the Central Library, and the Sherfield administration, Chemistry, and Skempton buildings. It is often the site of college events, including student bands, fairs, and balls.\\nIn April 2006, the Imperial College student newspaper Felix reported that the college was seeking permission of Westminster City Council to develop part of the lawn into a three-storey modular building, however this has not come to pass."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%AB%E3%83%81%E3%83%AD%E3%83%BC%E3%83%AB%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/P-47-2.jpg","page_title":"マルチロール機","context_page_description":"マルチロール機とは、装備を変更することで制空戦闘、各種攻撃任務、偵察などの任務を実施できる戦闘機。マルチロールファイターとも呼ばれる。"},{"page_url":"https://hr.wikipedia.org/wiki/Garoua","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Marche_Garoua_Nord_Cameroon.jpg","page_title":"Garoua","context_page_description":"Garoua je grad i riječna luka u Kamerunu, sjedište regije Nord i departmana Bénoué. Nalazi se na sjeveru države, 40 km od granice s Nigerijom i 110 km od granice sa Čadom. Leži na rijeci Benue, važnoj prometnici Kameruna i Nigerije.\\nGaroua je rodno mjesto prvog predsjednika Kameruna, Ahmadoua Ahidjoa. Danas je trgovačko središte regije. Razvijena je tekstilna industrija i turizam. Na sjevernim rubovima grada nalazi se međunarodna zračna luka, odakle idu direktni letovi za Pariz.\\nPrema popisu iz 2001. godine, Garoua je imala 356.900 stanovnika, čime je bila 3. grad po brojnosti u državi."},{"page_url":"https://pl.wikipedia.org/wiki/Ceromancja","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Sv%C3%A1tek_svat%C3%A9ho_Ond%C5%99eje_wr%C3%B3%C5%BCenie.jpg","page_title":"Ceromancja","context_page_description":"Ceromancja – sposób wróżenia polegający na laniu wosku roztopionego w mosiężnym tyglu. Gorący wosk wlewa się powoli do misy z zimną wodą. Kiedy zetknie się z powierzchnią wody, zastyga, przyjmując rozmaite kształty.\\nWypracowane w ciągu wieków zwyczajowe interpretacje złożyły się na dający się z łatwością przyswoić system, przyjęty później w tasseomancji.\\nZwyczaj lania wosku przez ucho od klucza i interpretowania kształtu cienia rzucanego przez zastygniętą bryłę należy do tradycyjnych zabaw andrzejkowych. W dawnej Polsce wosk lany był także w wigilie innych świąt, np. w Sylwestra - przeddzień Nowego Roku.\\nDawniej zamiast wosku stosowano też ołów."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9C%D0%B5%D0%BB%D0%B5-%D0%BB%D0%B5-%D0%92%D0%B8%D0%B4%D0%B0%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Chateau_de_Meslay.jpg","page_title":"Меле-ле-Видам","context_page_description":"Меле-ле-Видам — Францин гӀала-коммуна, лаьтта Центр — Луаран атагӀа регионехь. Коммунан департамент — Эр а, Луар а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%89%D5%A1%D6%80%D5%AC%D5%A6_%D4%B3%D5%AC%D5%B8%D5%BE%D5%A5%D6%80_%D4%B2%D5%A1%D6%80%D5%AF%D5%AC%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Charles_Glover_Barkla.jpg","page_title":"Չարլզ Գլովեր Բարկլա","context_page_description":"Չարլզ Գլովեր Բարկլա, բրիտանացի ֆիզիկոս, 1917 թվականին «Քիմիական տարրերին բնորոշ ռենտգենյան ճառագայթման հայտնաբերման համար» ստացել է ֆիզիկայի նոբելյան մրցանակ։"},{"page_url":"https://it.wikipedia.org/wiki/Ischia_Film_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Ischia_Film_Festival.JPG","page_title":"Ischia Film Festival","context_page_description":"L’Ischia Film Festival è un festival cinematografico internazionale specificamente dedicato alle location del cinema. Il festival è realizzato dall'Associazione Culturale Art Movie e Music e il suo ideatore e direttore artistico è Michelangelo Messina.\\nLa prima edizione del festival si è tenuta nel 2003 presso l'isola d'Ischia con il nome di Foreign Film Festival. La manifestazione è nata con l'intento di conferire un riconoscimento artistico alle opere, ai registi, ai direttori della fotografia e agli scenografi che hanno valorizzato luoghi italiani o stranieri per invogliare lo spettatore a visitarne le bellezze.\\nIl festival, che si svolge in luglio, organizza annualmente il convegno nazionale sul cineturismo. La rassegna cinematografica si compone di tre sezioni competitive dedicate ai cortometraggi e ai documentari, una sezione speciale denominata Primo Piano dedicata ai lungometraggi e una sezione fuori concorso denominata Scenari.\\nIl festival fa parte dell'AFIC, l'Associazione Italiana Festival di Cinema, cui appartengono altre analoghe manifestazioni nazionali di promozione del cinema italiano."},{"page_url":"https://en.wikipedia.org/wiki/Vehicle_registration_plates_of_Mississippi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/1925_Mississippi_license_plate.jpg","page_title":"Vehicle registration plates of Mississippi","context_page_description":"The U.S. state of Mississippi first required its residents to register their motor vehicles and display license plates in 1912. Since then, the state has gone through a variety of license plate designs and currently has several different designs for passenger, non-passenger, and optional-issue plates.\\nPlates are currently issued by the Vehicle Licensing Division of the Mississippi Department of Revenue. Only rear plates have been required since 1925."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A1%B0%EC%84%A0%EB%AF%BC%EC%A3%BC%EC%A3%BC%EC%9D%98%EC%9D%B8%EB%AF%BC%EA%B3%B5%ED%99%94%EA%B5%AD_%EC%9B%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/1947-5won-a4.jpg","page_title":"조선민주주의인민공화국 원","context_page_description":"조선민주주의인민공화국 원은 조선민주주의인민공화국에서 통용되는 화폐이다. 1원은 100전에 해당한다. 조선민주주의인민공화국 원은 조선민주주의인민공화국 중앙은행에 의해 발행된다. 다만, 환율의 가치를 볼 때 조선민주주의인민공화국 100원은 한국 돈으로 약 135원 내외를 가지고 있는 가치가 되므로 1KPW = 1.35KRW의 가치를 두고 있는 등가를 가지고 있는 셈이지만 실제 가치는 북한 원이 한국 원보다 약간 무거운 측면을 가지고 있다."},{"page_url":"https://lv.wikipedia.org/wiki/Ce%C4%BCa_p%C4%81reja","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Empties_Through_Chester_-_geograph.org.uk_-_1934869.jpg","page_title":"Ceļa pāreja","context_page_description":"Ceļa pāreju veido pārmiju pārvedas un ceļš, kurš tās savieno. Ceļu pāreja nodrošina vilcienu novirzīšanu no viena ceļa uz otru — blakusesošo sānu ceļu.\\nIzšķir:\\nparastās ceļu pārejas, kuras sastāv no divām parastajām pārmiju pārvedām;\\nšķērspārejas, kad ceļa pāreja tiek nodrošināta ar slīpleņķa nekustīgā ceļa krustojuma palīdzību.\\nParastās ceļu pārejas ierīko, kad sadales punktā vietas ir pietiekoši, bet šķērspārejas, kad vietas nepietiek.\\nPēc ceļa pārejas sliežu ceļa garenasu nogriežņu un tangenšu savstarpējā savienojuma veida pāreja var būt:\\ntaisna;\\nsavienota ar vienu līkni starp diviem taisniem, taču ne paralēliem ceļiem;\\nsavienota ar vienu līkni starp diviem līklīnijas ceļiem;\\nsaīsinātās ceļu pārejas starp paralēliem vai neparalēliem, vai līklīnijas ceļiem, kad pārmijas savstarpēji savieno ar \\"S\\" veida līkni."},{"page_url":"https://vi.wikipedia.org/wiki/Acosmeryx","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Acosmeryx_sericeus_%28Walker%2C_1856%29.jpg","page_title":"Acosmeryx","context_page_description":"Acosmeryx là một chi bướm đêm thuộc họ Sphingidae."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Sauveur_de_Caen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Caen_France_%2817%29.JPG","page_title":"Église Saint-Sauveur de Caen","context_page_description":"L'église Saint-Sauveur est un lieu de culte catholique dans le centre-ville ancien de Caen. Avant 1802, cette église s'appelait Notre-Dame-de-Froide-Rue. Depuis 1802, elle est dédiée au saint Sauveur. Ce monument fait l’objet d’un classement au titre des monuments historiques depuis 1889."},{"page_url":"https://en.wikipedia.org/wiki/Language_island","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Germany_sorbian_region.png","page_title":"Language island","context_page_description":"A language island is an exclave of a language that is surrounded by one or more different languages.\\nExamples of language islands:\\nSaterland\\nBrussels\\nSzeklerland\\nPalenquero\\nAlghero\\nSwabian Turkey\\nUpper Harz\\nBetawi\\nChipilo and Chipilo Venetian dialect\\nMonégasque\\nLusatia"},{"page_url":"https://vi.wikipedia.org/wiki/Agnieszka_Radwa%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Agnieszka_Radwa%C5%84ska_at_the_2009_US_Open_01.jpg","page_title":"Agnieszka Radwańska","context_page_description":"Agnieszka Roma \\"Aga\\" Radwańska là 1 cựu vận động viên quần vợt chuyên nghiệp người Ba Lan. Radwańska đạt thứ hạng cao nhất là số 2 thế giới vào tháng 7 năm 2012. Được biết đến là 1 tay vợt biết cách xây dựng chiến thuật thi đấu cũng như lối chơi thông minh, phòng ngự và phản công tốt ở cuối sân, Radwanska đã có được 17 danh hiệu đơn trong sự nghiệp.\\nRadwanska đã từng tiến sâu vào 1 giải Grand Slam đó là tại giải Wimbledon 2012 và đã để thua Serena Williams. Ngoài ra, còn vào được bán kết của Úc Mở rộng và tứ kết Roland Garros.\\nNgoài ra, cô còn chơi ở nội dung đôi, từng đánh cặp với Maria Kirilenko và Daniela Hantuchová, nhưng sau năm 2010, Radwanska tập trung cho nội dung đơn và ít khi tham gia đánh đôi.\\nRadwanska được bình chọn là tay vợt nữ được yêu thích nhất của WTA trong 5 năm liên tiếp. Với thành tích của mình trong thể thao, năm 2013, cô đã được Tổng thống Ba Lan Bronisław Komorowski trao tặng huy hiệu chữ thập vàng."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A3%CF%84%CE%AC%CE%B4%CE%B9%CE%BF_%CE%9A%CF%8C%CE%BD%CE%B9%CE%BD%CE%B3%CE%BA_%CE%92%CE%AF%CE%BB%CE%B5%CE%BC_%CE%99%CE%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Willem_II_stadion.jpg","page_title":"Στάδιο Κόνινγκ Βίλεμ ΙΙ","context_page_description":"Το Στάδιο Κόνινγκ Βίλεμ ΙΙ είναι ποδοσφαιρικό γήπεδο στο Τίλμπουρχ της Ολλανδίας και είναι έδρα της Βίλεμ ΙΙ."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%87%8D%E5%BA%86%E5%B8%82%E6%91%A9%E5%A4%A9%E5%A4%A7%E6%A5%BC%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/YIFC6.jpg","page_title":"重庆市摩天大楼列表","context_page_description":"重慶摩天大樓目前建成的高度超過兩百米的有二十一棟，位居中國前列。被稱作重慶母城的渝中區平地少而人口眾多，不得已而向天空發展，所以是重慶摩天大樓最為集中的區域。隨著重慶的不斷發展以及城市化進程的不斷加快，重慶將擁有越來越多的摩天大樓。重慶的摩天大樓分布較為集中，主要在各區核心位置。例如城市商圈，步行街或是中央商務區。較為集中的地方有四點：渝中區解放碑中央商務區，南岸區南坪商圈，江北區觀音橋商圈以及日前正在建設中的江北嘴中央商務區。摩天大樓常常被看作是一個地區經濟與實力的代表，並可或多或少的提升城市的天際線。目前重慶最高的摩天大樓是有355米總高的來福士廣場T3N和來福士廣場T4N。該樓坐落於渝中區朝天門附近，已於2019年完工。"},{"page_url":"https://tr.wikipedia.org/wiki/Erich_Ludendorff","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Hindenburg%2C_Kaiser%2C_Ludendorff_HD-SN-99-02150.JPG","page_title":"Erich Ludendorff","context_page_description":"Erich Friedrich Wilhelm Ludendorff, Alman asker. Liège Muharebesi'nın galibi ve Paul von Hindenburg'la birlikte Tannenberg Muharebesi zaferinin mimarlarından biridir. Alman savaş ve siyaset üzerindeki belirleyici etkisi vardı. 22 Ağustos 1914 tarihinde Kaiser II. Wilhelm tarafından Almanya'nın en yüksek askeri madalyası Pour le Mérite ile taltif edildi."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B8%8C%EB%88%84%EC%95%84_%ED%92%80%EB%B3%B4%EB%A5%B4%EB%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Beno%C3%AEt_Poelvoorde_2013.jpg","page_title":"브누아 풀보르드","context_page_description":"브누아 풀보르드는 벨기에의 배우이다."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D0%B5%D1%86%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/%D0%9F%D0%B0%D0%BC%D1%8F%D1%82%D0%BD%D0%B8%D0%BA_%D0%92.%D0%98._%D0%9B%D0%B5%D0%BD%D0%B8%D0%BD%D1%83_%D0%B2_%D0%B3._%D0%91%D0%B5%D0%BB%D0%BE%D1%80%D0%B5%D1%86%D0%BA%D0%B5.jpg","page_title":"Белорецк","context_page_description":"Белоре́цк — город в России на Южном Урале, административный центр Белорецкого района Республики Башкортостан. Образует муниципальное образование город Белорецк со статусом городского поселения как единственный населённый пункт в его составе."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2,_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD_%D0%A2%D0%B8%D1%85%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/G.Tiumeneva%2CN.Tiuchko%2CV.Borisov.jpg","page_title":"Борисов, Валентин Тихонович","context_page_description":"Валенти́н Ти́хонович Бори́сов — украинский советский композитор, профессор, музыкально-общественный деятель и педагог, заслуженный деятель искусств Украинской ССР.\\nБыл женат на музыковеде Лине Тюменевой.\\nСкончался от рака гортани в возрасте 87 лет.\\nВ Харькове на доме где жил и работал установлена мемориальная доска."},{"page_url":"https://en.wikipedia.org/wiki/Blake_Austin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Blake_Austin_City.jpg","page_title":"Blake Austin","context_page_description":"Blake Austin is a professional rugby league footballer who plays as a stand-off for the Warrington Wolves in the Super League.\\nAustin previously played for the Canberra Raiders, Penrith Panthers and the Wests Tigers in the NRL. He played for the City Origin team in 2015 and Portugual and Great Britain at international level. He has also represented England at 9s."},{"page_url":"https://zh.wikipedia.org/zh-sg/10","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Blair_Cheney_at_Number_10.jpg","page_title":"10","context_page_description":"10是9与11之间的自然数。"},{"page_url":"https://en.wikipedia.org/wiki/Art_Nouveau_religious_buildings","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Queens_Cross_Church07p.jpg","page_title":"Art Nouveau religious buildings","context_page_description":"Art Nouveau temples are churches, chapels, synagogues, and mosques built in the style known as Art Nouveau in French and English languages, Jugendstil in Germany and Nordic countries, Secessionsstil in countries of former Austro-Hungary, Modernisme in Catalan or Modern in Russian. As National Romantic style is also referred to Art Nouveau, churches of that style are also listed here, as well as some temples not of pure Art Nouveau style but with distinctive Art Nouveau features."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9E%D1%80%D0%B4%D1%8D%D0%BD_%D0%94%D0%B0%D0%BD%D0%B5%D0%B1%D1%80%D0%BE%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Scannen0001_dannebrogorde.jpg","page_title":"Ордэн Данеброг","context_page_description":"Ордэн Данеброг — другі па значнасці рыцарскі ордэн Даніі.\\nСэнсавай асновай ордэна стала дзяржаўны сцяг Даніі, на чырвоным поле якога намаляваны белы крыж."},{"page_url":"https://en.wikipedia.org/wiki/Fudge_Farm","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Fudge-Farm-Surgoinsville-tn1.jpg","page_title":"Fudge Farm","context_page_description":"Fudge Farm is a historical farmhouse and property located just east of Surgoinsville, Tennessee, United States. An I-house, it was completed around 1851 and was built by slave labor for local planter Conrad Fudge, who had recently moved to the area from Virginia. Fudge Farm is still in use and privately owned. Aside from the house, the property also has a stock barn, a granary, smokehouse and a well house."},{"page_url":"https://fr.wikipedia.org/wiki/Hilding_Ekelund","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Toolo_church-Helsinki1.jpg","page_title":"Hilding Ekelund","context_page_description":"Hilding Ekelund est un architecte finlandais."},{"page_url":"https://en.wikipedia.org/wiki/Sefer_Torah","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/PikiWiki_Israel_10909_Architecture_of_Israel.JPG","page_title":"Sefer Torah","context_page_description":"A Torah scroll, in Hebrew Sefer Torah, is a handwritten copy of the Torah, meaning: of the Pentateuch, or the five books of Moses. It must meet extremely strict standards of production. The Torah scroll is mainly used in the ritual of Torah reading during Jewish prayers. At other times, it is stored in the holiest spot within a synagogue, the Torah ark, which is usually an ornate curtained-off cabinet or section of the synagogue built along the wall that most closely faces Jerusalem, the direction Jews face when praying.\\nThe text of the Torah is also commonly printed and bound in book form for non-ritual functions. It is then known as a Chumash, and is often accompanied by commentaries or translations."},{"page_url":"https://en.wikipedia.org/wiki/Kursaal_Congress_Centre_and_Auditorium","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Kursaal_kasinoa%2C_Euskal_Herria.jpg","page_title":"Kursaal Congress Centre and Auditorium","context_page_description":"The Kursaal Congress Centre and Auditorium is a complex comprising several spaces: a great auditorium, many-use halls and exhibition halls. It was designed by Spanish architect Rafael Moneo, and is located in Donostia-San Sebastián. It opened in 1999.\\nIt consists of several spaces, including the 1,800-seat concert hall, the Palacio de Congresos-Auditorio Kursaal, and is the home of the biggest film festival in Spain, the San Sebastian International Film Festival, in existence since 1953."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%9D%99%E5%B2%A1%E7%9C%8C%E7%AB%8B%E4%B8%AD%E5%A4%AE%E5%9B%B3%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/The_Research_room_of_children%27s_book_ac_%283%29.jpg","page_title":"静岡県立中央図書館","context_page_description":"静岡県立中央図書館は、静岡市駿河区谷田にある公共図書館。静岡県が図書館法に基づき設置している。\\n「調べる・考える・解決する」をスローガンに、レファレンスを軸とした静岡県内127館の図書館のネットワークづくり、資料の永年保存、地域資料の情報収集などを行い、県内図書館の中核として市町立図書館を支援している。静岡県立美術館に隣接し、近隣に静岡県立大学がある。\\n2017年4月から実施された長寿命化改修の可能性調査により、2階閲覧室床部にひび割れが発見され、同年7月4日から臨時休館となっていたが、同年8月1日から一部入館と資料閲覧を再開し、2018年1月からは事前予約資料の受け取りに関して個人利用者への貸出業務を再開している。"},{"page_url":"https://pl.wikipedia.org/wiki/Park_Ujazdowski_w_Warszawie","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Rzezba_gladiatora_w_Parku_Ujazdowskim_w_Warszawie.jpg","page_title":"Park Ujazdowski w Warszawie","context_page_description":"Park Ujazdowski – zabytkowy park w śródmieściu Warszawy, położony przy Alejach Ujazdowskich między ul. Piękną i placem Na Rozdrożu."},{"page_url":"https://de.wikipedia.org/wiki/Pelecyphora","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Pelecyphora_strobiliformis.jpg","page_title":"Pelecyphora","context_page_description":"Pelecyphora ist eine Pflanzengattung in der Familie der Kakteengewächse. Ihr botanischer Name bezieht sich auf die beilförmigen Warzen der ursprünglich bekannten Art Pelecyphora aselliformis."},{"page_url":"https://cs.wikipedia.org/wiki/Mal%C3%A9_Sundy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Lesser_Sunda_Islands_en.png","page_title":"Malé Sundy","context_page_description":"Malé Sundy je název skupiny ostrovů v jižní části Malajského souostroví na rozhraní Indického a Tichého oceánu. Administrativně patří pod správu indonéských provincií Bali, Nusa Tenggara Barat a Nusa Tenggara Timur, východní část ostrova Timor je nezávislý stát Východní Timor. Souostroví má rozlohu přibližně 73 600 km² souše. Spolu s Velkými Sundami tvoří Sundské ostrovy."},{"page_url":"https://vi.wikipedia.org/wiki/Pami","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Stele_of_Year_2_of_Pami%2C_Louvre.jpg","page_title":"Pami","context_page_description":"Usermaatre Setepenre Pami là một pharaon cai trị 7 năm thuộc Vương triều thứ 22 trong lịch sử Ai Cập cổ đại. Mặc dù không tìm thấy bất cứ mối quan hệ nào giữa ông với vị vua trước - Shoshenq IV, nhưng Pami được chứng thực là cha đẻ của vị vua kế nhiệm Shoshenq V.\\nCái tên \\"Pami\\" của ông trong tiếng Ai Cập có nghĩa là \\"con mèo\\"."},{"page_url":"https://lmo.wikipedia.org/wiki/Castell_de_Praga","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/PONTE_CARLO_-_PRAGA_-_panoramio.jpg","page_title":"Castell de Praga","context_page_description":"El Castell de Praga a l'è on castell che l'è in la capital boema che 'l resaliss al secol quell de IX e che dal 1918 a l'è la Residenza del President de la Cechia. L'è in del quartiee Hradčany, el nucli original de la città. A l'è el castell a corp singol pussee grand del mond cont i sò 70'000 meter quader."},{"page_url":"https://es.wikipedia.org/wiki/Malibcong","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Ph_locator_abra_malibcong.png","page_title":"Malibcong","context_page_description":"Malibcong es un municipio perteneciente a la provincia de Abra en la Región Administrativa de La Cordillera situada al norte de la República de Filipinas y de la isla de Luzón, en su interior."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%98%EB%85%B8%EC%9D%B4_%EA%B9%83%EB%8C%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Flag_tower%2C_Hanoi.jpg","page_title":"하노이 깃대","context_page_description":"하노이 깃대는 베트남 하노이에 있는 타워다. 33.4m이며, 깃발까지 포함하면 41m이다. 시의 상징물 중 하나이며, 세계유산인 하노이 탕롱황성의 일부이기도 한다."},{"page_url":"https://it.wikipedia.org/wiki/Karen_Gillan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Karen_Gillan_by_Gage_Skidmore_3.jpg","page_title":"Karen Gillan","context_page_description":"Karen Sheila Gillan è un'attrice, modella e regista britannica, nota per il ruolo di Amy Pond nella serie televisiva Doctor Who, per quello di Nebula nel Marvel Cinematic Universe e per quello di Ruby Roundhouse in Jumanji - Benvenuti nella giungla e in Jumanji: The Next Level."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%93_%D7%95%D7%99%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ed_Wynn_All_Star_Revue.JPG","page_title":"אד וין","context_page_description":"אד וין היה קומיקאי ושחקן קולנוע יהודי אמריקאי שהיה מועמד לפרס אוסקר לשחקן המשנה הטוב ביותר לשנת 1959 על תפקידו בסרט \\"יומנה של אנה פרנק\\"."},{"page_url":"https://id.wikipedia.org/wiki/Wittenborn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Wittenborn_Wappen.png","page_title":"Wittenborn","context_page_description":"Wittenborn adalah kota yang terletak di distrik Segeberg, Schleswig-Holstein, Jerman. Kota Wittenborn memiliki luas sebesar 6,19 km². Wittenborn pada tahun 2006, memiliki penduduk sebanyak 137 jiwa."},{"page_url":"https://eu.wikipedia.org/wiki/Albalate_de_Zorita","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Albalate_de_Zorita_01.jpg","page_title":"Albalate de Zorita","context_page_description":"Albalate de Zorita Guadalajarako udalerria da, La Alcarria eskualdean dagoena.\\n2009ko urtarrilaren 1eko erroldaren arabera 1.087 biztanle zituen."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8C%8C_%EC%95%94_%ED%86%A0%EB%A7%88%EC%BC%80%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Pa_amb_Tomaquet.jpg","page_title":"파 암 토마케트","context_page_description":"파 암 토마케트는 스페인 카탈루냐, 발렌시아, 안달루시아, 아라곤, 발레아레스, 무르시아 지방의 전통 요리이다. 지역에 따라서 '판 콘 토마테', '파 암 올리' 라고도 부른다. 파 암 토마케트는 카탈루냐 요리의 대표 음식으로 카탈루냐의 상징이기도 하다.\\n파 암 토마케트는 '빵과 토마토'라는 속뜻처럼, 빵에 토마토를 짜내듯 바르고 올리브 오일과 소금을 친 요리다. 가끔씩 토마토를 바르기 전에 마늘을 먼저 바르기도 한다. 이 때 빵은 굽든 굽지 않았든 크게 상관은 없다. 파 암 토마케트는 전통 요리를 벗어나 스페인 전역에 널리 퍼져 있으며, 지중해식 요리의 전형적 사례로 여겨진다. 또 아침부터 저녁까지 어느 때든 간단한 끼니거리나 타파스로 만들어 먹을 수 있기 때문에 인기가 높다."},{"page_url":"https://hr.wikipedia.org/wiki/Bla%C5%BEeni_Alojzije_Stepinac","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/NDH_-_salute.jpg","page_title":"Blaženi Alojzije Stepinac","context_page_description":"Blaženi Alojzije Stepinac, zagrebački nadbiskup i kardinal. Papa Ivan Pavao II. ga je proglasio blaženim 3. listopada 1998. u Mariji Bistrici. Smatra se jednim od velikana Katoličke Crkve u Hrvatskoj.\\nDjetinjstvo je proveo u rodnom mjestu. Za vrijeme Prvoga svjetskog rata sudjelovao je u borbama na talijanskom frontu gdje je bio ranjen i proveo u zarobljeništvu pet mjeseci; potom je bio i na solunskom bojištu. Iz rata se vratio kući s činom potporučnika. Nakon studija u Rimu, zaređen je za svećenika 1930. godine. Na njegov prijedlog osnovan je Caritas Zagrebačke nadbiskupije, kojem je bio na čelu. Imenovan je nadbiskupom koadjutorom 1934. godine. Iste godine zaređen je za biskupa.\\nPostao je zagrebački nadbiskup 1937. godine. Kao žarki i neumorni propovjednik Božje riječi pohađao je svoju prostranu nadbiskupiju promičući Katoličku akciju, Caritas i pobožnost prema Djevici Mariji. Utemeljio je brojne nove župe i organizirao proslavu 1300. obljetnice evangelizacije hrvatskog naroda.\\nZa vrijeme Drugog svjetskog rata pomagao je progonjene i patnike, zbrinuo je 500 prognanih slovenskih svećenika te veliki broj bolesne i gladne djece."},{"page_url":"https://de.wikipedia.org/wiki/Free_for_All_(Blakey-Album)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Art_Blakey08.JPG","page_title":"Free for All (Blakey-Album)","context_page_description":"Free for All ist ein Jazz-Album von Art Blakey und seinen Jazz Messengers. Es wurde am 10. Februar 1964 im Studio von Rudy Van Gelder in Englewood Cliffs, New Jersey aufgenommen und im selben Jahr von Blue Note Records veröffentlicht."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%BC%EB%A7%88%ED%86%A0%EC%BD%94%EC%9D%B4%EC%A6%88%EB%AF%B8_%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Yamato-Koizumi_Station_Yamatokoriyama_Nara_pref_Japan01s3.jpg","page_title":"야마토코이즈미 역","context_page_description":"야마토코이즈미 역은 일본 나라현 야마토코리야마시에 위치한 서일본 여객철도의 역이다."},{"page_url":"https://pl.wikipedia.org/wiki/Jacek_Urbaniak","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Jacek_Urbaniak.jpg","page_title":"Jacek Urbaniak","context_page_description":"Jacek Urbaniak – polski muzyk, instrumentalista, specjalizujący się w instrumentach dętych drewnianych i muzyce dawnej, lider zespołu Ars Nova, kompozytor."},{"page_url":"https://cs.wikipedia.org/wiki/Houbovci","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/White_cup_Sponges.jpg","page_title":"Houbovci","context_page_description":"Houbovci či také houby nebo živočišné houby jsou jednodušší, většinou mořští živočichové s vakovitým tělem. Výjimečně mohou dosahovat průměru až 2,5 metru. Bývají většinou asymetrické, jen místy s náznaky paprsčité symetrie. Žijí přisedle, jen larvy jsou plovoucí. Buňky nevytvářejí pravé tkáně, metabolizují a dýchají samy za sebe, mnohé mohou měnit funkci podle změny umístění. Živí se filtrováním drobných organismů z vody. Jsou to hermafrodité nebo gonochoristi. Množí se i nepohlavně pučením, tvořením gemulí i po odlomení části, neboť mají ohromnou schopnost regenerace."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A7%D7%9C%D7%99%D7%99%D7%A0%D7%A8%D7%99%D7%99%D7%A4%D7%9C%D7%99%D7%A0%D7%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Kath._Pfarrkirche_Hl._Josef%2C_Kleinreifling.jpg","page_title":"קליינרייפלינג","context_page_description":"קליינרייפלינג הוא כפר קטן במחוז שטייר שבאוסטריה עילית באוסטריה. אוכלוסייתו כ-760 נפש, נכון לינואר 2018."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%DA%A9%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Tiberius-Br%C3%BCcke.JPG","page_title":"مارکیا","context_page_description":"مارِکیا رودخانه‌ای به‌طول ۷۰ کیلومتر واقع در شرق ایتالیاست. این رودخانه در دوران باستان آریمینوس نامیده می‌شد که برگرفته از واژهٔ یونانی آریمینوُس و درعین حال نام باستانی ریمینی بود. رود مارکیا از شرق پیه‌وو سانتو استفانو و جنوب غربی بادیا تدالدا در استان آرتزو در توسکانی سرچشمه می‌گیرد و با جریان‌یافتن به سمت شمال شرقی وارد استان پزارو و اوربینو در مارکه می‌شود. این رودخانه سپس با گذشتن از نووافلتریا وارد استان ریمینی در ناحیهٔ امیلیا رومانا می‌شود. سپس در تورلو تا ۱ کیلومتری غرب منطقهٔ سامارینی آکواویوا جریان یافته و رود سن مارینو نیز به آن می‌پیوندد. رود مارکیا سرانجام با گذشتن از وروکیو در نزدیکی ریمینی به دریای آدریاتیک می‌ریزد."},{"page_url":"https://en.wikipedia.org/wiki/Maotianshan_Shales","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Maotianshan_shale_outcrop.JPG","page_title":"Maotianshan Shales","context_page_description":"The Maotianshan Shales are a series of Early Cambrian deposits in the Chiungchussu Formation, famous for their Konservat Lagerstätten, deposits known for the exceptional preservation of fossilized organisms or traces. The Maotianshan Shales form one of some forty Cambrian fossil locations worldwide exhibiting exquisite preservation of rarely preserved, non-mineralized soft tissue, comparable to the fossils of the Burgess Shale. They take their name from Maotianshan Hill in Chengjiang County, Yunnan Province, China.\\nThe most famous assemblage of organisms are referred to as the Chengjiang biota for the multiple scattered fossil sites in Chengjiang. The age of the Chengjiang Lagerstätte is locally termed Qiongzhusian, a stage correlated to the late Atdabanian Stage in Siberian sequences of the middle of the Early Cambrian.\\nThe shales date to ≤518 million years ago. The shales also contain the slightly younger Guanshan biota from Malong District in Yunnan."},{"page_url":"https://arz.wikipedia.org/wiki/NGC_5439_(%D9%85%D8%AC%D8%B1%D9%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/NGC5439_-_SDSS_DR14.jpg","page_title":"NGC 5439 (مجره)","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nNGC 5439 هى مجره بتتبع كوكبه السلوقيان و اللى اكتشفها لويس سويفت و الاكتشاف كان بتاريخ 1 يناير 1883."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84_%D8%AF%D9%8A%D9%83%D9%88%D8%B1%D9%8A%DA%A4%D9%88%D9%86%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Bill_DeCorrevont_-_1948_Bowman.jpg","page_title":"بيل ديكوريڤونت","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبيل ديكوريڤونت كان لاعب كورة القدم الامريكيه من امريكا."},{"page_url":"https://it.wikipedia.org/wiki/Alfredo_Abon_Lee","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Alfredo_Abon_Lee.jpg","page_title":"Alfredo Abon Lee","context_page_description":"Alfredo Abon Lee è stato un militare cubano naturalizzato statunitense di origini cinesi.\\nLee è conosciuto per essere stato un importante comandante batistiano durante la rivoluzione cubana degli anni '50 quando fu al comando della piazzaforte di Yaguajay. Alla fine della guerra civile nel dicembre del 1958 fu al comando delle truppe dell'Esercito Nazionale di Cuba contro i ribelli del Movimento del 26 luglio nella battaglia di Yaguajay quando le sue truppe furono pesantemente sconfitte dai ribelli guidati da Camilo Cienfuegos, cosa che determinò la definitiva sconfitta del regime di Fulgencio Batista e la caduta di quest'ultimo subito dopo il 1º gennaio 1959. Prima di questo impegno Lee aveva servito nel Battaglione 22 impiegato in operazioni nella parte orientale di Cuba.\\nLee andò in esilio negli Stati Uniti d'America, dove morì a Englewood nel 2012."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Phalsbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Phalsbourg_%28Moselle%29_Place_d%27Armes_02_MH.jpg","page_title":"Liste des monuments historiques de Phalsbourg","context_page_description":"Ce tableau présente la liste de tous les monuments historiques classés ou inscrits dans la ville de Phalsbourg, Moselle, en France."},{"page_url":"https://fi.wikipedia.org/wiki/Mille_Lacs","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Garrison_Big_Fish.jpg","page_title":"Mille Lacs","context_page_description":"Mille Lacs Lake myös: Lake Mille Lacs ja Mille Lacs, on järvi Minnesotan osavaltiossa Yhdysvalloissa. Se ulottuu Mille Lacsin, Aitkinin ja Crow Wingin piirikuntien alueelle, Minneapolis-St. Paulin metropolialueen pohjoispuolella. Järven pinta-ala on 536 neliökilometriä, ja sen suurin syvyys on 13 metriä. Odžibwan kielellä järven nimi on Misi-zaaga'igan."},{"page_url":"https://pl.wikipedia.org/wiki/W%C3%B6rth_an_der_Donau","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/Schloss_W%C3%B6rth.jpg","page_title":"Wörth an der Donau","context_page_description":"Wörth an der Donau, Wörth a.d. Donau – miasto w Niemczech, w kraju związkowym Bawaria, w rejencji Górny Palatynat, w regionie Ratyzbona, w powiecie Ratyzbona, siedziba wspólnoty administracyjnej Wörth an der Donau. Leży na pograniczu Lasu Bawarskiego, około 22 km na wschód od Ratyzbony, nad Dunajem, przy autostradzie A3."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D0%B5%D0%BD%D0%B8%D0%BD%D0%BE_(%D0%A2%D0%B2%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/%D0%92%D1%8A%D0%B5%D0%B7%D0%B4_%D0%B2_%D0%BF%D0%BE%D1%81%D0%B5%D0%BB%D0%BE%D0%BA_%D0%9E%D0%BB%D0%B5%D0%BD%D0%B8%D0%BD%D0%BE.jpg","page_title":"Оленино (Тверская область)","context_page_description":"Оле́нино — посёлок городского типа в Тверской области России.\\nАдминистративный центр Оленинского муниципального округа. С 2005 по 2019 год вместе с 3 сельскими населёнными пунктами составлял муниципальное образование посёлок Оленино со статусом городского поселения. С 29 декабря 2019 года, в связи со вступлением в силу Закона Тверской области № 86-ЗО от 18.12.2019 года, городское поселение упразднено.\\nНаселение — 4708 чел.\\nРасположен в 178 км к юго-западу от областного центра, в 5 км от федеральной автомагистрали «Балтия». Железнодорожная станция на линии Москва — Рига."},{"page_url":"https://it.wikipedia.org/wiki/Cladonia_cenotea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Cladonia_cenotea-1.jpg","page_title":"Cladonia cenotea","context_page_description":"Cladonia cenotea Schaer., è una specie di lichene appartenente al genere Cladonia, dell'ordine Lecanorales.\\nIl nome proprio deriva probabilmente dal greco κενὸτης, kenòtes, che significa vuoto."},{"page_url":"https://id.wikipedia.org/wiki/Teater_IMAX_Keong_Emas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Keong_Emas.jpg","page_title":"Teater IMAX Keong Emas","context_page_description":"Teater Imax Keong Emas berbentuk keong raksasa, merupakan tempat pemutaran dan pertunjukan film khusus dengan teknologi canggih, didirikan atas prakarsa lbu Tien Soeharto, dan mulai dioperasikan pada tanggal 20 April 1984.\\nGedung teater yang sangat khas ini dimaksudkan sebagai sarana rekreasi yang mendidik guna memperkenalkan kekayaan alam dan budaya bangsa melalui tanyangan film layar raksasa dengan menggunakan kecanggihan teknologi sinematografi modem Proyektor IMAX.\\nMenonton film di teater ini, penonton serasa ikut berada di dalamnya dan ikut pula berperan sebagai pemain.\\nTeknologi film imax menunjukkan kecanggihan dan kemampuannya untuk menimbulkan daya tarik kuat yang membuat penonton berdecak kagum.\\nBeberapa film tersedia untuk diputar, antara lain film Indonesia Indah I, Indonesia Indah II, Indonesia Indah III, dan Indonesia Indah IV. Semuanya menunjukkan keindahan lingkungan, kekayaan alam, dan keragaman budaya Indonesia."},{"page_url":"https://ms.wikipedia.org/wiki/Antonio_Cassano","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Antonio_Cassano_Euro_2012_vs_England.jpg","page_title":"Antonio Cassano","context_page_description":"Antonio Cassano ialah pemain bola sepak profesional Itali yang bermain sebagai penyerang untuk kelab Serie A, Sampdoria."},{"page_url":"https://an.wikipedia.org/wiki/Cuello_Otal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/05.Cuello_Otal_y_Penya_Ronata.JPG","page_title":"Cuello Otal","context_page_description":"O cuello Otal u cuello d'Otal ye un puerto de montanya d'o Pireneu aragonés, en as sierras interiors, que comunica a valle d'Otal con a valle d'o río Sorrosal, tributaria de a de l'Ara, en a comarca de Sobrarbe. O cuello se troba entre as alturas d'o Pelopín y a Penya Ronata, a 1894 msnm y ye o punto d'unión d'as sierras d'a Manchoya y Erata.\\nIste puerto ye un d'os camins que tradicionalment comunicaban o Sobrepuerto con as atras valles d'a redolada, por a part d'Otal, antiga cabecera d'a valle d'Otal y una d'as poblacions principals en a dita subcomarca. Se troba a menos de cinco-cientos metros d'unatro cuello que tamién comunicaba a valle d'Otal, en iste caso con a de Broto; o cuello Pelopín u puerto de Yosa."},{"page_url":"https://fr.wikipedia.org/wiki/Aix-en-Provence","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Flag_of_Aix-en-Provence.svg","page_title":"Aix-en-Provence","context_page_description":"Aix-en-Provence est une commune française du Sud-Est de la France, dans le département des Bouches-du-Rhône, dont elle est sous-préfecture, en région Provence-Alpes-Côte d'Azur. Elle forme avec 35 autres communes le pays d'Aix au sein de la Métropole Aix-Marseille Provence.\\nFondée en 122 av. J.-C. sous le nom d'Aquae Sextiae par la garnison romaine de Gaius Sextius Calvinus, Aix devient par la suite la capitale du comté de Provence.\\nLa commune compte 142 482 habitants en 2017, ce qui en fait la 24ᵉ plus peuplée de France. Elle constitue avec Marseille une aire urbaine qui comptait 1 756 296 habitants en 2016, soit la troisième aire urbaine de France.\\nVille thermale depuis l'Antiquité, Aix-en-Provence dispose d'un important patrimoine culturel et s'affirme comme un important pôle touristique."},{"page_url":"https://en.wikipedia.org/wiki/Rennell_flying_fox","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Rennell_Flying_Fox_area.png","page_title":"Rennell flying fox","context_page_description":"The Rennell flying fox is a species of flying fox found in the Solomon Islands. It is an endangered species risking extinction."},{"page_url":"https://en.wikipedia.org/wiki/Periballia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Plantarum_indigenarum_et_exoticarum_icones_ad_vivum_coloratae%2C_oder%2C_Sammlung_nach_der_Natur_gemalter_Abbildungen_inn-_und_ausl%C3%A4ndlischer_Pflanzen%2C_f%C3%BCr_Liebhaber_und_Beflissene_der_Botanik_%2815903833759%29.jpg","page_title":"Periballia","context_page_description":"Periballia is a genus of Mediterranean plants in the grass family.\\nSpecies\\nPeriballia involucrata Janka - Spain, Portugal\\nPeriballia laevis Asch. & Graebn. - Spain, Portugal, Morocco, Crimea; naturalized in parts of United States\\nPeriballia minuta Asch. & Graebn. - Spain, Portugal, France incl Corsica, Italy incl Sicily + Sardinia, Greece, Bulgaria, Albania, Croatia, European Turkey, Algeria, Morocco; naturalized in South Africa + Australia"},{"page_url":"https://fr.wikipedia.org/wiki/Gargenville","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Gargenville_-_Lavoir_Centre01.jpg","page_title":"Gargenville","context_page_description":"Gargenville est une commune française située dans le département des Yvelines en région Île-de-France. C'est une petite ville située le long de la Seine, à 45 km à l'ouest de Paris. Avec la commune voisine d'Issou, elle forme une agglomération de 10 000 habitants environ.\\nSes habitants sont appelés les Gargenvillois.\\nLa commune fait partie du parc naturel régional du Vexin français."},{"page_url":"https://pt.wikipedia.org/wiki/Elei%C3%A7%C3%A3o_presidencial_nos_Estados_Unidos_em_1856","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7f/1856DemocraticPoster.png","page_title":"Eleição presidencial nos Estados Unidos em 1856","context_page_description":"A eleição presidencial dos Estados Unidos de 1856 foi a décima-oitava eleição presidencial do país. O presidente em exercício, Franklin Pierce, não foi nomeado pelo Partido Democrata para uma reeleição apesar de seus esforços. O Partido Democrata nomeou James Buchanan, isso se deveu em parte ao fato da lei Kansas-Nebraska de 1854 aprovada por Pierce que revogou o compromisso do Missouri e reabriu a questão da expansão da escravidão no Oeste do país. Isso dividiu os democratas dos estados do Norte e os democratas dos estados do sul. O Partido Whig havia se desintegrado desde a última eleição sobre a questão da escravidão, e novos partidos como o Partido Republicano e o Partido Americano surgiram. O Partido Republicano nomeou John C. Frémont como seu primeiro candidato presidencial."},{"page_url":"https://da.wikipedia.org/wiki/Frederiksstaden","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Amalienborg_from_top_of_church.jpg","page_title":"Frederiksstaden","context_page_description":"Frederiksstaden er et københavnsk bykvarter i Indre By mellem gaderne Bredgade, Sankt Annæ Plads, Toldbodgade og Esplanaden. En del huse på sydsiden af Store Kongensgade er dog opført samtidig med Frederiksstaden. Frederiksstaden omfatter det meste af Sankt Annæ Øster Kvarter og præges af rokokostilen. De fleste ældre huse i bydelen er fredet. Frederiksstaden er optaget i Kulturkanonen."},{"page_url":"https://ro.wikipedia.org/wiki/Pompeia_Plotina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Head_Roman_woman_Glyptothek_Munich_405.jpg","page_title":"Pompeia Plotina","context_page_description":"Pompeia Plotina a fost soția împăratului Traian."},{"page_url":"https://tl.wikipedia.org/wiki/Kolpashevo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ferry_in_Kolpashevo.jpg","page_title":"Kolpashevo","context_page_description":"Ang Kolpashevo ay isang lungsod sa bansang Rusya."},{"page_url":"https://lv.wikipedia.org/wiki/Sib%C4%ABrijas_pe%C4%BCk%C4%81j%C4%ABte","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Prunella_montanella_map2.png","page_title":"Sibīrijas peļkājīte","context_page_description":"Sibīrijas peļkājīte ir neliels peļkājīšu dzimtas dziedātājputns, kas mājo Eiropas galējos ziemeļaustrumos un Āzijas ziemeļu daļā pāri visai Sibīrijai. Izdala divas pasugas."},{"page_url":"https://ceb.wikipedia.org/wiki/Skimmia_laureola","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Skimmia_laureola_Blanco1.128-original.png","page_title":"Skimmia laureola","context_page_description":"Espesye sa tanom nga bulak ang Skimmia laureola. Ang Skimmia laureola sakop sa kahenera nga Skimmia sa kabanay nga Rutaceae."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%98%E3%83%AA%E3%83%9D%E3%83%BC%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/%E3%83%98%E3%83%AA%E3%83%9D%E3%83%BC%E3%83%88%E3%81%AE%E5%A4%A7%E3%81%8D%E3%81%95_JPN_20180207.jpg","page_title":"ヘリポート","context_page_description":"ヘリポート、もしくはヘリ発着場とは、ヘリコプター専用の離着陸場のことである。またその敷地内でヘリコプターが離着陸する場所のみを指す場合はヘリパッドという。さらに航空法に定めるヘリポートとは異なる消防活動のために高層ビルの屋上に設置されたヘリコプターの離着陸場があり、緊急離着陸場および緊急救助用スペースで区別され、火災やテロなどの緊急時にしか使用できない。Hマークは消防・防災ヘリが消火活動や救助活動をするための離着陸施設を指し、Rマークは着陸はせず、ウインチで人員、機材の乗降をする場所を指す。マークは円内にHまたはRの文字が記入される。"},{"page_url":"https://fr.wikipedia.org/wiki/1802_en_Lorraine","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Portrait_Auguste_Migette_par_Marmand.jpg","page_title":"1802 en Lorraine","context_page_description":"Cette page concerne les événements qui se sont produits durant l'année 1802 en Lorraine."},{"page_url":"https://de.wikipedia.org/wiki/Justus_Siebein","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Grabplatten_Eltern_Siebein_Joachim_Specht.jpg","page_title":"Justus Siebein","context_page_description":"Justus Ritter von Siebein war ein bayerischer General, Kommandeur des Militär-Max-Joseph-Ordens und Ritter der Französischen Ehrenlegion."},{"page_url":"https://en.wikipedia.org/wiki/Zuzwil,_St._Gallen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/ZuzwilKirche.jpg","page_title":"Zuzwil, St. Gallen","context_page_description":"Zuzwil is a village and a municipality in the Wahlkreis of Wil in the canton of St. Gallen in Switzerland."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D9%8A%D8%B1%D9%8A%D8%A7%D9%85_%D8%B3%D9%8A%D8%AF%D9%8A%D8%B1%D9%8A%D9%86%D8%B3%D9%83%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Miriam_Sidranski.jpg","page_title":"ميريام سيديرينسكى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nميريام سيديرينسكى منافسه العاب قوى من اسرائيل."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A4%E0%A7%81%E0%A6%81%E0%A6%A4_%E0%A6%B0%E0%A7%87%E0%A6%B6%E0%A6%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Pairedmoths.jpg","page_title":"তুঁত রেশম","context_page_description":"তুঁত রেশম বা বোমবিক্স মোরি আর্থ্রোপোডা পর্বের অন্তর্ভুক্ত ইনসেক্টা শ্রেণীর লেপিডটেরা বর্গের পতঙ্গ। রেশম পোকার ইংরেজি সাধারণ নাম সিল্ক ওর্য়াম তবে এই প্রজাতির রেশম পোকার প্রধান খাদ্য তুঁত গাছের পাতা বলে এদেরকে তুঁত রেশম পোকা বা Mulerry Silkworm বলে।"},{"page_url":"https://pl.wikipedia.org/wiki/Scala_(stolica_tytularna)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Duomo_San_Lorenzo_Scala.JPG","page_title":"Scala (stolica tytularna)","context_page_description":"Scala – stolica historycznej diecezji w Italii erygowanej w roku 987, a włączonej w roku 1603 w skład diecezji Rebellum.\\nWspółczesne miasto Scala w prowincji Salerno we Włoszech. Obecnie katolickie biskupstwo tytularne ustanowione w 1968 przez papieża Pawła VI."},{"page_url":"https://en.wikipedia.org/wiki/Thermal_oxidizer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Basic_thermal_oxidizer.JPG","page_title":"Thermal oxidizer","context_page_description":"A thermal oxidizer is a process unit for air pollution control in many chemical plants that decomposes hazardous gases at a high temperature and releases them into the atmosphere."},{"page_url":"https://de.wikipedia.org/wiki/Dibenzylsulfoxid","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Bencil_sulf%C3%B3xido.png","page_title":"Dibenzylsulfoxid","context_page_description":"Dibenzylsulfoxid ist eine chemische Verbindung aus der Gruppe der Sulfoxide."},{"page_url":"https://es.wikipedia.org/wiki/HEN","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Hen2-sm-left.JPG","page_title":"HEN","context_page_description":"HEN una estructura informática que mediante la implementación de varios tipos de redes, permite realizar pruebas y experimentos para la investigación de tecnologías de red."},{"page_url":"https://en.wikipedia.org/wiki/Holy_water_in_Eastern_Christianity","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Holy_water_in_Thessaloniki.JPG","page_title":"Holy water in Eastern Christianity","context_page_description":"Among Eastern Orthodox and Eastern-Rite Catholic Christians, holy water is used frequently in rites of blessing and exorcism, and the water for baptism is always sanctified with a special blessing.\\nThroughout the centuries, there have been many springs of water that have been believed by members of the Orthodox Church to be miraculous. Some still flow to this day, such as the one at Pochaev Lavra in Ukraine, and the Life-Giving Spring of the Theotokos in Constantinople.\\nAlthough Eastern Orthodox do not normally bless themselves with holy water upon entering a church like Catholics do, a quantity of holy water is typically kept in a font placed in the narthex of the church, where it is available for anyone who would like to take some of it home with them. It is customary for Orthodox to drink holy water, to use it in their cooking and to sprinkle their houses with it.\\nOften, when objects are blessed in the church the blessing is completed by a triple sprinkling with holy water using the words, \\"This is blessed by the sprinkling of this holy water, in the name of the Father, and of the Son, and of the Holy Spirit.\\""},{"page_url":"https://fr.wikipedia.org/wiki/Iouri_Dokho%C3%AFan","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Yury_Dokhoian_2011.jpg","page_title":"Iouri Dokhoïan","context_page_description":"Iouri Dokhoïan est un joueur et un entraîneur d'échecs russe né le 26 octobre 1964 à Zyrianovka. Grand maître international depuis 1988, il fut un des secondants de Garry Kasparov pendant de nombreuses années. En 2009, il a commencé à travailler avec Sergueï Kariakine.\\nSes meilleurs classements mondiaux furent 40ᵉ en janvier 1989 et 41ᵉ joueur mondial en juillet 1989."},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9tiers_du_Moyen_%C3%82ge","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/13-alimenti%2Ccarni_suine%2CTaccuino_Sanitatis%2C_Casanatense_4182.jpg","page_title":"Métiers du Moyen Âge","context_page_description":"Les métiers du Moyen Âge nous sont connus par quelques textes, dont le Livre des métiers d'Étienne Boileau, et des ordonnances royales.\\nLes métiers sont généralement organisés en corporations, avec un saint patron propre à chacune. Les corporations se composent de maîtres et de compagnons.\\nÀ Paris, en 1292, 130 métiers sont répertoriés et organisés."},{"page_url":"https://de.wikipedia.org/wiki/%C3%96hlbergkellergasse","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/%C3%96hlbergkellergasse_1.jpg","page_title":"Öhlbergkellergasse","context_page_description":"Die Öhlbergkellergasse in Pillersdorf ist eine zweizeilige Kellergasse und zählt zu den ursprünglichsten Kellergassen im österreichischen Weinviertel. 1995 wurde sie bei einem Wettbewerb zur Belebung der Kellergassen zur schönsten Kellergasse Niederösterreichs gekürt.\\nDie Weinkeller beiderseits des Hohlweges am Öhlberg sind teilweise schon über 600 Jahre alt, ab dem 18. Jahrhundert wurden dann auch Presshäuser angebaut. Das besondere dieser Kellergasse ist die Natürlichkeit und Ursprünglichkeit der weiß getünchten Keller mit den grünen Türen, die sich beinahe jeglicher Modernisierung entzogen haben.\\nAn den Wochenenden von Mai bis August laden die Winzer abwechselnd zur „Offenen Kellertür“ ein, Wein zu verkosten und die Öhlbergkellergasse und deren Keller zu besichtigen. Die Route des Themenradweges Der Burgunder führt durch die Öhlbergkellergasse."},{"page_url":"https://es.wikipedia.org/wiki/Aracy_de_Almeida","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Araci_de_Almeida_1945.png","page_title":"Aracy de Almeida","context_page_description":"Aracy Teles de Almeida fue una cantora brasileña.​\\nTuvo una gran interacción con el compositor Noel Rosa. También fue jurado del programa Show de Calouros de Silvio Santos. Entre otros, era conocida como \\"Dama da Central\\", pues solamente viajaba en tren, \\"A Dama do Encantado\\", o \\"O Samba Em Pessoa\\".\\nCantaba samba, mas apreciaba la música clásica y se interesaba en la lectura del psicoanálisis, además de tener en su casa cuadros de pintores brasileños como Aldemir Martins, y Di Cavalcanti, con quien mantuvo amistad. Los que vivían con ella en privado o profesional, la veían como una mujer leída y comprendida. Tratada por amigos por el apodo \\"Araca\\", Noel Rosa dijo, en entrevista para \\"A Pátria\\", el 4 de enero de 1936: \\"Aracy de Almeida es, en mi opinión, la persona que interpreta exactamente lo que yo produzco\\"."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D1%80%D0%BA%D0%BE%D0%B2,_%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%AE%D1%80%D1%8C%D0%B5%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/%D0%90%D0%BD%D0%B4%D1%80%D0%B5%D0%B9_%D0%9A%D1%83%D1%80%D0%BA%D0%BE%D0%B2.jpg","page_title":"Курков, Андрей Юрьевич","context_page_description":"Андре́й Ю́рьевич Курко́в — украинский писатель, преподаватель, сценарист."},{"page_url":"https://it.wikipedia.org/wiki/Sean_Giambrone","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Sean_Giambrone_2019_cropped.jpg","page_title":"Sean Giambrone","context_page_description":"Sean Giambrone è un attore e doppiatore statunitense, noto per aver interpretato Adam Goldberg nella serie TV The Goldbergs."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A6%D0%B5%D1%80_(%D0%BE%D0%B1%D1%89%D0%B8%D0%BD%D0%B0_%D0%9A%D0%B8%D1%87%D0%B5%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Cer_106.JPG","page_title":"Цер (община Кичево)","context_page_description":"Цер е село в община Кичево, в западната част на Северна Македония."},{"page_url":"https://es.wikipedia.org/wiki/Compa%C3%B1%C3%ADa_Magall%C3%A1nica","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/LiefdeShip.jpg","page_title":"Compañía Magallánica","context_page_description":"La Compañía Magallánica, también conocida como la Compañía de Rotterdam, fue una empresa neerlandesa fundada en 1598, cuyo objetivo era establecer una ruta comercial a las Indias Orientales a través del cruce del Estrecho de Magallanes.\\nLa compañía fue fundada por varios comerciantes del sur de los Países Bajos, entre los que se encontraban Johan van der Veecken y Pieter van der Hagen. Para su operación, la compañía contaba con una flota compuesta de cuatro barcos y un yate bajo el mando del almirante Jacques Mahu y el vicealmirante Simon de Cordes.​\\nEl 4 de diciembre de 1602 los financistas de la expedición elaboran una escritura pública en notaría, debido a que las naves no habían vuelto luego de tres años, y por tanto debían cobrar el seguro asociado.​"},{"page_url":"https://no.wikipedia.org/wiki/Feng_Guozhang","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Feng_Kuo-chang.jpg","page_title":"Feng Guozhang","context_page_description":"Feng Guozhang var en kinesisk militær og politiker. Han var Republikken Kinas president i 1917-18."},{"page_url":"https://de.wikipedia.org/wiki/Autoradio","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/11-08-05-volkswagen-by-RalfR-08.jpg","page_title":"Autoradio","context_page_description":"Ein Autoradio ist ein Hörfunkempfänger, der für den Einbau in ein Kraftfahrzeug entwickelt wurde. Zu diesem Zweck ist es üblicherweise auf eine Betriebsspannung von 12 V ausgelegt und besitzt ein normiertes oder an den Fahrzeugtyp angepasstes Gehäuse. Autoradios müssen besonders kompakt gebaut und gegenüber Erschütterungen und Temperaturschwankungen unempfindlich sein, was den Einsatz von Heim-Rundfunkempfangsgeräten in Fahrzeugen ausschließt. Viele Geräte können zusätzlich Tonträger wie Audio-CDs, USB-Sticks oder Kompaktkassetten wiedergeben. Im Jahr 2009 stellte Blaupunkt das erste Internet-Autoradio vor."},{"page_url":"https://en.wikipedia.org/wiki/Ponta_Delgada,_S%C3%A3o_Vicente","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Ponta_Delgada%2C_S%C3%A3o_Vicente%2C_Madeira_Island.jpg","page_title":"Ponta Delgada, São Vicente","context_page_description":"Ponta Delgada is a parish in the municipality of São Vicente on the island of Madeira. The population in 2011 was 1,363, in an area of 9.39 km². Ponta Delgada is located on the north coast, 2 km west of Boa Ventura and 6 km east of São Vicente."},{"page_url":"https://id.wikipedia.org/wiki/Pemilihan_umum_Senat_Amerika_Serikat_di_Oklahoma_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Jim_Inhofe_official_senate_portrait_115th_congress.jpg","page_title":"Pemilihan umum Senat Amerika Serikat di Oklahoma 2014","context_page_description":"Pemilihan umum Senat Amerika Serikat di Oklahoma 2014 digelar pada tanggal 4 November 2014 untuk memilih anggota Senat Amerika Serikat yang akan mewakili negara bagian Oklahoma. Pemilu ini diadakan serentak dengan pemilu senat, kongres, dan gubernur lainnya di Amerika Serikat.\\nDalam pemilu ini, Senator pertahana dari Partai Republik, Jim Inhofe, berhasil mempertahankan kursinya dan mengalahkan penantang dari Partai Demokrat, Matt Silverstein."},{"page_url":"https://de.wikipedia.org/wiki/Reggie_Nelson","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/ReggieNelson.jpg","page_title":"Reggie Nelson","context_page_description":"Reggie Lee Nelson ist ein ehemaliger US-amerikanischer American-Football-Spieler in der National Football League. Er spielte für die Jacksonville Jaguars, die Cincinnati Bengals sowie für die Oakland Raiders als Safety. Zwei mal wurde er in den Pro Bowl berufen."},{"page_url":"https://es.wikipedia.org/wiki/Provincia_de_Mil%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Provincia_di_Milano-Stemma.svg","page_title":"Provincia de Milán","context_page_description":"La provincia de Milán fue una provincia de Lombardía. Su capital fue la ciudad de Milán. Su población fue de 3 170 597 habitantes y su superficie de 1575 km².\\nHubo en ella 134 municipios.\\nLa nueva provincia de Monza y Brianza se creó con parte de la provincia de Milán, y estuvo plenamente efectiva en 2009.\\nEn 2015 fue reemplazada por la ciudad metropolitana de Milán."},{"page_url":"https://fr.wikipedia.org/wiki/Neufch%C3%A2tel_(fromage)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Fromage_de_Neufch%C3%A2tel_laitier.JPG","page_title":"Neufchâtel (fromage)","context_page_description":"Le neufchâtel est un fromage français fabriqué dans le pays de Bray et plus particulièrement aux alentours de Neufchâtel-en-Bray. Cette appellation d'origine est préservée via une AOC depuis 1969.\\nLa forme en cœur est typique de ce fromage mais les formes en briquette, bonde, double bonde, carré et triple-cœur sont également enregistrées dans le cahier des charges de la protection.\\nLa race des vaches et leur alimentation, ainsi que la fabrication du fromage sont définies dans le décret de l'appellation.\\nC'est un fromage lactique à base de lait de vache mis en œuvre majoritairement cru, à pâte molle à croûte fleurie, affiné au moins dix jours, d'un poids de 100 à 600 g selon le format.\\nSa période de consommation idéale s'étale d'avril à août."},{"page_url":"https://hu.wikipedia.org/wiki/A_m%C3%A1ltai_l%C3%ADra_bankjegyei","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/SetteGiugno2009.jpg","page_title":"A máltai líra bankjegyei","context_page_description":"Ebben a szócikkben Málta euró előtti fizetőeszköze, a máltai líra pénzjegyeit mutatjuk be.\\nA máltai líra, 1973-ig máltai font 1825-től 2008-ig, az euró bevezetéséig Málta nemzeti valutája, mely 1972. június 22-ig egyenértékű volt a brit font sterlinggel. Málta 1800 és 1813 között brit protektorátus, majd 1813-tól 1964-ig brit koronagyarmat, függetlenségének elnyerése után 1964 és 1974 között a szigetország Máltai Állam néven alkotmányos monarchia perszonálunióban Nagy-Britanniával, 1974 óta pedig köztársaság a Nemzetközösségen belül."},{"page_url":"https://fr.wikipedia.org/wiki/Festival_de_Woodstock","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Woodstock_redmond_hair.JPG","page_title":"Festival de Woodstock","context_page_description":"Le Festival de Woodstock est un festival de musique et un rassemblement emblématique de la culture hippie des années 1960, organisé à White Lake, hameau de Bethel, Comté de Sullivan, dans les montagnes Catskill, dans l'État de New York, sur les terres du fermier Max Yasgur, à une cinquantaine de miles au sud-ouest de Woodstock. Ce qui aurait pu tourner au fiasco par le mélange de drogues et météo désastreuse devient un des plus grands moments de l'histoire de la musique populaire, classé par le magazine Rolling Stone parmi les 50 moments qui ont changé l'histoire du rock 'n' roll, apothéose du mouvement hippie.\\nOrganisé pour se dérouler du 15 au 17 août 1969 et accueillir 50 000 spectateurs, il en accueille finalement environ un demi million, et se poursuivit un jour de plus, soit jusqu'au 18 août 1969 au matin.\\nLe festival accueille les concerts de 32 groupes et solistes de musiques folk, rock, soul et blues. Le budget de rémunération des artistes atteignit au total dix millions de dollars."},{"page_url":"https://ru.wikipedia.org/wiki/Rover_SD1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Rover_SD1_Interior_%282517758216%29.jpg","page_title":"Rover SD1","context_page_description":"Rover SD1 — британский автомобиль, хэтчбек компании British Leyland."},{"page_url":"https://sv.wikipedia.org/wiki/Paphiopedilum_victoria-mariae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Paphiopedilum_victoria-mariae.jpg","page_title":"Paphiopedilum victoria-mariae","context_page_description":"Paphiopedilum victoria-mariae är en orkidéart som först beskrevs av Henry Frederick Conrad Sander och Maxwell Tylden Masters, och fick sitt nu gällande namn av Robert Allen Rolfe. Paphiopedilum victoria-mariae ingår i släktet Paphiopedilum och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9A%E3%82%B9%E3%82%B3%E3%83%BB%E3%82%B5%E3%83%B3%E3%83%8B%E3%83%BC%E3%82%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Pesco_Sannita_-_municipio_e_monumento_ai_caduti.jpg","page_title":"ペスコ・サンニータ","context_page_description":"ペスコ・サンニータは、イタリア共和国カンパニア州ベネヴェント県にある、人口約1,900人の基礎自治体。"},{"page_url":"https://no.wikipedia.org/wiki/The_Amazing_Race_4","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/KKCity5.jpg","page_title":"The Amazing Race 4","context_page_description":"The Amazing Race 4 er den fjerde sesongen av den amerikanske realityserien The Amazing Race. The Amazing Race 4 fulgte tolv lag med to, med et pre-eksisterende forhold, i et kappløp rundt i verden.\\nEkteparet Reichen Lehmkuhl og Chip Arndt vant kappløpet, og ble dermed de første, åpne homofile paret til å vinne The Amazing Race."},{"page_url":"https://pt.wikipedia.org/wiki/Manoao","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Manoao_colensoi_11.JPG","page_title":"Manoao","context_page_description":"Manoao é um género de conífera pertencente à família Podocarpaceae."},{"page_url":"https://es.wikipedia.org/wiki/Scaled_Composites","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Voyager_aircraft.jpg","page_title":"Scaled Composites","context_page_description":"Scaled Composites frecuentemente abreviado Scaled es una compañía aeroespacial propiedad de Northrop Grumman desde 2007 que fue fundada en 1982 en Mojave, California por el famoso diseñador de aviones Burt Rutan y anteriormente llamada Rutan Aircraft Factory. La compañía fue fundada para desarrollar aviones experimentales, pero en la actualidad se centra en el diseño y desarrollo de aviones conceptuales y procesos de fabricación de prototipos para aviones y otros vehículos. Es conocida por diseños interesantes y por su uso de materiales compuestos no metálicos.\\nEl 1 de abril de 2004, el Departamento de Transportes de EE. UU. autorizó a la empresa que indicó como la primera a nivel mundial que tenía una licencia para un vuelo tripulado sub-orbital. La licencia fue aprobada por la Oficina de Transporte Espacial Comercial de la Administración Federal de Aviación, que había apoyado licencias para más de 150 lanzamientos comerciales de vehículos no-tripulados durante sus 20 años de existencia, pero nunca una licencia para un vuelo tripulado en una trayectoria sub-orbital."},{"page_url":"https://fr.wikipedia.org/wiki/Lindelofia_longiflora","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Lindelofia_longiflora4.jpg","page_title":"Lindelofia longiflora","context_page_description":"Lindelofia longiflora est une plante herbacée de la famille des Boraginacées originaire d'Asie himalayenne."},{"page_url":"https://sv.wikipedia.org/wiki/Thulinska_villan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Villa_Gistra_vykort.JPG","page_title":"Thulinska villan","context_page_description":"Thulinska villan är en privatvilla vid nuvarande Saltsjöpromenaden 38 i Saltsjöbaden, Nacka kommun. Villan ritades av arkitekt Carl Westman och uppfördes 1903 för skeppsredaren Carl Gustav Thulin med familj. Thulinska villan är ytterst välbevarad och utpekas av kommunen som en av de mest intressanta i området."},{"page_url":"https://en.wikipedia.org/wiki/Queen_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Marlene_Dietrich_in_Shanghai_Express_%281932%29_by_Don_English.png","page_title":"Queen II","context_page_description":"Queen II is the second studio album by the British rock band Queen. It was released on 8 March 1974 by EMI Records in the UK and by Elektra Records in the US. It was recorded at Trident Studios and Langham 1 Studios, London, in August 1973 with co-producers Roy Thomas Baker and Robin Geoffrey Cable, and engineered by Mike Stone.\\nDescribed as \\"arguably the heaviest Queen album\\", Queen II marked the end of the first phase of the band's career. The album combines a heavy rock sound with art rock and progressive rock elements, and has been called \\"a pillar of grandiose, assaultive hard rock\\" by the Rock and Roll Hall of Fame. Queen II is not a concept album but a collection of songs with a loose theme running throughout. The two sides of the original LP were labelled \\"Side White\\" and \\"Side Black\\", with corresponding photos of the band dressed in white or in black on either side of the record's label face. The white side has songs with a more emotional theme and the black side is almost entirely about fantasy, often with quite dark themes."},{"page_url":"https://de.wikipedia.org/wiki/Borgo_Teresiano","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/10/Pividor_La_Riva_Carciotti.jpg","page_title":"Borgo Teresiano","context_page_description":"Das Borgo Teresiano ist ein Stadtviertel im Zentrum von Triest, direkt östlich des Hafenbeckens, das die österreichische Kaiserin Maria Theresia gegen Mitte des 18. Jahrhunderts erbauen ließ. Das Viertel diente als neues Handelszentrum der Stadt und ist eines der ersten Beispiele einer modernen städtebaulichen Planung. Zusammen mit den Stadtteilen Borgo Giuseppino, Barriera Nuova, San Vito und Città Vecchia bildet das Borgo Teresiano heute den Stadtbezirk 4."},{"page_url":"https://sk.wikipedia.org/wiki/Vysok%C3%A9_Tatry_(pohorie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Vysok%C3%A9_Tatry_r.1922.jpg","page_title":"Vysoké Tatry (pohorie)","context_page_description":"Vysoké Tatry sú najvyššie pohorie na Slovensku a v Poľsku a sú zároveň jediným horstvom v týchto štátoch s alpským charakterom. Sú geomorfologickou časťou Východných Tatier a majú rozlohu 341 km²."},{"page_url":"https://sh.wikipedia.org/wiki/Leonardo_Ara%C3%BAjo","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Leonardo_Nascimento_de_Araujo_2011.jpg","page_title":"Leonardo Araújo","context_page_description":"Leonardo Araújo je brazilski nogometaš."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D1%80%D0%B5%D0%BD%D1%86%D0%BE_%D0%92%D0%B5%D0%BD%D0%B5%D1%86%D0%B8%D0%B0%D0%BD%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/9_Lorenzo_Veneziano%2C_Annonciation_Polyptych._1371._Gallerie_dell%27Accademia%2C_Venice.jpg","page_title":"Лоренцо Венециано","context_page_description":"Лоренцо Венециано — итальянский живописец."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%88%D9%83_%D9%81%D8%A7%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/IAMap-doton-RockValley.PNG","page_title":"روك فالي","context_page_description":"روك فالي ‏ هي مدينة تقع في ولاية آيوا في الولايات المتحدة. تبلغ مساحة هذه المدينة 8.47، وترتفع عن سطح البحر 381 م، بلغ عدد سكانها 3354 نسمة في عام 2012 حسب إحصاء مكتب تعداد الولايات المتحدة."},{"page_url":"https://ceb.wikipedia.org/wiki/Kisumu_(kapital_sa_lalawigan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Kisumu_montage.png","page_title":"Kisumu (kapital sa lalawigan)","context_page_description":"Kapital sa lalawigan ang Kisumu sa Kenya. Nahimutang ni sa lalawigan sa Kisumu, sa kasadpang bahin sa nasod, 260 km sa amihanan-kasadpan sa Nairobi ang ulohan sa nasod. 1,174 metros ibabaw sa dagat kahaboga ang nahimutangan sa Kisumu, ug adunay 216,479 ka molupyo.\\nAng yuta palibot sa Kisumu kay patag sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabungtoran. Ang yuta palibot sa Kisumu nga tinakpan sa ubos sa habagatan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 1,848 ka metro ug 13.6 km sa amihanan-sidlakan sa Kisumu. Dunay mga 343 ka tawo kada kilometro kwadrado sa palibot sa Kisumu nga hilabihan populasyon. Kisumu ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kasagbotan ang palibot sa Kisumu.\\nAng klima habagat. Ang kasarangang giiniton 24 °C. Ang kinainitan nga bulan Pebrero, sa 27 °C, ug ang kinabugnawan Mayo, sa 21 °C. Ang kasarangang pag-ulan 1,991 milimetro matag tuig. Ang kinabasaan nga bulan Abril, sa 301 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 60 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Paavo_Ruotsalainen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Paavon_pirtti.JPG","page_title":"Paavo Ruotsalainen","context_page_description":"Paavo Ruotsalainen, eigentlich Påhl Henrik Ruotsalainen, bekannt unter dem Namen Ukko-Paavo, war ein finnischer Bauer und Laienprediger.\\nPaavo Ruotsalainen wurde als ältester Sohn eines Bauern geboren. Seine erste Bibel erhielt er mit sechs Jahren. Zum Zeitpunkt seiner Konfirmation hatte er sie bereits dreimal gelesen. Sein Vertieftsein in die Worte der Bibel brachte ihm den Spitznamen närrischer Paavo ein. Als er im Winter 1799 von dem Laienpastor Jakob Högman in Jyväskylä hörte, ging er sofort die 200 km zu Fuß nach Jyväskylä. Dieser Besuch legte die Grundlage für sein religiöses Leben."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D1%84%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/L%C3%ADnea_de_Wallace.jpg","page_title":"Географија","context_page_description":"Географија или земљопис је комплексна наука која проучава природне и друштвене појаве и процесе у геопростору, те везе и односе између њих. Назив географија је грчког порекла и долази од gea-Земља и grafein-писати, описивати. Прва особа која је користила реч „γεωγραφία” je bio Ератостен. Уз филозофију и историју, географија припада међу најстарије науке људске цивилизације. Она се за објашњавање географског простора користи методама природних и друштвених наука. С обзиром на разнозначност геопростора, географија је као наука врло комплексна. То је једина дуална наука, која повезује природне и друштвене науке. Назива се и светском дисциплином.\\nГеографија је, дакле, синтетичка наука, која спаја многа достигнућа бројних наука ради објашњавања географског простора. Она припада у групи природних наука, јер јој је основно полазиште у природним обележјима геопростора. Географија као наука о географском простору објашњава раширеност, утицаје и међузависност свих најважнијих природних и друштвених чиниоца, који суделују у обликовању геопростора као целине или његових просторних делова."},{"page_url":"https://it.wikipedia.org/wiki/Kaycee_Stroh","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/KayCee_Stroh.jpg","page_title":"Kaycee Stroh","context_page_description":"Kaycee Stroh è un'attrice e ballerina statunitense, conosciuta maggiormente per il suo ruolo nei film Disney per la televisione, High School Musical il suo sequel, High School Musical 2 e il suo ultimo capitolo High School Musical 3: Senior Year."},{"page_url":"https://en.wikipedia.org/wiki/Hammuda_Pasha_Bey","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Hamouda_Bacha_Mosque1.JPG","page_title":"Hammuda Pasha Bey","context_page_description":"Hammuda Pasha Bey, died 1666 was the second Bey of the Tunisian Muradid dynasty. He reigned from 1631 until his death."},{"page_url":"https://cs.wikipedia.org/wiki/Rab%C5%A1tejn_nad_St%C5%99elou_(hrad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Z%C3%A1mek_Rab%C5%A1tejn_nad_St%C5%99elou%2C_k%C5%99esla.jpg","page_title":"Rabštejn nad Střelou (hrad)","context_page_description":"Rabštejn nad Střelou je hrad přestavěný na zámek ve stejnojmenném historickém městečku u Manětína v okrese Plzeň-sever. Založen byl Oldřichem Pluhem z Rabštejna ve třicátých letech čtrnáctého století. V dalších letech se mezi majiteli vystřídala řada šlechtických rodů a po určitou dobu patřil českým králům. Podobu středověkého gotického hradu výrazně ovlivnily vestavby klášterů a budovy barokního zámku. Celý areál je chráněn jako kulturní památka České republiky."},{"page_url":"https://it.wikipedia.org/wiki/Bianco_e_nero","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Fig_2b.jpg","page_title":"Bianco e nero","context_page_description":"Bianco e nero o bianconero, spesso abbreviato in B/N, indica una forma di rappresentazione visiva che non utilizza il colore. Il termine fa riferimento al solo uso del bianco e del nero, anche se in realtà vengono poi normalmente utilizzate tutte le gradazioni di grigio intermedie, da qui le immagini a livelli di grigio.\\nRappresentare la realtà in bianconero coinvolge sia le arti pittoriche, sia la storia del cinema e della fotografia. Se agli albori di queste due ultime arti, la rappresentazione dei soggetti era obbligatoriamente in bianconero, con il tempo, riprendere in bianconero derivò solamente da una scelta artistica.\\nNella fotografia bianconero, determinare un metodo ripetibile e non casuale, con il quale attribuire agli elementi di una scena una consapevole gradazione di grigio è stata la ricerca d’elezione per ogni fotografo e cineasta del bianconero. Le problematiche annesse a tale ricerca sono tutte legate alla qualità della pellicola adoperata, la sua sensibilità e il suo sviluppo in funzione della sua esposizione."},{"page_url":"https://fy.wikipedia.org/wiki/Honkbal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Zack_Greinke_on_July_29%2C_2009.jpg","page_title":"Honkbal","context_page_description":"Honkbal is in slachsport dy't spile wurdt troch twa teams mei njoggen spilers. It spul komt oarspronklik út de Feriene Steaten. Hjoed-de-dei is honkbal ek populêr yn Meksiko, de Kariben en grutte dielen fan Azië. Yn Europa is de sport net hiel bot populêr.\\nOant en mei de Olympyske Simmerspullen 2008 wie honkbal in olymyske sport."},{"page_url":"https://pl.wikipedia.org/wiki/Kr%C4%99czynka_jesienna","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Spiranthes_spiralis_tubers_Hompelvoet_RF.JPG","page_title":"Kręczynka jesienna","context_page_description":"Kręczynka jesienna – gatunek byliny z rodziny storczykowatych."},{"page_url":"https://hr.wikipedia.org/wiki/Vladimir_Popovi%C4%87_%E2%80%93_%C5%A0panac","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Vladimirp.JPG","page_title":"Vladimir Popović – Španac","context_page_description":"Vladimir Popović Vlado Lukin aktivist lijevog političkog usmjerena, vojnik, general, diplomat, političar za vrijeme SFRJ, suradnik Josipa Broza Tita."},{"page_url":"https://ro.wikipedia.org/wiki/R%C3%A2ul_Madeira","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c6/Madeirarivermap.jpg","page_title":"Râul Madeira","context_page_description":"Râul Madeira este o cale navigabilă majoră în America de Sud, de aproximativ 3,250 km lungime. El străbate Bolivia și Brazilia."},{"page_url":"https://sl.wikipedia.org/wiki/Ciprnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Ciprnik1.jpg","page_title":"Ciprnik","context_page_description":"Ciprnik je razgledni vrh na jugozahodnem koncu pobočja, ki poteka med dolino Male Pišnice in Planice. Severovzhodni vrh gore predstavlja vrh Vitranc, pod katerim se nahajajo kranjskogorska smučišča. Najlažji dostop na Ciprnik je zložna pot po vrhu grebena od Doma na Vitrancu. Z vrha Ciprnika je razgled na Ponce, Jalovec, Planico, Tamar, Mojstrovko in Slemenovo špico, na dolino Male Pišnice, Martuljške gore, Karavanke, Dobrač in avstrijske tritisočake."},{"page_url":"https://fy.wikipedia.org/wiki/Litografy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Het_leelijke_jonge_eendje.jpg","page_title":"Litografy","context_page_description":"Litografy is in grafyske technyk, dy’t by de flakdruk heart. It wurd is ôflaat fan de Grykske wurden λίθος lithos en γράφειν grafein en betsjut stiendruk.\\nLitografy makket gebrûk fan it fet yn it tekenmateriaal en yn de drukinket. As drager fan de tekening moat in beskaat soarte kalkstien of in coate metalen plaat. As de tekening ôf is, wurdt de stien wiet holden en it tekenmateriaal ferfongen troch drukinket. Mei in parse wurd de beïnke tekening oerbrocht op papier.\\nDe litografy is tusken 1794 en 1798 stal jûn troch Alois Senefelder. Hy socht in manier om syn skreaune toanielstikjes fermannichfâldigje te kinnen. It earste kommersjele súkses helle er ein 18e iuw mei it útjaan fan blêdmuzyk. Nei allerhande eksperiminten fûn er by tafal út dat Solnhofener kalkstien by útstek as byld- en tekstdrager funksjonearje koe. It tafal wol dat er yn Beieren wenne, Súd-Dútslân, dêr’t dy ‘suvere’ kalkstien út de folop foarhannen wie."},{"page_url":"https://fr.wikipedia.org/wiki/Basilique_Notre-Dame-du-Port_de_Clermont-Ferrand","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/NDPort-4675-0026.jpg","page_title":"Basilique Notre-Dame-du-Port de Clermont-Ferrand","context_page_description":"La basilique Notre-Dame-du-Port est une église collégiale française de style roman auvergnat, située à Clermont-Ferrand dans le quartier du Port, entre la place Delille et la cathédrale.\\nDu Xᵉ siècle à la Révolution, elle fut desservie par une communauté de chanoines, sécularisés dès avant le XIIIᵉ siècle. Elle a été élevée au rang de basilique mineure en 1881 par le pape Léon XIII.\\nClassée monument historique sur la première liste de 1840, elle a été inscrite le 2 décembre 1998 au Patrimoine Mondial de l'Unesco au titre des Chemins de Saint-Jacques-de-Compostelle en France.\\nSa dénomination proviendrait du nom du quartier où elle a été construite « le Port », en latin portus, qui signifie « l'entrepôt ». C'était l'endroit où l'on apportait et stockait les marchandises. L'ancienne Porte Royale qui se situait en bas de l'actuelle rue du Port, était le lieu par lequel arrivaient les marchandises dans la ville, ce qui confirme le rôle de passage et d'échange de l'endroit. Néanmoins, le Portus n'est pas attesté dans les écrits anciens avant 1065."},{"page_url":"https://lv.wikipedia.org/wiki/Di%C4%81nas_smaile","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Atlantic_Ocean_laea_relief_location_map.jpg","page_title":"Diānas smaile","context_page_description":"Diānas smaile ir Apvienotajai Karalistei piederošās Svētās Helēnas salas augstākā virsotne. Izvietojies vulkāniskās izcelsmes salas vidusdaļā. 81 ha liela teritorija ap Diānas smaili 1996. gadā pasludināta par nacionālo parku endēmo augu biomu aizsardzībai."},{"page_url":"https://en.wikipedia.org/wiki/World_Aquarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/World_Aquarium.jpg","page_title":"World Aquarium","context_page_description":"The World Aquarium was an interactive animal exhibition, conservation research center, and animal sanctuary located in Laclede's Landing, St. Louis, Missouri, United States. It closed in mid-2019. Some highlights of the child-centered exhibition are being able to feed and touch many animals. The museum allows general admission, school tours and behind-the-scenes tours.\\nThe aquarium houses a variety of animals such as sharks, rays, turtles, parrots, marsh turtles, otter, snakes, alligator, crocodile and sloth. The displays are located on 2 levels, one with large fish in large displays and the other level with filled with smaller displays designed for child-centered experiences.\\nAccording to the curator, the mission of World Aquarium is to increase the knowledge of aquatic life and environments, to enable people to conserve the world of water, and to provide leadership for the preservation and sustainable use of aquatic resources globally.\\nThe aquarium depends heavily on its volunteers and donations. Some volunteers have been working for five years or more."},{"page_url":"https://en.wikipedia.org/wiki/Kikwete_Cabinet","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Christopher_Chiza.png","page_title":"Kikwete Cabinet","context_page_description":"The Kikwete Cabinet was formed by President Jakaya Kikwete after taking the oath of office on 21 December 2005. Kikwete had won a landslide victory in the 2005 presidential election receiving 80.2 percent of the popular vote. His inaugural cabinet had seven women ministers, the highest in the nation's history."},{"page_url":"https://hsb.wikipedia.org/wiki/%C4%8Cechow_(Oblas%C4%87_Moskwa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%D0%90%D0%B4%D0%BC%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%28%D0%A7%D0%B5%D1%85%D0%BE%D0%B2%29.jpg","page_title":"Čechow (Oblasć Moskwa)","context_page_description":"Čechow je město ze 67.000 wobydlerjemi w ruskej oblasći Moskwa.\\nLeži při rěce Lopasnja něhdźe 50 kilometrow wuchodnje Moskwy.\\nSydlišćo je so w 14. lětstotku jako wjes Lopasnja załožiło a ma wot lěta 1954 měšćanske prawa."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_man%C5%BEelek_panovn%C3%ADk%C5%AF_Svat%C3%A9_%C5%99%C3%AD%C5%A1e_%C5%99%C3%ADmsk%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Adelheid_von_Burgund.jpg","page_title":"Seznam manželek panovníků Svaté říše římské","context_page_description":"Seznam manželek panovníků Svaté říše římské zahrnuje franské královny a panovnice Svaté říše římské, od roku 843 do zániku říše v roce 1806. Francká říše byla rozdělena Verdunskou smlouvou z roku 843 na tři části. Z říše Východofranské, která připadla Ludvíku II. Němci, vznikla roku 962 Svaté říše římské a později Svaté říše římské národa německého.\\nPro přehlednost jsou jednotlivé panovnice řazeny chronologicky a podle dynastií, vládnoucích ve Svaté říši římské."},{"page_url":"https://cs.wikipedia.org/wiki/%C4%8Cernovice_(p%C5%99%C3%ADrodn%C3%AD_pam%C3%A1tka)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Reitter_lucanus_cervus.jpg","page_title":"Černovice (přírodní památka)","context_page_description":"Černovice jsou přírodní památka východně od obce Černovice v okrese Chomutov. Důvodem vyhlášení chráněného území je ochrana lokality s výskytem roháče obecného a jeho biotopu."},{"page_url":"https://es.wikipedia.org/wiki/Bleona_Qereti","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Bleona_Qereti.jpg","page_title":"Bleona Qereti","context_page_description":"Bleona Qereti, también conocida simplemente como Bleona, es una cantante, modelo y actriz albanesa. Desde 2009 reside en Estados Unidos, donde ha trabajado con productores como Timbaland, Rodney Jerkins o el ganador de un Grammy David Foster.​ Bleona ha lanzado dos sencillos desde entonces, incluyendo \\"Show Off\\" y \\"Pass Out\\", este último coproducido por Timbaland. En septiembre de 2013 lanzó el sencillo \\"Take It Like A Man\\", que entró en el 7.º puesto de las listas británicas. La cantante fue catalogada como la \\"Madonna de Albania\\" por el New York Daily News.​"},{"page_url":"https://ca.wikipedia.org/wiki/Ertil","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Ertil.png","page_title":"Ertil","context_page_description":"Ertil - Эртиль - és una ciutat de la província de Vorónej, a Rússia."},{"page_url":"https://es.wikipedia.org/wiki/Borealopelta_markmitchelli","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Borealopelta_Royal_Tyrrell_2.jpg","page_title":"Borealopelta markmitchelli","context_page_description":"Borealopelta markmitchelli es la única especie del género Borealopelta de dinosaurio tireóforo nodosáurido, que vivió a mediados del período Cretácico, hace aproximadamente 125 millones de años, en la época del Aptiense, en lo que hoy es Norteamérica. Contiene una sola especie, B. markmitchelli, nombrada en 2017 por Caleb Brown y colegas a partir de un espécimen bien preservado conocido como el nodosaurio de Suncor. Descubierto una mina poseída por la compañía de energía de Suncor en Alberta, Canadá, el espécimen es notable para estar entre los fósiles mejor conservados de dinosaurio de su tamaño jamás encontrado. Conserva no solo la armadura con osteodermos en sus posiciones en vida, sino también restos de sus vainas de queratina y piel superpuesta. También se encontraron melanosomas que indican un tono de piel rojiza sombreada. En el momento de su descubrimiento, fue descrito como el fósil mejor conservado de su tipo jamás encontrado."},{"page_url":"https://fr.wikipedia.org/wiki/Hudson_(fleuve)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Hudson_River_at_Norrie_State_Park.jpg","page_title":"Hudson (fleuve)","context_page_description":"L'Hudson est un fleuve de 507 km de long, coulant principalement dans l'État de New York et formant en partie la frontière entre les États de New York et du New Jersey. Le nom du fleuve provient de Henry Hudson, un Anglais naviguant pour le compte des Provinces-Unies et notamment de la Compagnie néerlandaise des Indes orientales, qui explora le fleuve en 1609. Cependant, le premier Européen en mesure de l'observer fut l'Italien Giovanni da Verrazano en 1524, dont l'expédition fut financée par les marchands florentins de Lyon et par François Iᵉʳ."},{"page_url":"https://no.wikipedia.org/wiki/Fylkesvei_3750","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/FV252_A-A_mot_RV41.jpg","page_title":"Fylkesvei 3750","context_page_description":"Fylkesvei 3750 går mellom Mollestad og Oggevatn i Birkenes kommune. Veien er 20,2 km lang.\\nFrem til 2019 hadde veien betegnelsen fylkesvei 252."},{"page_url":"https://es.wikipedia.org/wiki/Ohanavan","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Ohanavan.JPG","page_title":"Ohanavan","context_page_description":"Ohanavan es una localidad del raión de Ashtarak, en la provincia de Aragatsotn, Armenia, con una población censada en octubre de 2011 de 2312 habitantes.\\nSe encuentra ubicada en el centro de la provincia, cerca del monte Aragáts y a poca distancia al noroeste de Ereván y al norte de la frontera con la provincia de Armavir.​"},{"page_url":"https://cs.wikipedia.org/wiki/Jaroslav_%C5%A0ebek","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Biskupsk%C3%A9_sv%C4%9Bcen%C3%AD_Z._Wasserbauer_2018-05-19_Jaroslav_%C5%A0ebek.jpg","page_title":"Jaroslav Šebek","context_page_description":"Jaroslav Šebek je český historik, pracovník Historického ústavu AV ČR Praha, zaměřující se na dějiny českých zemí 20. století, zejména dějiny politických stran, česko-německé vztahy a církevní dějiny."},{"page_url":"https://cs.wikipedia.org/wiki/Hr%C3%A1dky","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/P%C5%99%C3%ADrodn%C3%AD_rezervace_Hr%C3%A1dky%2C_okres_Blansko_%2802%29.jpg","page_title":"Hrádky","context_page_description":"Hrádky je přírodní rezervace ev. č. 1471 poblíž obce Osiky v okrese Brno-venkov. Oblast spravuje AOPK Brno.\\nDůvodem ochrany je jedinečně zachovalé přirozené společenstvo javorových bučin na rozhraní 4. a 5. vegetačního stupně. Lokalita je pozoruhodná i z geologického a geomorfologického hlediska jako příklad uložených poměrů rul a selekce mrazovým zvětráváním, území je významné i ornitologicky. Prostor rezervace zahrnuje vrcholovou partii a část svahů stejnojmenného vrchu s nadmořskou výškou 627 metrů spadajícího do Hornosvratecké vrchoviny."},{"page_url":"https://en.wikipedia.org/wiki/Pari_Lake","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/The_Freezing_Pari_Lakes_by_Crazy_Adventures_of_Swat_Valley.jpg","page_title":"Pari Lake","context_page_description":"Pari Lake is located approximately 14,442 feet above sea level, in the mountain ranges of Utror Valley, Kalam, Swat Valley, Khyber Pakhtunkhwa, Pakistan. It is comparatively greater in size and depth than the other lake situated in its vicinity and remains open in the months of July till September. The western face of the lake is open and its water flows down to the gigantic Kundol Lake which is situated in the foothills. There are in fact two lakes that share the common name and are sometimes referred to as lake 1 and lake 2.\\nThe name pari or Khapiro is given to this lake because of the belief that this lake is the house of fairies, where they reside and bathe in the pure, cool and clear water of the lake. To the North east of the Utror Valley this lake is situated and one can get access there by trekking. This trek is very dangerous and frustrating, the way is narrow bends and turns So, more care should be taken."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_4e_arrondissement_de_Paris","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Eglise_saint_louis_en_l%27ile.jpg","page_title":"Liste des monuments historiques du 4e arrondissement de Paris","context_page_description":"Cet article recense les monuments historiques du 4ᵉ arrondissement de Paris, en France."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B6%81%EC%84%9C%EC%B2%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Hangul.png","page_title":"궁서체","context_page_description":"궁서체 또는 궁체는 조선 시대 중기 이후에 궁녀들이 한글을 보다 빠르고 유연하게 쓰기 위해 사용한 한글 서체다. 선이 맑고 곧으며 단정하고 아담한 것이 특징으로, 현재 한글 서체의 표준이 되었다."},{"page_url":"https://lt.wikipedia.org/wiki/Kabana","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Cabana-Vista_desde_el_distrito_de_Tauca.JPG","page_title":"Kabana","context_page_description":"Kabana – miestas Peru, Ankašo departamento šiaurėje. Paljaskos provincijos centras. Kelias į Korongą.\\nKabana gyvuoja dar nuo priešinkinių laikų. Oficialiai įkurta 1857 m. sausio 2 d., o nuo 1901 m. tapo provincijos sostine. Apylinkėse gausu archeologinių radimviečių.\\n1946 m. Kabanoje gimė Peru prezidentas Alejandro Toledo."},{"page_url":"https://de.wikipedia.org/wiki/Hadamar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Hadamar_Gedenkst%C3%A4tte_Mahnmal.JPG","page_title":"Hadamar","context_page_description":"Hadamar ist eine Stadt im mittelhessischen Landkreis Limburg-Weilburg.\\nSie grenzt an die Kreisstadt Limburg an der Lahn und liegt zwischen Köln und Frankfurt am Main am Südrand des Westerwaldes am Elbbach in einer Höhe von 120 bis 390 m ü. NN.\\nBekannt ist Hadamar auch für die am Stadtrand gelegene Vitos Klinik für Psychiatrie und Psychotherapie Hadamar, in deren Nebengebäuden sich die Gedenkstätte Hadamar befindet. Dort wird an die Ermordung von Menschen mit Behinderungen und psychischen Erkrankungen während der Zeit des Nationalsozialismus in der als Tötungsanstalt Hadamar benutzten Heil- und Pflegeanstalt Hadamar erinnert."},{"page_url":"https://id.wikipedia.org/wiki/Stasiun_Huitonglu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/201704_Huitonglu_Station.jpg","page_title":"Stasiun Huitonglu","context_page_description":"Stasiun Huitonglu, adalah sebuah stasiun dari Jalur 4 Nanjing Metro. Stasiun tersebut mulai beroperasi pada 18 Januari 2017."},{"page_url":"https://de.wikipedia.org/wiki/Bulgari","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Wallrafplatz_K%C3%B6ln_-_Reklame-7897.jpg","page_title":"Bulgari","context_page_description":"Bulgari ist ein weltweit im Luxusgütersektor und Hotelgewerbe tätiges italienisches Unternehmen mit Sitz in Rom. Bulgari ist für Schmuck, Uhren, Parfüm und Lederwaren bekannt.\\nDas 1884 gegründete ehemalige Familienunternehmen ist – nach Cartier und Tiffany & Co. – der drittgrößte Schmuckhersteller der Welt und gehört seit 2011 mit 50,4 % zu Moët Hennessy Louis Vuitton."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%AA%E5%8F%A4%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Tai_Koo_Station_2020_08_part6.jpg","page_title":"太古站","context_page_description":"太古站是港鐵港島綫的一個鐵路車站，位於香港東區康山地底，由法國濬海工程及干尼有限公司負責興建，於1985年5月31日啟用。車站所在的位置，鄰近鰂魚涌往昔的一座大型船塢「太古船塢」，該船塢於1980年代被太古地產改建為大型住宅屋苑太古城，因而取為站名。該站建有兩個上蓋物業，分別為康怡花園及康山花園。"},{"page_url":"https://en.wikipedia.org/wiki/Armorial_of_Romania","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Interbelic_Baia_County_CoA.png","page_title":"Armorial of Romania","context_page_description":"The Romanian government is the armiger in Romania. It exercises this right under the mandatory advice of the National Committee of Heraldry, Genealogy and Sigillography. The committee is subordinate to the Romanian Academy. All the coats of arms of Romanian institutions must be approved by this committee with two exceptions. The Romanian military is subject to the Ministry of National Defense Heraldric Committee, and Romanian law enforcement institutions are subject to the Ministry of Administration and Interior Heraldric Committee. Both of these committees may share members with the National Committee of Heraldry, Genealogy and Sigillography."},{"page_url":"https://en.wikipedia.org/wiki/Southern_National","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Bristol_Harbourside_-_Southern_National_334_C896GYD.jpg","page_title":"Southern National","context_page_description":"Southern National was a bus company operating in South West England from 1929 until 1969, and again from 1983 until 1999."},{"page_url":"https://en.wikipedia.org/wiki/A_Slice_of_Reality","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/London_MMB_%C2%BB004_Thames_Path.jpg","page_title":"A Slice of Reality","context_page_description":"A Slice of Reality is a work of modern art by Richard Wilson sitting by the Millennium Dome on the north-western bank of the Greenwich Peninsula. It consists of a 9-metre sliced vertical section through the former 800-ton 60-metre sand dredger Arco Trent and exposes portions of the former living quarters of the vessel to the elements."},{"page_url":"https://hu.wikipedia.org/wiki/Monaco","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Monacoc1890.jpg","page_title":"Monaco","context_page_description":"Monaco, hivatalos nevén Monacói Hercegség egy önálló és független városállam, a világ második legkisebb országa, amely Franciaország és a Földközi-tenger közé ékelődik a francia Riviérán. Egyedül Franciaországgal határos. Területe, amely szinte csak Monaco városából áll, a világ legsűrűbben lakott országa. Monaco adóparadicsom mind a lakosság, mind a helyi bejegyzésű cégek számára. 1292 óta a Grimaldi-ház uralkodik a hercegségben. A jelenlegi uralkodó II. Albert."},{"page_url":"https://cs.wikipedia.org/wiki/Kanton_Nexon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Map_canton_code_87_18.svg","page_title":"Kanton Nexon","context_page_description":"Kanton Nexon je francouzský kanton v departementu Haute-Vienne v regionu Limousin. Tvoří ho devět obcí."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Lutzelbourg_(Lutzelbourg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Lutzelbourg_3.jpg","page_title":"Château de Lutzelbourg (Lutzelbourg)","context_page_description":"Le château du Lutzelbourg est un château fondé par Pierre de Lutzelbourg au XIᵉ siècle sur un promontoire rocheux dominant à 322 m d'altitude la vallée de la Zorn en France, à Lutzelbourg, Moselle.\\nIl fait l’objet d’un classement au titre des monuments historiques depuis février 1930."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Monuments_historiques_in_Metz","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Metz_-_Corps_de_garde_sur_la_place_d%27Armes.jpg","page_title":"Liste der Monuments historiques in Metz","context_page_description":"Die Liste der Monuments historiques in Metz führt die Monuments historiques in der lothringischen Stadt Metz auf."},{"page_url":"https://eo.wikipedia.org/wiki/Castle_Donington","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/DoningtonHallCastleDonington.jpg","page_title":"Castle Donington","context_page_description":"Castle Donington estas loĝloko kun proksimume 7000 loĝantoj en la nordoriento de la provinco Leicestershire de Anglio. En ĝia areo troviĝas la flughaveno East Midlands Airport, 2 kilometrojn sude de la loĝloka centro. La regione centra urbo, Leicester, situas 40 kilometrojn sudokcidente.\\nLa flughaveno East Midlands Airport estas aviadila celo de pluraj flugkompanioj, inter alie de la flugkompanio British Midland International, kies ĉefa sidejo situas en la palaco Donington Hall kadre de la loĝloko, sed ankaŭ de Ryanair, EasyJet, Thomson Airways kaj pluraj aliaj. En la loĝloko ankaŭ situas la mondfama aŭtokonkurejo Donington Park Race Circuit, kiu plurfoje jare gastigas aŭto- kaj motorciklo-konkurojn.\\nLa urbocentro estas miksaĵo de historiaj domoj el la novklasikisma \\"Georga\\" kaj sekva empira epokoj kaj de modernaj konstruaĵoj. Iuj trabfakaj domoj el la 17-a kaj pli fruaj jarcentoj pretervivis laŭlonge de la ĉefa strato."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stationen_der_M%C3%A9tro_Paris","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Paris_Metro_line_13_station_Ga%C3%AEt%C3%A9_-_Motte_seats.jpg","page_title":"Liste der Stationen der Métro Paris","context_page_description":"Die Liste der Stationen der Métro Paris ist eine vollständige Übersicht über die bestehenden sowie diverse geschlossene oder in Bau befindliche Stationen der Pariser Métro. Die 1900 eröffnete Métro gehört zu den ältesten und größten Netzen weltweit. Sie erschließt die 20 Pariser Arrondissements sowie diverse Städte und Gemeinden in den umliegenden Départements der Île-de-France.\\nDas Netz der Métro umfasst insgesamt bestehende 303 Bahnhöfe beziehungsweise 383 Einzelhaltepunkte. Die unterschiedlichen Werte ergeben sich aus der Zählweise der Umsteigepunkte. Hinzu kommen zwölf geschlossene sowie 48 Einzelhaltepunkte, die sich aktuell im Bau befinden und in den kommenden Jahren eröffnet werden sollen.\\nAuf die zurzeit 16 Linien der Métro verteilen sich die Stationen folgendermaßen:"},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%A7%D7%95%D7%94%D7%9E%D7%94_%D7%9C%D7%A0%D7%93%D7%9E%D7%A8%D7%A7_%D7%98%D7%90%D7%95%D7%95%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Yokohama_Landmark_Tower_in_the_evening_twilight.jpg","page_title":"יוקוהמה לנדמרק טאוור","context_page_description":"יוֹקוֹהָמָה לַנְדְמַרְק טָאוֶר הוא גורד שחקים בעיר יוקוהמה שביפן, המתנשא לגובה של 296.3 מטר – היה עד לשנת 2012 הבניין הגבוה ביותר במדינה. המגדל שוכן ברובע מינאטו מיראי 21 בעיר, בסמוך למוזיאון יוקוהמה לאמנות. בנייתו הסתיימה בשנת 1993.\\nבבניין מלון חמישה כוכבים הנמצא בקומות מס' 49–70 וכולל 603 חדרים בסך הכול, ואילו ב-48 הקומות התחתונות שלו נמצאות חנויות, מסעדות, מרפאות ומשרדים. בקומה ה-69 ישנו מצפה, סקיי גרדן, שממנו נשקף נוף פנורמי של 360 מעלות על העיר. בקומה ה-71 מוצבים בפינות מנוגדות של הבניין שני מנחתי תנודות.\\nבמגדל פועלות המעליות השניות במהירותן בעולם, אשר מגיעות למהירות של 12.5 מטר בשנייה. מהירות זו מאפשרת הגעה לקומה ה-69 בתוך 40 שניות. בעבר היו אלה המעליות המהירות בעולם, עד לבנייתן של המעליות במגדל טאיפיי 101, אשר מגיעות למהירות של כ-60 קמ\\"ש.\\nתכנון הבניין נעשה בידי משרד יו סטובינס ושות', שכיום נקרא קלינגסטובינס."},{"page_url":"https://simple.wikipedia.org/wiki/Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Wisconsin_in_United_States.svg","page_title":"Wisconsin","context_page_description":"Wisconsin is a state in the north-central United States. Two of the five Great Lakes and four other states border Wisconsin. The capital of Wisconsin is Madison. The biggest city in Wisconsin is Milwaukee."},{"page_url":"https://de.wikipedia.org/wiki/Mutter_Courage_und_ihre_Kinder","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Bundesarchiv_Bild_183-1993-0105-514%2C_Wolfgang_Harich_in_seiner_Wohnung.jpg","page_title":"Mutter Courage und ihre Kinder","context_page_description":"Mutter Courage und ihre Kinder ist ein Drama, das 1938/39 von Bertolt Brecht im schwedischen Exil verfasst und 1941 in Zürich uraufgeführt wurde. Es spielt im Dreißigjährigen Krieg zwischen 1624 und 1636. Erzählt wird die Geschichte der Marketenderin Mutter Courage, die versucht, ihr Geschäft mit dem Krieg zu machen, und dabei ihre drei Kinder verliert. Das Geschehen kann als Warnung an die kleinen Leute verstanden werden, die hoffen, durch geschicktes Handeln mit dem Zweiten Weltkrieg umgehen zu können. Gleichzeitig richtet es eine Warnung an die skandinavischen Länder, in denen Unternehmen darauf hofften, am Zweiten Weltkrieg verdienen zu können. Brechts Absichten gehen aber darüber hinaus: Er will Abscheu vor dem Krieg vermitteln und vor der kapitalistischen Gesellschaft, die ihn seiner Ansicht nach hervorbringt.\\nDie Mutter Courage ist weiterhin beispielhaft für Brechts Konzept des epischen Theaters. Die Zuschauer sollen kritisch und distanziert die Ereignisse auf der Bühne analysieren, nicht gefühlvoll das Schicksal eines positiven Helden miterleben."},{"page_url":"https://en.wikipedia.org/wiki/Amethyst","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Uninscribed_amethyst_scarab_at_the_center_of_a_string_of_amethyst_ball_beads._Middle_Kingdom._From_Egypt._The_Petrie_Museum_of_Egyptian_Archaeology%2C_London.jpg","page_title":"Amethyst","context_page_description":"Amethyst is a violet variety of quartz. The name comes from the Koine Greek αμέθυστος amethystos from α- a-, \\"not\\" and μεθύσκω methysko / μεθώ metho, \\"intoxicate\\", a reference to the belief that the stone protected its owner from drunkenness. The ancient Greeks wore amethyst and carved drinking vessels from it in the belief that it would prevent intoxication.\\nAmethyst is a semiprecious stone that is often used in jewelry and is the traditional birthstone for February."},{"page_url":"https://de.wikipedia.org/wiki/Streitkr%C3%A4fte_Indonesiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Indonesia_Frigate_KRI_Karel_Satsuit_Tubun.jpg","page_title":"Streitkräfte Indonesiens","context_page_description":"Tentara Nasional Indonesia sind die Streitkräfte der Republik Indonesien mit Hauptquartier in Jakarta. Derzeitiger Oberbefehlshaber ist der Air Marshal Hadi Tjahjanto."},{"page_url":"https://es.wikipedia.org/wiki/Garage_rock","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/The_Standells.png","page_title":"Garage rock","context_page_description":"El garage rock es un subgénero del rock que combina aspectos sonoros del doo-wop, el cool jazz, el R&B y el soul con la influencia musical de la música surf con los ritmos característicos del blues con los elementos musicales del rock instrumental. este subgénero musical es una forma de rock and roll y rockabilly.\\nEl término rock de garaje viene del hecho de que sus intérpretes eran grupos compuestos por adolescentes y jóvenes aficionados, con una escasísima preparación musical, que solían reunirse «para tocar y ensayar en el garaje de sus casas». La música de estas bandas era, por lo general, mucho menos elaborada que los originales en los que se inspiraban; pero, a cambio, estaba repleta de pasión y energía juvenil, lo que algunos consideran el verdadero espíritu del Rock'n'Roll. La mayor parte de las bandas utilizaban sencillas secuencias de notas octavas y quintas debido, además de a lo anteriormente explicado, a que los amplificadores de la época poseían mucha distorsión a un volumen alto y se sobre-saturaban. Con el uso de esas notas se disimulaba este problema y se conseguían sorprendentes resultados."},{"page_url":"https://az.wikipedia.org/wiki/XX_%C9%99srin_ay_tutulmalar%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Lunar_eclipse_chart_close-1969Aug27.png","page_title":"XX əsrin ay tutulmaları","context_page_description":"XX əsrdə, ümumilikdə, 229 ay tutulması baş vermişdir. Bunlardan 83-ü penumbra, 65-i qismən, 81-i isə tam tutulma olmuşdur."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%BB%E3%82%B3%E3%83%AB%E3%83%BC%E3%83%8B%E3%83%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Domus.jpg","page_title":"ア・コルーニャ","context_page_description":"ア・コルーニャまたはラ・コルーニャは、スペイン・ガリシア州ア・コルーニャ県のムニシピオ。大西洋に面した港湾都市であり、ア・コルーニャ県の県都である。ガリシア統計局によれば、2013年の人口は245,923人で、ビーゴに次ぐガリシア州第2の都市。自治体の正式名称はガリシア語のA Coruñaだが、定冠詞なしのCoruñaや、スペイン語の名称La Coruñaも使われる。住民の呼称はcoruñés、coruñesa。\\n近隣の自治体アベゴンド、アルテイショ、ベルゴンド、カンブレ、カラル、クジェレード、オレイロス、サダとコマルカを構成。\\nア・コルーニャは大西洋における重要な港で、この地域の農産物の集散地となっている。造船業や金属加工業など重工業の多くは近隣のフェロルにあるが、ア・コルーニャには石油精製所が建てられている。\\n近隣の自治体アルテイショには、日本にも出店し、近年成長著しいアパレル産業のザラを展開するインディテックスの本拠地がある。\\nガリシア語話者の自治体住民に占める割合は15.84%。"},{"page_url":"https://en.wikipedia.org/wiki/Alwi_Shihab","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Alwi_Shihab_and_Paul_Wolfowitz_2001.jpg","page_title":"Alwi Shihab","context_page_description":"Alwi Abdurrahman Shihab is one of the leading authorities and scholars on the interaction of Christian and Muslim communities. Currently he is the Indonesian President's special envoy to the Middle East and the Organisation of Islamic Cooperation. He held the office of Indonesian Coordinating Minister for People's Welfare in 2004–2005 and the Foreign Minister of Indonesia from 1999 to 2001."},{"page_url":"https://ro.wikipedia.org/wiki/Megalopolisul_Marilor_Lacuri","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Appletonskyline.jpg","page_title":"Megalopolisul Marilor Lacuri","context_page_description":"Megalopolisul Marilor Lacuri, numit și ChiPitts, este megalopolis format dintr-un grup de metropole nord-americane care înconjoară regiunea Marilor Lacuri, în special între vestul mijlociu al Statelor Unite ale Americii, sudul zonei Ontario din Canada, împreuna cu mari porțiuni din Pennsylvania, New York și Quebec. Regiunea se extinde de la Chicago și Milwakee până la Detroit și Toronto, și include Buffalo, Cincinnati, Cleveland, Columbus, Dayton, Akron, Erie, Fort Wayne, Grand Rapids, Indianapolis, Louisville, Ottawa, Quad Cities, Rochester, South Bend și Toledo, extremitatea estică ajungând până la Pittsburgh și Buffalo, iar cea vestică în Kansas City și Orașele Gemene. În 2011 regiunea avea 59.144.461 de locuitori, și se estimează că până în 2025 va ajunge la 65 de milioane."},{"page_url":"https://de.wikipedia.org/wiki/Clara_M%C3%BCller-Jahnke","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Gedenktafel_Saarower_Weg_51_%28Wilhh%29_Clara_M%C3%BCller-Jahnke.jpg","page_title":"Clara Müller-Jahnke","context_page_description":"Clara Müller-Jahnke war eine deutsche Dichterin, Journalistin und Frauenrechtlerin. Sie galt als führende sozialistische Dichterin ihrer Zeit und machte insbesondere mit ihren agitatorischen Arbeitergedichten auf die Lage der Arbeiter und der Frauen aufmerksam."},{"page_url":"https://it.wikipedia.org/wiki/Serpuchovskij_rajon","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Flag_of_Serpukhov_rayon_%28Moscow_oblast%29.png","page_title":"Serpuchovskij rajon","context_page_description":"Il Serpuchovskij rajon è un rajon dell'Oblast' di Mosca, nella Russia europea; il capoluogo è Serpuchov. Istituito nel 1929, ricopre una superficie di 1.016 chilometri quadrati ed ospita una popolazione di circa 34.000 abitanti."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D0%B2%D0%BD%D1%96%D1%87%D0%BD%D0%B0_%D0%9A%D0%B0%D0%BB%D1%96%D1%84%D0%BE%D1%80%D0%BD%D1%96%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Roseville_-_City_Civic_Center.jpg","page_title":"Північна Каліфорнія","context_page_description":"Північна Каліфорнія — північна частина штату США Каліфорнія. Найбільші міста в регіоні — Сан-Хосе, Сан-Франциско, Сакраменто і Окленд. Північна Каліфорнія відрізняється середземноморським кліматом.\\nКорінні американці прибули до Північної Каліфорнії принаймні ще 8000 — 5000 до н. е., і, можливо, навіть значно раніше, і послідовні хвилі прибулих зробили цю місцевість однією з найбільш густонаселених районів доколумбової Північної Америки.\\nПрибулі європейські дослідники з початку XVI до середини XVIII століття не створили європейських поселень в Північній Каліфорнії. У 1770 році іспанські місії в Монтереї заснували перше європейське поселення в районі."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BD%D0%BE%D0%B0_%D0%92%D0%B8%D1%81%D0%B0%D0%B2%D0%B0%D0%BD%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Ratu_Tanoa_Visawaqa.jpg","page_title":"Таноа Висаванга","context_page_description":"Рату Таноа Висаванга — фиджийский вождь, дважды становившийся вунивалу Мбау. Отец Такомбау, объединившего все земли Фиджи в единое королевство."},{"page_url":"https://en.wikipedia.org/wiki/CSM_Jiul_Petro%C8%99ani","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Jiul_Petro%C8%99ani_1995-1996.jpg","page_title":"CSM Jiul Petroșani","context_page_description":"Clubul Sportiv Municipal Jiul Petroșani, commonly known as Jiul Petroșani, or simply as Jiul, is a Romanian amateur football club based in Petroșani, Hunedoara County, founded in 1919 under the name of CAM Petroșani.\\nJiul Petroșani is one of the oldest clubs in Romania that is still active. Founded before teams such as Steaua București, Dinamo București or Rapid București, Jiul, at its best, was ranked 2nd in the top-flight, but despite the ups and downs, Jiul was for most of its existence, a constant presence in the first two tiers of the Romanian football league system, fact that made it a traditional club in the country.\\nAfter 1990, the miners had their moments of brilliance, but the closure of the mines in the Jiu Valley, the main engine of the local economy led to the decay of the team, being almost annually in danger of bankruptcy."},{"page_url":"https://fr.wikipedia.org/wiki/Isabelle_d%27Orl%C3%A9ans_(1878-1961)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/CoA_of_Marie-Th%C3%A9r%C3%A8se_of_France.png","page_title":"Isabelle d'Orléans (1878-1961)","context_page_description":"Isabelle Marie Laure d’Orléans, qui porte le titre de courtoisie de duchesse de Guise, est née le 7 mai 1878, au château d’Eu, en Normandie, et est morte le 21 janvier 1961 à Larache, au Maroc.\\nMembre de la Quatrième maison d'Orléans, Isabelle d’Orléans est l'épouse du prétendant orléaniste au trône de France de 1926 à sa mort."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%88%D9%81%D9%8A%D8%AF%D9%8A%D9%88_%D9%87%D9%88%D8%A8%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ovidiu_Hoban.JPG","page_title":"اوفيديو هوبان","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nاوفيديو هوبان لاعب كورة قدم من رومانيا."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_der_Hammertorvorstadt_(Plauen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Plauen%2C_Hammerstra%C3%9Fe_67.JPG","page_title":"Liste der Kulturdenkmale in der Hammertorvorstadt (Plauen)","context_page_description":"In der Liste der Kulturdenkmale in der Hammertorvorstadt sind die Kulturdenkmale des Plauener Stadtteils Hammertorvorstadt verzeichnet, die bis Januar 2020 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Aufzählung ist eine Teilmenge der Liste der Kulturdenkmale in Plauen."},{"page_url":"https://pt.wikipedia.org/wiki/The_Midnight_Man_(ciness%C3%A9rie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/The_Midnight_Man_%281919%29_-_2.jpg","page_title":"The Midnight Man (cinessérie)","context_page_description":"The Midnight Man, também conhecido, no Reino Unido, como The Mystery Man, é um seriado estadunidense de 1919, dirigido por James W. Horne, em 18 capítulos, estrelado por James J. Corbett e Kathleen O'Connor. O seriado foi produzido e distribuído pela Universal Pictures e estreou nos cinemas dos Estados Unidos em 1 de setembro de 1919.\\nEste seriado é considerado perdido.\\nO filme foi estrelado pelo pugilista, campeão mundial de box, James J. Corbett, que atuou em alguns filmes da época."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B1%D5%AF%D5%BD%D5%B8%D6%82%D5%A2%D5%A1%D6%87%D5%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Flag_of_Aksubayevsky_rayon_%28Tatarstan%29.png","page_title":"Ակսուբաևո","context_page_description":"Ակսուբաևո, քաղաքատիպ ավան Ռուսաստանի Թաթարստան հանրապետության Ակսուբաևսկի շրջանի կազմում։\\nԲնակչությունը 2010 թվականին գրանցված տվյալներով կազմում էր 10189 մարդ։"},{"page_url":"https://da.wikipedia.org/wiki/Lars_Heikensten","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Lars_Heikensten.jpg","page_title":"Lars Heikensten","context_page_description":"Lars Heikensten er en svensk økonom, Nobelstiftelsens administrerende direktør og er Sveriges tidigere centralbankchef.\\nHeikensten hade Rigsbankens øverste stilling siden 13. juni 2003 til 2005, og sat før dette som vice-centrakbankchef fra 1995.\\nHan overtog stillingen som centralbankchef efter Urban Bäckström."},{"page_url":"https://es.wikipedia.org/wiki/Hirschau","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Hirschau-kaolin.jpg","page_title":"Hirschau","context_page_description":"Hirschau es un municipio situado en el distrito de Amberg-Sulzbach, en el estado federado de Baviera, con una población a finales de 2016 de unos 5783 habitantes.​\\nSe encuentra ubicado al este del estado, en la región de Alto Palatinado, cerca de la ciudad de Amberg y de frontera con República Checa."},{"page_url":"https://no.wikipedia.org/wiki/Giuseppe_Motta","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Giuseppe_Motta_Staatsarchiv_Bern_FN_Jost_P_368.jpg","page_title":"Giuseppe Motta","context_page_description":"Giuseppe Motta var en sveitsisk politiker for det kristendemokratiske folkeparti. Han var regjeringsmedlem og forbundspresident, landets statsoverhode.\\nMotta var medlem av det sveitsiske Forbundsrådet fra 1911 og til sin død i 1940. I denne perioden var han fem ganger forbundspresident."},{"page_url":"https://hr.wikipedia.org/wiki/La_Paz,_okrug_(Arizona)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Map_of_Arizona_highlighting_La_Paz_County.svg","page_title":"La Paz, okrug (Arizona)","context_page_description":"La Paz, Petnaesti i najnoviji okrug Arizone, 11,690 km², 19,715 st., nastao 1. siječnja 1983. izdvajanjem sjevernog dijela okruga Yuma.\\nGlavni gradski centri su Parker i Quartzsite, zimsko turističko središte kroz koje zimi privlači preko milijun posjetitelja i gdje se nalazi grob poznate sirijske kamile Haiji Ali, popularno nazvane \\"Hi Jolly\\"."},{"page_url":"https://de.wikipedia.org/wiki/Balfour-Bericht","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Portrait_of_Arthur_Balfour%2C_1st_Earl_of_Balfour.jpg","page_title":"Balfour-Bericht","context_page_description":"Der Balfour-Bericht ist eine Erklärung, die 1926 von einem Ausschuss zur Neubestimmung der Beziehungen innerhalb des Britischen Empires erarbeitet und im Oktober/November des Jahres auf der Londoner Konferenz als Dokument abschließend erörtert und dann verabschiedet wurde. Konferenzteilnehmer waren der Premierminister des britischen \\"Mutterlands\\" und dessen Kollegen aus den sich selbst verwaltenden Dominions Kanada, Neufundland, dem Irischen Freistaat, der Südafrikanischen Union, Australien und Neuseeland. Den Vorsitz hatte der ehemalige britische Premierminister und Außenminister Lord Balfour. Von ihm stammt die berühmt gewordene Definition über die Beziehungen zwischen den Dominions und Großbritannien, welche die Erkenntnisse des Berichtes zusammenfasste:\\n“They are autonomous Communities within the British Empire, equal in status, in no way subordinate one to another in any aspect of their domestic or external affairs, though united by a common allegiance to the Crown, and freely associated as members of the British Commonwealth of Nations.”"},{"page_url":"https://vi.wikipedia.org/wiki/Nitscha","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Nitscha_in_WZ.png","page_title":"Nitscha","context_page_description":"Nitscha là một đô thị thuộc huyện Weiz thuộc bang Steiermark, nước Áo. Đô thị Nitscha có diện tích 14,12 km², dân số thời điểm cuối năm 2005 là 1395 người."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%A5%D5%A4%D5%BE%D5%AB%D5%A3_%D4%B4%D5%B8%D5%B0%D5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Alter_St-Matth%C3%A4us-Kirchhof_Dohm_Hedwig.jpg","page_title":"Հեդվիգ Դոհմ","context_page_description":"Մարիան Ադելաիդ Հեդվիգ Դոհմ, գերմանացի ֆեմինիստ և հեղինակ: Նա առաջին ֆեմինիստ մտածողներից էր, որ գենդերային դերերը դիտարկել է որպես ոչ թե կենսաբանական, այլ սոցիալական խտրականության արդյունք:"},{"page_url":"https://en.wikipedia.org/wiki/Rose_Cleveland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Rose_Cleveland%2C_before_1918_%28cropped%29.jpg","page_title":"Rose Cleveland","context_page_description":"Rose Elizabeth ”Libby” Cleveland, was acting First Lady of the United States from 1885 to 1886, during the first term of her brother, President Grover Cleveland's two administrations. The president was a bachelor until he married Frances Folsom on June 2, 1886, fourteen months into his first term."},{"page_url":"https://fr.wikipedia.org/wiki/Pic_du_Midi_de_Bigorre","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/JHM-1963-_T%C3%A9l%C3%A9ph%C3%A9rique_du_Pic_du_Midi_de_Bigorre.jpg","page_title":"Pic du Midi de Bigorre","context_page_description":"Le pic du Midi de Bigorre est situé dans les Hautes-Pyrénées, et atteint une altitude de 2 876 mètres. Il est connu entre autres pour la présence d'un observatoire astronomique et d'un relais de télévision, installés à son sommet.\\nCe site touristique fait partie du regroupement de stations N'PY."},{"page_url":"https://en.wikipedia.org/wiki/Acrantophis_dumerili","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Dumeril%27s_Madagascar_ground_boa_%28Acrantophis_dumerili%29_male_head_Isalo.jpg","page_title":"Acrantophis dumerili","context_page_description":"Acrantophis dumerili, commonly known as Dumeril's boa, similar to and often confused as the Madagascar ground boa, is a non-venomous boa species found on Madagascar. No subspecies are currently recognized."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%81%D0%B0%D0%BA%D1%83%D1%80%D0%B0_(%D0%B3%D0%BE%D1%80%D0%BE%D0%B4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Flag_of_Asakura_Fukuoka.JPG","page_title":"Асакура (город)","context_page_description":"Асакура — город в Японии, находящийся в префектуре Фукуока. Площадь города составляет 246,73 км², население — 54 227 человек, плотность населения — 219,78 чел./км²."},{"page_url":"https://gl.wikipedia.org/wiki/Josep_Maria_Subirachs","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/JOSEP_MARIA_SUBIRACHS%2C_ESCULPTOR_%2814953130084%29.jpg","page_title":"Josep Maria Subirachs","context_page_description":"Josep Maria Subirachs i Sitjar, nado en Barcelona o 11 de marzo de 1927, e finado ibídem o 7 de abril de 2014, foi un escultor, pintor, gravador, escenógrafo e crítico de arte catalán. Foi un dos escultores contemporáneos con máis prestixio internacional, como se pode ver nos seus múltiples galardóns e recoñecementos, así como da presenza da súa obra en museos e lugares públicos de cidades de todo o mundo, mais principalmente Barcelona. Tamén participou nunha gran cantidade de exposicións tanto colectivas como individuais, en museos e galerías públicas e privadas.\\nArtista polifacético, Subirachs destacou especialmente na escultura, pero tamén noutras técnicas como a pintura, o debuxo, o gravado, o cartel, o tapiz, a ilustración de libros, o deseño de xoias e o acuñamento de medallas. Tamén realizou escenografías para prestixiosas montaxes de obres de teatro e ballet. Exerceu de mestre de arte e, no eido teórico, como escritor e colaborador en revistas e xornais, crítico de arte e conferenciante en universidades e academias arredor do mundo."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%9A%86%E5%BE%B7%E5%B7%A5%E5%AD%A6%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Karhuset_lth.jpg","page_title":"隆德工学院","context_page_description":"隆德工學院是隆德大學的八個學院之一。1961年成立的隆德理工大學曾經是一個獨立的機構，由瑞典皇家工學院的校長監管。1969年的秋季學期合併於隆德大學，成為隆德工學院，但瑞典語仍舊保留原校名。學院成立之初的六個系分別為，物理，電子，機械，土木工程，建築設計和化學。教學樓的主體結構由建築師Klass Anshelm設計。"},{"page_url":"https://ga.wikipedia.org/wiki/M%C3%A1ire_I_Shasana","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Mary_I_of_England.jpg","page_title":"Máire I Shasana","context_page_description":"Bhí Máire I, ar a dtugtar freisin Máire Thúdarach, ina banríon ar Shasana agus ar Éirinn ó 19 Iúil go dtí lá a báis. Bhí sí ina iníon Anraí VIII, rí ar Shasana agus na banríona Caitríona Aragón. Ba í an ceathrú monarc Túdarach agus tá cáil ar na hiarrachtaí a rinne sí chun a Caitliceachas Rómhánach a athbhunú i Sasana. Bhí sé mar thoradh ar na polasaithe seo gur cuireadh beagnach trí chéad Protastúnach chun báis le linn a réimis, agus tugadh an leasainm 'Máire Fhuilteach' uirthi de bharr an tslada seo. Aistríodh Sasana ina tír Phrotastúnach arís nuair a tháinig leath-dheirfiúr Mháire, Eilís I, i gcomharbacht uirthi."},{"page_url":"https://no.wikipedia.org/wiki/Gorm_den_gamle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Runenstein_Gorm_2.jpg","page_title":"Gorm den gamle","context_page_description":"Gorm den gamle var konge av Danmark på midten av 900-tallet. Hans hustru var Tyra Danebod som han senere reiste den eldste av de to runesteinene på Jelling til minne om. Gorm var sønn av den danske kongen Hardeknut og var selv far til Harald Blåtann, som etterfulgte ham som konge. Gorms senere slektning, Svein Estridsson, refererte til både Gorm og hans far som «konger av Danmark», men det er vanskelig å presisere Danmarks geografiske omfang under Gorm. Gorm døde troligvis 964.\\nModerne historikere mener at Gorm styrte fra Jelling og at han neppe var konge over hele Danmark, snarere over Jylland og Sønderjylland. Han regnes likevel ofte som den første konge i den danske kongerekken. Det skyldes at han er den første konge som nevnes i samtidige, danske kilder, det vil si de to runesteinene på Jelling. Teksten på den lille Jellingsteinen sier:\\nkurmr kunukr karthi kubl thusi aft thurui kunu sina tanmakar but\\nGorm konge gjorde kumler disse etter Tyra kone sin Danmarks bod\\nGorm omtales også på den store Jellingsteinen hvor det står:"},{"page_url":"https://ja.wikipedia.org/wiki/%E8%88%B9%E5%B2%A1%E5%B1%B1_(%E6%96%B0%E6%BD%9F%E7%9C%8C%E5%B0%8F%E5%8D%83%E8%B0%B7%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/20180419_The_reservoir_of_Funaoka_mountain.jpg","page_title":"船岡山 (新潟県小千谷市)","context_page_description":"船岡山は、新潟県小千谷市にある丘。標高は104.9m。"},{"page_url":"https://ca.wikipedia.org/wiki/Otello_(Rossini)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Andrea_Nozzari.png","page_title":"Otello (Rossini)","context_page_description":"Otello, ossia Il moro di Venezia és una òpera en tres actes amb música de Gioachino Rossini i llibret de Francesco Maria Berio di Salsa, basat en la tragèdia en cinc actes Othello ou le More de Venise de Jean-François Ducis i Otel·lo de William Shakespeare. Es va estrenar al Teatro del Fondo de Nàpols, el 4 de desembre de 1816.\\nSetanta anys abans que Giuseppe Verdi en fes un tractament molt diferent del mateix tema en el seu Otello basat clarament en Shakespeare, el de Rossini i el llibretista Berio di Salsa es basa més aviat en Othello ou le More de Venise, una tragèdia en cinc actes de Jean-François Ducis basada al seu torn en l'obra shakespeariana. És l'única obra rossiniana basada en un drama de Shakespeare. L'òpera s'allunya bastant de l'obra original, té lloc a Venècia i no a Xipre, i el drama es desenvolupa d'una altra forma. El paper de Jago és menys important i diabòlic que a l'obra original i en la versió de Verdi, estrenada el 1887.\\nRossini escriu l'obra ni més ni menys que per a tres tenors de pes."},{"page_url":"https://is.wikipedia.org/wiki/Abies_chensiensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Abies_chensiensis_-_Botanischer_Garten_Freiburg_-_DSC06478.jpg","page_title":"Abies chensiensis","context_page_description":"Abies chensiensis, er tegund af þin ættuðum frá Gansu, Hubei, Sichuan, Tíbet, Yunnan í Kína og Arunachal Pradesh í Indlandi. honum var fyrst lýst af Philippe Édouard Léon Van Tieghem 1892."},{"page_url":"https://it.wikipedia.org/wiki/Phonola","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Maglia18.jpg","page_title":"Phonola","context_page_description":"Phonola è stato un marchio italiano - attualmente inutilizzato - del mercato dell'elettronica di consumo, in particolare nel settore degli apparecchi radio-televisivi, posseduto e gestito dall'azienda FIMI S.A. che per anni si sarebbe dedicata esclusivamente a tale settore, dopo una breve parentesi nella produzione di materiali isolanti."},{"page_url":"https://es.wikipedia.org/wiki/Reserva_de_Ali_Botush","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Ali_Botush_reserve_Bulgaria_11.JPG","page_title":"Reserva de Ali Botush","context_page_description":"La reserva de Ali Botush, también transcrita como Alibotoush, es una reserva natural en la pequeña cordillera de Slavyanka, situada en la frontera entre Bulgaria y Grecia. La reserva ocupa la sección norte de la montaña que se encuentra dentro del territorio de Bulgaria y se nombra por el antiguo nombre de Slavyanka. Está situada en los municipios de Sandanski y Hadzhidimovo, provincia de Blagoevgrad. Fue declarada en 1951 para proteger los bosques más extensos del pino endémico de Bosnia en la Península de los Balcanes. Su territorio se expandió aún más varias veces y abarca un área de 1638 hectáreas o 16,38 km². Fue declarada Reserva de la Biosfera por la UNESCO en 1977.en búlgaro, Али ботуш\\nLa reserva fue creada para proteger los bosques más extensos en los Balcanes de pino de Bosnia y es famosa por su rica flora; más de 1500 especies que se encuentran dentro de su limitado territorio."},{"page_url":"https://it.wikipedia.org/wiki/Lichtenberg_(Berlino)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Loeperplatz_4.jpg","page_title":"Lichtenberg (Berlino)","context_page_description":"Lichtenberg è un quartiere di Berlino. Amministrativamente, appartiene all'omonimo distretto."},{"page_url":"https://it.wikipedia.org/wiki/Presidenza_di_George_W._Bush","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/John_Paul_II_and_George_Bush_2001.jpg","page_title":"Presidenza di George W. Bush","context_page_description":"La presidenza di George W. Bush ha avuto il più grande numero di minoranze etniche di tutti i gabinetti federali fino ad allora presenti nei governi degli Stati Uniti e comprendeva i primi due segretari di gabinetto di origine asiatica. Secondo il Guinness dei primati, è stato il più opulento gabinetto di tutti i tempi.\\nIl ministro dei Trasporti Norman Mineta, il primo segretario di gabinetto asiatico-americano, è stato in precedenza ministro del Commercio sotto Bill Clinton; egli è stato l'unico democratico nel gabinetto Bush.\\nIl governo comprendeva figure molto in vista nelle passate amministrazioni repubblicane, in particolare Colin Powell che era consigliere per la Sicurezza nazionale sotto Ronald Reagan e capo di Stato maggiore dell'esercito sotto George H. W. Bush, e il ministro della Difesa Donald Rumsfeld, che ha avuto lo stesso incarico sotto Gerald Ford.\\nTra le nomine più criticate troviamo quelle di John Negroponte, Elliott Abrams, Otto Reich e John Poindexter per i loro ruoli nello scandalo \\"Irangate\\" e per le accuse di aver occultato gli abusi ai diritti umani in America centrale e meridionale."},{"page_url":"https://es.wikipedia.org/wiki/Tibet_Airlines","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/B-6425_-_Tibet_Airlines_-_Airbus_A319-115_-_SHA_%2813603392154%29.jpg","page_title":"Tibet Airlines","context_page_description":"Tibet Airlines es una aerolínea con sede corporativa y domicilio social en Lhasa, Región Autónoma del Tíbet, China. Opera vuelos regulares domésticos desde el aeropuerto de Lhasa."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%AF%D8%A8%D8%A6%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Palm_Island_Resort.jpg","page_title":"دبئی","context_page_description":"دبئی متحدہ عرب امارات کا ایک شہر ہے جسے ملک کے سب سے بڑا شہر ہونے کا اعزاز حاصل ہے۔\\nدبئی اپنی شاندار صنعتوں، تعمیرات و رہائش کے عظیم منصوبہ جات، کھیلوں کے شاندار ایونٹس اور گنیز بک آف ورلڈ ریکارڈز کے اندراج کے باعث دنیا بھر میں معروف ہے۔ یه شہر صنعتوں کے علاوہ سیاحت کے حوالے سے بھی دنیا بھر میں مشہور ہے اور اس وقت شہر میں جاری عظیم تعمیراتی منصوبے دنیا بھر کی نگاہوں کا مرکز بنے هوے ہیں۔ دبئی دنیا کے 25 مہنگے ترین شہروں میں بھی شامل ہے۔"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Riemst","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Millen_Tolhuis.jpg","page_title":"Lijst van onroerend erfgoed in Riemst","context_page_description":"Een overzicht van het onroerend erfgoed in de gemeente Riemst. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EB%A6%AC%EC%95%84_%EB%A7%88%EB%88%84%EC%97%98%EB%9D%BC_%EB%93%9C_%ED%8F%AC%EB%A5%B4%ED%88%AC%EA%B0%88_%EC%99%95%EB%85%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Maria_Manuela%2C_Princess_of_Portugal_and_Asturias_-_El_Prado.jpg","page_title":"마리아 마누엘라 드 포르투갈 왕녀","context_page_description":"포르투갈의 마리아 마누엘라는 스페인의 국왕인 펠리페 2세의 왕비로 아비스가 출신이다.\\n1527년 10월 5일 포르투갈 코임브라에서 포르투갈의 주앙 3세 국왕과 그의 아내인 카탈리나 데 아우스트리아 왕비의 딸로 태어났다. 1527년부터 1535년까지는 포르투갈의 공주로 남아 있었다. 그의 형제로는 포르투갈의 세바스티앙 국왕의 아버지인 주앙 마누엘 왕자가 있다.\\n1543년 11월 12일 살라망카에서 펠리페 2세 국왕과 결혼했다. 1545년 7월 8일에는 바야돌리드에서 돈 카를로스 데 아우스트리아를 낳았지만 불과 4일 만에 출산 후유증에 의한 출혈로 인해 사망했다."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D8%A7%D8%A6%D8%B2_%D8%A7%D9%84%D8%A7%D8%AA%D8%AD%D8%A7%D8%AF_%D8%A7%D9%84%D8%A3%D9%88%D8%B1%D9%88%D8%A8%D9%8A_%D9%84%D9%83%D8%B1%D8%A9_%D8%A7%D9%84%D9%82%D8%AF%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Chelsea_Deco.jpg","page_title":"جوائز الاتحاد الأوروبي لكرة القدم","context_page_description":"جوائز الاتحاد الأوروبي لكرة القدم ‏ هي مجموعة من الجوائز تقدم منذ عام 2005 من قبل الاتحاد الأوروبي لكرة القدم للاعبي الذي قدموا أذازاءاً استثنائياً في موسم من مواسم كرة القدم الأوروبية. يتم الإعلان عن الفائزين سنوياً في شهر أغسطس من كل عام. في حفل قرعة دوري أبطال أوروبا و الذي يقام سنوياً في مدينة موناكو الفرنسية.\\nإنتر ميلان هو الفريق الوحيد الذي فاز بجميع الجوائز المتاحة في نفس الموسم. أوقف الاتحاد الأوروبي لكرة القدم منح الجوائز بعد موسم 2009–10، بعدما قام باستيدال تلك الجوائز بجائزة أفضل لاعب في أوروبا."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D8%A4%D8%B3%D8%A7%D8%A1_%D9%88%D8%B2%D8%B1%D8%A7%D8%A1_%D8%A7%D9%84%D9%86%D8%B1%D9%88%D9%8A%D8%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Frederik_Stang.jpg","page_title":"رؤساء وزراء النرويج","context_page_description":"هذه هي قائمة رؤساء حكومات النرويج. في العصر الحديث، ورئيس الحكومة رئيس الوزراء عنوان. في أوقات مختلفة في الماضي، وشمل أعلى لقب الحكومية ستيوارد، الوالي، وزير أول.\\nحتى عام 1873، ملك للاتحاد الشخصية بين السويد والنرويج النرويج يحكم من خلال اثنين من خزانات: واحدة في ستوكهولم وآخر في كريستيانيا. يتألف مجلس الوزراء ستوكهولم التي تم إنشاؤها حديثا من رئيس الوزراء ووزيرين، وكان هدفها نقل المواقف من مجلس الوزراء كريستيانيا للملك السويدي الدور.\\nوكان على رأس مجلس الوزراء في كريستيانيا من قبل ستيوارد. لفترات وجيزة، تم تعيينه وليا للعهد الوالي الحالي للنرويج من قبل الملك، في هذه الحالة أصبح الوالي أعلى سلطة في كريستيانيا.\\nكلما كان الملك الحالي في كريستيانيا، ومع ذلك، وقال انه يفترض أعلى سلطة، وبالتالي وضع الحاكم أو الوالي مؤقتا من التهمة. وبالمثل، عندما لم يكن هناك حاكم، الوالي أو الملك الحالي في كريستيانيا، وكان على رأس مجلس الوزراء وزير أول، والذي كان عضوا أبرز مجلس الوزراء.\\nفي شهر يوليو عام 1873، تم إلغاء منصب محافظ بعد أن شاغرا منذ 1856. وفي الوقت نفسه، تمت ترقية منصب وزير أول في كريستيانيا لرئيس وزراء النرويج."},{"page_url":"https://en.wikipedia.org/wiki/Mycalesis_visala","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Long-brand_Bushbrown_Mycalesis_visala_Male_UP_Mumbai_Maharashtra_DSCF2917_%281%29.JPG","page_title":"Mycalesis visala","context_page_description":"Mycalesis visala, the long-brand bushbrown, is a species of satyrine butterfly found in south Asia. It might include the Tamil bushbrown as a subspecies."},{"page_url":"https://en.wikipedia.org/wiki/Abingdon_Historic_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Daniel-Trigg-House.jpg","page_title":"Abingdon Historic District","context_page_description":"Abingdon Historic District is a national historic district located at Abingdon, Washington County, Virginia. The district encompasses 145 contributing buildings, 2 contributing site, and 13 contributing structures in the town of Abingdon. It includes a variety of residential, commercial, and institutional buildings dating from the late-18th century to the mid-20th century. Notable contributing resources include Sinking Spring Cemetery, William King High School, General Francis Preston House, Martha Washington Inn, Barter Theatre, the Virginia House, Alexander Findlay House, Gabriel Stickley House, Ann Berry House, Washington County Courthouse, Rev. Charles Cummings House, and James Fields House. Located in the district and separately listed are the Abingdon Bank and Dr. William H. Pitts House.\\nIt was listed on the National Register of Historic Places in 1970, with a boundary increase in 1986."},{"page_url":"https://pt.wikipedia.org/wiki/Invas%C3%A3o_Mongol_no_Jap%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Mongol_invasions_of_Japan_1274%2C_1281.jpg","page_title":"Invasão Mongol no Japão","context_page_description":"As invasões dos mongóis ao Japão de 1274 e de 1281 foram operações militares empreendidas por Kublai Khan ao invadir as ilhas japonesas após ter conquistado Coreia. Apesar de terem falhado, as tentativas de invasão são de grande importância histórica, impondo uma freada na expansão mongol, expressando um ponto chave no rumo da história do Japão como nação."},{"page_url":"https://fr.wikipedia.org/wiki/Laffrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Photo_1414.jpg","page_title":"Laffrey","context_page_description":"Laffrey est une commune française située dans le département de l'Isère en région Auvergne-Rhône-Alpes.\\nPositionnée sur la bordure septentrionale du plateau matheysin qui domine la vallée de la Romanche, cette petite commune de moyenne montagne est célèbre pour sa montée routière dénommée « Rampe ou Descente de Laffrey » et ses lacs, mais qui ne sont pas tous situés sur le territoire sur le territoire communal.\\nAu niveau historique, la cité doit également sa renommée pour son site de la prairie de la rencontre, évoquant un épisode des cent-jours. Un monument célébrant ce passage de l'histoire napoléonienne est situé au sud du bourg, le long de la route nationale 85, également dénommée sous le vocable de « Route Napoléon » pour les mêmes raisons historiques.\\nSes habitants sont dénommés les Fredeyards."},{"page_url":"https://ms.wikipedia.org/wiki/Stesen_MRT_Cochrane","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/SBK_Line_Cochrane_Station_Linkway_to_MyTown_1.jpg","page_title":"Stesen MRT Cochrane","context_page_description":"Stesen MRT Cochrane ialah stesen transit aliran massa di tenggara Kuala Lumpur, Malaysia. Stesen ini adalah salah satu stesen dalam Laluan Sungai Buloh-Kajang. Stesen ini dinamakan sempena Jalan Cochrane yang terletak di utara stesen. Stesen ini dibuka pada 16 Julai 2017 di bawah pembukaan Fasa 2 laluan ini."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%A8_%E2%80%9E%D0%A0%D0%B0%D1%82%D0%BA%D0%BE_%D0%88%D0%BE%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%9B%E2%80%9D_%D0%98%D0%9E_%D0%93%D1%80%D0%B8%D0%B2%D1%81%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Arilje-grivska-7123.jpg","page_title":"ОШ „Ратко Јовановић” ИО Гривска","context_page_description":"ОШ „Ратко Јовановић” ИО Гривска је једно од издвојених одељења ОШ „Ратко Јовановић” из Крушчице.\\nШкола у Гривској је најстарија школа у овом крају, која је почела са радом 1916. године у кући Адама Маринковића, а зграда у којој ђаци из Гривске и данас похађају наставу саграђена је 1933. године. Поводом 100 година школске традиције у Гривској 2016. године школа је потпуно реконструисана."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Gothic_brick_buildings_in_Germany","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Kircheketz%C3%BCr_s%C3%BCden_3.JPG","page_title":"List of Gothic brick buildings in Germany","context_page_description":"This list is a part of the international List of Gothic brick buildings.\\nFor the parts of this list on the various countries see:\\n– In long tables, vertical arrows link to the navigation boards above and below. –"},{"page_url":"https://sv.wikipedia.org/wiki/Orchis_troodi","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/Orchis_anatolica_%28with_butterfly%29-_Nea_Moni_-_Chios_-_29_april_2008.JPG","page_title":"Orchis troodi","context_page_description":"Orchis troodi är en orkidéart som först beskrevs av Jany Renz, och fick sitt nu gällande namn av Pierre Delforge. Orchis troodi ingår i släktet nycklar, och familjen orkidéer. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://hu.wikipedia.org/wiki/Rotter_Lajos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/RotterLajos_a_Nemere_kabinj%C3%A1ban.jpg","page_title":"Rotter Lajos","context_page_description":"Rotter Lajos magyar gépészmérnök, repülőgép-tervező és pilóta, a Karakán és a Nemere vitorlázó repülőgépek tervezője."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Innenstadt_(G%C3%B6rlitz),_R%E2%80%93Z","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Sohrstrasse_15_G%C3%B6rlitz.jpg","page_title":"Liste der Kulturdenkmale in Innenstadt (Görlitz), R–Z","context_page_description":"In der Liste der Kulturdenkmale in Innenstadt (Görlitz), R–Z sind sämtliche Kulturdenkmale der Görlitzer Innenstadt verzeichnet, die bis Oktober 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden und deren Straßenname mit den entsprechenden Anfangsbuchstaben beginnt. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Görlitz."},{"page_url":"https://vi.wikipedia.org/wiki/Bo%C5%99enovice,_Krom%C4%9B%C5%99%C3%AD%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Kaple_Bo%C5%99enovice.jpg","page_title":"Bořenovice, Kroměříž","context_page_description":"Bořenovice là một làng thuộc huyện Kroměříž, vùng Zlínský, Cộng hòa Séc."},{"page_url":"https://nl.wikipedia.org/wiki/Achter_de_Hoven_(Leeuwarden)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Achter_de_Hoven_Leeuwarden_OSM.jpg","page_title":"Achter de Hoven (Leeuwarden)","context_page_description":"Achter de Hoven is een buurt in de stad Leeuwarden, in de Nederlandse provincie Friesland.\\nAchter de Hoven was tot 2018 een wijk. Het is een buurt in de wijk Potmargezone met het riviertje de Potmarge. De buurt is onderverdeeld in de Vegelinbuurt, Fruitbuurt en het Rode Dorp. De Vegelinbuurt is gebouwd als arbeidersbuurt aan het eind van de 18e eeuw. Het Rode Dorp kenmerkt zich door de \\"rode\\" dakpandaken van de huizen. De straat Achter de Hoven loopt van de Blokhuisbrug naar de Spoorstraat.\\nDe naam Achter de Hoven betekent eigenlijk achter de tuinen. De wijk ligt op de plek waar oorspronkelijk het buitenverblijf Mariënburg van Maria Louise van Hessen-Kassel, bijgenaamd Marijke Meu of Marijke Muoi heeft gestaan. Tevens waren op deze plek vroeger tuinderijen van de burgers van Leeuwarden. In de Vegelinbuurt bestaan de straatnamen uit namen van weldoeners uit het eind van de 18e eeuw. De straatnamen in het Rode Dorp verwijzen naar het tuinderijverleden. De straatnamen van de Fruitbuurt bestaan uit de namen van fruit.\\nDe wijk ligt naast de fabrieken van Koopmans en Friesche Vlag. Op de huidige plek van de woonwijk was het bedrijf Casolith gevestigd."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Sendling","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Hefner-Alteneck-Strasse_2.jpg","page_title":"Liste der Baudenkmäler in Sendling","context_page_description":"Auf dieser Seite sind die Baudenkmäler im Münchner Stadtteil Sendling im gleichnamigen Stadtbezirk 6 aufgelistet. Zu diesen Baudenkmälern gibt es auch eine Bildersammlung und ein Fotoalbum mit ausgewählten Bildern.\\nDiese Liste ist Teil der Liste der Baudenkmäler in München. Grundlage ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://it.wikipedia.org/wiki/Ghazni","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Ghazni-Minaret.jpg","page_title":"Ghazni","context_page_description":"Ghazni, in passato conosciuta come Ghazna o Ghaznīn, è una città dell'Afghanistan, capoluogo dell'omonima provincia ed è stata capitale dell'impero degli Yaminidi."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D9%84_%D9%87%D8%A7%D9%8A%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Heim_P%C3%A1l-1.jpg","page_title":"بال هايم","context_page_description":"بال هايم ‏ هو طبيب مجري، ولد في 30 نوفمبر 1875 في بودابست في المجر، وتوفي بنفس المكان في 23 أكتوبر 1929 بسبب ذات الرئة."},{"page_url":"https://nl.wikipedia.org/wiki/Jerry_Scheff","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Jerry_Scheff_Official.JPG","page_title":"Jerry Scheff","context_page_description":"Jerry Obern Scheff is een Amerikaans bassist. Hij is bekend geworden als de vaste bassist van Elvis Presley in de vroege jaren 70, als lid van de TCB Band en zijn samenwerking met The Doors."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E9%98%AA%E6%AF%8D%E5%AD%90%E5%8C%BB%E7%99%82%E3%82%BB%E3%83%B3%E3%82%BF%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Osaka_Medical_Center_and_Research_Institute_for_Maternal_and_Child_Health1.jpg","page_title":"大阪母子医療センター","context_page_description":"大阪母子医療センターとは、 大阪府和泉市にある医療機関・病院。"},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_%C3%A9volutive_des_v%C3%A9g%C3%A9taux","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/LepidodendronOhio.jpg","page_title":"Histoire évolutive des végétaux","context_page_description":"L’histoire évolutive des végétaux est un processus de complexification croissante, depuis les premières algues, en passant par les bryophytes, les lycopodes et les fougères, jusqu'aux complexes gymnospermes et angiospermes actuels. Bien que les végétaux plus primitifs continuent de prospérer, particulièrement dans leur milieu d'origine, chaque nouveau degré d'organisation évolue et développe de nouvelles capacités qui lui permettent de mieux s'adapter à de nouveaux milieux.\\nTout porte à penser que les algues sont apparues en milieu aquatique il y a au moins 1,2 milliard d'années. La symbiose entre des bactéries photosynthétiques et des eucaryotes semble être à l'origine des algues vertes, apparues pendant l'Ordovicien, il y a près de 500 millions d'années, et produisant de la chlorophylle a et b. C'est à l'Ordovicien supérieur que les végétaux partent à la conquête des terres, donnant naissance aux premières plantes terrestres. Celles-ci ont commencé à se diversifier à la fin du Silurien, il y a environ 420 millions d'années, et les résultats de cette diversification sont visibles en détail dans un fossile du début du Dévonien connu sous le nom de flore de Rhynie."},{"page_url":"https://et.wikipedia.org/wiki/J%C4%99drzej%C3%B3w","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Jedrzejow_20060722_1115.jpg","page_title":"Jędrzejów","context_page_description":"Jędrzejów on linn Poolas Święty Krzyżi vojevoodkonnas, Jędrzejówi maakonna halduskeskus. Jędrzejów asub Kielcest 50 km edelas.\\nJędrzejów on kujunenud 1140. aastatel asutatud tsistertslaste kloostri ümber. Jędrzejów sai linnaõigused 1271. aastal. 1870. aastal kaotas Jędrzejów linnaõigused, kuid sai need 1916. aastal tagasi."},{"page_url":"https://pl.wikipedia.org/wiki/Suezmax","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/SuezCanal_ElBallah.JPG","page_title":"Suezmax","context_page_description":"Suezmax – statek o maksymalnych wymiarach gabarytowych umożliwiających żeglugę przez Kanał Sueski. Wielkość statku ograniczona jest głębokością toru wodnego wynoszącą obecnie 23 metry. Po konflikcie wojennym w latach 1967 - 1975 kanał zmodernizowano, uprzednio głębokość toru wodnego wynosiła 16 m. Obecnie teoretyczne wielkości wymiarów statków przedstawiają się następująco:\\nzanurzenie 21,3 m\\nszerokość 70 m\\ndługość 500 m\\nnośność 150 tysięcy DWT dla statków załadowanych i 200 tysięcy DWT po częściowym rozładowaniu.\\nTa ostatnia graniczna wielkość powoduje, że Kanał Sueski jest dostępny dla większości statków, z wyjątkiem bardzo dużych tankowców i masowców.\\nPolskimi statkami typu Suezmax były: MS Zawrat, MS Sokolica, MS Czantoria."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D0%BA%D1%83%D1%80%D1%81_%D0%BF%D0%B5%D1%81%D1%8C%D0%BD%D1%96_%D0%AD%D1%9E%D1%80%D0%B0%D0%B1%D0%B0%D1%87%D0%B0%D0%BD%D1%8C%D0%BD%D0%B5-1967","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Map_of_Eurovision_1967.gif","page_title":"Конкурс песьні Эўрабачаньне-1967","context_page_description":"Конкурс песьні «Эўрабачаньне-1967» стаў 12-м конкурсам песьні Эўрабачаньне. Ён прайшоў 8 красавіка 1967 году ў горадзе Вена у бальнай залі палацу Хофбург. Данія вырашыла не прымаць удзелу ў конкурсе, скараціўшы лік удзельнікаў да 17. Сыстэма галасаваньня вярнулася да варыянту 1957 году, калі 10 сяброў журы, якія прадстаўляюць сваю краіну, галасавалі за самую ўпадабаную песьню. Упершыню перамагла Вялікабрытанія зь песьняй «Puppet on a String», выкананай Сэндзі Шоў. Рафаэль ізноў прадстаўляў Гішпанію, заняўшы 6-е месца. Швайцарыя набрала нуль ачкоў. Упершыню тэлекамэры паказвалі ўдзельнікаў конкурсу за кулісамі.\\nПадчас конкурсу вядучая абвясьціла Вялікабрытанію пераможцам да таго, як былі падлічаны галасы ўсіх сяброў журы, аднак, па канчатку падліку перамога так і засталася за ангельскай сьпявачкай."},{"page_url":"https://it.wikipedia.org/wiki/Celti","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Temple_de_Diane_N%C3%AEmes.JPG","page_title":"Celti","context_page_description":"I Celti furono un insieme di popoli indoeuropei che, nel periodo di massimo splendore, erano stanziati in un'ampia area dell'Europa, dalle Isole britanniche fino al bacino del Danubio, oltre ad alcuni insediamenti isolati più a sud, frutto dell'espansione verso le penisole iberica, italica e anatolica. Uniti dalle origini etniche e culturali, dalla condivisione di uno stesso fondo linguistico indoeuropeo e da una medesima visione religiosa, rimasero sempre politicamente frazionati; tra i vari gruppi di popolazioni celtiche si distinguono i Britanni, i Galli, i Pannoni, i Celtiberi e i Galati, stanziati rispettivamente nelle Isole Britanniche, nelle Gallie, in Pannonia, in Iberia e in Anatolia.\\nPortatori di un'originale e articolata cultura, furono soggetti a partire dal II secolo a.C. a una crescente pressione politica, militare e culturale da parte di altri due gruppi indoeuropei: i Germani, da nord, e i Romani, da sud."},{"page_url":"https://de.wikipedia.org/wiki/Gewehr_88","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Gewehr88_Kammerst%C3%A4ngel_mit_Halbmond_noBG.png","page_title":"Gewehr 88","context_page_description":"Das Gewehr 88 wurde im Jahre 1888 als Ordonnanzwaffe des Deutschen Heeres angenommen, der Name leitet sich von der Jahreszahl ab. Da die preußische Gewehrprüfungskommission in Spandau bestrebt war, durch Kombinieren von Einzelkomponenten verschiedener Herkunft das beste Gewehr zu schaffen, trägt es auch den Namen „Kommissionsgewehr“."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%98%8E%E6%97%A5%E5%BE%85%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Matsuko_Ashita.jpg","page_title":"明日待子","context_page_description":"明日 待子は、日本の女優、日本舞踊家。昭和初期〜戦後にかけてムーランルージュ新宿座の看板スターの一人で、元祖・ライブアイドルの一人、また諏訪根自子・山口淑子・原節子と共に日本初のアイドルの一人とされている。岩手県釜石市出身。本名は須貝 とし子。晩年を日本舞踊家として過ごし、正統五條流宗家家元・五條 珠淑を名乗っていた。"},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Isidro_Fabela","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Isidro_Fabela_en_el_Estado_de_Mexico.svg","page_title":"Municipio de Isidro Fabela","context_page_description":"El municipio de Isidro Fabela es uno de los 125 municipios que conforman al Estado de México. Su cabecera es la localidad de Tlazala de Fabela. El municipio es parte de la Zona metropolitana del valle de México."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9A%E0%B0%BE%E0%B0%B0%E0%B1%81%E0%B0%95%E0%B1%87%E0%B0%B6%E0%B0%BF_%E0%B0%B0%E0%B0%BE%E0%B0%97%E0%B0%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ec/Charukesi_scale.svg","page_title":"చారుకేశి రాగం","context_page_description":"చారుకేశి రాగము కర్ణాటక సంగీతం లో ఒక రాగం. ఇది 72 మేళకర్త రాగాల వ్యవస్థలో 26 వ మేళకర్త రాగము. ముత్తుస్వామి దీక్షితుల కర్ణాటక సంగీత పాఠశాఅలలో ఈ రాగాన్ని \\"తరంగిణి\\" అని పిలుస్తారు. ఈ రాగాన్ని వినేవారికి కరుణ రసాన్ని, భక్తిభావాన్ని రేకెత్తిస్తుంది."},{"page_url":"https://pl.wikipedia.org/wiki/M%C4%99czennicy_wile%C5%84scy","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/%D0%9F%D1%8F%D1%82%D0%BD%D0%B8%D1%86%D0%BA%D0%B0%D1%8F_%D1%86%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_-_panoramio.jpg","page_title":"Męczennicy wileńscy","context_page_description":"Męczennicy wileńscy, święci Antoni, Jan i Eustachy – trzej dworzanie wielkiego księcia litewskiego Olgierda, skazani na śmierć i straceni w 1347 r. z powodu wyznawania prawosławia, w 1374 r. kanonizowani.\\nWedług powstałego w Konstantynopolu na okoliczność kanonizacji opisu męczeństwa Antoni, Jan i Eustachy przyjęli chrzest z rąk Nestora, spowiednika Anny, pierwszej żony Olgierda, wyznawczyni prawosławia. Publicznie odmówili respektowania pogańskich zwyczajów panujących na litewskim dworze, przez to zostali wtrąceni do więzienia, a po kilkukrotnej odmowie odejścia od chrześcijaństwa – straceni przez powieszenie.\\nHistorycznie ośrodkiem kultu męczenników wileńskich była cerkiew Trójcy Świętej w Wilnie i powstały przy niej monaster, które według prawosławnej tradycji założono na miejscu egzekucji męczenników. Po przejęciu klasztoru przez unitów głównym centrum kultu Antoniego, Jana i Eustachego stał się Monaster Ducha Świętego w Wilnie. Tam też przechowywane są ich relikwie.\\nKult męczenników jest szczególnie żywy wśród prawosławnych mieszkańców Litwy i Białorusi. Jest także obecny w Polskim Autokefalicznym Kościele Prawosławnym."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%81%D1%82%D1%80%D0%B0%D0%BB%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%B1%D0%BE%D1%82%D0%B0%D0%BD%D1%96%D1%87%D0%BD%D0%B8%D0%B9_%D1%81%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Banksia_spinulosa_2.jpg","page_title":"Австралійський національний ботанічний сад","context_page_description":"Австралійський національний ботанічний сад — ботанічний сад у місті Канберра. Ботанічний сад знаходиться у веденні Департаменту з охорони навколишнього середовища та культурної спадщини австралійського уряду.\\nВ ботанічному саду зосереджена найбільша колекція австралійської флори. Метою ANBG є наукове вивчення флори Австралії та збереження тих місцевих рослин, які знаходяться під загрозою у дикій природі.\\nБотанічний сад є членом Міжнародної ради ботанічних садів з охорони рослин."},{"page_url":"https://de.wikipedia.org/wiki/Daniel_Go%C5%82%C4%99biewski","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Daniel_Go%C5%82%C4%99biewski_2011.jpg","page_title":"Daniel Gołębiewski","context_page_description":"Daniel Gołębiewski ist ein polnischer Fußballspieler, der als Mittelstürmer fungiert."},{"page_url":"https://de.wikipedia.org/wiki/Kocher_(Fluss)","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Kochertal.JPG","page_title":"Kocher (Fluss)","context_page_description":"Der Kocher ist der nach der Wasserführung zweitgrößte Nebenfluss des Neckars und mündet, von rechts aus östlicher Richtung kommend, nördlich von Heilbronn."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A0%D0%B0%D1%83%D0%BB_%D0%93%D0%B0%D1%80%D1%81%D0%B8%D1%8F_(%D1%84%D1%83%D1%82%D0%B1%D0%BE%D0%BB%D0%B1%D0%BE%D0%B7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Ra%C3%BAl_Garc%C3%ADa_-_01.jpg","page_title":"Раул Гарсия (футболбоз)","context_page_description":"Раул Гарсия Эскудеро — футболбози испанӣ, нимҳимоятгар."},{"page_url":"https://en.wikipedia.org/wiki/Kesgrave","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/All_Saints%2C_Kesgrave_-_geograph.org.uk_-_1185969.jpg","page_title":"Kesgrave","context_page_description":"Kesgrave is a small town containing two large estates in the English county of Suffolk on the eastern edge of Ipswich."},{"page_url":"https://en.wikipedia.org/wiki/GWR_6100_Class","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/6165_at_Reading%2C_May_1964.jpg","page_title":"GWR 6100 Class","context_page_description":"The GWR 6100 Class is a class of 2-6-2T side tank steam locomotives."},{"page_url":"https://sv.wikipedia.org/wiki/Genesis_(rymdsond)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Genesis_in_collection_mode.jpg","page_title":"Genesis (rymdsond)","context_page_description":"Genesis var en rymdsond i NASAs Discovery-program, som sändes upp från Cape Canaveral Air Force Station den 8 augusti 2001 med en Delta II-raket. Den var avsedd att samla partiklar från solvinden. Den 8 september 2004 kraschlandade sondens landningskapsel i Utahöknen i USA sedan dess fallskärmar inte vecklat ut sig. Den behållare som innehöll det insamlade materialet klarade kraschen relativt bra, och forskarna tror att det mesta av det kan användas som det var tänkt."},{"page_url":"https://en.wikipedia.org/wiki/520_Park_Avenue","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/520_Park_Av_fr_QBB_ramp_jeh.jpg","page_title":"520 Park Avenue","context_page_description":"520 Park Avenue is a skyscraper located on East 60th Street near Park Avenue on the Upper East Side of Manhattan, New York City. It was designed by the firm of the 2011 Driehaus Prize winner, Robert A.M. Stern Architects. The building was funded through a US$450 million construction loan from The Children's Investment Fund. At 781 ft tall, it is the 36th tallest building in New York, and the tallest on the Upper East Side.\\nArthur and William Lie Zeckendorf of Zeckendorf Development developed the building."},{"page_url":"https://pl.wikipedia.org/wiki/Parafia_%C5%9Bw._Marii_Magdaleny_w_G%C5%82%C4%99bokiem","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Sieniawa%2C_cerkiew_Narodzenia_Bogurodzicy_%28HB1%29.jpg","page_title":"Parafia św. Marii Magdaleny w Głębokiem","context_page_description":"Parafia św. Marii Magdaleny w Głębokiem − parafia rzymskokatolicka znajdująca się w archidiecezji przemyskiej w dekanacie Rymanów."},{"page_url":"https://cy.wikipedia.org/wiki/Llwyd_gwrych_y_cyfandir","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Altai_Accentor_%28Prunella_himalayana%29_%2842901525014%29.jpg","page_title":"Llwyd gwrych y cyfandir","context_page_description":"Aderyn a rhywogaeth o adar yw Llwyd gwrych y cyfandir a adnabyddir hefyd gyda'i enw gwyddonol Prunella modularis modularis; yr enw Saesneg arno yw Continental hedge accentor. Mae'n perthyn i deulu'r Llwydiaid sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn P. modularis modularis, sef enw'r rhywogaeth."},{"page_url":"https://cy.wikipedia.org/wiki/Kusilvak_Census_Area,_Alaska","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Aerial_view_of_Tutakoke_Bird_Camp%2C_Coast_of_the_Bering_Sea_just_south_of_Hooper_Bay%2C_Alaska%2C_near_Chevak%2C_Alaska.jpg","page_title":"Kusilvak Census Area, Alaska","context_page_description":"Sir yn nhalaith Unorganized Borough, Unol Daleithiau America yw Kusilvak Census Area. Cafodd ei henwi ar ôl Kusilvak Mountains a/ac Wade Hampton III. Sefydlwyd Kusilvak Census Area, Alaska ym 1980 a sedd weinyddol y sir yw dim gwerth.\\nMae ganddi arwynebedd o 19,673. Allan o'r arwynebedd hwn, y canran o ffurfiau dyfrol, megis llynnoedd ac afonydd, yw 13.2%. Yn ôl cyfrifiad y wlad, poblogaeth y sir yw: 7,977. Mewn cymhariaeth, yn 2016 roedd poblogaeth Caerdydd yn 361,462 a Rhyl tua 26,000.\\nMae'n ffinio gyda Nome Census Area. Ceir 9 cylchfa amser yn UDA, ac mae'r sir hon yn perthyn i'r cylchfa amser a elwir yn Alaska Time Zone."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_places_in_the_Bonavista_Bay_region","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/St._Paul%27s_Anglican_Church_1.JPG","page_title":"List of historic places in the Bonavista Bay region","context_page_description":"These properties are entered on the Canadian Register of Historic Places, whether they are federal, provincial, or municipal. The list contains entries found in communities on the Bonavista Peninsula, from Clarenville north and east."},{"page_url":"https://no.wikipedia.org/wiki/Oliver_Lieb","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Oliver_lieb.jpg","page_title":"Oliver Lieb","context_page_description":"Oliver Lieb er en tysk produsent av elektronisk musikk. Etter å ha startet med å spille bass i ulike band, begynte han med elektronisk musikk i 1992. Lieb er kjent som en av pionerene innen sjangeren trance og er også anerkjent for produksjoner innen techno og ambient. Diskografien hans er svært omfattende, og han har produsert låter under over 50 forskjellige aliaser. I tillegg til hans eget navn er aliasene L.S.G., Spicelab og Paragliders blant de mest profilerte navnene han har gått under. Berømte plateselskap han har vært en sentral bidragsyter til inkluderer Harthouse og Superstition.\\nLieb har et studio i Frankfurt am Main, og han er særlig anerkjent for det store spekteret av utsyr han bruker til å lage musikken sin. I motsetning til de fleste produsentene innen elektronisk musikk, som bare bruker en eller et fåtall maskiner, har Lieb over 30 maskiner i studioet sitt.\\nLieb er mest berømt for sin produksjon innen trance, først og fremst under aliaset L.S.G. Blant annet hadde han en stor hit med «Netherworld» i 1997. De siste årene har han imidlertid tatt avstand fra kommersialiseringen innen sjangeren, og har konsentrert seg om utgivelser innen techno."},{"page_url":"https://sv.wikipedia.org/wiki/Blue_of_Sint-Niklaas","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/BlvSN.jpg","page_title":"Blue of Sint-Niklaas","context_page_description":"Blue of Sint-Niklaas är en flamländsk kaninras. Den har avlats på sedan 1800-talet, nära staden Sint-Niklaas, för att tillgodose den lokala pälsindustrin. Blue of Sint-Niklaas är därmed en av världens äldsta pälskaniner. Blå beveren, också en pälskanin, är släkt med Blue of Sint-Niklaas och har avlats i samma område i Flandern, Waasland.\\nInternationellt godkänns bara blå sorter av rasen i standarden, i motsats till den blå beverens, där andra sorter godkänns. Även i motsats till den blå beveren väger Blue of Sint-Niklaas mycket mer, upp till 5,4 kg som är i likhet med den belgiska jättekaninen.\\nEfter minskningen av pälsförsäljning och pälsindustri i regionen dog Blue of Sint-Niklaas nästan ut, eftersom den inte var populär som sällskapsdjur eller köttkanin."},{"page_url":"https://sv.wikipedia.org/wiki/Guld%C3%A4pplet_(l%C3%A4rarpris)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Ryan11.JPG","page_title":"Guldäpplet (lärarpris)","context_page_description":"Guldäpplet är ett pris som årligen delas ut till en eller flera lärare vilka \\" ... förnyat lärandet med stöd av IT i egen undervisning och som inspirerat elever och kollegor i ett lokalt, kommunalt och gärna även nationellt verksamhetsfält.\\" Guldäpplejuryns särskilda pris ges sedan 2007 till en lärare \\"som har uträttat långvariga, betydelsefulla insatser för främjande av lärande med stöd av IT och medier”\\nInitiativtagare till priset är styrelsen för Föreningen Datorn i utbildningen och tidskriften Datorn i utbildningen. Guldäpplet delas ut av en minnesfond som bildats efter Yngve Lindberg, en av föreningens grundare. Prissumman för båda priserna uppgår sedan 2011 till 25 000 kronor."},{"page_url":"https://en.wikipedia.org/wiki/San_Diego_Botanic_Garden","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Quail_botanical_gardens.jpg","page_title":"San Diego Botanic Garden","context_page_description":"The San Diego Botanic Garden, formerly Quail Botanical Gardens, is a botanical garden in Encinitas, California, United States. At 37 acres, the garden includes rare bamboo groves, desert gardens, a tropical rainforest, California native plants, Mediterranean climate landscapes, and a subtropical fruit garden. The gardens are open to the public daily. The name of the facility was changed in 2009 to better reflect the garden's status as a regional attraction.\\nLocated 30 minutes north of San Diego in Encinitas, California, San Diego Botanic Garden features numerous exhibits, including rare bamboo groves, desert gardens, a tropical rainforest, California native plants, Mediterranean climate landscapes, succulent gardens, an herb garden, firesafe landscaping, a subtropical fruit garden, and native coastal sage natural areas. The Hamilton Children's Garden was opened in June 2011, the largest interactive children's garden on the West Coast.\\nUntil 1957 the gardens were the private estate of Ruth Baird Larabee, at which time she donated her house and grounds to the County of San Diego. The Quail Botanical Gardens Foundation was established in 1961."},{"page_url":"https://sv.wikipedia.org/wiki/Largny-sur-Automne","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Map_commune_FR_insee_code_02410.png","page_title":"Largny-sur-Automne","context_page_description":"Largny-sur-Automne är en kommun i departementet Aisne i regionen Hauts-de-France i norra Frankrike. Kommunen ligger i kantonen Villers-Cotterêts som ligger i arrondissementet Soissons. År 2009 hade Largny-sur-Automne 236 invånare."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Grimaud","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Grimaud_%2829%29_v2.jpg","page_title":"Burg Grimaud","context_page_description":"Die Burg Grimaud ist die Ruine einer mittelalterlichen Höhenburg in Frankreich. Sie erhebt sich auf einem Hügel, der den Ort Grimaud im Département Var etwas überragt.\\nDie schon im 11. Jahrhundert erwähnte Burg war Sitz des Seigneurs von Freinet, der ein Lehnsmann des Grafen von Provence war. Im Mittelalter und in der Frühen Neuzeit war die Burg an verschiedene Adelsfamilien verlehnt, die sie veränderten und erweiterten. In den Hugenottenkriegen entwehrt, wurde sie im 17./18. Jahrhundert zu einer schlossartigen Anlage umgestaltet. Nachdem sie während der Französischen Revolution konfisziert und anschließend als Steinbruch genutzt worden war, verfiel die Burg allmählich zu einer Ruine. Heute sind ihre Reste gesichert und stehen Besuchern unentgeltlich das ganze Jahr hindurch offen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D1%85%D0%BB%D0%BE%D0%B2%D0%B8%D1%86%D0%B0_(%D0%BF%D0%B5%D1%89%D0%B5%D1%80%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Uhlovitsa1.jpg","page_title":"Ухловица (пещера)","context_page_description":"Ухловица —пещера в урочище Синий водоворот вблизи села Ухловица Смолянской области в Родопах."},{"page_url":"https://nl.wikipedia.org/wiki/Ambtsketen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Bundesarchiv_Bild_183-1987-1028-040%2C_Berlin%2C_750-Jahr-Feier%2C_Stadtverordnetenversammlung.jpg","page_title":"Ambtsketen","context_page_description":"Een ambtsketen is een ketting, in het algemeen vervaardigd uit zilver, waarmee bepaalde hoge ambtsdragers zoals burgemeesters en rectores van een universiteit zich onderscheiden. De penning aan de keten is het teken van hun ambt, en zij wordt doorgaans alleen bij officiële plechtigheden gedragen."},{"page_url":"https://de.wikipedia.org/wiki/Jyoti_Prakash_Dutta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/JPDutta.jpg","page_title":"Jyoti Prakash Dutta","context_page_description":"Jyoti Prakash Dutta ist ein indischer Filmregisseur und -produzent der Bollywood-Filmindustrie.\\nDutta produziert seine Filme unter seiner eigenen Filmproduktionsgesellschaft JP Films. Zu seinen wichtigsten Filmen gehören der Border, Refugee und Umrao Jaan. Für Border erhielt er einen Filmfare Award für die beste Regie und einen Nargis Dutt Award. Er ist Mitglied des Beraterstabs für die International Indian Film Academy Awards.\\nJ. P. Dutta ist der Sohn des Filmregisseurs und Drehbuchautors O. P. Dutta, mit dem er auch zusammenarbeitet. Er ist mit der Schauspielerin Bindiya Goswami verheiratet und hat zwei Töchter, Nidi und Siddhi."},{"page_url":"https://it.wikipedia.org/wiki/Akka_(Marocco)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Akka_%2810%29.JPG","page_title":"Akka (Marocco)","context_page_description":"Akka è una piccola città marocchina situata nella regione Souss-Massa. Akka è un toponimo di origine berbera: aqa e significa Uadi.\\nPur essendo una piccola città, Akka è molto nota per aver dato natalità al rabbino Mardochée Aby Serour."},{"page_url":"https://pt.wikipedia.org/wiki/Nycticorax_megacephalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Rodrigues_Night_Heron.jpg","page_title":"Nycticorax megacephalus","context_page_description":"Nycticorax megacephalus é uma espécie extinta de garça que era endêmica da ilha Rodrigues."},{"page_url":"https://de.wikipedia.org/wiki/Omar_Mukhtar","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Muchtar_Kamel_70_-_DSCF0230.JPG","page_title":"Omar Mukhtar","context_page_description":"Omar Mukhtar war ein libyscher Koranlehrer und Freiheitskämpfer.\\nWährend der italienischen „Rückeroberung Libyens“ 1923 bis 1932 war er Anführer des libyschen Widerstands in der Cyrenaika. Im Jahr 1931 wurde er von den italienischen Faschisten gefangen genommen und im Konzentrationslager Soluch gehängt. Der Beiname Muchtar bedeutet „der Auserwählte“ und bezeichnet einen gewählten Dorfvorsteher."},{"page_url":"https://en.wikipedia.org/wiki/Northeastern_Huskies_men%27s_ice_hockey","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Joe_Vitale_2013-11-02.JPG","page_title":"Northeastern Huskies men's ice hockey","context_page_description":"The Northeastern Huskies men's ice hockey team is an NCAA Division I college ice hockey program that represents Northeastern University in Boston, Massachusetts. The team has competed in Hockey East since 1984 and has won three tournament titles, having previously played in the Eastern College Athletic Conference, where they won one tournament championship. The Huskies currently play home games at the 4,666-seat Matthews Arena, the world's oldest hockey arena still in use. Former player Jim Madigan has coached the Huskies since 2011."},{"page_url":"https://lt.wikipedia.org/wiki/Semerpalu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/S%C3%B5merpalu_m%C3%B5isa_peahoone.jpg","page_title":"Semerpalu","context_page_description":"Semerpalu – gyvenvietė Veru apskrityje, pietryčių Estijoje. Semerpalu savivaldybės administracinis centras. 332 gyventojai."},{"page_url":"https://en.wikipedia.org/wiki/Renaissance_architecture_in_Central_and_Eastern_Europe","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Kamienica_%22Pod_%C5%9Aw._Krzysztofem_i_%C5%9Aw._Miko%C5%82ajem_%22_ul._Rynek_12_e83.jpg","page_title":"Renaissance architecture in Central and Eastern Europe","context_page_description":"Renaissance architecture was that style of architecture which evolved firstly in Florence and then Rome and other parts of Italy as the result of Renaissance humanism and a revived interest in Classical architecture. It was part of the general movement known as the Italian Renaissance, which spread outwards from Italy and effected many aspects of scholarship and the arts. When the Renaissance spirit was exported into Eastern Europe, it had to compromise with local traditions and climates. The Renaissance style differs from place to place throughout the region with many local characteristics making themselves apparent."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%83%BD%E7%99%BB%E5%8D%8A%E5%B3%B6%E6%B2%BF%E6%B5%B7%E4%B8%8D%E6%98%8E%E8%88%B9%E4%BA%8B%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Seal_of_United_States_Forces_Japan.png","page_title":"能登半島沿海不明船事件","context_page_description":"能登半岛沿海不明船事件，是发生于1999年3月23日至3月24日凌晨的冲突事件，北朝鲜所派遣的可疑船只进入日本领海，接着日方进行一连串的驱赶行动，双方并在过程中开火。"},{"page_url":"https://it.wikipedia.org/wiki/Lophophorus_impejanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Lophophorus_impejanus_MHNT.ZOO.2010.11.10.1.jpg","page_title":"Lophophorus impejanus","context_page_description":"Il lofoforo splendido, o lofoforo himalayano, è un uccello della famiglia Phasianidae. È l'uccello nazionale del Nepal e dell'Uttarakhand."},{"page_url":"https://de.wikipedia.org/wiki/Packard_Hawk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/1958_Packard_Hawk_Convertible.jpg","page_title":"Packard Hawk","context_page_description":"Der Packard Hawk war eines von vier Packard-Automobilen, welche die Studebaker-Packard Corporation 1958 herstellte. Das ursprüngliche Packard-Werk in Detroit war bereits an Curtiss-Wright vermietet, und die Packard-Modelle waren alle umdekorierte Studebaker-Modelle mit Packard-Firmenschild. Der Packard Hawk war eigentlich ein Studebaker Golden Hawk, der etwas in Form und Ausstattung verändert wurde.\\nAnstatt des großen, fast senkrecht stehenden Kühlergrills des Studebaker hatte der Packard ein breites, niedriges Fischmaul direkt über dem vorderen Stoßfänger auf der gesamten Fahrzeugbreite. Darüber gab es eine leicht nach vorne abfallende Nase und eine Motorhaube, die an die 1953er-Studebaker erinnerte, aber mit einer Ausbauchung wie beim Golden Hawk. Darunter lag der McCulloch-Radialverdichter, mit dem der Studebaker-V8 mit 4735 cm³ Hubraum eine Leistung von 275 bhp erreichte. Die Seiten der Heckflossen waren mit metallisierter PET-Folie beklebt, die ihnen ein metallisch-goldenes Aussehen verlieh. Eine Reserveradabdeckung zierte die Kofferraumklappe."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BA%D0%B0%D0%B9%D0%BB%D0%B0%D0%B1_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Carr_i_Pogue..jpg","page_title":"Скайлаб 4","context_page_description":"Скайлаб 4 или SL-4 е третата и последна пилотирана мисия до американската станция Скайлаб. Мисията е изстреляна с ракета-носител Сатурн IB и е с тричленен екипаж. Мисията Скайлаб-4 в поставя рекорд за продължителност на пилотиран космически полет, подобрен едва 4 години по-късно от Союз 26."},{"page_url":"https://en.wikipedia.org/wiki/List_of_elected_and_appointed_female_heads_of_state_and_government","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Soong_Ching-ling_1937.jpg","page_title":"List of elected and appointed female heads of state and government","context_page_description":"The following is a list of women who have been elected head of state or government of their respective countries since the interwar period, and below that is a list of appointed heads of state. The first list includes female presidents who are heads of state and may also be heads of government, as well as female heads of government who are not concurrently head of state, such as prime ministers. The list does not include female monarchs who are head of state.\\nYevgenia Bosch is sometimes considered the first modern woman leader of a national government. She was Minister of Interior and the Acting Leader in 1917-18 of the People's Secretariat of Ukraine, one of a number of competing ruling bodies in the Ukrainian People's Republic. Khertek Anchimaa-Toka, of the mostly unrecognized and now-defunct Tuvan People's Republic, is regarded as \\"first ever elected woman head of state in the world\\". She became the chair of the country's presidium in 1940.\\nThe first woman to be democratically elected as prime minister of a country was Sirimavo Bandaranaike of Ceylon, when she led her party to victory at the 1960 general election."},{"page_url":"https://en.wikipedia.org/wiki/Lorton_station_(VRE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Lorton_VRE_Station-1.JPG","page_title":"Lorton station (VRE)","context_page_description":"Lorton station is a railroad station located at 8990 Lorton Station Boulevard in Lorton, Virginia. It is served by the Virginia Railway Express Fredericksburg Line. This station is one mile north from Amtrak's Lorton station, the northern terminus of the Auto Train. Amtrak's Northeast Regional, Silver Meteor, Silver Star, Palmetto, and Carolinian trains share the line but do not stop at either Lorton station.\\nThe station opened in 1994, two years after VRE began service, as an infill station."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Naturschutzgebiete_in_Schleswig-Holstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/NSG_L%C3%BCtjenholmer_Heided%C3%BCnen_%282%29.jpg","page_title":"Liste der Naturschutzgebiete in Schleswig-Holstein","context_page_description":"Diese sortierbare Liste enthält 203 Naturschutzgebiete in Schleswig-Holstein.\\nNamen und Schlüsselnummern entsprechen, soweit nicht anders angegeben, den amtlichen Bezeichnungen."},{"page_url":"https://it.wikipedia.org/wiki/Ryan_Hedges","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/RyanHedges.jpg","page_title":"Ryan Hedges","context_page_description":"Ryan Peter Hedges è un calciatore gallese, ala dell'Aberdeen e della nazionale gallese."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_Th%E1%BB%A7_t%C6%B0%E1%BB%9Bng_Ph%C3%A1p","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Napoleon-3.jpg","page_title":"Danh sách Thủ tướng Pháp","context_page_description":"Thủ tướng Pháp trong Đệ ngũ Cộng hòa là người đứng đầu Chính phủ và Nội các Pháp. Nguyên thủ Quốc gia là Tổng thống.\\nTrong lịch sử người đứng đầu chính phủ Pháp được gọi bằng nhiều tên khác nhau. Gần đây nhất, trong Đệ nhị, đệ tam, đệ tứ cộng hòa chức vụ được gọi là Chủ tịch Hội đồng Bộ trưởng, hay còn gọi Chủ tịch Hội đồng."},{"page_url":"https://en.wikipedia.org/wiki/Sandwip","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/The_delta_of_Ganges_by_J._Rennel.jpg","page_title":"Sandwip","context_page_description":"Sandwip is an island along the south eastern coast of Bangladesh in the Chittagong District. Also spelled Sandvip, the transliteration of the name would in fact be Shondip. It is part of the sub-district of Sandwip Upazila."},{"page_url":"https://en.wikipedia.org/wiki/Edvard_Westman","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Edvard_Westman_strandlandskap.JPG","page_title":"Edvard Westman","context_page_description":"Gustav Edvard Westman was a Swedish painter, known for his works in the plein air style."},{"page_url":"https://de.wikipedia.org/wiki/Terti%C3%A4r-_und_Industrie-Erlebnispark_St%C3%B6ffel","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/St%C3%B6ffel_hinten.jpg","page_title":"Tertiär- und Industrie-Erlebnispark Stöffel","context_page_description":"Der Tertiär- und Industrie-Erlebnispark Stöffel ist ein Freilichtmuseum im Westerwald. Benannt ist er nach dem Stöffel, einer zwischen den Bächen Nister und Hornister liegenden Basaltkuppe im Bereich der Gemeinden Enspel, Stockum-Püschen und Nistertal im Westerburger Land.\\nDer Park ist entstanden in dem mit rund 140 Hektar größten zusammenhängenden Basaltabbaugebiet im Westerwald. Der Basaltabbau auf dem heutigen Park-Gelände wurde im Jahr 2000 eingestellt. Direkt im Anschluss befindet sich jedoch ein heute noch aktiver Basaltbruch. Auf dem Gelände befindet sich ein in seiner Vollständigkeit einzigartiges Ensemble von historischen Industriebauten der Basaltverarbeitung und eine bedeutsame Fossillagerstätte aus dem späten Paläogen vor 25 Millionen Jahren. In den Sedimentablagerungen eines durch einen Vulkanausbruch verschütteten Sees, die zu Ölschiefer geworden sind, wurden seit 1990 zahlreiche Fossilien entdeckt. Der bekannteste Fund ist die gleitfliegende „Stöffelmaus“ Eomys quercyi. Weitere Funde sind unter anderem Krokodilzähne, Insekten und Amphibien, Säugetiere und Pflanzen."},{"page_url":"https://pt.wikipedia.org/wiki/Stanley_Rogers_Resor","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Stanley_Rogers_Resor%2C_official_photo.jpg","page_title":"Stanley Rogers Resor","context_page_description":"Stanley Rogers Resor era um advogado americano, oficial militar dos Estados Unidos e membro do governo."},{"page_url":"https://fi.wikipedia.org/wiki/Liekkikurkkukukastaja","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/DicaeumMonticolaKeulemans.jpg","page_title":"Liekkikurkkukukastaja","context_page_description":"Liekkikurkkukukastaja on Borneon kotoperäinen punakurkkuinen pienikokoinen varpuslintu."},{"page_url":"https://sv.wikipedia.org/wiki/Fotografi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Chicago_Union_Station_1943.jpg","page_title":"Fotografi","context_page_description":"Fotografi är vetenskapen om framställning och behandling av fotografier. Ett fotografi är också själva benämningen på den tvådimensionella avbildningen av verkligheten som skapas genom att ljus fångas på ett ljuskänsligt medium genom eller i en kamera, antingen mekaniskt, kemiskt eller elektroniskt. Själva avbildningen kopieras sedan vanligen på ett fotopapper, som då utgör det egentliga fotografiet, eller så reproduceras och förevisas det exempelvis på en bildskärm.\\nOrdet fotografi kommer från grekiskans φως phos, ljus, och γράφω graphō, skriva, rita, av grekiska grạphhein - skriva, rita, det vill säga att måla, skriva eller rita med ljus. En fotografisk avbildning kan beroende på vilket ljuskänsligt medium som används bli svartvit eller i färg. Själva bilden som avtecknar sig på det är som regel i färg. Som ett sätt för visuell kommunikation och uttryck har fotografier distinkta estetiska förmågor. Fotografi är också grunden för filmkonsten."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%97%E6%B4%9B%E9%9B%B7%E6%96%AF%E5%B3%B6_(%E4%BA%9E%E9%80%9F%E7%BE%A4%E5%B3%B6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Baia_da_Alagoa_Cedros_Flores_Azores.jpg","page_title":"弗洛雷斯島 (亞速群島)","context_page_description":"弗洛雷斯岛是葡萄牙的火山岛，位于大西洋海域，属于亚速群岛的一部分，长17公里、宽12公里，面积143.1平方公里，最高点海拔高度914米，2003年人口3,907。"},{"page_url":"https://en.wikipedia.org/wiki/David_Zeiger_(industrialist)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/David_Zeiger_Carta_de_Scylla_Medici_1972-01-27.jpg","page_title":"David Zeiger (industrialist)","context_page_description":"David Zeiger Brazilian industrialist in the area of clothing and fashion.\\nZeiger's family immigrated from Ukraine to Brazil in the early 1920s. David, with his siblings and mother, met with his father Shaja Zeiger, who had left Poland a year earlier. Shaja Zeiger was a tailor, and in a few years founded Goomtex, a factory for raincoats and overcoats. As a young man, David Zeiger worked with his father, and soon became the manager of the business. After his marriage, David Zeiger began to run Pullsport—a women's fashion factory—along with his wife Mila.\\nDavid Zeiger also dedicated his energy to the areas of culture, philanthropy, and publicity."},{"page_url":"https://en.wikipedia.org/wiki/Trachyte","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Iron_Pot_Mountain%2C_Yeppoon.jpg","page_title":"Trachyte","context_page_description":"Trachyte is an igneous volcanic rock with an aphanitic to porphyritic texture. It is the volcanic equivalent of syenite. The mineral assemblage consists of essential alkali feldspar; relatively minor plagioclase and quartz or a feldspathoid such as nepheline may also be present. Biotite, clinopyroxene and olivine are common accessory minerals."},{"page_url":"https://nn.wikipedia.org/wiki/Tifinagh","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/2D5D.png","page_title":"Tifinagh","context_page_description":"Tifinagh er eit alfabet nytta for somme tamazightisk språk, i fyrste rekkje tuareg. Tifinagh var opphavleg eit abjadalfabet.\\nEtter som tida har gått har tifinagh vorte modifisert og det finst i dag fleire variantar."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%96%AC%E6%B2%BB%C2%B7%E6%B9%AF%E9%A6%AC%E5%A3%AB%C2%B7%E5%A3%AB%E4%B8%B9%E9%A0%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/George-Thomas-Staunton.jpg","page_title":"喬治·湯馬士·士丹頓","context_page_description":"喬治·湯馬士·斯當東，第二代斯當東從男爵，FRS，俗稱斯當東或小斯當東，英格蘭旅行家及東方文化研究者。\\n他出生於英格蘭的梳士巴利，父親是外交官兼東方文化研究者喬治·倫納德·斯當東。1792年伴隨著身為副使的父親與喬治·馬戛爾尼一同前往中國慶賀乾隆帝八十大壽。其時小斯當東年僅12歲，即能通六國語言，遂頗得乾隆皇帝歡心。1792年至1794年他從中文獲得了良好的知識，1798年於英國東印度公司於廣州代理處任職。1816年以英國東印度公司在廣州的特別委員會主席與正使阿美士德，副使埃利斯出使，主要是敦請清廷廢除公行制，多開商埠，以及進行自由貿易；此外，他們還打算向清帝解釋英國對尼泊爾的軍事行動。\\n1818年至1852年曾於幾個英國地區出任國會議員，最後是出任樸次茅斯國會議員，並加入東印度委員會，1823年加入科爾布魯克創辦亞洲文會。1840年四月七日，英國下議院開會討論是否對華用兵，當正反兩派旗鼓相當之時，小斯當東發表了主戰演說，演說中強調中國對於國際法的漠視，以及對英人態度的嚴刻，他認為必須以訴諸武力的方式，來維護英國的商業利益。並在演說中驕傲地提及自己過去在阿美士德使團時所作的堅持，即不屈做跪叩之禮。"},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%B5%E0%A4%BF%E0%A4%B6%E0%A5%8D%E0%A4%B5%E0%A4%B5%E0%A4%BF%E0%A4%A6%E0%A5%8D%E0%A4%AF%E0%A4%BE%E0%A4%B2%E0%A4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Tartu_-_panoramio_%2810%29.jpg","page_title":"विश्वविद्यालय","context_page_description":"विश्वविद्यालय त्यो संस्था हो जसमा सबै प्रकारको विद्याहरुको उच्च कोटिको शिक्षा दिइन्छ, परीक्षा लिइन्छ तथा मानिसहरुलाई विद्या सम्बन्धी उपाधीहरु आदि प्रदान गरिन्छ। यसका अन्तर्गत विश्वविद्यालयका मैदान, भवन, प्रभाग, तथा विद्यार्थिहरुको सङ्गठन आदि पनि सम्मिलित छन्।"},{"page_url":"https://it.wikipedia.org/wiki/Wotton","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Saint_Hippolytus_Church_in_Wotton.JPG","page_title":"Wotton","context_page_description":"Wotton è un comune del Canada, situato nella provincia del Québec, nella regione di Estrie."},{"page_url":"https://sv.wikipedia.org/wiki/Pyrazin","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Pyrazine-3D-balls-B.png","page_title":"Pyrazin","context_page_description":"Pyrazin eller 1,4-diazabensen är ett vitt kristallint pulver med en irriterande pyridinaktig lukt. Pyrazin är en svag bas, pKₐ för korresponderande syra är 1,00. Pyrazin är hygroskopiskt och blandbart med vatten i alla proportioner, något löslig i etanol och dietyleter."},{"page_url":"https://br.wikipedia.org/wiki/Potifar","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Guercino_Gius_moglie_Putif..jpg","page_title":"Potifar","context_page_description":"Potifar pe Putiphar a zo, e levr ar C'heneliezh, un ofiser d'ar faraon, karget d'ober war-dro gwarded ar palez.\\nPrenañ a reas ar sklav Jozeb a oa bet gwerzhet gant e vreudeur, ha kaset da Egipt. Deuet e oa Jozeb da vezañ penn ar vevelien. Gwreg Potifar a orgedas ouzh Jozeb, met eñ a nac'has kousket ganti. Tamallet e voe Jozeb neuze gant ar wreg da vezañ klasket he gwallañ, ha taolet e voe Jozeb er vac'h gant Potifar. Diwezhatoc'h e voe tennet alese gant ar faraon."},{"page_url":"https://vec.wikipedia.org/wiki/Saint-Christophe-de-Valains","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Saint-Christophe-de-Valains_%2835%29_Mairie.jpg","page_title":"Saint-Christophe-de-Valains","context_page_description":"Saint-Christophe-de-Valains el xé on comun de 225 abitanti del departemento de Ille-et-Vilaine che el fa parte del rejon Bretagna in Fransa."},{"page_url":"https://sk.wikipedia.org/wiki/IRIS-T","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/IRIS-T_air-to-air-missile.jpg","page_title":"IRIS-T","context_page_description":"IRIS-T je raketa vzduch-vzduch krátkeho dosahu s infračerveným navádzaním. Jej producentom je nemecký výrobca zbraní Diehl BGT Defence. Impulzom na vývoj tejto strely bola potreba, nahradiť raketu AIM-9L."},{"page_url":"https://no.wikipedia.org/wiki/Teglverksdammen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Teglverksdammen.jpg","page_title":"Teglverksdammen","context_page_description":"Teglverksdammen er en park på Hasle i Oslo, åpnet i 2015, der Hovinbekken er gjenåpnet og danner to store dammer."},{"page_url":"https://lt.wikipedia.org/wiki/Koral%C5%B3_j%C5%ABra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Part_of_Great_Barrier_Reef_from_Helicopter.jpg","page_title":"Koralų jūra","context_page_description":"Koralų jūra – tai pusiau uždara Ramiojo vandenyno jūra, esanti šiaurės rytinėje Australijos pakrantėje. Jūra taip pat skalauja Naujosios Gvinėjos ir Naujosios Kaledonijos krantus. Toreso sąsiauriu jungiasi su Indijos vandenynu. Pavadinimas kilęs iš joje esančio Didžiojo barjerinio rifo – didžiausio koralinio rifo pasaulyje. Joje išsidėsčiusi bendravardė negyvenamų salų grandinė – Koralų jūros salos.\\nJūros plotas 4,068 mln. km². Gylis iki 9174 m. Vandens temperatūra pietuose nuo 19 °C rūgpjūtį iki 24 °C vasarį, šiaurėje siekia 28 °C. Potvynių aukštis iki 7,2 m.\\nSvarbiausi uostai: Kernsas, Port Morsbis, Numea."},{"page_url":"https://eu.wikipedia.org/wiki/Parada_baserria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Parada_baserria.JPG","page_title":"Parada baserria","context_page_description":"Parada baserria Donostiako eraikuntza zaharrenetarikoa da. Mirakruz gainaren aldean kokatua dago, Altzako Binagrene auzoan gaur Intxaurrondo, Pasaiako bidean. Parada izenak jatorri gaskoia du, inguruko Arzak bezala. Bai Donostian baita Pasaian ere jatorri gaskoiko komunitate garrantzitsua bizi zen. Etxe armarridun da. Helbidea Parada bidea 8 da. Ondoan, beste etxe modernoago atxikituta dauka, 1911an eraikia."},{"page_url":"https://en.wikipedia.org/wiki/Superfluid_helium-4","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Normal_and_superfluid_density_01.jpg","page_title":"Superfluid helium-4","context_page_description":"Superfluid helium-4 is the superfluid form of helium-4, an isotope of the element helium. A superfluid is a state of matter in which matter behaves like a fluid with zero viscosity. The substance, which looks like a normal liquid, flows without friction past any surface, which allows it to continue to circulate over obstructions and through pores in containers which hold it, subject only to its own inertia.\\nKnown as a major facet in the study of quantum hydrodynamics and macroscopic quantum phenomena, the superfluidity effect was discovered by Pyotr Kapitsa and John F. Allen, and Don Misener in 1937. It has since been described through phenomenological and microscopic theories. The formation of the superfluid is known to be related to the formation of a Bose–Einstein condensate. This is made obvious by the fact that superfluidity occurs in liquid helium-4 at far higher temperatures than it does in helium-3. Each atom of helium-4 is a boson particle, by virtue of its zero spin. Helium-3, however, is a fermion particle, which can form bosons only by pairing with itself at much lower temperatures, in a process similar to the electron pairing in superconductivity."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%B5%D0%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Voreppe.JPG","page_title":"Вореп","context_page_description":"Вореп — Францин гӀала-коммуна, лаьтта Рона — Альпаш регионехь. Коммунан департамент — Изер. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://en.wikipedia.org/wiki/Yulia_Peresild","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Yulia_Peresild%2C_March_2013.jpg","page_title":"Yulia Peresild","context_page_description":"Yulia Sergeevna Peresild is a Russian stage and film actress."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E7%8E%8B%E7%B4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Wang_Fu-Ink_Bamboo.jpg","page_title":"王紱","context_page_description":"王紱，字孟端，號友石生，九龍山人，無錫人，明代著名畫家。\\n元至正二十二年五月初三日生，幼年聰穎好學，為弟子員，能書畫，擅長山水，師法吳鎮、王蒙。洪武初年薦入翰林，擢為中書舍人。建文二年隱居九龍山。為惠山寺僧性海作《竹爐煮茶圖》。永樂元年，供事文淵閣，參與編纂《永樂大典》，曾隨明成祖北巡。永樂十四年二月六日病逝京師館舍。"},{"page_url":"https://no.wikipedia.org/wiki/Corydoras_delphax","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Corydoras_delphax.jpg","page_title":"Corydoras delphax","context_page_description":"Corydoras delphax er en art i gruppen pansermaller.\\nDet er en liten fisk som lever i ferskvann i Inirida og andre steder i øvre Orinoco i Colombia.\\nDen blir opptil 4,9 cm lang SL."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D1%96%D0%BB%D1%96%D0%BF%D0%BF_II_(%D0%B3%D0%B5%D1%80%D1%86%D0%BE%D0%B3_%D0%91%D1%83%D1%80%D0%B3%D1%83%D0%BD%D0%B4%D1%96%D1%97)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Karte_Haus_Burgund_1.png","page_title":"Філіпп II (герцог Бургундії)","context_page_description":"Філіпп II Сміливий, Лисий — герцог Бургундії у 1363–1404 роках, визначний політичний діяч."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Monterey_County,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Monterey_Co_Jail.jpg","page_title":"National Register of Historic Places listings in Monterey County, California","context_page_description":"This is a list of the National Register of Historic Places listings in Monterey County, California.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Monterey County, California, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in an online map.\\nThere are 59 properties and districts listed on the National Register in the county, including 6 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 31, 2020."},{"page_url":"https://nl.wikipedia.org/wiki/Uil_van_Athene","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Twaalf_gouden_uilen_Wia_van_Dijk.jpg","page_title":"Uil van Athene","context_page_description":"De uil van Athene is een kleine uil die in de Griekse mythologie Pallas Athena, de godin van de wijsheid, vertegenwoordigt of vergezelt. In de Romeinse mythologie is het equivalent de uil van Minerva, Athene's syncretische incarnatie. De uil was in de klassieke oudheid een symbool van kennis, wijsheid en scherpzinnigheid."},{"page_url":"https://nl.wikipedia.org/wiki/Valleien_van_de_Laambeek,_Zonderikbeek,_Slangebeek_en_Roosterbeek_met_vijvergebieden_en_heiden","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Laambeek_1.jpg","page_title":"Valleien van de Laambeek, Zonderikbeek, Slangebeek en Roosterbeek met vijvergebieden en heiden","context_page_description":"Valleien van de Laambeek, Zonderikbeek, Slangebeek en Roosterbeek met vijvergebieden en heiden is een Natura 2000-gebied in Vlaanderen. Het overlapt gedeeltelijk met vogelrichtlijngebied 'Vijvercomplex van Midden-Limburg'. Dit gebied beslaat 5095 hectare en ligt in de provincie Limburg ten noordoosten van de stad Hasselt. Het grootste gedeelte bestaat uit een uitgestrekt vijverlandschap, heiden en bossen doorsneden door tal van valleien van laaglandbeken die ontspringen op het Kempens plateau."},{"page_url":"https://fr.wikipedia.org/wiki/Poule_meusienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Poule_meusienne.jpg","page_title":"Poule meusienne","context_page_description":"La meusienne est une race de poule domestique française."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Studentenverbindungen_in_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Corps_Berlin_320.png","page_title":"Liste der Studentenverbindungen in Berlin","context_page_description":"Diese Liste der Studentenverbindungen in Berlin verzeichnet die Korporationen an der Humboldt-Universität zu Berlin, der Technischen Universität Berlin, der Kaiser-Wilhelms-Akademie für das militärärztliche Bildungswesen, der Handelshochschule Berlin, der Landwirtschaftlichen Hochschule Berlin und der Tierärztlichen Hochschule Berlin und deren Vorgängern."},{"page_url":"https://ca.wikipedia.org/wiki/Margaridoia_perenne","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Bellis_perennis_white_%28aka%29.jpg","page_title":"Margaridoia perenne","context_page_description":"La margaridoia perenne és una planta herbàcia molt comú als Països Catalans que creix de forma silvestre als prats o a les vores dels camins. A nivell popular, són poc conegudes les seves propietats medicinals, però en realitat té moltes aplicacions."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%E2%80%9E%D0%A1%D0%B2._%D0%A2%D1%80%D0%BE%D0%B8%D1%86%D0%B0%E2%80%9C_-_%D0%94%D0%BE%D0%B1%D1%80%D0%BE%D1%88%D0%B8%D0%BD%D1%86%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Holy_Trinity_Church_%28Dobro%C5%A1inci%29_%288%29.jpg","page_title":"Црква „Св. Троица“ - Доброшинци","context_page_description":"„Св. Троица“ — црква која се наоѓа во Доброшинци, Општина Василево."},{"page_url":"https://en.wikipedia.org/wiki/Hybomitra_montana","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Tabanidae_-_Hybomitra_montana.jpg","page_title":"Hybomitra montana","context_page_description":"Hybomitra montana, the Slender-horned Horsefly, is a species of horse flies in the family Tabanidae."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AA%E0%A5%8B%E0%A4%B2%E0%A5%88%E0%A4%82%E0%A4%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Warsaw_modern_buildings.jpg","page_title":"पोलैंड","context_page_description":"पोलैंड, आधिकारिक तौर पर पोलैंड गणराज्य, मध्य यूरोप में एक देश है। पोलैंड का कुल क्षेत्रफल लगभग 3 मिलियन वर्ग किलोमीटर है, जो इसे यूरोप का 9वां सबसे बड़ा देश बना देता है। लगभग 40 मिलियन की आबादी के साथ, यह यूरोपीय संघ का 6 वां सबसे अधिक आबादी वाला देश है। राज्य बाल्टिक सागर से कारपैथी पर्वत तक फैला हुआ है। पोलैंड की राजधानी वारसॉ है। अन्य शहर क्रकाउ, व्रोकला, डांस्क‎ और पॉज़्नान हैं।\\nपश्चिम में जर्मनी के साथ पोलैंड सीमाएं, दक्षिण में चेक गणराज्य और स्लोवाकिया और पूर्व में लिथुआनिया, यूक्रेन, बेलारूस और रूस के साथ।\\nपोलैंड की स्थापना ड्यूक मिज़को प्रथम के तहत एक राष्ट्र के रूप में की गई थी, जिसने ९६६ ईस्वी में देश को ईसाई धर्म में परिवर्तित कर दिया था। १०२५ में, पोलैंड के पहले राजा को ताज पहनाया गया था और १५६९ में, पोलैंड ने लिथुआनिया के ग्रैंड डची के साथ एक लंबा सहयोग स्थापित किया, इस प्रकार पोलिश-लिथुआनियन राष्ट्रमंडल की स्थापना की। यह राष्ट्रमंडल उस समय के सबसे बड़े और सबसे शक्तिशाली यूरोपीय देशों में से एक था। यह १७९५ में टूट गया था और पोलैंड ऑस्ट्रिया, रूस और प्रशिया के बीच बांटा गया था। प्रथम विश्व युद्ध के बाद १९१८ में पोलैंड फिर से स्वतंत्र हो गया। द्वितीय विश्व युद्ध १९३९ में शुरू हुआ जब नाजी जर्मनी और सोवियत संघ ने पोलैंड पर हमला किया।"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D8%B1%D9%88%D8%AF%DA%AF%D8%A7%D9%87_%DA%A9%D9%88%D8%A6%DB%8C%D9%86%D8%B2%D8%AA%D8%A7%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Queenstown_Airport_view_from_Deer_Park.jpg","page_title":"فرودگاه کوئینزتاون","context_page_description":"فرودگاه کوئینزتاون یک فرودگاه همگانی مسافربری با کد یاتا ZQN است که یک باند فرود آسفالت دارد و طول باند آن ۱۷۷۷ متر است. این فرودگاه در کشور نیوزلند قرار دارد و در ارتفاع ۳۵۷ متری از سطح دریا واقع شده است."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AC%E0%B5%8D%E0%B4%B0%E0%B5%8C%E0%B5%BA%E0%B4%B2%E0%B5%8B%E0%B4%B5%E0%B4%BF%E0%B4%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Brownlowia_elata_%28Illustration%29.jpg","page_title":"ബ്രൌൺലോവിയ","context_page_description":"മാൽവേസീ കുടുംബത്തിലെ പൂച്ചെടികളുടെ ഒരു ജനുസ്സാണ് ബ്രൗൺലോവിയ.\\nസ്പീഷീസ് include:\\nBrownlowia arachnoidea\\nBrownlowia argentata\\nBrownlowia calciphila\\nBrownlowia clemensiae\\nBrownlowia cuspidata\\nBrownlowia denysiana\\nBrownlowia dictyopsila\\nBrownlowia eberhardtii\\nBrownlowia elata\\nBrownlowia elliptica\\nBrownlowia emarginata\\nBrownlowia ferruginea\\nBrownlowia fluminensis\\nBrownlowia glabrata\\nBrownlowia grandistipulata\\nBrownlowia havilandii\\nBrownlowia helferiana\\nBrownlowia kleinhovioidea\\nBrownlowia macrophylla\\nBrownlowia ovalis\\nBrownlowia paludosa\\nBrownlowia palustris\\nBrownlowia peltata\\nBrownlowia purseglovei\\nBrownlowia riparia\\nBrownlowia rubra\\nBrownlowia sarawhensis\\nBrownlowia sarwonoi\\nBrownlowia stipulata\\nBrownlowia tabularis\\nBrownlowia tersa\\nBrownlowia velutina"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%82%B2%E3%82%B9%E3%82%BF%E3%83%B3%E3%81%AE%E6%AD%B4%E5%8F%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Sunni_Muslim_man_wearing_traditional_dress_and_headgear.jpg","page_title":"ダゲスタンの歴史","context_page_description":"本項ではダゲスタンの歴史について述べる。北コーカサス東部にあるダゲスタンは歴史的にいくつかの公国で構成された。南のイスラム教国と北の正教会国家が覇権を争う場所としての役割が19世紀初まで長く続き、特にペルシアとロシア帝国の間の紛争が最も重要であった。\\n「ダゲスタン」という名前は歴史上東コーカサスを指した。この地域は1860年にロシア帝国に併合され、ダゲスタン州に改名された。その後、テレク州東部も含めて1921年にダゲスタン自治ソビエト社会主義共和国が成立、1991年に自治権のより強い、ロシア連邦の構成主体であるダゲスタン共和国に変わって現代にいたる。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Pieschen_(A%E2%80%93K)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Barbarastra%C3%9Fe_40%E2%80%9342.JPG","page_title":"Liste der Kulturdenkmale in Pieschen (A–K)","context_page_description":"Die Liste der Kulturdenkmale in Pieschen umfasst sämtliche Kulturdenkmale der Dresdner Gemarkung Pieschen.\\nAufgrund der hohen Anzahl der Kulturdenkmale wurde die alphabetisch nach Adressen geordnete Liste in folgende zwei Teillisten untergliedert:\\nListe der Kulturdenkmale in Pieschen (A–K)\\nListe der Kulturdenkmale in Pieschen\\nDiese Teilliste enthält alle Kulturdenkmale in den Straßen von A–K."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Myrmecia_species","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Myrmecia_esuriens_casent0914027_p_1_high.jpg","page_title":"List of Myrmecia species","context_page_description":"Myrmecia is a genus of small to large venomous ants commonly known as bulldog ants or jack jumper ants. The genus was first established by Danish zoologist Johan Christian Fabricius in 1804 and is placed in the subfamily Myrmeciinae of the family Formicidae. There are currently 94 described species in this genus, 93 of which are valid and identifiable. Almost all species are endemic to Australia and can be found nowhere else, with an exception of a single species found in New Caledonia."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8A%A0%E6%8B%BF%E5%A4%A7%E5%9B%BD%E5%AE%B6%E5%85%AC%E5%9B%AD%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Kejimkujik_NP_Nova_Scotia_3.jpg","page_title":"加拿大国家公园列表","context_page_description":"加拿大国家公园是依据加拿大国家公园法案设立保护区，由加拿大政府拥有。国家公园保留地是已经按照国家公园标准设立但尚未正式认定的国家公园，属于国家公园系统的一部分。加拿大一共设立了39个国家公园和8个国家公园保留地，分布在10个省和3个地区，总面积达303,571平方千米，约占全国土地面积的3%。加拿大公园管理局负责管理加拿大国家公园和国家公园保留地，首要任务为保护这些地区的生态完整，其次为帮助人们探索研究和享受这些区域的自然空间 。广义的国家公园还包括四个国家海洋保护区域和一个国家地标。"},{"page_url":"https://de.wikipedia.org/wiki/Rallye-Weltmeisterschaft_2001","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Sb_skoda.jpg","page_title":"Rallye-Weltmeisterschaft 2001","context_page_description":"Die FIA-Rallye-Weltmeisterschaft 2001 wurde am 19. Januar in Monte Carlo gestartet und endete am 25. November in Großbritannien. Insgesamt wurden 14 Weltmeisterschaftsläufe auf vier Kontinenten gefahren. Richard Burns wurde Weltmeister. Er überholte mit einem dritten Rang im letzten Weltmeisterschaftslauf Colin McRae und Tommi Mäkinen."},{"page_url":"https://ro.wikipedia.org/wiki/Parcul_Ion_Voicu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Parcul_Ioanid.jpg","page_title":"Parcul Ion Voicu","context_page_description":"Parcul Ioanid este un parc din București, sectorul 2, cu o suprafață de 10.000 mp, amenajat pe locul fostului afluent al Dâmboviței, Bucureștioara. Parcul este declarat monument istoric, cu codul B-II-a-A-18300.\\nLibrarul și editorul George Ioanid, care avea una din primele librarii din București, pe Calea Victoriei, a cumpărat terenul în 1856 de la marele agă Pană Băbeanul pentru 2100 de galbeni. Înainte zona fusese una din multele \\"grădini\\" din București, cunoscută sub numele de Grădina Breslea, menționată ca atare și în \\"Ciocoii vechi și noi\\".\\nÎn 1870, terenul mlăștinos, aflat în proprietatea librarului Gheorghe Ioanid, a fost desecat, proprietarul acestuia a hotărât să-l amenajeze ca parc, plantând în acest sens mai mulți copaci pe terenul mlăștinos.\\nAspectul actual al parcului a luat naștere între anii 1909-1910, când Primăria orașului București a început în zonă o serie de lucrări de urbanism cunoscute sub numele de \\"lotizarea Ioanid\\". Astfel, a apărut un cartier de vile dispuse în jurul actualului parc, fiecare casă având o vedere directă la parc.\\nParcul a fost proiectat după tiparul scuarurilor englezești și al parcurilor franțuzești, în special Parcul Monceau din Paris."},{"page_url":"https://en.wikipedia.org/wiki/Southern_League_All-Star_Game","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/1ST_Chris_Coghlan.jpg","page_title":"Southern League All-Star Game","context_page_description":"The Southern League All-Star Game is an annual baseball game sanctioned by Minor League Baseball between professional players from the teams of the Double-A Southern League. Each division, North and South, fields a team composed of players in their respective divisions as voted on by the managers, general managers, and broadcasters from each of the league's 10 clubs.\\nFrom the first All-Star Game in 1964 through 1998, the event predominantly consisted of a single team of the league's All-Stars versus a Major League Baseball team. The division versus division format has been used since 1999. No game was held from 1991 to 1995 as the Southern League and the other two Double-A leagues, the Eastern League and Texas League, participated in the Double-A All-Star Game instead.\\nTraditionally, the game has taken place during the three-day All-Star break between the first and second halves of the season. The game is meant to mark the halfway-point in the season with the first 70 games being played before and the remaining 70 after. Some additional events, such as the Home Run Derby and All-Star Fan Fest take place each year during this break in the regular season."},{"page_url":"https://pt.wikipedia.org/wiki/Elei%C3%A7%C3%B5es_distritais_no_Distrito_Federal_em_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Luiz_Pitiman.JPG","page_title":"Eleições distritais no Distrito Federal em 2014","context_page_description":"As eleições distritais no Distrito Federal em 2014 aconteceram em 5 de outubro, como parte das eleições em 26 estados e no Distrito Federal. Foram eleitos o governador, o vice-governador, um senador, oito deputados federais e vinte e quatro estaduais.\\nComo nenhum dos candidatos a governador recebeu metade do votos válidos, um segundo turno foi realizado em 26 de outubro. Pela Constituição, o governador é eleito para um mandato de quatro anos a se iniciar em 1º de janeiro de 2015.\\nO governador do Distrito Federal à época era Agnelo Queiroz, que tentou a reeleição, tendo de enfrentar Luiz Pitiman, Rodrigo Rollemberg, Toninho do PSOL e Perci Marrara, além do ex-governador cassado José Roberto Arruda, que decidiu renunciar à candidatura e deixou em seu lugar Jofran Frejat. Na eleição para senador, Reguffe foi eleito para a sucessão de Gim Argello com 57,61%.\\nCom 55,56% dos votos válidos, o senador Rodrigo Rollemberg, do Partido Socialista Brasileiro foi eleito governador do Distrito Federal derrotando Jofran Frejat, do Partido da República que obteve 44,44% dos votos."},{"page_url":"https://cy.wikipedia.org/wiki/New_Roads,_Louisiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Chep_Morrison_1961.jpg","page_title":"New Roads, Louisiana","context_page_description":"Dinas yn Pointe Coupee Parish, yn nhalaith Louisiana, Unol Daleithiau America yw New Roads, Louisiana."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D8%A7%D8%B1%D9%84_%D8%B3%D8%AA%D8%B4%D9%88%D8%B1%D9%8A%D8%AA%D8%B4%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b8/Schuricht5.jpg","page_title":"كارل ستشوريتشت","context_page_description":"كارل ستشوريتشت كان ملحن مزيكا من المانيا."},{"page_url":"https://fr.wikipedia.org/wiki/Dongfeng_Peugeot-Citro%C3%ABn_Automobiles","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Citro%C3%ABn_C4L_02_China_2013-03-02.jpg","page_title":"Dongfeng Peugeot-Citroën Automobiles","context_page_description":"Dongfeng Peugeot-Citroën Automobile est une coentreprise entre l'industriel chinois Dongfeng Motor Corporation et le constructeur automobile français PSA Peugeot Citroën. DPCA compte en 2006 deux implantations industrielles à Wuhan et à Xiangyang dans la province du Hubei. Après la troisième usine de Wuhan inaugurée en juin 2013, PSA obtient durant l'été 2014 l'autorisation pour une quatrième usine à Chengdu. Grâce à la stratégie et aux produits mis en place en 2012 et 2013 sous la présidence de Philippe Varin, les ventes de DPCA ont bondi de 28 % au premier semestre 2014, dans un marché global en hausse de 12.3%.\\nDongfeng Citroën s'est classé premier dans l'enquête de satisfaction de J.D. Power en Chine, Dongfeng Peugeot se situant lui aussi nettement au-dessus de moyenne des constructeurs généralistes.\\nDans le même temps, Dongfeng et PSA Peugeot Citroën sont en négociation pour une entrée au capital de PSA par Dongfeng. Le 20 janvier 2014, le conseil de surveillance de PSA valide la montée au capital de Dongfeng, à hauteur de 750 millions d'euros, soit 14 % du capital."},{"page_url":"https://az.wikipedia.org/wiki/Kardiogen_%C5%9Fok","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/PanoramaKardiogen_%C5%9Fok.jpg","page_title":"Kardiogen şok","context_page_description":"Kardiogen şok ürəyin nasos funksiyasının kəskin çatmamazlığı nəticəsində meydana çıxan kəskin qan dövranı pozğunluğu. Bu hal potensial olaraq reanimasion tədbirlərlə aradan qaldırıla bilinir. Reanimasion tədbirlərsiz kardiogen şok beyin ölümü ilə nəticələnir."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%AD%D2%AB%D0%BA%D0%B5%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Harvesting_at_Silkstone_Common_-_geograph.org.uk_-_519170.jpg","page_title":"Эҫкерт","context_page_description":"Эҫкерт — бесән, һалам йәки көлтәне өҫкә табан тарайта барып, тығыҙлап тултырылған дүрткел оҙонса өйөм. Ул мал аҙығын асыҡ һауала һаҡлау өсөн тәғәйенләнә."},{"page_url":"https://en.wikipedia.org/wiki/Joe_Sam_Queen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Joe_Sam_Queen.jpg","page_title":"Joe Sam Queen","context_page_description":"Joe Sam Queen is a North Carolina politician and architect. He has served in both the North Carolina Senate and the North Carolina House of Representatives."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%95%D7%A7%D7%95%D7%9F_%D7%94%D7%A9%D7%99%D7%A9%D7%99,_%D7%9E%D7%9C%D7%9A_%D7%A0%D7%95%D7%A8%D7%95%D7%95%D7%92%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Waldemar_IV_Otherday_of_Denmark_c_1375_crop.jpg","page_title":"הוקון השישי, מלך נורווגיה","context_page_description":"הוקון מגנוססון היה מלך נורווגיה מ-1343 ועד מותו, תחת השם הוקון השישי ומלך שוודיה מ-1362 ועד 1364, תחת השם האקאן השני. לעיתים הוא ידוע בשם הוקון מגנוססון הצעיר, כדי להבדילו מרב-סבו, הוקון החמישי, שמלך בין השנים 1299–1319.\\nהוקון היה בנו הצעיר של מגנוס הרביעי, מלך שוודיה, שמלך גם בנורווגיה כ\\"מגנוס השביעי\\". הכוונה הייתה שאחיו הגדול, אריק, יירש את אביהם על כס מלכות שוודיה, בעוד שהוקון הוכתר כמלך נורווגיה עוד בחיי אביו. מגנוס העדיף את הוקון על פני אריק, וכך גרם לאריק למרוד ולהשתלט על דרום שוודיה. אריק מת ב-1359 והוקון נעשה שליט-שותף של שוודיה יחד עם אביו שלוש שנים לאחר מכן. השניים מלכו יחדיו על שוודיה עד –1364, כאשר הם הודחו לטובתו של אחיינו של מגנוס, אלברכט ממקלנבורג, על ידי קבוצת אצילים שוודים גולים בראשותו של בו יונסון. מגנוס והוקון ניסו לקבל בחזרה את כס המלכות השוודי, אך ללא הצלחה.\\nב-1363 נשא הוקון לאישה את מרגרטה, בתו של ולדמר הרביעי, מלך דנמרק. הנישואים, שבעצמם היו חלק ממאבק כוחות נורדי, הביאו לעולם בן אחד, אולף. עימותיו המתמשכים של הוקון עם חותנו הסתיימו רק כאשר זה האחרון הלך לעולמו ב-1375. הוקון ניצל את ההזדמנות כדי שבנו ייבחר כיורשו של סבו, והביס את קרובי משפחתה של אשתו מבית מקלנבורג בתביעתם לכתר.\\nלאחר מותו של הוקון ב-1380, ירש אותו בנו אולף, כשמרגרטה משמשת כעוצרת."},{"page_url":"https://de.wikipedia.org/wiki/Drosera_linearis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Drosera_linearis_by_reuvenm_cropped_CC-BY.jpg","page_title":"Drosera linearis","context_page_description":"Drosera linearis ist eine fleischfressende Pflanze aus der Gattung Sonnentau."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%9B%BB%E6%BC%BF%E7%89%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Magnetosphere_rendition.jpg","page_title":"電漿片","context_page_description":"等离子片是磁层内密度较高的片状区域，在靠近赤道平面附近的低磁场区以热等离子将磁层内的瓣分隔出成南半球和北半球。\\n磁层是由带电粒子流，如太阳风，和行星磁场交互作用产生的。所有行星，包括地球，的内在磁场，都有磁层包围着。"},{"page_url":"https://de.wikipedia.org/wiki/Nikolai_Iwanowitsch_Kostomarow","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Stamp_of_Ukraine_s14.jpg","page_title":"Nikolai Iwanowitsch Kostomarow","context_page_description":"Nikolai Iwanowitsch Kostomarow war ein russischer Sozialaktivist, Historiker, Schriftsteller und Dichter, wirklicher Staatsrat, Mitglied der Sankt Petersburger Kaiserlichen Akademie der Wissenschaften sowie einer der Führer der St. Cyril und Methodius-Bruderschaft. Er war Forscher der soziopolitischen und wirtschaftlichen Geschichte Russlands, vor allem dem Gebiet der heutigen Ukraine."},{"page_url":"https://es.wikipedia.org/wiki/Western_Springs_(Illinois)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Western_Springs_IL_Water_Tower_1.jpg","page_title":"Western Springs (Illinois)","context_page_description":"Western Springs es una villa ubicada en el condado de Cook en el estado estadounidense de Illinois. En el Censo de 2010 tenía una población de 12975 habitantes y una densidad poblacional de 1.794,3 personas por km².​"},{"page_url":"https://en.wikipedia.org/wiki/Mars_Cube_One","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/PIA20346marsco.jpg","page_title":"Mars Cube One","context_page_description":"Mars Cube One was a Mars flyby mission launched on 5 May 2018 alongside NASA's InSight Mars lander mission. It consisted of two nanospacecraft, MarCO-A and MarCO-B, that provided a real-time communications link to Earth for InSight during its entry, descent, and landing on 26 November 2018 - when InSight was out of line of sight from the Earth. Both spacecraft were 6U CubeSats, and the mission was a test of new miniaturized communications and navigation technologies. These were the first CubeSats to operate beyond Earth orbit, and aside from telecommunications they also tested CubeSats' endurance in deep space. On 5 February 2019, NASA reported that both the CubeSats had gone silent by 5 January 2019, and are unlikely to be heard from again. In August 2019, the CubeSats were honored for their role in the successful landing of the InSight lander on Mars.\\nThe InSight lander re-transmitted its telemetry data during the landing, which demonstrated the new relay system and technology for future use in missions to other Solar System bodies. This provided an alternative to the orbiters for relaying information and achieved a technology development threshold."},{"page_url":"https://no.wikipedia.org/wiki/Mahmud_I","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/63/Tughra_of_Mahmud_I.JPG","page_title":"Mahmud I","context_page_description":"Mahmud I var sultan i Det osmanske riket fra 1730 til 1754."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%A4%D1%80%D0%B0%D0%B9%D0%B5%D0%BD%D1%88%D1%82%D0%B0%D0%B9%D0%BD-%D0%A2%D0%BE%D0%B9%D1%84%D0%B5%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Karte_Gemeinde_Freienstein-Teufen_2007.png","page_title":"Фрайенштайн-Тойфен","context_page_description":"Фрайенштайн-Тойфен — Швейцарияның Цюрих кантонында орналасқан коммуна. Бюлах округінің құрамына кіреді.\\n2007 жылғы мәліметтер бойынша тұрғындарының саны 2227 адамды құрайды. Алып жатқан жер аумағы 8.32 км² шамасында. Ресми идентификациялық коды — 57, пошта индексі — 8427."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D9%88%D8%B1%DA%86_%D8%AF%D9%8A%D8%AA%D9%8A%D8%B1%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Georges_Di%C3%A9terle_%281844-1937%29_%28A%29.jpg","page_title":"چورچ ديتيرل","context_page_description":"چورچ ديتيرل كان مهندس من فرنسا."},{"page_url":"https://fi.wikipedia.org/wiki/Saab_90_Scandia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/SAAB_Scandia_SAS_Heathrow_1953.jpg","page_title":"Saab 90 Scandia","context_page_description":"Saab 90 Scandia on ruotsalaisen SAAB-lentokonetehtaan ensimmäinen matkustajalentokone ja sellaisena yhtiön ensimmäinen siviililentokone.\\nKun vuonna 1944 oli selvää, että toinen maailmansota päättyisi pian, Saab pyrki pääsemään sodan jälkeisille siviilikonemarkkinoille. Myös Saab-henkilöauton kehittäminen oli konversiota sotataloudesta."},{"page_url":"https://en.wikipedia.org/wiki/Frazier_Bridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Frazier_Bridge_Sign.jpg","page_title":"Frazier Bridge","context_page_description":"Frazier Bridge is a historic Double arched bridge over the La Chute River at Ticonderoga in Essex County, New York. It was built in 1894 and is a double-arched masonry bridge, 23 feet wide and spanning 50 feet at roughly 10 feet above water level.\\nIt was listed on the National Register of Historic Places in 1998."},{"page_url":"https://de.wikipedia.org/wiki/St._George%E2%80%99s_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/SGBIS_Shields.jpg","page_title":"St. George’s School","context_page_description":"St. George’s – The British International School ist eine staatlich anerkannte internationale Schule mit Standorten in Köln und Duisburg für Schüler von 2 bis 18 Jahren und in München für Schüler von 3 bis 18 Jahren. Sie ist das erste britische Internat auf deutschem Boden."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%8A%D8%B3_%D8%AF%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Kris_Dunn.jpg","page_title":"كريس دان","context_page_description":"كريس دان ‏ مواليد 18 مارس 1994 في نيو لندن، هو لاعب كرة سلة أمريكي. بدأ مسيرته الاحترافية في سنة 2016. تم اختياره من قبل فريق مينيسوتا تمبر ولفز خلال الدرافت. يلعب مع مينيسوتا تمبر ولفز في الرابطة الوطنية لكرة السلة كلاعب هجوم خلفي. يحمل الرقم 3. يبلغ طوله 6 قدم 4 بوصة."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%83%A7%E3%83%B3%E3%83%BBF%E3%83%BB%E3%82%B1%E3%83%8D%E3%83%87%E3%82%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Kennedy_Nixon_Debat_%281960%29.jpg","page_title":"ジョン・F・ケネディ","context_page_description":"ジョン・フィッツジェラルド・ケネディは、アメリカ合衆国の政治家。第35代アメリカ合衆国大統領。在任中の1963年11月22日にテキサス州ダラスで暗殺された。名前のイニシャルをとってJFKないし通称であるジャックと呼ばれることも多い。"},{"page_url":"https://es.wikipedia.org/wiki/Pasaje_Olaya","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Pasajeolaya.jpg","page_title":"Pasaje Olaya","context_page_description":"El Pasaje Olaya es una calle del Damero de Pizarro en el centro histórico de Lima, capital del Perú. Se extiende en una cuadra desde el Jirón Huallaga hacia el sur hasta el Jirón Ucayali."},{"page_url":"https://de.wikipedia.org/wiki/Ernst_Stuhlinger","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/VonBraunCitizenship.jpg","page_title":"Ernst Stuhlinger","context_page_description":"Ernst Stuhlinger war ein deutsch-amerikanischer Kernphysiker sowie Elektrotechnik- und Raumfahrtwissenschaftler. 1955 wurde er amerikanischer Staatsbürger."},{"page_url":"https://ca.wikipedia.org/wiki/Wallers","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Wallers_-_Fosse_Arenberg_des_mines_d%27Anzin_%28108%29.JPG","page_title":"Wallers","context_page_description":"Wallers és un municipi francès, situat a la regió dels Alts de França, al departament del Nord. L'any 2006 tenia 5.499 habitants. Limita al nord amb Hasnon, al nord-est amb Raismes, a l'est amb Hérin, al sud-est amb Bellaing i Haveluy, al sud amb Denain, i a l'oest amb Hélesmes."},{"page_url":"https://pl.wikipedia.org/wiki/Odznaka_Obywatelska","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/D%C3%A9coration_Civique_1940-1945.jpg","page_title":"Odznaka Obywatelska","context_page_description":"Odznaka Obywatelska – odznaczenie państwowe Królestwa Belgii, ustanowione w 1867 roku."},{"page_url":"https://nl.wikipedia.org/wiki/Kalanchoe_daigremontiana","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Bryophyllum_daigremontianum_nahaufnahme2.jpg","page_title":"Kalanchoe daigremontiana","context_page_description":"Kalanchoe daigremontiana en ook wel bommenwerper genoemd is een succulent die inheems is in Madagaskar en die behoort tot de vetplantenfamilie.\\nDe plant groeit rechtop en heeft vrij langgerekte, driehoekige, groene bladeren, die aan de onderkant paars gevlekt zijn. Hij kan ongeveer 1 meter hoog worden, met \\"bladeren\\" die 15–20 cm lang kunnen worden en ongeveer 3,2 cm breed. Alle delen van de plant zijn giftig, wat zelfs fataal kan zijn als kinderen of dieren hiervan eten.\\nDe plant behoort tot de zogenaamde broedplanten, wat inhoudt dat de jonge plantjes op de randen van het blad van de volwassen plant groeien en worteltjes maken. Op een zeker moment laat de plant zijn 'broed' op de aarde vallen en zo kunnen de jonge plantjes verder wortelen en uitgroeien tot volwassen planten. De planten vermeerderen op deze manier zeer snel en kunnen in korte tijd wel honderden jonge plantjes voortbrengen.\\nDe soort kan als kamerplant worden gehouden."},{"page_url":"https://en.wikipedia.org/wiki/Gianfranco_Zola","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Zola_chelsea.JPG","page_title":"Gianfranco Zola","context_page_description":"Gianfranco Zola OMRI OBE is an Italian football manager and former footballer who played predominantly as a forward. He was most recently the assistant manager of Chelsea.\\nHe spent the first decade of his playing career playing in Italy, most notably with Napoli, alongside Diego Maradona and Careca, where he was able to win the Serie A title, and at Parma, where he won the Italian Super Cup and the UEFA Cup. He later moved to English side Chelsea, where he was voted the Football Writers' Player of the Year in the 1996–97 season. During his time at the club, he won the UEFA Cup Winners' Cup, the UEFA Super Cup, two FA Cups, the League Cup, and the Community Shield. In 2003, he was voted Chelsea's greatest player ever. He was capped 35 times for Italy from his debut in 1991, appearing at the 1994 World Cup, where Italy finished in second place, and Euro 1996.\\nAfter a stint with Italy under-21s, Zola began his club managerial career with West Ham United of the Premier League in 2008 in the Premier League, before being sacked in 2010. He was manager of Watford from July 2012 until he announced his resignation on 16 December 2013."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E5%96%80%E5%88%99%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Shigatse_Railway_Station_9.jpg","page_title":"日喀则站","context_page_description":"日喀则站是西藏自治区日喀则市一座铁路车站。车站位于桑珠孜区甲措雄乡占都村，是拉日铁路的终点站。车站于2014年8月16日建成通车，现时有两班前往拉萨的图定列车Z8802次和Z8804次，另有一班Z6812次列车前往西宁。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%83%D0%B3%D1%80%D0%BE,_%D0%92%D0%B8%D0%BB%D1%8C%D1%8F%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/William-Adolphe_Bouguereau_%281825-1905%29_-_Bather_%281870%29.jpg","page_title":"Бугро, Вильям","context_page_description":"Вилья́м-Адольф Бугро́ — французский живописец, видный представитель салонного академизма XIX века.\\nЕго творчество может характеризоваться как «квинтэссенция живописи своего поколения». В каталогах учтены 828 картин Бугро, преимущественно на мифологические, аллегорические и библейские сюжеты. Исследователи причисляют его творчество к так называемому «романтическому реализму», поскольку он, следуя приёмам романтизма, предпочитал писать с натуры и воспроизводил внешность своих моделей с фотографической точностью. Несмотря на верность академическим принципам, в частности, — примату рисунка над цветом, — в 1890-е годы испытывал влияние символизма, который истолковывал как метод раскрытия сущности изображаемого человека при помощи второстепенных деталей, несущих смысловую нагрузку.\\nС 1876 года — действительный член Академии изящных искусств, профессор Высшей школы изящных искусств и Академии Жюлиана. В 1857 году удостоен почётной Медали Салона, командор ордена Почётного легиона. Пользуясь коммерческим успехом, Бугро не принял импрессионизма и новых направлений в изобразительном искусстве и последовательно противостоял им, используя административные ресурсы."},{"page_url":"https://it.wikipedia.org/wiki/Mauro_Valentini_(1973)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Soccer_San_Marino.png","page_title":"Mauro Valentini (1973)","context_page_description":"Mauro Valentini è un ex calciatore italiano naturalizzato sammarinese, di ruolo difensore."},{"page_url":"https://en.wikipedia.org/wiki/William_Ernest_Cooke","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Perth_Observatory_staff-1900.jpg","page_title":"William Ernest Cooke","context_page_description":"William Ernest Cooke, generally referred to as W. Ernest Cooke or informally Ernest Cooke, was an Australian astronomer, credited with a number of important scientific breakthroughs and improved methodologies in astronomical observations and star cataloguing. He was the first Western Australian Government Astronomer and established the Perth Observatory as one of the best equipped and productive establishments of its type in Australia.\\nCooke was born in Adelaide, the son of Ebenezer Cooke, public servant and politician from South Australia. He was educated at The Collegiate School of St Peter in Adelaide and the University of Adelaide.\\nCooke did well at school: in 1879 he was first placed in St Peter's First Class of matriculants, with passes in Greek and Chemistry. He signed the student roll at the University of Adelaide in March the same year, while he was still 15. After a glowing reference from his headmaster, he took a Civil Service cadetship under Sir Charles Todd at the Adelaide Observatory in December 1878. He was awarded a Bachelor of Arts degree in 1883 and a Master of Arts in 1889."},{"page_url":"https://da.wikipedia.org/wiki/Abilene_(Kansas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/KSMap-doton-Abilene.png","page_title":"Abilene (Kansas)","context_page_description":"Abilene er en amerikansk by og administrativt centrum for det amerikanske county Dickinson County, i staten Kansas. I 2000 havde byen et indbyggertal på 6.543."},{"page_url":"https://fr.wikipedia.org/wiki/Beskides","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Barania_G%C3%B3ra_-_observation_tower.jpg","page_title":"Beskides","context_page_description":"Les Beskides est le nom traditionnellement attribué à une succession de massifs montagneux des Carpates s'étendant du nord-est de la Tchéquie, le long de la frontière entre la Pologne et la Slovaquie jusqu'à l'ouest de l'Ukraine.\\nLe nom Beskid / Beskidy, derivé du moyen bas allemand : beshêt, beskēt, « partage », est entendu dans le sens de la limite séculaire entre les royaumes de Pologne et de Hongrie depuis le Moyen Âge."},{"page_url":"https://en.wikipedia.org/wiki/List_of_foods_named_after_places","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/NY_Strip_Steak.jpg","page_title":"List of foods named after places","context_page_description":"Lists of foods named after places have been compiled by writers, sometimes on travel websites or food-oriented websites, as well as in books.\\nSince all of these names are words derived from place names, they are all toponyms.\\nAccording to Delish.com, \\"[T]here's a rich history of naming foods after cities, towns, countries, and even the moon.\\"\\nThe following foods and drinks were named after places. Each non-obvious etymology is supported by a reference on the linked Wikipedia page. Food names are listed by country of the origin of the word, not necessarily where the food originated or was thought to have originated. Some foods are certified to originate in that region with a protected designation of origin."},{"page_url":"https://pl.wikipedia.org/wiki/Kraina_Grzyb%C3%B3w_TV","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/KGTVstudio.jpg","page_title":"Kraina Grzybów TV","context_page_description":"Kraina Grzybów TV – polskie uniwersum artystyczne wykreowane przez Wiktora Striboga, będące kanałem internetowym w serwisie YouTube. Podstawowy element Krainy Grzybów stanowi serial internetowy pod tytułem Poradnik uśmiechu. Program zdobył popularność w wielu krajach, ponadto posiada tłumaczenia w formie napisów na język m.in. angielski, niemiecki, rosyjski i włoski."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%82%D8%B1%D9%88%D9%86_%D9%88%D8%B3%D8%B7%D8%A7%DB%8C_%D9%85%D8%AA%D8%A3%D8%AE%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Map_France_1477-en.svg","page_title":"قرون وسطای متأخر","context_page_description":"سده‌های میانی پایانی یا اواخر قرون وسطی، دوره‌ای از تاریخ اروپا است که به‌طور کلی سده‌های ۱۴ و ۱۵؛، را شامل می‌شود. در این بخش‌بندیِ سه‌گانهٔ قرون وسطی؛، به منظور ارائهٔ گروه‌بندی کرانه‌دارتری از پیشامدها، شخصیت‌ها، و موقعیت‌ها به گونهٔ نمایان‌تری از دسته‌بندی سنتی و کلی «قرون وسطی» به وجود آمده‌اند. در این بخش‌بندی، گستره‌های زمانی لزوماً یکسان نیستند و یک بخش گسترهٔ زمانی بیش‌تری از بخشی دیگر دارد.\\nسده‌های میانی پایانی به دنبال سده‌های میانی میانه و پیش از شروع بخش آغازین دوران نوین و آغاز رنسانس در بسیاری از قسمت‌های اروپا، در تاریخ اروپا، قرار دارد.\\nدر اروپا با رسیدن به نزدیکی‌های سال ۱۳۰۰، رفاه و رشدی که در طول چندین سده ادامه داشت به یک‌باره متوقف شد. یک سری از فجایع گوناگون قحطی و طاعون، از جمله قحطی بزرگ ۱۳۱۵-۱۳۱۷ و مرگ سیاه، جمعیت اروپا را به حدود نیمی از آنچه که در قبل از این مصیبت‌ها بود کاهش داد. همراه با کاهش جمعیت، ناآرامی‌های اجتماعی و جنگ بومی بالا گرفت. فرانسه و انگلستان هر دو با قیام جدی دهقانان، و شورش خرده کشاورزان روبرو بودند و همچنین بیش از یک سده متناوباً جنگ صد ساله را تجربه کردند. علاوه بر این دشواری‌ها و بسیاری از مشکلات دیگر در این دوره، همبستگی کلیسای کاتولیک نیز به خاطر دو دستگی غرب در هم شکسته شد."},{"page_url":"https://sv.wikipedia.org/wiki/Landkreis_Bamberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Pommersfelden_im_Landkreis_Bamberg.png","page_title":"Landkreis Bamberg","context_page_description":"Landkreis Bamberg är ett distrikt i Bayern, Tyskland."},{"page_url":"https://en.wikipedia.org/wiki/Congea_tomentosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Starr_071024-0098_Congea_tomentosa.jpg","page_title":"Congea tomentosa","context_page_description":"Congea tomentosa is a large tropical evergreen vine, commonly referred to as wooly congea, shower orchid, or shower of orchid. It is called lluvia de orquideas or terciopelo in Spanish, krua on in Thai, and rong bao teng in Chinese. Native to Myanmar and Thailand, it can be found elsewhere in South Asia, including Laos, Vietnam, Malaysia, China, Bangladesh, and India. Its native habitat is mixed forests 600–1200 meters above sea level.\\nThis tropical vine has been naturalized elsewhere, including the islands of the Caribbean, southern Florida, and southern California. In the United States, Wooly Congea can be grown outdoors in USDA zones 10 and 11. It does not tolerate frost.\\nThe plant can grow to 3–5 meters in cultivation and even larger in its native state. The stems, leaves and bracts are covered with fine, downy hairs. The leaves are light green in color, 6-8 inches long, and quite attractive. They are evergreen with prominent veins and are arranged in opposite pairs. The actual flowers are tiny and inconspicuous, but they are borne in the center of three showy white or violet 1 inch long bracts that look like velvety propellers. Wooly Congea blooms in late winter to spring."},{"page_url":"https://sq.wikipedia.org/wiki/Lista_e_tempujve_hindu_n%C3%AB_Sri_Lanka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Temple_hindu1.jpg","page_title":"Lista e tempujve hindu në Sri Lanka","context_page_description":"Kjo është një listë e tempujve hindu në Sri Lanka sipas provincave dhe distrikteve:"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%B3%95%E5%9C%8B%E6%8E%88%E5%8B%B3%E5%8F%8A%E5%98%89%E7%8D%8E%E5%88%B6%E5%BA%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Kruis_van_een_Commandeur_in_de_Orde_Merite_Maritime.jpg","page_title":"法國授勳及嘉獎制度","context_page_description":"法国授勋与嘉奖制度列表呈列出现代法国勋章、荣誉与嘉奖的所有装饰。有些勋章可同时颁发给军人或平民，例如荣誉军团勋章；其他勋章则分为纯军用或民间性质的嘉奖。1963年法国改革授勋制度之后，19个部长级勋章仅有4个保存下来，其他则被国家功绩勋章所取代。"},{"page_url":"https://fi.wikipedia.org/wiki/Gemini_4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Gemini-Titan_4_portrait.jpg","page_title":"Gemini 4","context_page_description":"Gemini 4 oli avaruuslento, joka toteutettiin 3.–7. kesäkuuta 1965. Lento kesti yhteensä 98 tuntia. Avaruusaluksessa mukana olivat astronautit Edward White ja James McDivitt. White suoritti ensimmäisenä yhdysvaltalaisena avaruuskävelyn. Se tapahtui 160 kilometrin lentokorkeudessa ja kesti 20 minuuttia.\\nLennon aikana miehistö yritti mennä lähelle avaruuteen jäänyttä Titan-kantoraketin osaa. Yritys kuitenkin epäonnistui miehistön tekemän virheen takia."},{"page_url":"https://fr.wikipedia.org/wiki/L%C3%BC_Huihui","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/20150527_Huihui_Lu_5296.jpg","page_title":"Lü Huihui","context_page_description":"Lü Huihui est une athlète chinoise, spécialiste du lancer de javelot. Elle remporte la médaille d'argent des Mondiaux de 2015 à Pékin et le bronze aux Mondiaux de 2017 à Londres ainsi qu'aux Mondiaux de 2019 à Doha.\\nElle a également détenu le record d'Asie de la discipline avec 66,13 m, du 30 août 2015 au 21 mai 2017. Elle reprend ce record le 6 août suivant avec 67,59 m, qu'elle améliore en 2019 à 67,72 m, 67,83 m puis 67,98 m."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B4_%D0%97%D0%B0%D1%98%D0%B5%D1%87%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Zajeacr_22.jpg","page_title":"Град Зајечар","context_page_description":"Град Зајечар је град у источној Србији на граници са Бугарском. Налази се у централном делу Тимочке Крајине, у Зајечарском округу у који још спадају општине Сокобања, Књажевац и Бољевац. Средиште је градско насеље Зајечар који представља административни, културни, привредни, економски, политички и верски центар како општине тако и самог округа.\\nГрад Зајечар обухвата површину од 1.068 km². Територију пресецају Црни и Бели Тимок који спајањем чине Велики Тимок који протиче и кроз град Зајечар. На територији града постоје три вештачка акумулациона језера: Грлишко, Рготско и Совинац. Недалеко од Зајечара налази се бањско лечилиште Гамзиградска Бања са уређеним термоминералним изворима, а недалеко од њега се налази значајан археолошки локалитет Гамзиград."},{"page_url":"https://de.wikipedia.org/wiki/Speyer_Hauptbahnhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Speyerhbf1911_%28restored%29.jpg","page_title":"Speyer Hauptbahnhof","context_page_description":"Speyer Hauptbahnhof ist der wichtigere von insgesamt zwei Bahnhöfen der rheinland-pfälzischen Mittelstadt Speyer. Er gehört der Bahnhofskategorie 4 an und verfügt über drei Bahnsteiggleise. Der Bahnhof liegt im Verbundgebiet des Verkehrsverbundes Rhein-Neckar und gehört zur Tarifzone 143. Die Anschrift des Bahnhofs lautet Bahnhofstraße 43.\\nEr wurde am 11. Juni 1847 als Endbahnhof der in Schifferstadt von der Pfälzischen Ludwigsbahn abzweigenden Stichstrecke eröffnet. Mit deren Verlängerung bis nach Germersheim 1864 wurde er zum Durchgangsbahnhof. Die Eröffnung der Verbindung nach Heidelberg fand 1873 statt und drei Jahre später die Durchbindung der Nord-Süd-Strecke bis nach Wörth. Seit der Unterbrechung der Strecke nach Heidelberg im Jahr 1945 ist er erneut nur Durchgangsbahnhof. Seit 2003 ist er zudem in das Netz der S-Bahn RheinNeckar integriert."},{"page_url":"https://de.wikipedia.org/wiki/P%C3%A9ry-La_Heutte","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/2018-Pery-Kath-Kirche.jpg","page_title":"Péry-La Heutte","context_page_description":"Péry-La Heutte ist eine auf den 1. Januar 2015 entstandene Fusionsgemeinde im Kanton Bern, Schweiz. Die im Verwaltungskreis Berner Jura gelegene neue Gemeinde besteht aus den ehemals selbständigen Gemeinden La Heutte und Péry."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B0%D0%BD%D0%BA%D1%83%D0%B2%D0%B5%D1%80_(%D0%BE%D1%81%D1%82%D1%80%D1%96%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Wfm_vancouver_island.jpg","page_title":"Ванкувер (острів)","context_page_description":"Острів Ванкувер — острів на західному узбережжі канадської провінції Британська Колумбія. Названий на честь британського дослідника Джорджа Ванкувера.\\nПлоща острову — приблизно 32 134 км², довжина — 460 км, ширина — 80 км. Населення станом на 2004 рік — 734 860 жителів. За кількістю населення це другий канадський острів."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D1%86%D1%96%D0%B9_%D0%90%D0%BD%D0%BD%D0%B5%D0%B9_%D0%A1%D0%B5%D0%BD%D0%B5%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Duble_herma_of_Socrates_and_Seneca_Antikensammlung_Berlin_07.jpg","page_title":"Луцій Анней Сенека","context_page_description":"Сене́ка Анне́й Лу́цій — давньоримський філософ, поет, державний діяч і оратор, консул-суффект 55 року. Син філософа Сенеки Старшого. Дядько поета Лукана."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B8%D1%81%D0%B0%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/DC_-_Foto_Serra_No_142_-_Vista_a%C3%A9rea_parcial_e_Ilh%C3%A9u_do_Rei_-_Bissau.jpg","page_title":"Бисау","context_page_description":"Биса́у — столица Республики Гвинеи-Бисау, административный центр автономного сектора Бисау. Население — 492 004 жителей."},{"page_url":"https://fi.wikipedia.org/wiki/Halikon_terveysasema","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Halikon_terveysasema.JPG","page_title":"Halikon terveysasema","context_page_description":"Halikon terveysasema on Salon Halikon pitäjässä toimiva kaupungin terveysasema.\\nTyypillisesti keskikesällä tämä terveysasema on kiinni, jolloin terveyspalveluja tarjotaan esimerkiksi Salon läntisellä terveysasemalla tai Salon pääterveysasemalla."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_d%27Indre-et-Loire_(A-J)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/L%27%C3%8Ele-Bouchard_-_%C3%89glise_Saint-Gilles_-_1.jpg","page_title":"Liste des monuments historiques d'Indre-et-Loire (A-J)","context_page_description":"Cet article recense une partie des monuments historiques d'Indre-et-Loire, en France.\\nPour des raisons de taille, la liste est découpée en deux. Cette partie regroupe les communes débutant de A à J. Pour les autres, voir la liste des monuments historiques d'Indre-et-Loire."},{"page_url":"https://en.wikipedia.org/wiki/List_of_diplomatic_visits_to_the_United_States:_Africa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/President_Barack_Obama_and_First_Lady_Michelle_Obama_greet_His_Excellency_Salva_Kiir_Mayardit%2C_President_of_the_Republic_of_South_Sudan.jpg","page_title":"List of diplomatic visits to the United States: Africa","context_page_description":"International trips made by the heads of state and heads of government to the United States have become a valuable part of American diplomacy and international relations since such trips were first made in the mid-19th century. They are complicated undertakings that often require months of planning along with a great deal of coordination and communication.\\nThe first international visit to the United States was made by King Kalakaua of Hawaii in 1874, which was the first visit by a foreign chief of state or head of government.\\nThe first African head of state to visit the United States was President Edwin Barclay of Liberia in 1943."},{"page_url":"https://it.wikipedia.org/wiki/Robert_Gascoyne-Cecil,_V_marchese_di_Salisbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Robert_Gascoyne-Cecil_1927.jpg","page_title":"Robert Gascoyne-Cecil, V marchese di Salisbury","context_page_description":"Robert Arthur James Gascoyne-Cecil, V marchese di Salisbury è stato un nobile e politico inglese."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_Ghidfal%C4%83u,_Covasna","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Biserica_reformata_din_Ghidfalau.jpg","page_title":"Comuna Ghidfalău, Covasna","context_page_description":"Ghidfalău este o comună în județul Covasna, Transilvania, România, formată din satele Angheluș, Fotoș, Ghidfalău și Zoltan."},{"page_url":"https://de.wikipedia.org/wiki/Rika_Unger","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Portrait_Unger.jpg","page_title":"Rika Unger","context_page_description":"Rika Unger war eine deutsche Bildhauerin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BC%D0%B1%D0%B8-%D0%BC%D0%BE%D0%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Zombie_Walk_POA_2007.jpg","page_title":"Зомби-моб","context_page_description":"«Зомби-моб» — название многочисленных мероприятий, организованных поклонниками зомби-культуры; участники данных мероприятий одеваются и гримируются, чтобы максимально реалистично походить на живых мертвецов.\\nОни обычно встречаются в центре города и стараются пройти как можно больше общественных мест и центральных улиц. Зомби-мобы могут преследовать различные цели, их могут организовать просто ради веселья или ради установки мирового рекорда. Иногда зомби-мобы помогают благотворительным организациям в сборе денег."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D1%80%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Map_of_comune_of_Grone_%28province_of_Bergamo%2C_region_Lombardy%2C_Italy%29.svg","page_title":"Гроне","context_page_description":"Гро̀не е село и община в Северна Италия, провинция Бергамо, регион Ломбардия. Разположено е на 388 m надморска височина. Населението на общината е 898 души."},{"page_url":"https://de.wikipedia.org/wiki/Synagoge_(Lechenich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Lechenich-Judenstra%C3%9Fe-Infotafel.JPG","page_title":"Synagoge (Lechenich)","context_page_description":"Die Synagoge in Lechenich, einem Stadtteil von Erftstadt im Rhein-Erft-Kreis, wurde 1886 erbaut und befand sich in der Judenstraße 8. Sie wurde während des Novemberpogroms 1938 zerstört."},{"page_url":"https://en.wikipedia.org/wiki/Imperial_lemon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Imperial_lemon_at_Kew_Gardens.jpg","page_title":"Imperial lemon","context_page_description":"The Imperial lemon is thought to be a lemon and grapefruit hybrid. Its fruit is slightly larger than a lemon and has a more rounded shape."},{"page_url":"https://fi.wikipedia.org/wiki/Turku","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Eduskuntavaalit_2015_tulokset_Turussa.png","page_title":"Turku","context_page_description":"Turku on Suomen kaupunki ja Varsinais-Suomen maakunnan keskus, joka sijaitsee Aurajoen suulla Saaristomeren rannikolla. Kaupungin asukasluku on 2019 elokuussa 192 674 ja Turun seutukunnan 330 482. Tämä tekee Turusta asukasluvultaan Suomen kuudenneksi suurimman kunnan ja kolmanneksi suurimman kaupunkialueen.\\nTurun arvioidaan syntyneen 1200-luvulla, ja se on siten Suomen vanhin kaupunki. Kaupungin perustamisvuotena mainitaan usein vuosi 1229. Turku oli pitkään Suomen merkittävin asutuskeskus, maan epävirallinen pääkaupunki vuosina 1809–1812 ja 1840-luvulle saakka Suomen suurin kaupunki. Turku on yhä alueensa paikallishallinnollinen, taloudellinen ja kulttuurinen keskus. Kaupunki on Lounais-Suomen aluehallintoviraston päätoimipaikka ja Varsinais-Suomen maakuntakeskus. Useat valtion virastot siirrettiin 1810-luvun alkupuolella Turusta virallisen pääkaupungin muodostamisen yhteydessä Helsinkiin, mutta Suomen arkkipiispanistuin jäi Turkuun jossa se yhä sijaitsee. Yliopisto siirrettiin Helsinkiin Turun palon jälkeen vuonna 1827.\\nTurku on tunnettu etenkin kulttuurikaupunkina."},{"page_url":"https://en.wikipedia.org/wiki/Beaulieu,_Hampshire","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Sunbeam_1000HP.jpg","page_title":"Beaulieu, Hampshire","context_page_description":"Beaulieu is a small village located on the southeastern edge of the New Forest national park in Hampshire, England, and home to both Palace House and the British National Motor Museum."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_fortificat%C4%83_din_Reghin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Biserica_evanghelica_din_Reghin_%2837%29.jpg","page_title":"Biserica fortificată din Reghin","context_page_description":"Biserica evanghelică din Reghin este un ansamblu de monumente istorice aflat pe teritoriul municipiului Reghin.\\nAnsamblul este format din două monumente:\\nBiserica evanghelică\\nCasa parohială"},{"page_url":"https://pt.wikipedia.org/wiki/Zamiaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Encephalartos_altensteinii_002.jpg","page_title":"Zamiaceae","context_page_description":"Zamiaceae é uma família de cicas que, juntamente com Cycadaceae e Stangeriaceae, pertence à Ordem Cycadales dentro da Divisão Cycadophyta. As cicadófitas originaram-se há 290 milhões de anos e correspondem a uma linhagem dentro do grande grupo das Acrogimnospermas."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CF%85%CF%83%CF%84%CF%81%CE%B9%CE%B1%CE%BA%CE%AD%CF%82_%CE%88%CE%BD%CE%BF%CF%80%CE%BB%CE%B5%CF%82_%CE%94%CF%85%CE%BD%CE%AC%CE%BC%CE%B5%CE%B9%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Austrian_Leopard_2A4_tanks%2C_Strong_Resolve_2002.JPEG","page_title":"Αυστριακές Ένοπλες Δυνάμεις","context_page_description":"Οι Αυστριακές Ένοπλες Δυνάμεις αποτελούνται από τις δυνάμεις του Στρατού Ξηράς και της Πολεμικής Αεροπορίας της Αυστρίας. Η Αυστρία ως χώρα που δεν έχει πρόσβαση στη θάλασσα, δεν διαθέτει ναυτικές δυνάμεις."},{"page_url":"https://fr.wikipedia.org/wiki/Peter_Kaumba","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Kaumba_in_2012.jpg","page_title":"Peter Kaumba","context_page_description":"Peter Kaumba est un ancien footballeur zambien reconverti entraîneur."},{"page_url":"https://sv.wikipedia.org/wiki/Al-Fatih-mosk%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Al_Fateh_Grand_Mosque_-_Bahrain.jpg","page_title":"Al-Fatih-moskén","context_page_description":"Al-Fatih-moskén i Manama, Bahrain, är en av de största moskéerna i världen, med kapacitet för över 7 000 tillbedjare åt gången. Moskén är den största helgade platsen i Bahrain. Moskén ligger väldigt nära det Kungliga Bahrainska Palatset, kung Hamad ibn Isa al-Khalifahs residens. Den gigantiska kupolen på moskéns topp är gjord av rent glasfiber. Med en vikt på över 60 ton är kupolen för närvarande världens största kupol av glasfiber."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B5%86%E0%B4%B8%E0%B5%8D%E0%B4%B8%E0%B4%BF%E0%B4%AF%E0%B5%BC_%E0%B4%B5%E0%B4%B8%E0%B5%8D%E0%B4%A4%E0%B5%81%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B4%B3%E0%B5%81%E0%B4%9F%E0%B5%86_%E0%B4%AA%E0%B4%9F%E0%B5%8D%E0%B4%9F%E0%B4%BF%E0%B4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Messier_13_Hubble_WikiSky.jpg","page_title":"മെസ്സിയർ വസ്തുക്കളുടെ പട്ടിക","context_page_description":"ഫ്രഞ്ചുകാരനായ വാൽനക്ഷത്ര നിരീക്ഷകൻ ചാൾസ് മെസ്സിയർ നിരീക്ഷണപഠനങ്ങളിലൂടെ പട്ടികയിലാക്കിയ ഖഗോളവസ്തുക്കളാണു മെസ്സിയർ വസ്തു എന്നറിയപ്പെടുന്നത്. വാൽ നക്ഷത്രങ്ങളെ തിരയുന്നതിനിടെ വാൽനക്ഷത്രത്തോട് സാദൃശ്യമുള്ളതായ കുറേ ഖഗോള വസ്തുക്കൾ, മെസ്സിയറിനെ വല്ലാതെ ബുദ്ധിമുട്ടിലാക്കി. ഇങ്ങനെയുള്ള ഖഗോളവസ്തുക്കളെ വാൽനക്ഷത്രങ്ങളായി തെറ്റിദ്ധരിക്കാതിരിക്കാൻ, മെസ്സിയർ ഇവയ്ക്കെല്ലാം ഓരോ സംഖ്യ കൊടുത്ത് പട്ടികയിലാക്കി. ഈ വസ്തുക്കളാണു് പിന്നീടു് മെസ്സിയർ വസ്തു എന്നറിയപ്പെട്ടത്. മെസ്സിയർ വസ്തുക്കൾ എല്ലാം തന്നെ ഗാലക്സികളോ, നെബുലകളോ, ഓപ്പൺ ക്ലസ്റ്ററുകളോ, ഗ്ലോബുലാർ ക്ലസ്റ്ററുകളോ ആണെന്നു് പിന്നീടു് തെളിയിക്കപ്പെട്ടു.\\nM1, M2, ...എന്നിങ്ങനെയാണ് മെസ്സിയർ ഇവയെ നാമകരണം ചെയ്തത്. ഉദാഹരണത്തിന് ആൻഡ്രോമിഡ ഗാലക്സിയുടെ ഈ കാറ്റലോഗ് പ്രകാരം ഉള്ള പേര് ‍M31 എന്നാണ്. ആകെ 110 ഖഗോള വസ്തുക്കളാണ് ഈ കാറ്റലോഗിൽ ഉള്ളത്. 1781-ൽ ആണ് ഈ കാറ്റലോഗ് പുറത്തിറങ്ങിയത്. മെസ്സിയർ ജീവിച്ചത് ഫ്രാൻസിലായത് കൊണ്ട് ദക്ഷിണാർദ്ധഗോളത്തിലെ പല പ്രധാന ഖഗോളവസ്തുക്കളേയും ഈ കാറ്റലോഗിൽ ഉൾപ്പെടുത്തിയിട്ടില്ല."},{"page_url":"https://fr.wikipedia.org/wiki/Briollay","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Briollay_-_Ancienne_salle_seigneuriale_-_Fa%C3%A7ade_et_toiture.jpg","page_title":"Briollay","context_page_description":"Briollay est une commune française située dans le département de Maine-et-Loire, en région Pays de la Loire.\\nBriollay se trouve au cœur de l'Anjou, au nord d'Angers. Son territoire, situé dans les basses vallées angevines, est essentiellement rural.\\nProche d'Angers, la capitale de l'Anjou, sa situation en fit un point de passage obligé. Très vite un éperon fut édifié entre les rivières de la Sarthe et du Loir.\\nSa proximité avec la métropole angevine l'a fait naturellement adhérer à Angers Loire Métropole."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AD%A6%E6%B1%89%E5%9C%B0%E9%93%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/%E6%AD%A6%E6%B1%89%E5%B8%82%E8%BD%A8%E9%81%93%E4%BA%A4%E9%80%9A%E4%B8%80%E3%80%81%E4%BA%8C%E3%80%81%E4%B8%89%E6%9C%9F%E5%BB%BA%E8%AE%BE%E8%A7%84%E5%88%92%E7%BA%BF%E7%BD%91%E5%9B%BE.jpg","page_title":"武汉地铁","context_page_description":"武汉地铁，又称武汉轨道交通，是中华人民共和国湖北省武汉市的城市轨道交通系统。其第一条线路——武汉轨道交通1号线一期工程，于2004年7月28日开通运营，这使得武汉成为中国大陆继北京，天津，上海，广州、长春、大连之后第七座开通城市轨道交通系统的城市。\\n武汉轨道交通现已有9条线路、共228座车站投入运营，运营里程339公里，已覆盖11个市辖区，以运营里程计算武汉地铁目前是中国第五大城市轨道交通系统。武汉地铁为缓解城市交通拥堵、武汉市民过江等难题提供了有效的解决方案。武汉轨道交通日均客运量360万乘次，2019年4月4日最高日客运量达445.62万乘次，居中国大陆第六。"},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%AA%E0%B8%B3%E0%B8%99%E0%B8%B1%E0%B8%81%E0%B8%87%E0%B8%B2%E0%B8%99%E0%B8%95%E0%B8%A3%E0%B8%A7%E0%B8%88%E0%B8%84%E0%B8%99%E0%B9%80%E0%B8%82%E0%B9%89%E0%B8%B2%E0%B9%80%E0%B8%A1%E0%B8%B7%E0%B8%AD%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Royal_Thai_Police-Immigration_Police_BMW_330e.jpg","page_title":"สำนักงานตรวจคนเข้าเมือง","context_page_description":"สำนักงานตรวจคนเข้าเมือง เป็นหน่วยงานในสังกัดของสำนักงานตำรวจแห่งชาติ มีหน้าที่ตรวจบุคคลและพาหนะที่เดินทางเข้าออกมายังภายในประเทศ พร้อมทั้งตรวจสอบคนต่างด้าวที่อาจเข้าเมืองมาอย่างผิดกฎหมาย โดยสำนักงานตรวจคนเข้าเมือง ก่อตั้งขึ้นเมื่อวันที่ 17 กรกฎาคม พ.ศ. 2470 ในสมัยของพระบาทสมเด็จพระปรมินทรมหาประชาธิปก พระปกเกล้าเจ้าอยู่หัว ซึ่งได้มีการตราพระราชบัญญัติคนเข้าเมือง พ.ศ. 2470 ขึ้นพร้อมกับหน่วยงาน คือ กรมตรวจคนเข้าเมือง ผู้บัญชาการสำนักงานตรวจคนเข้าเมืองคนปัจจุบัน คือ พลตำรวจโท สมพงษ์ ชิงดวง"},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B5%E0%A4%BF%E0%A4%95%E0%A4%BF%E0%A4%AE%E0%A5%80%E0%A4%A1%E0%A4%BF%E0%A4%AF%E0%A4%BE_%E0%A4%95%E0%A5%89%E0%A4%AE%E0%A4%A8%E0%A5%8D%E0%A4%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Commons_screenshot.png","page_title":"विकिमीडिया कॉमन्स","context_page_description":"विकिमीडिया कॉमन्स मुक्त प्रयोग चित्रों, ध्वनि और अन्य मीडिया फ़ाइलों का एक ऑनलाइन भंडार है। यह विकिमिडिया फाउंडेशन की एक परियोजना है। विकिमीडिया कॉमन्स पे अपलोड की गई फ़ाइलें सभी विकिमीडिया परियोजनाओं जैसे विकिपीडिया, विकिसोर्स, विकिन्यूज़, विकिवर्सिटी, आदि के विभिन्न भाषा रुपों में इस्तेमाल की जा सकती हैं। यह फ़ाइलें ऑफ़लाइन प्रयोग के लिए भी डाउनलोड की जा सकती हैं। वर्तमान समय में कॉमन्स पर 1.2 करोड़ से भी अधिक मीडिया फ़ाइलें उपलब्ध हैं।"},{"page_url":"https://sv.wikipedia.org/wiki/Bedotia_madagascariensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Bedotia_madagascariensis.png","page_title":"Bedotia madagascariensis","context_page_description":"Bedotia madagascariensis är en fiskart som beskrevs av Regan, 1903. Bedotia madagascariensis ingår i släktet Bedotia och familjen Bedotiidae. IUCN kategoriserar arten globalt som nära hotad. Inga underarter finns listade."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1936","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Charles_Dutoit_%281984%29_by_Erling_Mandelmann.jpg","page_title":"Lijst van personen geboren in 1936","context_page_description":"Dit is een lijst van personen die geboren zijn in 1936.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://es.wikipedia.org/wiki/Patricio_Lorente","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Lorente-libro-2020-unlp.jpg","page_title":"Patricio Lorente","context_page_description":"Patricio Lorente ​​ es un académico y dirigente universitario argentino. Desde 2018, se desempeña como Secretario General de la Universidad Nacional de La Plata. Entre 2015 y 2016, fue presidente del consejo de administración de Wikimedia Foundation, la entidad rectora de Wikipedia y otros proyectos asociados."},{"page_url":"https://en.wikipedia.org/wiki/Wharton_Esherick_Studio","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Wharton_Esherick_House_%26_Studio%2C_1520_Horsehoe_Trail%2C_Malvern_%28Chester_County%2C_Pennsylvania%29.jpg","page_title":"Wharton Esherick Studio","context_page_description":"Wharton Esherick Studio, now housing the Wharton Esherick Museum, was the studio of the craftsman-artist Wharton Esherick, in Malvern, Pennsylvania. The Studio was built between 1926 and 1966, reflecting Esherick's evolving sculptural style—from Arts and Crafts, through German Expressionism, ending with the free form Modernist curves that marked his later work.\\nThere are five structures on the site: his home and studio, the 1956 workshop designed with Louis Kahn, the 1928 German Expressionist log garage which now serves as the museum visitor center, his woodshed, and the recently reconstructed German Expressionist outhouse.\\nThe buildings, from their structural forms down to the door handles and light pulls, were designed and built by Wharton Esherick to create a complete artistic environment. The Studio is filled with more than 300 of Wharton Esherick's works, including sculpture, furniture and furnishings, paintings and prints.\\nThe Wharton Esherick Museum was incorporated as a non-profit corporation in 1971, and opened for visitors in 1972. The Museum is open for tours, with advance reservations, Saturdays from 10 a.m. to 5 p.m. and Sundays from 1 p.m. to 5 p.m."},{"page_url":"https://de.wikipedia.org/wiki/Cucurbins%C3%A4ure","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/RedJasmons%C3%A4ure.png","page_title":"Cucurbinsäure","context_page_description":"Cucurbinsäure ist ein Naturstoff, der zu den Jasmonaten gehört."},{"page_url":"https://es.wikipedia.org/wiki/Jalcomulco","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Bridge_over_Rio_de_los_Pescados_%28R%C3%ADo_Antigua%29%2C_Jalcomulco.jpg","page_title":"Jalcomulco","context_page_description":"El municipio de Jalcomulco se encuentra ubicado en la zona central del estado de Veracruz, México, en la región llamada Capital, es uno de los 212 municipios de la entidad. Se localiza a 29 km, de Xalapa, la capital del Estado y a 359 km, de la Ciudad de México; se localiza en las coordenadas 19°20′N 96°46′O, y cuenta con una altitud de 340 msnm.​\\nEste municipio fue fundado en 1825, lo conforman tres localidades en las cuales habitan 4,940 personas, según el Censo de Población y Vivienda 2010 del INEGI.\\nLa cabecera municipal, del mismo nombre, se asienta en la margen izquierda del río de los Pescados, o río de La Antigua mismo que atraviesa al municipio en dirección oeste a este.\\nSus comunidades más importantes, de acuerdo a su número de habitantes son: Jalcomulco con 2,955, Santa María Tatetla con 1,777 y Tacotalpan con 167.\\nSus límites geográficos son:\\nNorte:Coatepec y Emiliano Zapata.\\nSur:Tlaltetela.\\nEste:Apazapan.\\nOeste:Tlaltetela y Coatepec."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%BE%D1%81%D0%BE%D0%BA%D0%B0%D0%B2%D0%B0_%D0%A1%D1%83%D0%BC%D1%96%D0%BC%D0%BE%D1%82%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Hosokawa_Sumimoto.jpg","page_title":"Хосокава Сумімото","context_page_description":"Хосокава Сумімото — японський військовий та державний діяч, даймьо середини періоду Муроматі."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Franklin_D._Roosevelt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/M%C3%A9tro_Paris_station_FranklinDRoosevelt_am%C3%A9nagement2011.jpg","page_title":"Estação Franklin D. Roosevelt","context_page_description":"Franklin D. Roosevelt é uma estação das linhas 1 e 9 do Metrô de Paris, localizada no 8.º arrondissement de Paris."},{"page_url":"https://sk.wikipedia.org/wiki/SYMA_Rendezv%C3%A9ny_%C3%A9s_Kongresszusi_K%C3%B6zpont","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Hall_A_2013_World_Fencing_Championships_n3.jpg","page_title":"SYMA Rendezvény és Kongresszusi Központ","context_page_description":"SYMA Rendezvény és Kongresszusi Központ je výstavný a kongresový komplex v maďarskom hlavnom meste Budapešť. Ide o jedno z najmodernejších centier v Maďarsku, v ktorom sa konajú významné športové, výstavné a kultúrne podujatia. Komplex bol otvorený v roku 2000 na mieste pôvodnej budapeštianskej športovej haly, ktorá vyhorela v roku 1999 a aktuálne pozostáva z troch samostatných multifunkčných hál s celkovou plochou 29 000 m².\\nV januári 2014 sa tu konali Majstrovstvá Európy v krasokorčuľovaní 2014, vo februári 2014 tu budú prebiehať tenisové súťaže 1. skupiny Fed Cupu."},{"page_url":"https://pl.wikipedia.org/wiki/Darna","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Derna_Coast.jpg","page_title":"Darna","context_page_description":"Darna – miasto w Libii, nad Morzem Śródziemnym. Liczba mieszkańców w 2003 roku wynosiła ok. 126 tys. Stolica gminy Darna.\\nW potocznej polszczyźnie utrwaliła się nazwa Derna, zapewne pod wpływem dialektalnej wymowy zasłyszanej w kontaktach z miejscową ludnością i angielskiej nazwy miasta."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%86%DB%8C_%D8%A8%D8%AA%D8%A7%D9%86%DA%A9%D9%88%D8%B1%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Danny_Betancourt_on_March_9%2C_2013.jpg","page_title":"دنی بتانکورت","context_page_description":"دنی بتانکورت بازیکن بیسبال اهل کوبا است.\\nوی در مسابقات کشوری و بین‌المللی در مجموع برندهٔ ۲ مدال طلا شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Ectopic_ureter","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Ectopic_Ureter_Positions.jpg","page_title":"Ectopic ureter","context_page_description":"Ectopic ureter is a medical condition where the ureter, rather than terminating at the urinary bladder, terminates at a different site. In males this site is usually the urethra, in females this is usually the urethra or vagina. It can be associated with renal dysplasia, frequent urinary tract infections, and urinary incontinence. Ectopic ureters are found in 1 of every 2000–4000 patients, and can be difficult to diagnose, but are most often seen on CT scans.\\nEctopic ureter is commonly a result of a duplicated renal collecting system, a duplex kidney with 2 ureters. In this case, usually one ureter drains correctly to the bladder, with the duplicated ureter presenting as ectopic."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AA%A8%EC%8A%A4%EB%B2%84%EA%B7%B8_500","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/PEO_Mossberg_590A1.jpg","page_title":"모스버그 500","context_page_description":"모스버그 500은 O.F. Mossberg & Sons가 제조한 펌프 액션 산탄총 시리즈이다. 500 시리즈의 모델 번호로는 500, 505, 510, 535, 590가 포함된다."},{"page_url":"https://it.wikipedia.org/wiki/Museo_Sorolla","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Museo_Sorolla_-_Sala_3_muro_oeste.jpg","page_title":"Museo Sorolla","context_page_description":"Il Museo Sorolla è un museo spagnolo statale sito a Madrid in una palazzina del Paseo del General Martínez Campos, sistemazione che servì da studio e abitazione a Joaquín Sorolla insieme alla moglie e ai loro tre figli."},{"page_url":"https://es.wikipedia.org/wiki/Euphaedra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Euphaedra_%28Xypetana%29_xypete_MHNT_ventre.jpg","page_title":"Euphaedra","context_page_description":"Euphaedra es un género de Lepidoptera de la familia Nymphalidae, subfamilia Limenitidinae, tribu Adoliadini, cuenta con 8 subgéneros, 215 especies y 150 subespecies reconocidas científicamente.​"},{"page_url":"https://pl.wikipedia.org/wiki/Nouainville","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Eglise_Nouainville.jpg","page_title":"Nouainville","context_page_description":"Nouainville – miejscowość i gmina we Francji, w regionie Normandia, w departamencie Manche.\\nWedług danych na rok 1990 gminę zamieszkiwało 335 osób, a gęstość zaludnienia wynosiła 88 osób/km²."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_T%C5%99eb%C3%AD%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Blatnice_-_socha_sv._Jana_Nepomuck%C3%A9ho.jpg","page_title":"Seznam kulturních památek v okrese Třebíč","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Třebíč vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Budišově\\nSeznam kulturních památek v Budkově\\nSeznam kulturních památek v Dalešicích\\nSeznam kulturních památek v Dešově\\nSeznam kulturních památek v Dukovanech\\nSeznam kulturních památek v Hrotovicích\\nSeznam kulturních památek v Chlumu\\nSeznam kulturních památek v Jaroměřicích nad Rokytnou včetně částí obce Boňov, Popovice, Příložany a Ratibořice\\nSeznam kulturních památek v Jemnici včetně částí obce Louka a Panenská\\nSeznam kulturních památek v Kdousově\\nSeznam kulturních památek v Krhově\\nSeznam kulturních památek v Mohelně\\nSeznam kulturních památek v Moravských Budějovicích včetně částí obce Lažínky a Vesce"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%A7%DB%8C%D8%B1%D8%8C_%D9%86%D9%88%D8%A7%D8%AF%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/2015-04-29_18_29_47_Old_truck_and_buildings_in_Dyer%2C_Nevada.jpg","page_title":"دایر، نوادا","context_page_description":"دایر، نوادا یک سکونتگاه مسکونی در ایالات متحده آمریکا است که در شهرستان اسمرالدا، نوادا واقع شده‌است."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%94%B0%EC%98%A4%EA%B8%B0%EB%AC%BC%EB%96%BC%EC%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Ibisbill.jpg","page_title":"따오기물떼새","context_page_description":"따오기물떼새는 도요목에 속하는 새의 일종이다. 따오기물떼새과과 따오기물떼새속의 유일종이다."},{"page_url":"https://de.wikipedia.org/wiki/Bell_XP-77","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Bell_XP-77_SDASM.jpg","page_title":"Bell XP-77","context_page_description":"Die Bell XP-77 war ein Prototyp eines leichten Jagdbombers"},{"page_url":"https://en.wikipedia.org/wiki/Coca_Carola","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/BB25.CocaCarola.jpg","page_title":"Coca Carola","context_page_description":"Coca Carola was a Swedish Punk band formed in Åkersberga in 1986. Signed to the record label Beat Butchers, they were well known to the Swedish punk scene together with bands such as Asta Kask and Köttgrottorna. After more than 17 years together and seven albums, the band called it quits in 2004. The band has occasionally reunited since then, e.g. for the Peace & Love music festival in Borlänge, Sweden, in 2012.\\nAmong other themes, the band made songs supporting sports club Djurgårdens IF.\\nLast line-up:\\nCurre Sandgren - guitar & vocals\\nJonas Winberg - guitar & backing vocals\\nJonas Mellberg - bass & backing vocals\\nMårten Tolander - drums"},{"page_url":"https://eu.wikipedia.org/wiki/Fuch%C5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Tokyo_Racecourse_Fuji_view_stand_20070422.jpg","page_title":"Fuchū","context_page_description":"Fuchū\\nTokio prefeturako erdialdean dagoen hiria da. 2010eko erroldaren arabera 29'34 km²-tan 255.394 biztanle zeuden."},{"page_url":"https://af.wikipedia.org/wiki/Vertebrale_subluksasie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Kiropraktisk_ledd-korreksjon_av_rygg.jpg","page_title":"Vertebrale subluksasie","context_page_description":"In chiropraktyk is 'n vertebrale subluksasie 'n beweerde wanbelyning van die werwelkolom, wat nie noodwendig op X-strale sigbaar is nie. Dit het geen biomediese basis nie, het nie kliniese betekenis nie, en word geklassifiseer as pseudowetenskaplik.\\nDie gebruik van die woord 'subluksasie' moet nie verwar word met die term se presiese anatomiese gebruik in wetenskaplike medisyne nie, wat slegs die anatomiese verwantskappe in ag neem. In medisyne is 'n subluxasie 'n onvolledige of gedeeltelike ontwrigting van 'n gewrig of orgaan.\\nSomige chiropraktisyns volg steeds die vitalistiese tradisie van Palmer, en beweer dat subluxasie aansienlike gevolge vir die gesondheid het, terwyl ander dit as 'n historiese konsep beskou en nie die oorsaak van die siekte is nie.\\nVolgens die Wêreldgesondheidsorganisasie is 'n subluxasie 'n \\"beduidende strukturele verplasing\\" en is dit dus altyd sigbaar op statiese beeldvormingstudies, soos X-strale. Dit staan ​​in direkte kontras met die geloof in vertebrale subluxasie soos gevestig in chiropraktyk, 'n pseudowetenskaplike veld van alternatiewe behandeling buite wetenskaplike hoofstroomgeneeskunde, waarvan die praktisyns nie mediese dokters is nie."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D0%B8%D0%B1%D0%BD%D0%B8%D1%87%D0%BA%D0%B8_%D0%BA%D1%80%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/%D0%A1%D0%B8%D0%B1%D0%BD%D0%B8%D1%87%D0%BA%D0%B0_%D0%BF%D0%B5%D1%9B%D0%B8%D0%BD%D0%B0.jpg","page_title":"Сибнички крас","context_page_description":"Сибнички крас представља ретки део Гледићких планина који је изграђен претежно од кречњака мезозојске старости тако да су настали крашки облици рељефа пећине и јаме. У Сибничком красу се налази Сибничка пећина или Велика Тамница, пећина Мала Тамница, Мала пећина и Сибничка јама."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%AB%D5%AC%D5%B5%D5%A1%D6%80%D5%B4%D5%A5%D5%B6%D5%BF%D5%A5%D6%80%D5%B8_%D5%A4%D5%A5_%D4%B7%D5%BD%D5%A3%D5%A5%D5%BE%D5%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/VillarmenteroDeEsgueva20110906110227P1120919.jpg","page_title":"Վիլյարմենտերո դե Էսգեվա","context_page_description":"Վիլյարմենտերո դե Էսգեվա, մունիցիպալիտետ Իսպանիայում։ Գտնվում է Վալիադոլիդ պրովինցիայի Կաստիլիա և Լեոն ինքնավար համայնքի կազմում։ Մունիցիպալիտետը գտնվում է Պարամոս դել Էսգեվա շրջանում։ Տարածքը զբաղեցնում է 13,47 կմ2 ։ Բնակչությունը՝103 մարդ ։ Գտնվում է պրովինցիայի վարչական կենտրոնից 30 կմ հեռավորության վրա։"},{"page_url":"https://en.wikipedia.org/wiki/Typhoon_Shanshan_(2006)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Shanshan_2006-09-17_0425Z.jpg","page_title":"Typhoon Shanshan (2006)","context_page_description":"Typhoon Shanshan, known in the Philippines as Typhoon Luis, was a strong typhoon that affected parts of East Asia in late September 2006. The 13th named storm of the 2006 Pacific typhoon season, Typhoon Shanshan was also the seventh typhoon of the year operationally recognised by the Japan Meteorological Agency. In post-operational analysis Shanshan became the eighth typhoon of the year when Typhoon Maria was added to the list. The Joint Typhoon Warning Center considered Shanshan the 13th tropical storm and eighth typhoon of the season, a Category 4-equivalent typhoon in terms of 1-minute average wind speed. The name Shanshan was submitted to the naming list by Hong Kong and is a girls' given name.\\nShanshan wreaked havoc in Japan, with reports that it caused a tornado which derailed a train. It made landfall first in the Yaeyama Islands, where it caused heavy rains, and later in Kyūshū. The outer bands of Shanshan also affected South Korea. Shanshan also knocked power out to thousands of homes in the two countries, and killed at least eleven people. Damage amounted to $2.5 billion, making Shanshan the sixth costliest disaster worldwide in 2006."},{"page_url":"https://en.wikipedia.org/wiki/Little_Thetford","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Horseshoes_Old_public_house_Little_Thetford.jpg","page_title":"Little Thetford","context_page_description":"Little Thetford is a small village in the civil parish of Thetford, 3 miles south of Ely in Cambridgeshire, England, about 76 miles by road from London. The village is built on a boulder clay island surrounded by flat fenland countryside, typical of settlements in this part of the East of England. During the Mesolithic era, the fenland basin was mostly dry and forested, although subject to salt and fresh water incursions. The marshes and meres of this fenland may therefore have been difficult to occupy, other than seasonally, but there is evidence of human settlement on the island since the late Neolithic Age; a Bronze Age causeway linked the village with the nearby Barway, to the south-east. An investigation, prior to a 1995 development in the village, discovered a farm and large tile-kiln of Romano-British origin; further investigations uncovered an earlier settlement of the Pre-Roman Iron Age. The Roman road Akeman Street passed through the north-west corner of the parish, and the lost 7th century Anglo-Saxon village of Cratendune may be nearby."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9B%D7%9C%D7%9B%D7%9C%D7%AA_%D7%94%D7%90%D7%99%D7%97%D7%95%D7%93_%D7%94%D7%90%D7%99%D7%A8%D7%95%D7%A4%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Map_of_GDP_per_capita_in_the_EU_in_2007_%28NUTS_3%29.svg","page_title":"כלכלת האיחוד האירופי","context_page_description":"כלכלת האיחוד האירופי בחישוב של כלל מדינות האיחוד, היא למעשה הכלכלה הגדולה בעולם. בין מדינות האיחוד מתקיים שיתוף פעולה הדוק, הכולל תנועה חופשית של הון, סחורות ואנשים; נורמות וסטנדרטים אחידים; מימון פרויקטים משותפים; ובמרבית מדינות האיחוד גם איחוד מוניטרי הכולל מטבע משותף - האירו.\\nעם זאת, ישנם הבדלים משמעותיים בין המדינות המרכיבות את האיחוד. מרבית המדינות החדשות שהצטרפו לאיחוד החל מעשור הראשון של המאה ה-21, ובדגש על מדינות מזרח היבשת סובלות מסטנדרטים כלכליים ירודים משמעותית מחמשה עשר מדינות האיחוד האירופי הוותיקות. לעומת זאת, בסוף העשור הזה נרשמה צמיחה גבוהה יותר דווקא במדינות החדשות."},{"page_url":"https://az.wikipedia.org/wiki/B%C3%B6y%C3%BCk_Yar%C4%B1q","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Dark_Rift_2012.jpg","page_title":"Böyük Yarıq","context_page_description":"Astronomiyada Böyük Yarıq- Günəş Sistemi ilə Süd Yolu qalaktikasının Oxatan qolu arasında uzanan örtülü, qeyri-parlaq, molekulyar toz buldudunun birləşməsidir. Bu buludlar Yerdən 800-1000 parsek məsafədə yerləşir. Buludlar 1 milyon günəş kütləsi tərtibində plazma və tozdan ibarətdir.\\nBöyük Yarıq — Adi gözlə, Süd Yolunun parlaq qolunu, uzunluğunun üçdə biri qədərini uzunlamasına bölən və çoxlu sayda ulduzun zolaqları ilə əhatə olunmuş qaranlıq bir zolaq kimi görünür.\\nBöyük Yarıq Qu bürcündən başlayaraq burada, Qu Yarığı və ya Şimal Kömürü adlandırılır, Qartal bürcünə uzanır; İlandaşıyan bürcündə genişlənir; Oxatan bürcündə Qalaktik Mərkəzdə gizlənir; və nəhayət Sentavr bürcünə uzanır. Qaranlıq ən vacib bölgələrdən biri, Qu OB2 assosiasiyasıdır, o gənc ulduzların böyük bir qrupunu özündə birləşdirməklə bərabər həm də Dünyanın yaxınlığındakı ən böyük ulduzəmələgəlmə bölgələrindən biridir. Bu cür qaranlıq yarıqlar, Andromedada NGC 891 və Veronikanın Saçları bürcündə NGC 4565 kimi bir çox kənar qalaktikalarda görülə bilər."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Eichst%C3%A4tt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Luitpoldstr._35_Eichstaett-2.jpg","page_title":"Liste der Baudenkmäler in Eichstätt","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Großen Kreisstadt Eichstätt zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_du_patrimoine_mondial_en_Tch%C3%A9quie","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Zatec_CZ_Knezska_brana_PICT2989.jpg","page_title":"Liste du patrimoine mondial en Tchéquie","context_page_description":"Cet article recense les sites inscrits au patrimoine mondial en Tchéquie."},{"page_url":"https://es.wikipedia.org/wiki/Uni%C3%B3n_Deportiva_Mah%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Flag_maritime_mahon.svg","page_title":"Unión Deportiva Mahón","context_page_description":"La Unión Deportiva Mahón es un club de fútbol español, de la ciudad de Mahón Fue fundado como Unión Sportiva Mahón en 1922, fruto de la fusión de los clubes locales Mahonés Foot-ball Club y Seislán Foot-ball Club. A su vez, en 1974 se fusionó con el Club Deportivo Menorca para crear el Club de Fútbol Sporting Mahonés, aunque la UD Mahón denunció poco después la fusión por incumplimiento de sus cláusulas. Tras un largo pleito con las autoridades deportivas, en 2001 recuperó el equipo sénior.\\nFue el primer equipo balear en disputar una competición oficial de ámbito nacional, la Copa del Rey 1928, y el primer club menorquín que participó en categoría nacional de la liga española. Actualmente milita en la Regional Preferente de Menorca."},{"page_url":"https://ca.wikipedia.org/wiki/Bartlettina_sordida","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Eupatorium_megalophyllum.jpg","page_title":"Bartlettina sordida","context_page_description":"Bartlettina sordida, R. M. King & H. Rob., anteriorment classificada en el gènere Eupatorium, és una espècie fanerògama d'arbust pertanyent a la família de les asteràcies."},{"page_url":"https://hr.wikipedia.org/wiki/Grkokatoli%C4%8Dka_crkva_u_Hrvatskoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Crkva_svetih_%C4%86irila_i_Metoda_u_Zagrebu.jpg","page_title":"Grkokatolička crkva u Hrvatskoj","context_page_description":"Grkokatolička crkva u Hrvatskoj je Katolička crkva koja koristi bizantski istočni obred. Pokriva je Križevačka biskupija."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B8%8B%E8%B0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/PARCO_Shibuya_Part1-2.jpg","page_title":"渋谷","context_page_description":"渋谷は、東京都渋谷区の地名。\\n町名としての渋谷、渋谷一丁目から四丁目まである。\\n渋谷駅を中心とする地域の総称。前述「1」の他に、「道玄坂」「宇田川町」「神南」「桜丘町」などが含まれる。東京を代表する繁華街の一つであり、最先端の流行やファッション、音楽、若者文化の街となっている。\\n近年では、渋谷駅から北西にやや離れているものの、個性的な店舗が住宅・企業オフィスの間に点在するエリアが「奥渋谷」と呼ばれることもある。町名としては松濤、富ヶ谷、神山町などである。\\n東京特別区の一つである渋谷区。\\n武蔵国の村を起源とする、明治時代以降に存在した渋谷村と渋谷町。"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AF%80%E0%AE%9A%E0%AF%8D_%E0%AE%95%E0%AE%BE%E0%AE%B5%E0%AE%BF%E0%AE%A9%E0%AF%8D,_%E0%AE%A8%E0%AE%BF%E0%AE%AF%E0%AF%82_%E0%AE%9A%E0%AF%86%E0%AE%B0%E0%AF%8D%E0%AE%9A%E0%AE%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Census_Bureau_map_of_Beach_Haven%2C_New_Jersey.png","page_title":"பீச் காவின், நியூ செர்சி","context_page_description":"பீச் காவின் என்பது ஐக்கிய அமெரிக்க நாடுகளில் அமைந்துள்ள நியூ ஜேர்சி மாநிலத்தின் ஓசன் கவுன்டியில் அமைந்துள்ள ஒரு தன்னாட்சியுள்ள நகரம் ஆகும்."},{"page_url":"https://es.wikipedia.org/wiki/Die_Fantastischen_Vier","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Michael_beck_1.jpg","page_title":"Die Fantastischen Vier","context_page_description":"Die Fantastischen Vier, también conocidos como los Fanta 4, es un grupo de hip hop de Stuttgart. Sus miembros son Michael Bernd Schmidt alias Smudo, Andreas Rieke alias And.Ypsilon, Thomas Dürr alias \\"Thomas D, el Portero\\" y Michael 'Michi' Beck alias Dee Jot Hausmarke. Fueron de los primeros grupos alemanes de rap en usar el alemán en sus letras.​"},{"page_url":"https://ast.wikipedia.org/wiki/Tony_Becker","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Tony_Becker_Texas_Wheelers_1974.JPG","page_title":"Tony Becker","context_page_description":"Tony Becker, ye un actor, actor de televisión y actor de cine estauxunidense.\\nYe meyor conocíu pol so papel de Daniel 'Danny' Purcell na serie Tour of Duty de CBS.\\nEl primer papel de televisión de Becker taba na sitcom de curtia duración de la cadena ABC The Texas Wheelers a los 11 años. Tamién co-protagonizó la serie de The Oregon Trail y For Love and Honor y tuvo un papel recurrente como Drew en Los Walton. Tamién participó en películes d'esta serie col mesmu papel.\\nAmás, foi estrella convidada en numberoses series de televisión como Marcus Welby, M.D., Lou Grant, Little House on the Prairie, Knots Landing, Matlock, Walker, Texas Ranger y Melrose Place. Tamién tuvo un pequeñu papel na película de 1986 d'aición Iron Eagle."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%B3%E3%83%89%E3%81%AB%E3%81%8A%E3%81%91%E3%82%8B%E3%82%A4%E3%82%B9%E3%83%A9%E3%83%BC%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Qutab_Minar_mausoleum.jpg","page_title":"インドにおけるイスラーム","context_page_description":"インドに居住または活動するイスラム教について概説する。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Le_Locle","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Ch%C3%A2teau_des_Monts_1.JPG","page_title":"Liste der Kulturgüter in Le Locle","context_page_description":"Die Liste der Kulturgüter in Le Locle enthält alle Objekte in der Gemeinde Le Locle im Kanton Neuenburg, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit."},{"page_url":"https://cy.wikipedia.org/wiki/Madison,_Nebraska","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Horace_L._McBride.jpg","page_title":"Madison, Nebraska","context_page_description":"Dinas yn Madison County, yn nhalaith Nebraska, Unol Daleithiau America yw Madison, Nebraska. ac fe'i sefydlwyd ym 1885."},{"page_url":"https://nl.wikipedia.org/wiki/Dourlers","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Map_commune_FR_insee_code_59181.png","page_title":"Dourlers","context_page_description":"Dourlers is een gemeente in het Franse Noorderdepartement en telt 568 inwoners. De plaats maakt deel uit van het arrondissement Avesnes-sur-Helpe."},{"page_url":"https://nl.wikipedia.org/wiki/Amerikaanse_populier","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Populus_deltoides_bark_pode3_028_pvp.jpg","page_title":"Amerikaanse populier","context_page_description":"De Amerikaanse populier of Amerikaanse zwarte populier is een populierensoort uit de sectie Aegiros. De Amerikaanse populier komt van nature voor in Noord-Amerika en is rond 1750 voor het eerst ingevoerd in Frankrijk. De boom wordt gemiddeld 70 tot 100 jaar oud, maar ze kunnen onder goede groeiomstandigheden 200 tot 400 jaar oud worden. De Amerikaanse populier komt van nature voor langs rivieren."},{"page_url":"https://ro.wikipedia.org/wiki/Aislingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Aislingen_St._Georg_01.JPG","page_title":"Aislingen","context_page_description":"Aislingen este o comună-târg din districtul Dillingen an der Donau, regiunea administrativă Schwaben, landul Bavaria, Germania."},{"page_url":"https://simple.wikipedia.org/wiki/Bobby_Dodd","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Georgia_Tech_Clemson_2007_Halftime.jpg","page_title":"Bobby Dodd","context_page_description":"Robert \\"Bobby\\" Lee Dodd was an American college football coach at Georgia Institute of Technology. He was elected to the College Football Hall of Fame as a player and coach. He is one of only three people to have done this.\\nDodd was born in Galax, Virginia. He moved to Kingsport, Tennessee and played several sports at Dobyns-Bennett High School. After high school, he played as a quarterback at the University of Tennessee. From 1931–1945, he worked as an assistant coach for William Alexander at Georgia Tech. Alexander hired Dodd while he was still a student at Tennessee. Dodd replaced Alexander in 1945 and became the third head coach at Georgia Tech. He retired from coaching after the 1966–67 season, with 165 wins, 64 losses, and 8 ties in his career. He also worked as athletic director for Georgia Tech from 1950 until 1976. Dodd died in June 1988 at the age of 79 in Atlanta, Georgia."},{"page_url":"https://ca.wikipedia.org/wiki/Pentesilea","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Woodcut_illustration_of_Penthesilea_-_Penn_Provenance_Project.jpg","page_title":"Pentesilea","context_page_description":"Pentesilea, en grec: Πενθεσίλεια o \\"Penthesilea\\", segons la mitologia grega, fou la reina de les guerreres amazones, i les va dirigir en la Guerra de Troia."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II_listed_buildings_in_Liverpool-L5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Kirkdale_Community_Centre_2019-1.jpg","page_title":"Grade II listed buildings in Liverpool-L5","context_page_description":"Liverpool is a city and port in Merseyside, England, which contains many listed buildings. A listed building is a structure designated by English Heritage of being of architectural and/or of historical importance and, as such, is included in the National Heritage List for England. There are three grades of listing, according to the degree of importance of the structure. Grade I includes those buildings that are of \\"exceptional interest, sometimes considered to be internationally important\\"; the buildings in Grade II* are \\"particularly important buildings of more than special interest\\"; and those in Grade II are \\"nationally important and of special interest\\". Very few buildings are included in Grade I — only 2.5% of the total. Grade II* buildings represent 5.5% of the total, while the great majority, 92%, are included in Grade II.\\nLiverpool contains more than 1,550 listed buildings, of which 28 are in Grade I, 109 in Grade II*, and the rest in Grade II. This list contains the Grade II listed buildings in the L5 postal district of Liverpool. This area lies to the north of the centre of the city."},{"page_url":"https://es.wikipedia.org/wiki/Conrado_II_de_Italia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Conrad_II_of_Italy.jpg","page_title":"Conrado II de Italia","context_page_description":"Conrado fue el segundo hijo del emperador Enrique IV. Coronado Rey de romanos en 1087 y depuesto en 1098; y debido a su enfrentamiento con su padre elegido Rey de Italia en 1093.\\nConrado nació en la Abadía de Hersfeld en 1074, hijo de Enrique IV y de Bertha de Saboya. Su hermano mayor había nacido y muerto en agosto de 1071 y como heredero de su padre fue investido con el ducado de Baja Lorena y el marquesado de Turín en 1076; fue llevado a Italia donde permaneció al cuidado de Teobaldo de Castiglione, arzobispo de Milán. El 30 de mayo de 1087, fue coronado como Rey de Alemania en Aquisgrán, lo que le convertía en heredero de su padre.\\nBajo la influencia de la marquesa Matilde de Toscana, ​ Conrado se adhirió al bando papal en contra de su padre en la Querella de las Investiduras, y en 1093 fue coronado rey rival de Italia en Milán por su arzobispo Anselmo III.​​ En 1095, después del Concilio de Piacenza, prestó juramento de lealtad al Papa Urbano II en Cremona, a su vez, el Papa le prometió la corona imperial, así como el arreglo de su enlace matrimonial con Constanza, hija del conde de Sicilia Roger I."},{"page_url":"https://cs.wikipedia.org/wiki/Thios%C3%ADran_sodn%C3%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Thios%C3%ADran_sodn%C3%BD.JPG","page_title":"Thiosíran sodný","context_page_description":"Thiosíran sodný, je nejběžnější solí kyseliny thiosírové."},{"page_url":"https://nl.wikipedia.org/wiki/Boldixum","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/St_Nicolai_Foehr.jpg","page_title":"Boldixum","context_page_description":"Boldixum, is een Duits dorp en voormalige gemeente op het waddeneiland Föhr. Bestuurlijk valt Boldixum onder de gemeente Wyk auf Föhr in de landkreis Noord-Friesland in de deelstaat Sleeswijk-Holstein.\\nHet dorp werd in 1463 als Boldichsum genoemd in een jaarboek van de bisschop van Sleeswijk. Vjifhonderd jaar later werd in het dorp een gedenksteen geplaatst om dit feit te vieren. Boldixum was lange tijd de hoofdplaats van het eiland Föhr, maar raakte overvleugeld door Wyk dat gunstiger was gelegen.\\nBoldixum kent de Sint-Nicolaaskerk uit de 13e eeuw, die is voorzien van een interieur met fraaie houten ornamenten. Op 14 juni 1426 kwamen in deze kerk vertegenwoordigers van de zeven harden bijeen. De Eed van de zeven harden was gericht tegen het afstaan van de bijzondere rechten die Noord-Friesland in het verleden waren toegekend."},{"page_url":"https://de.wikipedia.org/wiki/Waikato_Plains","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/NZ-Waikato_P.png","page_title":"Waikato Plains","context_page_description":"Die Waikato Plains sind ein großes weitgehend ebenes Gebiet im Nordwesten der Nordinsel Neuseelands. Die Ebene ist das natürliche Überflutungsgebiet des Waikato River, Neuseelands längstem Fluss."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Nationalen_Denkm%C3%A4ler_Kolumbiens","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lost_City_Ruins.jpg","page_title":"Liste der Nationalen Denkmäler Kolumbiens","context_page_description":"Die Monumentos Nacionales de Colombia und die Bienes de Interés Cultural de Carácter Nacional sind die Gebäude, Naturschutzgebiete, Archäologischen Stätten, historischen Zentren, Stadtteile und Kulturgüter, die aufgrund ihres ursprünglichen, originalen, sinnlichen, künstlerischen, und technischen Wertes repräsentativ für Kolumbien sind. Sie stellen zentrale Elemente der Geschichte und Kultur von Kolumbien dar.\\nDas erste Gesetz zum Schutz des Nationalerbes war das Gesetz 163 vom 30. Dezember 1959. 2008 wurde durch das Gesetz Ley 1185 das Kulturerbe der Nation definiert als \\"materielle Güter, immaterielle Manifestationen, Produkte und Darstellungen von Kultur, die die Nationalität von Kolumbien ausdrücken. Seither wurden 1084 Objekte zu \\"Monumentos Nacionales\\" erklärt. Für die Regulierung, Reglementierung, Unterhaltung, Schutz und Schutzmaßnahmen ist das Ministerio de Cultura in Zusammenarbeit mit dem Consejo Nacional de Patrimonio verantwortlich. 1996 bzw. 1998 wurden sämtliche alten Bahnhöfe und Eisenbahnlinien unter staatlichen Schutz gestellt. Darüber hinaus wurden Erstausgaben des Romans Hundert Jahre Einsamkeit unter Schutz gestellt."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D0%B0%D1%80%D0%BA%D0%B5%D0%BB%D1%81%D0%B1%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/Barkelsby_in_RD.png","page_title":"Баркелсби","context_page_description":"Баркелсби — општина во округот Рендсбург-Екернферде, во Шлезвиг-Холштајн, Германија."},{"page_url":"https://fr.wikipedia.org/wiki/%C5%A0%C3%A1rka_Kub%C3%ADnov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Sarka_Kubinova_2010.jpg","page_title":"Šárka Kubínová","context_page_description":"Šárka Kubínová est une joueuse volley-ball tchèque, née le 19 avril 1988 à Havlíčkův Brod. Elle mesure 1,78 m et joue au poste de passeuse."},{"page_url":"https://de.wikipedia.org/wiki/Beezie_Madden","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a3/2008_Olympic_Games_Equestrian_Game_Day_Celemony_01.jpg","page_title":"Beezie Madden","context_page_description":"Elizabeth „Beezie“ Madden, gebürtige Elizabeth Patton, ist eine US-amerikanische Springreiterin."},{"page_url":"https://nl.wikipedia.org/wiki/Porta_San_Sebastiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Porta_Appia4.JPG","page_title":"Porta San Sebastiano","context_page_description":"De Porta San Sebastiano is een stadspoort in de antieke Aureliaanse Muur in Rome. De oorspronkelijke Romeinse naam was Porta Appia.\\nDe naam Porta San Sebastiano komt van de nabijgelegen Catacomben van Sint Sebastiaan.\\nDoor deze poort loopt de Via Appia, in de oudheid een van de oudste en belangrijkste uitvalswegen van de stad. De Via Appia begon voor de bouw van de Aureliaanse Muur bij de Porta Capena van de Servische stadsmuur. De weg liep naar de Romeinse stad Brindisium, het huidige Brindisi). Vanwege het drukke verkeer was de Porta Appia een van de hoofdpoorten van de stad en had daarom twee doorgangen."},{"page_url":"https://de.wikipedia.org/wiki/Karl_Friedrich_Reinhard","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/CarlFriedrichGrafReinhardDiplomatS173.jpg","page_title":"Karl Friedrich Reinhard","context_page_description":"Karl Friedrich Reinhard, französisch Charles Frédéric, comte Reinhard, war ein französischer Diplomat, Staatsmann und Schriftsteller deutscher Herkunft. Talleyrand nannte ihn „Das Geschenk Tübingens an Frankreich“."},{"page_url":"https://en.wikipedia.org/wiki/Religion_in_Spain","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Templo_hind%C3%BA_de_Benalm%C3%A1dena.jpg","page_title":"Religion in Spain","context_page_description":"The major religion in Spain has been Catholic Christianity since the Reconquista, with a small minority of other Christian and non-Christian religions and high levels of secularization as of 2020. The Pew Research Center ranked Spain as the 16th out of 34 European countries in levels of religiosity, which is lower than Italy, Portugal and Poland, but much higher than the United Kingdom and the Nordic countries. There is no official religion and religious freedom is protected: the Spanish Constitution of 1978 abolished Catholicism as the official state religion, while recognizing the role it plays in Spanish society.\\nCatholicism has been present in the Iberian Peninsula since Roman times. The Spanish Empire spread it to the Philippine islands and Latin America, which are now predominantly Catholic countries. However, since the end of the Francoist dictatorship practical secularization has grown strongly. Only 3% of Spaniards consider religion as one of their three most important values, lower than the 5% European average.\\nA Survey published in 2019 by the Pew Research Center found that 54% of Spaniards had a favorable view of Muslims, while 76% had a favorable view about Jews."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%B5%D1%8F%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Chapelle_Vierge_Feillens_4.jpg","page_title":"Феян","context_page_description":"Фея́н — муніципалітет у Франції, у регіоні Рона-Альпи, департамент Ен. Населення — 3108 осіб.\\nМуніципалітет розташований на відстані близько 340 км на південний схід від Парижа, 65 км на північ від Ліона, 30 км на північний захід від Бург-ан-Бресса."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BD%D0%B3_%D0%99%D0%BE%D0%BD%D0%B3_%D0%A0%D0%B5%D0%BA%D1%81%D1%82%D1%8A%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/RextonII_SMS.JPG","page_title":"Санг Йонг Рекстън","context_page_description":"Рекстън е модел високопроходим автомобил на южнокорейския SUV-специалист SsangYong Motor Company. Технологично базиран на платформата на Mercedes-Benz M-Class, Рекстън съчетава лекотата на управление и комфорта на лимузина със здравината и проходимостта на военен всъдеход. Предлага се в 5 или 7-местна конфигурация на седалките, без разлика в междуосието и в размерите на купето. Дизайнът на Рекстън е създаден в торинското студио Италдизайн от легендарния Джорджето Джуджаро.\\nПроизводството на Рекстън стартира в края 2001 г. а през 2004, 2006, 2013 и 2015 г. моделът претърпява фейслифт и технологично усъвършенстване. От началото на 2016 година третото поколение на Rexton получава нов дизелов двигател с директно впръскване и работен обем 2.2 л, както и 7G-Tronic автоматична трансмисия от Mercedes-Benz.\\nПоради факта, че е шаси-базиран и издръжлив на екстремна екплоатация, от самото си създаване до днес Рекстън е на въоръжение в армията на своята родина Южна Корея.\\nДоставяните на територията на ЕС високопроходими автомобили Рекстън се произвеждат в завода на SSang Yong в Pyongtaek при тристепенна система за качествен контрол и в съответствие с технологичните и екологични норми на ЕС."},{"page_url":"https://cy.wikipedia.org/wiki/Owrtyn","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Overton-on-Dee_-_Owrtyn_-_geograph.org.uk_-_1843843.jpg","page_title":"Owrtyn","context_page_description":"Mae Owrtyn yn bentref a chymuned ar lan Afon Dyfrdwy ym mwrdeistref sirol Wrecsam. Saif ger cyffordd y priffyrdd A528 a'r A539. Saif 7 mile o dref Wrecsam a 22 mile o Gaer a'r Amwythig.\\nDywedir fod y casgliad o saith ywen sy'n tyfu ym mynwent Eglwys y Santes Fair yn un o Saith Rhyfeddod Cymru. Mae'r eglwys ei hun yn dyddio i'r tua'r 12g, ond mae'r coed yw rhwng 1500 a 2000 o flynyddoedd oed; oherwydd hyn, mae'n debygol fod yma eglwys Geltaidd cynharach yn y lleoliad hwn.\\nMae’n debyg bod enw'r pentref yn dod o'r hen Saesneg Ovretone, yn golygo 'tref uwch' neu 'ucheldre'. Saif ar esgair uwchben Afon Dyfrdwy.\\nDefnyddir tywodfaen coch leol ar gyfer llawer o'r adeiladau, er bod yma hefyd friciau o farl teracota o Riwabon neu Gefn Mawr. Er defnyddiwyd tywodfaen wrth adeiladu’r eglwys, mae briciau’n domineiddio tai’r pentref. Defnyddir llechu neu deils cochion ar toeau. Oedd llawer o’r tai teras a bythynnod lled-wahanedig ar Ffordd Wrecsam a Ffordd Salop yn fythynod gweithwyr y stadau mawrion, Bryn y Pys a Gwernhaylod. Perchnogion Poethlyn, enillydd ras y Grand National, oedd y teulu Peel o Fryn y Pys. Adeiladwyd neuadd y pentref ym 1926."},{"page_url":"https://en.wikipedia.org/wiki/Military_police","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Norway_military_police_cars_new_livery.JPG","page_title":"Military police","context_page_description":"Military police are law enforcement agencies connected with, or part of, the military of a state.\\nIn different countries it may refer to:\\nA section of the military responsible for policing the areas of responsibility of the armed forces against all criminal activity by military or civilian personnel\\nA section of the military responsible for policing in both the armed forces and in the civilian population\\nA section of the military solely responsible for policing the civilian population\\nThe preventive police forces of each Brazilian state, responsible for policing the civilian population, which become auxiliary forces of the Brazilian Army\\nThe status of military police is usually prominently displayed on the helmet or on an armband, brassard, or arm or shoulder flash.\\nNaval police members are sometimes called \\"masters-at-arms\\" and shore patrol.\\nAir Force police members are sometimes called Security Police, Air Police or Security Forces."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%85%D9%8A%D9%84_%D9%85%D9%88%D8%B1%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/SA-Logo.svg","page_title":"إميل موريس","context_page_description":"اميل موريس ‏ هو قائد عسكري ألماني وجنرال نازي من أصول يهودية وآرية مختلطة ولد في 19 كانون الثاني/يناير 1897م، وهو من الأعضاء الأوائل في الحزب النازي. ورفيق للزعيم النازي أدولف هتلر في السجن ومنحه هتلر لقب آري تشريفا لهُ لولائهِ للاشتراكية القومية.\\nلقد كان موريس مساعد ومستشار مقرب من الزعيم النازي أدولف هتلر وهذه الصداقة الشخصية تعود إلى عام 1919م تقريبا عندما كان كلاهما عضو في حزب العمال الألماني، وكذلك مع تأسيس كتيبة العاصفة في عام 1920، وكان اميل أحد المؤسسين لقوات كتيبة العاصفة، ورئيسا لها للفترة 1920-1921م، حيث كان يعرف زعيم ال \\"إس أ\\" بالفوهرر أي المرشد الأعلى.\\nولقد تم اقالته من منصبه لخلافه مع هتلر.\\nفي عام 1936 أصبح اميل موريس نائب الرايخستاغ، وفي عام 1937 كان يشغل منصب رئيس غرفة التجارة في مدينة ميونخ.\\nومن عام 1940 إلى عام 1942، خدم في سلاح الجو الألماني كضابط. وفي عام 1948م بعد انتهاء الحرب العالمية الثانية حكم عليه بالسجن لمدة أربع سنوات في معسكر عمل."},{"page_url":"https://en.wikipedia.org/wiki/Parkinson_%26_Dockendorff","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Richter-House-Oct-08.jpg","page_title":"Parkinson & Dockendorff","context_page_description":"Parkinson & Dockendorff was an architectural firm based in La Crosse, Wisconsin, that was known for its works designed from 1905 through the 1930s. The firm's two named partners were Albert Edward Parkinson and Bernard Joseph Dockendorff. The firm is credited with designing over 800 public buildings, including \\"many of the most significant surviving Early Modern commercial and public buildings\\" in La Crosse. A number of Parkinson & Dockendorff's works are listed on the National Register of Historic Places."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%AE%E0%B5%86%E0%B4%95%E0%B5%8D%E0%B4%B8%E0%B4%BF%E0%B4%95%E0%B5%8D%E0%B4%95%E0%B5%8B_%E0%B4%B8%E0%B4%BF%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B4%BF_%E0%B4%AE%E0%B5%86%E0%B4%9F%E0%B5%8D%E0%B4%B0%E0%B5%8B%E0%B4%AA%E0%B5%8A%E0%B4%B3%E0%B4%BF%E0%B4%B1%E0%B5%8D%E0%B4%B1%E0%B5%BB_%E0%B4%95%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B5%80%E0%B4%A1%E0%B5%8D%E0%B4%B0%E0%B5%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Croquis_de_Catedral_Metropolitana_CD_Mexico.svg","page_title":"മെക്സിക്കോ സിറ്റി മെട്രോപൊളിറ്റൻ കത്തീഡ്രൽ","context_page_description":"മെക്സിക്കോയിലെ കത്തോലിക്കാ അതിരൂപതയുടെ ആസ്ഥാനമാണ് മെട്രോപൊളിറ്റൻ കത്തീഡ്രൽ ഓഫ് ദി അസംപ്ഷൻ ഓഫ് ദി മോസ്റ്റ് ബ്ലെസ്സെഡ് വിർജിൻമേരി ഇൻ ടു ഹെവൻസ്. ഡൗൺ‌ടൗൺ‌ മെക്സിക്കോ സിറ്റിയിലെ പ്ലാസ ഡി ലാ കോൺ‌സ്റ്റിറ്റ്യൂഷ്യന്റെ വടക്കുവശത്തുള്ള ടെം‌പ്ലോ മേയറിനടുത്തുള്ള പഴയ ആസ്ടെകുകളുടെ പുണ്യപ്രദേശത്താണ് ഇത് സ്ഥിതിചെയ്യുന്നത്. 1573 മുതൽ 1813 വരെയുള്ള കാലയളവിലാണ് കത്തീഡ്രൽ നിർമ്മിച്ചത്. സ്പാനിഷ് വിജയത്തോടെ ടെനോച്ടിട്ലൻ പിടിച്ചടക്കിയതിനുശേഷം പണിത ആദ്യത്തെ പള്ളിക്ക് ചുറ്റുമാണ് ഇത് നിർമ്മിച്ചത്. സ്പെയിനിലെ ഗോതിക് കത്തീഡ്രലുകളിൽ നിന്ന് പ്രചോദനം ഉൾക്കൊണ്ട് സ്പാനിഷ് ആർക്കിടെക്റ്റ് ക്ലോഡിയോ ഡി ആർക്കിനീഗ നിർമ്മാണം ആസൂത്രണം ചെയ്തു.\\nഇത് നിർമ്മിക്കാൻ വളരെയധികം സമയമെടുത്തതിനാൽ, 250 വർഷത്തിനുള്ളിൽ, എല്ലാ പ്രധാന വാസ്തുശില്പികൾ, ചിത്രകാരന്മാർ, ശിൽപികൾ, ഗിൽഡിംഗ് മാസ്റ്റേഴ്സ്, വൈസ്രോയൽറ്റിയിലെ മറ്റ് പ്ലാസ്റ്റിക് ആർട്ടിസ്റ്റുകൾ എന്നിവർ ചുറ്റുമതിലിന്റെ നിർമ്മാണത്തിൽ ഒരു ഘട്ടത്തിൽ പ്രവർത്തിച്ചു. നിർമ്മാണത്തിന്റെ വിപുലമായ കാലഘട്ടത്തിന്റെ അതേ അവസ്ഥയിൽ ആ നൂറ്റാണ്ടുകളിൽ പ്രാബല്യത്തിലായിരുന്നതും പ്രചാരത്തിലുള്ളതുമായ ഗോതിക്, ബറോക്ക്, ചുരിഗ്യൂറെസ്ക്, നിയോക്ലാസിക്കൽ തുടങ്ങി വിവിധ വാസ്തുവിദ്യാ ശൈലികളുമായി സംയോജിപ്പിക്കാൻ ഇത് സൗകര്യം നൽകി."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Miami","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Viceroy_Hotel_%26_Spa_Tower_from_Brickell_Ave.JPG","page_title":"List of tallest buildings in Miami","context_page_description":"The U.S. city of Miami, Florida has the country's third-tallest skyline with over 300 high-rises, 80 of which stand taller than 400 feet, mainly according to Emporis, SkyscraperPage, and The Skyscraper Center, which is the online database of the Council on Tall Buildings and Urban Habitat. The tallest building in the city is the 85-story Panorama Tower, which rises 868 feet in Miami's Brickell district and surpassed all other buildings in height when it topped out in 2017. Nine of the ten tallest buildings in Florida are located in Miami."},{"page_url":"https://fi.wikipedia.org/wiki/Ernest_Johann_Creutz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Pernaja_church_01.JPG","page_title":"Ernest Johann Creutz","context_page_description":"Ernest Johann Creutz vanhempi oli suomalainen valtaneuvos, maaherra ja Turun hovioikeuden presidentti. Hänen poikansa oli valtioneuvos Ernst Johan Creutz nuorempi ja veljensä niin ikään maaherrana toiminut amiraali Lorentz Creutz.\\nErnest Johann Creutz oli vuosina 1652–1666 Uudenmaan ja Hämeen läänin maaherra sekä vuonna 1666 lyhytaikaisesti Turun ja Porin läänin maaherra Erik von der Linden kuoltua. Hän siirtyi 1667 Ruotsin Västmanlandiin. Creutz nimitettiin valtaneuvokseksi ja Turun hovioikeuden presidentiksi vuonna 1674. Hän ajoi reduktiota ja puolusti Suomen etuja."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%99%E1%80%B1%E1%80%9B%E1%80%AE%E1%80%99%E1%80%BC%E1%80%84%E1%80%B7%E1%80%BA","image_url":"https://upload.wikimedia.org/wikipedia/my/b/bb/MayYiMyint.jpeg","page_title":"မေရီမြင့်","context_page_description":"​ ​မေရီမြင့် ​သည် တစ်ခါက မြန်မာ့ရုပ်ရှင်​လောကတွင် ထင်ရှား​​​​သော ရုပ်ရှင်သရုပ်​ဆောင် ဖြစ်ခဲ့သည်။ ပြဇာတ် ၃၀ နှင့် ရုပ်ရှင် ၄၇ ကားတွင် သရုပ်ဆောင်ခဲ့သည်။ တင်တင်မူ သီဆိုသည့် နာမည်ကြီး 'ရွှေလည်တိုင်' သီချင်း၏ မူရင်းသီဆိုခဲ့သူလည်း ဖြစ်သည်။ ကမ္ဘာတစ်ပတ် လည်ပတ်ခဲ့ပြီး ဟောလိဝုဒ်ကို ရောက်ဖူးသည်။ ယုဝတီကလောင်ရှင်များ အဖွဲ့ဝင်ဖြစ်ကာ ဝတ္ထုတို၊ ဝတ္ထုရှည်များရေးသားခဲ့သည်။ ကိုယ်တိုင်ရေး ဝတ္ထုရှည်ကို ကိုယ်တိုင်ဒါရိုက်တာလုပ်ပြီး ရုပ်ရှင်တစ်ကား ရိုက်ကူးဖူးသည်။"},{"page_url":"https://fr.wikipedia.org/wiki/Zenobia_Camprub%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Img_45547_Zenobia_Camprubi.jpg","page_title":"Zenobia Camprubí","context_page_description":"Zenobia Camprubí Aymar, née à Malgrat De Mar en 1887 et morte à San Juan en 1956, est une écrivaine et linguiste espagnole.\\nElle est la première traductrice hispanique de Rabindranath Tagore et a développé des activités culturelles considérables.\\nPendant l'exil républicain, elle enseigne à l'Université du Maryland. Elle était amie avec Federico García Lorca et l'épouse de Juan Ramón Jiménez."},{"page_url":"https://de.wikipedia.org/wiki/Streifen-Zwergohreule","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Otus_brucei_breeding_NEW_distr.png","page_title":"Streifen-Zwergohreule","context_page_description":"Die Streifen-Zwergohreule oder auch Streifenohreule ist eine der Zwergohreule sehr ähnliche Art, deren Verbreitungsgebiet vor allem im Nahen und Mittleren Osten liegt. Es werden vier Unterarten beschrieben, von denen Otus bucei exiguus in der Südosttürkei und gelegentlich an der östlichen Mittelmeerküste vorkommt."},{"page_url":"https://es.wikipedia.org/wiki/M113","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/M113-fort-meade-1965.jpg","page_title":"M113","context_page_description":"El M113 es un transporte blindado de personal desarrollado en los Estados Unidos.\\nLa familia de vehículos M113 fue desarrollada a partir del M59 y M75 a finales de los años 1950. Es capaz de realizar operaciones anfibias, aunque su navegabilidad es bastante limitada, usándose esta capacidad a fin de vadear. Vehículo dedicado a terrenos irregulares propios del frente de batalla, dispone de una gran maniobrabilidad, alcanzando 40 km por hora campo a través así como pendientes de 45º de inclinación. Los eslabones de las cadenas disponen de tacos de goma que facilitan su desplazamiento por carreteras pavimentadas, llegando a desarrollar 60 km/h.\\nLa familia M113 cuenta aproximadamente con 12 versiones de vehículos ligeros a oruga, utilizados en gran cantidad de cometidos de combate. Se cree que, a la fecha, se han construido unas 80 000 unidades, habiéndose desarrollado las configuraciones A1, A2 y A3. El M113TBP fue el primer transporte blindado de personal norteamericano moderno desarrollado para el teatro de guerra mecanizada; su primera aparición en combate se realizó durante la guerra de Vietnam."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Lichtenfels_(Oberfranken)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Lichtenfels%2C_Coburger_Stra%C3%9Fe_38-001.jpg","page_title":"Liste der Baudenkmäler in Lichtenfels (Oberfranken)","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen Stadt Lichtenfels zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 26. August 2014 wieder und enthält 317 Baudenkmäler."},{"page_url":"https://cs.wikipedia.org/wiki/Vimperk","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Vimperk_celek_ze_zam_1_DSCN4705.JPG","page_title":"Vimperk","context_page_description":"Vimperk je historické město v okrese Prachatice v Jihočeském kraji, 25 km jihozápadně od Strakonic, na úpatí Boubína na Šumavě. Žije zde přibližně 7 400 obyvatel.\\nMěsto patrně vzniklo na Zlaté stezce, po které se do Čech dopravovala sůl. Je zde zámek, gotický kostel, svérázné svažité náměstí s městskou věží a zachovalé části městských hradeb. Historické jádro města je městskou památkovou zónou.\\nVimperk je výchozím bodem pro velkou část turistických výprav na Šumavu. Pro výrobu zde mívaly hlavní význam oděvní, polygrafické, sklářské ale hlavně dřevozpracující závody. Dnes je to především omezená tradiční polygrafická výroba, výroba měřicích přístrojů a další menší závody.\\nNa severozápadním okraji města leží místní část číslo II, kde je zámek i poměrně zachovalé centrum města, které také nejvíce navštěvují turisté. Historická část leží na skalnatém ostrohu nad řekou Volyňkou, která ji bezpečně chránila z jihu. Na severní straně je rovnoběžné údolí, které město odděluje od zámku. Centrum tvoří silně svažité velké náměstí s radnicí, městskou věží a kostelem, dále malé náměstí, které je neoficiálním centrem, síť ulic kolem Pivovarské ulice a městský park."},{"page_url":"https://vi.wikipedia.org/wiki/C%C3%A2y_g%E1%BA%A1o","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Bombax-ceiba-Hong-Kong-12.JPG","page_title":"Cây gạo","context_page_description":"Cây gạo, tương tự như các loài cây khác trong chi Bombax, còn có tên gọi khác là mộc miên, hoặc hồng miên và người Tây Nguyên gọi là cây Pơ-lang. Trong một số hệ thống phân loại cũ, người ta đưa nó vào họ Gạo.\\nĐây là loài cây ở vùng nhiệt đới với thân cây cao và thẳng với lá rụng vào mùa đông. Các hoa đỏ với 5 cánh hoa mọc vào mùa xuân trước khi cây ra lá non. Quả nhỏ chứa các sợi tương tự như sợi bông. Thân cây có các gai để ngăn cản sự tấn công của động vật. Mặc dù bề ngoài thì thân cây có vẻ tốt cho mục đích khai thác gỗ, nhưng gỗ của nó quá mềm để có thể sử dụng vào những việc như vậy.\\nLoài cây này có lẽ có nguồn gốc ở Ấn Độ nhưng hiện nay nó được trồng rộng rãi ở các bang của Malaysia, Indonesia, miền nam Trung Quốc, Hồng Kông, Đài Loan và Việt Nam. Theo ghi chép trong lịch sử Trung Quốc thì vua Nam Việt là Triệu Đà đã tặng một cây cho vua của nhà Hán vào thế kỷ 2 TCN.\\nCác sợi bông của nó cũng được dùng nhồi vào gối hay nệm cũng như làm lớp cách nhiệt lót áo lạnh. Tuy nhiên vì bông cây gạo không dài sợi nên không thể kéo sợi và dệt như bông vải được.\\nHoa gạo được dùng trong một số loại trà thuốc Trung Hoa.\\nTại Quảng Đông, cây này gọi là 木綿 - mộc miên, hay 紅綿 - hồng miên."},{"page_url":"https://hu.wikipedia.org/wiki/Stilfser_Joch","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/%C3%89SZAKI%C3%9AT_5_P1110495.jpg","page_title":"Stilfser Joch","context_page_description":"A Stilfser Joch Olaszország legmagasabban fekvő hegyi közúti hágója. A Stilfser Joch a lombardiai Valtellina völgybeli Bormio várost köti össze a dél-tiroli Vinschgau-völgyben fekvő Prad-dal. A hágó a nemzetközi jelentőségű SS-38. sz. olasz főközlekedési út magaspontja. Ez az Alpok és egész Európa a második legmagasabban fekvő, aszfaltozott, autóval járható hágója,\\n…„Bár 1937-ben a Col d’Iseran elorozta az Európa legmagasabban fekvő hágója címet, a Stelvio ennek ellenére mindmáig megmaradt az egyik legtisztább, legizgalmasabb és legvarázslatosabb hegyi játszótérnek a természetjárók, kerékpárosok, motorkerékpárosok világában. Nem mintha a keleti vagy akár a nyugati emelkedők közül bármelyik is pihentető időtöltést jelentene. Az olasz Marco Pinotti, aki a 2005-ös Giro során járt a hegyen, az „aszketikus élmény” szavakkal írta le az utat - az önmegtagadás szinte vallási áhítattal járó gyakorlataként. Bár az aszketikus talán nem is megfelelő szó, hiszen abban benne foglaltatik a puritánság és a lemondás is. A Stelvio pedig élvezetet is nyújt."},{"page_url":"https://de.wikipedia.org/wiki/Madison_Range","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Western_Face_of_Madison_Range.jpg","page_title":"Madison Range","context_page_description":"Die Madison Range ist eine Gebirgskette in den Rocky Mountains in Montana in den Vereinigten Staaten. Der Gebirgszug wurde von Meriwether Lewis, im Zuge der Lewis-und-Clark-Expedition 1805 zu Ehren des damals zukünftigen Präsidenten, James Madison, benannt."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E8%98%87%E6%A0%BC%E8%98%AD%E5%9C%8B%E5%AE%B6%E5%9C%96%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/National_Library_Extension.jpg","page_title":"蘇格蘭國家圖書館","context_page_description":"苏格兰国家图书馆是一座位于苏格兰首府爱丁堡的法定送存图书馆，是苏格兰国家收藏机构之一。其总部在爱丁堡旧城中皇家一英里和爱丁堡大学之间的乔治五世桥。其藏书量达到700万册。 另有1400万印刷品和200万份地图。\\n苏格兰国家图书馆藏有许多历史文献，其中重要者包括古登堡圣经副本、达尔文的书信及《物种起源》的手稿、第一对开本等。另外该图书馆还有世界最多的苏格兰盖尔语材料。"},{"page_url":"https://vi.wikipedia.org/wiki/HMS_Sirius_(82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/HMS_Sirius_guns.jpg","page_title":"HMS Sirius (82)","context_page_description":"HMS Sirius (82) là một tàu tuần dương hạng nhẹ thuộc lớp Dido của Hải quân Hoàng gia Anh Quốc được đưa ra hoạt động trong Chiến tranh Thế giới thứ hai. Nó ngừng hoạt động vào năm 1949 và bị tháo dỡ vào năm 1956."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%A3%D8%AE%D9%88%D8%A9_%D8%B4%D8%AD%D8%A7%D8%AF%D8%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Chehade_Brothers.jpg","page_title":"الأخوة شحادة","context_page_description":"فريد ورامي شحادة الذين يعرفون مهنيًا بأخوة شحادة، هم موسيقيان ومغنيان فلسطينيان لبنانيّان. من أهالي البلدة القديمة في القدس، فريد من ورامي من بدأ الأخوة شحادة في دراسة الموسيقى في سن مبكرة وأصبحوا يتقنون الأشكال الفنية الموسيقية والشاعرية الشرقية للزجل والغزل والهيجاء والتقسيم، كانت انطلاقتهم الفنية المهنية كإخوان شحادة بوساطة الفنان والمنتج متعدد الأوجه ميشال ألفتريادس. كان رامي هو المغني في الفرقة، يبرهن الأخوان على البراعة في العزف على جميع الآلات الموسيقية العربية المعروفة، بدءاً من الآلات الحنية مثل العود، بزق، القانون، كمنجة والناي، إلى الآلات الإيقاعية مثل الطبلة، الكاتم والرق."},{"page_url":"https://vi.wikipedia.org/wiki/C%E1%BB%99ng_h%C3%B2a_X%C3%B4_vi%E1%BA%BFt_X%C3%A3_h%E1%BB%99i_ch%E1%BB%A7_ngh%C4%A9a_Byelorussia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/%D0%90%D0%B1%D0%B2%D1%8F%D1%88%D1%87%D1%8D%D0%BD%D0%BD%D0%B5_%D0%A1%D0%B0%D0%B2%D0%B5%D1%86%D0%BA%D0%B0%D0%B9_%D0%A1%D0%B0%D1%86%D1%8B%D1%8F%D0%BB%D1%96%D1%81%D1%82%D1%8B%D1%87%D0%BD%D0%B0%D0%B9_%D0%A0%D1%8D%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D1%96%D0%BA%D1%96_%D0%91%D0%B5%D0%BB%D0%B0%D1%80%D1%83%D1%81%D1%96.jpg","page_title":"Cộng hòa Xô viết Xã hội chủ nghĩa Byelorussia","context_page_description":"Cộng hòa Xô viết Xã hội chủ nghĩa Byelorussia, là một nhà nước cộng hòa thành lập sớm trong lịch sử của lãnh thổ Belarusians sau sự sụp đổ của Đế quốc Nga như một hệ quả tất yếu của Cách mạng tháng Mười Nga."},{"page_url":"https://de.wikipedia.org/wiki/232","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Plotinos.jpg","page_title":"232","context_page_description":"Römisch-Persische Kriege: Der römische Kaiser Severus Alexander führt eine Gegenoffensive gegen das Sassanidenreich unter Ardaschir I."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D9%86%D9%88%D9%8A%D9%84_%D9%83%D9%8A%D8%B1%D9%88%D8%AC%D8%A7_(%D9%85%D9%84%D8%AD%D9%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Maestro_Quiroga_%28busto_bronce%29.jpg","page_title":"مانويل كيروجا (ملحن)","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمانويل كيروجا كان ملحن مزيكا من اسبانيا."},{"page_url":"https://fr.wikipedia.org/wiki/Hilton_Ruiz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Hilton_Ruiz.jpg","page_title":"Hilton Ruiz","context_page_description":"Hilton Ruiz, né le 29 mai 1952 et décédé le 6 juin 2006, est un pianiste de jazz portoricain."},{"page_url":"https://pl.wikipedia.org/wiki/Gomphus_graslinellus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Pronghorn_Clubtail_Dragonfly.jpg","page_title":"Gomphus graslinellus","context_page_description":"Gomphus graslinellus – gatunek ważki z rodzaju Gomphus należącego do rodziny gadziogłówkowatych. Występuje na terenie Ameryki Północnej."},{"page_url":"https://ms.wikipedia.org/wiki/Matthew_McConaughey","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Matthew_McConaughey.jpg","page_title":"Matthew McConaughey","context_page_description":"Matthew David McConaughey ialah seorang pelakon dan penerbit Amerika Syarikat. Beliau mula mendapat perhatian menerusi peranannya dalam Dazed and Confused dan kemudiannya muncul dalam filem-filem seperti Texas Chainsaw Massacre: The Next Generation, A Time to Kill, Amistad, Contact, EDtv dan U-571.\\nPada tahun 2000an, beliau lebih dikenali dengan membintangi filem romantik komedi, termasuk The Wedding Planner, How to Lose a Guy in 10 Days, Failure to Launch, Fool's Gold dan Ghosts of Girlfriends Past. Sejak tahun 2010, beliau telah berpindah dari filem romantik komedi dan mempunyai peranan dalam The Lincoln Lawyer, Bernie, Killer Joe, The Paperboy, Mud, Magic Mike, The Wolf of Wall Street dan Interstellar. Sesetengah pengkritik filem dan wartawan juga merujuk kepada era filem ini sebagai 'McConaissance'.\\nMcConaughey mencapai kejayaan besar pada tahun 2013 untuk lakonannya dalam Dallas Buyers Club yang mendapatkan beliau Anugerah Akademi dan Anugerah Golden Globe untuk Pelakon Lelaki Terbaik."},{"page_url":"https://gl.wikipedia.org/wiki/Ecocardiograf%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Apikal4D.gif","page_title":"Ecocardiografía","context_page_description":"A ecocardiografía, tamén coñecida coma ultrasón cardíaco ou ecocardiograma, é unha tecnoloxía sanitaria que emprega técnicas ecográficas estándares para producir imaxes en rebandas de dúas dimensións do corazón. Ademais, os últimas sistemas de ultrasóns empregan agora imaxes ao vivo en 3D. Desde os comezos, as técnicas de imaxe teñen sido melloradas; os modos A e B foron perfeccionados dando paso ao modo M. Este derradeiro modo, malia ser aínda adoito empregado, representa na pantalla un único feixe do modo 2D, e emprégase de xeito complementario a este. Na actualidade, o modo máis utilizado é o 2D, permitido obter imaxes a tempo real e en dúas dimensións. Pódese tamén complementar con outras téxnicas coma o Doppler tisular ou contrastes.\\nA imaxe resultante dunha ecocardiografía é similar á obtida por calquera outra proba ecográfica. Dita imaxe obtense grazas a un transductor piezoeléctrico que emite e recibe ecos de ultrasóns.\\nA ecocardiografía adóitase realizar dende o tórax, colocando o transductor sobre o peito, entre as costelas, denominándose así ecocardiografía transtorácica. Outro xeito de realizalo é de xeito transesofáxico, isto é, a través do esófago."},{"page_url":"https://en.wikipedia.org/wiki/Embassy_of_Azerbaijan_in_Moscow","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Moscow%2C_Leontyevsky_16%2C_Embassy_of_Azerbaidzhan.jpg","page_title":"Embassy of Azerbaijan in Moscow","context_page_description":"The Embassy of Azerbaijan in Moscow is the diplomatic mission of the Republic of Azerbaijan to the Russian Federation. It is located at 16 Leontyevsky Lane in the Presnensky District of Moscow."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B9%BF%E6%AD%A9%E5%B1%B1%E5%8F%A4%E5%A2%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Ushimado-bay_viewed_from_Ushimado_Olive_Garden-2.jpg","page_title":"鹿歩山古墳","context_page_description":"鹿歩山古墳は、岡山県瀬戸内市牛窓町鹿忍にある古墳。形状は前方後円墳。岡山県指定史跡に指定されている。"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%8C%87%E5%8D%97%E5%AE%A2%E9%81%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/%E6%8C%87%E5%8D%97%E5%AE%A2%E9%81%8B_2013_KINGLONG_KL6112U1_997-FZ_757.jpg","page_title":"指南客運","context_page_description":"指南汽车客运股份有限公司，简称指南客运，主要经营台北联营公车、新北市公车、桃园市公车与国道客运，为中兴巴士集团成员。"},{"page_url":"https://kn.wikipedia.org/wiki/%E0%B2%85%E0%B2%B2%E0%B2%A8%E0%B3%8D_%E0%B2%AE%E0%B3%88%E0%B2%95%E0%B3%86%E0%B2%B2%E0%B3%8D_%E0%B2%B8%E0%B3%81%E0%B2%97%E0%B2%B0%E0%B3%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Sir_Alan_Sugar_at_the_BAFTA%27s-mirrored-closer.jpg","page_title":"ಅಲನ್ ಮೈಕೆಲ್ ಸುಗರ್","context_page_description":"ಅಲನ್ ಮೈಕೆಲ್ ಸುಗರ್ ಉದ್ಯಮ ದಿಗ್ಗಜ, ಮಾಧ್ಯಮದಲ್ಲಿ ಕೆಲಸ ಮಾಡುವವರು. ಹಾಗೂ ರಾಜಕೀಯ ಸಲಹೆಗಾರರಾಗಿದ್ದರು.ಸಂಡೇ ಟೈಮ್ಸ್ ಶ್ರೀಮಂತರ ಪಟ್ಟಿ 2015 ರ ಪ್ರಕಾರ ಸುಗರ್ £ 1.4 ಬಿಲಿ ಅಂದಾಜು ಸಂಪತ್ತಿನೊಂದಿಗೆ \\"ಬಿಲಿಯನೇರ್ ಕ್ಲಬ್\\" ಸೇರಿದ್ದಾರೆ. ಮತ್ತು ಯುಕೆ 101 ನೇ ಶ್ರೀಮಂತ ವ್ಯಕ್ತಿ ಎಂಬ ಶ್ರೇಯಾಂಕ ಪಡೆದಿದ್ದಾರೆ. 2007 ರಲ್ಲಿ ಅವರು ತನ್ನ ಉಳಿದ ಆಸಕ್ತಿಯನ್ನು ಮಾರಾಟ ಗ್ರಾಹಕ ಎಲೆಕ್ಟ್ರಾನಿಕ್ಸ್ ಕಂಪನಿ ಆಮ್ಸ್ಟ್ರಾಡ್, ತನ್ನ ದೊಡ್ಡ ಮತ್ತು ಪ್ರಸಿದ್ಧ ವ್ಯಾಪಾರಿಯಾಗಿದ್ದರು.ಸುಗರ್ 1991 ರಿಂದ 2001 ರವರೆಗೆ ಟೋಟ್ಟೆನ್ಹ್ಯಾಮ್ ಹಾಟ್ಸ್ಪರ್ ಅಧ್ಯಕ್ಷನಾಗಿದ್ದರು.ಸುಗರ್ ಅಮೆರಿಕನ್ ಉದ್ಯಮಿ ಡೊನಾಲ್ಡ್ ಟ್ರಂಪ್ ಒಳಗೊಂಡ 2005 ರಿಂದ ವಾರ್ಷಿಕವಾಗಿ ಪ್ರಸಾರ ಮಾಡಲಾಯಿತು. ಅದೇ ಹೆಸರಿನ ಜನಪ್ರಿಯ ಅಮೇರಿಕಾದ ದೂರದರ್ಶನ ಕಾರ್ಯಕ್ರಮದ ಮೇಲೆ ಆಧಾರಿತ ಇದು ಬಿಬಿಸಿ ಟೀವಿ ಸರಣಿ ಅಪ್ರೆಂಟಿಸ್ ಕಾಣಿಸಿಕೊಳ್ಳುತ್ತದೆ.\\nಆರಂಭಿಕ ಜೀವನ ಸುಗರ್ ಒಂದು ಯೆಹೂದಿ ಕುಟುಂಬದ ಪೂರ್ವ ಲಂಡನ್ನಲ್ಲಿ ಜನಿಸಿದರು. ಅವರು ನಾಲ್ಕು ಫೇ ಮಕ್ಕಳು ಮತ್ತು ನಾಥನ್ ಸುಗರ್ ಕಿರಿಯ ಆಗಿದೆ. ಅವರ ತಂದೆ ಈಸ್ಟ್ ಎಂಡ್ನ ಗಾರ್ಮೆಂಟ್ ಉದ್ಯಮದಲ್ಲಿ ದರ್ಜಿ ಆಗಿದ್ದರು.ಸುಗರ್ ಚಿಕ್ಕವನಾಗಿದ್ದಾಗ, ತನ್ನ ಕುಟುಂಬ ಕೌನ್ಸಿಲ್ ಫ್ಲಾಟ್ ವಾಸಿಸುತ್ತಿದ್ದರು. ತನ್ನ ಯಥೇಚ್ಛ ಕರ್ಲಿ ಕೂದಲು ಅವರು \\"ಮಾಪ್ ತಲೆ\\" ಅವರು ಇನ್ನೂ ಇಂದಿನ ಮೂಲಕ ಸಾಗುವ ಒಂದು ಹೆಸರು ಎಂಬ ಬಿರುದು ಉಂಟು. ಅವರು ಪ್ರಾಥಮಿಕ ಶಾಲೆ ಮತ್ತು ಮೇಲ್ ಕ್ಲಾಪ್ಟನ್ ನಂತರ ಬ್ರೂಕ್ ಹೌಸ್ ಸೆಕೆಂಡರಿ ಸ್ಕೂಲ್, ಹ್ಯಾಕ್ ನೆ, ಮತ್ತು ಮಾಡಿದ ಹಾಜರಿದ್ದರು ಒಂದು ಹಣ್ಣು ಕೆಲಸ ಮೂಲಕ ಹೆಚ್ಚುವರಿ ಹಣ."},{"page_url":"https://af.wikipedia.org/wiki/Faith_Domergue","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Faith_Domergue_1946.jpg","page_title":"Faith Domergue","context_page_description":"Faith Domergue was 'n Amerikaanse aktrise. Sy was bekend vir haar rolle in die rolprente Where Danger Lives, It Came from Beneath the Sea, This Island Earth, en Voyage to the Prehistoric Planet."},{"page_url":"https://vi.wikipedia.org/wiki/Gest%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Geste_Eglise.JPG","page_title":"Gesté","context_page_description":"Gesté là một xã thuộc tỉnh Maine-et-Loire trong vùng Pays de la Loire phía tây nước Pháp. Xã này nằm ở khu vực có độ cao từ 48-104 mét trên mực nước biển."},{"page_url":"https://nl.wikipedia.org/wiki/Wapen_van_Brussel","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Coat_of_arms_of_Brussels_%28Napoleon%29.svg","page_title":"Wapen van Brussel","context_page_description":"Het wapen van Brussel betreft het heraldisch wapen van de Belgische hoofdstad Brussel. Het wapen is twee maal toegekend: een maal in 1817 door de Hoge Raad van Adel tijdens het Verenigd Koninkrijk der Nederlanden en de tweede maal op 25 maart 1844. De tweede maal kreeg het wapen ook de nieuwe blazoenering."},{"page_url":"https://de.wikipedia.org/wiki/Wolf_Justin_Hartmann","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Marktbreit_Wolf_Justin_Hartmann.jpg","page_title":"Wolf Justin Hartmann","context_page_description":"Wolf Justin Hartmann war ein deutscher Abenteurer, Schriftsteller und Offizier in beiden Weltkriegen. Sein Spitzname für Freunde und die wenigen Verwandten, zu denen er Kontakte pflegte, war \\"Hadschi\\". Mit diesem Namen unterschrieb er sehr zahlreiche persönliche Widmungen in seinen Büchern. Es gibt allerdings keinen Hinweis darauf, dass Hartmann jemals in Mekka war."},{"page_url":"https://pt.wikipedia.org/wiki/Ponta_das_Almas","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Ponta_das_Almas_20190921_155914.jpg","page_title":"Ponta das Almas","context_page_description":"A Ponta das Almas ou \\"Sítio Arqueológico Ponta das Almas\\" é um Parque na Lagoa da Conceição, na margem Oeste da Lagoa de Fora, considerado \\"Patrimônio Cultural Brasileiro\\".\\nA Ponta das Almas se localiza no início do caminho para o Canto dos Araçás e para a Costa da Lagoa.\\nConforme os textos do Totem e da Placa informativa in locus:\\n\\"Este sítio arqueológico faz parte do Patrimônio Cultural Brasileiro protegido pela Constituição e pela Lei Federal n°924/61. É caracterizado por vestígios de coletores do litoral catarinense. Entre os elementos marcadores do sítio pode ser observada uma grande quantidade de restos alimentares de peixes e moluscos, além de manchas pretas de fogueiras.\\";\\nhttps://commons.wikimedia.org/wiki/File:Ponta_das_Almas_20190921_160046.jpg\\n\\"Sambaqui da Ponta das Almas. Patrimônio Público Federal. Lei Federal 3924/61. Leis Complementares 001/97, 4362002, 255/2006. Área de Preservação Cultural APC-3. Neste Sítio Arqueológico viveu o homem de sambaqui. Diversos esqueletos e utensílios datados em mais de 2.000 anos a.c. estão enterrados nesta área de preservação cultural. A comunidade é a melhor guardiã de seus bens culturais. Ajude a Preservar.\\""},{"page_url":"https://fr.wikipedia.org/wiki/Centromerus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Centromerus.sylvaticus2.-.lindsey.jpg","page_title":"Centromerus","context_page_description":"Centromerus est un genre d'araignées aranéomorphes de la famille des Linyphiidae."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D1%96%D1%81%D1%82%D0%B5%D1%88%D1%82%D1%96%D0%B9-%D0%A7%D0%B8%D1%87%D0%B5%D1%83%D0%BB%D1%83%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Roman_Catholic_Church_Cristestii_Ciceului.JPG","page_title":"Крістештій-Чичеулуй","context_page_description":"Крістештій-Чичеулуй — село у повіті Бістріца-Несеуд в Румунії. Входить до складу комуни Уріу.\\nСело розташоване на відстані 343 км на північний захід від Бухареста, 31 км на захід від Бистриці, 59 км на північний схід від Клуж-Напоки."},{"page_url":"https://pt.wikipedia.org/wiki/Agrilus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Agrilus_inamoenus_-_ZooKeys-256-035-g002-21.jpeg","page_title":"Agrilus","context_page_description":"Agrilus é um gênero de insetos coleópteros, notável por ter o maior número de espécies de qualquer gênero no reino animal."},{"page_url":"https://en.wikipedia.org/wiki/Augustus_Frederic_Scott","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/-2020-02-03_No21_Mount_Street%2C_Cromer.JPG","page_title":"Augustus Frederic Scott","context_page_description":"Augustus Frederic Scott a Norwich-based Architect who was born in 1854 in the Breckland village of Rockland St Peter, Norfolk. His work included both civic and ecclesiastical buildings, in addition to several large hotels and many private commissions."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%AB%E3%83%86%E3%82%A3%E3%82%B9%E5%8B%95%E7%89%A9%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Artis_de_Partis.jpg","page_title":"アルティス動物園","context_page_description":"アルティス動物園は、オランダの首都アムステルダム中心部に所在する動物園である。\\nオランダ最古の動物園であるとともに、欧州本土においても最古の動物園である。この動物園は27の歴史的建物からなり、水族館とプラネタリウム、動物学と植物学の歴史に関する図書館も付属し、樹木園や芸術コレクションも置かれている。\\n20世紀後半からは、隣接地に狼展示場、昆虫館、世界初の微生物動物園などを建設した。2020年から、全体の改修を予定している。\\n本動物園は、ヨーロッパ動物園・水族館協会 、 Dutch Zoo Federation 、the International Species Information System 、世界動物園水族館協会 のメンバーである。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%DA%86%E2%80%8C%D8%A7%D9%85%E2%80%8C%D8%A7%D8%B3_%D8%B1%D9%88%D8%A8%D9%88%DA%A9_(%D8%A7%DA%86%DB%B1%DB%B3%DB%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/HMS_Roebuck_%28H130%29.jpg","page_title":"اچ‌ام‌اس روبوک (اچ۱۳۰)","context_page_description":"اچ‌ام‌اس روبوک (اچ۱۳۰) یک کشتی است که طول آن ۶۴ metres و ارتفاع آن ۴ metres می‌باشد. این کشتی در سال ۱۹۸۵ ساخته شد."},{"page_url":"https://en.wikipedia.org/wiki/Western_Chain_(New_Zealand)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/NZStewardIslandAreaMap.png","page_title":"Western Chain (New Zealand)","context_page_description":"The Western Chain is a group of islets at 48°03′0″S 166°30′30″E and a part of The Snares. They lie some 5 km to the WSW off the main island North East Island, which lies approx. 200 kilometres south of New Zealand's South Island. The Western Chain island is some 2 km long in NW direction, and the highest elevation of 44 m is at the southernmost Island.\\nThe islets all carry Maori names, from NE: Tahi, Rua, Toru, Whā and finally Rima."},{"page_url":"https://en.wikipedia.org/wiki/Pandanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/S%C3%BCdseeabteilung_in_Ethnological_Museum_Berlin_134.JPG","page_title":"Pandanus","context_page_description":"Pandanus is a genus of monocots with some 750 accepted species. They are palm-like, dioecious trees and shrubs native to the Old World tropics and subtropics. Common names include pandan, screw palm, and screw pine. They are classified in the order Pandanales, family Pandanaceae."},{"page_url":"https://en.wikipedia.org/wiki/List_of_awards_and_nominations_received_by_Anupam_Kher","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/AnupamKher6.jpg","page_title":"List of awards and nominations received by Anupam Kher","context_page_description":"Anupam Kher is an Indian actor and the former Chairman of Film and Television Institute of India. He is the recipient of two National Film Awards and eight Filmfare Awards. He has appeared in over 500 films in several languages and many plays. He won the Filmfare Award for Best Actor for his performance in Saaransh. He holds the record for winning the Filmfare Award for Best Comedian five times in total for: Ram Lakhan, Lamhe, Khel, Darr and Dilwale Dulhaniya Le Jayenge. He won the National Film Award for Special Mention twice for his performances in Daddy and Maine Gandhi Ko Nahin Mara. For his performance in the film Vijay, he won the Filmfare Award for Best Supporting Actor.\\nBesides working in Hindi films, he has also appeared in many acclaimed international films such as the Golden Globe nominated Bend It Like Beckham, Ang Lee's Golden Lion–winning Lust, Caution, and David O. Russell's Oscar-winning Silver Linings Playbook. He received a BAFTA nomination for his supporting role in the British television sitcom The Boy With The Topknot.\\nHe has held the post of chairman of the Central Board of Film Certification and the National School of Drama in India."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1986","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Omar_Khadr_-_PD-Family-released.jpg","page_title":"Lijst van personen geboren in 1986","context_page_description":"Dit is een lijst van personen die geboren zijn in 1986.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Festzug_der_W%C3%BCrttemberger","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Gulden_Wilhelm_I._W%C3%BCrttemberg_1841_Avers.jpg","page_title":"Festzug der Württemberger","context_page_description":"Der Festzug der Württemberger wurde am 28. September 1841 anlässlich des 25-jährigen Thronjubiläums des württembergischen Königs Wilhelm I. in Stuttgart veranstaltet. Mit rund 10.000 Teilnehmern und 200.000 Zuschauern war er der Höhepunkt der Jubiläumsfeierlichkeiten. Neben der Huldigung des Monarchen verdeutlichte der Festzug auch die Zusammengehörigkeit des zu Beginn des 19. Jahrhunderts aus verschiedenen Herrschaften gebildeten Königreichs Württemberg."},{"page_url":"https://it.wikipedia.org/wiki/Piero_Angelini","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Piero_Angelini.jpg","page_title":"Piero Angelini","context_page_description":"Piero Mario Angelini è un politico e accademico italiano."},{"page_url":"https://en.wikipedia.org/wiki/Battle_axe","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Mindanao_moro_panabas_1.JPG","page_title":"Battle axe","context_page_description":"A battle axe is an axe specifically designed for combat. Battle axes were specialized versions of utility axes. Many were suitable for use in one hand, while others were larger and were deployed two-handed.\\nAxes designed for warfare ranged in weight from just over 0.5 to 3 kg, and in length from just over 30 cm to upwards of 150 cm, as in the case of the Danish axe or the sparth axe. Cleaving weapons longer than 150 cm would arguably fall into the category of polearms."},{"page_url":"https://war.wikipedia.org/wiki/Perotrochus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Perotrochus_atlanticus.jpg","page_title":"Perotrochus","context_page_description":"Perotrochus in uska genus han Gastropoda. An Perotrochus in nahilalakip ha familia nga Pleurotomariidae.\\nAn kladograma hini sumala ha Catalogue of Life:"},{"page_url":"https://nl.wikipedia.org/wiki/A_Nightmare_on_Elm_Street_5:_The_Dream_Child","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Nightmare_on_Elm_Street_5.jpg","page_title":"A Nightmare on Elm Street 5: The Dream Child","context_page_description":"A Nightmare on Elm Street 5: The Dream Child is een Amerikaanse horrorfilm, geregisseerd door Stephen Hopkins."},{"page_url":"https://en.wikipedia.org/wiki/Soviet_War_Memorial_(Sch%C3%B6nholzer_Heide)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/The_statue_seen_from_behind.Sch%C3%B6nholzer_Heide.Soviet_War_Memorial.JPG","page_title":"Soviet War Memorial (Schönholzer Heide)","context_page_description":"The Soviet War Memorial in Schönholzer Heide in Pankow, Berlin was erected in the period between May 1947 and November 1949 and covers an area of 30 000 m². The memorial contains the largest Soviet cemetery in Berlin, which is also the largest Russian cemetery in Europe outside of Russia.\\nThe monument is one of three Soviet memorials built in Berlin after the end of the war. The other two memorials are the Tiergarten memorial, built in 1945 in the Tiergarten district of what later became West Berlin, and the Soviet War Memorial.\\nSchönholzer Heide was a popular recreation area in the 19th century. During the Second World War the area was turned into a work camp. After the war, the north-western part of the area was used to build the third largest Soviet war memorial in Berlin, together with the memorials in Treptower Park and Tiergarten.\\nA group of Soviet architects consisting of K. Solovyov, M. Belaventsev, V. Korolyov and the sculptor Ivan Pershudchev made the plan for the cemetery, where 13,200 of the 80,000 Soviet soldiers that had fallen during the Battle of Berlin, would be buried."},{"page_url":"https://it.wikipedia.org/wiki/Circondario_di_Eichst%C3%A4tt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Wappen_Landkreis_Eichstaett.png","page_title":"Circondario di Eichstätt","context_page_description":"Il circondario di Eichstätt è uno dei circondari dello stato tedesco della Baviera.\\nFa parte del distretto governativo dell'Alta Baviera."},{"page_url":"https://en.wikipedia.org/wiki/Pope_of_the_Coptic_Orthodox_Church_of_Alexandria","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Pope_Shenouda_III_of_Alexandria_by_Chuck_Kennedy_%28Official_White_House_Photostream%29.jpg","page_title":"Pope of the Coptic Orthodox Church of Alexandria","context_page_description":"The Pope of the Coptic Orthodox Church of Alexandria is the leader of the Coptic Orthodox Church of Alexandria, a faith with ancient Christian roots in Egypt. The current holder of this position is Pope Tawadros II, who was selected as the 118th pope on November 18, 2012.\\nFollowing the traditions of the church, the pope is chairman and head of the Holy Synod of the Coptic Orthodox Patriarchate of Alexandria as a first among equals. The Holy Synod is the highest authority in the Church of Alexandria, which has between 12 and 18 million members worldwide, 10 to 14 million of whom are in Egypt. It formulates the rules and regulations regarding matters of the church's organization, faith, and order. The pope is also the chairman of the church's General Congregation Council.\\nAlthough historically associated with the city of Alexandria, the residence and Seat of the Coptic Orthodox Pope of Alexandria has been located in Cairo since 1047. The pope is currently established in Saint Mark's Coptic Orthodox Cathedral, inside a compound which includes the Patriarchal Palace, with an additional residence at the Monastery of Saint Pishoy."},{"page_url":"https://nl.wikipedia.org/wiki/Marc_Dessauvage","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Godsheide1.JPG","page_title":"Marc Dessauvage","context_page_description":"Marc Dessauvage was een Vlaams architect. Gedurende de korte architectencarrière van 20 jaar schiep hij een opmerkelijk oeuvre van vooral religieuze architectuur waarmee hij een belangrijke bijdrage leverde aan de moderne architectuur in Vlaanderen. Dessauvage geldt als een van de toonaangevende architecten van het brutalisme. In 1972 ontwierp Dessauvage een opmerkelijke atelierwoning voor zichzelf in het landelijke Loppem."},{"page_url":"https://en.wikipedia.org/wiki/Coach_(bus)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/1961_Restored_Bedford.jpg","page_title":"Coach (bus)","context_page_description":"A coach is a bus used for longer-distance service, in contrast to transit buses that are typically used within a single metropolitan region. Often used for touring, intercity, and international bus service, coaches are also used for private charter for various purposes.\\nDeriving the name from horse-drawn carriages and stagecoaches that carried passengers, luggage, and mail, modern motor coaches are almost always high-floor buses, with a separate luggage hold mounted below the passenger compartment. In contrast to transit buses, motor coaches typically feature forward-facing seating, with no provision for standing. Other accommodations may include on-board restrooms, televisions, and overhead luggage space."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B8%D1%82%D1%80%D0%B8%D1%85_IV_%D1%84%D0%BE%D0%BD_%D0%98%D0%B7%D0%B5%D0%BD%D0%B1%D1%83%D1%80%D0%B3-%D0%9A%D0%B5%D0%BC%D0%BF%D0%B5%D0%BD%D0%B8%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Isenburg-Kempenich_250px.png","page_title":"Дитрих IV фон Изенбург-Кемпених","context_page_description":"Дитрих III (IV) фон Изенбург-Кемпених е господар на Изенбург-Кемпених.\\nТой е син на Герхард I фон Изенбург-Кемпених и Беатрикс. Внук е на Дитрих II фон Изенбург-Кемпених.\\nБрат е на Симон I фон Кемпених, Ютта и на Катарина."},{"page_url":"https://id.wikipedia.org/wiki/Nasi_uduk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Nasi_uduk_netherlands.jpg","page_title":"Nasi uduk","context_page_description":"Nasi uduk atau dalam bahasa Belanda rijst vermengd met onrust van de liefde adalah nama makanan yang terbuat dari bahan dasar nasi putih yang diaron dan dikukus dengan santan, serta dibumbui dengan pala, kayu manis, jahe, daun serai dan merica. Makanan ini ditemukan oleh penduduk pulau Jawa sekitar tahun 1910-1924 dan dipopulerkan oleh Hindia Belanda setelahnya. Nasi uduk biasa dihidangkan dengan emping goreng, tahu goreng, telur dadar / telur goreng yang teriris, dan abon kering, tempe, bawang goreng, ayam goreng, timun serta sambal kacang. Makanan ini biasanya lebih sering dijual di pagi hari untuk sarapan dan malam hari untuk makan malam. Pada malam hari, biasanya nasi uduk dijual di pinggir jalan raya di kota-kota besar. Nasi uduk banyak dijual di kota-kota dan berbagai wilayah di Indonesia Selatan, yaitu pulau Jawa, dan cukup sulit untuk ditemukan di pulau Sumatra, Kalimantan, Sulawesi, Papua dan lain-lain. Pada tahun 2018 Masehi makanan ini tercatat memiliki harga antara Rp.12,000 hingga Rp.15,000."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D0%BA%D0%BE%D0%BD%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Village_de_corconne.JPG","page_title":"Корконн","context_page_description":"Корконн — Францин гӀала-коммуна, лаьтта Бретань регионехь. Коммунан департамент — Гар. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%81%D1%91%D0%BD%D0%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Wa%C5%82brzych%2C_zamek_Ksi%C4%85%C5%BC_%28AW58%29MW_DSC07540.JPG","page_title":"Ксёнж","context_page_description":"Ксёнж или Фюрстенштайн — крупнейший замок Силезии и третий по величине в Польше после Мальборка и Вавеля. Расположен на охраняемой природной территории неподалёку от Валбжиха.\\nВ XIII—XIV вв. замок служил резиденцией князей свидницко-яворских из дома Пястов. Его строителем считается Болько I Суровый. 30-метровый донжон и средневековые части замка возведены во второй половине XIV века. В 1392 г. отошёл к богемской короне, в 1428-29 гг. занят гуситами.\\nС 1509 г. до конца Второй мировой войны замком владел графский род Хохбергов, который в середине XIX века также унаследовал от Асканиев права на княжество Пщиньское. Во второй половине XVI века Хохберги обновили замок в соответствии с художественными вкусами эпохи Возрождения.\\nВ 1671-88 гг. Фюрстенштейн был восстановлен после Тридцатилетней войны. Итальянский зодчий Антонио Доменико Росси перестраивает южное крыло в стиле барокко. В продолжение XVIII в. в стилях барокко и рококо были переоборудованы почти все интерьеры.\\nВо время Второй мировой войны германское командование включило замок в проект «Великан», который предусматривал перенос немецких промышленных предприятий под землю."},{"page_url":"https://fr.wikipedia.org/wiki/Inception","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Paris-pont-de-bir-hakeim-bicycle-path.jpg","page_title":"Inception","context_page_description":"Inception ou Origine au Québec, est un thriller de science-fiction américano-britannique écrit, réalisé et produit par Christopher Nolan, sorti en 2010.\\nSorti deux ans après le grand succès de The Dark Knight du même réalisateur, le film voit le jour grâce à la réputation de celui-ci : les sociétés de production Warner Bros. et Legendary Pictures lui octroient un budget de 160 millions de dollars, sans compter 100 millions dévolus à la promotion du film.\\nInception reçoit un accueil positif, les critiques ayant salué particulièrement son originalité, son casting, sa musique et ses effets visuels. Il rapporte plus de 800 millions de dollars, le classant dans les quarante plus gros succès au box-office mondial. Le film remporte quatre Oscars, dont celui de la meilleure photographie, et il est nommé à ceux du meilleur film et du meilleur scénario original."},{"page_url":"https://sv.wikipedia.org/wiki/Enslinje","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Kl%C3%B6vholmen.jpg","page_title":"Enslinje","context_page_description":"En enslinje är en linje genom två i naturen urskiljbara punkter, \\"ensmärken\\", som används i navigation för positionsbestämning, för att hitta en trygg kurs eller bestämma gränsen för tryggt vatten."},{"page_url":"https://es.wikipedia.org/wiki/Principado_de_Sealand","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Map_of_Sealand_with_territorial_waters.svg","page_title":"Principado de Sealand","context_page_description":"Sealand, oficialmente Principado de Sealand es considerado internacionalmente como micronación, cuya forma de gobierno es la monarquía constitucional, parlamentaria, unitaria. El principado proclama como territorio soberano propio la plataforma marina Roughs Tower, construida por la Royal Navy en 1942 y localizada en el mar del Norte, a diez kilómetros de la costa de Suffolk, en el Reino Unido, así como aguas territoriales en un radio de doce millas náuticas.\\nSealand fue ocupado por la familia y asociados de Paddy Roy Bates, quien autoproclamó el principado y acuñó para sí mismo el apelativo de Su Alteza Real Príncipe Roy de Sealand. La población en sus instalaciones rara vez excede de cinco personas y el área habitable de la torre es de 550 m².\\nPese a la falta de reconocimiento de su soberanía y legitimidad, Sealand es una de las micronaciones más conocidas del mundo y a menudo se le usa como un caso de estudio, de la manera en la que los principios de derecho internacional se pueden aplicar a un territorio en disputa."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%80%D0%BE%D0%B7%D0%B0%D0%B3%D0%BE%D1%80%D1%81%D0%BA%D0%B0_%D0%BE%D0%B2%D1%86%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Local_Stara_Zagora_Sheep_area_of_distribution.PNG","page_title":"Старозагорска овца","context_page_description":"Местна старозагорска овца е българска порода овце с предназначение добив на вълна, мляко и месо."},{"page_url":"https://en.wikipedia.org/wiki/Intertransverse_ligament","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Gray84.png","page_title":"Intertransverse ligament","context_page_description":"The intertransverse ligaments are ligaments that are placed between the transverse processes of the spine.\\nIn the cervical region they consist of a few irregular, scattered fibers that are often replaced by muscles. In the thoracic region they are rounded cords intimately connected with the deep muscles of the back. In the lumbar region they are thin and membranous.\\nThe intertransverse ligaments often blend with the intertransverse muscles.\\nThe function of the intertransverse ligaments is to limit lateral flexion of the spine."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D0%B0%D1%81%D0%BC%D0%B0%D0%BD%D1%96%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Topography_of_Tasmania.jpg","page_title":"Тасманія","context_page_description":"Тасманія — штат, розташований на однойменному острові, близько 240 км на південь від Австралії і роз'єднаний з нею Бассовою протокою. До території штату належать деякі ближні острови: Кінг, Фліндерс та Маккуорі. Населення штату 494 520 осіб. Тасманія — найменший штат Австралії, його площа — 68 401 км². Столиця штату — Хобарт. Найбільші міста: Хобарт, Лонсестон, Девонпорт та Берні. Острів Тасманія є структурним продовженням Великого Вододільного хребта Австралії.\\nНа період колонізації, корінне населення цього острова було повністю знищене англійцями.\\nБереги утворюють численні затоки. У рельєфі переважають відособлені крутосхильні плато і нагір'я заввишки 600—1 000 м. Низовина Мідлендс, розташована за течією річки Теймар-Макуорі, відокремлює Східне нагір'я від Центрального плато гора Осса, 1 617 м — найвища вершина Тасманії, в межах якого розташоване озеро Сент-Клер."},{"page_url":"https://gl.wikipedia.org/wiki/Holodomor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/The_Soviet_Union_1969_CPA_3748_stamp_%28Stanislav_Kosior%29.jpg","page_title":"Holodomor","context_page_description":"Holodomor é o nome atribuído á fame de carácter xenocida, que devastou principalmente o territorio da República Socialista Soviética de Ucraína, durante os anos de 1932 a 1933. Este acontecemento, tamén coñecido por gran fame de Ucraína, representou un dos máis tráxicos capítulos da Historia de Ucraína, debido ó enorme custo en vidas humanas.\\nA pesar de que esta fame afectou igualmente a outras rexións soviéticas, o termo Holodomor é aplicado especificamente ós feitos ocorridos nos territorios con poboación de etnia ucraína: Ucraína e a rexión de Kuban, no Cáucaso do Norte. Como tal, o Holodomor é ás veces denominado \\"Xenocidio Ucraíno\\" ou \\"Holocausto Ucraíno\\", significando que esa traxedia resulta dunha acción deliberada de exterminio desencadeada polo réxime soviético contra o pobo ucraíno, en canto entidade socio-étnica.\\nTendo como referencia o concepto de xenocidio e a súa definición xurídica, verifícase un crecente consenso da historiografía, relativo á natureza xenocida do Holodomor. Por outra banda, hai un número cada vez maior de países que o recoñecen oficialmente como un acto de xenocidio, como España."},{"page_url":"https://fi.wikipedia.org/wiki/Hippokrateen_vala","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/HippocraticOath.jpg","page_title":"Hippokrateen vala","context_page_description":"Hippokrateen vala on antiikin Kreikasta periytyvä vala, jonka joutuivat vannomaan lääkärin ammattiin ryhtyvät henkilöt. Vala liitetään \\"lääketieteen isänä\\" tunnetun Hippokrateen nimeen, ja on osa tämän nimiin laitettujen teosten kokoelmaa Corpus Hippocraticum.\\nSuomessa Hippokrateen valaa ei enää nykyisin vannota, mutta sen sijaan vuonna 1997 on otettu vapaaehtoisena käyttöön lääkärinvala, jonka valmistuvat lääkärit voivat vannoa."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%8A%E0%B9%87%E0%B8%AD%E0%B8%A1%E0%B8%8B%E0%B9%87%E0%B8%AD%E0%B8%87%E0%B9%81%E0%B8%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Cheomseongdae-1.jpg","page_title":"ช็อมซ็องแด","context_page_description":"ช็อมซ็องแด เป็นหอดูดาวเก่าแก่ที่ยังหลงเหลืออยู่ในทวีปเอเชีย ปัจจุบันอยู่ในเมืองคย็องจู ประเทศเกาหลีใต้"},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_rellotges_de_sol_de_l%27Alt_Pened%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Cal_Rafols_dels_Caus%2C_Avinyonet_del_Pened%C3%A8s.jpg","page_title":"Llista de rellotges de sol de l'Alt Penedès","context_page_description":"Llista de rellotges de sol instal·lats de forma permanent en espais públics de la comarca de l'Alt Penedès."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BA%D0%BB%D0%B0%D0%B4%D1%87%D0%B0%D1%82%D0%BE%D0%BC%D0%BE%D1%80%D0%B4%D1%8B%D0%B9_%D0%BB%D0%B8%D1%81%D1%82%D0%BE%D0%BD%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Centurio_senex.jpg","page_title":"Складчатомордый листонос","context_page_description":"Складчатомордый листонос — вид летучих мышей монотипического рода Centurio семейства листоносых, обитающий в Центральной и Южной Америке.\\nДлина тела от 55 до 70 мм. Вес от 17 до 28 грамм. Спина желтовато-коричневого цвета, в то время как брюхо светлее. Рот короткий, круглый, голый, покрыт мясистым образованием, более выраженным у самцов. Рот окружён белыми волосами на подбородке и шее. Глаза относительно большие; радужная оболочка золотистого цвета. Уши длинные, узкие, желтоватые. Не имеет хвоста. Самки немного крупнее самцов. Зубная формула. Кариотип 2n = 28, FN = 52.\\nЖивёт в лиственных и вечнозелёных лесах, сезонно затопляемых лесах на высоте до 1000 метров над уровнем моря. Также встречается в сухих лесах, галерейных лесах, плантациях, садах, может жить в городских парках.\\nВедёт ночной образ жизни. Питается фруктами, предпочитая переспевшие бананы, манго и папайя. Скрывается среди лиан и густой растительности. Самцы ночуют в одиночку или небольшими группами по 2—3 особи, а самки скрываются среди густой листвы. Активность начинается вскоре после захода солнца и уменьшается во время полнолуния."},{"page_url":"https://en.wikipedia.org/wiki/Georg_August_Thilesen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Georg_August_Thilesen.jpg","page_title":"Georg August Thilesen","context_page_description":"Georg August Thilesen was the Norwegian lawyer and elected official. He served as mayor of Drammen 1883–1884, Minister of the Interior 1888-1889 and 1898–1899, member of the Council of State Division in Stockholm 1899–1900, and Minister of Finance in 1900."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D8%B1%D8%A7%D8%AC_%D8%A7%D8%B1%DA%A9%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Erckel%27s_Francolin_RWD5.jpg","page_title":"دراج ارکل","context_page_description":"دراج ارکل نام یک گونه از سرده دراج‌های کبکی است."},{"page_url":"https://fr.wikipedia.org/wiki/Apparitions_mariales_de_Lourdes","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Photo_Dominique_Peyramale.jpg","page_title":"Apparitions mariales de Lourdes","context_page_description":"Les apparitions de Lourdes sont des apparitions mariales manifestées à une jeune fille âgée de quatorze ans, Bernadette Soubirous. Celle-ci a déclaré qu'elle avait assisté à dix-huit apparitions d'une jeune fille se présentant comme étant l'Immaculée Conception.\\nSelon son récit, ces apparitions interviennent pendant six mois, dont douze apparitions en l'espace d'une quinzaine de jours. Les déclarations de la jeune fille suscitent de vives polémiques et font rapidement l'objet d'enquêtes et de contre-enquêtes des autorités civiles. Le commissaire Jacomet, puis le procureur l'interrogent et la menace de prison si elle maintient ses dires ou continue de se rendre à la grotte. Malgré les pressions, Bernadette reste constante dans ses déclaration et ne parvient pas à être mise en défaut. Une foule de plus en plus importante se rend à la grotte avec elle pour assister aux « apparitions » et assister à ses extases. Le jeudi 4 mars 1858, on dénombre environ 8 000 personnes déjà pressées devant la grotte lorsque Bernadette s'y rend à son tour. L'attitude « étrange » de la voyante, et l'absence « d'un grand miracle » désappointe et déçoit un certain nombre de fidèles et de curieux."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9A%E3%83%B3%E3%82%B6%E3%83%B3%E3%82%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9b/Old_Pzarms.gif","page_title":"ペンザンス","context_page_description":"ペンザンスは、イギリス、イングランドのコーンウォールにあるタウン、行政教区、港である。コーンウォールにある大きな町としてはもっとも西に位置しており、プリマスの西およそ120 km、ロンドンの西南西約500 kmに位置している。マウンツ・ベイの内側に位置し、南東側にイギリス海峡があり、西には漁港のニューリンが、北には行政教区のマドロンが、東には行政教区のラッジバンが隣接している。ペンザンスは温帯気候に属し、グレートブリテン島のほとんどの地域よりも穏やかな気候となっている。\\n1512年以降多くの勅許を得ており、1614年に独立した都市として設置された。人口は2001年の時点で21,168人である。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%A0%BC%E5%88%A9%E6%B3%BD667Cc","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Gliese_667_Cc_sunset.jpg","page_title":"格利泽667Cc","context_page_description":"格利泽667Cc是一颗围绕恒星格利泽667C公转的系外行星，格利泽667C是格利泽667三合星系统个成员之一。Gliese 667 Cc最小的质量可能为地球质量的4½，最高可能为地球质量的9倍。\\n格利泽667 Cc是距离太阳较近的三合星系统的成员，位于天蝎座。格利泽667 Cc最先由欧洲南方天文台的高精度径向速度行星搜索器使用径向速度法发现，并于在2011年11月21日先期发布声明。2012年2月2日，哥廷根大学和 Carnegie Institution for Science发布了相关的论文。\\n恒星Gliese 667 C拥有至少7颗行星，其中三颗为岩石行星位于适居带。Gliese 667 Cc位于适居带的内边缘。其轨道半长轴只有0.1251天文单位。Gliese 667Cc上的一年只有28.155地球日。Gliese 667Cc和地球有85%的相似度。根据母星Gliese 667 C的热光度，Gliese 667 Cc接收到的光相当于地球的90%。但其中大部分电磁辐射为不可见的红外线。根据黑体温度计算方式，Gliese 667 Cc吸收了更多的电磁辐射，使其表面温度比地球稍高，更加接近适居带的“热”边缘。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%BC%E3%83%96%E3%83%AB%E5%85%AB%E7%80%AC%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Cable-Yase_station.jpg","page_title":"ケーブル八瀬駅","context_page_description":"ケーブル八瀬駅は、京都府京都市左京区にある、京福電気鉄道鋼索線の駅。路線とともに毎年冬季は休業する。\\n叡山ケーブルの山下駅に相当する。"},{"page_url":"https://pl.wikipedia.org/wiki/National_Historic_Landmark","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/USS_Constitution_1997.jpg","page_title":"National Historic Landmark","context_page_description":"National Historic Landmark – budynek, miejsce, twór natury, a nawet określony obszar, uznany za takowy przez rząd Stanów Zjednoczonych ze względu na swe historyczne znaczenie. Wszystkie NHL są wymienione w Narodowym Rejestrze Pomników Historycznych, jednakże z ponad osiemdziesięciu tysięcy miejsc w USA uważanych za historyczne, na liście NHL znajduje się zaledwie 2430."},{"page_url":"https://vi.wikipedia.org/wiki/Catocala_electa","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Catocala_electa01.jpg","page_title":"Catocala electa","context_page_description":"Catocala electa là một loài bướm đêm thuộc họ Erebidae. Loài này được tìm thấy ở châu Âu và châu Á.\\nSải cánh dài 65–80 mm. The moths gặp ở tháng 7 đến tháng 9 tùy theo địa điểm.\\nẤu trùng ăn Sallow và dương."},{"page_url":"https://nl.wikipedia.org/wiki/Meervoudige_belichting","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Lunar-eclipse-2004.jpg","page_title":"Meervoudige belichting","context_page_description":"Meervoudige belichting is een film- en fotografietechniek waarbij twee of meer afzonderlijke gemaakte beelden op één film of foto samengevoegd worden.\\nBij film wordt een bepaalde scène gefilmd terwijl men een deel van de lens bedekt. Daardoor zal een deel van de filmrol niet belicht worden. Op een gegeven moment stopt men met filmen en spoelt men de film terug. Dan filmt men een andere scène, maar nu wordt het andere deel van de camera bedekt. Op deze manier krijgt men een stuk film waarop beide scènes staan.\\nEen voorbeeld: iemand ligt links in beeld te slapen en zijn droom wordt rechts in beeld getoond."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_biens_culturels_d%27importance_nationale_dans_le_canton_du_Tessin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Bellinzona_Castello_di_Sasso_Corbaro_aussen.jpg","page_title":"Liste des biens culturels d'importance nationale dans le canton du Tessin","context_page_description":"Cette liste présente les biens culturels d'importance nationale dans le canton du Tessin. Cette liste correspond à l'édition 2009 de l'Inventaire Suisse des biens culturels d'importance nationale pour le canton du Tessin. Il est trié par commune et inclus : 150 bâtiments séparés, 26 collections et 35 sites archéologiques."},{"page_url":"https://en.wikipedia.org/wiki/Spanish_Marine_Infantry","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Spain_Marine_Infantry_Brigade_2017.png","page_title":"Spanish Marine Infantry","context_page_description":"The Spanish Naval Infantry is the naval infantry unit of the Spanish Navy responsible for conducting amphibious warfare by utilizing naval platforms and resources. The Marine Corps is fully integrated into the Armada's structure.\\nThe Corps was formed in 1537 by Charles I of Spain, making it the oldest marine corps in existence in the world, drawing from the Compañías Viejas del Mar de Nápoles."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D1%8B_%D0%A1%D0%A1%D0%A1%D0%A0_(1947)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Stamp_of_USSR_1133.jpg","page_title":"Знаки почтовой оплаты СССР (1947)","context_page_description":"Зна́ки почто́вой опла́ты СССР (1947) — перечень знаков почтовой оплаты, введённых в обращение дирекцией по изданию и экспедированию знаков почтовой оплаты Министерства связи СССР в 1947 году."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%AE%E6%8B%89%E6%89%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Prato0001.jpg","page_title":"普拉托","context_page_description":"普拉托位于意大利中部，是托斯卡纳大区普拉托省的首府。人口18万多，为托斯卡纳大区第二大城市，意大利中部第三大城市，仅次于罗马和佛罗伦萨。\\n自1950年代以来，该市接受了大量的移民，最初来自意大利南部，后来来自国外，其中最突出的是1980年代末开始抵达的华人移民。"},{"page_url":"https://de.wikipedia.org/wiki/Naturpark_Schw%C3%A4bisch-Fr%C3%A4nkischer_Wald","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Pfedelbach-Gleichen-Damwildgehege.jpg","page_title":"Naturpark Schwäbisch-Fränkischer Wald","context_page_description":"Der im Jahr 1979 gegründete Naturpark Schwäbisch-Fränkischer Wald im nordöstlichen Baden-Württemberg umfasst große Teile der einander benachbarten Naturräume Schwäbisch-Fränkische Waldberge sowie Schurwald und Welzheimer Wald. Außerdem hat er an seinen Grenzen Anteil an den Naturräumen Hohenloher und Haller Ebene, Östliches Albvorland und Neckarbecken. Die Ausdehnung des Naturparks wird annähernd durch die Städte Backnang, Beilstein, Weinsberg, Öhringen, Schwäbisch Hall, Gaildorf, Lorch und Schorndorf beschrieben.\\nDer Naturpark umfasst Teile der Landkreise Rems-Murr-Kreis, Schwäbisch Hall, Heilbronn, Hohenlohekreis, Ostalbkreis und Ludwigsburg.\\nDem ebenfalls 1979 gegründeten Naturparkverein Schwäbisch-Fränkischer Wald gehören neben den sechs Landkreisen 37 Städte und Gemeinden sowie Verbände aus Land- und Forstwirtschaft sowie Naturschutz an. Von 1979 bis 2006 wurden mehr als 15 Mio. Euro in Erholungseinrichtungen, Landschaftspflege, Umweltbildung, Öffentlichkeitsarbeit und in die Erhaltung des Kulturerbes investiert. In dem am 22. Juni 2004 eröffneten Naturpark-Zentrum in der Stadt Murrhardt befinden sich die Geschäftsstelle und eine Dauerausstellung."},{"page_url":"https://fr.wikipedia.org/wiki/Gbogolo","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Vue_de_la_foule.jpg","page_title":"Gbogolo","context_page_description":"Gbogolo est une localité du centre de la Côte d'Ivoire et appartenant au département de Séguéla, Région du Worodougou. La localité de Gbogolo est un chef-lieu de communes dans le canton Tiéma. Le canton Tiéma comprend treize villages dans la sous-préfecture de Massala."},{"page_url":"https://en.wikipedia.org/wiki/Oldsmobile_88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/1961_Oldsmobile_Dynamic_88_Convertible_%2835232134240%29.jpg","page_title":"Oldsmobile 88","context_page_description":"The Oldsmobile 88 is a full-size car that was sold and produced by Oldsmobile from 1949 until 1999. From 1950 to 1974 the 88 was the division's top-selling line, particularly the entry-level models such as the 88 and Dynamic 88. The 88 series was also an image leader for Oldsmobile, particularly in the early years when it was one of the best performing automobiles thanks to its relatively small size, light weight and advanced overhead-valve high-compression V8 engine. This engine, originally designed for the larger C-bodied and more luxurious 98 series, also replaced the straight-8 on the smaller B-bodied 78. With the large, high performance V8, the Oldsmobile 88 is considered by some to be the first muscle car, although this title is disputed.\\nA large number of variations in nomenclature were seen over this long model run — Futuramic, Super, Golden Rocket, Dynamic, Jetstar, Delta, Delmont, Starfire, Holiday, L/S, LSS, Celebrity, and Royale were used at various times with the 88 badge, and Fiesta appeared on some station wagons in the 1950s and 1960s. The name was more commonly shown as numerals in the earlier years and was changed to spell out \\"Eighty Eight\\" starting in 1989."},{"page_url":"https://en.wikipedia.org/wiki/Camcorder","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Camcorder_in_use_-_SA.jpg","page_title":"Camcorder","context_page_description":"A camcorder is an electronic device originally combining a video camera and a videocassette recorder.\\nThe earliest camcorders were tape-based, recording analog signals onto videotape cassettes. In 2006, digital recording became the norm, with tape replaced by storage media such as mini-HD, microDVD, internal flash memory and SD cards.\\nMore recent devices capable of recording video are camera phones and digital cameras primarily intended for still pictures; the term \\"camcorder\\" may be used to describe a portable, self-contained device, with video capture and recording its primary function, often having advanced functions over more common cameras."},{"page_url":"https://en.wikipedia.org/wiki/Baptisia_arachnifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Baptisia_arachnifera_3.jpg","page_title":"Baptisia arachnifera","context_page_description":"Baptisia arachnifera, commonly known as hairy rattleweed, cobwebby wild indigo, hairy wild indigo, and hairy false indigo, is an endangered species of flowering plant in the legume family. Its native habitat is limited to sandy soils in pinewoods along the coastal plain of the U.S. state of Georgia."},{"page_url":"https://de.wikipedia.org/wiki/Panzerwaffe","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Standarte_Panzertruppe_W.jpg","page_title":"Panzerwaffe","context_page_description":"Panzerwaffe war in der deutschen Wehrmacht bis 1945 die allgemeine Bezeichnung für Panzerkampfwagen, Kampfpanzer, Schützenpanzer oder in der öffentlichen Wahrnehmung auch einfach nur Panzer. Damit wurde aber auch das Hauptwaffensystem der Panzertruppe bezeichnet.\\nIn der deutschen Bundeswehr wird das am stärksten gepanzerte und am flexibelsten bewaffnete Waffensystem der Panzertruppe als Kampfpanzer bezeichnet."},{"page_url":"https://et.wikipedia.org/wiki/Mulla_t%C3%A4nav","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Elamu_Mulla_tn_2%2C_Tallinn.JPG","page_title":"Mulla tänav","context_page_description":"Mulla tänav on tänav Tallinnas Põhja-Tallinna linnaosas Pelgulinna asumis. Tänav algab Telliskivi tänavalt, ristub Roo tänavaga ja lõpeb umbtänavana veidi enne ristumist Sõle tänavaga.\\nMulla tänaval asuvad Mööblimaja ja Pelgulinna Gümnaasium.\\nMulla tänav on nime saanud 27. augustil 1930. Tänav sai nime lähikonnas asuva Saue tänava mõjul."},{"page_url":"https://pl.wikipedia.org/wiki/Rezerwat_przyrody_W%C4%85w%C3%B3z_Szaniawskiego","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5f/W%C4%85w%C3%B3z_szaniawskiego_brzoza.jpg","page_title":"Rezerwat przyrody Wąwóz Szaniawskiego","context_page_description":"Rezerwat przyrody Wąwóz Szaniawskiego – leśny rezerwat przyrody utworzony w 1977 r. na terenie wsi Jadwisin w gminie Serock.\\nPoczątkowo zajmował 11,50 ha. W 2011 roku został powiększony do 13,9312 ha. Wokół rezerwatu wyznaczono otulinę o powierzchni 34,03 ha.\\nCelem ochrony jest zachowanie drzewostanów o charakterze zbliżonym do naturalnego, odznaczających się różnorodnością zbiorowisk roślinnych. Na terenie rezerwatu występuje las mieszany z sosną i pomnikowymi dębami porastającymi zbocze wąwozu i wysoką skarpę doliny Narwi.\\nInne gatunki występujące na terenie rezerwatu to klon, lipa, grab, w podszycie leszczyny, porzeczki alpejskie, głóg dwuszyjkowy. Urozmaicenie stanowi resztka drzewostanu parkowego, złożonego z tuj, topoli kanadyjskich i robinii. Ogółem wyróżniono 34 pomniki przyrody w tym 2 głazy – granity.\\nNazwa rezerwatu pochodzi od nazwiska Jerzego Szaniawskiego, który był właścicielem dworku znajdującego się na terenie obecnego rezerwatu.\\nW pobliżu znajduje się rezerwat „Jadwisin”."},{"page_url":"https://nl.wikipedia.org/wiki/Conus_grahami_longilineus","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Conus_grahami_longilineus_1.jpg","page_title":"Conus grahami longilineus","context_page_description":"Conus grahami longilineus is een ondersoort van de zeeslakkensoort Conus grahami, uit het geslacht Conus. De slak behoort tot de familie Conidae. Conus grahami longilineus werd in 1980 beschreven door Röckel in Rolán & Monteiro. Net zoals alle soorten binnen het geslacht Conus zijn deze slakken roofzuchtig en giftig. Zij bezitten een harpoenachtige structuur waarmee ze hun prooi kunnen steken en verlammen."},{"page_url":"https://nds.wikipedia.org/wiki/Psalter_vun_Genf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/ClementMarot.jpg","page_title":"Psalter vun Genf","context_page_description":"De Psalter vun Genf is een Reeg vun Gesangböker mit den Text vun de Psalmen ut de Bibel in Riemels, toeerst in franzöösche Spraak.\\nJohannes Calvin hett in Straßborg dat Singen vun Psalmleder kennen lehrt. 1539 hett he dor denn een Utwahl rutgeven. De weern vun Clément Marot un vun em süms torechtmaakt. 1542, 1543, un 1551 sünd in Genf nee Utgaven rutkamen. De weeren denn jümmers een beten grötter. Later hett Calvin siene eegen Riemels torüchnahmen un hett Marot de Texten maken laten. As düsse Dichter 1544 dootbleven is, hett in dat Jahr 1548 Théodore de Bèze sien Arbeit övernahmen.\\nIn Genf hett toeerst Guillaume Franc de Musik komponeert. He weer bi de Utgaven vun 1542 un 1543 tostännig. Dormals güng dat üm een Utwahl vun 50 Psalmen. 1551 sünd al 83 Psalmen rutkamen. De Texten hett Bèze maakt, de Musik keem dütmal vun Loys Bourgeois. Een kumplett Gesangbook mit all 150 Psalmen is denn in dat Jahr 1562 rutkamen. De Musik, de noch fehlen dö, hett Pierre Davantès bistüürt.\\nClaude Goudimel hett de Melodien vun den Genfer Psalter up eenfache Aart för Chören torecht maakt."},{"page_url":"https://pl.wikipedia.org/wiki/Historia_Bayernu_Monachium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Soccerball.png","page_title":"Historia Bayernu Monachium","context_page_description":"FC Bayern München to niemiecki klub sportowy z siedzibą w Monachium, Bawaria. Jest najbardziej znany ze swojej profesjonalnej drużyny piłkarskiej, najbardziej utytułowanej drużyny w historii niemieckiej piłki nożnej, rekordzistę pod względem zdobytych mistrzostw i pucharów krajowych, która występuje na co dzień w Bundeslidze, najwyższej klasie rozgrywkowej w piłce nożnej w Niemczech.\\nKlub został założony w 1900 roku przez jedenastu piłkarzy pod wodzą Franza Johna. Największy sukces przypadł w połowie lat 70 XX wieku, kiedy pod dowództwem Franza Beckenbauera wygrał Puchar Europy trzy razy z rzędu. Bayern dotychczas osiągnął dziesięć finałów Pucharu Europy, ostatnio zdobywając piąty tytuł w 2013 r. Bayern zdobył także jeden Puchar UEFA, jeden Puchar Zdobywców Pucharów, jeden Superpuchar Europy, jedno klubowe mistrzostwo Świata i dwa Puchary Interkontynentalne, co czyni go jednym z najbardziej utytułowanych klubów na arenie międzynarodowej. Bayern należy do klubów, które skompletowały wszystkie europejskie puchary. Od czasu utworzenia Bundesligi Bayern wygrał ją 28 razy, a od 2013 roku wygrywa ją nieprzerwanie, co jest dotychczas najdłuższą mistrzowską serią w Bundeslidze."},{"page_url":"https://nn.wikipedia.org/wiki/Alan_White_i_Yes","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/AlanWhite.jpg","page_title":"Alan White i Yes","context_page_description":"Alan White er ein engelsk trommeslagar, kjend for arbeidet sitt i progrockbandet Yes. White var òg medlem av Plastic Ono Band, og spelte på konserten med bandet i 1969 i Toronto Rock and Roll Revival, som vart spelt inn og gjeven ut tre månader seinare som Live Peace in Toronto 1969. I alt har White spelt på over femti album med artistar som John Lennon, George Harrison, Joe Cocker, Ginger Baker og The Ventures.\\nWhite byrja som seksåring å spele piano, og bytte seinare til trommar og spelte offentleg for første gongen som 13-åring. På 1960-talet spelte han i mange band, og vart ofte brukt som studiomusikar. Den første smaken hans av suksess kom i 1967 saman med The Alan Price Set, og i 1968 då han vart med i Ginger Baker's Airforce."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%AC%D5%B8%D5%BE%D5%A4%D5%AB%D5%BE%D5%AB_%D6%84%D5%A1%D5%B2%D5%A1%D6%84%D5%A1%D5%BA%D5%A5%D5%BF%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/BASA_Regional_State_Archives_Directorate_Plovdiv_Ivan_Kesyakov_not_classified.jpg","page_title":"Պլովդիվի քաղաքապետերի ցանկ","context_page_description":"Պլովդիվի քաղաքապետերի ցանկում ներկայացված է Բուլղարիայի՝ մեծությամբ երկրորդ քաղաք Պլովդիվի ղեկավարների ցանկը սկսած 1878 թվականից, երբ հիմնադրվել է այդ պաշտոնը Բուլղարիայի անկախացումից հետո։"},{"page_url":"https://zh.wikipedia.org/zh-my/%E3%80%8C%E5%8F%8D%E5%B0%8D%E4%BF%AE%E8%A8%82%E5%BC%95%E6%B8%A1%E6%A2%9D%E4%BE%8B%E3%80%8D%E9%81%8A%E8%A1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/%E9%A6%99%E6%B8%AF%E6%B0%91%E9%99%A3%E6%8C%8712%2C000%E4%BA%BA%E5%8F%83%E8%88%87_%E5%8F%8D%E4%BF%AE%E8%A8%82%E5%BC%95%E6%B8%A1%E6%A2%9D%E4%BE%8B%E9%81%8A%E8%A1%8C_06.jpg","page_title":"「反對修訂引渡條例」遊行","context_page_description":"2019年3月31日香港反对逃犯条例修订草案游行，是民间人权阵线在2019年3月31日举行的第一次反对逃犯条例修订草案公众游行，亦为反对逃犯条例修订草案运动各场公众行动中的第一场公众行动。由湾仔卢押道去金钟公民广场。这次游行主办单位宣称有1.2万人参加，警方表示高峰期有5,200人。是次游行亦象征著反对逃犯条例修订草案运动的开始。"},{"page_url":"https://es.wikipedia.org/wiki/Jan_Kalivoda","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Kalivoda.jpg","page_title":"Jan Kalivoda","context_page_description":"Johannes Wenzeslaus Kalliwoda, más conocido cómo Jan Kalivoda fue un compositor, violinista y director de orquesta checo."},{"page_url":"https://pl.wikipedia.org/wiki/G%C3%B3rka_Prudnicka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/2011-07_Ernestinenberg_04.jpg","page_title":"Górka Prudnicka","context_page_description":"Górka Prudnicka – wieś w Polsce, położona w województwie opolskim, w powiecie prudnickim, w gminie Biała. Historycznie leży na Górnym Śląsku, na ziemi prudnickiej. Położona jest na terenie Kotliny Raciborskiej, będącej częścią Niziny Śląskiej.\\nW latach 1975–1998 miejscowość należała administracyjnie do ówczesnego województwa opolskiego.\\nWedług danych na 2011 wieś była zamieszkana przez 211 osób."},{"page_url":"https://sh.wikipedia.org/wiki/Catwoman","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Eartha_Kitt_Catwoman_Batman_1967.JPG","page_title":"Catwoman","context_page_description":"Catwoman je fiktivni, stripovski lik koji se pojavljuje u izdanjima DC Comicsa, a mahom u materijalima povezanim s Batmanom. U početku superzlikovac, a danas mahom antiheroina i Batmanova saveznica, Catwoman su stvorili Bob Kane i Bill Finger, crpeći inspiraciju iz Kaneove rođakinje Ruth Steel te glumice Jean Harlow. Catwoman je nastala kako bi se serijalu dodao seksualni naboj, ali i kako bi privukla ženske čitatelje, što je razlog zašto je njezin lik, iako isprva negativac, drastično drugačiji od likova poput Jokera te zašto ima specifičan odnos s Batmanom. Iako ne i jedina, najpoznatija Catwoman svakako je Selina Kyle, koja se premijerno pojavila u stripu Batman #1 pod imenom The Cat. U tom se stripu pojavljuje kao pljačkašica s bičem kojoj poseban užitak predstavljaju pljačke visokog rizika."},{"page_url":"https://en.wikipedia.org/wiki/Frocking","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Frocking_ceremony_on_board_the_USS_Peleliu_%28LHA_5%29.jpg","page_title":"Frocking","context_page_description":"In the United States military, frocking is the practice of a commissioned or non-commissioned officer selected for promotion wearing the insignia of the higher grade before the official date of promotion. An officer who has been selected for promotion may be authorized to \\"frock\\" to the next grade.\\nThe need to frock is a result of the fact that the number of people who may serve in a particular rank is restricted by federal law. Thus, even though an individual may have been selected for promotion and, for officers, confirmed by the Senate, they must often wait for a vacancy to occur in order to be officially promoted.\\nFrocking customs and policies vary across military services, particularly for enlisted members. In the United States Army a general officer may request authority to frock soldiers of his command. In the United States Air Force, only senior field grade and general officers are usually frocked. The United States Navy makes use of frocking much more frequently than do the Army and the Air Force."},{"page_url":"https://it.wikipedia.org/wiki/Nazionale_di_calcio_della_Slovacchia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Slovakia_national_team_2010.jpg","page_title":"Nazionale di calcio della Slovacchia","context_page_description":"La nazionale di calcio della Slovacchia è la rappresentativa calcistica della Slovacchia ed è posta sotto l'egida della Federazione calcistica della Slovacchia.\\nNacque nel 1993 insieme alla nazionale di calcio della Repubblica Ceca in seguito alla scissione della Cecoslovacchia, che portò alla scomparsa della nazionale di calcio della Cecoslovacchia. Conta una partecipazione alla fase finale di un mondiale, competizione in cui ha raggiunto gli ottavi di finale a Sudafrica 2010, e una partecipazione alla fase finale di un europeo, manifestazione in cui ha raggiunto gli ottavi di finale a Francia 2016. La tradizionale rivale della Slovacchia è la Rep. Ceca, che ha affrontato nei gironi di qualificazione al campionato del mondo 1998, al campionato d'Europa 2008 e al campionato del mondo 2010.\\nNella classifica mondiale della FIFA, istituita nell'agosto 1993, la Slovacchia vanta quale miglior piazzamento il 14º posto dell'agosto 2015, mentre il peggior piazzamento è il 150º posto del dicembre 1993. Attualmente occupa la 32ª posizione della graduatoria."},{"page_url":"https://es.wikipedia.org/wiki/Michelangelo_Cerquozzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Ni%C3%B1os_cogiendo_fruta_%28Cerquozzi%29.jpg","page_title":"Michelangelo Cerquozzi","context_page_description":"Michelangelo Cerquozzi, llamado Michelangelo delle Battaglie, fue un pintor barroco italiano, especializado en escenas populares minuciosamente descritas."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_du_patrimoine_immobilier_du_Bas-Saint-Laurent","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Chapelle_de_Notre-Dame-des-Murailles_01.jpg","page_title":"Liste du patrimoine immobilier du Bas-Saint-Laurent","context_page_description":"Cette liste recense les biens du patrimoine immobilier du Bas-Saint-Laurent inscrits au répertoire du patrimoine culturel du Québec. Cette liste est divisée par municipalité régionale de comté géographique."},{"page_url":"https://sv.wikipedia.org/wiki/Fothergilla_gardenii","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Fothergilla_gardenii_%282013%29.JPG","page_title":"Fothergilla gardenii","context_page_description":"Fothergilla gardenii är en växtart som beskrevs av Johan Andreas Murray. Fothergilla gardenii ingår i släktet Fothergilla och familjen trollhasselväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Kraszewice_(wojew%C3%B3dztwo_wielkopolskie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ko%C5%9Bci%C3%B3%C5%82_w_Kraszewicach.JPG","page_title":"Kraszewice (województwo wielkopolskie)","context_page_description":"Kraszewice – wieś w południowej części województwa wielkopolskiego, w powiecie ostrzeszowskim, w gminie Kraszewice."},{"page_url":"https://pt.wikipedia.org/wiki/Monte_Odin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Mount_Odin_snow_and_ice.jpg","page_title":"Monte Odin","context_page_description":"O Pico Outlook é uma montanha na região de Qikiqtaaluk, Nunavut, Canadá, a mais alta da Ilha de Baffin, com 2147 m de altitude. Está integrada no Parque Nacional Auyuittuq, junto ao passo Akshayuk, 46 km a norte de Pangnirtung e a sul do monte Asgard.\\nO monte Odin é a mais alta montanha dos montes Baffin e a 5.ª mais alta da cordilheira Ártica."},{"page_url":"https://es.wikipedia.org/wiki/Aphyosemion_splendopleure","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Aphyosemion_splendopleure_%27Tiko_green%27_Female.png","page_title":"Aphyosemion splendopleure","context_page_description":"Aphyosemion splendopleure, ​ es una especie de pez de agua dulce actinopterigio.​\\nEs codiciado por su belleza para su comercialización en acuariofilia, si bien es muy difícil de mantener en acuario.​"},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%B1%D8%A7%D9%83%D8%B2_%D9%85%D8%AD%D8%A7%D9%81%D8%B8%D8%A7%D8%AA_%D9%85%D8%B5%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/%D9%85%D8%B1%D9%83%D8%B2_%D8%A3%D8%B1%D9%85%D9%86%D8%AA.png","page_title":"مراكز محافظات مصر","context_page_description":"تضم محافظة الجيزة 9 مراكز."},{"page_url":"https://et.wikipedia.org/wiki/L%C3%A4%C3%A4ne-Austraalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/WAGovernmentHouse1crop_gobeirne.JPG","page_title":"Lääne-Austraalia","context_page_description":"Lääne-Austraalia on Austraalia suurim osariik. See hõlmab riigi ja Austraalia mandri läänepoolse kolmandiku. Osariik piirneb põhjas, läänes ja lõunas India ookeaniga, kirdes Põhjaterritooriumiga ning kagus Lõuna-Austraalia osariigiga. Lääne-Austraalia lõunarannikut uhub India ookeani osa Suur Austraalia laht.\\nOsariik on Sahha järel pindalalt teine 1. järgu haldusüksus maailmas. Lääne-Austraalia on näiteks Rootsist umbes kuus ja Eestist 60 korda suurem.\\nSeal elab ligikaudu 2,3 miljonit inimest, enamik neist osariigi edelanurgas Edelapiirkonnas.\\nLääne-Austraalia levinumad hüüdnimed on Wildflower State ja Golden State, Lääne-Austraalia elanikke hüütakse Sandgroper'iteks ehk liivauuristajateks.\\nEsimene Lääne-Austraaliasse jõudnud eurooplane oli Hollandi maadeuurija Dirk Hartog, kes maabus 1616. aastal Austraalia läänerannikule. 1826. aastal rajasid britid Kuningas George'i lahe äärde tänapäeva Albany lähedale sõjaväe eelposti. 1829. aastal rajati Swani jõe suudmesse koloonia Swan River Colony, millest kujunes hiljem osariigi pealinn Perth.\\nPerth on sageli sihtkohaks Eesti noortele, kes lähevad Austraaliasse töö- ja puhkeviisaga."},{"page_url":"https://nv.wikipedia.org/wiki/M%C3%A1g%C3%AD_Bitsee%CA%BC_Nood%C7%AB%CC%81z%C3%AD_Bik%C3%A9yahd%C4%99%CC%81%C4%99%CC%81%CA%BC_tsinyi%CA%BC_ch%CA%BCa%C5%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Gephyromantis_salegy03.jpg","page_title":"Mágí Bitseeʼ Noodǫ́zí Bikéyahdę́ę́ʼ tsinyiʼ chʼał","context_page_description":"Mágí Bitseeʼ Noodǫ́zí Bikéyahdę́ę́ʼ tsinyiʼ chʼał éí chʼał íiyisígíí dah yikahjí atah daasdzoh, áádóó éí Mágí Bitseeʼ Noodǫ́zí Bikéyahdi tʼéiyá dahólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Gephyromantis\\" deiłníigo deiyózhí. Mágí Bitseeʼ Noodǫ́zí Bikéyahdę́ę́ʼ tsinyiʼ chʼał éí 47 ałʼąą ádaatʼé.\\nDíí chʼał éí 0.7–1.5di asdzoh ádaníłtso łeh. Bitsʼíís éí dinilzhin dóó yishtłizhgo naashchʼąąʼ łeh.\\nMágí Bitseeʼ Noodǫ́zí Bikéyahdę́ę́ʼ tsinyiʼ chʼał éí chʼosh yázhí dóó wóʼałtaasʼéí deildeeł; chʼil bitʼąąʼ łaʼ dóó tąądee naagháhii éí bichʼiyąʼ ałdóʼ."},{"page_url":"https://ca.wikipedia.org/wiki/Sant_Vicen%C3%A7_de_Jonqueres","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Porta_de_la_esgl%C3%A9sia.jpg","page_title":"Sant Vicenç de Jonqueres","context_page_description":"Sant Vicenç de Jonqueres és una església catalogada com a monument del municipi de Sabadell inclosa en l'Inventari del Patrimoni Arquitectònic de Catalunya.\\nEl conjunt està format per l'edifici de l'església, la rectoria adossada pel costat de ponent, la sagristia, el campanar i el clos del cementiri pel costat de llevant i migdia. La rectoria la porten uns masovers i la planta baixa està destinada a un taller de restauració de mobles i a un restaurant. Des de l'any 1995, l'antiga església s'ha convertit en la seu del Servei General d'Informació de Muntanya."},{"page_url":"https://vi.wikipedia.org/wiki/Ballota_acetabulosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Ballota_acetabulosa_by_Nick.JPG","page_title":"Ballota acetabulosa","context_page_description":"Ballota acetabulosa là một loài thực vật có hoa trong họ Hoa môi. Loài này được Benth. mô tả khoa học đầu tiên năm 1834."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A8%E3%83%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/P5393_Guernica_Gernikako_Arbola_Tregenza.jpg","page_title":"フエロ","context_page_description":"フエロは、中世から19世紀のスペインにおいて、習慣や慣習に由来する社会的慣行が法的価値を持つようになった規範、または国王などの統治者が所与の領域を治めるに際して当該領域やその住民に譲与した特権のこと。ブルボン朝以後のフエロは後者を指した。日本語では地方特権、地方特殊法、地方特別法、地域特別法などと訳されるが、訳語は定まっていない。ラテン語のフォルムに由来し、カタルーニャ語ではフル、ガリシア語ではフォロ、バスク語ではフォルと呼ばれる。\\nカスティーリャ王国・スペイン帝国においてはほとんどの町や共同体がフエロの諸特権を享受し、国王の受け入れがたい行動や命令に抗うための地方の防御策がフエロだった。フエロの維持はカスティーリャ王国・スペイン帝国の安定や一体化に重要な役割を果たしており、1707年にスペイン帝国がアラゴン王国とバレンシア王国のフエロを廃止した際には、スペイン帝国内部のアラゴン連合王国諸国とつながりの深い貴族集団から抗議の声が上がったほどだった。特にバスク地方のフエロが有名であるため、ここではバスク地方のフエロについて述べる。バスク地方のフエロは中世後期以後に編纂され、15世紀から17世紀にかけて法典化されたが、第一次カルリスタ戦争後の1839年に縮小され、第三次カルリスタ戦争後の1876年に撤廃された。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1982","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Leon_Britton.jpg","page_title":"Lijst van personen geboren in 1982","context_page_description":"Dit is een lijst van personen die geboren zijn in 1982.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%B0%D1%81%D1%83%D1%82%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/KamaSutra06.jpg","page_title":"Камасутра","context_page_description":"Камасутра — індійський еротичний трактат, написаний лікарем Ватсьяяною за мотивами скульптурних зображень храму «Чорна пагода». Історики вважають, що вона складена між 400 р. до н. е. і 200 р. н. е. Є одною із Кама-шастр, трактатів про чуттєву насолоду. Індійський філософ Канкара написав коментар до «Камасутри». Зміст їх було викладено англійським вченим Ауфрехтом в Оксфорді в 1859 р. у книзі «Каталог любові». Відтоді книга неодноразово перевидавалася.\\nНазва походить від кама — насолода, утіха, та сутра — збірка, трактат. Не слід плутати із Карма-сутрою, буддійським трактатом про карму. Хоча широко відома як вузько сексуальний твір, насправді містить в собі настанови щодо правильного отримання та переживання насолоди; має під собою ґрунтовні філософські та релігійні підвалини."},{"page_url":"https://en.wikipedia.org/wiki/Corymbia_grandifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Corymbia_grandifolia.jpg","page_title":"Corymbia grandifolia","context_page_description":"Corymbia grandifolia, commonly known as the cabbage gum, large-leaved cabbage gum and the paper-fruited bloodwood, is a species of tree that is endemic to northern Australia. It has smooth bark, egg-shaped to broadly elliptic to lance-shaped adult leaves, flowers buds in groups of three or seven, creamy white flowers and cup-shaped to cylindrical fruit."},{"page_url":"https://ceb.wikipedia.org/wiki/Platambus_maculatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Platambus_maculatus.jpg","page_title":"Platambus maculatus","context_page_description":"Espesye sa bakukang nga una nga gihulagway ni Linnaeus ni adtong 1758 ang Platambus maculatus. Ang Platambus maculatus sakop sa kahenera nga Platambus sa kabanay nga Dytiscidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://en.wikipedia.org/wiki/V_sign","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Robbie_paparazzi_V_sign.jpg","page_title":"V sign","context_page_description":"The V sign is a hand gesture in which the index and middle fingers are raised and parted to make a V shape while the other fingers are clenched. It has various meanings, depending on the circumstances and how it is presented.\\nWhen displayed with the palm inward toward the signer, it can be an offensive gesture in some Commonwealth nations, dating back to at least 1900. The more widespread use as a victory sign, with the back of the hand toward the signer, was introduced in January 1941 as part of a campaign by the Allies of World War II. During the Vietnam War, in the 1960s, the \\"V sign\\" was widely adopted by the counterculture as a symbol of peace. Shortly thereafter, it also became a gesture associated with fun used in photographs, especially in East Asia, where the gesture is also associated with cuteness."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%B1%D8%AA%D9%8A%D9%86_%D9%87%D8%A7%D9%85%D9%8A%D8%B1%D9%8A%D8%AA%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Martin_Hammerich.jpg","page_title":"مارتين هاميريتش","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمارتين هاميريتش كان صحفى من دنمارك."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A6%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%83%D1%80%D0%B3%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Crimea_Kerch_Tsar%27s_barrow-07.jpg","page_title":"Царский курган","context_page_description":"Ца́рский курга́н — памятник античной архитектуры второй половины IV века до н. э., усыпальница одного из правителей династии Спартокидов, правивших Боспорским царством в 438—109 гг. до н. э. Склеп был полностью разграблен ещё в древности.\\nРасположен в Керчи, у посёлка Аджи-Мушкай вблизи от Аджимушкайских каменоломен. Курган входит в состав Восточно-Крымского историко-культурного музея-заповедника. В Российской Федерации, контролирующей спорную территорию Крыма, является объектом культурного наследия федерального значения, на Украине, в пределах международно признанных границ которой находится спорная территория, — памятником культурного наследия национального значения."},{"page_url":"https://de.wikipedia.org/wiki/Kirkgunzeon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Kirkgunzeon_-_geograph.org.uk_-_879397.jpg","page_title":"Kirkgunzeon","context_page_description":"Kirkgunzeon ist eine Ortschaft in der schottischen Council Area Dumfries and Galloway beziehungsweise der traditionellen Grafschaft Kirkcudbrightshire. Sie liegt rund neun Kilometer nordöstlich von Castle Douglas und zwölf Kilometer südwestlich von Dumfries am rechten Ufer des Baches Kirkgunzeon Lane."},{"page_url":"https://nl.wikipedia.org/wiki/Zytek","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Gordon_Murray_Design_T.27_RAC_Future_Car_Challenge_1.jpg","page_title":"Zytek","context_page_description":"Zytek is een Brits bedrijf in de automobiel-industrie, opgericht in 1981. Het bedrijf heeft twee onderdelen, Zytek Automotive, dat is gevestigd in Fradley, Staffordshire en Zytek Engineering, in Repton, Derbyshire."},{"page_url":"https://en.wikipedia.org/wiki/Chris_Hardwick","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/ChrisHardwickJul2011.jpg","page_title":"Chris Hardwick","context_page_description":"Christopher Ryan Hardwick is an American stand-up comedian, actor, television and podcast host, writer, and producer. He hosts Talking Dead, an hourly aftershow on AMC affiliated with the network's zombie drama series The Walking Dead and Fear the Walking Dead, as well as Talking with Chris Hardwick, a show in which Hardwick interviews prominent pop culture figures, and The Wall, a plinko-inspired gameshow on NBC. Hardwick created Nerdist Industries, operator of the Nerdist Podcast Network and home of his podcast The Nerdist Podcast, which later left the network and was renamed to ID10T with Chris Hardwick. His podcast has broadcast 1,000 episodes as of December 2019.\\nHardwick originated the role of Stacee Jaxx in Rock of Ages during its premiere run in Los Angeles. In 2011, he began hosting the BBC America Britcom block Ministry of Laughs. From 2013 to 2017, he hosted @midnight with Chris Hardwick, a nightly comedy-game show series on Comedy Central. In 2013, he hosted Talking Bad, a live half-hour talk show on AMC following the final eight episodes of Breaking Bad. In 2016, he started to host Talking Saul for the Breaking Bad spin-off Better Call Saul."},{"page_url":"https://fi.wikipedia.org/wiki/Israelin_ilmavoimat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/F-16Isufa001.jpg","page_title":"Israelin ilmavoimat","context_page_description":"Israelin ilmavoimat on osa Israelin puolustusvoimia. Sillä on käytössään noin tuhat lentokonetta ja sen nykyinen komentaja on Amir Eshel."},{"page_url":"https://pl.wikipedia.org/wiki/Flisakowate","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Brychius_elevatus_%28Panzer%2C_1794%29.jpg","page_title":"Flisakowate","context_page_description":"Flisakowate – rodzina drobnych, wodnych chrząszczy z podrzędu drapieżnych, należąca do Hydradephaga."},{"page_url":"https://en.wikipedia.org/wiki/Yim_Tin_Tsai_(Sai_Kung_District)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Abandoned_Salt_Farm_in_Yim_Tin_Tsai.JPG","page_title":"Yim Tin Tsai (Sai Kung District)","context_page_description":"Yim Tin Tsai is a small offshore island in Sai Kung District, Hong Kong. As of 2013 there is at least one person living on the island again after a long absence of a permanent population."},{"page_url":"https://fr.wikipedia.org/wiki/Georges_Eekhoud","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Georges_Eekhoud_%281854-1927%29.jpg","page_title":"Georges Eekhoud","context_page_description":"Georges Eekhoud, né le 27 mai 1854 à Anvers et mort le 29 mai 1927 à Schaerbeek, est un écrivain francophone, homosexuel et anarchiste belge.\\nEn 1899, il publia Escal-Vigor au Mercure de France, un des premiers romans modernes qui traite de l'homosexualité. Le livre fit scandale et il fut poursuivi. Plusieurs écrivains de renom prirent position en faveur de l'auteur. Un procès à huis clos eut lieu, qui se termina par l'acquittement de l'écrivain.\\nFlamand par la naissance et l'ascendance, il reçut, comme Maurice Maeterlinck, Émile Verhaeren ou Georges Rodenbach, une éducation francophone. Il ne renia jamais intimement son origine flamande. Il choisit d'écrire en français parce que la littérature qui s'écrivait dans cette langue, en Belgique, à l'époque, était la littérature prestigieuse, mais il écrivit, pour des raisons économiques, des romans populaires en néerlandais sous pseudonyme et il collabora à la presse flamande, sous son nom."},{"page_url":"https://de.wikipedia.org/wiki/Liste_bekannter_Leib%C3%A4rzte","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Siegmund_Albich.jpg","page_title":"Liste bekannter Leibärzte","context_page_description":"Leibärzte befanden sich schon seit der Antike in einer hervorgehobenen und verantwortungsvollen Position. Sie waren aber nicht immer nur für das Wohlergehen ihrer Anvertrauten zuständig, sondern beeinflussten durch ihre Sonderposition so manches Mal auch die Tages-, Gesellschafts- oder Familienpolitik. Auch an Intrigen waren sie nicht immer unbeteiligt, und manchen haftete gar der Vorwurf eines Giftmordes an. Die Leibärzte wurden meist hoch dotiert und geehrt, aber im negativen Fall durchaus auch mit Entlassung, Verbannung, Kerkerhaft, Folter, Verstümmelung oder dem Tode bestraft. Dabei gab es fallweise auch den einen oder anderen Scharlatan unter ihnen. Ab dem Spätmittelalter übernahmen aber dann meist höchst qualifizierte und vielseitig ausgebildete Persönlichkeiten diese Position."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%B8%D0%B1%D0%BE%D1%80%D1%87%D0%B8%D0%B9_%D0%BE%D0%BA%D1%80%D1%83%D0%B3_13","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Mykola_Katerynchuk_-_2014_%28cropped%29.jpg","page_title":"Виборчий округ 13","context_page_description":"Виборчий округ 13 — виборчий округ у Вінницькій області. В сучасному вигляді був утворений 28 квітня 2012 постановою ЦВК №82. Окружна виборча комісія цього округу розташовується в Калинівському районному будинку культури за адресою м. Калинівка, вул. Нестерчука, 22.\\nДо складу округу входять міста Козятин і Хмільник, а також Калинівський, Козятинський і Хмільницький райони. Виборчий округ 13 межує з округом 67 на північному заході, з округом 63 на північному сході, з округом 18 на південному сході, з округом 11 і округом 12 на півдні, з округом 14 на південному заході та з округом 191 на заході. Виборчий округ №13 складається з виборчих дільниць під номерами 050375-050442, 050444-050472, 050474-050508, 051210-051274, 051276-051284, 051608-051623 та 051656-051668."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%AA%DB%8C%D9%85_%D8%B1%D8%A7%D8%A8%DB%8C%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/TimRobbinsTIFFSept2012.jpg","page_title":"تیم رابینز","context_page_description":"تیم رابینز آمریکالی فیلمین سناریو یازاری, فیلم یؤنئتمنی, فیلم یاپیمجی‌سی, موسیقی‌چی و اوْیونچو. ۱۶ اوْکتوبر ۱۹۵۸ ‏ ایلینده کالیفورنیا ایالتینده دۆنیایا گؤز آچیب. 1982–گۆنوموز ایللر آراسیندا سینما ساحه‌سینده چالیشیب."},{"page_url":"https://en.wikipedia.org/wiki/1992_Pacific_hurricane_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Darby_1992-07-05_2000Z.png","page_title":"1992 Pacific hurricane season","context_page_description":"The 1992 Pacific hurricane season is the most active Pacific hurricane season on record, featuring 27 named storms, and the second-costliest Pacific hurricane season in history, behind the 2013 season. The season also produced the second-highest ACE value on record in the basin, only surpassed by the 2018 season. The season officially started on May 15 in the eastern Pacific, and on June 1 in the central Pacific, and lasted until November 30. These dates conventionally delimit the period of each year when most tropical cyclones form in the northeastern Pacific Ocean. However, these bounds were easily exceeded when Hurricane Ekeka formed on January 28 and again a couple months later with Tropical Storm Hali.\\nThe most notable storm was Hurricane Iniki, which caused billions of dollars of damage to the Hawaiian Islands, primarily in Kauai, along with six casualties. Hurricanes Lester, Virgil, Winifred, and Orlene also made landfall and killed several people, but were significantly less destructive. Hurricane Darby and Tropical Storm Agatha brought rains and more destruction to Mexico, without making landfall."},{"page_url":"https://es.wikipedia.org/wiki/ATPasa_de_intercambio_hidr%C3%B3geno-potasio","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Hydrogen_potassium_ATPase.jpg","page_title":"ATPasa de intercambio hidrógeno-potasio","context_page_description":"ATPasa hidrógeno-potasio gástrica, también llamada ATPasa H+/K+, es una Proteína transportadora cuyo propósito es la acidificación del estómago."},{"page_url":"https://nl.wikipedia.org/wiki/Louisine_Havemeyer","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Woman_with_a_Towel_MET_DP253482.jpg","page_title":"Louisine Havemeyer","context_page_description":"Louisine Havemeyer, geboortenaam Louisine Waldron Elder was kunstverzamelaar, feministe en filantrope. Naast haar rol als promotor van de impressionistische kunst, leverde ze belangrijke steun aan de beweging voor vrouwenkiesrecht in de Verenigde Staten. Op het gebied van de kunst steunde ze onder meer de impressionistische schilder Edgar Degas en Alice Paul was een van de voorvechtsters van het suffragisme die op haar steun kon rekenen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%AA%E5%AD%90%E6%B2%B3%E5%8C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/ChinaLiaoyangTaizihe.png","page_title":"太子河区","context_page_description":"太子河區是遼寧省遼陽市下轄的一個市轄區。"},{"page_url":"https://pt.wikipedia.org/wiki/Esc%C3%B3pia_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/OfficeBldgMacedoniaSquare.jpg","page_title":"Escópia 2014","context_page_description":"Escópia 2014 foi um projeto financiado pelo Governo da República da Macedônia, baseado na ideologia do então partido dominante VMRO-DPMNE, com o objetivo de dar à capital, Escópia, um apelo mais clássico. O projeto, anunciado oficialmente em 2010, consistiu principalmente na construção de faculdades, museus e edifícios governamentais, bem como na construção de monumentos representando figuras históricas da região da Macedônia. Cerca de 20 edifícios e mais de 40 monumentos foram construídos como parte do projeto.\\nDe fato, este projeto político é um de construção de nações e tenta impor uma nova narrativa revisionista da história da Macedônia, promovendo a identidade macedônica, com uma continuidade ininterrupta desde a antiguidade ao longo da Idade Média até aos tempos modernos. O projeto Escópia 2014 tem sido criticado por vários grupos desde o momento em que foi anunciado pela primeira vez, sendo taxado de kitsch historicista-nacionalista. O Escópia 2014 também gerou polêmica por seu custo, para o qual as estimativas variam de 80 a 500 milhões de euros.\\nMacedonia Square before the commencement of Skopje 2014 and after the addition of many monuments and façade reconstructions"},{"page_url":"https://uk.wikipedia.org/wiki/Renault_Fuego","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Renault_Fuego_GTA_RA.jpg","page_title":"Renault Fuego","context_page_description":"Renault Fuego — легковий автомобіль з кузовом типу купе, що випускався компанією Renault з 1980 по 1992 рік. Він змінив собою купе Renault 15/17."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B4%A7%E8%BF%90%E8%88%AA%E7%A9%BA%E5%85%AC%E5%8F%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/SIA_Cargo_747_loading.jpg","page_title":"货运航空公司","context_page_description":"貨運航空公司是專門從事貨物運輸的航空公司。一些大的客運航空公司有專門從事貨運的子公司或者部門。\\n烏克蘭的安東諾夫航空在1990年代裡開始使用軍事運輸飛機進行商業運輸，從而開闢了一種新型的空運，重設計了全球物流市場。"},{"page_url":"https://de.wikipedia.org/wiki/Bammental","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Bammental-reilsheim-fw1593.jpg","page_title":"Bammental","context_page_description":"Bammental ist eine Gemeinde mit rund 6500 Einwohnern im Rhein-Neckar-Kreis in Baden-Württemberg."},{"page_url":"https://sk.wikipedia.org/wiki/Poprad","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Square_of_Poprad_4.jpg","page_title":"Poprad","context_page_description":"Poprad je okresné mesto na severe Slovenska v Prešovskom kraji. Počtom obyvateľov je najväčším mestom Spiša, tretím najväčším mestom východného Slovenska a desiatym najväčším mestom na Slovensku. Vďaka svojej polohe sa mu dostal prívlastok vstupná brána do Vysokých Tatier."},{"page_url":"https://it.wikipedia.org/wiki/Sorgeat","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Sorgeat_eg1.JPG","page_title":"Sorgeat","context_page_description":"Sorgeat è un comune francese di 99 abitanti situato nel dipartimento dell'Ariège nella regione dell'Occitania."},{"page_url":"https://es.wikipedia.org/wiki/Nishinoomote","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Nishinoomote_Kagoshima_chapter.JPG","page_title":"Nishinoomote","context_page_description":"Nishinoomote es una ciudad en la prefectura de Kagoshima, Japón, localizada en las islas Ōsumi, parte del grupo de islas Ryūkyū. Tenía una población estimada de 14 980 habitantes el 1 de octubre de 2019 y una densidad de población de 73 personas por km².​"},{"page_url":"https://es.wikipedia.org/wiki/Luis_Alberto_de_Herrera","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Monumento_L.A._de_Herrera.png","page_title":"Luis Alberto de Herrera","context_page_description":"Luis Alberto de Herrera y Quevedo fue un político, periodista e historiador uruguayo, principal caudillo del Partido Nacional durante más de 50 años. Fue una de las principales figuras políticas de Uruguay en el siglo XX."},{"page_url":"https://de.wikipedia.org/wiki/Hong_Kong_Monetary_Authority","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Hong_Kong_Monetary_Authority_Reception.jpg","page_title":"Hong Kong Monetary Authority","context_page_description":"Die Hong Kong Monetary Authority, kurz HKMA, ist Hongkongs Währungsamt und de facto Hongkongs Zentralbank. Sie wurde am 1. April 1993 gegründet. Als Hauptziele nennt die HKMA das Erhalten der Währungsstabilität und Hongkongs Status als internationales Finanzzentrum, die Förderung der Stabilität des Finanzsystems und die Verwaltung des Exchange Fund, ein Fonds mit Währungsreserven. Als geldpolitische Institution gibt Hongkongs Währungsamt die HKMA keine Banknoten heraus. Diese Aufgaben, das Notenprivileg, hat sie drei lokalen Banken, die Hongkong and Shanghai Banking Corporation, die Standard Chartered Bank und die Bank of China, übergeben. Eine Ausnahme macht die HKMA jedoch bei den Zehn-Hongkong-Dollar-Münzen und den selten gewordenen Zehn-Hongkong-Dollar-Scheine. Die HKMA allein gibt die Zehn-Hongkong-Dollar-Münzen heraus und behält sich das Recht vor neben den drei Handelsbanken Neuausgabe von Zehn-Hongkong-Dollar-Scheine zum besonderen Anlass zu emittieren."},{"page_url":"https://cs.wikipedia.org/wiki/Horn%C3%AD_%C3%9Ajezd_(okres_Svitavy)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Podlubn%C3%AD%C4%8Dek_opukov%C3%A9_sk%C3%A1ly.jpg","page_title":"Horní Újezd (okres Svitavy)","context_page_description":"Obec Horní Újezd se nachází v okrese Svitavy v Pardubickém kraji. Žije zde 402 obyvatel."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%95%D7%A8%D7%95_%D7%9E%D7%A0%D7%A6%27%D7%A1%D7%98%D7%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Avro_Manchester_ExCC.jpg","page_title":"אוורו מנצ'סטר","context_page_description":"אוורו 679 מנצ'סטר היה מפציץ כבד דו-מנועי מתוצרת חברת אוורו ששימש את חיל האוויר המלכותי הבריטי במחצית הראשונה של מלחמת העולם השנייה. המנצ'סטר היה לכישלון בשל מנועיו שלא ענו על הצרכים והיו בלתי-אמינים, אך נחשב לקודמו ומבשר דרכו של מפציץ האוורו לנקסטר, מהמפציצים החשובים במלחמת העולם השנייה."},{"page_url":"https://en.wikipedia.org/wiki/Jonathan_DeFelice","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Father_Jonathan_Defelice.jpg","page_title":"Jonathan DeFelice","context_page_description":"Jonathan DeFelice, O.S.B. is the former President of Saint Anselm College in Goffstown, New Hampshire. Serving the college for 24 years, Father DeFelice was the longest serving college president in the state of New Hampshire. Growing up in Bristol, Rhode Island, he graduated from Portsmouth Abbey School in 1965, and then attended Saint Anselm College, earning a bachelor's degree in Philosophy in 1969. He entered Saint Anselm Abbey as a novice in 1968, and professed solemn vows as a Benedictine monk in 1973. He was ordained a Catholic priest in 1974. Defelice was a \\"Faithful Educator\\" according to Christy Nadalin in her book, Legendary Locals of Bristol.\\nHe served a five-year term as a member of the New Hampshire Postsecondary Education Commission beginning in 1990 after being sworn in by then Gov. Judd Gregg. Under his leadership, the college sought to expand its inclusiveness efforts to attract both students and faculty of diverse backgrounds.\\nIn May 1992, The Sun Journal reported on Defelice's directive to college employees to discontinue construction contracts with the late Republican U.S. Senate candidate Hal Eckman for his pro-choice position on abortion then."},{"page_url":"https://en.wikipedia.org/wiki/Johann_Baptist_Moroder","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Grabsengel-detail.jpg","page_title":"Johann Baptist Moroder","context_page_description":"Johann Baptist Moroder was an Austrian sculptor.\\nHe mainly focused on sculptures of bigger sizes representing Christian sacred figures; nowadays his works are mainly spread in the Italian region of Alto Adige."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%88%DA%A9%D9%84%D8%A7%DB%8C_%D8%AC%D9%88%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/The_young_lawyers_1970.JPG","page_title":"وکلای جوان","context_page_description":"وکلای جوان نام یک مجموعهٔ تلویزیونی آمریکایی است که از سال ۱۹۷۰ تا ۱۹۷۱ میلادی از شبکهٔ اِی‌بی‌سی به روی آنتن رفت.\\nداستان این مجموعه دربارهٔ چند دانشجوی آرمانگرای رشتهٔ حقوق است که در «مدرسهٔ عالی حقوق بوستون» تحصیل می‌کنند و یک مرکز کمک‌رسانی مردمی به نام «دفتر وکالت محله» برپا می‌کنند تا به مردم تهی‌دست کمک کنند. از آنجا که این دانشجویان، هنوز اجازهٔ رسمیِ کار در دادگاه‌ها را ندارند، فعالیت‌هایشان را تحتِ حمایتِ و نظارتِ یک وکیلِ خبرهٔ دادگستری به نام «دیوید بارت» انجام می‌دهند.\\nاین سریال در سال ۱۹۷۱ میلادی، نامزدِ دریافتِ «جایزه گلدن گلوب بهترین هنرپیشه نقش مکملِ مرد در یک مجموعهٔ تلویزیونی» و «جایزه گلدن گلوب بهترین مجموعه تلویزیونی – درام» و همچنین «جایزهٔ تدوین‌گران سینمای آمریکا» بابت «بهترین تدوین تلویزیونی» بود.\\nمجموعهٔ تلویزیونی وکلای جوان، در سال ۱۳۵۱ خورشیدی، با دوبلهٔ فارسی از تلویزیون ملی ایران پخش شد."},{"page_url":"https://sv.wikipedia.org/wiki/Dirinon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Dirinon_%284%29.jpg","page_title":"Dirinon","context_page_description":"Dirinon är en kommun i departementet Finistère i regionen Bretagne i västra Frankrike. Kommunen ligger i kantonen Landerneau som tillhör arrondissementet Brest. År 2009 hade Dirinon 2 460 invånare."},{"page_url":"https://eu.wikipedia.org/wiki/Buruko_beheko_muskulu_laprana","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Obliquus_capitis_inferior_muscle.png","page_title":"Buruko beheko muskulu laprana","context_page_description":"Buruko beheko muskulu laprana, garondoko muskulu lapran laburren artean luzeena da. Garondoko muskulu lapranen artean aurkitzen dira buruko beheko muskulu laprana eta buruko goiko muskulu laprana."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%B1%E4%BA%AC%E3%83%9F%E3%83%83%E3%83%89%E3%82%BF%E3%82%A6%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Tokyo_Midtown_Coverway_2013.jpg","page_title":"東京ミッドタウン","context_page_description":"東京ミッドタウンは、東京都港区赤坂にある大規模複合施設である。防衛庁本庁檜町庁舎跡地の再開発事業として、2007年3月30日に開業した。管理運営者は、東京ミッドタウンマネジメント株式会社。"},{"page_url":"https://ast.wikipedia.org/wiki/Casserres","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/El_Guixar%C3%B3_-_F%C3%A0brica_2.JPG","page_title":"Casserres","context_page_description":"Casserres ye un conceyu de Cataluña perteneciente a la provincia de Barcelona, na comarca del Bergadá.\\nAsitiáu a 12 km de la capital de la contorna Berga, pol so conceyu pasen les rieres de Clarà y Merola y en cantu del so términu'l ríu Llobregat."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%98%D0%B2%D0%B0%D0%BD_%D0%A6%D0%BE%D0%BD%D1%87%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Hales_Tageev_Nikolov_Tsonchev.JPG","page_title":"Иван Цончев","context_page_description":"Иван Стефанов Цончев бил бугарски офицер, генерал-мајор. Неофицијален водач на Врховниот македонско-одрински комитет, главен организатор на Горноџумајското востание и учесник во Илинденското востание."},{"page_url":"https://fr.wikipedia.org/wiki/Los_Sauces","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Camino_a_Los_Sauces-_Ruta_R-86._Cercano_a_Trintre.JPG","page_title":"Los Sauces","context_page_description":"Los Sauces est une commune du Chili de la Province de Malleco, elle-même située dans la Région de l'Araucanie. En 2012, la population de la commune s'élevait à 7 169 habitants. La superficie de la commune est de 850 km²."},{"page_url":"https://it.wikipedia.org/wiki/M108_(astronomia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/M108map.png","page_title":"M108 (astronomia)","context_page_description":"M 108 è una galassia a spirale a circa 45 milioni di anni luce, nella costellazione dell'Orsa Maggiore, scoperta da Pierre Méchain nel 1781. Nel 2005, Scott D. Davis suggerì il nome, Galassia Surfboard, per il fatto che la sua forma ricorda quello di una tavola da surf."},{"page_url":"https://da.wikipedia.org/wiki/Karavanserai","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Izadkhvast_Caravanserai_01.jpg","page_title":"Karavanserai","context_page_description":"En karavanserai eller karavanestation er et herberg opført langs handelsruterne i Asien, Nordafrika og det sydøstlige Europa, specielt på silkevejen, i Mellemøsten ofte benævnt ved det persiske navn khan. Der findes over 1000 karavanseraier opført mellem år 900 og 1900, men de fleste er nu ruiner."},{"page_url":"https://id.wikipedia.org/wiki/Steve_Lewis_Hesketh","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Steveheskethpg2.jpg","page_title":"Steve Lewis Hesketh","context_page_description":"Steven Hesketh adalah pemain sepak bola Australia yang sekarang bermain untuk Arema Indonesia. Ia juga pernah membela Deltras Sidoarjo."},{"page_url":"https://de.wikipedia.org/wiki/Michail_Iwanowitsch_Glinka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Michael_Glinka_Litho.jpg","page_title":"Michail Iwanowitsch Glinka","context_page_description":"Michail Iwanowitsch Glinka war ein russischer Komponist. Er gilt als Schöpfer einer eigenständigen klassischen Musik Russlands."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%A1%D5%B6%D5%A3_%D5%85%D5%B8%D5%B6%D5%A3_%D4%B3%D5%B8%D6%82%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Bang_Yong-guk_at_Korea_KPOP_World_Festival_2013.jpg","page_title":"Բանգ Յոնգ Գուկ","context_page_description":"Բանգ Յոնգ Գուկ, հարավկորեացի ռեփեր, կոմպոզիտոր, պրոդյուսեր, հայտնի է բեմական Յոնգուկ անվամբ։ Հիփ-հոփ B.A.P. բոյ-բենդի անդամ է։\\nԴեբյուտը կատարել է 2007 թվականին՝ որպես «Soul Connection» խմբի անդամ «Jepp Blackman» կեղծանունով։ 2011 թվականի մարտին մասնակցել է Սոն Ջինի «Going Crazy» սինգլի ձայնագրմանը, որը հիթ դարձավ Կորեայում։ Նույն թվականի հուլիսին թողարկեց իր առաջին թվային սինգլը՝ «I Remember» անվամբ։ Նոյեմբերին համագործակցել է BEAST խմբից Զելոյի հետո, միասին թողարկել են «Never Give Up» սինգլը։ Նրա առաջին B.A.P սինգլը թողարկել է 2012 թվականի հունվարին։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%BE%D0%B7%D0%B0%D0%B2%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B4%D0%BE%D1%80%D0%BE%D0%B6%D0%BD%D0%B0%D1%8F_%D0%B2%D0%B5%D1%82%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/TGM23_cross_9_Rota_street_in_Moscow.jpg","page_title":"Электрозаводская железнодорожная ветка","context_page_description":"Электрозаво́дская железнодорожная ветка — подъездной путь Московского электролампового завода от станции МК МЖД Черкизово в историческом районе Черкизово ВАО Москвы.\\nВетка имеет длину почти 4 км. Проходит вдоль русла реки Хапиловки, заключённой впоследствии в коллектор; из-за этого трасса ветки сильно искривлена. Построена в 1927 г., была электрифицирована на напряжение 550 вольт постоянного тока вплоть до 1986 г. Таким образом, ветка являлась первой электрифицированной железной дорогой в СССР. На ветке использовались электровозы ЭП и II-КП4А. Значительная часть опор контактной сети сохранилась на ветке до настоящего времени. Электрификация была по промышленному принципу — с контактной подвеской, аналогичной трамвайной.\\nНа ветке 4 переезда:\\nчерез Окружной проезд;\\nчерез улицу Измайловский Вал;\\nчерез улицу Девятая Рота;\\nчерез Электрозаводскую улицу.\\nНа переезде через Измайловский Вал ветка пересекает трамвайные пути. Когда ветка была электрифицирована, этот переезд был единственным пересечением трамвая с электрифицированной линией в Москве, поскольку пересечение трамвайной линии и железной дороги с железнодорожной электрификацией невозможно из-за разной высоты подвески."},{"page_url":"https://nl.wikipedia.org/wiki/Sacristie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Bilbao_-_San_Vicente_de_Abando%2C_Sacristia_1.JPG","page_title":"Sacristie","context_page_description":"De sacristie is het vertrek in een kerk waar zowel het liturgisch vaatwerk als het liturgisch textiel bewaard worden. Het wordt ook gebruikt als kleedkamer voor de celebrant en diens assistenten."},{"page_url":"https://eu.wikipedia.org/wiki/Langenwolschendorf","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Wappen_Langenwolschendorf.png","page_title":"Langenwolschendorf","context_page_description":"Langenwolschendorf Alemaniako udalerria da. Turingia estatuan kokatuta dago, Greiz barrutian. 2014an 864 biztanle zituen 6,79 kilometro koadrotan banatuta."},{"page_url":"https://no.wikipedia.org/wiki/%C3%85sane_Folkeh%C3%B8gskole","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Suraksha_plaque.JPG","page_title":"Åsane Folkehøgskole","context_page_description":"Åsane folkehøgskole er en frilynt folkehøgskole som ligger i bydelen Åsane i Bergen. Skolen har omtrentlig 100 elever på hovedlinjene, og arrangerer også en rekke korte kurs. Skolen ble bygget i 1966 og det ble i 2000-årene gjennomført kraftig rehabilitering av bygningsmassen ved skolen. Eiere er IOGT i Norge."},{"page_url":"https://fr.wikipedia.org/wiki/Harold_Cooper","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Harry_Lennix_by_Gage_Skidmore.jpg","page_title":"Harold Cooper","context_page_description":"Harold Cooper est un personnage de fiction apparaissant dans la série télévisée The Blacklist, créée par Jon Bokenkamp et diffusée sur la chaîne NBC depuis 2013. Il est interprété par l'acteur Harry Lennix, doublé par Thierry Desroses dans la version française.\\nDans le quatrième épisode de la septième saison, Kuwait, Ruffin Prentiss interprète Cooper jeune."},{"page_url":"https://ro.wikipedia.org/wiki/Parcul_Na%C8%9Bional_Bia%C5%82owieski","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Zubro%C5%88.png","page_title":"Parcul Național Białowieski","context_page_description":"Parcul Național Białowieski este o arie protejată ce corespunde categoriei a II-a IUCN, situată pe teritoriul administrativ voievodatului Podlasia din Polonia, la frontiera cu Belarus. Acest parc național reprezintă porțiunea poloneză din Pădurea Białowieża, un areal natural întins pe teritoriile Poloniei și Belarusului vecin inclus în întregimea sa în Patrimoniul Mondial UNESCO."},{"page_url":"https://en.wikipedia.org/wiki/Squares_in_London","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Addington_Square_SE5_-_geograph.org.uk_-_165917.jpg","page_title":"Squares in London","context_page_description":"Squares have long been a feature of London and come in numerous identifiable forms. The landscaping spectrum of squares stretches from those with more hardscape, constituting town squares —to those with communal gardens, for which London is a major international exponent, known as garden squares.\\nA few in the capital of the United Kingdom, such as Trafalgar Square, began as public open spaces in the same way as other city squares worldwide, typically a plaza, piazza and a platz in Spain, Italy and Germany. Most, however, began as garden squares i.e. private communal gardens for the inhabitants of surrounding houses. All types of the space are more prevalent in parts of London with high density. Some of these gardens are now open to the public, while others, for example around Notting Hill, are railed and private.\\nThe terminology has been loosely applied for over a century. Some \\"squares\\" are irregularly shaped—including five triangles, a pentagon, hexagon, octagon, and two ovals among those officially named Square."}]`),T={name:"App",components:{PoemCard:P},data(){return{searchQuery:"",visibleCount:4,poemsData:M,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},G={class:"card-container"},I